NULL,143,NULL,NULL,NULL,NULL,NULL,1182,NULL,1209,NULL,'A user cannot open a new tab from the tree in the document view which is odd. i see no reason why this basic web functionality shouldn\'t work from the tree. it would enhance a users experiece of using our services if this could be enabled.',NULL,NULL,NULL,NULL,NULL,0,'',NULL,'Whittingham Ridell',NULL,'WHIT5109'),(191,1,NULL,NULL,'I find it difficult to find sections of legislation when browsing the yellow tax handbook as it doesn\'t show the section range - just the part number.',NULL,NULL,85,NULL,143,NULL,1158,NULL,NULL,NULL,1182,NULL,1209,NULL,'The yellow TH lists legislation differently to the main UK stats dbase which does list by section range alongside the leg part number. Tax practitioners much prefer the yellow as a source of legislation. \r\n\r\nit would enhance tax users experience in using our srvices if this editorial change could be made.',NULL,NULL,NULL,NULL,NULL,0,'David Smith','2010-08-12','Turner Peachey',NULL,'TURN5026'),(201,1,2463,0,'fsafasfasfasfasfasfas',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,0,'NM Test 22','2010-08-12','CHARTWELL & SADLERS',1735,''),(211,1,9956,0,'Testing Testing 123',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,0,'NM Report Test 123','2010-08-12','RADCLIFFESLEBRASSEUR',1165,''),(221,1,13119,576,'Tetsing testing 123',26,NULL,90,NULL,NULL,NULL,NULL,NULL,1177,NULL,1183,NULL,1215,NULL,'',NULL,NULL,NULL,NULL,NULL,0,'Natasha Miller','2010-08-12','CLIFFORD CHANCE',224,'ACLI5000'),(231,1,13119,0,'sdsd',24,NULL,NULL,NULL,162,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'sdsd',NULL,NULL,NULL,NULL,NULL,0,'sdsd','2010-08-12','CLIFFORD CHANCE',224,''),(241,1,NULL,0,'Lawtel  have recently rolled out a new functionality called Pending Actions which enables all documents submitted to the High Court to be tracked by Lawtel which means users can follow proceedings from start to finish. Lawtel state that Pending Actions is the only place you can search and track an action before it goes to court.',43,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,0,'biall','2010-08-13','no',NULL,''),(251,1,NULL,NULL,'PLC rocks',51,NULL,93,NULL,150,NULL,1162,NULL,NULL,NULL,1180,NULL,1209,NULL,'',NULL,NULL,NULL,NULL,NULL,0,'a salesperson','2010-08-13','lawyers r us',NULL,'none'),(261,1,NULL,0,'Solicitors Regulation Authority will be rewriting the Code of Conduct  - making wholesale changes. The proposed rules are out for consultation until the end of the summer 2010. By Sept 10 the position as to their potential impact will be clearer.',NULL,NULL,NULL,NULL,171,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1209,NULL,'Supports development of Professional Regulation content (print and online) if there is to be a wholesale revision of the professional rules.',NULL,NULL,NULL,NULL,NULL,0,'Helen Redding','2010-08-13','Knight & Sons',NULL,''),(271,1,NULL,0,'Feedback on prospect of a new edition of Mustill & Boyd: Commercial Arbitration - Absolutely, yes. Brand is key. Know Mustill but dont know Boyd. Its the go-to book. Doesnt matter who writes it as long as it is done as well as it has been in the past. Its better than Redfern & Hunter. Will be in demand from the hardcore arbitration lawyers across the world.',49,NULL,NULL,NULL,162,NULL,1160,NULL,NULL,NULL,NULL,NULL,1209,NULL,'Positive feedback on the prospect of a new edition despite the time lapsed since the last edition and the strong competition on the market.',NULL,NULL,NULL,NULL,NULL,0,'Helen Redding','2010-08-13','Spenser Underhill Newmark LLP',NULL,''),(281,1,NULL,0,'Juris has a wide range of publications, some of which fall into the category of guides akin to what you are planning, some are journals, others are conference papers. Truthfully, an online product with this material on it would be nice to have, but www.kluwerarbitration.com is the must have. Kluwers website is not that easy to use and searching does prove frustrating from time to time, but it is the must have.',NULL,NULL,85,NULL,162,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1209,NULL,'Highlights strength of the competition in the online international arbitration market.',NULL,NULL,NULL,NULL,NULL,0,'Helen Redding','2010-08-13','Brick Court Chambers',NULL,''),(291,1,0,36395,'Customer concerned in B&F PA around level of risk due to out of date internal biz devt docs.',NULL,NULL,84,NULL,168,NULL,NULL,NULL,NULL,NULL,1179,NULL,1210,NULL,'LexisCheck opportunity',NULL,NULL,NULL,NULL,NULL,0,'Alex Sage','2010-08-16','',0,'CLIF5140'),(301,1,9467,0,'Visited customer & has been chased for debt not owed.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1212,NULL,'Need to get AR to review / reconcile acct & call customer to resolve query.',NULL,NULL,NULL,NULL,NULL,0,'Alex Sage','2010-08-16','PENGELLY & RYLANDS',1018,''),(311,1,NULL,0,'Whilst on a sales call with the knowledge manager / in response to PSL propostion uncovered the fact that PLC provide bulk content feed into an internal customer CMS search-able with internal content in order to meet their practical guidance needs.',47,NULL,87,NULL,NULL,NULL,1162,NULL,NULL,NULL,1185,NULL,1210,NULL,'Will need a different PLC proposition / offer at the top end of large law to meet this customer obstacle.  Potential product implication in that do we need to develop a bulk content offer?',NULL,NULL,NULL,NULL,NULL,0,'Alex Sage','2010-08-16','Irwin Mitchell',NULL,''),(321,1,NULL,NULL,'Customer is looking to move into cross border work based on recruit of new partner.',NULL,NULL,NULL,NULL,139,NULL,NULL,NULL,NULL,NULL,1179,NULL,NULL,NULL,'Potential EU Tracker & PSL cross boder module customer.',NULL,NULL,NULL,NULL,NULL,0,'Alex Sage','2010-08-16','Alpha Bank',NULL,'140HKH'),(331,1,0,NULL,'Customer called credit control about wanting a three year payment plan versus PIA subscriptions as this is what West have offered them.',NULL,NULL,NULL,NULL,