INSERT INTO `insights` VALUES (31,'PRODUCT','Other','Stuart Rau',13274,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'\"Also, why should I have to press backspace twice to return to a previous page.\"\r\n\r\nThis affects all of LexisLibrary.',NULL,NULL,59,9,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,'2010-10-14 15:42:15',111,'2011-01-19 15:52:49',6,0,NULL,NULL,NULL,'N'),(41,'PRODUCT','Other','Kamlesh	Chauhan',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'\"Not easy to use and set up for specific tax content, i.e. if we work in VAT we don\'t need access to so many sources of information and search facilities could be easier to use. Shoud have simple version and normal version so can switch between two as required.\"\r\n',NULL,NULL,53,9,'In Q1 we will be launching TolleyLibrary which will be simpler and easier to use for tax practitioners.','',NULL,'Smith & Williamson',NULL,NULL,'All',NULL,NULL,59,'2010-10-14 15:59:27',111,'2011-01-19 15:52:35',6,0,NULL,NULL,NULL,'N'),(51,'PRODUCT','Other','Katherine	Shaw',2681,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'\"When you click \'Back\' to go to the previous page, you have to do this twice, which is a waste of time.\"\r\n\r\nThis affects all of LexisLibrary',NULL,NULL,0,9,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,'2010-10-14 16:03:04',111,'2011-01-19 15:52:19',6,0,NULL,NULL,NULL,'N'),(61,'PRODUCT','Other','Peter	Cashmore',31167,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'\"The user interface. It is not well laid out and can be counterintuitive. The \"back\" button has to be pressed twice each time which is annoying.\"\r\n\r\nThis affects all of LexisLibrary.\r\n',NULL,NULL,59,9,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,'2010-10-14 16:10:09',111,'2011-01-19 15:52:00',6,0,NULL,NULL,NULL,'N'),(71,'PRODUCT','Other','Helen Riley',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Customer woul like US materials to be included in alerts.',NULL,NULL,0,0,'','',NULL,'Warwick University',NULL,NULL,NULL,NULL,NULL,59,'2010-10-15 13:22:30',111,'2011-01-19 15:51:44',6,0,NULL,NULL,NULL,'N'),(81,'CUSTOMER','Customer/product advisory board','Anthony Fairclough',NULL,8082,'','Anthony Fairclough','Legal Information Manager',NULL,NULL,NULL,NULL,'He would like an option to not print the arrangement of sections in an Act. \r\n\r\n\r\nTel:  +44 (0) 20 7404 3447',0,1,0,NULL,'provide a feature giving option to print or not to print.','',NULL,'Matrix Law',NULL,NULL,NULL,NULL,NULL,59,'2010-10-15 13:29:46',111,'2011-01-19 15:54:12',6,0,NULL,NULL,NULL,'N'),(91,'PRODUCT','Other','Martin Gill',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Would like the ability to search US Journals within All Subscribed Journals as they\'re currently hidden.',NULL,NULL,0,9,'','',NULL,'Leeds University',NULL,NULL,'Journals',NULL,NULL,59,'2010-10-15 13:36:19',111,'2011-01-19 15:51:13',6,0,NULL,NULL,NULL,'N'),(101,'PRODUCT','Other','Ann Richardson',NULL,NULL,NULL,'',NULL,0,NULL,NULL,NULL,'A number of customers have asked that the legisaltion results open at legislation title default.\r\n\r\nTaylor Wessing - Jacki Smith\r\nBircham Dyson Bell - Sarah Nicolls\r\nLovells - Karen Gordon\r\nEversheds\r\nWeil Gotschal- Sarah chase',NULL,NULL,59,2,'Perhaps give them the option to chose','',NULL,'Allen & Overy',NULL,'Lexis Library',NULL,NULL,NULL,59,'2010-10-15 13:39:53',801,'2011-10-28 09:44:56',82,0,0,'TBC','','N'),(111,'PRODUCT','Other','Ann Richardson',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'All content from Butts to be available on LNB, e.g. Fin Regs, ICLRs, all tax sources.\r\n\r\nFrom a  range of firms as well as A&O\r\n\r\nTaylor Wessing - Jacki Smith\r\nBircham Dyson Bell - Sarah Nicolls\r\nLovells - Karen Gordon\r\nEversheds\r\nWeil Gotschal - Sarah Chase',NULL,NULL,0,9,'Need to assess reasons why some content goes online and some does not, and communicate this to customers. There could be contractual reasons with some content, or perhaps it may have an adverse  impact on certain hardcopy sales.','',NULL,'Allen & Overy',NULL,'Lexis Library',NULL,NULL,NULL,59,'2010-10-15 13:46:20',111,'2011-01-19 15:49:59',6,0,NULL,NULL,NULL,'N'),(121,'PRODUCT','Other','Angela Carritt',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Would like to see Shepard\'s, a citator service available on Lexis.com, on LexisLibrary.',NULL,NULL,0,0,'','',NULL,'Bodlean Library',NULL,NULL,'Shepard\'s',NULL,NULL,59,'2010-10-15 13:56:17',111,'2011-01-19 15:49:45',6,0,NULL,NULL,NULL,'N'),(131,'PRODUCT','Other','Ann Richardson',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Feedback on Alerts. A range of customers dislike the format, the mismatching fonts, that they can\'t forward them on to colleagues or non subscribers. They say there is not enough information on front page, and not enough paragraph breaks which makes extra work for librarians. There is duplication of documents and Irish content can\'t be filtered out. They want a link to the full document instantly. they are unclear on what individual sources contain.\r\n\r\nFrom:\r\n\r\nCharles Russell - Alice Bevington\r\nLovells - karen Gordon\r\nEversheds\r\nBircham Dyson Bell - Sarah Nicolls\r\nKennedys - Helen Smith\r\nWragg & Co Susanne Homer\r\nPinsents Mason - Alison walker\r\nSlaughter & May - Ian Hunter\r\nFresfields - Stella Cox\r\nCliford Chance - Emma Minter\r\nFreshfields - Anna Lowndes\r\nMayer Brown - June Goodwin\r\n',NULL,NULL,59,5,'Assess the usability of the alerts and see what improvements can be made for future developments.','',NULL,'Allen & oVery',NULL,NULL,NULL,NULL,NULL,59,'2010-10-15 14:05:21',111,'2011-01-19 15:49:27',6,0,NULL,NULL,NULL,'N'),(141,'PRODUCT','Other','',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'\"In the topics list, could \'Delict\' be added either next to or as well as \'Tort\'?\"\r\n\r\nDelict is the Scots Law term for Tort - it would probably be better to have this as a mirror topic to Tort to avoid confusion as English practitioners might not know this.',NULL,NULL,51,0,'','',NULL,'Aberdeen University',NULL,NULL,NULL,NULL,NULL,59,'2010-10-15 14:05:40',111,'2011-01-19 15:49:09',6,0,NULL,NULL,NULL,'N'),(151,'PRODUCT','Other','Ann Richardson',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Font size needs increasing to at least 12 pt to help visually impaired.\r\n\r\nAlso submitted by Eversheds.',NULL,NULL,0,9,'Explore if this is possible but we do conform to international guidelines here.','',NULL,'Allen & Overy',NULL,'Lexis Library',NULL,NULL,NULL,59,'2010-10-15 14:18:48',111,'2011-01-19 15:48:58',6,0,NULL,NULL,NULL,'N'),(161,'PRODUCT','Other','Michelle Celik',3426,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'It would be helpful to have legislation that has been repealed available online as well',NULL,NULL,0,2,'','',NULL,NULL,NULL,NULL,'Legislation',NULL,NULL,59,'2010-10-15 14:24:23',111,'2011-01-19 15:48:36',6,0,NULL,NULL,NULL,'N'),(171,'PRODUCT','Other','Allen & Overy',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Source directory feedback: Dislike the fact that some subject areas habve nothing but generic sources in them. They think generic sources within a subject shouls be grouped as generic.\r\n\r\nAlso Lovells - Nicola Chapman',NULL,NULL,0,9,'','',NULL,'Ann Richardson',NULL,NULL,NULL,NULL,NULL,59,'2010-10-15 14:24:57',111,'2011-01-19 15:48:23',6,0,NULL,NULL,NULL,'N'),(181,'PRODUCT','Other','Ann Richardson',388,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Would like KWIC to return as a View option.\r\n\r\nEversheds submitted this too.',NULL,NULL,0,0,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,'2010-10-15 14:28:17',111,'2011-01-19 15:48:11',6,0,NULL,NULL,NULL,'N'),(191,'PRODUCT','Other','',204,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'General difficulty in navigating and searching. \r\n\r\nSubmitted by Davies Arnold Cooper too.',NULL,NULL,0,0,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,'2010-10-15 14:30:36',111,'2011-01-19 15:47:53',6,0,NULL,NULL,NULL,'N'),(201,'PRODUCT','Other','',7602,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'lack of consitency in the source guides.',NULL,NULL,0,0,'AS - would like to pick up on this. More standardisation would be