,'They would like to be able to search on a range for figures on quantum in PI.',NULL,NULL,44,6,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,'2010-10-18 08:54:14',111,'2011-01-19 15:44:05',6,0,NULL,NULL,NULL,'N'),(331,'PRODUCT','Other','',4547,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Would like a competetion PAP.',NULL,NULL,14,9,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,'2010-10-18 08:56:06',111,'2011-01-19 15:43:35',6,0,NULL,NULL,NULL,'N'),(341,'PRODUCT','Other','',NULL,NULL,NULL,'',NULL,0,1,NULL,NULL,'Would like draft legislation to bemade available.\r\n\r\nHouse of Lords & Other law firms',NULL,NULL,59,2,'Some of what they need may already be available via other sources such as Current Awareness which can sometimes contain government information. Perhaps a source for this could be created.','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2010-10-18 13:12:25',801,'2011-11-14 14:51:58',82,NULL,0,'TBC','','N'),(351,'PRODUCT','Other','Hilary Smith',NULL,NULL,NULL,NULL,NULL,NULL,1,70,NULL,'Chance the Form Title field name to Form/Precedent Title instead.',NULL,NULL,0,3,'Would add clarity.','',NULL,'Kennedys',NULL,NULL,NULL,NULL,NULL,59,'2010-10-18 13:20:52',111,'2011-01-19 15:43:20',6,0,NULL,NULL,NULL,'N'),(361,'PRODUCT','Other','Gail sanderson',3373,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Would like more detail in the contents tree.',NULL,NULL,0,9,'No examples were given by the customer, but it would be helpful in a search across a PAP page to have a breakdown of the individual volume results for larger works such as EF&P and Halsburys Laws.','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,'2010-10-18 13:28:51',111,'2011-01-19 15:43:07',6,0,NULL,NULL,NULL,'N'),(371,'PRODUCT','Customer training session','Mhairi Dear',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Would like pre-devolution legislation for Scotland for at least major areas such as property. A general request from the Scottish Trainer for Scottish accounts.',NULL,NULL,51,2,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,'2010-10-18 13:32:00',111,'2011-01-19 15:42:53',6,0,NULL,NULL,NULL,'N'),(381,'PRODUCT','Other','Neil Cohen',12213,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Would like Print Management introduced so they can print off a single paragraph of a notice.\r\n\r\nAshursts also requested this.',NULL,NULL,0,9,'At the moment highlighting text and printing does not work on LL and the toc segments can be larger than the text needed. So the cstomer needs to copy and paste to an e-mail or to Word.','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,'2010-10-18 13:36:14',111,'2011-01-19 15:42:41',6,0,NULL,NULL,NULL,'N'),(391,'PRODUCT','Other','Diane Laverty',3564,NULL,NULL,NULL,NULL,NULL,1,779,NULL,'Wants a Pensions Practice area.',NULL,NULL,43,9,'Customer can create it themselves via client admin.','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,'2010-10-18 13:40:11',111,'2011-01-19 15:42:28',6,0,NULL,NULL,NULL,'N'),(401,'COMPETITOR','Other','Company Announcement',NULL,NULL,NULL,'',NULL,0,NULL,NULL,NULL,'Thomson Reuters has acquired Serengeti Law\r\n\r\nThomson Reuters\' Legal business has acquired Serengeti Law, a matter-management system for corporate law departments. The acquisition is one sign of an ongoing shift in the balance of power between corporations and the law firms they hire - and technology is tipping the scales.\r\n\r\nImportant Details: Thomson Reuters\' Legal business has acquired Serengeti Law, which provides matter-management software to corporate legal departments. Serengeti and its 50 employees will become part of TLR\'s Corporate, Government & Academic business unit.\r\n\r\nSerengeti\'s software helps General Counsel (GC) at in-house legal departments to manage their relationships with outside counsel. Its Serengeti Tracker offering ties legal departments directly to law firm billing systems, and adds data and analytic tools to enable legal departments to track, control, manage, analyze and report on legal activities worldwide. Serengeti is primarily used by large and middle-market firms. Its offering is a subscription-based Software as a Service (SaaS) model, so installation and maintenance costs are minimal. By virtue of the large number of global firms whose billing systems are connected to Tracker, Serengeti has a valuable view into the legal services industry that allows corporations to benchmark and track the performance of law firms all over the world.\r\n\r\nThomson Reuters brings something to the party as well - its good relationships with General Counsel and strong channel relationships with everyone involved, as well as its well-established brand.\r\n\r\nImplications: We have noted that technology, and the distressed state of the legal services industry in general, have shifted the balance of power between corporations and the law firms they hire to do their legal work (see, for example, Insights, 24 September 2010, Information Strategies for Today\'s Uneasy Legal Services Industry). This acquisition is an example of how Thomson Reuters is taking advantage of that shift by building out its range of offerings for the corporate market.\r\n\r\nThe General Counsel (GC) role is changing on a number of fronts:\r\n As businesses go global, so do their relationships with legal partners all over the world. Managing those relationships grows more complex every day;\r\n GCs are being pressured by their own management to undergo the same relentless focus on cost containment and efficiency that other operational parts of the company labor under. That means a combination of looking at external spending, bringing that work in-house if necessary, and making that in-house work much more efficient with the help of technology and business-process thinking;\r\n Workloads are changing - today\'s GCs have moved from being a sort of traffic cop or liaison between the company and its outside firms, to holding an expanded role in a much wider variety of legal matters, a role in governance, risk and compliance (GRC) efforts, and in collaborating on legal matters across borders and even with other buyers of legal services.\r\n\r\nResponses include retaining more legal work in-house rather than farming it out to firms, finding alternative providers (LPO, or Legal Process Outsourcing, is the legalese for it), and building new business relationships with law firms that are less about hourly billing and more about fixed-rate, results-based billing arrangements with greater control and accountability. It is in that latter area where Serengeti plays a role for its customers.\r\n\r\nThomson Reuters Legal\'s recent important moves have been all about the corporate market and not so much about serving its traditionally most productive cash cow, the world\'s large law firms. In addition to Serengeti, it also recently acquired Complinet and Paisley, folding them into a new GRC unit that will help corporations and financial services companies manage the tsunami of regulations reshaping their business (see Insights, 22 September 2010, Thomson Reuters: Building a New Business on the Foundations of the Old). We expect the legal information and services market in the next few years to be characterized by an increased urgency around serving corporations and their new legal needs as the law firm market continues to struggle and redefine itself\r\n',NULL,0,0,0,'LN needs to assess strategy for In-house legal departments / GCs and particularly Enterprise Solutions.','',NULL,NULL,NULL,NULL,NULL,'Thomson Reuters',NULL,62,'2010-10-18 13:46:18',801,'2011-11-14 14:52:52',82,NULL,0,'TBC','','N'),(411,'PRODUCT','Other','Miriam Davies',9005,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Would like PDFs for SIs\r\n\r\nOthers who want this too are: Foot Anstey - Justine Hughes, Richards Butler - Lotita Worley, Cliffiord Chance - Chrissy Harkness.',NULL,NULL,0,2,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,'2010-10-18 13:47:50',111,'2011-01-19 15:42:02',6,0,NULL,NULL,NULL,'N'),(421,'PRODUCT','0','Nicola Chapman',7602,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Dates