ULL,NULL,NULL,59,'2010-10-18 17:18:22',111,'2011-01-19 12:40:56',6,0,NULL,NULL,NULL,'N'),(1101,'PRODUCT','Other','Ems Holmes',12348,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Wants links to complex tables within legislation; for example rather than a message telling you to refer to the hard copy.',NULL,NULL,0,2,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,'2010-10-18 17:20:52',111,'2011-01-19 12:40:30',6,0,NULL,NULL,NULL,'N'),(1111,'CUSTOMER','Publication','Legalweek.com',NULL,NULL,NULL,'','',0,NULL,NULL,NULL,'Land Securities has appointed its first general counsel and company secretary with the hire of SABMiller\'s European head of legal.\r\n\r\nAdrian de Souza is set to join the FTSE 100 property group on 1 November to take up the newly-formed post. He replaces outgoing company secretary Peter Dudgeon, a non-lawyer, who is stepping down after 12 years in the role.\r\n\r\nDe Souza has been with drinks giant SABMiller for seven years, having joined from Clifford Chance, and has held his current post for three years. At Land Securities he will lead a 10-strong legal team, including head of legal services Clive Ashcroft, and will report into chief financial officer Martin Greenslade.\r\n\r\nDe Souza told Legal Week: \"I have always wanted to be GC and company secretary at a FTSE 100 company and was delighted to be offered the position at a very exciting time for the company, so this was an opportunity I couldn\'t resist. The idea is to bring everyone within Land Securities\' London and retail divisions together and to provide more legal support for the corporate headquarters. \"\r\n\r\nDudgeon commented: \"Land Securities has never been dull and, after 12 years, the time feels right to take a break before looking for a new challenge.\"\r\n\r\nIn September Land Securities appointed UK top 30 firm Nabarro as the official adviser on its retail parks portfolio, following a competitive tender process. The arrangement, which includes all asset management work for the portfolio, is for three years but Land Securities has the option to review the relationship annually.\r\n\r\nIn addition to Nabarro, the company works closely with Eversheds and Dundas & Wilson on the property side, with Slaughter and May the main corporate adviser',0,0,0,0,'Opportunity to re-engage to understand legal needs.','',NULL,'Land Securities','Land Securities',NULL,NULL,NULL,NULL,62,'2010-10-20 08:26:16',801,'2011-11-14 14:54:37',82,NULL,0,'TBC','','N'),(1121,'PRODUCT','Customer training session','Iain Greenwood',NULL,NULL,NULL,NULL,NULL,NULL,1,6048,NULL,'System history needs to go back at least a month to be helpful.\r\n\r\n020 7312 6432\r\niain.greenwood@grosvenor.com\r\n',NULL,NULL,53,0,'He is referring to the History section of My Research where searches are stored for a week, and pages visited for the last 2 days.','',NULL,'Grosvenor',NULL,NULL,NULL,NULL,NULL,59,'2010-10-20 19:01:05',111,'2011-01-19 12:40:10',6,0,NULL,NULL,NULL,'N'),(1131,'MARKET','Customer/product advisory board','',NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'weryhweyweyweywy',NULL,0,0,NULL,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2010-10-22 12:14:57',111,'2011-01-21 10:27:42',21,0,NULL,NULL,NULL,'N'),(1141,'COMPETITOR','Direct Mail','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'aafasfasgf',NULL,0,0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2010-10-22 12:15:05',111,'2011-01-21 10:28:02',21,0,NULL,NULL,NULL,'N'),(1151,'COMPETITOR','Publication','Outsell',NULL,NULL,NULL,'',NULL,0,NULL,NULL,NULL,'Wolters Kluwer Financial Services Acquires FRSGlobal\r\n\r\nThe compliance space continues to heat up, this time in the form of an acquisition by Wolters Kluwers\' Financial Services unit.\r\n\r\nImportant Details: Wolters Kluwer Financial Services helps banks and other financial institutions comply with regulatory requirements and minimize risks through a wide range of regulatory intelligence offerings, transactional solutions, policy and procedure management tools, and risk analytics and controls. Financial Services is part of Wolters Kluwers\' Financial & Compliance Services business unit. That unit also includes ARC Logics (a governance, risk and compliance (GRC) business that includes offerings across all industries including Axentis, ComplyTrack, TeamMate, and Sword products) and Transport Services, which provides freight exchange and logistics for the transportation industry. WK Financial Services currently serves a large share of US banks, mortgage originators, lenders, and insurers.\r\n\r\nWK Financial Services recently announced the acquisition of FRSGlobal, a Belgium-based provider of risk modeling and reporting applications. Its offerings help financial services companies meet external regulatory reporting requirements, but also internal reporting obligations in order to give management a better view into the organization\'s risk levels. FRS Global has offices worldwide and provides regulatory reports for over 40 countries. The reporting services integrate with an organization\'s core banking and finance systems -including those provided by Wolters Kluwer Financial Services - to provide a unified view of risk via internal and external dashboards. Together the firms offer a spectrum of services addressing financial risk (the WK Financial Services piece) plus compliance and operational risk (FRSGlobal).\r\n\r\nImplications: This acquisition represents within the financial services sector the same trend that is apparent in the horizontal GRC space - a shift from seeing compliance and risk management as the stuff of point solutions to a more comprehensive view of risk across an organization. When risk management came onto the corporate radar in the 1980s and 1990s it was seen as a set of tools to ensure that individual transactions, events, or relationships complied with applicable regulations and controls. Today, the emphasis is on looking at risk (operational, financial and compliance risks) across the organization - of seeing the whole, rather than a series of siloed compliance points.\r\n\r\nThe acquisition also represents the sort of consolidation and focus that is sorely needed in an ill-defined and fragmented compliance space. Thomson Reuters\' recent move to create a new GRC unit (see Insights, 22 September 2010, Thomson Reuters: Building a New Business on the Foundations of the Old) is another sign of the urgency and opportunity in helping organizations deal with compliance risks, while creating a more well-defined market space in the process. \r\n',NULL,0,0,0,'Further activity in the GRC space. LN needs to decide whether to play in this space.','',NULL,NULL,NULL,NULL,NULL,'Wolters Kluwer',NULL,62,'2010-10-26 11:19:36',801,'2011-11-14 14:53:59',82,NULL,0,'TBC','','N'),(1161,'MARKET','Other','',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,'Moved from ActWise. YM 26/10/2010\r\n\r\n\r\nDate Captured: 08/09/2010\r\n\r\n\r\nCaptured by: Lynne Davis and Mark Frost\r\n\r\nDialogue Summary: Impact of changes in Legal Aid (now known as Legal Services Commission Funding)\r\n\r\n\r\nContext:\r\nQuestion from Amanda to GP team: \'When you have been demoing/selling LexisPSL DR, have any users mentioned that they would like more content on Legal Services Commission funding? It used to be called Legal Aid\'\r\n\r\n\r\nVerbatim:\r\nLynne Davies: I was at a firm last week & the LSC has altered the criteria for Family law firms to obtain work, they have halved the number of firms on the panel & the criteria for being on the panel are ridiculously high. Each Family solicitor at a firm has to answer 5 really detailed case study questions (think they get 5 days to complete them), if they pass these they then get another raft of questions to sit (takes a ton of their time to prep for these questions), if they pass they can stay on the panel, a lot of them have failed! I know of 3 firms in Bolton who are facing going out of business because they relied so heavily on Legal Aid work and their solicitors have failed the exam!\r\n \r\nMark Frost: I was also at one today that has failed to obtain their license but are appealing. I am sure there was at least one more who lost their license.',NULL,4,28,NULL,'To be discussed at meeting on 30/11/2010, following conversation with Dave Coleman on 25/11/2010. YM 26/11/2010','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-26 14:45:14',111,'2011-01-19 15:57:45',11,0,NULL,NULL,NULL,'N'),(1171,'COMPETITOR','Other','Barrister',50214,NULL,NULL,NULL,NULL,NULL,NULL,NULL,43,'Moved from ActWise. YM 26/10/2010\r\n\r\n\r\nDate Captured: 24/08/2010\r\n\r\n\r\nCaptured By: Amy Hand   \r\n\r\n\r\nDialogue Summary: Displacing LawTel with LexisLibrary   \r\n\r\n\r\nContext: About half the members take individual Lawtel subs and pay approx 300 each. They take Lawtel for cases and current awareness.\r\n\r\n\r\nVerbatim: \r\nThere would be a great deal of reluctance to get rid of Lawtel because barristers are just so used to using it. The main obstacle turned out to be the time it would take for members to get used to Lexis for the searches they would generally do on Lawtel.  Members often get briefs in at very short notice and need to be able to research quickly and efficiently  they just do not want the fear of not being able to find the information they want if they are under a great deal of time pressure or working late into the night.',NULL,1,0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-26 14:55:43',111,'2011-01-19 16:04:46',11,0,NULL,NULL,NULL,'N'),(1181,'PRODUCT','0','Barrister',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Moved from ActWise. YM 26/10/2010\r\n\r\n\r\nDate Captured: 24/08/2010\r\n\r\nCaptured By: Anna Routledge\r\n\r\nCompetitor: Westlaw\r\n\r\nCustomer Sector: Legal - BAR\r\n\r\nProduct Experience: Search & Browse\r\n\r\nDialogue Summary:\r\nPresentation of search results on Westlaw vs LexisLibrary   \r\n\r\nVerbatim: said that he preferred Westlaws legislation over ours (they have access to LN legislation) due to the format of the search results. He finds Westlaws results are a lot cleaner and easier to find the desired result',NULL,NULL,0,2,'No actioned required. YM 15/11/2010','',NULL,'Serle Court Chambers',NULL,NULL,NULL,NULL,NULL,52,'2010-10-26 15:12:14',111,'2011-01-19 16:11:10',11,0,NULL,NULL,NULL,'N'),(1191,'PRODUCT','0','Librarian',50565,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Moved from ActWise. YM 26/10/2010\r\n\r\nDate Captured: 24/08/2010\r\n\r\nCaptured By: Amy Hand\r\n\r\nCompetitors: LEG - Westlaw   \r\n\r\nCustomer Sector: LEGAL - Bar \r\n\r\nDialogue Summary: Perception that LN pricing unaffordable for individuals, and preference for Westlaw\r\n\r\nVerbatim: The perception within Crown office is that LexisNexis is way out of reach for individual subscribers and therefore unless the whole of Chambers make the decision to subscribe there is no point in individuals even considering our online services. \r\nThey take Westlaw because they like the functionality.  They find the interface simple to use.\r\nThey take Westlaw because they can easily access historical legislation.\r\nThey take Westlaw because there are some texts which are exclusive to West eg Chitty on Contracts which they have to have.',NULL,NULL,0,2,'No actioned required. YM 15/11/2010','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-26 15:30:53',111,'2010-12-16 13:08:55',7,0,NULL,NULL,NULL,'N'),(1201,'COMPETITOR','0','Look Chan Ho, Senior Associate',4541,NULL,NULL,NULL,NULL,NULL,NULL,NULL,50,'Moved from ActWise. YM 26/10/2010\r\n\r\n\r\nCaptured By: Susan Bentley\r\n\r\nDate Captured: 05/08/2010\r\n\r\nContent Type: Legislation  \r\n\r\nCompetitors: LEG - Westlaw\r\n\r\nCustomer Sector: LEGAL - Top Tier\r\n\r\nDialogue Summary: Mistakes in Westlaw legislation   \r\n\r\nVerbatim: \r\nHe said that recently he found mistakes in their legislation, specifically for the consolidated Insolvency Rules 1986 (changed by 2 set of amendment rules in April this year).',NULL,0,0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-26 15:43:28',111,'2010-11-26 12:28:11',7,0,NULL,NULL,NULL,'N'),(1211,'CUSTOMER','Renewal or new business conversation','David Smith ',NULL,3985,'ELMH5001','Barry legg','practice manager',0,NULL,NULL,NULL,'some uses find lexis library hard to use - some use baili instead even though the content is not as good.',33,1,0,0,'nothing - well known and search enhancements should help','',NULL,'elmhirst',NULL,NULL,NULL,NULL,NULL,65,'2010-10-26 16:21:23',801,'2011-11-14 14:55:21',82,NULL,0,'TBC','','N'),(1221,'CUSTOMER','0','',NULL,NULL,'','','',NULL,NULL,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nDate Captured: 04/08/2010\r\n\r\nCaptured By: Amanda Wadey\r\n\r\nDialogue Summary: Customer perception that unapproved judgements can be used in court   \r\n\r\nVerbatim: unapproved judgments (ie those not formally reported by a court reporting service like All ER or WLR) can be relied on in court\r\n    \r\nContent Type: Cases   \r\n\r\nCustomer Sector: LEGAL - General Practice\r\n\r\nCaptured From (Individual Role) Librarian',0,0,0,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nTHIS IS NOT TRUE! Fortunately, I was able to refer to an excellent note in LexisPSL DR on the subject that refers to a practice direction written by Lord Woolf: it is not sufficient to cite an unofficial report if an official or approved report is available\r\n\r\nSo, if you come against an objection to buying our case reports because litigation lawyers think they can rely on free BAILLI unapproved judgments you can confidently tell them that that is not the case. There is a hierarchy of law reports and our Library gives access to all of these apart from the Weekly Law Reports.\r\n\r\nSee attached email for full details','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 09:08:45',111,'2011-01-19 15:59:24',11,0,NULL,NULL,NULL,'N'),(1231,'CUSTOMER','Informal conversation','',2778,2778,'','','',NULL,NULL,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Amanda Wadey\r\nDate Captured: 03/08/2010\r\n\r\nDialogue Summary: Different content types relevant to different practice areas (eg. in PI, quantum more important than up-to-date legislation)   \r\n\r\nVerbatim: PI lawyers dont need up to date legislation (apart from for civil procedure).\r\nThis is because the version of the legislation that governs a PI claims is that in force at the time the claim is brought. LN can provide copies of legislation at a particular time (as can our competitors but I believe we can turn it round more quickly).\r\n\r\nPractice Area: Employment; Family; Personal Injury; Company Commercial; Property; Private Client (Wills and Probate); Civil Procedure   \r\nContent Type: Cases; Legislation; Forms and Precedents; Commentary; Current Awareness; Practical Guidance   \r\n\r\nCustomer Sector: LEGAL - General Practice\r\n\r\nCaptured From (Firm Name): Cohen Cramer + others',0,0,0,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nYour Interpretation / Suggested Response Lawyers from different practice areas value different aspects (component modules) from LPSL.\r\nPI lawyers as we note value the extensive quantum database, more than up to date legislation, forms or precedents.\r\nAnother practice area values forms more than up to date legislation and another values up to date legislation more than forms.\r\n \r\nSee attachment for more info\r\n \r\n1) To help future development, focus on developing what is important and highly valued specific to each practice area rather than making us the highest performer in low valued functionality.\r\n2) Develop value propositions for sales to use specific to each practice area.','1288171329.xls','Cohen Cramer Research Requirements.xls',NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 09:22:00',111,'2011-01-19 15:59:43',11,0,NULL,NULL,NULL,'N'),(1241,'PRODUCT','0','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nDate Captured 28/07/2010\r\n\r\nCaptured By: Mark Frost\r\n\r\nDialogue Summary: PLC sales message - everything in \'one place\'\r\n\r\nContext: I had an interesting meeting with a firm yesterday that has recently taken all of PLCs modules, in what was described as their UK Law package.\r\n\r\nVerbatim: The main point that came out of it was that the PLC account manager was activelly selling the PLC modules on the basis they can provide all the information required by a solicitor. In particular they were highlighting links to case law so that all the research was available in \'one place\'.\r\n\r\nContent Type: Cases; Legislation\r\n\r\nCompetitors: LEG - BAILI; LEG - PLC\r\n\r\nCustomer Sector: LEGAL - General Practice',NULL,NULL,0,0,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nYour Interpretation / Suggested Response Obviously we know that the cases and legislation in PLC link out to OPSI and BAILLI but may be worth brushing up on why our case and legislation offering is much better, and perhaps have some bullet points prepared we can use to overcome this objection.\r\n \r\nAmanda proposed to put together some bullets on this.\r\n\r\nNo action required. YM 15/11/2010','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 09:33:16',111,'2010-12-16 13:04:01',7,0,NULL,NULL,NULL,'N'),(1251,'COMPETITOR','Renewal or new business conversation','Liz Shaw',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,47,'45 Fee earner practice - \r\n2009 spend 22K including Corp, Property, IP & DR.\r\n2010 spend 24K Full suite - 1 year deal',NULL,4,0,NULL,'Acknowledge pricing strategy to keep out PSL',NULL,NULL,'Wake Smith',NULL,NULL,NULL,NULL,NULL,10,'2010-10-27 09:43:00',111,'2011-01-20 14:22:24',7,121,NULL,NULL,NULL,'N'),(1261,'PRODUCT','0','',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nDate Captured: 23/07/2010\r\n\r\nCaptured By: Lucy Cudd\r\n\r\nDialogue Summary: Multiple customer queries as to why Cordery on Solicitors is not available online\r\n\r\nVerbatim: In the past 24 hours I have been asked by two separate firms whether we have Cordery on-line, as far as I am aware after checking the sources on the library we dont.\r\n\r\nLN Product Family: LexisLibrary (incl Print)\r\n\r\nCustomer Sector: LEGAL - General Practice',NULL,NULL,0,6,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nYour Interpretation / Suggested Response: Does anyone know why we dont? or does anyone know who I can ask?\r\n \r\nAlex Smith:\r\nI believe we were look at a legal practice menu (Cordery, Bar Handbook) onto LexisLibrary. Not sure where this got to. Personally think it should be on LL in the legal library menu at the very least. If commercially the right decision then it would be easy to do.\r\nThe commercial decision is in Orla\'s team.\r\nWe are getting quite a few requests from large law customers who want all LLFs online as they are cancelling print for a variety of practical reasons\r\n \r\nAmanda: In my short life as a head of sales out on customer visits, I have been asked about this 3 times and Im sure the guys would echo that this is a frequent request.\r\n\r\nNo action required. YM 15/10/2010','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 09:43:15',111,'2010-12-16 12:02:14',7,0,NULL,NULL,NULL,'N'),(1271,'PRODUCT','Renewal or new business conversation','John Beaumont',5483,NULL,NULL,NULL,NULL,NULL,4,4949,NULL,'Quantum database compared to Kemp still not as comprehensive - The client currently relies on Kemp - will not pay additional revenue for PSL PI whilst they still need Kemp.',NULL,NULL,44,1,'accelerate case law content within quantum database\r\n\r\nResponse from Clare Duggan, 29/10/2010\r\nLexisNexis is looking to extend their quantum coverage and is offering lawyers a one off fee of 40 for each quantum case submitted which is published in the quantum database and/or other LexisNexis products (eg LexisLibrary, Quantum Cases Database, Butterworths Personal Injury Litigation Service, Halsbury\'s Laws). Quantums can be submitted from now onwards, and early next year, there will be a link available from both LexisLibrary and LexisPSL enabling subscribers to submit these via an online form. We hope this will help to grow our archive in line with Kemps offering.\r\nYM 29/10/2010','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,'2010-10-27 09:49:58',111,'2010-11-26 12:52:17',7,59,NULL,NULL,NULL,'N'),(1281,'CUSTOMER','Industry event','',NULL,NULL,'','','',NULL,NULL,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nDate Captured: 09/07/2010\r\n\r\nCaptured By: Stuart Greenhill\r\n\r\nDialogue Summary:\r\nFeedback on LN from group of firms at CX meeting in Manchester   \r\n\r\nVerbatim:\r\nTraining\r\n         Customer training is generally perceived as very good but often isnt used as people are busy or they go through training then dont use the services for a while so forget\r\n         E-learning particularly at the point of use would be very useful e.g. a 30 second how to search video when people are trying to search (and get stuck)\r\n \r\nLexisLibrary\r\n         Lack of RSS feeds in comparison to West/Lawtel/PLC\r\n         LexisLibrary doesnt work well on BlackBerry (Publisher does), firms are starting to explore Ipads etc so we need to work with these tools\r\n         LexisLibrary font is too small and he look and feel is too complex\r\n         Westlaw looks cleaner , simpler and more Google like\r\n         LexisLibrary is very good for experienced users/info pros less so for infrequent users/solicitors\r\n         Our results should have the option to be returned by relevance of source e.g. Hals Laws towards the top, less reliable sources lower down\r\n         We should have more practice area pages e.g. Insolvency\r\n         Its hard to use our taxonomy in searching e.g. I only want Employment results not all results, realize this is possible but need to be taught how so not intuitive\r\n         Legislation is particularly difficult to use in comparison to West which is much cleaner in terms of layout\r\n         LexisLibrary is misleading in that firms believe they have bought all LexisNexis legal and tax content but some content, notably journals arent included\r\n         Journals that are included can be months out of date notably Pensions World practitioners assume all content on LexisLibrary is up to date so this creates significant risk\r\n         Journals are a key current awareness source for PSLs, not having this content in our updates creates a poor experience and means PSLs have to use another service or trawl through websites \r\n         As not all journal content is available online it can be frustrating when practitioners want an article they know about but which isnt available online its only available in print or direct from the specific journals website e.g. New Law Journal\r\n         Your preference would be that once youve subscribed you should be able to access this in print, through LexisLibrary or directly through the relevant journals website, all of which should be updated at the same time\r\n \r\nUsage stats\r\n         Our usage states come through too late e.g. later than the 10th of the month\r\n         It would be more useful to have usage broken down by practice area e.g. employment which PLC does and we dont\r\n \r\nPLC\r\n         PLCs precedents are more practical and practitioner focused than EF&P which can be overly flowery while PLCs are written in more of a plain English perspective\r\n         Practice notes and checklists are also written for practitioners\r\n         House style and firm style are excellent tools for easy production of precedents saving time\r\n         EF&P is far more difficult to use in terms of auto-numbering/formatting and doesnt have house style (we do have auto-numbering functionality now)\r\n         PLC precedents integrate into case management systems making them easy to access and part of a firms workflow\r\n         PLC precedents are all written in a similar consistent style even across practice areas, ours arent\r\n         PLC send regular update emails about content additions, service amendments\r\n         PLC are embedding their content with widgets to be able to search from firms intranets\r\n         Your biggest frustration with PLC is the way they split modules to force you to take more subs e.g. Corporate module no longer includes IP&IT\r\n         You see the value in having practical guidance content linking to deeper content but our offering needs to match and exceed PLCs first\r\n \r\nAccount Management\r\n         Account Management is very good and all key info comes through Sarah/Mark as opposed to from marketing, all queries tend to go to Sarah/Mark\r\n \r\nNews and Business\r\n         Our content loading of news content is inconsistent and is often late, we dont notify you when this is late which makes using our content for current awareness updates difficult and frustrating\r\n         We dont tell you when there are issues with our products or provide a notification tool which you can sign up to by product so you know when there are issues\r\n         The Sunday Times and MEN are two particular sources youve had issues with, the Sunday Times has occasionally come through on a Tuesday! It can be quicker at times to buy the physical paper!\r\n         Such issues reflect badly on you as information professionals and escalate to Senior Partners\r\n         Old content often resurfaces as current e.g. an article from Jan can show up in todays update\r\n         Duplicated results (though this has recently been fixed)\r\n         Product updates can be very technical and unclear\r\n         Not all the right sources are in the right library files e.g. The Lawyer didnt used to be in UK Publications when clearly it should be, this needs to be accurate and we should focus on the most used UK sources and make sure they are in the right group files (e.g. UK News, UK Publications etc)\r\n         Our licensing restrictions are far tighter than Wests e.g. West allow you to pass a small number of docs to clients\r\n \r\nLexisNexis strengths\r\n         Our content breadth is excellent and cant be matched by other providers\r\n         Halsburys Laws is superb in terms of its coverage\r\n         We have a precedent for pretty much everything all be it the precedent may be difficult to format and in flowery language\r\n         Our Account Management is excellent\r\n\r\nContext: \'MaxineRichards@eversheds.com\'; \'nicola.matthews@addleshawgoddard.com\'; \'mark.briegal@ralli.co.uk\'; \'zoe.wright@dlapiper.com\'; \'lisa.smith@dwf.co.uk\'; \'timdavies@pannone.co.uk\'\r\n\r\nLN Product Family: LexisLibrary (incl Print); Nexis\r\n\r\nContent Type: Forms and Precedents; Current Awareness; Practical Guidance; Encyclopaedic Work; Journals    \r\n\r\nCompetitors: LEG - Lawtel; LEG - PLC; LEG - Westlaw\r\n\r\nCustomer Sector: LEGAL - Top Tier\r\n\r\nCaptured From (Firm Name): Multiple - see context',0,1,0,NULL,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 09:55:47',111,'2011-01-19 15:59:59',11,0,NULL,NULL,NULL,'N'),(1291,'CUSTOMER','0','',NULL,NULL,'','','',NULL,NULL,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nDate Captured: 07/07/2010\r\n\r\nCaptured By: Fiona Campbell\r\n\r\nDialogue Summary: Effective initial positioning statements for appointments and Lockdown\r\n\r\nVerbatim: Basically, for the Lockdown Campaign, the idea that other customers had made admin and time/cost savings attracted them to want a meeting. \r\nFor first meetings with new account managers, for the Bar, Arjun found that quite a few had questions that they wanted answering so he mainly pulled them in by saying that we want to make sure that they are still receiving the best package for them and that they have enough materials for each of their practice areas. He also said that we are looking to improve the quality of our service to them.\r\nFor Niche firms, Fiona found that what worked was saying that a new account manager had been appointed, who wanted to make sure they were getting the best value for their subscriptions. Fiona also just said that they were keen to introduce themselves to make sure that going forward we could provide the best service possible.   \r\n\r\nCustomer Sector: LEGAL - Niche inc Factory',0,0,0,NULL,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 09:59:39',111,'2011-01-19 16:00:44',11,0,NULL,NULL,NULL,'N'),(1301,'CUSTOMER','Informal conversation','Graham Hobbs',4417,4417,'','Graham Hobbs','Practice Director',NULL,NULL,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nDate Captured: 25/06/2010\r\n\r\nCaptured By: Aneil Rakity\r\n\r\nDialogue Summary: Feedback on LN sales process\r\n\r\nVerbatim: During the course of the last week or so, we have finalised our 2010/11 arrangements with Claire. During this same period I have had two calls from other people who want to talk to me about our expiring subscription, the second being this morning. This was from one \"Chris\" on 0208 686 9141 extension 5062.\r\nI have spent a lifetime running relationship management teams albeit in another sector but this is not impressive given the relationship debacle with L/Nexis and Axxia over the last year or so.\r\nIf I may, I would summarise our and I would imagine most firm\'s requirements as follows:\r\n         A clear point of contact with a relationship manager\r\n         The nominated person to remain in situ for more than a month or so\r\n         Needs satisfaction to be the prime focus, from which sales will surely follow, as distinct from what appears to often be a preoccupation with sales and sales targets\r\n         From the above approach, a sense of added value from the relationship manager\r\n         Product improvement\r\n         Removal of the three months notice clause which is irritating and is currently being exploited by at least two of your competitors\r\nThe above is meant to be constructive, I hope it helps.\r\nIn confidence I can advise you that PLC make significant mention that their product requires no notice to terminate upon expiry and we also received an unsolicited approach from Westlaw recently who stated that LNB requires 3 months notice, the clear implication being that Westlaw did not.\r\n\r\nCustomer Sector: LEGAL - Consumer-Led',0,0,0,NULL,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 10:11:47',111,'2011-01-19 16:01:00',11,0,NULL,NULL,NULL,'N'),(1311,'PRODUCT','0','Kate Heward, Librarian',1671,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Ben May\r\n\r\nDate Captured: 23/06/2010\r\n\r\nDialogue Summary: Adding sources to LexisLibrary bookshelf from other practice areas   \r\n\r\nContext: De-brief following refresher training for fee-earners\r\n\r\nVerbatim: A fee-earner working in Personal Injury wanted to change the bookshelf on the Personal Injury Practice Area Page by adding The Civil Court Practice 2010 (The Green Book). I could not find it on the add/remove/sort under Commentary, or any other  source type. When I looked for it under Find More Sources I still could not find it.\r\n\r\nCustomer Sector: LEGAL - General Practice',NULL,NULL,44,0,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nYour Interpretation / Suggested Response: \r\nPersonal Injury is a contentious area of law, and therefore the practice involves working with civil procedure rules. The lawyer naturally wanted to make full use of the PI PAP by adding the Green Book, which contains the Civil Procedure Rules and other commentary. The Librarian was unable to do this, as the PAP bookshelf does not allow you to add sources from \"other\" practice areas, although the Green Book is very relevant to personal injury practice.\r\n\r\nI was not aware that the Green Book could not be added to the PAP bookshelf for  Personal Injury. I went through the steps with Kate, and had to concede that it does not allow you to add the Green Book. I promised to take this matter further.\r\n\r\nNo action required. YM 15/11/2010','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 10:19:38',111,'2010-12-16 11:31:44',7,0,NULL,NULL,NULL,'N'),(1321,'PRODUCT','0','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nDate Captured: 16/06/2010\r\n\r\nCaptured By: Lynne Davies\r\n\r\nDialogue Summary: Feedback on CLT webinars\r\n\r\nVerbatim: We have bought a couple of these just as one offs for 150 plus VAT for only 1 person to claim CPD, they are of average standard with no quiz at the end for the delegate to take.  They are worth 1.5 CPD points each.  I am not very impressed by them.\r\nTheir packages work a little different.\r\nYou MUST buy a membership first which is 650 plus VAT annually.  This gives you a 50% discount on all of their seminars / conferences / etc.\r\nOnce you have your membership you can buy a package of 10 webinars for up to 50 lawyers for 12 months in a single discipline for 1500 plus VAT.  You can only have webinars within its discipline if you buy them this way. \r\nOr\r\nYou can buy places....for example, if I have 60 lawyers and I want them to watch 2 webinars then I buy 120 places, I pay up front at the beginning and then the lawyers can pick any webinar (any discipline) they wish to watch, over the year as long as no more then 120 places are used.  (does that make sense?)  This costs 20 per place.\r\nYou can also buy past webinars as part of the packages.\r\n\r\nCompetitors: LEG - CLT\r\n\r\nCustomer Sector: LEGAL - General Practice',NULL,NULL,0,0,'No action required. YM 15/11/2010','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 10:25:07',111,'2010-12-16 11:25:51',7,0,NULL,NULL,NULL,'N'),(1331,'PRODUCT','0','',NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nDate Captured 09/06/2010\r\n\r\nCaptured By: Mark Frost\r\n\r\nDialogue Summary: Firmstyle required to displace PLC with LexisPSL   \r\n\r\nVerbatim: the requirement of firmstyle or an equivalent as essential - PLC gives them this and they are concerned that the amount of time it would take their fee earners to draft the precedents into the firms house style would outweigh the benefit of moving.\r\n\r\nContext: new business - displacing multiple PLC subs with LexisPSL. 30k opportunity\r\n\r\nProduct Experience: Firmstyle\r\n\r\nCompetitors: LEG - PLC\r\n\r\nCustomer Sector: LEGAL - General Practice',NULL,NULL,0,3,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response workaround; timescales?\r\n\r\nResponse from Clare Duggan, 17/11/2010\r\n\"Thanks for your feedback below. I believe Lexis SmartStyle is due to be rolled out in Q1, 2010. This should help to displace PLC. Further information and training materials will be available closer to the time. I think John Hanratty should be able to give you further information on this if required sooner.\"','',NULL,NULL,NULL,NULL,'FIRMSTYLE',NULL,NULL,52,'2010-10-27 10:35:25',111,'2010-12-16 11:22:16',7,59,NULL,NULL,NULL,'N'),(1341,'COMPETITOR','Customer training session','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,39,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nDate Captured: 04/06/2010\r\n\r\nCaptured By: Dawn Gray-Smith\r\n\r\nDialogue Summary:\r\nPreference for LexisNexis over PLC\r\n\r\nContext: called the client to coordinate training for the firm and was passed directly to the partner who could not find an order in LL he needed now. I asked him if he had looked in PSL Wills and Probate and he hadnt because he had not yet used it.  We immediately found what he needed in IPFDA 1975 actions.\r\n\r\nVerbatim: The partner said he was able to save a lot of money in cancelling Jordans in favour of us and that our content and services are superior to the expensive PLC who they did evaluate at some point.  He said PLC content is not practical for High street firms and they should change their name.  He also said they should be able to cancel laser forms and he prefers our HotDocs forms, because they are easy to locate and easier to use.\r\n\r\nLN Product Family: LexisPSL; HotDocs\r\n\r\nPractice Area: Private Client (Wills and Probate)\r\n\r\nCompetitors: LEG - Jordans; LEG - LaserForms; LEG - PLC\r\n\r\nCustomer Sector: LEGAL - Consumer-Led',NULL,4,47,NULL,'',NULL,'RE PSL client feedback.htm',NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 10:44:07',111,'2011-01-19 16:04:27',11,0,NULL,NULL,NULL,'N'),(1351,'PRODUCT','0','Peter Wildey',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nDate Captured: 04/06/2010\r\n\r\nCaptured By: Mary McGilloway\r\n\r\nDialogue Summary: Easier to find what you need on CCH than LexisLibrary   \r\n\r\nContext: Strategy meeting with HMRC\r\n\r\nVerbatim: Users can get straight to what they need quickly on CCH compared to LexisLibrary   \r\n\r\nProduct Experience: Navigation\r\n\r\nCompetitors: TAX - CCH\r\n\r\nCustomer Sector: TAX\r\n\r\nCaptured From (Firm Name): HMRC\r\n\r\nCaptured From (Firm ID / Account No): HMRC5000\r\n\r\nCaptured From (Individual Name): Peter Wildey',NULL,NULL,0,0,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nYour Interpretation / Suggested Response: \r\nThe table of contents is presented straight away on entering CCH so users can drill down to key information very quickly e.g. tax rates, cases,  This aproach works for them as they have a smaller set of sources.\r\n \r\nPromised to look at this and report findings to others to consider for the new product.','',NULL,'HMRC',NULL,NULL,'Navigation',NULL,NULL,52,'2010-10-27 10:52:09',111,'2011-01-19 16:10:39',11,0,NULL,NULL,NULL,'N'),(1361,'PRODUCT','0','Vivien Bradley-Shaw, Solicitor',7167,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'Moved from ActWise. 27/10/2010\r\n\r\n\r\nDate Captured: 03/06/2010\r\n\r\nCaptured By: Sue Fachiri\r\n\r\nDialogue Summary: Depth of content in LexisPSL Wills & Probate   \r\n\r\nContext: New Business Lexis PSL - Wills & Probate\r\n\r\nVerbatim: It\'s OK for run of the mill things, what if I need something more detailed eg oath for administrators, deceased divorced with minor children (which is  becomimng more commontoday)\r\n\r\nPractice Area: Private Client (Wills and Probate)\r\n\r\nCustomer Sector: LEGAL - Projects\r\n\r\nCaptured From (Firm ID / Account No): LARG500',NULL,NULL,47,0,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nYour Interpretation / Suggested Response: \r\nThere isn\'t enough content. This is a lawyer with good technology understanding.\r\n \r\nResponse: Lexis PSl is an organic service relying on suggestions from users and often adding such content . At the end of the session we looked for such a precedent within wider library and found it in EF&P and forwarded by email. Also undertook to forward suggestion to PSL team and let customer know the outcome.\r\n\r\nEffect of response: Pleased to hear that  suggestions acted upon but still dubious about level of coverage and  wishes to discuss needs further with AM.\r\n\r\nNo actioned required. YM 15/11/2010','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 11:00:23',111,'2010-12-16 11:17:23',7,0,NULL,NULL,NULL,'N'),(1371,'PRODUCT','0','Andrew Mercer, Partner',12185,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nDate Captured: 27/05/2010\r\n\r\nCaptured By: Sue Fachiri\r\n\r\nDialogue Summary: Searching on LexisPSL\r\n\r\nVerbatim: I still can\'t find what I\'m looking for \r\n\r\nContext: As part of a group, they all wanted to use the PSL service to search rather than browse, they have Lexis Library and find it frustrating to search.\r\n\r\nCustomer Sector: LEGAL - General Practice\r\n\r\nCaptured From (Firm ID / Account No): TRET0001',NULL,NULL,0,0,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nI tried to concentrate and emphasise the fact that PSl was topic led.  I took away from this session the fact that many practitioners see an online service as something that HAS to be searched and we need to get across the message that searching is not mandatory and subsequently have used this approach in training sessions to good effect\r\n\r\nEffect of this was grudging acceptance, on subsequent floorwalk the general opinion was more positive\r\n\r\n\r\nResponse from Clare Duggan, 17/11/2010\r\n\"It would really help to know exactly what these users were trying to find so we know where the problem lies. Is it design, functionality, content or something else entirely? Nonetheless, we are introducing word wheels/suggested searches onto LexisPSL next year so this should help them no end.\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,72,'2010-10-27 11:50:35',111,'2010-12-16 11:12:02',7,59,NULL,NULL,NULL,'N'),(1381,'PRODUCT','0','Richard Bates, Partner',13049,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nDate Captured: 21/05/2010\r\n\r\nCaptured By: David Smith\r\n\r\nDialogue Summary: Use of connectors in LexisLibrary search   \r\n\r\nContext: Pre-sales demo for lexis library - introducing the connectors on Lexis Library\r\n\r\nVerbatim: I thought connectors were the type of thing you had to remember in the early days of the interent - I didn\'t realise we would still need to use this kind of thing now!\r\n   \r\nProduct Experience: Search & browse\r\n\r\nCustomer Sector: LEGAL - Projects\r\n\r\nCaptured From (Firm ID / Account No): YOUN5016',NULL,NULL,0,0,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nThe client was surprised our search engine wasn\'t smarter and still required connectors.\r\nWe are looking to address this later this year as people are so used to  a google style search online - we have a \'searching\' project underway to enhance users\' experience and offer such tools as \'did you mean\', smart indexing behind the scenes and more \'fuzzy\' searching.\r\nThe user was pleased to hear this but was still surprised it was not the way the site currently worked.\r\n\r\nNo action required. YM 15/11/2010 ','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 11:59:27',111,'2010-12-16 11:08:19',7,0,NULL,NULL,NULL,'N'),(1391,'PRODUCT','0','Lorna Watson (01865 292 252), partner in tax team',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nDate Captured 17/05/2010\r\n\r\nCaptured By: Mary McGilloway\r\n\r\nDialogue Summary: Not using sources in LexisLibrary as unable to find them.   \r\n\r\nContext: Not using Tax Partner or the Charities menu - danger of cancellation.\r\n\r\nVerbatim: We are not using Tax Partner or the Charity books as we can\'t find them.\r\n\r\nProduct Experience: Navigation\r\n    \r\nCustomer Sector: TAX\r\n\r\nCaptured From (Firm ID / Account No) SHAW5587',NULL,NULL,0,0,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\n\r\nThey can\'t see how to access the material. Tax partner is available via another url outside Lexis Library and the link to it is hidden beneath another link Other Lexis Nexis Sources on the Tax & Accountancy page - so it\'s far from obvious to a user. The charity sources needed adding to the bookshelf.\r\n\r\nResponse: I will set up links to Tax Partner on your  PC desktop and add the Charity titles to the bookshelf.\r\n\r\nEffectiveness: Much happier and I have had confirmation that they renewed their contact.','',NULL,'Shaw Gibbs',NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 12:26:31',111,'2011-01-19 16:10:15',11,0,NULL,NULL,NULL,'N'),(1401,'PRODUCT','0','David Walker, Tax Partner',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: David Smith\r\n\r\nDate Captured: 12/05/2010\r\n\r\nDialogue Summary: Navigation of different sections in Tax handbook online   \r\n\r\nContext: renewal training on lexis library tax\r\n\r\nVerbatim: I find it difficult to find sections in the yellow tax handbook by browsing as it\'s difficult to see which part the section sits in  \r\n\r\nProduct Experience: Search & browse; Navigation   \r\n\r\nCustomer Sector: TAX   \r\n\r\nCaptured From (Firm ID / Account No): TURN5026',NULL,NULL,0,0,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nThe yellow tax handbook lists legislation in within the \'parts\' but doesn\'t show (as the main UK stats dbase does) the section range within each part.\r\nI agree it would be useful if you could see the section range within each title of the parts. user agreed this would be a useful development which would add to their experience of using this key tax source.','',NULL,'Turner Peachy',NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 12:32:44',111,'2011-01-19 16:09:58',11,0,NULL,NULL,NULL,'N'),(1411,'CUSTOMER','0','',9797,NULL,'','','',NULL,NULL,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Lucy Cudd\r\n\r\nDate Captured: 10/05/2010\r\n\r\nDialogue Summary: Engaging with partners around sale of LexisPSL Employment vs PLC\r\n\r\nContext: new business - displacing PLC Employment with LexisPSL employment\r\n\r\nVerbatim: Rather than look at Lexis Nexis I would ask them: (1) whether they prepare briefing notes on different employment law topics; (2) if so, can we please have a list and a sample; (3) if not, why not, and they can come back to talk to us as and when they start to compile them.  If they do produce them, then lets have a look at a sample and then decide, on the strength of that, whether its worth any of us giving up our time for a demo\r\n\r\nContent Type: Practical Guidance\r\n    \r\nCompetitors: LEG - PLC   \r\n\r\nCustomer Sector: LEGAL - General Practice\r\n\r\nCaptured From (Firm ID / Account No): 9797',0,4,24,NULL,'','1288183532.htm','FW Lexis Nexis - PSL Demonstration Prettys.htm',NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 12:45:23',111,'2011-01-19 16:01:14',11,0,NULL,NULL,NULL,'N'),(1421,'PRODUCT','Customer training session','Leonie Reynalds, Enquires',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Katie Cook\r\n\r\nDate Captured: 10/05/2010\r\n\r\nDialogue Summary: Useability of LNA\r\n\r\nContext: Trial training on Blog watch\r\n\r\nVerbatim: \r\n1) Clients advised that the option to de- dup per source would be really useful as some sources such as twitter has more dups than others\r\n2) it would be useful to have the abilty to add blogs as required and utilise flexible sources\r\n3) understands that sarcasm is hard to track\r\n\r\nCustomer Sector: PUBLIC SECTOR',NULL,NULL,0,0,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response:\r\n1) searching blogs and websites is a whole different way of searching and has its own variety of challenges. Blog specialists and AM have been in contact withclient and workd to add de -dup as required\r\n2) would like ability to customise on own. blog specialists and AM have been in contact withclient and workd to add sources as required\r\n3) personal interpetation required .. The difference between Great! and GREAT! little can be done, but blog team are aware and something they do try and gauge ','',NULL,'HMRC',NULL,'LNA',NULL,NULL,NULL,52,'2010-10-27 12:52:25',111,'2011-01-19 16:09:14',11,0,NULL,NULL,NULL,'N'),(1431,'PRODUCT','Customer training session','Multiple Users',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: David Smith\r\n\r\nDate Captured: 10/05/2010\r\n\r\nDialogue Summary: Ability to open new tab from LexisLibrary navigation tree\r\n\r\nContext: Training on lexis Library tax   \r\n\r\nVerbatim: can we open a new tab from the tree on the left\r\n \r\nProduct Experience: Navigation\r\n\r\nCustomer Sector: TAX\r\n\r\nCaptured From (Firm ID / Account No): WHIT5109',NULL,NULL,0,0,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nCan a user open a link from the document view tree in a new window or tab \r\nIt\'s not possible to do this but I will feed this back as a suggested product development - the alternative is to press ctrl n to open a new tab showing the same content as the first and then navigate from there.\r\nUsers were a little surprised why this didn\'t work!\r\n\r\nNo action required. YM 15/11/2010','',NULL,'Whittingham Ridell',NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 12:59:45',111,'2010-12-16 09:41:27',7,0,NULL,NULL,NULL,'N'),(1441,'PRODUCT','Customer training session','Isabel Lloyd-Jones, Head of PI',NULL,NULL,NULL,'','',0,1,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Gavin Allan\r\n\r\nDate Captured: 07/05/2010\r\n\r\nDialogue Summary: Finding cases on LexisLibrary\r\n\r\nContext: Pre-sales demo for Lexis Library/Lexis PSL\r\n\r\nVerbatim: \"Through e-mail: we are in the process of a trial run of your services as you konw.\r\nI am trying to find a case with a WLR ref .The case name is just H v S which doesn\' t help! The ref is  l2002] 3 WLR 1179\r\nAm I likely to be able to find it or does the site not relate to WLR refs  at all\"\r\n \r\nProduct Experience: Search & browse   \r\n\r\nCustomer Sector: LEGAL - General Practice\r\n   \r\nCaptured From (Firm ID / Account No): HOWE5009',NULL,NULL,0,1,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nWhen you search in the Lexis Library cases page against party names for \'H v S\' nothing comes up in relation to the correct case. Searching in the search terms box for \'H v S\' brings up coverage of the case from Bingham and Berrymans, and the result shows as having \'H v S\' as the title/party names. It\'s not the full case but it\'s a good summary that would help to convince our users we have comprehensive coverage.\r\n\r\nFollow-up: Clare Duggan - 24 May 2011\r\nHi Gavin\r\n\r\nFurther to your feedback earlier this year from Howells, the online coordination and fabrication team have explored the issue and it turns out that the cause is down to the (Bingham) source being a combination of commentary and cases content. Unfortunately it\'d be extremely difficult to split the source, and the cases in the content are very short and don\'t have much metadata to work with. \r\n\r\nI am trying to find a case with a WLR ref .The case name is just H v S which doesn\' t help! The ref is  l2002] 3 WLR 1179\r\nAm I likely to be able to find it or does the site not relate to WLR refs at all\"\r\n\r\nIf you find this to be an increasingly difficult issue for customers as time goes on, please come back to me and I\'ll ask the teams to investigate if there are any alternative developments which would resolve this.\r\n\r\nKind regards,\r\n\r\nClare.\r\n\r\n\r\nAllow the case summaries in Bingham and Berrymans to be searched by party name field in the cases page on Lexis Library. We should not have to think laterally about a possible way round it. The content is excellent, so let\'s make it even more accessible!\r\n \r\nOur currently perceived weak PI/Clin Neg content would be extended through these excellent summaries. People give up if they don\'t see it on a first search for party name and go elsewhere eg Kemp & Kemp/LawTel.\r\n\r\n\r\nResponse from Clare Duggan, 17/11/2010\r\n\"Thanks for your feedback below. It looks like this content hasn\'t been marked up correctly so Tom Macdonald is looking into it and hopefully it is something we can rectify going forward.\r\nI\'ll keep you in the loop.\"','',NULL,'HOWELLS',NULL,NULL,'','',0,66,'2010-10-27 13:06:24',801,'2011-10-28 09:56:59',82,59,0,'TBC','','N'),(1451,'MARKET','Customer training session','James Field, In House Solicitor',NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: David Smith\r\n\r\nDate Captured: 06/05/2010\r\n\r\nDialogue Summary: Practice area specific updaters on EU Tracker\r\n\r\nContext: training on EU Tracker with account manager Peter Stennett who asked if other business units have a need for EU legislation.\r\n\r\nVerbatim: is there an updater in EU tracker which users can set to be informed of directives / regulations for SPECIFIC practice areas? \r\n\r\nContent Type: Legislation   \r\n\r\nProduct Experience: Alert\r\n\r\nCustomer Sector: CORPORATE\r\n\r\nCaptured From (Firm ID / Account No): QUIN5043',NULL,2,27,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response:\r\nThe user could see there was an updater one can set but this is a general one and thought it would provide too much info - they wanted a tailored updater.\r\nThe current updater would cover updates from all practice areas but I agree it\'s not targetted and that would be a useful enhancement. it would mean the resource was more useful and relevant to other business units and drive up usage.\r\n\r\n\r\nTo be discussed at meeting on 30/11/2010, following conversation with Dave Coleman on 25/11/2010. YM 26/11/2010','',NULL,'Quinetiq',NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 13:17:19',111,'2011-01-19 15:58:04',11,0,NULL,NULL,NULL,'N'),(1461,'COMPETITOR','Direct Mail','WestLaw Oct Newsletter',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'WestLaw UK launch INDEX OF LEGAL TERMS - A new way to start your legal research on 26 October. Also included is suggested search terms (Wordwheels).\r\n\r\nOn 26 October (subject to testing) Westlaw launch their Index of Legal Terms allowing the use of legal terms as the entry point to research. This enhancement adds a whole new set of content (in the form of legal dictionaries and also enables a search for Latin phrases, providing both translations and definitions) . \r\n\r\nThis enhancement adds a whole new set of content for you to use in your research, in the form of legal dictionaries:\r\n\r\n Strouds Judicial Dictionary of Words and Phrases\r\n Jowitts Dictionary of English Law \r\n Osborns Concise Law Dictionary\r\n\r\nOffering concise, expert explanations of legal concepts and terms with links to the supporting cases and legislation you need to join up your research, they will allow you to cut straight to the heart of a matter.\r\n\r\n\r\n\r\n',NULL,1,0,NULL,'From Alex Smith\r\n\r\nPlease see below the Westlaw.co.uk announcement around their enhancement on Legal Terms and using legal terms as the entry point to research. \r\n\r\nThis makes our Legal Terms Navigator launch in the December Release (around 4 December) absolutely crucial to meet with as much functionality and content as possible. \r\n\r\nWe need: \r\n\r\n(a) to meet our product development dates and targets without fail. \r\n(b) have as many legal terms in the Navigator as possible for launch\r\n(c) aggressively market this as the way of the future and as something modern and new. \r\n\r\nLuckily West have \"just\" (with nice functionality including wordwheel) put on print dictionaries so we can market their attempt as old skool and a bit lazy compare with Navigator.\r\n\r\nThey don\'t have the backing of the indexes reinvented and they don\'t have the authority of Halsbury\'s to back their definitions.\r\n\r\nThe product side is in hand and we need to gain absolute confidence in the December date. \r\n\r\nContent is twofold: \r\n\r\n(a) Lawrence and content solutions are working hard in getting our Indexes into shape for online\r\n\r\n(b) Katy, two paralegals in my team and a team of freelancers are working on delivering 500 legal terms for launch reaching 750 by year end. However if anyone has further resource to offer in their editorial teams I\'m sure Katy can fully utilise, especially making sure the defining cases and legislation is pulled out. \r\n\r\nThe impact? \r\n\r\nThe West move backs the view I\'ve had all year based on customer research and interviews that Legal Terms is the way into our products and core titles like Halsbury\'s Laws, all england and our practitioner titles. I\'m pleased West have played their card as we have the measure of their offering and whilst it\'s annoying they are there first with a wordwheel of legal terms and terms at the top of their results their approach reflects their slightly dated approach of putting \'books online\" (something we did in the 1990s). Our offering in December remains new, fresh and different and we need to drive forward with the content and product delivery with renewed vigour and focus and to market this firmly as the future of legal research and the doorway to our crown jewels. \r\n\r\nI\'m working with Laura already oin the marketing and I look forward to working with you and your teams to deliver something \'gamechanging\' in December. \r\n\r\nAny ideas and suggestions around accelerating content delivery and marketing tack please let me know. \r\n\r\nAlex\r\n',NULL,NULL,NULL,NULL,NULL,NULL,'ThomsonReuters - WestLawUK',NULL,62,'2010-10-27 13:37:05',111,'2010-11-26 12:53:04',7,0,NULL,NULL,NULL,'N'),(1471,'PRODUCT','Customer training session','David Hyland, Partner',9686,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: David Smith\r\n\r\nDate Captured: 05/05/2010\r\n\r\nDialogue Summary: Browsing bulletins\r\n\r\nContext: renewal training on lexis library - browsing Tree of Harvey Bulletin\r\n\r\nVerbatim: how can we tell which month each bulletin refers to?... It would be useful if the bulletin number also showed the month it was published \r\n\r\nProduct Experience: Search & browse\r\n\r\nCustomer Sector: LEGAL - Niche inc Factory\r\n\r\nCaptured From (Firm ID / Account No): PJHL5000',NULL,NULL,0,0,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\n\"That\'s a good idea - I will suggest it as an enhancement to our site\"\r\nThis has been reported to terry Eagling-joyce who will raise it further as a proposed development with the editorial team\r\n\r\nNo action required. YM 15/11/2010','1288186817.htm','RE Harvey Bulletin date mark up and Index queries.htm',NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 13:39:10',111,'2010-12-15 15:45:21',7,0,NULL,NULL,NULL,'N'),(1481,'PRODUCT','Customer training session','Sarah King, Partner',9686,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: David Smith\r\n\r\nDate Captured: 05/05/2010\r\n\r\nDialogue Summary: Unable to open cases in LexisLibrary\r\n\r\nContext: renewal training on lexis library\r\n\r\nVerbatim: there appears to be some cases we cannot open which is a bit annoying as they are clearly employment cases and the menu is supposed to give us access to employment content\r\n\r\nProduct Experience: Navigation   \r\n\r\nCustomer Sector: LEGAL - Niche inc Factory   \r\n\r\nCaptured From (Firm ID / Account No): PJHL5000',NULL,NULL,24,1,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nThey are referring to ALL ER reporter cases which are not included within this menu - just ALL ER (employment) and ALL ER European cases.\r\nThe all england reporter is not a source included within the Employment menu - with access to the IRLS, all er itself, knights industrial and now the industrial tribunal reports, it\'s a huge case database.\r\nCustomer still couldn\'t work out why they didn\'t get access to cases picked up by All er reporter - when they were hyper linked in LL.\r\n\r\nNo call to action. YM 15/11/2010','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 14:12:46',111,'2010-12-15 16:27:35',7,0,NULL,NULL,NULL,'N'),(1491,'PRODUCT','Renewal or new business conversation','Roger Margand, Partner',5882,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By Lucy Cudd\r\n\r\nDate Captured 01/05/2010\r\n\r\nDialogue Summary: Still doesnt think Lexis PSL Coco is \'there\' yet\r\n\r\nContext: they have taken all lexis PSL modules last year with the exception of PSL coco as they didnt see it as \'ready\' in 09. their PLC coco module was coming up for renewal so wanted to discuss PSL coco once more\r\n\r\nVerbatim: \r\n1) In terms of our range of documents, the customer thinks this is pretty limited.  A good example of shareholders agreements PLC provides shareholders agreements for a range of circumstances together with a lot more in the way of practice notes and checklists\r\n2) The other useful thing about the PLC precedents is the auto-formatting.  The format opening is a lot clearer, a lot easier to navigate through and in terms of the renumbering, it is actually fairly sophisticated in terms of clauses and sub-clauses automatically renumbering as you change it.  There are no bullet points or foot note numbers that you need to remove or play around with as you go through the precedent, but again, as a general point, the whole site runs quicker\r\n3) PLC also does well what the customer would call the support materials in relation to commercial.  When the Companies Act came out, they produced a slideshow summarising the Companies Act changes which you could then download and haut into your own firms logos and colours to present.  They also produced a fairly easy and concise list of checklists and notes on the Companies Acts.  I did not spend a huge amount of time navigating the module but I am not sure you do anything that is at the same level\r\n4) Where we score really well against PLC is in relation to the cases and the overall width of information that we provide.  teh customer thinks that the problem is that in trying to cater for the small to medium firm dealing in small to medium transactions, he does not think that we have got enough depth to deal with the slightly more satiric work which firms of our level still get. \r\n5) he thinks the search engine is a little clunky.  He struggled to get a result when he put shareholders in terms of finding a precedent and had to play around with it for a little while before he was able to find our  template shareholders agreement. \r\n6) customer thinks that in short what we have got is really good particulary the width of precedents in the commercial module, for example, we offer finance and lending documentation that he would have to pay an extra fee to PLC for.   What is not so good is how little there is in there, again, looking at the finance and in particular the lending module, there is one short form facility agreement which, given all the different types of lending and lending transactions they advise on is not sufficiently diverse enough to be as useful as it could be.\r\n\r\nContent Type: Cases; Forms and Precedents\r\n\r\nProduct Experience: Navigation; Autoformatting\r\n\r\nCompetitors: LEG - PLC\r\n\r\nCustomer Sector: LEGAL - General Practice\r\n\r\nCaptured From (Firm ID / Account No): HOOD5000',NULL,NULL,12,1,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\n1) as to the range of company documents, this will be greatly increased by the launch of Corporate in October, as a lot of the private company content in Corporate will flow in to Company Commercial. As to the specific example given of shareholders agreements, the joint ventures sub-topic in Corporate will include a lot more precedents and practice notes in this area, dealing with a broad range of circumstances.\r\n2) We are aware of the auto-formatting/cross-referencing issue and there is a project running at the moment to develop a way to offer this functionality, so this should soon be resolved.  The footnotes and bullet points referred to in the context of company precedents are in the EF&P content included in Company Commercial.  There will be no EF&P precedents in the Corporate module and no EF&P precedents in the company content of the Company Commercial module come October, so this will no longer be an issue for company precedents.  \r\n3) The Corporate module will include comprehensive coverage of the Companies Act 2006, broken down as the product demands into overviews, practice notes, precedents etc., which will for the most part flow through to the Company Commercial module come October.  We are not planning checklists summarising the Companies Act 2006 changes because with the whole Act now being in force this does not seem appropriate/useful  we would be commenting on the historical position.\r\n4) The company content in the Company Commercial module is deliberately aimed at small to medium firms doing small and medium transactions, the Corporate module will be for those doing more complex transactions and for the full range of transactions.  Again, we cant comment on the complexity of the commercial content.\r\n5) This should be improved come October, we are currently working to develop the taxonomy for the Corporate module, so this should help with searching for company content.\r\n6) There will be more financing content in the Corporate module come October, which will then feed into the Company Commercial module.  However, there will not be a huge amount of financing content, as neither Company Commercial nor Corporate are intended to compete with PLCs Financing module.  In the Corporate module and in the company part of Company Commercial module, the intention is only to provide enough high-level financing content to inform a corporate lawyer doing a corporate deal.  Whether there should be a separate LexisPSL Financing module is currently under discussion.  We will also offer high-level tax content in Corporate and Company Commercial come October.\r\n\r\nNo call to action. YM 15/11/2010','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 14:20:04',111,'2010-12-15 16:01:36',7,0,NULL,NULL,NULL,'N'),(1501,'PRODUCT','Customer training session','Solicitor',9487,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Rachel Thomas\r\n\r\nDate Captured: 22/04/2010\r\n\r\nDialogue Summary: Finding related journal entries in LexisLibrary\r\n\r\nContext: Training on LexisLibrary\r\n\r\nVerbatim: We should be able to easily link to relevent journal articles as we want personal opinions.\r\n\r\nContent Type: Journals\r\n\r\nProduct Experience: Search & browse; Navigation   \r\n    \r\nCustomer Sector: LEGAL - Full Service Commercial',NULL,NULL,0,9,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nWe need a Find Related Journal Articles link in LexisLibrary.\r\nFeed back again to prodcut developers, it is on the radar.\r\n\r\n\r\nResponse from Clare Duggan, 12/11/2010\r\n\"Youll be pleased to know that this is something which our Online Coordination Team are working on at the moment and hope to introduce via a Find Related Journals link on LexisLibrary in 2011.\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,80,'2010-10-27 14:26:12',111,'2010-12-15 14:58:12',7,59,NULL,NULL,NULL,'N'),(1511,'PRODUCT','0','Richard Pritchard, Info Assistance',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Moved from ActWise. 27/10/2010\r\n\r\n\r\nCaptured By: Katie Cook\r\n\r\nDate Captured: 20/04/2010\r\n\r\nDialogue Summary: New NexisDirect format\r\n\r\nContext: New Business/ against Factiva. asked what they thought of the nexi direct format and he mentioned that it does not need pictures, just livening up a little. it started a team discussion as the team was split half and half on their views of the colours and format.\r\n\r\nVerbatim: nexis just looks very bland with gray and red\r\n\r\nLN Product Family: Nexis   \r\n    \r\nProduct Experience: Layout\r\n\r\nCompetitors: CPT - Factiva\r\n\r\nCustomer Sector: CORPORATE',NULL,NULL,0,0,'','',NULL,'Commerz Bank',NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 14:50:22',111,'2011-01-19 16:08:52',11,0,NULL,NULL,NULL,'N'),(1521,'PRODUCT','0','Julie Owen, Info Manager',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Katie Cook\r\n\r\nDate Captured: 20/04/2010\r\n\r\nDialogue Summary: Functionality on Nexis is not obvious relative to Factiva\r\n\r\nContext: New Business/ against Factiva. factiva has a page of drop down options to add various filters etc, where our platform is not so visiable with a variety of options, although present - again this came back to lack of shading. client agreed all options available on factiva were present on Nexis.. Just more subtle eg results grouping.\r\n\r\nVerbatim: Nexis feels like there are a lot of optional extras and everything is very hidden (there was an arm movement with this) where as in comparison factiva is very exposed and in your face.. You see all they have to offer! (another arm jesture).\r\n\r\nLN Product Family: Nexis\r\n\r\nCompetitors: CPT - Factiva   \r\n\r\nCustomer Sector: CORPORATE',NULL,NULL,0,0,'','',NULL,'Commerz Bank',NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 14:55:23',111,'2011-01-19 16:08:37',11,0,NULL,NULL,NULL,'N'),(1531,'COMPETITOR','Customer training session','',50007,NULL,NULL,NULL,NULL,NULL,NULL,NULL,50,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Lynne Davies  \r\n\r\nDate Captured: 12/04/2010\r\n\r\nDialogue Summary: PDF downloads of cases\r\n\r\nContext: LexisLibrary training\r\n\r\nVerbatim: Do we have plans/timescales to include the PDF download across all our cases? Apparently, West are going to do this soon & charge it as a bolt on option to the sub. The barristers said they would be prepared to pay this extra charge if it meant they had good PDFs to take to court \r\n\r\nContent Type: Cases\r\n\r\nProduct Experience: PDF download\r\n\r\nCustomer Sector: LEGAL - Bar',NULL,1,0,NULL,'We have added PDFs to several of our case series and are happy to receive feedback on other series which our customers would like us to provide in PDF format so we can look to prioritise these going forward. Ones such as Butterworths Intellectual Property and Technology Cases are an example of such a series which we have added PDFs to, as a direct result of customer feedback. This functionality is something we include within a users subscription, and which also extends to other content types such as UK Parliament Acts.\r\nClare Duggan, 08/11/2010',NULL,'FW West Cases.htm',NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 15:01:27',111,'2011-01-19 16:04:06',11,0,NULL,NULL,NULL,'N'),(1541,'COMPETITOR','0','',50098,NULL,NULL,NULL,NULL,NULL,NULL,NULL,43,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Amy Hand\r\n\r\nDate Captured: 01/03/2010\r\n\r\nDialogue Summary: Clerks and barristers find LawTel easier for finding points of law   \r\n\r\nVerbatim: They prefer to use Lawtel as the Clerks and the Barristers find it easier to find points of law.\r\n1) The Lawtel email update to more user friendly than the updates from LN.\r\n2) The Lawtel email update provides a summary of the case, to determine whether they need to click in on it. LN doesnt and the catchwords are specific enough.\r\n3) Searching for Cases on Lawtel provides the Headnotes, so the relevance can more easily be judged. This saves a lot of time.\r\n4) Searching brings better results back from Lawtel. Assume that you are searching for cases on adjudication.  There will not be an overwhelming number of these, so you may just want to browse through the more recent decisions to see whether the law has changed in some regard or whether any recent decisions have any direct bearing on the particulars issues in your own case.  Typing construction adjudication into a Lawtel case search comes back with 311 results.  Scrolling down the first page, you can quickly see that the vast majority are TCC cases that are relevant to the enquiry.  They are in chronological order.  Scrolling down the results, you also get a little two line summary of the case so that you judge its relevance on the face of it.  Putting the same terms into Bailli (searching for all of those words in the English and Welsh Courts) and you get 864 results.  Many of those do not relate to construction adjudication, which become clear if you rearrange them in date order.  There is no summary of the decision on the search page  indeed unlike Lawtel there is no summary of the case at all.  So in order to determine whether it is relevant, you pretty much have to scan read the whole document (or the first few pages, if the judge has summarised the issues there).  Turning to Lexis, using the same terms in a cases search returns only 33 results!  Again, there is no summary on the results and  because many of these cases are only transcripts that havent appeared in the official law reports  there is no summary / head note either, again obliging you to read through the case to assess it for relevance to the issues that you are investigating.\r\n\r\nContent Type: Cases\r\n\r\nProduct Experience: Search & browse; Navigation\r\n\r\nCustomer Sector: LEGAL - Bar',NULL,1,0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 15:06:16',111,'2011-01-19 16:03:47',11,0,NULL,NULL,NULL,'N'),(1551,'PRODUCT','0','',50392,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Nathan Hegarty\r\n\r\nDate Captured: 01/03/2010\r\n\r\nDialogue Summary: Obstacles to displacing Westlaw with LexisLibrary\r\n\r\nVerbatim: Would not look at replacing Westlaw because:\r\n1) we dont have the Criminal Appeal Law Reports and they need these for the Criminal set within the Chambers.\r\n2) we dont have the Weekly Law Reports and these are the main Law Reports used in Court.\r\n3) we dont have the Criminal Appeal Sentencing Information.\r\n\r\nCompetitors: LEG - Westlaw\r\n\r\nCustomer Sector: LEGAL - Bar',NULL,NULL,21,1,'Response from Clare Duggan to Nathan Hegarty, 12/11/2010\r\n\"Crime is not an area of law we have historically been very strong in. Major criminal cases are covered in the All England Law Reports and criminal commentary is available in Blackstones Criminal Practice and Halsburys Laws of England. The most authoritative law reports are actually the ICLRs which are available on LexisLibrary. We are also planning to launch a LexisPSL Crime Module in 2011 which may be of interest to your customer.\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,36,'2010-10-27 15:12:52',111,'2010-12-15 14:46:54',7,59,NULL,NULL,NULL,'N'),(1561,'PRODUCT','0','',50716,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Nathan Hegarty\r\n\r\nDate Captured: 01/03/2010\r\n\r\nDialogue Summary: Obstacles to displacing Westlaw and Sweet & Maxwell in the Bar   \r\n\r\nVerbatim: \r\n1) Criminal practitioners must have access to Criminal Appeal Reports, Criminal Appeal Reports (Sentencing) and some other Criminal related law reports that are published by Sweet & Maxwell.  He cant see us ever resolving this as the reports are published by Sweet and Maxwell, who have the same problem with Westlaw not having All England as it is ours.\r\n2) There are other law reports such as Housing Law Reports that Westlaw have, but we dont\r\n3) Although they prefer our Legislation, Westlaw has historical versions of Legislation which are very useful.\r\n4) Westlaw has a one-page report with each case that details other related cases, legislation etc.  Although we have links to these within our service, it is useful to have a printout to refer to as a summary.\r\n5) Westlaw has more journals than we do and some of them are particularly useful\r\n\r\nContent Type: Cases; Legislation; Journals  \r\n\r\nCompetitors: LEG - Sweet & Maxwell; LEG - Westlaw   \r\n\r\nCustomer Sector: LEGAL - Bar',NULL,NULL,21,1,'1) Although this is an area which Sweet and Maxwell are very strong in, we do offer an array of criminal cases, and very popular commentary titles such as Blackstones Criminal Practice which may be of interest. We are also hoping to launch a new LexisPSL Crime module next year which will mean a wide selection of tools for a criminal lawyer.\r\n2) Again, we do offer a wide selection of housing cases within series such as the All England Law Reports and Estates Gazette. However we would be interested to know if there are any particular cases which would be useful or which our competitor is or isnt covering presently.\r\n3) Customers can get access to historical versions post-1998 through our Legislation team who will email users directly within 2 hours, but more often a few minutes. To submit a request, users simply need to click on the link entitled Historical Versions on the Legislation Search Form and fill in the required information. \r\n4) This is interesting feedback which weve not had before but we will certainly monitor going forward to see if its a common customer requirement across our various sectors.\r\n5) We are looking to extend our journals offering in 2011 so would be interested in the type or name of journals which customers would like us to cover. We are always looking to recruit users onto our quarterly Product Advisory Boards so they can help to drive product development. Do let us know if this customer would be interested in attending.\r\nClare Duggan, 08/11/2010','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 15:16:22',111,'2010-12-15 14:41:35',7,0,NULL,NULL,NULL,'N'),(1571,'PRODUCT','0','Barrister',50197,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Amy Hand\r\n\r\nDate Captured: 01/03/2010\r\n\r\nDialogue Summary: Obstacles to selling LexisLibrary in the Bar\r\n\r\nVerbatim: \r\n1) members really like the automatic build for historical legislation on Westlaw. Barristers often receive the brief on a case at very short notice and often work late into the night preparing their argument  in this situation it is extremely valuable to have immediate access. \r\n2) members rely heavily on Chitty which they cant get on Lexis\r\n\r\nCompetitors: LEG - Sweet & Maxwell; LEG - Westlaw   \r\n\r\nCustomer Sector: LEGAL - Bar',NULL,NULL,0,2,'1) Customers can get access to historical versions post-1998 through our Legislation team who will email users directly within 2 hours, but more often a few minutes. To submit a request, users simply need to click on the link entitled Historical Versions on the Legislation Search Form and fill in the required information. We have looked into automating this process over the years but there are always enhancements which users prioritise over this one, due to it generally being something they dont need to do very often. It is however something which we continue to monitor and would be interested in knowing if there are any particular areas of law which customers particularly require this historical information for. It may be we can then look to prioritise Acts within certain practice areas going forward.\r\n2) Chitty is one of Sweet and Maxwells titles which unfortunately (but not surprisingly) we have been unable to licence. We do however have a title called Butterworths Common Law Series: The Law of Contract which may be of use to this barrister.\r\nClare Duggan, 08/11/2010','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 15:32:59',111,'2010-12-15 14:38:40',7,0,NULL,NULL,NULL,'N'),(1581,'CUSTOMER','0','Practice Administrator',50290,50290,'','','',NULL,NULL,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Anna Routledge\r\n\r\nDate Captured: 01/03/2010\r\n\r\nDialogue Summary: Need for historical legislation in the Bar\r\n   \r\nVerbatim: Rejected a proposal for the Bar collection based on it being too expensive. They felt that the value they would get from it wasnt worth the price as they would still need to take Westlaw as historical legislation is important to them. She said there was no particular practice area that required this historical legislation it was just across the board.\r\n\r\nContent Type: Legislation\r\n\r\nCustomer Sector: LEGAL - Bar',50,1,0,NULL,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 15:38:54',111,'2011-01-19 16:01:32',11,0,NULL,NULL,NULL,'N'),(1591,'CUSTOMER','0','Barrister',50007,50007,'','','',NULL,NULL,NULL,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Nathan Hegarty\r\n\r\nDate Captured: 01/03/2010\r\n\r\nDialogue Summary: Westlaw seen by Chambers as essential, vs LexisLibrary which is \'nice-to-have\' if affordable\r\n\r\nVerbatim: Wouldnt subscribe to LN becuase in the past they had been quoted around 60k for 35 users to have LexisLibrary. Their Westlaw sub gives them the basics that they need, particularly as their main area of work is Crime. LexisLibrary would be useful for the work they do occasionally when they need some commentary or more obscure content-however it is not worth the additional 1800 per fee earner to subscribe to both.\r\nCannot cancel Westlaw as they need it for the Criminal Appreal Law Reports. \r\n\r\nContent Type: Cases\r\n\r\nCustomer Sector: LEGAL - Bar',50,1,21,NULL,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 15:43:23',111,'2011-01-19 16:01:47',11,0,NULL,NULL,NULL,'N'),(1601,'COMPETITOR','0','Librarian',50379,NULL,NULL,NULL,NULL,NULL,NULL,NULL,39,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nCaptured By: Anna Routledge\r\n   \r\nDate Captured: 01/03/2010\r\n\r\nDialogue Summary: Chambers feedback on Lawtel, Jordans and print vs online\r\n\r\nVerbatim: Taken Lawtel for 10 years (chambers wide) as they like daily updates and find the transcripts very useful. I asked if they found transcripts sufficient as I didnt think they could be cited if there was a law report available for this case, she seemed to think that they could still access the complete report through Lawtel as well if they needed to. They also like the case comments section as it tells them how that case had changed the law.\r\nTake Jordans Family online for approx 10 users. Denise wasnt aware that we licensed the FLRs online but she said they would still wouldnt take our Family Online menu as they needed access Harman and Duckworth as the key texts.\r\nThe majority of barristers are very traditional and would still want the major works in print but she wasnt aware that we can combine with online at a reasonable price. Denise also wasnt aware that not all online subs have to be chambers wide i.e. we would only charge 10 users for Family. Agreed to raise with committee at next meeting to see if they want to pursue further.\r\n\r\nContent Type: Cases\r\n\r\nCompetitors: LEG - Jordans; LEG - Lawtel\r\n\r\nCustomer Sector: LEGAL - Bar',NULL,1,0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-27 15:49:23',111,'2011-01-19 16:03:16',11,0,NULL,NULL,NULL,'N'),(1611,'PRODUCT','Customer training session','Lyn Wildish',NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'Client has had endless technical problems trying to link from the LN Library back to PSL. The links stall and fail a largepercentage of the time and it affects all fee earners who have lost confidence and patience with using the service. They have contacted the help desk on numerous occaisions and get no response.',NULL,NULL,59,6,'The client needs to be contacted and the technical problems that are stopping them using the content resolved.\r\n\r\nResponse from Clare Duggan, 29/10/2010\r\nId be interested in seeing exactly what steps they are taking and screenshots of the issues as this doesnt give me enough information to work with. Im assuming it is one for the technical team but Id be happy to take a look if more details are provided.\r\nYM 29/10/2010','',NULL,'Steels',NULL,NULL,'LexisPSL',NULL,NULL,8,'2010-10-28 09:42:07',111,'2010-11-26 11:57:00',7,59,NULL,NULL,NULL,'N'),(1621,'PRODUCT','Customer training session','Lyn WIldish',NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'The practitioners attending the training were negative and  the employment team seemed as though they attended the session especially to have a rant about how inadequate the content is in comparison to PLC! They think that there are huge gaps in content and that PLC is far more thorough. The trainer did suggest at that point that that our PSLs are open and receptive to feedback and would be happy to look into adding content if they are made aware of the gaps.\r\n',NULL,NULL,24,6,'PLease can someone from the Employment PSL team contact Lynn initially at the client on 01379 652141 and get the name of one of the Employment team and speak with them directly to find out exactly what content they feel is missing in comparison to PLC. At the moment they feel that the service is a waste of money and their renewal is due Feb 11 and I suspect the sub will be lost at that point.\r\n\r\nResponse from Clare Duggan, 29/10/2010\r\nAgain, wed need to know exactly what content they believe is missing. Id suggest you invite Philip Thornton or one of the team along to your meeting to discuss content issues in more depth.\r\nYM 29/10/2010','',NULL,'Steels',NULL,NULL,'LexisPSL',NULL,NULL,8,'2010-10-28 09:45:41',111,'2010-11-26 11:56:13',7,59,NULL,NULL,NULL,'N'),(1631,'PRODUCT','Customer training session','Lyn WIldish',NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'The commercial team were really unhappy about the content in the commercial PSL module. They have found on occasions that the precedents in commercial simply ask you to click on a link which takes you back into Lexis Library- in which case, they dont see the need for PSL.\r\n',NULL,NULL,12,6,'Again please can someone from the Commercial PSL team contact the client and obtain the name of one of the Commercial team and then go through with them specifically what they would expect and want to see within the site and talk through our upcoming additions with the client\r\n\r\nResponse from Clare Duggan, 29/10/2010\r\nThe inclusion of LexisLibrary precedents in the CoCo module came about as a result of sales feedback as there was a feeling that customers who took both products didnt know the full extent of what was available on both. It would be worth discussing this in more depth with Veronica Bailey.\r\nYM 29/10/2010','',NULL,'Steeles',NULL,NULL,'LexisPSL',NULL,NULL,8,'2010-10-28 09:55:44',111,'2010-11-26 11:55:32',7,59,NULL,NULL,NULL,'N'),(1641,'PRODUCT','Customer training session','Lyn Wildish',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The practitioners do not feel that they have any great need for PSL because they primarily find PSL useful for the precedent documents however they find the precedents in PSL are not as relevant or comprehensive as they would find in EF&P. They prefer to go to EF&P within Lexis Library where they can find a more broader range of precedents. At that point the trainer did highlight the additional benefits of overview, practice notes, commentary, cases etc. they also pointed out the link to view results for precedents in Lexis Library. However, at that point,  the seamless link back to the Lexis Library let us down and didnt work. When the trainer finally got into Lexis Library it had returned a screen with over 3500 results which was not helpful at all.\r\n',NULL,NULL,59,3,'This relates to both the practise areas they subscribe to, Employment and Commercial. I am going to visit the client to understand in more detail what their content issues are and it would be helpful to have a product specialist with me as I will not be able to answer any very specific comparison between either pLC or EF & P\r\n\r\nResponse from Clare Duggan, 29/10/2010\r\nAgain, an item to discuss when you take one of the lawyers along to your customer meeting. With regards to the 3,500 message, this is no longer appearing on LexisLibrary, as we now display the most relevant 1000 documents when the results list is this large. The linking issue sounds the same issue as 1611 above. \r\nYM 29/10/2010','',NULL,'Steels',NULL,'Lexis PSL','Lexis PSL',NULL,NULL,8,'2010-10-28 10:02:41',111,'2010-11-26 11:54:45',7,59,NULL,NULL,NULL,'N'),(1651,'PRODUCT','Informal conversation','Junior Lawyer',5570,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'\"She told me that she was very impressed with PSL and called it brilliant. She found it easy to find what she was looking for and generally easier to use than PLC.\"\r\n(See attached email)',NULL,NULL,0,6,'No call to action. YM 29/10/2010','1288366105.htm','RE PSL feedback.htm',NULL,NULL,NULL,NULL,NULL,NULL,52,'2010-10-28 10:10:43',111,'2010-12-15 14:33:16',7,0,NULL,NULL,NULL,'N'),(1661,'CUSTOMER','Renewal or new business conversation','Josie Norris, Paralegal',2663,2663,'','Josie Norris','Paralegal',0,0,NULL,NULL,'\"At our meeting the other Friday, you asked which precedents would persuade us away from PLC if they were offered on your corporate and commercial PSL service.\r\n \r\nI have consulted members of my department and we agree that the following would be our top 11 corporate and commercial documents (sorry, snuck another one in!):\r\n \r\n Asset Purchase Agreement; \r\n- Share Purchase Agreement;\r\n- Shareholders\' Agreement;\r\n- standard Articles (amended);\r\n- Joint Venture Agreement;\r\n- Trade Mark Licence;\r\n- Consultancy Agreement (Service Company);\r\n- Intellectual Property Assignment;\r\n- Terms & Conditions- Goods & Services;\r\n- Manufacturing Agreement;\r\n- Mutual Non-disclosure/Confidentiality Agreement.\r\n \r\nI will be in touch regarding feedback from our PSL trial.\"\r\n\r\n(see attached email)',47,4,0,0,'','1288261885.htm','Fw Top 10 Corporate  Commercial precedents.htm','',NULL,NULL,'','',0,52,'2010-10-28 10:31:17',801,'2011-01-19 16:02:22',0,0,0,NULL,NULL,'N'),(1671,'COMPETITOR','Informal conversation','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Solo pricing from PLC and Sweet and Maxwell / Lawtel\r\n\r\nThe 2 main products I have been looking at are PLC and S&Ms Practical Commercial Precedents (both on-line via Lawtel and via the CD updated version).  \r\n\r\nPLC will provide corporate only access for 688 or their entire UK site for 1800.  The corporate service is quite honestly brilliant.  The only issue is that often documents you may need straddle into other service areas (employment / finance / IT/IP) so you may not really be able to manage with this alone.  The 1800 though is too expensive.  There is a middle option for some additional services in addition to the corporate service for c. 1300 but this again is expensive, and it will be sods law, the documents you need also straddle outside these areas. \r\n\r\nS&M will provide their CD commercial precedents for c. 980, and payable in 4 quarterly payments.  Whilst the depth in the corporate area is not that great, the key benefit is the width of the range of precedents as they cover most commercial areas.  Being able to pay quarterly is of course massively helpful.  Also, as I have the CD, I may be able to get away with using the precedents unmaintained after the first year for a little bit of time, if I independently keep up to date. \r\n',NULL,4,12,NULL,'Ensure our pricing and offering for solo\'s is competitive.  \r\nBasic offering at low price with options to pay for extra as and when needed may by attractive.',NULL,NULL,'SL Law Limited',NULL,NULL,NULL,'PLC & ThomsonReuters',NULL,62,'2010-11-01 10:13:58',111,'2010-11-26 10:18:13',7,121,NULL,NULL,NULL,'N'),(1681,'COMPETITOR','Customer training session','Helen Hinder',NULL,NULL,NULL,'',NULL,0,NULL,NULL,50,'It\'s great how flexible you are with training, coming out at weekends and evenings because Westlaw won\'t, despite being asked, as a matter of company policy.',NULL,0,0,0,'','',NULL,'College of Law',NULL,NULL,NULL,NULL,NULL,80,'2010-11-02 10:53:45',801,'2011-11-14 14:55:57',82,NULL,0,'TBC','','N'),(1691,'PRODUCT','Customer training session','Catherine Batson',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'\"Is there any pagination yet in the legal journals? At the moment it is tricky for students/academics to provide specific references. If asked I will say to use another database where you can do this such as Westlaw. It is one of Westlaw\'s key differentiators.\"',NULL,NULL,0,5,'\"The reason for not reproducing page numbers on Journals (in a similar fashion as we do for cases) is because we don\'t reproduce the journals as we do in hard copy ie page 1 followed by page 2 etc because we arrange the articles and editorial comments differently. To follow the hardcopy scheme would not have the structure that aids navigation online - therefore to put in the muddled page numbers would be messy. It is however something which we will continue to monitor.\"\r\nClare Duggan, 08/11/2010','',NULL,'University of Surrey',NULL,NULL,'LexisLibray',NULL,NULL,80,'2010-11-02 10:55:15',111,'2010-12-15 13:00:25',7,0,NULL,NULL,NULL,'N'),(1701,'PRODUCT','Customer training session','Catherine Batson',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'\"My other request is to be able to extract multiple references into software such as Endnote for academics who need to compile a bibliography. Westlaw can\'t do ths either but academics expect it.\"',NULL,NULL,0,9,'\"Bibliographic software compatibility is something which we have been working towards and we are hoping that LexisLibrary will be compatible with Refworks by the end of 2010. We will keep customers informed in our monthly e-burst update.\"\r\nClare Duggan, 08/11/2010','',NULL,'University of Surrey',NULL,NULL,'LexisLibrary',NULL,NULL,80,'2010-11-02 10:56:13',111,'2010-12-15 12:40:40',7,0,NULL,NULL,NULL,'N'),(1711,'COMPETITOR','Publication','Orange Rag',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,49,'Peter Lake, who has been with Thomson Reuters for the past 23 years  most recently as Managing Director of Sweet & Maxwell  is leaving the company at the end of this year. We wish him well for the future  although \'well\' is possibly not the best word as Orange Rag editor Charles Christian inveigled Peter into become the chairman of the board of a literary trust which, along with 99% of all the other arts groups in England & Wales, thanks to government spending cuts is now facing the worst financial crisis in its history. So who is his successor? It is Mark Schlageter who currently runs TR\'s Tax & Accounting research and guidance business in the US. He has a reputation for doing a great job driving online developments and revenues  so that is good. But his job title!!!  Goodbye Managing Director, Sweet & Maxwell and hello President, Core Legal UK & Ireland. (Must remember, in the world of publishing, books are no longer books but products.)\r\n',NULL,1,0,NULL,'No call the action; Derek confirms that the appropriate people have been informed. YM 06/12/2010',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,51,'2010-11-02 13:00:08',111,'2010-12-06 17:15:24',7,0,NULL,NULL,NULL,'N'),(1721,'COMPETITOR','Publication','Orange Rag',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Peter Lake, who has been with Thomson Reuters for the past 23 years  most recently as Managing Director of Sweet & Maxwell  is leaving the company at the end of this year. We wish him well for the future  although \'well\' is possibly not the best word as Orange Rag editor Charles Christian inveigled Peter into become the chairman of the board of a literary trust which, along with 99% of all the other arts groups in England & Wales, thanks to government spending cuts is now facing the worst financial crisis in its history. So who is his successor? It is Mark Schlageter who currently runs TR\'s Tax & Accounting research and guidance business in the US. He has a reputation for doing a great job driving online developments and revenues  so that is good. But his job title!!!  Goodbye Managing Director, Sweet & Maxwell and hello President, Core Legal UK & Ireland. (Must remember, in the world of publishing, books are no longer books but products.)',NULL,0,0,NULL,'No call to action; Derek confirms that the appropriate people have been infomed. YM 06/12/2010',NULL,NULL,NULL,NULL,NULL,NULL,'ThomsonReuters (Sweet & Maxwell)',NULL,62,'2010-11-03 11:06:34',111,'2010-12-06 17:17:24',7,0,NULL,NULL,NULL,'N'),(1731,'MARKET','Other','',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,'PLC have launched a Global GC product covering the core business juristictions http://gld.practicallaw.com/about/gld\r\n',NULL,4,36,NULL,'We need to assess how much of a threat this is to Masterplan/Legal Intelligence','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,51,'2010-11-03 19:17:35',111,'2010-11-26 10:01:38',7,62,NULL,NULL,NULL,'N'),(1741,'CUSTOMER','Renewal or new business conversation','Julie Kitchen',NULL,NULL,'','','',NULL,NULL,NULL,NULL,'LexisSmart Access - Hugh James and Ashfords have both asked if there can be separate access rather than through their Lexis online subscriptions as it is their secreataryies who would use this. An icon on their desk tops or a direct link that they can all use rather than typing in a password or setting them up with individual log ons. This will encourage more usage of the service. The easier we can make it the more likely it is to be used according to my contacts even if it is better than Laser Forms.',0,4,0,NULL,'More feedback than a problem. This can be done but it is important that the feedback is picked up by the right people.','',NULL,'Hugh James',NULL,NULL,NULL,NULL,NULL,9,'2010-11-05 11:33:31',111,'2010-11-26 12:55:58',7,0,NULL,NULL,NULL,'N'),(1751,'CUSTOMER','Renewal or new business conversation','Ongoing',NULL,NULL,'','','',NULL,NULL,NULL,NULL,'The time we take to issue passwords is now closer to three days rather the 24 hours it used to be. This causes a lot of problems for the clients as it is usually when someone wants to use our service but can\'t. The long wait aggravates the problem. I am constantly told that Westlaw and PLC provide them on the same day usually within three hours. I am not sure if this is a resource issue and Stephen Maxwell always helps if required but as a standard it reflects badly on LexisNexis. Client admin is a way round it but I this isn\'t suitable for everyone.\r\nSmall problems like this cause a lot of damage to our reputation.',50,0,0,NULL,'Improve the resources so we issue passwords quicker. It seems as though we have lost a member of staff or two and the peole left are struggling to keep up with the requests.','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,'2010-11-05 11:42:34',111,'2010-11-26 12:56:27',7,0,NULL,NULL,NULL,'N'),(1761,'COMPETITOR','Other','candidate interview',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,47,'They position and sell against LexisNexis on the following:\r\n\r\n18 Practice Areas verses our 7  \"customer can build their own package just for the content they need\"\r\nFocus on Commercial firms which are typically larger teams  price is per department, so an easier sell\r\nFocus on CoCo teams because they know their content is rich and CoCo depts influence purchasing preference of the firm\r\nPlant seeds in the Sales Process of Competitor pitfalls, ie: have a look at the X agreement on LexisNexis by comparison (knowing we dont even have it, so negative perception feels real).\r\nThe PLC Brand, most firms have heard of their service; they use their strong reputation to generate the \'must have\' feeling\r\n',NULL,4,12,NULL,'get a list of PLC CoCo precedents and ensure LPSL includes this as a minimum\r\nfind out whats missing in CoCo and ensure we have this in either LPSL or LexisLibrary and then inform the sales group so we know where to find it\r\nhave a core list of precedents (or whatever the content challange is) which we know we have and PLC does not, and which we know customers want, and actively expose the absence as a weakness in PLC\r\nuse the \'build your own package\' approach - we will be able to offer more practice areas next year\r\n\r\n\r\nResponse from Clare Duggan, 12/11/2010\r\n\r\n\"Ive included Cara, Susan and Laura from Content Acquisition in the email as I believe that they will be interested in the feedback and how we approach this.\r\n\r\nI am not sure that simply replicating PLC precedents or other content in our CoCo module is the right approach. My preference would be for sales to set up some customer meetings for Content Acquisition to attend and get a real understanding what it is that customers are after on the content front so we can prioritise accordingly and get to the heart of our customers needs. I am sure the quality and the range of areas covered are as, if not more, important than pure numbers. We also have to remember that PLC have been writing this content for over 10 years so simply replicating what theyve done is not going to be quick or necessarily the best way to compete. I have heard some customers complain that PLC have a bloated offering with too many precedents on the same matter, so it may be that we need to validate this and come up with a  more compelling offer.\"\r\n\r\nResponse from Cara Annett, 21/01/2011 \r\nThe Content Acquisition response to this was communicated to WFT in a recent Sales meeting (3/01/2011), and is set out in the attached slides [Wai-Fung please note that in the table I have amalgamated standard docs and standard clauses into precedents as previously discussed]. Essentially, we have identified (as a rough first cut) approx. 300 missing docs and we are prioritising them based on usefulness to the customer (anything esoteric, out of date or irrelevant to a company commercial lawyer is categorised as 4 or 5 priority; therefore not urgent. We will revisit to this group of documents to provide Sales with an explanation as to why they are not useful to have in PLC once priorities 1 and 2 have been addressed. Priorities 1 and 2 are being added to the CoCo teams roadmap and in due course we will communicate the publication of these documents or the timeframe for addition.\r\n\r\nMany thanks to Wai-Fung who has provided a law grad on secondment to Content Acq. for the next two weeks. Jess will validate the current variance analysis, update it, output a list of docs we have that PLC don\'t (to provide to Sales) and refine the responsibilities and reasoning behind priorities.\"\r\n','1295619374.pptx','Sales PA team Jan 2011.pptx',NULL,NULL,NULL,NULL,NULL,NULL,54,'2010-11-09 22:52:12',241,'2010-11-26 10:25:56',7,59,NULL,NULL,NULL,'N'),(1771,'COMPETITOR','Publication','OrangeRag',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'ClearPeople push Sharepoint DMS into corporate sector \r\n\r\nClearPeople, the provider of SharePoint-based document management solutions for law firms (which include Linklaters spinoff Kinstellar and London based Winckworth Sherwood) have just announced their DMS solution has been tailored  based on client demand for the corporate legal sector. ClearPeoples latest implementations of this DMS for inhouse legal teams include a global defence manufacturer and GDF Suez, one of the worlds largest energy companies. \r\n \r\n\"With our solution and with the MacroView DMF integration, users can manage documents in approval and compliance processes directly from within the Microsoft Office applications they use every day, such as Outlook  letting the users work efficiently within their comfort zone,\" said Gabriel Karawani who heads up ClearPeoples Business Solutions team.\r\n \r\nClearPeoples document management solution builds on SharePoint and, since most mid-size and large corporates already have a SharePoint strategy, the incremental costs of providing ClearPeoples solution to legal teams is typically much lower than that of competing systems. \"Most large corporate IT departments already have  or are building - SharePoint skills, so ClearPeoples DM solution is simply an incremental step. In fact, when you look at the total cost of ownership, a DM solution from ClearPeople typically costs 50% or less than comparable solutions.\" continued Karawani.\r\n',NULL,3,0,NULL,'More movement in the in-house legal solutions space. Greater pressure for LN clarity of approach for in-house market.',NULL,NULL,NULL,NULL,NULL,NULL,'ClearPeople',NULL,62,'2010-11-10 10:02:53',111,'2010-12-16 13:49:37',7,0,NULL,NULL,NULL,'N'),(1781,'PRODUCT','Customer training session','Nic Pestell',NULL,NULL,NULL,NULL,NULL,NULL,1,70,NULL,'The question was asked as to whether cross references were linked within precedents once downloaded or whether they had to be manually updated. it was pointed out by other members of the session that other provider\'s precedents (PLC\'s) do have this funtionality.',NULL,NULL,0,3,'i indicated there is a project underway to enable this kind of functionality which is increasingly expected as a BASIC function of our downloaded precedents - this project needs to have more resource and urgency if PLC are to be stopped in their tracks.\r\n\r\nResponse from Clare Duggan, 12/11/2010\r\n\"Content Solutions are working tirelessly on the LexisSmart Style Project and hope to deliver this functionality in Q1, 2011. There will be communications and demonstrations available in the new year prior to launch.\"\r\n\r\nFurther response from Clare Duggan, 17/11/2010\r\n\"Ive just had a further update on this. Cross referencing is actually outside the scope of this project but there is some work being looked at about cross referencing of numbers longer term. We dont yet have a timeframe on this.\r\n\r\nApologies for any confusion. Im sure John Hanrattty could provide further information if required.\"','',NULL,'Machins',NULL,NULL,NULL,NULL,NULL,65,'2010-11-10 15:10:52',111,'2010-11-26 12:58:01',7,59,NULL,NULL,NULL,'N'),(1791,'PRODUCT','Customer training session','Deborah Ripping',NULL,NULL,NULL,NULL,NULL,NULL,NULL,96,NULL,'Deborah indicated that access to the LVT (land valuation Tribunals) decisions would be useful through lexis library ',NULL,NULL,49,1,'investigate sourcing this content\r\n\r\nResponse from Clare Duggan, 12/11/2010\r\n\"I have passed this feedback onto the Cases team to investigate. I will let you know of any developments.\"\r\n\r\nResponse from Clare Duggan, 15/11/2010\r\n\"The cases team have done some exploration of your feedback below and haven\'t been able to find anything on Land Valuation Tribunals.  There is a website called \"Valuation Tribunals\" and also a website called Residential Property Tribunal Service which talks about Leasehold Valuation Tribunals (also referred to as LVT). If the customer could provide further information or examples of this content it might be possible to evaluate whether this is something that would be included in our cases offering.\r\n \r\nThis has been flagged with Hemali Patel, Managing Editor of Case Materials, in case there is any further feedback relating to this.  There are currently no plans to add any content like this at the moment.\"','',NULL,'Machins',NULL,'Legal Library',NULL,NULL,NULL,65,'2010-11-10 15:17:07',111,'2010-11-26 12:58:52',7,59,NULL,NULL,NULL,'N'),(1801,'CUSTOMER','Other','Emma Reid-Chalmers',NULL,NULL,'CHAM5335','Emma Reid-Chalmers','Barrister',NULL,NULL,NULL,NULL,'The service that the customer ideally requires (LexisNexis Library) is too expensive for a sole practitioner barrister that does not have the collective buying power of a set of chambers behind them, yet the customer still needs the same breadth of resources that are available to chambers.  The customer wants a subscription to the library but cannot afford all the content she requires, as she has a broad common law practice that spans multiple practice areas on an unpredictable basis.  Flexible contracts with the option to switch practice area menus would not be suitable becasue of the lack of a single specialised practice area, thus the customer would be swapping practice areas every time they received a new instruction.  The customer would like a subscription that provides a backbone library.  Then on an as needed basis,would be able to purchase a fixed length (i.e. a month) temporary access to the additional content they require to enable them to act upon their brief.\r\n\r\nThe customer finds that the typical instructions she recieves are those that span the mid ground between numerous practice areas, as these are where legal problems occur and the solicitors feel unable to deal with the issues arising.\r\n\r\nRather than subscribe to our services the customer currently spends 200-300 a time travelling to Lincolns Inn at weekends to use the Inn\'s library (this gives them an entire library rather than just our content e.g. westlaw et al) and does this approximately every other month.  The customer states that this is considerably cheaper than taking a subscription.',0,1,0,NULL,'Look at a different, flexible and affordable packages for sole practitioner (or small groupsbarristers as I have many customers who travel to the Inns to use the library rather than subscribe to us.\r\n\r\nPassed to Dave Coleman. YM 15/11/2010','',NULL,'Chambers of Emma Reid-Chalmers','Chambers of Emma Reid-Chalmers',NULL,NULL,NULL,NULL,38,'2010-11-11 10:37:26',111,'2010-11-26 13:21:36',7,52,NULL,NULL,NULL,'N'),(1811,'COMPETITOR','Customer training session','Jessica Tinker',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,47,'Jessica is in the Litigation team at Cannings Connolly.  Cannings Connoly has a LexisLibrary sub but have found it difficult to search, they have trialled LeixsPSL for both the content & the links to LexisLibrary.  Cannings Connoly has one PLC sub to the Corporate module.  Jessica had never used PLC before so was a first time user of PLC.  Jessica need to find out information as to the rules & regs governing how a company communicates with its shareholders via websites.  Jessica typed website communications into LexisPSL CoCo and a few results appeared (we also tried website w/p communications) but nothing that answered her query.  Jessica then logged onto PLC Corporate, typed in website communications and got exactly the information she required (screen dump of PLC results attached).  This perfectly demostrated what customers often give as the reason for preferring PLC - the ease of the search, the results required were found straight away.',NULL,4,19,NULL,'I forwarded this query to the Corporate/CoCo LPSL team, they did reply very quickly and answered the query.  However, I don\'t think the answer given actually addresses the issue.  I was told that the results LexisPSL gave for the seacrh we ran for website communications did actually contain the information Jessica required, but the information was actually contained within a drafting note of one of the precedents given in the results.  So I appreciate the information is there but I am sure when Jessica can run this search on PLC and instantly be given the information she is not going to want to waste her time trying to dig arund on LexisPSL for the information when it is not clearly & obviously presented in the results.\r\nSo the issue would appear to be the ease of use of PLC, and on the basis of this example I can fully understand why Jessica would now feel PLC is quicker, easier to use & quickly directs her to the answer for this query.\r\n\r\nResponse from Clare Duggan, 16/11/2010\r\n\"I think its an interesting one in that looking at PLC results, they dont necessarily even contain the whole phrase (results 2 and 3). Did Jessica think all the results (or just number 1) were relevant? Was the drafting note useful or did she need to be able to access the precedent too? Is the problem that we just dont have the type of material (precedent/practice note or other) that PSL were able to provide. From our authors perspective, it sounds like they believe the right content is on there? I dont suppose we have the full PLC document to show our authors do we? \r\n\r\nOne enhancement we will be introducing on LexisPSL next year is synonym searching which may help if this term as an example has multiple names or referred to in more than one way.\r\n\r\nIm not sure Ive necessarily given you any answers here. In fact Ive probably asked a lot more questions but itd be interesting to dig a bit deeper to see whether its a content, product or functionality issue which needs addressing here.\r\n\r\nHappy to have a chat next time youre in Halsbury House or if you want to continue the discussion on email.\"',NULL,'Cannings Connolly - PLC - website communications.doc','Cannings Connolly',NULL,NULL,NULL,NULL,NULL,68,'2010-11-11 12:04:45',111,'2010-11-26 10:23:40',7,59,NULL,NULL,NULL,'N'),(1821,'COMPETITOR','Publication','OutSell',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The first new service launch from the newly-created GRC (Governance, Risk and Compliance) division is BoardLink, an iPad app which facilitates the handling of board \"books\" and papers in secure digital environments.\r\n\r\nImportant Details: Accountability begins and ends with the Board of Directors. Yet for most directors and executive committee members, getting to the meeting with the right set of papers , including the document only sent out the night before and the amended version of last month\'s market study, is a struggle. For external/non-executive directors on the boards of several enterprises, the struggle can be even worse. And where are last month\'s papers, where I made careful notes about the cash flow position? And where are the questions I noted while reading through all of this week\'s material? And how can I be sure that I have the updated version when a paper is withdrawn and re-issued with amendments? And where is the forward meetings schedule for this committee, which I need to attend when it is discussing remuneration, but not when it is looking at appointments? And to get the documents, and annotate them, and file and store them, do I need to download and print out from a laptop, or can I do all that I need in the meeting on my own tablet? And how do we make sure that all of this material is secure, both in transit and in the possession of the recipient, and that company rules on disclosure and circulation are being monitored and observed?\r\n\r\nThese problems are the meat of the GRC\'s new BoardLink iPad app service. The objective is to give directors a toolset which can be licensed and deployed as a networked communications system, running on the intranet or the internet, probably managed by company secretaries and aimed at improving their productivity greatly, with incremental gains for individual board and committee members. While Westlaw has had the BoardLink service in its armoury for some time, putting it on an iPad (and presumably, in time, on a Blackberry slate, and into other tablet environments) piggybacks on the current device fever to extract some real advantages in corporate communication terms. And here again the new GRC division is able to take something that Thomson Reuters Legal was doing already, give it a twist, and then connect it to a much wider financial and commercial corporate client base. Meanwhile existing BoardLink customers get the app free of charge.\r\n\r\nImplications: Start at the root of the risk, governance and compliance game - in the performance of the board and all that this relates to. This appears to be the GRC message, and while making an iPad app available is a modest enough step forward, then it is also a strategic declaration of intent. Quite apart from following the now familiar theme of connecting the legal/regulatory and financial services wings of Thomson Reuters, this announcement could be vital in other ways if BoardLink in its mobile manifestation can come into widespread use as a communications tool for directors. The way is then open for Thomson Reuters to offer compliance services on such a communications network, including material common to all enterprises of different classes, and then customising to specific requirements of certain types of company. And updating them. This is a Trojan Horse, or a Rockefeller lamp in which the fuel oil of regulatory content can become active in a whole variety of manifestations. And clearly the idea of giving away the app, as Rockefeller is said to have done with the kerosene lamp, is somewhere in the thinking here.\r\n\r\nConsider this as the first of a range of workflow/communication tools for critical commercial functions, and a strategy around creating the active networked application pointed at improving productivity and decision-making. Then add the compliance factor as a way of making these tools immediately relevant and attractive (buyable in the need to have sense, where simply changing the circulation methodology for board papers might be termed nice but not essential) , and a whole approach to moving beyond content into context and usage value becomes apparent. Eventually, in B2B, this contextual approach may become the only way of \"publishing\" anything. \r\n',NULL,0,0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,'ThomsonReuters',NULL,62,'2010-11-12 15:30:05',111,'2010-11-26 13:14:35',7,0,NULL,NULL,NULL,'N'),(1831,'COMPETITOR','Customer training session','Anna Spriggs',5574,5574,'HUNT5038','Anna Sprigg','Property Fee earner/trialist of PSL',NULL,NULL,NULL,NULL,'In demo\'ing PSL to Anna on Friday at HC Solicitors she said they are looking to greatly reduce their overall budget.\r\nOne thing they want to ditch is LawTel for their cases as they don\'t like how they search for them.\r\nI showed her cases in the topic tabs in PSL and said we had excellent fuller banks of cases in the Library.\r\nThis information has already been forwarded to the account manager (Amanda Wadey).',43,4,4,NULL,'Account manager to pitch a deal that includes an alternative offering of case law from Lexis to the LawTel which they don\'t like.\r\n\r\nPassed to Dave Coleman. YM 15/11/2010',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,66,'2010-11-13 16:24:11',111,'2010-11-26 13:29:11',7,52,NULL,NULL,NULL,'N'),(1841,'COMPETITOR','Customer training session','Stephen West',5574,NULL,NULL,NULL,NULL,NULL,NULL,NULL,47,'HC Solicitors are looking to cancel PLC Employment on renewal next year Stephen said.  He would not clarify the specifics in terms of reasoning.',NULL,4,24,NULL,'Account manager to be aware and package into any deal our equivalent content which would be Lexis PSL Employment/Lexis Library Employment (Amanda Wadey already aware of this information)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,66,'2010-11-13 16:27:19',111,'2010-11-26 13:56:58',7,0,NULL,NULL,NULL,'N'),(1851,'COMPETITOR','Customer training session','Ron Beech',2762,NULL,NULL,NULL,NULL,NULL,NULL,NULL,49,'Ron Beech (buying partner/commercial property expert) loves the precedents in Aldridge Practical Lease Precedents.\r\nHe likes them as they are easy to use and the ones that are easy to band around between firms. \r\nHe likes EF&P ones but finds them cumbersome.\r\nI informed him of the PSL precedents which he wants to look at.',NULL,4,11,NULL,'A general comment to be aware to back up decisions as to the approach of creating our precedents (which I believe is already happening with PSL ones), but just to back up that the market do feel the need for this approach.\r\n\r\nPassed to Dave Coleman. YM 15/11/2010',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,66,'2010-11-13 16:32:08',111,'2010-11-26 13:31:37',7,52,NULL,NULL,NULL,'N'),(1861,'CUSTOMER','Customer training session','Nick Long',9809,9809,'PILL0011','Sarah Nickols','Tax Partner',0,0,NULL,NULL,'In the training a partner (Nick Long) asked if we had the Tolley Workbooks online (I and II).\r\nI asked what they covered and he said they were very practical in nature with worked eg\'s etc that they find invaluable.\r\nI said I was unaware that they were in the Library yet, but would ask, but also that this sort of content is likely to sit within Tolley Guidance if I understood him correctly. \r\n\r\n',55,20,53,0,'The nature of this content would be useful if not already, then to be included in Tolley Guidance.\r\nSecodnly, if it is possible, as they seem to be books we own, could we put them into the Library and or Tolley Guidance direct?\r\n\r\n24.05.11 - reassigned to Tolley Guidance Team. Email sent.\r\n24.05.11 - spoke with Anita Harwood and sent email\r\n\r\nAH I have been unable to find any books with the title Tolley Workbooks.  The most appropriate sounding titles with two volumes that include practical examples is Taxwise  I & II.  These are annual titles and are part of the library','',NULL,'',NULL,NULL,'','',0,66,'2010-11-14 23:00:00',52,'2011-06-22 10:45:25',7,421,NULL,NULL,NULL,'N'),(1871,'COMPETITOR','Informal conversation','N/A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,49,'the following have all left in addition to Peter Lake (MD) who is leaving at the end of the year and is being replaced by Mark Schlageter who currently runs TR\'s Tax & Accounting research and guidance business in the US. Apparently the cuts are going to the next two levels down as well. \r\n	Giles Grant - Vice President  Strategy & Business Development\r\nGiles joined Sweet & Maxwell in January 2008. Prior to this, he was with Incisive Media, as both Group MD for Digital Strategy & Development, and MD for the Interactive Marketing Division, across both B2B and B2C brands. Between 1999 and 2005 Giles was MD of BSI Business Information, part of the BSI Group, developing digital and Asian business units. Before this he held senior positions at Reed Elsevier. Giles has also worked in retail (Laura Ashley) and services (RAC).\r\n\r\n	Ashley Doody  Chief Technology Officer\r\nAshley was appointed Technology Director in July 2006, having previously been Business Systems Manager for Sweet & Maxwell. In 2001, his role was expanded to include IT support in addition to business systems. Prior to joining Sweet & Maxwell, Ashley worked for Thomson Consulting for five years, providing fee based technology consultancy for Thomson businesses including Sweet & Maxwell, Compu-Mark, Derwent and Thomson Financial. Prior to joining Thomson Ashley was at Hoskyns, now known as Cap Gemini Ernst & Young.\r\n\r\n	Mark Potter  Vice President  Human Resources\r\nMark joined Sweet & Maxwell in June 2005 having previously worked at HSBC (Interim Head of Global Graduate Recruitment & Training) and Barclays (Senior HR Business Partner). Prior to this he was the UK HR Director for Powwow Water, a subsidiary of Hutchison Whampoa. Previously, he held a range of senior HR positions at Nokia, Sears & Bechtel. He began his career in Marketing, working first for Renault and then Lucas Industries. Mark holds a Business Studies degree from Oxford Brookes, an MSc from Stirling University & is a Fellow of the Chartered Institute of Personnel & Development.\r\n\r\n	Mark Seaman  Vice President  Editorial & Production\r\nMark has been the Editorial and Production Director for Sweet & Maxwell since 2003. He manages the product delivery functions of the business in Print, CD ROM and Online (from editorial offices based in London, Yorkshire and the Netherlands) and is responsible for Sweet & Maxwell\'s content management strategy and environmental footprint. Previously Mark worked for LexisNexis (Butterworths) in the UK as Publishing Director (responsible for the LexisNexis online service in the UK), Business Operations Director and latterly as Marketing Director, specialising in branding and PR communications initiatives.\r\n',NULL,0,0,NULL,'No call to action. YM 17/11/2010',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,51,'2010-11-16 08:44:10',111,'2010-11-26 10:22:04',7,0,NULL,NULL,NULL,'N'),(1881,'PRODUCT','Customer training session','Simon Rounding ',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'Simon had a couple of comments about navigating Lexis Library which in his opinion make it more difficult:\r\n\r\n1) When using the document view, the bar hiding the tree is VERY fiddley to move across. His suggestion was to make the range over which the right and left arrows appear much larger so it\'s easier to pick up. Also he thought the small arrows which jump the bar across should have arrows pointing right which would move the bar over in jumps - so the user could jump it over multiple times, and then arrows pointing the other way to jump it back.\r\n\r\n2) When browsing a work (once you\'ve clicked on \'browse\' after the title of a work you want to look at), the little pop up with \'open all levels / open next levels\' is a nuisance. It is far too \'sticky\' - in his view it needs to disappear as soon as you move off of the \'+\' - currently it stays there until you click in a bit of empty space. It also opens and obscures the text (we\'ve reported this before) making it a pain to see the title of the sections / chapters etc (especially with the stickiness described above). \r\nHe thinks it should open on the left of the \'+\'s. I explained what the \'open all levels\' option did which he thought was good but also then couldn\'t see the point of the \'open next level\' option which does the same as clicking on the the \'+\'.\r\n',NULL,NULL,0,0,'The above feedback is quite common and I believe it\'s this type of functionality which reduces a users experience of navigatign lexis library easily. i think we need to look at these functions again and look at ways to improve the user\'s experience as Simon suggested above.\r\n\r\n\r\nResponse from Clare Duggan, 17/11/2010\r\n\"Thanks for your feedback below. We are about to embark on a usability study to look at results pages so hopefully we will be making these pages more intuitive as a result of research findings. Do you think Simon (and any of his colleagues) would be interested in partaking?\r\nInterviews take no longer than an hour and they will be offered a 100 cash incentive or 100 towards the charity of their choice. Interview slots are available the w/c 29th November or 6th December if he does want the opportunity to shape these developments.\r\nI look forward to hearing from you.\"\r\n\r\nReply from David Smith, 18/11/2010\r\n\"I could ask but before I do, he is based in Selby North Yorkshire (quite a way) - or can these interviews be done remotely. Also, his comments relate to the doc view and browse trees - he actually doesn\'t really search as such, so if it\'s specifically the actual results page you\'ll be looking at, I\'m not sure he\'s your best person.\r\nHe was pretty straight talking though and expressed his frustrations as a user. \r\nLet me know if the above would work for you and I\'ll drop him a line.\"','',NULL,'Elmhirst Parker',NULL,NULL,NULL,NULL,NULL,65,'2010-11-16 16:37:11',111,'2010-12-15 12:36:57',7,0,NULL,NULL,NULL,'N'),(1891,'PRODUCT','Other','Simon Rounding ',3985,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'This was a sales demo and i was showing Simon (and other users) a section of Halsbury\'s for which there was a link within the PSL practice notes text (the practice area is not important).\r\n\r\nSimon asked if he could then link to the library to take him to the same section - but with the rest of the work before and after it. Basically he wanted to see a link (perhaps the title) which would open up lexis library and display the same piece of text - but as they have the whole of Laws on Lexis Library, he would then be able to read around the subject as he would be in the right part of this work.\r\n\r\nI did think this was a good idea - so users would truly be able to use these great links which give a little snippet of further reading from works like Laws in PSL, to link to the right section within the whole work on Lexis Library to read further around the topic. These would obviously be subscription sensitive and would need to be marked up as such.',NULL,NULL,0,0,'Consider adding links from PSL to take users into lexis library so they can browse further from the Butterworths links in PSL (i know we have some of these links into lexis library but think they should be alongside ALL of the \'butterworths\' links.\r\n\r\n\r\nResponse from Clare Duggan, 17/11/2010\r\n\"This is something which we have looked into before and remains in a backlog to be revisited. At the moment, we have had to prioritise other items such as word wheels and navigation to sub-topic when searching as we believe they will add a lot more value to the product as whole but we will certainly continue to monitor this and will let you know if we do decide to add this at a future point.\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,65,'2010-11-16 16:46:03',111,'2010-12-14 16:52:09',7,59,NULL,NULL,NULL,'N'),(1901,'CUSTOMER','Renewal or new business conversation','Sally Creissen',NULL,NULL,'DONN5042','Sally Creissen','Information Manager',NULL,NULL,NULL,NULL,'The Personal Injury team trialled Lexis PSL P.I.  The feedback from the fee earners was that they were concerned a leading case that relates to Part 36 of the Civil Procedure Rules was not mentioned.  Sally couldn\'t remember the name of the case but it was a new one that came out this summer.\r\n\r\n',0,4,44,NULL,'Do our PSL team know which case this would be and if there are any plans to update our service to take it into account?','',NULL,'DMH Stallard','DMH Stallard',NULL,NULL,NULL,NULL,7,'2010-11-17 14:16:00',111,'2010-11-26 13:24:53',5,431,NULL,NULL,NULL,'N'),(1911,'COMPETITOR','Informal conversation','Tonia Sexton',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Tonia has advised me that Justis did a demo of a product Link Studio at a librarians meeting she recently attended. Apparently they are touting it as a competitor to LexisCheck with functionality over and above JustCite.\r\n\r\nI know nothing more about it but it would be good to know what it is and how it differs from JustCite to combat any questions we may get when pitching LexisCheck',NULL,11,0,NULL,'Investigate their revised offering and report back to sales on features, pricing etc if possible\r\n\r\nResponse from Lisa Regan, 10/12/2010\r\n\"The LexisCheck product development team is aware of this Link Studio product in the market. \r\nIt is a mark-up tool that creates hyperlinks to cases/legislation in your documents.\r\nLexisCheck is a superior offering because not only does it create hyperlinks in your documents, it also provides status signals (traffic lights) indicating the validity of that piece of law with further links to related commentary and cases also.\r\nThere is no competitive analysis document as such but if you are interested in seeing the comparison for yourself, information can be found here http://www.justcite.com/about/justcite-link-studio.aspx or here http://www.justispublishing.com/services/linkstudio.html\"',NULL,NULL,'Geldards',NULL,NULL,NULL,'Jusits',NULL,16,'2010-11-18 09:00:25',111,'2010-12-10 15:26:00',7,61,NULL,NULL,NULL,'N'),(1921,'COMPETITOR','Customer training session','Michael Blank',1977,NULL,NULL,NULL,NULL,NULL,NULL,NULL,47,'Buckles use PLC currently as their first port of call in property, then come to EF&P if PLC is not extensive enough in coverage.\r\n\r\nThey have access to Lexis PSL Property so I was retraining them to try treating PSL as their starting point. \r\n\r\nI asked for their thoughts on the service I was showing them and they said they like the look of PSL Property, but when I drilled further as to whether in reality they would come to it at least 2 of their senior lawyers (Michael Blank and Colleen Gostick) said the main thing they turned to PLC for was the CPSE (Commercial Property Standard Enquiries) forms.\r\n\r\nAs Im sure you know, the CPSE forms are a joint venture of PLC with the London Property Support Lawyers Group which we do not have our own versions of. \r\n\r\nHowever, Lexis PSL (and EF&P) does have a link to the site where they can be found (where they are free), but it is quite embedded within the site.\r\n\r\nMichael and Colleen said is there a way it could be more prominent?\r\n\r\nI know there is investigation at the moment for other PSL modules to include a toolbox of useful links such as the one in Personal Injury. Would it be possible to have a link on the front page of Property PSL for the CPSE in an area like a toolbox?\r\n\r\nThey also felt a link could be useful in a toolbox like area on the front page for Stamp Duty Calculators (for leases?), and a Mortgage Calculator. Do these exist on other free sites that we could link to rather than having to create from scratch?\r\n\r\nThey are feeling (like many firms) they shouldnt be paying for 2 providers, so if we could tick all their boxes they would come completely over to us.\r\n\r\n',NULL,4,49,NULL,'Lexis PSL (and EF&P) does have a link to the site where the CPSE can be found (where they are free), but it is quite embedded within the site.\r\n\r\nMichael and Colleen said is there a way it could be more prominent?\r\n\r\nI know there is investigation at the moment for other PSL modules to include a toolbox of useful links such as the one in Personal Injury. Would it be possible to have a link on the front page of Property PSL for the CPSE in an area like a toolbox?\r\n\r\nThey also felt a link could be useful in a toolbox like area on the front page for Stamp Duty Calculators (for leases?), and a Mortgage Calculator. Do these exist on other free sites that we could link to rather than having to create from scratch?\r\n\r\n\r\nResponse from Clare Duggan, 30/11/2010\r\n\"Malcolm Dowden and I have had a conversation around this and hes of the mind that theyre all very good ideas. He pointed out that we have links to SDLT calculators on the landing pages, but if we could present them in a toolbox, similar to PIs, then the user experience could be significantly improved.\r\nApparently the CPSEs issue is a long running saga.  They were originally placed on PLC because it was the only available site.  The British Property Federation stipulated that they must be made freely available.  However, over time PLC have asserted a creeping copyright to the enquiries  hence the need for a link to their site...\r\nI will continue discussions with Malcolm on this and we can investigate the best way to move forward.\r\nIll obviously keep you in the loop.\"',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,66,'2010-11-18 12:09:45',111,'2010-12-01 16:45:48',7,59,NULL,NULL,NULL,'N'),(1931,'PRODUCT','Customer training session','Jessica Tinker',NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'Jessica assumed that because LexisPSL was more modern in its look and feel that it would accept natural language searching, she didn\'t realise that it still used, in her words \'the clunky Lexis search\' where you have t link words together.  \r\nJessica felt that we had missed a trick by not launching LexisPSL with a natural language search facility (which on the face of it is what PLC does)',NULL,NULL,59,9,'Jessica suggested that we should amend the search facility in LexisPSL to reflect the way that end users would assume it should work (i.e. natural language, or at least putting an impled and or w/p behind the scenes)\r\n\r\n\r\nResponse from Clare Duggan, 30/11/2010\r\n\"Youll be pleased to know that we are looking to introduce suggested searches across PSL in Q1 of 2011, so there should be a lot less reliance on connectors. This will not only aid end-users in locating their required materials but will also provide users with a consistent approach in LexisLibrary and PSL if they take both products.\"','',NULL,'Cannings Connolly',NULL,NULL,NULL,NULL,NULL,68,'2010-11-18 16:30:59',111,'2010-11-30 10:18:08',7,59,NULL,NULL,NULL,'N'),(1941,'PRODUCT','Customer training session','Ruth Lawrence',NULL,NULL,NULL,'','',0,0,4965,NULL,'Ruth Lawrence, Property Partner at Edwards Duthie trialled LexisSmart Precedents:\r\n\r\nComments from Edwards Duthie following a trial of Property were in general their Property Partner said it has not saved her any drafting time. There are a couple of specifics:\r\n\r\nIn the Lease of Whole she has experienced error messages when trying to assemble the document at various points. She says that clause 14.4 does not appear to be complete and that there are inconsistencies with the size of fonts in the headings. Also where there are definitions, these are coming out with no gaps between some of them. She also says that there is a colon in clause 4.1 that shouldn\'t be there.\r\n\r\nThis has meant that she has had to get her secretary to amend and use dictation which defeated the object of her using the drafting tool herself. She has been quite disappointed as she was hoping to be able to be more positive.\r\n\r\nOn the strength of this initial work she has said she is unlikely to recommend the firm purchases the service.\r\n\r\nThis feedback has already been passed to Vicki Tubb & Malcolm Dowden\r\n',NULL,NULL,49,3,'PM 24.05.11 Email sent to Vicki Tubb & Malcolm Dowden\r\nPM 24.05.11 Malcolm Dowden has confirmed that the issues raised were previously addressed\r\n','',NULL,'Edwards Duthie',NULL,'LexisSmart Precedents','','',0,68,'2010-11-18 16:34:31',1921,'2011-05-24 10:46:29',7,341,NULL,NULL,NULL,'N'),(1951,'PRODUCT','Renewal or new business conversation','Suzanne Cottle (General Practice Account Manager)',NULL,NULL,NULL,'','',0,4,4983,NULL,'Hi Suzanne - I\'m afraid we\'re having major problems with PAM (the system used for uploading and publishing content) at the moment.  We are pressing Martin Stevens, Vince Synan and Grant De\'ath for an indication of why precedent publications are failing, but not making much progress at the moment.\r\n\r\nYou\'ll see on the precedent landing pages (eg for leasehold enfranchisement) references to a lot of precedents produced to meet feedback,  but where the link produces a page saying \'no document found\'.  \r\n\r\nUnless and until that issue is resolved I can\'t put any new precedents onto the site.  Apologies...\r\n\r\nMalcolm Dowden\r\nSolicitor, LexisPSL \r\nHalsbury House\r\n35 Chancery Lane\r\nLondon\r\nWC2A 1EL\r\nmalcolm.dowden@lexisnexis.co.uk \r\n+44 (0)20 7400 2739 Tel\r\n+44 (0)7748760131 Mob \r\n\r\n-----Original Message-----\r\nFrom: Cottle, Suzanne (LNG-HBE) \r\nSent: 16 November 2010 11:30\r\nTo: Dowden, Malcolm (LNG-LON)\r\nCc: Morgan, Louise (LNG-HBE); Wadey, Amanda (LNG-LON)\r\nSubject: FW: Deed of Substitution\r\n\r\nHi Malcolm - sorry to chase - any news on this at all please so I can go back to the customer?\r\n\r\nThanks\r\n\r\nKind Regards\r\n\r\nSuzanne\r\n\r\n.................................................................................................\r\n \r\nSuzanne Cottle\r\nAccount Manager - Legal\r\nLexisNexis\r\nHalsbury House\r\n35 Chancery Lane\r\nLondon\r\nWC2A 1EL \r\n\r\nsuzanne.cottle@lexisnexis.co.uk\r\nBB: +44 (0) 7795 645970\r\n\r\n \r\n\r\n\r\n-----Original Message-----\r\nFrom: Cottle, Suzanne (LNG-HBE) \r\nSent: 09 November 2010 11:43\r\nTo: Dowden, Malcolm (LNG-LON)\r\nCc: Morgan, Louise (LNG-HBE); Wadey, Amanda (LNG-LON)\r\nSubject: Deed of Substitution\r\n\r\nHi Malcolm,\r\n\r\nApologies, I seem to be bothering you on a daily basis at the moment! I have just taken a 3 fee earner firm through a PSL demo and we failed at the first hurdle. They wanted to find a deed of substitution and there is nothing in PSL. We found it in the end in one of the Mortgages Volumes of EF and P in the library, but it didn\'t go down well. The customer has no online at the moment with anyone and maintains that this should be considered as a frequently used document - can you advise so I can go back to him with a silver bullet?\r\n\r\nThanks\r\nThis feedback has been sent to Malsolm and he has replied to Suzanne but we wated to ensure it was logged on the Insight tracker\r\n',NULL,NULL,49,3,'Response from Nachum Sokolic, 17/12/2010\r\n\r\nCan you attach an example precedent, or point me in the direction of an example precedent, in PAM, which is failing?','',NULL,'',NULL,NULL,'','',0,68,'2010-11-18 16:38:00',1921,'2011-05-24 10:04:05',7,361,NULL,NULL,NULL,'N'),(1961,'PRODUCT','Customer training session','John Lancaster',NULL,NULL,NULL,NULL,NULL,NULL,4,4980,NULL,'John flagged up the inability to run a search in LexisPSL for a form, for example a Form E.  So, if a user doesn\'t go into a topic in LPSL and want to search?  The search facility on LPSL doesn\'t include forms, John felt that if support staff were trying to locate a form in LPSL then the inability to search would hinder them.\r\n\r\nI appreciate that the inability to search LPSL for forms runs across all mosules, not just Family.',NULL,NULL,28,3,'Amend the LPSL search facility to incluide forms in the search results.\r\n\r\n\r\nResponse from Clare Duggan, 29/11/2010\r\n\"This is currently a limitation which we are hoping that we can rectify longer term once the Forms team have made some content enhancements enabling forms to be searched. In the interim, well add a Top Tip to one of the next e-bursts to remind customers to look for this content on the Forms landing pages.\"','',NULL,'GHP Legal',NULL,NULL,NULL,NULL,NULL,68,'2010-11-18 16:41:14',111,'2010-11-30 10:25:21',7,59,NULL,NULL,NULL,'N'),(1971,'PRODUCT','Other','Keith Arrowsmith',NULL,NULL,NULL,'','',0,4,4956,NULL,'From: Arrowsmith, Keith [mailto:keith.arrowsmith@ralli.co.uk] \r\nSent: 09 November 2010 09:21\r\nTo: Frost, Mark (LNG-HBE)\r\nSubject: RE: LexisPSL Update: Company Commercial\r\n\r\nMark - \r\n \r\nHere\'s an example of why I am not confident in the LexisPSL update.\r\n \r\nThe IP update seems to only be a clipping service from the Daily Telegraph - meanwhile PLC reports on Court of Appeal decisions.\r\n \r\nOn one of the PSL clippings (below) the patent story is summarised by \"copying\" and \"design\" - I much prefer the PLC clarity in reporting - patents are not the same as designs.\r\n \r\nHope that is useful feedback. \r\n \r\nKeith\r\n \r\n \r\n2. Title: Rolls-Royce Faces Court Fight With US Rival in Patent Row\r\n\r\n  Published Date: 8 November 2010\r\n  Sources: UK Legal Newspapers Index\r\n     \r\n  Brief Summary:\r\n\r\nDaily Telegraph, 8 November 2010: Rolls-Royce is facing a new headache over its superjumbo engines after one of its biggest rivals accused the British company of copying the design of engine parts\r\n\r\n________________________________________\r\nFrom: Frost, Mark (LNG-HBE) [mailto:mark.frost@lexisnexis.co.uk]\r\nSent: Mon 08-Nov-10 6:25 PM\r\nTo: Arrowsmith, Keith\r\nSubject: RE: LexisPSL Update: Company Commercial\r\nHi Keith,\r\n \r\nPlease can you forward me your login details so that I can check this for you\r\n \r\nRegards\r\n \r\nMark\r\n \r\nMark Frost\r\nAccount Manager - Legal\r\nLexis Nexis Butterworths\r\n \r\nmark.frost@lexisnexis.co.uk\r\nTel: +44 (0)7920 576963\r\n \r\n  Please consider the environment before printing\r\n \r\nFrom: Arrowsmith, Keith [mailto:keith.arrowsmith@ralli.co.uk] \r\nSent: 08 November 2010 12:49\r\nTo: Frost, Mark (LNG-HBE)\r\nSubject: FW: LexisPSL Update: Company Commercial\r\n \r\nHi Mark\r\n \r\nSorry to bother you again - I\'m back at my desk and trying to use the PSL service!\r\n \r\nI signed up to updates, get them, but when I click on the links I\'m told I didn\'t set it up and therefore I can\'t read the articles.\r\n \r\nI tried to go into my settings via the link at the bottom, but that gives me an error too!!\r\n \r\nCan you help or pass it onto someone else who can  please?\r\n\r\nKeith\r\n \r\n \r\n \r\nKeith Arrowsmith\r\nPartner\r\nIntellectual Property & Media \r\nFor and on behalf of Ralli Solicitors LLP\r\nt: 0161 615 0688\r\nf: 0161 615 0744 \r\n\r\nThe LPSL team have received this feedback directly from Mark Frost but we wanted to log it on the tracker as well',NULL,NULL,35,5,'To be sent to Donald Cran - not yet demo\'ed. YM 23/02/2011\r\nPM. Delgated to Donald Cran 13.05.11\r\n\r\nPM Update received form Cara Annett 15.06.11. Closed pending further follow-up\r\nCara advises that this matter was addressed directly with the AM back in December 2010 but no follow-up was given to the questions asked. Cara states in an email from December 2010:\r\nAmanda, Mark,\r\nPlease can you let me know whether this customer is comparing our PSL CoCo updates with PLC Commercial updates or with PLC Intellectual Property updates?  I can\'t currently get into to PLC to see but I\'d like to check this because from what I\'ve seen PLC\'s Commercial module doesn\'t really cover IP at all. \r\nThe piece in question is a summary of a Telegraph piece which is on a feed from LexisLibrary Current Awareness. I think most LexisPSL modules feature this feed as a value add. The source is called the UK Newspaper Index and it is popular with customers who use it to make sure they are prepared if a client comes asking about something reported in the newspapers. \r\n\r\nWe\'re grateful to Ralli for flagging the issue though because it highlights that what this source is could be made clearer in LexisPSL (in LexisLibrary, the source does have details that explain what it is. In LexisPSL Updates Archive, there is a brief description of the sources of updates but I don\'t think customers setting up an alert would see this). Therefore, we\'ll investigate this and would hope to provide clarification in the product shortly. We are also looking into providing enhanced linking between the Newspaper summaries and the legal updates. These two steps will I think overcome the issues with newspapers unsophisticated reporting whilst ensuring that law firms still have access to material to help them keep abreast of news coverage. Could you let the customer know and find out what he thinks about that?\r\n\r\nCan I check - was Mr Arrowsmith\'s problem with the error message (not being the person who set it up (from the start of the thread)) resolved? ','',NULL,'Ralli',NULL,NULL,'','',0,68,'2010-11-18 17:55:54',1921,'2011-06-16 16:28:45',7,221,NULL,NULL,NULL,'N'),(1981,'PRODUCT','Renewal or new business conversation','Michael Wosskow',NULL,NULL,NULL,NULL,NULL,NULL,4,4989,NULL,'They already have PLC for Employment, Corporate, Private Client, Property and Restructuring/Insolvency, Michael is the Senior Partner and uses PLC (or LPC as he calls it!)  He had tried to find a Patent Infringement letter on PLC but couldn;t find it, so he was really impressed when he saw one in the LPSL CoCo module and thought it was very comprehensive and would have been perfect for the job!',NULL,NULL,35,3,'','',NULL,'Wosskow Brown',NULL,NULL,NULL,NULL,NULL,68,'2010-11-18 19:31:48',1921,'2011-04-11 11:36:17',6,201,NULL,NULL,NULL,'N'),(1991,'PRODUCT','Other','Richard Twyman',9669,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'Piper Smith Watton has a LexisLibratry sub but were trialling LexisPSL as an alternative/easier way to access LexisLibrary content.\r\n\r\nRichard sent the following comment:\r\nI have spent 35 minutes on PSL trying to find a draft pre-action protocol letter for a construction case -- no joy\r\n\r\nI checked with Janna Purdie and currently LPSL doesn\'t contain pre-action protocol letters, neither does Emdens, so we do not currently offer these documents on LPSL or Library.\r\n\r\nPerhaps this could be something considered for development?',NULL,NULL,59,3,'Response from Laura Brown, 02/12/2010\r\n\"Hi Lynne, \r\nI saw your comment re the draft pre-action protocol letter for a construction case. Ill ask a couple of the PSLs if this is something they are planning to do and will forward any response to you. \r\nLaura\"\r\n','',NULL,NULL,NULL,NULL,'LexisPSL Dispute Resolution',NULL,NULL,68,'2010-11-18 19:36:29',111,'2010-12-02 16:34:24',4,251,NULL,NULL,NULL,'N'),(2001,'PRODUCT','Renewal or new business conversation','Alan Kennedy',NULL,NULL,NULL,'','',0,4,4945,NULL,'Alan has used LPSL at a previous firm (HLW in Sheffield).  He asked if we had considered running with the PI Toolbox idea and applying it to other LPSL modules, so for example, Alan is an Employment lawyer & felt that the addition of calculators to LPSL Employment would be a fantastic idea, and may well go above and beyond what PLC currently offer (Wosskow Brown has a PLC sub for - \r\nEmployment, Corporate, Private Client, Property and Restructuring/Insolvency and have been in touch with them with a view to purchasing the remainder of their full suite - that they gave me a list of:-\r\n\r\nArbitration\r\nCommercial\r\nCompetition\r\nCross Border\r\nDR\r\nFinance\r\nPensions\r\nShare Schemes & Incentives\r\nTax\r\n',NULL,NULL,24,9,'PM 24.05.11:Email sent to P. Thornton','',NULL,'Wosskow Brown',NULL,NULL,'','',0,68,'2010-11-18 19:40:17',1921,'2011-01-21 11:36:14',3,2321,NULL,NULL,NULL,'N'),(2011,'PRODUCT','Renewal or new business conversation','Sally Mallinson',NULL,NULL,NULL,'','',0,4,NULL,NULL,'Sally (Partner & Head of PI Department) and Jeff Knibb (PI Manager) liked LexisCalculate but asked if there were plans to add to the calculators - specifically an interest on costs calculator?  They both felt the PI Toolbox was a great idea',NULL,NULL,44,9,'We are intending to add a second tranche of calculators to the personal injury product later in 2011. I have noted the request for an interest on costs calculator and will certainly consider including it in the toolbox when the new calculators are being developed.\r\n\r\n','',NULL,'Wosskow Brown',NULL,NULL,'LexisPSL Personal Injury','',0,68,'2010-11-18 19:47:14',1921,'2011-05-09 10:41:32',7,371,NULL,NULL,NULL,'N'),(2021,'COMPETITOR','Publication','Outsell',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Thomson Reuters Acquires Legal Outsourcing Firm Pangea3\r\n\r\nSource: Outsell, David Curle, Director & Lead Analyst - Minneapolis, Minnesota \r\n\r\nThere\'s a fine line between an information provider embedding itself in its customers\' workflows, and actually taking over those workflows and a chunk of the customers\' business. Thomson Reuters\' acquisition of India-based legal process outsourcer Pangea3 pushes the line further out. But change is coming to legal services; and Thomson Reuters is not sitting around waiting for the legal services industry to change itself.\r\n\r\nImportant Details: Thomson Reuters has created quite a stir with its acquisition of the Indian legal process outsourcing (LPO) firm Pangea3. LPO has become an integral part of the legal services market, as both law firms and corporate legal departments have attempted to cut costs and gain efficiencies by outsourcing routine matters to third-party firms, some of them located offshore.\r\n\r\nPangea3 has 650 employees at its major delivery centers in Mumbai and New Delhi. Its client base includes Am Law 250 law firms and some of the world\'s largest financial services, pharmaceutical, healthcare, food and beverage, technology and consumer goods companies. The firm offers a variety of services organized into four distinct lines of business including legal document review; corporate transactions; intellectual property; and risk management and compliance. While Thomson Reuters did not disclose Pangea3\'s revenues, it claims Pangea3 has enjoyed over 20% annual growth in recent years, and that the entire LPO market will soon exceed $1 billion. That compares with $200-300 billion in total revenues for the US law firm industry. In general, the UK legal services industry has been a bit more dynamic and forward-thinking in its approach to outsourcing both legal work and other business processes.\r\n\r\nOne of the advantages of this acquisiton is that its benefits will accrue to a number of business units within Thomson Reuters\' legal business. In addition to the law firm and general counsel markets, which are the big users of LPO services, bits and pieces of the Pangea3 service offerings will find a home in Thomson\'s intellectual property units, its new Governance, Risk and Compliance unit, and various litigation-related document review offerings, for example.\r\n\r\nImplications: This acquisition is a big deal because LPO has become a big deal in the legal services industry. On the one hand, there is no denying that LPO is one of the many tools (including alternative fee arrangements and new staffing structure) that the legal services industry are starting to apply in order to wring more efficiency out of a industry with a business model that has been stubbornly resistant to change. Many lawyers and law firms have been reluctant to embrace LPO, however, because it doesn\'t fit with their self-image of what lawyering is all about. The idea of offshore, low-wage lawyers tackling legal matters the way that offshore call centers tackle customer support in other industries is insulting and threatening to many lawyers and law firms. But the success of the LPO model is evidence that just perhaps the mystique around what lawyers do is a smokescreen and that maybe, just maybe, legal services is an industry that can benefit from the same kinds of automation and process-thinking that are now applied in virtually every other industry.\r\n\r\nThomson Reuters understands this because it has been relentlessly finding ways to insinuate itself into customers\' workflows, with offerings that help firms manage time and billing, back office finances, litigation processes, their in-house knowledge and know how, and to help them to market themselves. This acquisition is a logical next step in its progression of providing information, then software, then services to a rapidly changing legal market.\r\n\r\nIn some sense Thomson Reuters will be competing with its customers - but that is a fair turnabout because, as we have pointed out earlier, many of the new technologies being adopted by the legal industry have allowed them to in essence compete with the legal publishers of the world (see Insights 1 June 2009, JD Supra Adds Law Centers). There are new ways for legal professionals to collaborate and to share information and practices that, to some extent at least, replicate the information that they traditionally could only obtain from the major legal publishing houses.\r\n\r\nJordan Furlong of Edge International and Stem Legal published a very timely blog post recently, Destroying your own business, in which he describes the inability or reluctance of the legal services industry to make the changes that need to be made in order to turn itself into a modern, efficient industry. Most of the innovation in legal services today, he argues, is occuring outside the legal profession itself. Rather than acquiring new players like Pangea3, major law firms are busy merging and consolidating among themselves, creating larger and larger versions of an outdated business model. Thomson Reuters has seen, from a position outside the industry, what many inside it could not, namely the opportunity to own and perfect another piece of the evolving delivery of legal services. As all major information providers learn sooner or later, Thomson Reuters has found that there is a natural (and perhaps inevitable) progression from providing information that supports business processes, to providing technology that supports those processes, to providing the processes themselves. \r\n',NULL,0,0,NULL,'No call to action.  Derek confirms that he is informing the appropriate people. YM 06/12/2010',NULL,NULL,NULL,NULL,NULL,NULL,'ThomsonReuters',NULL,62,'2010-11-22 09:28:55',111,'2010-12-06 16:42:56',7,0,NULL,NULL,NULL,'N'),(2031,'CUSTOMER','Customer training session','S Lomas',NULL,NULL,'','Theresa Randles','Practice Manager',0,NULL,NULL,NULL,'wed 3/11/10\r\n\r\nLexisLibrary must provide more of a Google style serach and provide more guidance after a search on where to go/what to do next.',0,1,59,0,'Agreed with Dave Coleman that this should be categorized as a Product Insight; delegated to Clare Duggan. YM 06/12/2010\r\n\r\nResponse from Clare Duggan, 06/12/2010\r\n\"Since we have introduced suggested searches across Quick Find, we are hoping that the number of search fields and forms our subscribers use starts dropping. This, in time, may give us the ability to move towards this type of search that Google offers (although we all know legal research is quite different than general surfing on the internet). As you know, we are currently doing usability on the results pages which should help us to identify what users want to do after they run a search and what they need from a product perspective to make this an intuitive workflow.\r\nWell keep you in the loop about what comes out of the study and what developments we decide on as a result of this study.\"','',NULL,'Druces',NULL,NULL,NULL,NULL,NULL,75,'2010-11-22 11:44:23',801,'2011-10-28 10:09:45',82,59,0,'TBC','','N'),(2041,'PRODUCT','Customer training session','Phil Cookson',1977,NULL,NULL,'','',0,4,4964,NULL,'From: Phil Cookson <PhilCookson@roythornes.co.uk> \r\nTo: Allan, Gavin (LNG-HBE) \r\nSent: Fri Oct 15 16:40:28 2010\r\nSubject: Smart Precedents \r\nGavin\r\n \r\nAs promised I have tried the \"Smart Precedents\" function which you have given me access to to test.\r\n \r\nAs you asked for feedback I thought it fair to drop you a line. I have used the service to produce 3 compromise agreements and have to say that I still very much prefer the plc offering both in terms of the document produced (although this is largely due to me \"knowing\" the plc version better than your document) but, more importantly in terms of how the document is produced.\r\n \r\nThe \"faults\" as I see them are as follows\r\n \r\n1. The data to be inputted - the plc version consists of 5 pages of inputting rather than the 49 pages on yours.\r\n2. I think the plc version is slicker as it assumes a level of understanding on the part of the person preparing the document as to what the various optional clauses are about. In the Lexis version the narrative sections simply get in the way. Whilst I appreciate that there is a need on occasion for explanations I feel there is a sense of overkill. I would go as far as to suggest that the narrative seems to have been drafted so as to avoid the risk of being sued by someone who completes the document in error. By way of example see the PILON provisions on page 11. Whilst I do not criticise the content of the note I simply don`t need it as I am aware of the issues and the associated risks as I suspect will almost every employment law practitioner. As I say it seems to me to be provide the information in a defensive rather than a helpful way.\r\n3. In terms of a possible way to improve the functionality it may be possible to slot the advice sections into a link to drafting notes  - this would assist in my view.\r\n4. The other problem I encountered was the auto referencing function which seemed to work in some cases and not in others. As you can appreciate I think it should either all work or none of it - I found this particularly irksome as I am not too familiar with the document itself and found the cross checking more difficult as a result.\r\n \r\nI appreciate that the feedback is quite negative so apologies but it is meant to be constructive.\r\n \r\nRegards\r\n \r\nPhil Cookson\r\nPartner\r\nFor and on behalf of Roythornes LLP\r\nE-mail: philcookson@roythornes.co.uk\r\nTel: 01733 898970\r\nFax: 01733 346868\r\nwww.roythornes.co.uk\r\n',NULL,NULL,24,3,'Ensure cross referencing works as this is one of the few possible weak points in PLC.\r\n\r\nConsider having multiple versions of core documents such as a compromise agreement (junior level and senior level) so we can also deliver what PLC does. \r\nOur version is very different at present in that it requires lots of input compared to PLC so is not as time efficient. We need our version, but we would benefit hugely from a version similar to PLC\'s that senior people feel they could turn to the site for (put together quickly). \r\n\r\nMark Edwards:\r\nThis is useful feedback and this approach has been taken for the will, and is under consideration for the compromise agreement. Currently we are awaiting further customer feedback on the compromise agreement before any decisions are taken.','',NULL,'',NULL,NULL,'','',0,66,'2010-11-24 07:06:36',1921,'2011-05-24 10:24:58',7,341,NULL,NULL,NULL,'N'),(2051,'PRODUCT','Customer training session','',9074,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'On calling the PSl contact us number -  0207 347 3746 no one answered and the answer phone message was from Jonathan Brewer (no longer with lexis) with no indication that it was the psl team.',NULL,NULL,0,0,'I have suggested this number be changed and the answer phone message amended.\r\n\r\nThis has already been picked up by clare duggan / Luella Porter - this entry is simply to record the insight.\r\n\r\n\r\nResponse from Clare Duggan, 29/11/2010\r\n\"This number has now been changed to the Belfast Helpdesk number so it is picked up quickly and then directed to the correct team of lawyers where required.\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,65,'2010-11-24 08:55:30',111,'2010-11-30 10:28:58',7,59,NULL,NULL,NULL,'N'),(2061,'PRODUCT','Customer training session','Andrew Morris',9074,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'I trained the user on how to open up the topics on the left hand \'browse topics\'  area as the client had NOT NOTICED that he was able to do this. I have had this many times (amnd reported this before) in other firms too e.g Heald Solicitors. \r\n\r\nThis meant that he thought the only topics he had were those which were open by default and that was the primary reason he had ben trying to SEARCH the site - which he had struggled with due to the normal isseus to do with using connectors / exact words etc.\r\n\r\n',NULL,NULL,0,0,'I appreciate it\'s a trade off between users being able to see the main headings on a reasonable sized web page but would it be possible that if a user opens the \'view all topic\'s\' once, that it\'s then locked on so they don\'t have to keep opening them every time they return to the home page.\r\n\r\nI would probably argue that potentially it would be better to have all topics open on the left by default - I believe from looking at how clients use this site that this would give particularly untrained, new users a far better experience - more people seem ok with scrolling down a web page than notice the \'open all\' links.\r\n\r\n\r\nResponses from Clare Duggan, 30/11/2010\r\n\"From a design perspective, it isnt considered good practice to expose items below the fold as users tend to miss them, hence the product being designed in thus way. In the PSL usability study conducted earlier this year, we tested this function and users overall had little trouble locating this icon. We can of course retest this next time we run further PSL usability work. \r\nIt is also worth mentioning that we are working to add suggested searches to LexisPSL in Q1, 2011 so this will also negate the need for connectors and will aid our users in pinpointing the exact materials theyre after.\"\r\n\r\nReply from David Smith, 30/11/2010\r\n\"but would it be a good idea to \'lock it on\' - so if a user has clicked on it once, it then stays open when they return to the home page or log on again?\"\r\n\r\nFurther response from Clare Duggan, 30/11/2010\r\n\"Itd need validation David but well certainly retest in the next set of usability on PSL. Thanks again for passing on the feedback.\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,65,'2010-11-26 15:27:06',111,'2010-12-01 16:54:18',7,59,NULL,NULL,NULL,'N'),(2071,'PRODUCT','0','Lyn Wildish',11344,NULL,NULL,NULL,NULL,NULL,4,4950,NULL,'Functionality and content issues. Please see attachment.',NULL,NULL,12,3,'','1291052836.htm','LexisPSL CoCo.htm',NULL,NULL,NULL,NULL,NULL,NULL,24,'2010-11-29 17:47:41',111,'2010-12-01 10:51:15',7,0,NULL,NULL,NULL,'N'),(2081,'PRODUCT','0','Lyn Wildish',11344,NULL,NULL,NULL,NULL,NULL,4,4951,NULL,'Comments on LexisPSL Employment content and functionality',NULL,NULL,24,3,'','1291053162.htm','LexisPSL CoCo.htm',NULL,NULL,NULL,NULL,NULL,NULL,24,'2010-11-29 17:53:08',111,'2010-12-01 10:51:41',7,0,NULL,NULL,NULL,'N'),(2091,'COMPETITOR','Publication','Press Release',5692,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Herbert Smith opens disputes operation in Belfast\r\n24 November 2010\r\nHerbert Smith announced today that it will be setting up an operation in Belfast, focused principally on reviewing and analysing the large volumes of documents often found in major contentious work, notably in litigation, arbitration and regulatory investigations.\r\n\r\nIn doing so, it will be the first leading international law firm to establish a UK-based operation to conduct this type of work. \r\n\r\nThe Belfast office will be wholly owned and controlled by Herbert Smith. It will open for business by the end of April 2011. The firm will initially recruit and train around 20 fee earners - a mix of solicitors and legal assistants  whose work will be completely integrated with Herbert Smith\'s service to clients across its international network. \r\n\r\nClients will be given the option of using the operation in Belfast when Herbert Smith discusses with them how their matters are to be resourced. \r\n\r\nThe office and its location will provide the following benefits:\r\n\r\n- a highly structured approach to document management and review \r\n- a significantly lower cost base in Belfast compared with England\r\n- a high quality pool of legal talent in Northern Ireland \r\n\r\nAn additional attraction was the financial and practical support provided by Northern Ireland\'s regional economic development agency, Invest Northern Ireland. \r\n\r\nThe office will be led on the ground by Libby Jackson, a solicitor currently in a practice management role in our London office, who will relocate to Belfast in early 2011. Overall management responsibility will rest with Sonya Leydecker, head of the firms global disputes practice, and Jenny Stainsby, a partner in our London office who comes from Northern Ireland, will also be closely involved in overseeing the initial development of the office. \r\n\r\nSonya Leydecker commented:\r\n\r\n\"I am very excited by this innovation. It will enable us to offer clients a very attractive combination of quality, efficiency and value for money. Clients are increasingly looking to their lawyers for more imaginative approaches to the management of disputes. In particular, complex projects such as disclosure are important but can increasingly be systematised and managed in new ways. The Belfast office will make a new range of resourcing options available to clients.\"\r\n\r\nJonathan Scott, the firm\'s senior partner, added:\r\n\r\n\"Our move is strongly aligned with clients\' interests and clearly sets us apart from the paths other firms have taken. This gives us a first mover advantage and we are confident we can take full advantage of it. We are very grateful to Invest Northern Ireland for the financial and practical assistance provided.\"\r\n',NULL,0,4,NULL,'Further developments in the outsourcing / LPO space as firms gear up for the impact of the Legal Services Act\r\n\r\nNo call to action.  Derek confirms that he is informing the appropriate people. YM 06/12/2010',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,62,'2010-12-03 09:53:52',111,'2010-12-06 16:42:22',7,0,NULL,NULL,NULL,'N'),(2101,'MARKET','Publication','Legal Week',1354,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,'BLP considers split from Lawyers on Demand arm as part of growth drive\r\nAuthor: Claire Ruckin \r\n02 Dec 2010 | 00:08 \r\n	Law firms: \r\n	Berwin Leighton Paisner \r\n\r\nFirm gauges options to sustain growth of much-touted virtual arm\r\nBerwin Leighton Paisner (BLP) is gearing up to split away from its groundbreaking Lawyers on Demand (LoD) service.\r\n\r\nThe City firms management is in talks that could see LoD, which provides clients with freelance lawyers on a temporary basis, spinning off from the law firm and operating as an independent business.\r\n\r\nThe discussions are being led by BLP managing partner Neville Eisenberg and LoD co-founders Jonathan Brenner (pictured) and Simon Harper, with a decision expected within the next six months.\r\n\r\nIf the firm decides to separate from the business, BLP would remain a key stakeholder, although its share of the LoD business is still to be decided. If LoD does spin off from BLP it is understood it may take advantage of opportunities under the Legal Services Act and seek outside investment within the next few years in order to develop the business further.\r\n\r\nThe virtual law firm, which was launched in 2008 by Brenner, the former co-founder of recruitment consultant ZMB, and BLP commercial partner Harper, is expecting to see turnover increase by more than 100% during 2010-11 to 4.5m, compared with 2m in the last financial year.\r\n\r\nIt has 75 lawyers on its books with between five and 15 years post-qualification experience and supplies locum lawyers to BLP as well as to in-house teams for clients such as Orange, BSkyB, Cisco, Gucci and a number of banks.\r\n\r\nLoD is now planning to extend its offering to other law firms and has already been in discussions with at least two firms in the City.\r\n\r\nEisenberg said: We have been looking at the structure of LoD and trying to figure out how to ensure its future success. Sometimes business lines that have separate structures have a bit more oxygen to develop business plans. LoD has been almost doubling in size annually; we want to ensure it continues to grow and remains successful.\r\n\r\nBrenner said: The LoD concept is at the heart of the debate on the changing face of the legal profession and the innovative ways in which legal services need to adapt to satisfy client demands.\r\n\r\nThe talks come after BLP earlier this year set up a division  Managed Legal Services  to directly run company legal teams.\r\n',NULL,0,0,NULL,'Additional developments in the legal services market in advance of the Legal Services Act. Expect more alternative models for service delivery emerge.\r\n\r\nNo call to action.  Derek confirms that he is informing the appropriate people. YM 06/12/2010','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,62,'2010-12-03 10:46:27',111,'2010-12-06 16:43:28',7,0,NULL,NULL,NULL,'N'),(2111,'PRODUCT','Customer cancellation request','Lyn Wildish',11344,NULL,NULL,NULL,NULL,NULL,4,4945,NULL,'Comments on LexisPSL Employment content and functionality (details below):\r\n\r\n\r\nFrom: Wilson, Dominique (LNG-LON)\r\nSent: 29 November 2010 09:38\r\nTo: Wadey, Amanda (LNG-LON)\r\nSubject: Help please on which PSL lawyer to ask to come with me to a meeting\r\nImportance: High\r\n\r\nGood morning,\r\nI hope that all is well and you are not too mad busy in the run up to year end.\r\nI am looking for a bit of guidance on which PSL lawyer to ask to come with me to see a client on 13th December in Norwich.\r\n\r\nThey were sold a load of PSL services in Feb of this year, by another account manager and so I am not really quite sure how the sale was positioned.\r\nThey are very unhappy with the service and I suspect will cancel on anniversary.\r\nThe trainers have been in, tech support have been in and so have I and I have suggested this meeting to explain to them what they had from Feb and what are plans are and re-structuring the package they have if needed to something that better suits their needs.\r\n\r\nI am not sure who is best to take from the team.\r\nAttached is their contract as they have lots of services though it seems these two teams are the most vocal!\r\n\r\nCan you suggest someone to approach?\r\nDom\r\n________________________________________\r\nFrom: Lyn Wildish [mailto:lwildish@steeleslaw.co.uk] \r\nSent: 26 November 2010 16:44\r\nTo: Wilson, Dominique (LNG-LON)\r\nSubject: \r\n\r\nDear Dom\r\nPlease see below comments from the two lawyers who will be attending the meeting on the 13 December.  I thought it may be useful for you to see their comments.\r\nEmployment\r\n1.      The team also has issues with the breadth and the depth of the content, and has had particular problems with the lack of more unusual precedents. For example, for Cosworth we required a salary sacrifice agreement, and for Premier we needed TUPE indemnities and warranties for an outsourcing agreement. Neither of these were available on PSL (or elsewhere on LNB). PLC has a much more extensive and reliable range of precedents.\r\n2.      The system is regarded as very slow, and will kick you out very quickly if it has not been accessed within about 30 mins  it can sometimes prove difficult to log back in and this is the cause of a great deal of frustration within the team when people are needing to access the information quickly.\r\n3.      When you access a particular document or page on the site, it does not allow you to go up one level in order to access a different (but related) document or page  it sends you right back to the beginning.  For example, once you have selected a precedent you cannot go back a step to select a related precedent, but have to start the process all over again.\r\n4.      The precedent pleadings are regarded as next to useless as they are very factually based and do not have enough legal content to be of any practical benefit.\r\n5.      The update section is very badly laid out and it is very difficult to locate updates from a particular period (eg from the last month).  Once an update drops off the front page, it is located somewhere within a very long list of subject headings and almost impossible to find unless you already know what you are looking for, as they are not listed by date.  The separate sections for news analysis (created by PSL) and legal updates (imported from LNB) is confusing and unhelpful.  I would agree that the updates provided by PLC are vastly superior in style and content.\r\nCompany Commercial\r\n6.      Lack of content in common subjects - eg. no terms and conditions.\r\n7.      The commentary and precedents are often too simple and lack the necessary depth to rely on.\r\n8.      The fact that the majority of the commercial content is merely an extract from EFP which we already have a full subscription to.\r\n9.      When accessing an EFP precedent through PSL it is impossible to see the wide commentary and other supplementary and related precedents in EFP without doing a second search in EFP (eg only one partnership agreement appears when EFP has a dozen which may be more appropriate). The effect of this with the previous point means that we increasingly do not use PSL but go straight to EFP.\r\n10.     The poor quality of some precedents (we would need to give them some specific examples  NCL recently commented on this)\r\n11.     That the service regularly crashes with no access to the system.\r\n12.     Lack of consistency of style between PSL and EFP.\r\n13.     When searching for a specific document (eg shareholders agreement) you can quickly find the precedent but it does not place this in context. You would commonly find one precedent and want to see what other precedents are included in the same area as well as reading the commentary and other information around the subject.\r\n14.     We were told previously that there was considerable work being undertaken to grow the system and have much broader coverage. There appears to be little evidence of additional precedents added in the time that we have been using the system.\r\n15.     The daily updates are better than those produced by the main Lexis system but of far less value than those produced by PLC.\r\n16.     In short it is a vaguely useful addition but far from being a replacement to the service that we had with PLC and certainly not one that I would recommend that we pay anything (or anything much) for on top of the existing subscription to EFP and the corporate law service. I had envisaged PSL as acting much more as an integrated portal to EFP and the other texts but it is actually a dumbed down edited selection.\r\nRegards\r\nLyn\r\nLyn Wildish\r\nFacilities Manager\r\nSteeles Law\r\nfor Steeles (Law) LLP\r\n2 Mount Street, Diss, Norfolk.  IP22 4QE\r\nTEL +44(0)1379 652141 FAX +44(0)1379 650150\r\nVisit our website at: www.steeleslaw.co.uk\r\nThis e-mail contains confidential information belonging to the sender which is legally privileged.  It is the responsibility of the recipient to ensure that any e-mails or attachments are virus free, as Steeles (Law) LLP accept no responsibility.  Should you not be the intended recipient then any disclosure, copying, distribution or the taking of any action in reliance on the contents of this e-mail is strictly prohibited.  If you have received this transmission in error, please notify us immediately, and permanently delete this message.\r\nSteeles (Law) LLP (OC305891) a limited liability partnership registered in England and Wales and regulated by the Solicitors Regulation Authority. Regi