t it is actually a dumbed down edited selection.\r\nRegards\r\nLyn\r\nLyn Wildish\r\nFacilities Manager\r\nSteeles Law\r\nfor Steeles (Law) LLP\r\n2 Mount Street, Diss, Norfolk.  IP22 4QE\r\nTEL +44(0)1379 652141 FAX +44(0)1379 650150\r\nVisit our website at: www.steeleslaw.co.uk\r\nThis e-mail contains confidential information belonging to the sender which is legally privileged.  It is the responsibility of the recipient to ensure that any e-mails or attachments are virus free, as Steeles (Law) LLP accept no responsibility.  Should you not be the intended recipient then any disclosure, copying, distribution or the taking of any action in reliance on the contents of this e-mail is strictly prohibited.  If you have received this transmission in error, please notify us immediately, and permanently delete this message.\r\nSteeles (Law) LLP (OC305891) a limited liability partnership registered in England and Wales and regulated by the Solicitors Regulation Authority. Registered office: 3 The Norwich Business Park, Whiting Road, Norwich, NR4 6DJ. A full list of members is available from the registered office. ',NULL,NULL,12,3,'FYI sent to the appropriate people on 09/12/2010. YM 15/12/2010','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,24,'2010-12-07 09:56:45',111,'2010-12-15 12:50:02',7,0,NULL,NULL,NULL,'N'),(2131,'PRODUCT','Other','LexisPSL',NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'On the whole PSL product, there are both Forms and Precedents, both of which have their own tabs and contain different content. However, both are set against LexisSmart and both use the same logo on thier launch pages. This is causing confusion for customer queries where the customer is simply using LexisSmart, and does not know the difference so poses a query for LexisSmart. This leads to confusion in the support teams as to where to direct the queries, and as the custodians of Smart Forms, we often get queries that are fro Smart Precedents, wasting valuable, highly-unresourced time in the UK.',NULL,NULL,0,3,'Change one or both logos to better reflect the content on PSL - at least differentiate them.\r\n\r\nResponse from Clare Duggan, 09/12/2010\r\n\"There was a commercial decision made to market and sell these as a package, hence the standard icon for them both. I think you need to encourage and explain to the support teams to check whether they are looking at forms or precedents before they direct their queries. Hopefully it is a teething issue which should be resolved once theyre educated.\"\r\n\r\nReply from Claire Melvin, 09/12/2010\r\n\"We agree with the concept to sell them as a package and the co branding  but this is not just the support team that are being affected  we had another one of these today from DH Stalland  asking why a particular document which was a smart form was broken (which it wasnt)  but it didnt have specific features on it which are actually smart precedent features not smart form features. We get the same sort of thing coming in the other direction with people complaining that a smart precedent doesnt have feature x  which you only get in a smart form.\r\nWeve tried to explain  that where they are in the precedent tab the features are different than those in the forms tab  with the same logo but no one gets itI think we need some more visual clues  say different coloured logos with the same branding   or something we can tell them to remind them (or more clarity in the support and promotional material)  that these ones do this  and the other ones do that.\r\nSame brand  both good  but different features.\"\r\n\r\nFurther response from Clare Duggan, 09/12/2010\r\n\"Thanks for the further clarification Claire. We can certainly look into this further and get a sizing for this work. Ideally Id want some further customer validation too which may be possible in some PSL usability sessions next year.\r\nIll keep you in the loop.\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,271,'2010-12-08 13:38:46',111,'2010-12-10 10:49:51',7,59,NULL,NULL,NULL,'N'),(2141,'COMPETITOR','Customer cancellation request','Westlaw',716,NULL,NULL,NULL,NULL,NULL,NULL,NULL,50,'Our client spends close to 160,000 with LexisNexis for the full online library, and a small selection of books.\r\n\r\nWestlaw have offered their service, although not comparible in content terms, at a ver competitive price:\r\n\r\nTotal price for Westlaw UK, Commentary and Kemp on Lawtel              =          38,900.00\r\n\r\nWe estimate they would need to spend approximately 50K - 60K with us to suppliment this content, and plug all the gaps, based on their current usage stats.\r\n\r\n\r\n\r\n',NULL,1,0,NULL,'We are going to package in new PSL and LexisCheck content to try and retain as much of this revenue as possible, but usefull for all to know that Westlaw are continuing with very aggressive pricing, and unless usage is high, it is difficult to persuade the client to stay with us at the same level of revenue...',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,'2010-12-08 15:52:58',111,'2011-01-20 14:21:33',7,121,NULL,NULL,NULL,'N'),(2151,'PRODUCT','Customer training session','Nicola Cornelius (and others)',13217,NULL,NULL,NULL,NULL,NULL,4,4792,NULL,'This insight was from feedback they gave in a quantum dbase training session - they have both psl and library so actually relates to both products. \r\n\r\n1) they find the psl quantum search from annoying as they can\'t search using BOTH injury drop downs and value ranges AND keywords at the same time - it\'s one or the other.\r\n\r\n2) The list of results is in reverse chronological and has no ability to sort by VALUE - this is a very common criticism of both psl and library for quantum and puts us behind both lawtel and kemp.\r\n\r\n3) I pointed out that on the psl form, if you use keywords, it only searches the top half of any quantum report - which they hadn\'t realised and accounts for why they often get 0 results. They use the keyword option when they have very specific scenarios for which the drop downs are not enough. They thought this should be included as an option if one needs to search the whole text of the quantum reports\r\n\r\n4) I indicated the lexis library search from does have the ability to do both 1 and 3 but then there is no value range restricter which was the main thing they really liked on PSL!',NULL,NULL,44,1,'With the revamp of Quantum we should look to take this customer feedback on board and do something about the search forms and sorting of results functionality.\r\n\r\nThis will be critical when our quantum data improves next year if users are to extract the maximum value from the data (and hence our investment in improving it) and find what they need. Just a bout every PI session I do users criticise our data and in particular the fact that there\'s no ability to sort results by VALUE.\r\n\r\nNicola thought that neither search from was quite right for the variety of different scenarios they find themselves in and I have to agree. I think we need to work towards ONE FORM which is the same on both sites and gives the user the ability to search with as much flexibility as they need.\r\n\r\nNicola (who is a trainee, soon to qualify and BIG advocate of our services internally) is also more than happy to speak to us about what needs to improve. She uses our site all the time and is the highest user in the firm...01792529622 nicola.cornelius@jcpsolicitors.co.uk\r\n\r\n\r\nResponse from Lisa Regan, 16/12/2010\r\n\"This is really useful and perhaps there is work to be done to the Quantum search forms in the New Year to make them more user friendly. I will raise this with some other customers and to the Product Development team to get their thoughts and opinions on how to proceed.  As a note, altering the search forms is application work and tied to scheduled Rosetta releases. Its doubtful we will have anything until at least Spring if we decide to make changes as the 2 first releases of 2011 are full up  February and April.\r\nIt is on my radar though!\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,65,'2010-12-16 11:55:22',111,'2010-12-16 14:01:27',7,61,NULL,NULL,NULL,'N'),(2161,'PRODUCT','Other','eBooks',2727,NULL,NULL,'','',0,0,NULL,NULL,'Graham Holliday, Information Manager contacted us because he heard about our eBooks offerring and what more info. He said \r\n\r\n\"As far as I can see, nearly all the books covered are also available in Lexis Library, but the advantage of this service is that you can download the whole book and then use it on your PC even when you don\'t have an internet connection.  I get the impression that it\'s aimed at small firms or sole practitioners who don\'t subscribe to Lexis Library?  It could, I suppose, also be useful for people who are working outside the office and aren\'t able to go on line - but they would presumably need to know in advance, so they could download the book.\" \r\n\r\nThis is useful because it reiterates the proposition from a customer perspective.',NULL,NULL,0,0,'Gemma Page has provided detailed information and offered a visit to explain further the offering.\r\n\r\nYM 12/01/2011\r\n\"Post my conversation with Dave Coleman regarding this Insight, it appears, judging from the Customer\'s feedback, that the purpose and benefits of e-books were not abundantly clear to the customer, particularly whether this product is a complement to or a substitute for one of our other products.  Therefore, we pose the following questions:\r\n 1) Have the benefits and positioning of e-books been communicated to the Sales force so they can handle such queries as raised in this Insight?\r\n 2) Equally, are the marketing collateral / customer communications clear on these points?\"\r\n\r\nSee email attachement for Cara\'s response. YM 17/01/2011','1295274290.htm','Re Insight ID 2161.htm','',NULL,'ebooks','','',0,241,'2010-12-17 12:10:51',1921,'2011-05-13 08:29:08',7,0,NULL,NULL,NULL,'N'),(2171,'PRODUCT','Other','Malcolm Dowden',9093,9093,'','Warren Gordon','senior real estate PSL ',1,1,NULL,NULL,'Malcolm has just taken a call from Warren Gordon, .  He is working with the EF&P precedent forward sale agreement (copy attached) which is in vol 38(3) of EF&P.\r\n\r\nHe noted a small typo which is now being amended but Warren was generally very positive about the precedent, and about EF&P in general. \r\n\r\n\r\n \r\n\r\n',0,0,0,3,'Nothing needs to be done as the fix is already in hand but Malcolm wanted the positive feedback to be recorded somewhere hence this insight.','',NULL,'',NULL,NULL,'','',0,59,'2011-01-05 10:31:32',101,'2011-01-10 13:51:44',7,59,NULL,NULL,NULL,'N'),(2181,'CUSTOMER','Informal conversation','Paul Smith, Marketing',1439,2681,'','David Lewiston','Marketing',NULL,NULL,NULL,NULL,'Test',4,11,27,NULL,'Test','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,601,'2011-01-06 13:49:37',111,'2011-01-21 10:31:20',21,0,NULL,NULL,NULL,'N'),(2191,'MARKET','Informal conversation','Paul Smith, Marketing',1439,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,'Test',NULL,11,12,NULL,'Test','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,601,'2011-01-06 16:29:56',111,'2011-01-21 10:32:53',21,0,NULL,NULL,NULL,'N'),(2201,'PRODUCT','Informal conversation','Paul Smith, Marketing',1439,NULL,NULL,NULL,NULL,NULL,11,1072,NULL,'Test',NULL,NULL,27,2,'Test','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,601,'2011-01-07 09:29:46',111,'2011-01-21 10:33:54',21,0,NULL,NULL,NULL,'N'),(2211,'CUSTOMER','Renewal or new business conversation','Jack Jones',1591,1591,'BOLT5000','Jack Jones','Service Manager',NULL,NULL,NULL,NULL,'Test',11,1,28,NULL,'test','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,521,'2011-01-07 11:08:52',111,'2011-01-21 10:31:41',21,0,NULL,NULL,NULL,'N'),(2221,'MARKET','Industry event','Jack Jones',1591,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,'blah blah blah blah test',NULL,1,28,NULL,'N/A','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,521,'2011-01-07 11:13:41',111,'2011-01-21 10:32:13',21,0,NULL,NULL,NULL,'N'),(2231,'PRODUCT','Informal conversation','Jack Jones',1591,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,'test',NULL,4,44,0,'test','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,521,'2011-01-07 11:18:00',111,'2011-01-21 10:33:29',21,0,NULL,NULL,NULL,'N'),(2241,'COMPETITOR','Informal conversation','Paul Smith, Marketing',1439,NULL,NULL,NULL,NULL,NULL,NULL,NULL,43,'Test',NULL,1,43,NULL,'Test',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,601,'2011-01-07 11:24:17',111,'2011-01-21 10:35:01',21,0,NULL,NULL,NULL,'N'),(2251,'PRODUCT','Direct Mail','Maxine Coles',4950,NULL,NULL,'','',1,4,NULL,NULL,'Once you have gone in to the forms section of an area (in my case Wills and Probate) there is no search facility and all the forms available are listed in a somewhat random order. A search facility at this point would be helpful.',NULL,NULL,47,3,'Response from Clare Duggan, 09/03/2011\r\n\"Longer term we are working towards a single forms repository which will hopefully enable us to offer a search across Forms. It\'d be interesting to hear what ordering Maxine would find more intuitive on this page.\"','',NULL,'',NULL,NULL,'LexisPSL - Wills & Probate','',301,68,'2011-01-18 13:44:18',1921,'2011-09-02 14:33:13',72,59,0,NULL,NULL,'N'),(2261,'COMPETITOR','Customer training session','PSL',10880,NULL,NULL,'','',1,4,NULL,47,'I heard yesterday from Chris Albion, the main Commercial Solicitor in Sharman Law (a Suzanne account from Bedford) that he is keen to see alternatives to PLC as he\'s finding it getting more and more unwieldy with the amount of content.\r\n\r\nHe also commented that he was finding it frustrating with the result sets you tend to get on PLC which are often long and not very relevant.\r\n\r\nCould this be an early sign that the perception is changing! Is anyone else hearing the same?\r\n',NULL,4,11,6,'Carry on as we are, ensuring we having appropriate coverage, but not too much as can link to Lexis Library.\r\n\r\nAwaiting response from Malcolm Dowden. YM 19/01/2011\r\n\r\nResponse from MJD:  I recently had an opportunity to compare PLC directly with LexisPSL Property.   There is no doubt that PLC\'s coverage of property issues is extensive.  However, I think that we are in a position to be far more positive about the ability of LexisPSL to match up point for point.   The key advantage of LexisPSL is that we can keep our practice notes brief and practical - links to LexisLibrary material and other resources (eg Law Soc guidance notes) allow us to be concise where PLC must describe cases, legislation etc in the body of their notes.   However, be aware that PLC are beginning to respond directly to LexisPSL.  They have adopted the \'tab\' structure for topics and sub-topics, and they are trying to break their long practice notes (eg more than 50 pages on easements) into more manageable and focused notes.  While that is an indication that they are raising their game in response to LexisPSL, it does give us an immediate opportunity to highlight the many instances where they have \'blank\' tabs (ie no content behind them).  In a number of areas LexisPSL content now surpasses PLC\'s.  The tab that is always populated in PLC is \'legal updates\' (ie material drawn from their excellent daily update emails).  However, that material is undifferentiated and includes a lot of outdated content.  It would be worthwhile considering as a marketing tactic the application of LexisCheck to content downloaded from PLC.  ','',NULL,'',NULL,NULL,'','',81,66,'2011-01-18 16:16:02',101,'2011-03-08 16:00:01',7,201,NULL,NULL,NULL,'N'),(2271,'PRODUCT','Customer training session','Tom Cadman',9756,NULL,NULL,'','',1,4,4959,NULL,'Tom queried why a user couldn\'t search across all LPSL modules, rather than having to repeat a search in each module.\r\nQuery came about because of the Forms contained within LPSL.  Tom raised the issue of the inability to search for a form, this then led him to raise that it would be an improvement to both be able to search for a form, but also to search across all the LPSL modules',NULL,NULL,47,3,'Response from Clare Duggan, 20/01/2011\r\n\"Both of the points Tom raises are items we will be validating in our usability study next month so we can assess their relative importance in the backlog of LexisPSL developments. The first item has historically been down to the fact that we haven\'t had a single repository of Forms but I believe we are getting closer to this solution, which may open up new opportunities.\r\nWe will be looking for attendees in the usability study so if Tom is interested, it\'d be great to include him.\"\r\n','',NULL,'',NULL,NULL,'','',281,68,'2011-01-20 09:43:02',101,'2011-01-20 14:34:50',7,59,NULL,NULL,NULL,'N'),(2281,'PRODUCT','Customer training session','Martin Legg',3985,NULL,NULL,'','',1,1,NULL,50,'What Martin likes about Lexis Library - \r\n\r\nCOMPREHENSIVE. In his words, he knows they have had a trial of Wests and plc but he knows Lexis is the most comprehensive and that he\'ll find something on the site to answer his queries or provide a precedent. \r\n\r\nWhat would change: the way it searches (some of which has been addressed) and the ease of use of precedents (which is mostly now sorted with new word download icon)',NULL,NULL,0,3,'Martin would like to see more intuitive search functionality - some of which is there with the word-wheels but for more general research too.\r\n\r\n\r\nResponse from Clare Duggan, 25/01/2011\r\n\"I think the double word-wheel on the Explore box which is due out in Q1 2011 should help Martin with his more general research. We\'ll be sending around internal and external communications on this closer to the time.\"','',NULL,'',NULL,NULL,'','',281,65,'2011-01-20 11:30:10',101,'2011-01-25 10:42:32',7,59,NULL,NULL,NULL,'N'),(2291,'PRODUCT','Customer training session','Gillian Forsythe',NULL,NULL,NULL,'','',1,1,NULL,NULL,'What she dislikes about lexis library is the bar in the doc view as it never behaves itself and is difficult to move over - this should be made easier\r\n\r\nThis is quite a common complaint that on some systems, the bar between the tree and document can be dragged one way but then won\'t let you drag it back - it moves just as you attempt to pick it up',NULL,NULL,0,0,'investigate why the bar does not always behave and perhaps make it easier to pick up.\r\n\r\n\r\nResponse from Clare Duggan, 25/01/2011\r\n\"This is something we can certainly monitor and am sure as we move away from a frames based product going forward, will disappear in the longer term.\"','',NULL,'',NULL,'Lexis Library ','','',271,65,'2011-01-20 11:33:08',101,'2011-01-25 10:43:43',7,59,NULL,NULL,NULL,'N'),(2301,'PRODUCT','Customer training session','Victoria Rounding ',3985,NULL,NULL,'','',1,1,NULL,47,'Vicki is familiar with most online service - she liked Wests and PLC at law school but knows our site is bigger and has greater content - DEPTH was the word used. Vicki was one of the key people trialling plc and wests recently as she was familiar with them - likes their sites but now for her work in practice prefers our resources.\r\n\r\nWhat Vicki would change abotu our sites: in Vicki\'s words \' your site is far more comprehensive than Wests or PLC and so consequently that makes it more difficult to find what you\'re looking for - but once you get used to your site, you know there will usually be something there for what you need\' (or words to that effect). So generally she would change the usability / searching - some of which I could show her and she liked with the enhancements.',NULL,NULL,0,0,'continue to develp the search functionality with to make it as easy as possible for users to find content. People expect everything to work like google with it\'s complex algorithms to find a best fit and generally find what users want quickly.\r\n\r\n\r\nResponse from Clare Duggan, 25/01/2011\r\n\"There\'s not a lot to add here - as you know, there are further enhancements being made to the search over the coming months which should help significantly\"','',NULL,'',NULL,NULL,'','',281,65,'2011-01-20 11:38:10',101,'2011-01-25 10:45:15',7,59,NULL,NULL,NULL,'N'),(2311,'PRODUCT','Customer training session','Simon Rounding ',3985,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'he uses Lexis Library quite a bit and has has some big gripes about our site  he hates the doc view move the bar over function as its too fidley and rarely works for him  he think this needs fixing. \r\nThe pop up to open all levels\' in browse view also drives him mad as it obscures the text (not the first time Ive heard this), he hates searching as he either gets nothing or loads (but I have addressed many of his concerns now with training)',NULL,NULL,0,0,'this insight was added in error as i had already done it - insight number 1881 - apologies.\r\n\r\nthis has been dealt with.','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,65,'2011-01-20 11:41:08',111,'2011-01-21 10:28:47',21,0,NULL,NULL,NULL,'N'),(2321,'PRODUCT','Customer training session','KYC ID',10504,NULL,NULL,'','',1,16,3389,NULL,'Please see below question from Roythornes abotu KYC ID, and answer from GB URU. Can we review what we offer as documents that clients can enter to verify a client?\r\n\r\n\r\n1. Does it have to be driving licence or passport? Can any of the following forms of id be sufficient given not everyone drives or has travelled abroad:\r\n\r\ni) Bank details\r\nii) Foreign id cards\r\niii) Pension number\r\niv) Shotgun licence (this was Spalding!)\r\n\r\nIf so, is there somewhere that you can key in what\'s on them, or is it the address that they\'re helpful for confirming...?\r\nA. The Lexis Nexis website front end has been designed to check UK driving licence & passport.  The underlying URU service does support checking of Bank account numbers, credit & debit card addresses & foreign ID cards but access to these functions is licence dependant and would need integrating within the Lexis Nexis website for this to be supported.\r\n\r\nOne thing to note is that URU can still check a provisional driving licence even if the person does not have a full one because they haven\'t passed their test as the driving licence number would stay the same.\r\n',NULL,NULL,59,9,'Review what we allow as documents that KYC ID accepts for id verification as many people don\'t have a passport or driving licence.\r\nIt sounds liek it is possible, just a Lexis choice to not include it as yet.\r\n\r\nUpdate Mark Dunn 03.05.11\r\nThese are currently the only documents enabled by GB Group for their URU service used by KYC ID. We can discuss with GB to see if the ID document options can be expanded.\r\nUpdate Mark Dunn 05.05.11\r\nI have a monthly catch-up with GB Group and will discuss this with them later this month.\r\n\r\n\r\n\r\n','',NULL,'',NULL,NULL,'','',281,66,'2011-01-21 10:58:47',101,'2011-05-05 14:18:13',4,1501,NULL,NULL,NULL,'N'),(2331,'PRODUCT','Customer training session','KYC ID',10504,NULL,NULL,'','',1,16,3389,NULL,'The following question arose at Roythornes which URU GB answered and looks as if there could be an enhancement to the way it handles sanctions in the report. Now it picks up wider data, there are regularly many names that seem to match for sanctions, usually from the States.\r\n\r\n\r\n1. Sanctions - often throws the report to a \'fail\' as has found lots of similarly named Americans. Is there a way of showing you have checked each one (by clicking into) and found them not to be your individual?\r\n\r\n',NULL,NULL,59,9,'Review how Sanctions appear on the report - can it be tracked/proved that individuals have been checked as not being your client so safe? IE change colour on the report, or have some kind of \'stamp\'?\r\n\r\nUpdate Mark Dunn 03.05.11\r\nThis is not a feature inbuilt within URU currently and we will need to check back with GB Group to see if their product interface allows this type of functionality. \r\nUpdate Mark Dunn 05.05.11\r\n\"I have a monthly catch-up with GB Group and will discuss this with them later this month.\"\r\n\r\n\r\n\r\n','',NULL,'',NULL,NULL,'','',301,66,'2011-01-21 13:09:47',101,'2011-05-05 14:15:25',4,1501,NULL,NULL,NULL,'N'),(2341,'COMPETITOR','Customer training session','Julian Rowden',13338,NULL,NULL,'','',1,4,NULL,47,'They had noticed since about 6 months ago that the PLC property updates had not been any where near as good as they used to be. they contain very little cases and more stuff from focus groups etc which Julian doesn\'t find useful.\r\n\r\ni set him up with a Library updater.',NULL,1,11,5,'nothing - just a bit of info!\r\n\r\nResponse from Joanna Bhatia, 22/02/2011\r\n\"We have been working hard on our current awareness in Property PSL and recent feedback suggests we are ahead of PLC in terms of reporting on cases.\r\nYour customer may also find it helpful to receive the PSL daily email alert (set up by going to Manage Legal Updates as I\'m sure you know) if he subscribes to LexisPSL which may prove to be even more focused for him.\"','',NULL,'',NULL,NULL,'','',81,65,'2011-01-28 16:27:59',101,'2011-02-22 17:41:51',7,201,NULL,NULL,NULL,'N'),(2351,'PRODUCT','Customer training session','Sophie Anderspn',1310,1310,'BENY5000','Nick Benyon','Managing PArtner',1,4,NULL,NULL,'I conducted a \"Day in the Life\" session here to gain insight into how the customers uses our product, how regularly, where in the work flow.\r\nTo better understand how their business operates and how we can apply this understanding to the training we deliver to ensure a fully bespoke offering is provided.  In many ways it is like a mini needs analysis .',0,1,44,6,'Analysis for training needs of PI firms\r\nKaren O\'Sullivan emailed 14 March 2011:\r\n Ogden tables to be within toolkit - we plan to add these to the toolbox when its contents are expanded later this year. The engineers are currently ascertaining how much info we can fit into the toolbox before the front page becomes cluttered and confusing\r\n Industry \'Norms\' - for example when a hair dye goes wrong there would be a industry norm amount that we can refer to without going to Quantum - I have added this to our roadmap for consideration. I suspect we may just link to relevant websites from the toolbox but that would still save the fee earner time. It may be too risky to have the information in the product as it would be hard to keep it up to date\r\n Out of court Settlements - for example those cases which do not get to court but are settled out of court - I have never thought these are of much use but if I got more feedback asking for this we could consider expanding the quantum database to include them\r\n\r\n','1296377097.doc','DAY IN THE LIFE (Sophie) form 1.doc','',NULL,NULL,'','',341,67,'2011-01-30 08:46:25',101,'2011-05-09 10:40:58',7,371,NULL,NULL,NULL,'N'),(2361,'CUSTOMER','Customer training session','LEGL01',2467,2467,'CHAT5005','Libby Nicholason','Partner & KM',1,1,NULL,NULL,'The customer commented that as a Wills & Probate Lawyer she becomes frustrated by the crossover of information with the Family Practice area within Library, she uses W&P practice area mainly however when she needs to find forms & precedents relating to divorced clients wills etc she has to use the family practice area. She believes that this should be held within the W&P menu',0,1,56,3,'Can we allow access to this content within both menus?\r\n\r\nDO we have an update on this trakcer, customer has requested feedback, thanks\r\n\r\nPM 25.05.11 Insight reassigned from Jon Scriven to Lisa Regan.','',NULL,'',NULL,NULL,'','',131,91,'2011-02-01 12:03:46',1921,'2011-11-01 10:19:10',72,61,0,'TBC','','N'),(2371,'PRODUCT','Customer training session','Wolferstans',12921,NULL,NULL,NULL,NULL,NULL,4,4949,NULL,'I was training a team of clin neg lawyers who were not impressed with our Clin neg offering in PI PSL.  The quantum cases they found were old and not enough.  The calculators need to include the multipliers.',NULL,NULL,44,6,'I fed this back to Jonathan Scriven (CC\'d Amanda Wadey). with details on comments made - email sent 24th Jan\r\n\r\nKaren O\'Sullivan responded by email 14 March 2011 - \r\n we are aware our clinical negligence content is limited and needs to be expanded. An external author is working on new practice notes and these should appear in the product soon\r\n we are launching a big marketing campaign in the next 2 months to significantly expand the number of cases in our quantum database. This should increase the number of clinical negligence quantum cases in the database and hopefully resolve the customer\'s concern\r\n we are aware multiplier calculators need to be included in the second tranche of calculators which will be released later in 2011\r\n\r\n','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,67,'2011-02-03 20:57:25',1921,'2011-04-11 11:52:15',7,371,NULL,NULL,NULL,'N'),(2381,'PRODUCT','Customer training session','Michlemores',8401,NULL,NULL,'','',0,4,4949,NULL,'Content needed.\r\nI sent the following to Jon Scriven today:\r\nHi\r\n \r\nAm at Michelmores with the PI/clin neg team.\r\n\r\nThis is what they would love to see in PSL:\r\n\r\nMore Clin neg overall\r\n\r\nMultiplier calcs\r\n\r\nA Disclosure letter (not pre action)\r\n\r\nLetter for a client setting out the stages of a court case\r\n\r\nLetter to client regarding seriousness of not telling the truth and the importance of the statement of truth.\r\n\r\nPI trust advice letter explaining what it is and why they need it\r\n\r\nLetter to client explaining expert meetings and what they will do\r\n\r\nLetter to client explaining general and special and provisional damages\r\n\r\n\r\nThanks!!\r\n\r\nSophie',NULL,NULL,44,3,' More Clin neg overall - an external author is in the process of preparing additional clinical neg practice notes and we hope to add these to the product shortly\r\n Multiplier calcs - a second tranche of calculators are to be added to the product later in 2011. We intend to include multiplier calculators in this second release.\r\n A Disclosure letter (not pre action) - this is currently being prepared and should be added to the product shortly\r\n Letter for a client setting out the stages of a court case - this is a good idea and something we will certainly consider adding in the future\r\n Letter to client regarding seriousness of not telling the truth and the importance of the statement of truth - this is a good idea and something we will certainly consider adding in the future\r\n PI trust advice letter explaining what it is and why they need it - this is a good idea and something we will certainly consider adding in the future\r\n Letter to client explaining expert meetings and what they will do - this is a good idea and something we will certainly consider adding in the future\r\n Letter to client explaining general and special and provisional damages - this is a good idea and something we will certainly consider adding in the future\r\n\r\n','',NULL,'',NULL,NULL,'','',0,67,'2011-02-03 20:59:18',1921,'2011-05-09 10:40:31',7,371,NULL,NULL,NULL,'N'),(2391,'CUSTOMER','Customer training session','Sophie Anderson',NULL,NULL,'','DEBBIE SIMONS','',1,0,NULL,NULL,'CHILDREN - Not enough content for most local authority legal teams.  to the point where someone said it was \"useless\"',0,4,28,9,'email to Dolly - LExis PSL\r\nWorking in collaboration with family team and external author to improve children\'s content.  Hopefully Q3 2011.','',NULL,'Plymouth City Council','Plymouth City COUNCIL',NULL,'','',452,67,'2011-02-03 21:01:24',1921,'2011-09-02 14:54:13',72,351,0,NULL,NULL,'N'),(2401,'COMPETITOR','Customer training session','Sophie Anderson',NULL,NULL,NULL,'','',0,0,NULL,47,'PLC has more practical precedents - example used a KIT letter\r\n\r\n',NULL,4,24,0,'Contact PSL team, give email address of trainee.\r\nSee PSl response:\r\n\r\nDear Ms Searle\r\n\r\n \r\n\r\nFurther to my email last week and your subsequent conversation with my colleague, Samantha Burnett, I am pleased to advise that a new precedent, Letter  employer\'s invitation to employee to work a KIT day (maternity leave), has now been added to LexisPSL Employment.\r\n\r\n \r\n\r\nYou can access it by browsing via the topics on the left hand side of the home screen under Protected rights in employment > Maternity, parents and carers > Precedents tab, under the heading maternity leave.  Alternatively, you can access it by clicking here (you will be prompted to log on to the service before being taken directly to the precedent).\r\n\r\n \r\n\r\nI hope that you find the new precedent helpful.  If you have any comments on it, please feel free to pass them on directly to me.\r\n\r\n \r\n\r\nThank you very much for your input.\r\n\r\n \r\n\r\nYours sincerely\r\n\r\n \r\n\r\nMelanie Adams\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n\r\n\r\n \r\n\r\nMelanie Adams\r\n\r\nSolicitor\r\n\r\nLexisNexis\r\n\r\nHalsbury House\r\n\r\n35 Chancery Lane\r\n\r\nLondon, WC2A 1EL\r\n\r\n \r\n\r\nmelanie.adams@lexisnexis.co.uk \r\n\r\n+44 (0)20 7400 2752 Direct\r\n\r\n+44 (0)7771 947135 Mobile\r\n','',NULL,'Plymouth City Council',NULL,NULL,'','',0,67,'2011-02-03 21:03:42',1921,'2011-05-24 10:48:23',7,431,NULL,NULL,NULL,'N'),(2411,'CUSTOMER','Customer training session','Sophie Anderson',1310,1310,'BENY5000','Nick Benyon','Managing PArtner',0,0,NULL,NULL,'Day in the life - project',0,4,44,0,'Karen O\'Sullivan emailed her response on 14 March 2011:\r\n\'I have just reviewed your \'Day in the life\' document for Benyons on the insight tracker. I note the main feedback from this fee earner was:\r\n\r\n\'More client letter precedents.  I have to explain everything to my client, process, stages etc and it would be great to have these as templates.\'\r\nThis seems to be a request a few customers have asked for so I have added it to our roadmap and will seriously consider adding some client letter precedents as soon as possible\r\n\r\n','1296767442.doc','DAY IN THE LIFE (Sophie) form 2.doc','',NULL,NULL,'','',0,67,'2011-02-03 21:12:14',1921,'2011-05-09 10:39:59',7,371,NULL,NULL,NULL,'N'),(2421,'MARKET','Renewal or new business conversation','FT & TIM',NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,NULL,'The client expressed concern that with the change in the pricing/licensing models adopted by the FT & TIM, this could lead to further publishers re assessing the Paywall model which would seriously undermine their business case for subscribing to services such as LexisNexis. ',NULL,24,0,NULL,'Please note there is no option for LN News & Business in the porduct family drop down - can you please amend\r\n\r\nLN needs to compile a statement that can be used by Sales so as to qwell any concerns regarding the potential loss of data from its services which may be due to publishers re asseessing their pricing models','',NULL,'Booz',NULL,NULL,NULL,NULL,NULL,841,'2011-02-03 21:59:35',111,'2011-02-04 12:25:33',3,121,NULL,NULL,NULL,'N'),(2431,'CUSTOMER','Other','Custommer Service Desk',NULL,NULL,'','Chris Goodger','Head of Information',0,0,NULL,NULL,'The client is very unhappy with the UK helpdesk as he has said he seems to know more about the Nexis.com than they do.  he has had several unpleasant converations so he has decided to use the US Helpdesk.  This is the number that all users now use.',0,0,0,0,'Train the Helpdesk and introduce an ongoing programme to support them so taht they may provide better support to clients on the Nexis.com, Lexis.com platforms','',NULL,'CRA International',NULL,NULL,'','',0,841,'2011-02-03 22:03:00',1921,'2011-11-14 16:03:30',92,1901,0,'TBC','','N'),(2441,'CUSTOMER','Informal conversation','Ryan Lane',NULL,NULL,'MART0044','Ryan Lane','Tax Manager',0,0,NULL,NULL,'Ryan couldn\'t understand why I didn\'t have informaiton on his colleagues attendance of our CPD seminar events. Our records on quickview do not communicate with the Elegy software used by the training and CPD dept. Therefore a KAM is only aware of online CPD subscriptions for a firm and not their attendance of events therefore making it challenging to gain real metrics when comparing online CPD and CPD conferences.',54,10,0,0,'Is there a plan to surface Elegy information into QuickView?  If not, can there be?\r\n\r\nDC: Hey Manni, this is a well documented issue, shared by a number of the SalesForce. The issue is under review in terms of getting the detail surfaced in QuickView, but may be held off until SOMIT is delivered. I will chase business systems for you.','',NULL,'Martin Green Ravden','Martin Green Ravden',NULL,'','',0,1211,'2011-02-04 09:52:42',52,'2011-06-22 08:07:14',7,52,NULL,NULL,NULL,'N'),(2451,'PRODUCT','Renewal or new business conversation','Gregg Thomas',NULL,NULL,NULL,'','',0,0,NULL,NULL,'This customer cancelled his online tax library due to difficulties with functionality and low usage. They were happy to replace their tax annuals on a firm wide license of e-books however our list of e-books on tax isn\'t the most comprehensive therefore they refrained from doing so.',NULL,NULL,1,2,'More of our front list book titles should be made available as e-books.\r\n\r\nResponse from Victoria Taylor, 04/02/2011\r\n\"Thank you for providing this feedback. By the end of Feb we\'ll have the following tax titles available as eBooks: Tolley\'s VAT Cases 2010, Tolley\'s Tax Cases 2010, Whillan\'s Worldwide Taxes 2010-11, Tolley\'s Tax Guide 2010-11, Tolley\'s Capital Gains Tax 2010-11 (Budget Edition & Main Annual), Tolley\'s Corporation Tax 2010-11 (Main Annual), Tolley\'s Income Tax 2010-11 (Budget Edition & Main Annual), Tolley\'s Inheritance Tax 2010-11, Tolley\'s Value Added Tax 2010 Second Edition, Clarke: Offshore Tax Planning 17th Edition, Tolley\'s Yellow Tax Handbook 2010-11, Tolley\'s Orange Tax Handbook 2010-11, Tax Office Directory 2011 First edition, Tolley\'s Tax Planning Set 2010 and Tax Office Directory 2011 first edition. \r\nThe rest of the tax list (with only a few minor exceptions) will be available when the printed edition publishes.\r\nI would very much like to hear which titles the customer wanted in eBook format that were not yet available. Please could you let me know?  \r\nHowever, in 2011 we will be publishing the majority of tax titles as eBooks.\r\nI\'d be very happy to discuss this with you further. Which titles were they particularly interested in? Does the customer take Tolley Guidance?\"\r\n\r\nManni Sasani, 04/02/2011\r\n\"The client used to take the library which they cancelled. Tolley Guidance is of interest to them but we haven\'t reached the trial stage yet as they are still reluctant about the concept of taking another \'online\' service.\r\nI believe it was the tolley tax \'planning\' titles that they wanted which was missing.\"\r\n\r\nIn this instance the customer\'s reluctance was mainly to do with price of multiple-licences. This query has been passed directly to the tax developer in case there is anything we can do for this particular customer. ','',NULL,'Blinkhorns',NULL,'e-books','e-books','',0,1211,'2011-02-04 10:00:47',1921,'2011-05-24 15:52:48',7,1561,NULL,NULL,NULL,'N'),(2461,'PRODUCT','Customer training session','Chris Shaw',13217,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Chris had been searching for a deed severing a joint tenancy (particularly the one he knew exists in BWPAS. He had entered into lexis library in various boxes \'sever joint tenancy\', had tried connectors and other arrangements but could not find it.\r\n\r\nhe went back to the old CD BOS for BWPAS and entered the same search and found it straight away. He was rather dismayed that the older CD search seemed much more user-friendly.',NULL,NULL,47,3,'I have already reported this one to Alex Smith too - i don\'t think any of the current search enhancements would help as if one enteres a partial word at the start of a search in quick find - such as \'sever joint tenancy\' , the word wheel doesn\'t then find \'severing\' - which is the word used in the actual precedent.\r\n\r\nResponse from Alex Smith, 23/02/2011\r\n\"This is great feedback on one of the core wider feedback we have on LexisLibary and LexisPSL. We are currently in the middle of massive two year investment around the search but getting the engine right for legal research involves a lot of research. \r\nWe\'d love to have this customer involved in some of our upcoming Search and Results usability studies. Could you please contact the customer to see whether they would be willing to be part of this (likely to an hour in the next few months) and get their details? We will be testing several engine capabilities and how they test with what the user is looking for. \"\r\n\r\nResponse from David Smith, 25/02/2011\r\n\"Hi Alex,\r\n\r\nYes indeed - this firm have already agreed to take part in the usability study and Clare Duggan is to contact them.\r\n\r\nHi Clare,\r\n\r\nI mentioned the other day that JCP have a young solicitor - Nicola Cornelius who you should try to get them to engage in the usability study when you visit, another person is Chris Shaw who gave me the following feedback which I entered into the iknow tracker (very similar thing to the bloke from Phillips & Co in Ludlow - insight 2471):\r\n\r\nChris had been searching for a deed severing a joint tenancy (particularly the one he knew exists in BWPAS. He had entered into lexis library in various boxes \'sever joint tenancy\', had tried connectors and other arrangements but could not find it.\r\n\r\nhe went back to the old CD BOS for BWPAS and entered the same search and found it straight away. He was rather dismayed that the older CD search seemed much more user-friendly.\r\n\r\nThey are 2 offices apart\"','',NULL,NULL,NULL,'Lexis Library','Lexis Library ',NULL,NULL,65,'2011-02-04 11:20:57',111,'2011-02-25 10:28:13',7,65,NULL,NULL,NULL,'N'),(2471,'PRODUCT','Customer training session','Steven phillips',9608,NULL,NULL,'','',0,1,NULL,NULL,'Steven is new to the online site but has used various BOS Cd\'s over the years including EF&P. he was surprised that the search funtion on the CD appears far more flexible and forgiving than the online alternative where words one enters in the search HAVE to be in the document or you get no results.',NULL,NULL,0,0,'I know some of the search enhancements will help but this was the 2nd time in a week someone had referred to the flexibility of the BOS CD search and how it was better than Lexis Library\r\n\r\nResponse from Clare Duggan, 23/02/2011\r\n\"Did you show the customer synonym searches as this is a good example of where your search terms don\'t have to be in the document? As I\'m sure you\'re aware, we\'re continuing to make a huge investment in search enhancements so really want to highlight the realm of great features and functionality to our customers. There will be more usability studies going on this year for searching and search results this year, so it\'d be good to include a user like Steven if he was willing to participate.\"','',NULL,'',NULL,NULL,'','',0,65,'2011-02-04 11:23:55',1921,'2011-05-24 09:30:11',7,61,NULL,NULL,NULL,'N'),(2481,'PRODUCT','Customer training session','Stephen Phillips',9608,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The client was hoping to find a \'short\' shop lease somewhere within psl but the one provided was somewhat longer. As well as using PSL, they also have continued to take Practical Lease Precedents from Sweets as there are some short leases within that work which are far more appropriate for the type of business they deal with.\r\n\r\nThis is not the first time users have said this - that the leases in our products are often just too long and detailed. This client is in a rural location, small town (Ludlow),, small firm and so are within the target market for PSL - in this case it currently doesn\'t provide all the documents they need.',NULL,NULL,49,3,'Offer both the longer shop leases but also a very much shorter, basic lease for a shop to cater for our different markets and client bases. They considered this to be possibly the most common document they use.\r\n\r\nResponse from Malcolm Dowden, 04/02/2011\r\n\"Ive been in touch with David on this insight and agreed to add a new precedent to meet the customer feedback.\"','',NULL,NULL,NULL,'Lexis PSL',NULL,NULL,NULL,65,'2011-02-04 13:18:00',111,'2011-02-04 16:41:21',7,201,NULL,NULL,NULL,'N'),(2491,'CUSTOMER','Other','James Froggart',NULL,NULL,'','','',0,0,NULL,NULL,'The International Tax menu is not as comprehensive as it could be.  The customer feels that the commentary around International Transfer Pricing is weak and not sufficient if investigated by UK Tax authorities.  The customer feels CCH offers more commentary but does not represent the information in a user friendly manner.',55,24,0,0,'DC: Hi Sam having looped around with the Tax team, they totally agree and this issue is well recognised. They have plans in place to rectify this and its on the RoadMap. Keep raising this in your team meetings for updates and thanks for your input.','',NULL,'Halcrow',NULL,NULL,'','',0,1371,'2011-02-08 13:06:54',52,'2011-06-22 08:12:44',7,52,NULL,NULL,NULL,'N'),(2501,'PRODUCT','Other','Sophie Anderson',NULL,NULL,NULL,'','',0,1,NULL,NULL,'Would be good to add a link from LL to PSl on the general search screens not just on PAP\'s screen as many client do not use PAP\'s screen but prefer using the general tabs.',NULL,NULL,0,0,'Response from Clare Duggan, 23/02/2011\r\n\"Lisa and I will take a look at what this would involve and come back to you. It\'d be good to get some customer contact details as and when it arises too.\"','',NULL,'',NULL,NULL,'','',0,67,'2011-02-09 10:08:26',1921,'2011-05-24 09:31:07',7,61,NULL,NULL,NULL,'N'),(2511,'PRODUCT','Customer training session','Claire Manning',13375,NULL,NULL,'','',0,1,3503,NULL,'Claire queried whether it is possible to download precedents from Atkins Court Forms with automatic numbering, as is possible on EF&P using the Word icon. I said that it is not available, and the Word icon on EF&P is a temporary measure while a broader strategy is developed. Claire complained that it is very difficult to implement house-styling on documents from Atkins at the moment. She also pointed out how me measure up badly against a competitor. In her words:\r\n\r\n\"Thanks Ben - it\'s disappointing for our lawyers not to have this functionality in the new service, especially when PLC have been offering house-style documents for years now. Thanks for looking into this for me though.\"',NULL,NULL,0,3,'Investing in our precedents proposition so that they are easy to use and do not involve significant secretarial work to be utilised. We are very far behind our competitors in this regard. SmartPrecedents is a step in the right direction, but it is not yet comprehensive, and we have excellent precedents in sources such as Atkins which we do not make accessible enough.\r\n\r\nResponse from Clare Duggan, 23/02/2011\r\n\"There is a project underway which will enable the use of a house style tool on both PSL and LexisLibrary Jon Hanratty\'s team has been heading this up so I\'ll get some timeframes and give you an update shortly.\"','',NULL,'',NULL,NULL,'','',0,1881,'2011-02-10 10:44:24',1921,'2011-05-24 09:31:42',7,61,NULL,NULL,NULL,'N'),(2521,'CUSTOMER','Informal conversation','Katie Bradford',7505,7505,'OPPE5001','Katie Bradford','Partner',NULL,NULL,NULL,NULL,'I met with Katie Bradford at Linklaters (she is a partner in their property law practice), and we ended up having a little chat about e-books - just thought I\'d pass on some of the things she said:\r\n\r\nShe thought the iPad was too big to really be practical, and expected that a smaller device would be more suitable (like the blackberry playbook for example). She also thought that the uncertainty in the market around the different file formats, and different devices meant that firms are unlikely to adopt e-books until all the technical stuff has sorted itself out - something we can\'t do anything about unfortunately!\r\n\r\nShe also mentioned that she still keeps her statute book from university by her desk, as it has all of her annotations in it.\r\nShe\'ll refer to the statute book (which was from the 70s), then check to see if anything has been amended.\r\n\r\nI talked about e-books and annotations, and she thought that it sounded good in principle, but would like to be able to transfer her annotations from one edition to the next - so her detailed notes remained the same, whilst the text was updated.\r\nA nice idea in principle.\r\n',0,24,49,NULL,'Response from Victoria Taylor, 14/02/2011\r\n\"Thanks for sharing these comments. These issues have cropped up a number of times before and have all been logged. Linklaters are due to commence an eBooks trial at the end of this month so we should receive further comments when they actually begin to use the product. Thanks again.\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1861,'2011-02-11 10:27:35',111,'2011-02-14 16:20:46',7,1561,NULL,NULL,NULL,'N'),(2531,'CUSTOMER','Informal conversation','',2681,2681,'','','',NULL,NULL,NULL,NULL,'I have picked up from a variety of sources that there is a real feeling in CC that fee earners rely too heavily on PLC over and above their own more valuable internal knowhow. The feeling is that this makes them vulnerable to PLC price increases and more importantly compromises the competitor advantage CC have as \'the best\'. they envisage the future being to combine all forms of knowhow but steer people to that which is collected internally where possible. ',0,4,0,NULL,'Response from Clare Duggan, 22/02/2011\r\n\"Interesting insight.\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2011-02-11 11:40:48',111,'2011-02-24 12:48:41',7,59,NULL,NULL,NULL,'N'),(2541,'COMPETITOR','Renewal or new business conversation','Michelle Bradford',585,NULL,NULL,'','',6,132,NULL,NULL,'On Oyez you can set up a \'pinboard\' then right click pick from pinboard and all your saved terms are there for you, such as your indemnity covenants in a TR1, is there something similar in smart forms as that is the best feature about Oyez?\r\n \r\nThanks\r\n \r\nMichelle\r\n',NULL,4,49,3,'update from Tim Wakefield:\r\n\r\nSuzanne \r\n\r\nI agree that this looks like a clause bank rather than a repository for favourite forms. At present there is no plan to develop this functionality on the portal and I am not sure that this is something that we would necessarily prioritise for the moment. I will log the feedback and monitor over next few months to see if we get further similar requests. For the moment this customer will have to use a work around which could be to save a completed TR1 as TR1_Indemnity_Covenant_1 and then cut and paste from that form into new forms as required. \r\n \r\nThanks,\r\n\r\nTim \r\n\r\n','',NULL,'',NULL,NULL,'SmartForms','Oyez',71,1441,'2011-02-15 09:54:36',1921,'2011-09-09 09:25:57',72,201,0,NULL,NULL,'N'),(2551,'COMPETITOR','Customer training session','Lexis PSL',12626,NULL,NULL,NULL,NULL,NULL,NULL,NULL,47,'I was running pre sales demo\'s at Weightmans in Liverpool yesterday to teams including Corporate where PLC feedback of great interest came up.\r\n\r\nLynne Rathbone currently uses PLC and said recently she has found it frustrating with any searching that she does. She really doesn\'t like the volume of material that now comes up of relevant and irrelevant documents (where it never used to). There also doesn\'t seem to be an easy way of filtering out the results to pick out the useful stuff.\r\n\r\nIt\'s almost like PLC are adding extra content to be like our Lexis Library for depth, but without giving any thought for the structure/control of the information.\r\n\r\nBoth corporate solicitors really liked the look of PSL Corporate and Company Commercial as they currently appear topic wise and how clearly set out the supporting documents are once you select a topic. \r\n',NULL,4,19,NULL,'Check if there really have been any changes to PLC in terms of the way you search and what content appears.\r\nListen out for other clients feeding similar information and maybe bring this observation into PLC ousting conversations if it is appropriate\r\nEnsure we keep our content in PSL nicely set out and structured, and focused with any results from searching. She liked our tabs that appear o searching in PSL (eg Cases/Practice Notes etc)\r\n\r\nNo call to action, according to Jane Mayfield. YM 09/03/2011',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,66,'2011-02-15 10:42:37',111,'2011-03-09 11:43:51',7,211,NULL,NULL,NULL,'N'),(2561,'PRODUCT','Customer training session','Emma Haley',1610,NULL,NULL,'','',0,1,NULL,NULL,'Emma Haley, PSL for the Private Client and Tax departments at Boodle Hatfield, pointed out a strange anomaly within the Butterworths Wills and Probate Administration Service Precedents. If you browse to Division AP, then open 1. Wills, there is a heading called \"Free of Tax or Subject to Tax : A General Note\". If you open up this heading, it contains a great number of excellent Gift clauses for using in Wills, but the heading is completely misleading. The heading should be something like \"Gifts in Wills\", far more appropriate. Users do not bother to open this area because it doesn\'t look useful at the moment.',NULL,NULL,47,3,'The heading currently there should be changed so that it gives a proper indication of the contents within it, such as Gifts in Wills. The General Note could then be the first paragraph within that section.\r\n\r\nPM  - Re-delegated from Jon Scriven to Lisa Regan 24.05.11\r\nLR 26/05/2011 - I\'ve forwarded the query to Tracey McGovern who is best palced to deal with this query \r\n\r\nPM: Update received from Tracey McGovern 02.06.11 which included response from author:\r\nAuthor Leslie Lintott states \"On this point, Tracey, it looks as if somewhere along the line a heading which is mean to apply to one paragraph only (AP 5.33) has been formatted to look as if it\'s a main heading to the next series of sub-headings.  In the index to the hard copy it is easy to see that the next paragraphs are all about gifts, etc and I don\'t think the fact that AP5.33 has its own heading matters at all.  It is the way it opens in the browser which causes the problem.   \r\n\r\nTracey then said \"The author seems to think that it\'s more to do with the styling of the heading than the name of the heading. I will therefore take this on board when I\'m amending the whole division as regards headings and layout in the next week or so and hopefully this problem will be rectified for the July release\"\r\n','',NULL,'',NULL,NULL,'','',0,1881,'2011-02-15 15:49:26',1921,'2011-06-06 08:42:01',7,61,NULL,NULL,NULL,'N'),(2571,'COMPETITOR','Renewal or new business conversation','Head Librarian',NULL,13375,'with5007','','',6,0,NULL,47,'Had a long conversation about LPSL v PLC. Withers are unusual for a top 50 firm. a relatively small Corporate team with large private client and family teams. the corporate team is 15 lawyers with one Knowledge Partner. for internal (and highly controversial) reasons the corporate team dont have one of the firms PSLs assigned to them. accordingly, the partner has reached out to PLC for bespoke support (in the absence of a PSL) and they are in dialogue. no-one in that team is a fan of PLC but there are no alternatives. my contact believes there would be a real appetite for a dialogue to support them. as this is such a small Coporate team (relatively) this would seem a firm ripe for attacking. the Family team have seen LPSL and whilst \'underwhelmed\' would clearly welcome some support too in the absence of PLC. they should be a real LPSL target!',47,4,19,9,'we should aim to meet with the corporate partner to discuss how we can work with them. call me to discuss. Gavin\r\n\r\nAnne-Marie Claydon spoke directly to Gavin Shaw about strategy for this client in the w/c 28/02/11. \r\n\r\n','',NULL,'',NULL,NULL,'','',452,1,'2011-02-18 18:20:01',1921,'2011-09-12 10:40:38',72,211,0,NULL,NULL,'N'),(2581,'PRODUCT','Customer training session','Mark Gardner',7184,NULL,NULL,NULL,NULL,NULL,4,4954,NULL,'Mark (Partner) felt that the LexisSmart Precedent for Part 36 offer - letter to claimant was a dangerous one to currently use becasue of the warning note on the frist page:\r\n\r\nPart 36 offer from claimantThis precedent is intended for use by a claimant\'s solicitor to a defendant (or their solicitor) either prior to or during proceedings. It is important that a Part 36 offer complies with CPR 36 otherwise it may not have the beneficial cost consequences of CPR 36. \r\n\r\nFor guidance on claimant\'s Part 36 offers see Practice Note: Claimant making a Part 36 offer.\r\n\r\nWARNING: DUE TO RECENT HIGH COURT AND COURT OF APPEAL DECISIONS, THIS PRECEDENT REQUIRES UPDATING AND WILL BE UPDATED IN JANUARY 2011. CARE SHOULD BE TAKEN IN USING THIS PRECEDENT IN THE MEANTIME. PLEASE READ THIS PRECEDENT IN CONJUNCTION WITH THE PRACTICE NOTES: Claimant making a Part 36 offer and Making a valid Part 36 Offer - Claimant or Defendant.\r\n\r\nI showed this precedent to Mark & his secretary on Thursday 17th February, and the note is still saying that the precedent requires updating and will be updated in January 2011.  Mark felt this could create far more work for Feee Earners when checking the precedent and almost negates it being in the \'smart\' format.  Mark\'s secreatry is often involved in draftign documents and he posed the question of \'what if she had seent this warning, forgotten to tell him about about it?\'  He felt we should be in a position to update the documents faster than we appear to be.',NULL,NULL,0,3,'Response from Janna Purdie, 22/02/2011\r\n\"Discuss the position with Smart Forms with Mark Edwards.  Given that the Smart Form precedent is drafted so that the offer is not time limited my view is that the case would have no impact on the form unless the user sought to amend the precedent produced. However, I do not know to what extent Rebecca amended it.  I am happy to have a look at it over the week in an external author capacity if that helps (I don\'t have time during the working week).  My view is that the warning should be removed from the form and replaced by a note setting out that if a user seeks to edit the precedent produced they should bear in mind the impact of the C v D case.  URGENT\"\r\n\r\nFurther response from Victoria Tubb, 04/03/2011\r\n\"I have reviewed this feedback from Janna on behalf of Mark Edwards.\r\nShe has instructed that the current warning on the LexisSmart Precedent for Part 36 Offers is not relevant and should be removed.\r\nI have instructed Matt Poulsom to remove the warning.\r\nIn terms of feedback to the customer I suggest that Lynne explains that the LexisSmart precedent has been reviewed in light of the case of C v D and we can confirm that it does not need to change.\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,68,'2011-02-21 12:21:24',111,'2011-03-04 13:42:37',7,341,NULL,NULL,NULL,'N'),(2591,'COMPETITOR','Renewal or new business conversation','',NULL,NULL,NULL,'','',0,0,NULL,55,'CCH are moving away from the traditional pick and mix menu to packages, which was what they had over LN.',NULL,0,0,0,'we should be going after CCH tax cusotmers and offering them a more flexible way of getting their infomation\r\n\r\nDC: Hi Christine, having looped around with the Tax team, they totally agree and this issue is well recognised. They have plans in place to rectify this and its on the RoadMap. Keep raising this in your team meetings for updates and thanks for your input..!','',NULL,'findlaysons ca ',NULL,NULL,'','',0,941,'2011-02-21 13:40:33',52,'2011-06-22 08:15:35',7,52,NULL,NULL,NULL,'N'),(2601,'PRODUCT','Customer training session','Berin Jones',12932,NULL,NULL,NULL,NULL,NULL,4,4947,NULL,'A customer has asked if we are adding Property Litigation, and if so will this sit in DR or Property? This customer also does Housing work, as far as I can see this info sits in the Local Govt module?\r\n\r\nAlso, they mentioned some Property work touches Charities information so does this info get covered by Property or are there plans to add a Charities subject to the Property module?\r\n',NULL,NULL,49,9,'Response from Elinor Clark (in Malcolm\'s absence), 22/02/2011\r\n\"Malcolm has dealt with this query\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,68,'2011-02-21 16:20:00',111,'2011-02-22 16:32:02',7,201,NULL,NULL,NULL,'N'),(2611,'PRODUCT','Customer training session','Mark Gardner',7184,NULL,NULL,NULL,NULL,NULL,4,4948,NULL,'Mark felt that the fact that the LexisPSL Part 36 offer from Claimant precedent (he referred to the smart precedent) had the warning on the first page:\r\n\r\nWARNING: DUE TO RECENT HIGH COURT AND COURT OF APPEAL DECISIONS, THIS PRECEDENT REQUIRES UPDATING AND WILL BE UPDATED IN JANUARY 2011. CARE SHOULD BE TAKEN IN USING THIS PRECEDENT IN THE MEANTIME. PLEASE READ THIS PRECEDENT IN CONJUNCTION WITH THE PRACTICE NOTES: Claimant making a Part 36 offer and Making a valid Part 36 Offer - Claimant or Defendant.\r\n\r\nMark felt that this document should have now been updated (as it does say it is being re-written in Jan 2011), I showed this to Mark on Thursday 17th February.  He thought it showed us up as not being up to date or as up to date as we should be in our socument drafting, also his secreatry does get involved in drafting these documnets but after having seen this warning he is not keen on that happening in case she \'misses\' something?  He then also asked if the \'flat\' precedent - so the Part 36 offer from Claimant - contained in LexisPSL (not the smart version) was also awaiting a re-write?  Or is this one the updated one & it is just the smart one that isn\'t??',NULL,NULL,0,3,'Response from Janna Purdie, 21/02/2011\r\n\"I need to discuss the updating of Smart Forms with Jon Scriven (the DR practice area director) as this is not within my remit but I would like to provide you with a complete response in relation to the issues raised for both Smart forms and PSL.  I will respond in detail tomorrow morning.\"\r\n\r\nResponse from Janna Purdie, 22/02/2011\r\n\"Discuss the position with Smart Forms with Mark Edwards.  Given that the Smart Form precedent is drafted so that the offer is not time limited my view is that the case would have no impact on the form unless the user sought to amend the precedent produced. However, I do not know to what extent Rebecca amended it.  I am happy to have a look at it over the week in an external author capacity if that helps (I don\'t have time during the working week).  My view is that the warning should be removed from the form and replaced by a note setting out that if a user seeks to edit the precedent produced they should bear in mind the impact of the C v D case.  URGENT\"\r\n\r\nFurther response from Victoria Tubb, 04/03/2011\r\n\"I have reviewed this feedback from Janna on behalf of Mark Edwards.\r\nShe has instructed that the current warning on the LexisSmart Precedent for Part 36 Offers is not relevant and should be removed.\r\nI have instructed Matt Poulsom to remove the warning.\r\nIn terms of feedback to the customer I suggest that Lynne explains that the LexisSmart precedent has been reviewed in light of the case of C v D and we can confirm that it does not need to change.\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,68,'2011-02-21 16:27:48',111,'2011-03-04 13:46:15',7,341,NULL,NULL,NULL,'N'),(2621,'PRODUCT','Renewal or new business conversation','Nick Trevelyan - Senior Legal Counsel',NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'Point from Nick,\r\n\r\n(a)                 lack of content - we are aware that you are continuing to develop your site but it was found wanting in some of the areas we needed over the past few weeks; Unfortunately theres nothing specific that I can really feedback to you but similar comments were received from other people in the department.\r\n\r\n(b)                 the occasional need to conduct multiple searches in different areas of the site on the same subject matter.\r\n\r\nHowever we do think there is potential for the service going forward because the presentation and layout are superior to our current service.',NULL,NULL,12,6,'Response from Clare Duggan, 09/03/2011\r\n\"Is their current service PLC or some other product? Are they subscribers or trialists of PSL?\r\na) If they do provide any specific examples of content they deem missing, it\'d be interesting for the lawyers/authors hear what they are. It may be that those areas are already available (but labelled differently), in the pipeline already or possibly something we could look to add.\r\nb) We are discussing this with users in our usability study at the moment so it may be something which we develop later if there is an overwhelming customer need. Did Nick mention what practice areas he might want to search across or had he struck problems before when he didn\'t know which module to search? Please let me know if you do have any further information on this or if this chap might be a suitable candidate for the study.\"','',NULL,'ENI UK',NULL,NULL,'LexisPSL - Employment, Property, DR, In-House, Corporate and Commercial',NULL,NULL,601,'2011-02-28 13:40:29',111,'2011-03-09 13:38:11',4,59,NULL,NULL,NULL,'N'),(2631,'PRODUCT','Informal conversation','LexisNexis Library',50666,NULL,NULL,NULL,NULL,NULL,1,3497,NULL,'The customer uses Google Chrome to access the service but finds that the results group column on the left hand side can\'t be moved left or right like it can via internet explorer. ',NULL,NULL,59,9,'Response from Lisa Regan, 03/03/2011\r\n\"Thank you for your feedback.\r\nWe were unaware of this issue previously.\r\nThere is a 2011 project underway to redesign the results lists so this may correct the issue.\r\nWe will possibly be getting rid of the left hand results groupings e.g. by topic and presenting the info in a different way e.g. tabs.\r\nThe majority of our customers do use Internet Explorer without issue, this is useful feedback nonetheless though.\r\nI will ensure the Prod Dev team knows about this issue so when testing we can also include testing using Google Chrome/Firefox as more browsers appear on the market.\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,32,'2011-03-03 11:19:31',111,'2011-03-03 16:32:26',7,61,NULL,NULL,NULL,'N'),(2641,'CUSTOMER','Renewal or new business conversation','Stephen Muir',NULL,NULL,'147BDR','Stephen Muir','Head of Legal',1,0,NULL,47,'They are a small legal team of 3 who have used PLC for numerous years.  On discussing PSL, they came back with the following informal feedback on what they really love on PLC:\r\n\r\n- very simple interface and easy to find an answer to any legal questions\r\n- particularly liked the \'ask the team\' section where you can pick up the phone if you can\'t find anything and the query is turned around immediately\r\n- \"I can run my business on PLC and it saves me 50k per annum on legal fees alone\"\r\n- Country questions are perfectly laid out and help undderstand specific points of law in a country along with the Find a Lawyer service\r\n- Stephen suggested to even get anywhere near PLC we need our PSLs to be shadowing in-house counsel to see the queries they handle on a daily basis and then replicate these in PSL',47,4,59,6,'For in-house team.\r\n\r\nWe need to ensure that our development is done by shadowing in-house lawyers (possibly by industry sector) and really understanding what their daily queries are in order to focus our coverage on these areas.  This will offer real practical guidance.\r\nFurthermore, some form of \'Ask the team\' service via telephone needs to be explored with a view to having PSLs dedicate time on the phone for our clients rather than the current hap hazhard approach','',NULL,'Barrie and Hibbert','Barrie and Hibbert',NULL,'','',61,1071,'2011-03-04 12:27:31',1921,'2011-09-20 12:41:42',72,591,0,NULL,NULL,'N'),(2651,'CUSTOMER','Customer training session','Michelmores',8401,8401,'','Helen Watson','Librarian',0,0,NULL,NULL,'Lexis Check - Head of Risk Mgt LOVED it. He wants all correspondence to be checked using Lexis Check and for it to be added to the Michelmores work flow process.',0,11,0,0,'Response from Matt Grant, 09/03/2011\r\n\"Marketing are aware, and we\'re chasing a quotable from the partner involved.\"','',NULL,'',NULL,NULL,'','',0,67,'2011-03-08 12:53:17',1921,'2011-05-06 08:38:15',7,321,NULL,NULL,NULL,'N'),(2661,'PRODUCT','Customer training session','Lesley Stuart',3076,NULL,NULL,'',NULL,0,4,4947,NULL,'So the Property Partner - Lesley Stuart - likes the concept of LPSL (has been used to LexisLibrary) but specifically Property she raised:\r\n\r\nLack of content in LexisPSL on Development (i.e. selling off plots of land), specifically Lesley was surprised there wasn\'t a separate topic heading for this area?\r\nQueried the order of PNs - so they aren\'t alphabetical but in her mind they aren\'t in the most logical order?\r\nQueried the amount of Charity content in LPSL Property\r\nQueried the \'can\'t find what you\'re looking for\' link as she doesn\'t like (or trust!) the idea of it doing the search for her, so her question was \'how does it know what I\'m looking for\'\r\n\r\nI obviously said she didn\'t have to use LPSL and could continue using LL (showed her suggested searches etc).\r\n',NULL,NULL,49,9,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,68,'2011-03-09 09:02:16',201,'2011-10-14 16:42:49',112,201,0,NULL,NULL,'N'),(2671,'CUSTOMER','Informal conversation','Clare Brown',2822,2822,'COLL5160','Clare Brown','Information Manager',0,0,NULL,NULL,'Does a PSL or lawyer look at what sources are listed in the bookshelf for each practice area page.  For example, in the Litigation Practice area the following key sources are missing:\r\n\r\nCook on costs\r\nThe Law of Contempt\r\nButterworths Costs Service\r\nThe Common Law Series\r\nStone\'s Justices\' Manual 2010\r\n\r\nLots of irrelevant sources are listed which clutter the page, such as:\r\n\r\nBill Tracker\r\nEvents\r\nGeneral Case Digest\r\nJudgements\r\n\r\nThe bookshelf needs to be far more concise',0,1,4,0,'All PAP bookshelves need to be de-cluttered\r\n\r\nLISA REGAN, 24/5/2011: Michael Urie in the Content Support team is looking into the issue of updating PAP bookshelves. I will forward this issue to him.','',NULL,'',NULL,NULL,'','',0,7,'2011-03-09 10:21:16',1921,'2011-05-24 09:32:27',7,61,NULL,NULL,NULL,'N'),(2681,'PRODUCT','Customer training session','Ian Huxham',10062,NULL,NULL,'','',0,4,4949,NULL,'All users at Recompense liked LPSL PI Quantum search but said it was not clear from the results list if the value was the original award value or the inflated value (i.e. today\'s value)\r\nThey said we should be clearer on what the value is?',NULL,NULL,44,1,'Karen O\'Sullivan emailed 14 March 2011 stating:\r\nThe figure provided in the \'value\' section of the cases summary is the general damages value at todays date. If customers want to know the figure for general damages that were actually awarded to the claimant they should click into the case and that information is at the top of the case summary. I think the \'value\' section of the case summary could make it clearer that the figure stated is at today\'s value. I will ask for this amendment to the database results to be made to the product asap','',NULL,'',NULL,NULL,'','',0,68,'2011-03-09 11:02:54',1921,'2011-05-05 15:18:22',7,371,NULL,NULL,NULL,'N'),(2691,'PRODUCT','Customer training session','Liz Larner',10062,NULL,NULL,'','',0,4,4949,NULL,'Liz felt that our coverage in Clinical Negligence was patchy and not comprehensive enough, with really new/recent cases on quantum\r\nShe also said we could do with having more cases on infections/hospital infections such as MRSA and C Diff\r\nOur quantum case database should have cases settled out of court',NULL,NULL,44,1,'Karen O\'Sullivan emailed on 14 march 2011 stating:\r\n we are aware our clinical negligence content is limited and needs to be expanded. An external author is working on new practice notes and these should appear in the product soon\r\n we are launching a big marketing campaign in the next 2 months to significantly expand the number of cases in our quantum database. This should increase the number of clinical negligence quantum cases in the database and hopefully resolve the customer\'s concern. I have noted their request for hospital infection cases (eg MRSA and C Diff)\r\n see 2701 for my comments on out of court quantum settlements\r\n','',NULL,'',NULL,NULL,'','',0,68,'2011-03-09 11:10:36',1921,'2011-05-05 15:14:03',7,371,NULL,NULL,NULL,'N'),(2701,'PRODUCT','Customer training session','Carolyn Hales',10062,NULL,NULL,'','',0,4,4949,NULL,'Recompense do a lot of noise induced hearing loss work and were critical of our lack of coverage in quantum on cases in this area (deafness).  Generally, Carolyn said many of these will settle ouut of court and this could explain why we have so few.  So the addition of out of court settlements would be a welcome change, especially fir noise induced hearing loss cases\r\n',NULL,NULL,44,1,'Karen O\'Sullivan emailed a response on 14 March 2011 stating:\r\n\'We have had a number of requests from customers for out of court settlements to be included in the quantum database. We will consider expanding the database to include them if it seems appropriate to do so (I have concerns about how useful out of court settlements are to fee earners generally although I can see in an area where nearly all the cases settle without trial [such as deafness] then there may be a need for their inclusion in the database)\'','',NULL,'',NULL,NULL,'','',0,68,'2011-03-09 11:14:17',1921,'2011-05-09 10:39:20',7,371,NULL,NULL,NULL,'N'),(2711,'PRODUCT','Customer training session','Ian Huxham',10062,NULL,NULL,'','',0,4,4955,NULL,'Ian queried the lack of quantum on deafness - or noise induced hearing loss.\r\nAttached is a screen dump, in quantum if you sleect deafness as major injury & JSB Severity & Value select slight, there are only 2 cases.\r\nIn the second case - White v Goodyear Great Britain Limited, the case mentions that:\r\nMajor Injury Partial hearing loss \r\nAdditional Injury None \r\nDuration and Prognosis Plaintiff suffered a partial hearing loss. \r\nFacts The plaintiff, aged 43 years at date of issue (August 1998), suffered an average binaural hearing loss of 23.3 dB with no tinnitus.\r\n \r\nAge at Injury 43 Year(s) 0 Month(s) \r\nAge at Settlement 44 Year(s) 0 Month(s) \r\nGender Male \r\nTotal Damages 5,500.00 \r\nType of Claim Employer liability \r\nContributor Lisa Watson \r\nContributor\'s Firm Chapman Everatt \r\n\r\nIan felt that a quantum like this didn\'t really give them what they needed, the ideal would be a quantum with the average binaural hearing loss figure split out so you can see which element of the hearing loss is work induded, which is age related etc?  At present if they were to use this case they would still need to reference many different tables to work out the % hearing loss of that figure attributed to age, work etc?\r\n\r\nHe suggested that when we are desiging a form for submission of cases that we take this into account and insist that any quantum we receive on hearing loss/deafness have to split out the hearing loss figure?',NULL,NULL,44,1,'Karen O\'Sullivan responded by email 14 March 2011 stating - \'We are currently testing our new quantum database submission form - and hope we can go live in the next 6 weeks. Once the submission system is live then there will be a marketing campaign to generate a high volume of case submission - which should subtantailly increase the size of our database. The feedback on the information needed for deafness cases is really useful. PSL lawyers will check all the quantum cases before they are put into the database. If the case is a deafness one then we will go back to the submitter for the average binaural hearing loss figure if they have not included it in their submission. This should address the customer\'s concerns\'','1299671829.DOC','White_v_Goodyear_Great_Britain_Limited.DOC','',NULL,NULL,'','',0,68,'2011-03-09 11:59:16',1921,'2011-05-09 09:01:30',7,371,NULL,NULL,NULL,'N'),(2721,'COMPETITOR','Renewal or new business conversation','Mark Smith - Solicitor',3170,NULL,NULL,NULL,NULL,NULL,NULL,NULL,47,'Practical Law is offering \'FirmPlus\' to DGB. This is access to all of their practice areas for a fixed annual sum. For this 7 f/e firm the price point is around 12K (based on Mark\'s comment that the PLC service is \'less than half\' of our 27K on-line library.\r\n\r\nPLC is developing a Family module but this is 18 months to 2 years away.',NULL,4,0,NULL,'The renewal is due in October and a decision on what service to continue with will be made in June. We have opened dialogue and re-introduced LexisPSL.\r\nGavin Parsons is the AM\r\n\r\nRelevant people informed via Dave Coleman. YM 10/03/2011',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1961,'2011-03-09 15:38:58',111,'2011-03-10 13:09:00',7,52,NULL,NULL,NULL,'N'),(2731,'PRODUCT','Customer training session','Chris Green',204,NULL,NULL,NULL,NULL,NULL,1,3499,NULL,'The Stop Press icon does not appear when you print legislation in Word.  The client thinks it would be much better if the Stop Press document was included with the document, when relevant, otherwise you run the risk of missing this vital information.  Currently, you have to print the Stop Press document separately.  ',NULL,NULL,59,2,'The Stop Press should be printed automatically with the legislation document.\r\n\r\nLisa Regan 22.03.11 (input by Phil Mone):\r\nI can see in some circumstances that a user would want to print the legislation without the stop press information so full customer validation would be needed if we were to automatically print the Stop Press on the legislation document. \r\nWe have product Advisory Boards coming up in April where customers come along to a forum and discuss developments/issues/feedback so we can as them then what they think.','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,71,'2011-03-18 12:27:28',1921,'2011-03-29 16:20:04',7,61,NULL,NULL,NULL,'N'),(2741,'CUSTOMER','Renewal or new business conversation','Nick Tilley',NULL,NULL,'HELP5010','Nick Tilley','Company Secretary',NULL,NULL,NULL,NULL,'The general view is that PSL is a more superficial product than PLC and whilst I was agnostic I am leaning towards that view.\r\n\r\n I speculate that you have an identity crisis compared with PLC. PLC is set up to deliver one product. PSL is competing with, and is drawn from, other titles in your range and I get an impression that you don\'t want to put so much into PSL that it stops the sales of the other titles and products. I am sure PLC does not have all the detail you have in the \'library\' but its distillation for an in house lawyer seems to be better. \r\n\r\nPSL is woefully short on the plc side - minutes, board processes and corporate governance.\r\n\r\nLexis\'s Practice Notes to be very superficial.  As a specific example on looking at Lexis\'s practice note on corporate insolvency for some information about Creditors\' Voluntary Liquidations the only information is a short paragraph describing the application procedures at Companies House (which are also available on the free Companies House website with greater detail).  There is then a link as below.  However, the link led to the message \"no documents found\".  \r\n\r\n  Butterworths Corporate Law Service > Insolvency > Part E Winding Up > Chapter 8 Voluntary Winding Up > 4 Creditors\' Voluntary Winding Up\r\n\r\n Lexis doesn\'t seem like a suitable resource for providing useful drafting cues and practice notes for drafting commercial contracts.  It\'s difficult to pin down the precise problem but the type of information needed just isn\'t there, or if it is, it isn\'t easy to find.  Two of my team discovered recently that despite quite a determined search, even a fundamental legal principle such as the doctrine of mistake wasn\'t provided for (I am sure there is loads about it in one of your main titles).  \r\n\r\n When searching for something on PLC there was always a sense that by entering a few simple key words into a search box it understood what you wanted to know and could suggest an abundant variety of possible information and guidance which was nearly always useful and relevant on some level.  Lexis often comes up with nothing or comes up with results which are completely off message.  \r\n\r\n The weekly PSL updates feel like a weak digest of the PLC equivalents which come in a variety of details and with a greater selection (both as to frequency and variety).\r\n',47,4,59,NULL,'In the process of arranging a meeting/telecon with one of our PSLs to discuss the issues raised\r\n\r\nUpdate Clare Duggan 15.04.11\r\nClare has stated \"Thanks for the feedback from Helphire. I am hoping that the majority of the items were addressed by the PSL lawyers on your customer visit but I have made a couple of comments below with regards to the functionality and linkin\"\r\n1) In relation to the Voluntary Insolvency isse  \"I\'ve asked the paralegal in the CoCo team to take a look at this link to see if the issue still remains and will let you know if not.\"\r\n2) In regards to searching issues \"Hopefully the wordwheels we released on LexisPSL this week will help on the search front and lessen the chance of getting zero results or irrelevant results. We will be extending the scope of these content-wise over the coming months.\r\n3) In regards to the PSL Updates, Clare states \"Did they go into any detail about the frequency they are after and what do they mean by variety? Any further information you can glean on these would be gratefully received. It would be good to understand whether it\'s the format or the content (or both) that needs addressing.\"\r\n','',NULL,'Helphire','Helphire',NULL,NULL,NULL,NULL,1241,'2011-03-22 08:28:51',1921,'2011-04-20 08:28:50',4,59,NULL,NULL,NULL,'N'),(2751,'CUSTOMER','Customer training session','Various (see below)',NULL,NULL,'BMWG0005','Mary Ferriss','Solicitor',NULL,NULL,NULL,NULL,'Meeting was with 2 solicitors (Mary Ferriss & Shashi Maharaj) and 1 support staff from the BMW FS team and was attended by Caron Bent (Training Consultant), Vicky Taylor (Publisher) and me \r\nMeeting was scheduled for 1.5 hours but actually lasted 2.5 hours+ \r\nShashi gave us some examples of PLC overviews (Insolvency, Capacity, Misrepresentation, Execution Clauses, Competition Law - consignment, Representation - summary of steps etc) - They are struggling to replicate the information they would review in these in their search results in LexisLibrary - In PLC you punch in one search term and you get one document that gives you \'all\' the key information you need on a particular subject area - They really miss these \'overviews\'! \r\nLexisPSL is of very limited use (they have access to In-House, Corporate, DR & PI) for this team - THEY NEED AN FS MODULE OF PSL \r\nTime is always an issue and at the moment it is much slower using Library than it was using PLC \r\nCaron ran through some example searches and outlined the use of connectors etc - The results we generally got to were good and relevant but the process of filtering and the search methodology of Library is very \'clunky\' and \'confusing\' compared to what they are used to in PLC \r\nWith little relevant material in PSL at present the FS team will only use Library and this lacks any practical guidance which is a big issue compared to PLC \r\nSome simple step-by-step \'how to\' guides and a search tips manual would be very helpful (Caron is emailing search tips) \r\nMary listed a number of print titles they use and asked about our equivalents - (please see attached notes which Vick Taylor took away from the meeting) \r\nAs Mary & Shashi (and Andrew Broadbent who was away due to illness) are not particularly \'computer-literate\' we suggested setting up a train the trainer session for Lily Parker to support their research on-site \r\nSpecific documents and searches that produced good results in the session (in some cases eventually!): Share Purchase Agreement, Capacity, Consumer Credit Act, Agency Agreement, Administration of Estates \r\nList of topics Mary would like to see in PSL (FS module or in In-House): \r\nGeneral Consumer Law, Loan agreements, Finance leasing, Advertising, Insurance, FOS rules, Cross-Border, Practical Lending & Security \r\nAreas which they already have access to but were not fully aware: \r\nEF&P, Litigation (PSL DR), Insolvency (PSL In-House0, Co-Sec issues (PSL Corporate), Data Protection (PSL In-House) \r\nThey loved Status Snapshot - We need to highlight these highly valued functions (Status Snapshot, Is it in Force, Case Tracker etc.) more as they really set us apart from PLC \r\nWE NEED A WELL CONSTRUCTED WELCOME PACK EXPLAINING ALL THE CONTENT THEY CAN ACCESS, KEY USPs AND EXPLAINING HOW WE ENVISAGE THEIR WORKFLOWS USING PSL AND LIBRARY \r\nMary reiterated throughout that they will all vote at the end of the year whether they wish to stay with us or move back to PLC so it is vital we continue to improve and closely support their service experience \r\nLexisSMART resonated with Mary with regard to their Purchase Agreement (currently filled in by the purchase department often with a lot of errors!) \r\nThey would like to be able to apply their House style to our precedents which is very easy on PLC (I understand this is in the pipeline and our offering will be much better than PLC\'s!!) \r\n',47,1,59,NULL,'Clare Duggan has updated (15.04.11) to specific points below:\r\nTHEY NEED AN FS MODULE OF PSL : \r\nClare States \"I believe this is in the pipeline for the next 12 months. Rachael West will be able to confirm.\"\r\n\r\nTime is always an issue and at the moment it is much slower using Library than it was using PLC \r\nClare states \"I have the US performance team running some tests on the product over the coming weeks as we have also noticed a degradation in the speed in recent weeks. I will let you know the outcome of that and hopefully we can make some improvements.\"\r\n\r\nCaron ran through some example searches and outlined the use of connectors etc - The results we generally got to were good and relevant but the process of filtering and the search methodology of Library is very \'clunky\' and \'confusing\' compared to what they are used to in PLC\r\nClare states\" Were they using the wordwheels or were their issues more around the results retrieved? We are currently doing a big project around improving our results pages and would be very interested to speak to them and discuss our prototypes if they would like to be involved and help shape the new-look results pages.\"\r\n\r\nWith little relevant material in PSL at present the FS team will only use Library and this lacks any practical guidance which is a big issue compared to PLC \r\nSome simple step-by-step \'how to\' guides and a search tips manual would be very helpful (Caron is emailing search tips) \r\nClare states \"The LN Academy training modules have been added to LexisLibrary and will be added to PSL soon too which should help. Hopefully word-wheels will reduce their need to use connectors as well.\"','',NULL,'BMW','BMW',NULL,NULL,NULL,NULL,1241,'2011-03-22 09:18:44',1921,'2011-04-20 09:26:48',4,59,NULL,NULL,NULL,'N'),(2761,'PRODUCT','Informal conversation','Ramby de Mello ',50371,NULL,NULL,'','',0,0,3137,NULL,'Account Manager Paul Taylor has captured feedback in regards to Butterworth\'s Immigration Law Service:\r\nThe Customer, Ramby de Mello, believes the usefulness of the service has diminished over time because:\r\n\r\n1) Updates are too slow to be released\r\n\r\n2) Main benefit was the content of the policies: these are now available free online and are updated faster than us\r\n',NULL,NULL,31,9,'1. The service has five updates per annum which is more than any direct competitor in this area. They publish in the same months each year - March, June, August, October, December but will be adjusted as necessary to ensure that significant changes in the law are covered as soon as possible.\r\n\r\n2. The service offers in-depth and comprehensive analysis and guidance on all immigration matters - something which is not freely available online. ','',NULL,NULL,NULL,NULL,'','',0,1921,'2011-03-22 14:47:04',801,'2011-11-14 15:18:50',82,171,0,'TBC','','N'),(2771,'PRODUCT','Renewal or new business conversation','Sarah Nicholls ( Judith PSL)',1435,NULL,NULL,'','',0,4,4969,NULL,'\"I remain concerned that there is no \'normal\' Husband and Wife pair of Wills.  The reciprocal Will between H and W they give is so basic that it would not even satisfy the average High Street Solicitor.  Crucially, it assumes that the survivor of the couple will be the sole executor, which is pretty unusual at BDB and won\'t be the norm even with a High Street solicitor.  It also doesn\'t even offer such basic things as legacies to god children / grandchildren etc, which again, if you are bothering to consult a solicitor you are more likely to want than not.  What one needs to be able to do is at least pull these clauses into the standard Will from the mega Will - one does not want to have to use the mega Will for such ordinary cases.  Perhaps there is a way to pull in extra clauses which I have not yet found?\r\n \r\nIn 7.1.1 of the attached (which, on my screen at least, has the problems of funny fonts) the reference to s31 of the Trustee Act is an active hyperlink.  Obviously we cannot have Wills that do this.  Do they know about this as a general feature, or is it part of the problems we have been having?\" -\r\n\r\n\r\n\"In brief, the decision is against.  Some of the f/e earners have trialled it, and Carolyn did a demo to a large proportion of the Probate Group at a seminar just before Christmas at which there was great interest, but not interest that will be converted into a decision in its favour.  The bottom line is that, whatever it may promise for the future, the package simply is not ready yet to be used in a commercial context.  \r\n \r\nLNB will want some feedback.  Apart from the lack of complete Wills, which we have mentioned before (the mega Will is not a realistic proposition for repeated use in a \'live\' context - something more streamlined is needed), there are issues such as the lack of standardisation of layout / wording etc, reflecting the fact that the precedents have been culled from a number of sources.  We would have expected this to have been ironed out, so that the resulting Will looks like a coherent whole; and too few of the precedent clauses offered us the Butterworths approach.  Given the relative merits and demerits of the source material, we would have expected to see the Butterworths draft at the core of it.  ... - it has actually been a very useful exercise, and there is no doubt that the future lies in that direction - but the future isn\'t here yet!\"\r\n',NULL,NULL,47,3,'Were some of the technical problems they experienced, teething issues as they trialled at launch.\r\nI am trying to re-visit the team with the new trusts content that has been added and wonder if some of the issues they had could be overcome by training - but do we need to re-visit the simple standard wills that we are making available on the site.\r\n\r\nThis firm uses our precedents mainly from BWPA as their standard and they have a project to review and automate what they can to speed process and were very keen.\r\nThey are also about to buy a new house styler tool so we have a further opportunity to go back in.\r\n\r\nAttached is the screen shot that she refers to in her email.','1300874065.DOC','Test Will from Lexis PSL Wills.DOC','',NULL,NULL,'','',0,8,'2011-03-23 09:56:46',1921,'2011-03-23 17:11:46',2,0,NULL,NULL,NULL,'N'),(2781,'PRODUCT','Customer training session','Martin Hartwell',NULL,NULL,NULL,NULL,NULL,NULL,NULL,6051,NULL,'Whilst i was completing a demo with the customer - the customer expressed how important a piece of functionality the \"My Research\" tab (which is not yet \"live\" on teh new platform) is. He also suggested an improvement to the functionality which was to have the ability to go back and view the pages he had viewed in the order he had viewed them in - \"Tax practitioners often \"jump around\" within sources and being able to go back and understand his train of thought when conducting research would be invaluable\" I have spoken with Dan Arrowsmith about this and Dan is investigating whilst we are testing the functionality whether we could add this as a feature.',NULL,NULL,53,9,'Dan is investigating whether or not we can add this as a feature of \"My Research\".\r\n\r\nLISA (25.03.11): We can validate this with customers and see if the majority of users will find it useful.  We have product advisory boards (forums) in April so we can validate the idea then.  We cannot guarantee that we will definitely develop it, but we will investigate the possibilty. Regards','',NULL,'Mosaic Professional Tax Planning',NULL,'Tolley Library',NULL,NULL,NULL,1291,'2011-03-24 09:53:32',1921,'2011-03-25 17:03:50',7,61,NULL,NULL,NULL,'N'),(2791,'PRODUCT','Customer training session','Kathryn Hirst',5338,NULL,NULL,NULL,NULL,NULL,4,4946,NULL,'Kathryin is the Employment Partner at Hansells.  Currently use PLC Employment & think the precedent content is far superior to LexisPSL (she is giving me specific examples).  I mentioned we are adding more precedents, can anyone tell me when these will be added, provide a list of precedent titles i can share with Kathryn please?\r\nKathryn also prefers the layout of PLC, she doesn\'t like the fact that once a tiopic is selected in LPSL that the content is split acorss tabs (overview, PNs, Butterworths etc) and finds the PLC layout of results much quicker & easier to work with.',NULL,NULL,24,3,'Update Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n\r\nUpdate Philip Thornton 27.04.11 \r\nAs regards the point about splitting content across tabs, we regard this as a useful product feauture which is superior to PLC. It would seem that the customer disagrees. There is no realistic prospect of this element of LexisPSL design changing in the foreseeable future. We have never heard any other customer express this particular view.\r\n\r\nTurning to the comments about precedents: We now have over 320 precedents in LexisPSL Employment. A list is attached.\r\n\r\nThe team have just added a new, totally revamped version of our most frequently-used precedent, the compromise agreement, which was overhauled in response to customer feedback and to reflect the latest legislative changes and current practice. It also now includes detailed drafting notes and links to our practice notes, the relevant legislation and HMRC material. They have also added a suite of 17 precedents (also with drafting notes), containing optional additional clauses to be used with the new agreement. This is in addition to the LexisSmart version of the compromise agreement. \r\n\r\nThey are also totally overhauling the:\r\n             Service agreement (to add extensive drafting notes and provide optional clauses for listed companies and those operating in a regulated environment) (target date is end of May)\r\n             Basic contract of employment (target date is end of June)\r\n             Share sale and business sale warranties and indemnities (target date end of July)\r\n             Restrictive covenant materials (target date end of August)\r\n\r\nIn addition, the team also plan to add several client-facing precedent letters (eg, letters of advice on: employment contract, director\'s service agreement, compromise agreement, conducting disciplinary investigation/hearing, overviews of tribunal procedure etc). They hope to start adding these by the end of the year.\r\n\r\nExtensions to the LexisSmart precedent offering in employment are also planned (over the course of the next nine months or so) to include:\r\n             Service agreement (three versions)\r\n             Basic contract of employment (numerous versions)\r\n             Written statement of particulars of employment\r\n             Consultancy agreements\r\n             Non-executive director letter\r\n             Secondment agreement\r\n             Trainee solicitor contract\r\n\r\nThe LexisPSL Employment  team have also recently added numerous contentious precedents (ET1s, ET3s and related tribunal documents) relating to claims under the Equality Act 2010 and, with those, now have a total of over 110 contentious precedents.  We understand that PLC currently have only 20 or so such precedents.\r\n\r\nThe team obtained over 70 precedents from Shepherd and Wedderburn earlier this year and are now collaborating with them over the production and maintenance of some of the precedents in the product. They are using some of these new precedents as the basis for creating updated and more contemporary versions of existing precedents (eg the service agreement, consultancy agreements, secondments agreements, policies and procedures) and to plug some gaps (eg in relation to medical report requests and TUPE).\r\n\r\nIf you have a need for a particular precedent we do not currently have in PSL, if you could the Employment PSL team (contact: melanie.adams@lexisnexis.co.uk) know, they will always do what they can to expedite adding it to the product.','1303911289.docx','List of precedents currently available in LexisPSL Employment 4.4.11.docx',NULL,NULL,NULL,NULL,NULL,NULL,68,'2011-03-25 11:12:24',1921,'2011-04-27 14:41:02',7,2321,NULL,NULL,NULL,'N'),(2801,'PRODUCT','Customer training session','Gemma Bean',6658,NULL,NULL,'','',1,4,4948,NULL,'If you select Part 36 offers, select PRactice Notes, select defendent receiving a Part 36 offer - deciding whterh to accept offer.  Within this PN, the majority of the cross references to other PNs result in a no documents found message, which looks awful for a customer?',NULL,NULL,9,6,'Update Clare Duggan 15.04.11\r\nIf you select Part 36 offers, select PRactice Notes, select defendent receiving a Part 36 offer - deciding whterh to accept offer.  Within this PN, the majority of the cross references to other PNs result in a no documents found message, which looks awful for a customer?\r\nI\'ve asked Matt Poulsom who is the paralegal for the DR team to investigate this and will come back to you asap.\r\n\r\nFollow-up: 24/5/2011\r\nHi Lynne\r\n\r\nFurther to your feedback below from Jordans Solicitors, I just wanted to let you know that these cross references have all been corrected.\r\n\r\nIf you select Part 36 offers, select Practice Notes, select defendant receiving a Part 36 offer - deciding whether to accept offer.  Within this PN, the majority of the cross references to other PNs result in a no documents found message, which looks awful for a customer?\r\n\r\nKind regards,\r\n\r\nClare.\r\n\r\n\r\n','',NULL,'',NULL,NULL,'','',0,68,'2011-03-25 11:18:14',1921,'2011-08-10 13:32:03',72,59,0,NULL,NULL,'N'),(2811,'PRODUCT','Customer training session','Gemma Bean',6658,NULL,NULL,NULL,NULL,NULL,4,4967,NULL,'The client - Gemma Bean - is trialling LexisPSL DR/PI.\r\nChose the smart Part 36 Offer From Claimant.  Within this letter there is no mention of CRU, whether there will be interim payments, whether it takes into account or is exclusive of recoverable benefits etc.  So, Gemma would have expected the letter to make mention of this but it doesn\'t.  Her feedback was that if she hadn\'t had her wits about her and had sent that out then there could have been comeback on her, but also as our letter doesn\'t make mention of this vital ifnormation then why would she use the LSmart version as ultimately it isn\'t saving her time because she is going to have to either use the current LSmart doc and heavily edit it to add this info, or in her mind she would be quicker fdradfting her own because that would give her peace of mind that all the relevant information had been included and not missed out.',NULL,NULL,44,3,'Karen O\'Sullivan Pi PSL 12 April 2011\r\nThe practice notes for Part 36 offers in PSL are being amended at the present time to be more PI specific as the current versions are of more general application having been copied from the DR product. We will also be including some precedents in this section which should cover the CRU issue Gemma has referred to.\r\nThe document assembly for Part 36 offers in Lexissmart is currently on hold due to the recent Court of Appeal decisions in this area. I am making enquiries about when this work will be re started.\r\nI anticipate the new practice notes and precedents will be on the product by the end of May 2011.\r\n\r\n11.04.11, Phil Mone, Email sent to Karen O Sullivan\r\n\r\n\r\n25.03.11 Janna Purdie : \r\nThe reference to CRU is to The Compensation Recovery Unit (CRU) works with insurance companies, solicitors and DWP customers, which is used to recover:\r\n\r\namounts of social security benefits paid as a result of an accident, injury or disease, where a compensation payment has been made. This is known as the Compensation Recovery Scheme. In addition as I understand it there is a separate recovery system for costs incurred by NHS hospitals and Ambulance Trusts for treatment from injuries from road traffic accidents and personal injury claims which is known as Recovery of NHS Charges. \r\n\r\nThe CRU is not referenced in the Part 36 practice notes or precedents in DR module as we do not deal with personal injury.  However, the Personal injury team use our information on this.  The issue is that the precedents in DR need to be amended to make them more reflective of the position for a PI lawyer and that amended version of the precedents should be made available in the PI module which is the one which I assume Gemma Bean should be using if she is looking at PI cases.\r\n\r\nThis would need to be actioned by Jon Scriven/Karen O\'Sullivan who work on the PI team.  I have changed the practice area above to Personal injury.','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,68,'2011-03-25 11:24:28',1921,'2011-04-13 16:58:08',7,371,NULL,NULL,NULL,'N'),(2821,'PRODUCT','Customer training session','Katherine Lindley',6658,NULL,NULL,NULL,NULL,NULL,4,4954,NULL,'Katherine currently uses Lawtel & Westlaw.  Katherine does the MIB/CICA work for Jordans.  On Lawtel she can access the enire pre-action protocol she needs for the MIB/CICA work, LexisPSL does not include this and she feels that if the firm were to swap to LPSL from Lawtel then she would be losing content, can we add it to LPSL??\r\nLPSL has a PN  on CICA - appealing the CICA - the note is OK but where KAtherine struggles to find information is surrounding when you can appeal.  So currently Katherine would love a PN that actually gives guidance on when you can appeal or when you can\'t appeal (perhaps a couple of paragraphs within the existing PN?) Our PN currently details the appeal process but this she already knows, guidance on when you can appeal is what is missing and what KAtherine would really value.',NULL,NULL,44,7,'Karen O\'Sullivan -PI PSL - 13 April 2011\r\nI have added these requests to our roadmap for further consideration in the future. Initial research indicates there might be a licensing issue in relation to the pre-action protocols but if they can be added to the product they will be. It shouldn\'t be difficult to add something to the practice note to cover Katherine\'s request for guidance on when to appeal the CICA.\r\n\r\n11.04.11, Phil Mone,  Email sent to Karen O Sullivan\r\n\r\n25.03.11 JANNA: MIB is the Motor Insurers Bureau and CICA is Criminal Injuries Compensation Authority and so I  think the issues raised in this insight arise out of the Personal injury module as we do not deal with these in DR module which is what I deal with.  \r\nThis needs to be sent to Jon Scriven and Karen O\'Sullivan who deal with the Personal Injury module','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,68,'2011-03-25 11:30:43',1921,'2011-04-13 17:05:00',7,371,NULL,NULL,NULL,'N'),(2831,'PRODUCT','Customer training session','Gemma Bean',6658,NULL,NULL,'','',1,4,4949,NULL,'Gemma has asked why there is a lack of consistency in the precedent download options in LPSL.  So for some precedents you have the \'download precedent in word\' link and tohers you don\'t.  The problem with not having a download to word link is it bevomes diofficult for a user to obtain a clean copy of a precedent to draft, currently they get a precedent littered with footnotes, paragraph references at times it is quicker to type from scratch rather than try and tidy up one of our precedents.\r\nGemma said if we had a consistent approach i.e. all precedents in LPSL had the download to word option this would be a huge improvement and reduce drafting time',NULL,NULL,44,3,'Clare Duggan 15.04.11\r\nThis is something we are working towards and hopefully the alternative rendition project (i.e. word downloads on Looselaf sources) that John Hanratty\'s team is working on will be a step in the right direction.\r\nIf not then consistent delivery of word downloads across precedents content will be rolled into the Investment case that Tim Wakefield is currently awaiting sign off on from Alex Sage/ Nicky. If it is signed off then phase 1 delivers June 2012.\r\n\r\nClare Duggan Follow-up 24.5.2011\r\nHi Lynne\r\n\r\nFurther to your insight from Jordans Solicitiors submitted earlier this year, I wanted to let you know that word downloads have now been rolled out across the Looseleaf sources. If users come across any specific instances/ precedents that appear to be missing the word icon then please let John Hanratty know and he will investigate.\r\n\r\nKind regards,\r\n\r\nClare.\r\n\r\n\r\n\r\n\r\n\r\n','1301062089.doc','LPSL - download in word.doc','',NULL,NULL,'','',0,68,'2011-03-25 14:10:33',1921,'2011-08-10 13:34:44',72,59,0,NULL,NULL,'N'),(2841,'PRODUCT','Customer training session','Various',13217,NULL,NULL,'','',NULL,4,4969,NULL,'Had a session today on john Collins solicitors in Swansea which provided some useful feedback.\r\n\r\nThey use Express wills cd from sweets and are looking to drop it in favour of ours.\r\n\r\nI showed them the mega will and they were actually horrified at it\'s size! They thought it would be rare they would need it and actually having more shorter run-of the mill simple wills would be more useful - we have a few of these of shorter smart forms but the mega was too much for them. I said it should probably take no more than 45 mins to complete - they are looking more at 10 mins (which they can do with the cd).\r\n\r\nI indicated they could set up some typical sample docs themselves based on the mega will and just copy these but this would take time and they thought each one would still take a while to set up.\r\n\r\nThey thought the final docs also looked a little unprofessional and they think having titles to indicate the headings of each will section would be clearer (at heading level 1 with the clauses at heading level 2), such as:\r\n\r\n1 revocation, \r\n1.1 text of the revocation clause\r\n2 appointment of executors\r\n2.1 \r\n\r\nEtc\r\n\r\nComparing one of their wills with our assembled doc, I have to agree.\r\n\r\nThey also thought it would be really useful to have a dbase with all the clauses we use within the mega-will  so a mega-will clause bank type of thing - I indicated they could just assemble a will no questioned answered but they thought it would be better incorporated into the psl product as a marked up list.\r\n\r\nOne of the shorter wills (can\'t remember the exact one), we assembled and they wanted to know if there was a question asking if they wanted all the STEP clauses in the will or if it could just refer to STEP which they normally do. I couldn\'t see this option - could be worth incorporating?\r\n\r\nThey did like the ability to store the will and return to the questionnaire later and also the fact it downloads to word but other than that, this is going to be difficult to shift them\r\n',NULL,NULL,47,3,'Please assign this insight To Vicci Tubb: victoria.tubb@lexisnexis.co.uk\r\n\r\nV Tubb 25.03.11 (input by Phil Mone) \"I\'ll upload where we are, still some way to go.\"\r\n\r\n24.5.2011 V Tubb - responded to JCP in full against their issues with actions. Debbie Ware is working on the revised Automated Will Draftsman and templates in response to the feedback from JCP. Completion date early June, testing and marketing to be completed by August for roll out of preview functionality.\r\n\r\n','',NULL,NULL,NULL,NULL,'','',0,65,'2011-03-25 14:36:07',2572,'2011-03-29 16:28:37',4,331,NULL,NULL,NULL,'N'),(2851,'PRODUCT','Customer training session','Denise Findlay',5338,NULL,NULL,NULL,NULL,NULL,4,4946,NULL,'Denise searched LSPL for a Parental Responsibility Agreement and couldn\'t find one?  She aslo looked for a Parental Responsibility Agreemeent for a Step parent and couldn\'t find one?\r\n\r\nIt could be that it is called something else but i promised I would follow up on this query.  I can find PNs covering this but Denise was looking for the actual agreement?\r\n\r\n',NULL,NULL,28,3,'Denise there are parental responsibility agreement forms on PSL- they are forms (which are not searchable) See Parental responsibility - Forms C (PRA2) - Step-Parent Parental Responsibility Agreement Section 4A(1)(a) Children Act 1989 , Claire\r\n','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,68,'2011-03-28 13:25:27',1921,'2011-03-30 16:46:46',7,1551,NULL,NULL,NULL,'N'),(2861,'PRODUCT','Customer training session','Pamela Hoare',5338,NULL,NULL,NULL,NULL,NULL,4,4949,NULL,'Pamela uses the S&M Facts and Figures book for reference and asked if we could add something similar to the PI Toolbox within LexisPSL:\r\n\r\nhttp://www.sweetandmaxwell.co.uk/Catalogue/ProductDetails.aspx?recordid=4139&productid=379684\r\n\r\n',NULL,NULL,44,9,'We are working with product development and the engineers to expand the contents of the toolbox - anticipated release date is the end of July. We are going to include a \'Figures and rates\' section in the toolbox which will include the information Pamela currently obtains from her Facts and Figures book.\r\nKaren O\'Sullivan - 30 March 2011','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,68,'2011-03-28 13:31:25',1921,'2011-03-30 16:15:44',7,371,NULL,NULL,NULL,'N'),(2871,'PRODUCT','Customer training session','Liz Larner',10062,NULL,NULL,NULL,NULL,NULL,4,4949,NULL,'Liz uses the S&M Facts & Figures book and asked if LPSL PI Toolbox could add something similar as it is a valuable reference:\r\n\r\nhttp://www.sweetandmaxwell.co.uk/Catalogue/ProductDetails.aspx?recordid=4139&productid=379684',NULL,NULL,44,9,'We are working with product development and the engineers to expand the contents of the toolbox - anticipated release date is the end of July. We are going to include a \'Figures and rates\' section in the toolbox which will include the information Liz  currently obtains from her Facts and Figures book.\r\nKaren O\'Sullivan - 30 March 2011','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,68,'2011-03-28 13:33:08',1921,'2011-03-30 16:15:03',7,371,NULL,NULL,NULL,'N'),(2881,'COMPETITOR','Customer cancellation request','Ramby De Mello',NULL,NULL,NULL,'','',0,0,NULL,49,'Sweet and Maxwell work in tandem with Chambers\' (No. 5 Chambers) marketing team and practice area clerks to send bulk offers to each practice area:          i.e. Buy 50 copies of the White Book and get it at \'x\' per copy to all members of the commercial lit team etc.',NULL,1,0,0,'We need to use marketing to draw up flyers for us containing competing offers\r\n\r\nPM - Initially delegated to Phil Rogers - Update from Phil Rogers 15.04.11  - this is for competitive strategy & not for me\r\nPM - Delegated to Derek Livingstone 24.05.11\r\n\r\nUpdate from Gavin Cummy 25.05.11\r\nWe are now starting to work with individual Chambers in the same way and offer the same service - hopefully better!','',NULL,'Number 5 Chambers',NULL,NULL,'','',0,38,'2011-03-30 09:09:30',1921,'2011-05-25 10:07:38',7,62,NULL,NULL,NULL,'N'),(2891,'CUSTOMER','Renewal or new business conversation','Janna Purdie',NULL,13345,'','Julie Simpson Day','PSL',NULL,NULL,NULL,NULL,'Generally impressed with LexisPSL DR.  The following issues arose out of the meeting:\r\n\r\n Cases landing pages - would like to be able to toggle between having the cases in alphabetical order and in date order (currently only available in date order)\r\n Like the bespoke email being received on a Friday. Would like to receive a weekly practical tip of the week in the DR email.\r\n Do not like the LexisLibrary current awareness alerts they currently receive.  Their view was the digests are simply ignored as they do not contain the information that is required for busy lawyers ie they want to be able to identify the principles of the case very quickly, they are not interested in \'voluminous\' facts.  I explained that in DR PSL they would not get those cases reports in the alerts but would get updates from LexisLibrary on legislation, journal articles and interviews and they thought that combined with the PSL bespoke current awareness that provided a good platform of information for them.  \r\n They find LexisLibrary itself very difficult to use and they much prefer Westlaw which has much easier search facilities.  They liked the fact that PSL product did not have the same search criteria as LexisLibrary ie with connectors etc\r\n They loved the current awareness in DR PSL and the structure that we have adopted and considered that it was exactly what they wanted to be able to see;  with the heading and opening para setting out the fundamental issues of the case so they could determine if they wanted to read any further.  They also liked the comment section at the end of the report.  Interestingly they asked for the principle para from the current awareness reports to be added into the practice notes.  This would dramatically extend the length of the practice notes so perhaps is not an option, however we already link back to our current awareness reports for CA and HL,SC decisions within our practice notes and I will look at extending this facility.\r\n In jurisdiction we do not have precedents on the basis that jurisdiction clauses would be drafted by coco teams.  however, they took the view their coco teams asked them to draft them so it would be helpful to have precedents.  They really liked the introduction practice note and said they could see that as being an invaluable practice note for them.\r\n Forms - they trialled Smart forms and so no need for them and alos are not prepared to pay for them.  They have never had HotDocs and want to use word.  I did not mention that word is being phased out as I am not appraised of the full position on this.  This is the second customer in a week who has said they want word documents and so this needs to be considered carefully.  The DR team may have to take the view that they maintain word forms themselves if the form team are dispensing with them.  to discuss with Jon Scriven and Tim Wakefield.\r\n They have the White Book on line and love it and would not move to the Green Book on the basis that the courts use the White Book and they are used to it.  They htought the commentary links to Green Book commentary in PSL was useful but would not buy the book on its own.\r\n They absolutely do not want further reading links that are not included in the subscription.  Their view was that this would be a frustration for them as they would expect everything in the product to be available to them and it would put them off the product.  I explained that we could look at what they currently had in subscription and what else they would need for the reading links.  On a prelim run through it would appear they would need Cook on Costs and they have the rest.\r\n Printing - they would like to have tick boxes besides the practice notes, cases (on the landing pages), forms and precedents so that they can tick through the list and then press print and all the documents they have chosen appear.  This would be helpful not only for research purposes but for trial bundles when producing authority bundles.  \r\n They liked the cross border section and felt that was extremely helpful to have international information easily accessible within the module.  They would like to see the international content expanded on\r\n They liked the fact that our practice notes were relatively short, PLC\'s were they felt far too long and it was difficult to navigate.\r\n They liked the fact that the headings in overviews, practice notes and landing pages were all the same so they could flick from one tab to another and find the relevant heading for them very quickly.\r\n They liked the fact that on practice notes we had highlighted that they would be effected by the CPR changes in April as this would help them determine whether to do something pre or post change and also updated them on CPR changes as they were working.\r\n They loved the fact that we only used consolidated legislation.\r\n They do not deal with adjudication but they are going to ask their construction team to look at it.  They liked the practice notes in there that identify what not to do and would like to see more of these in the rest of the DR product.\r\n They liked the \'see recent documents\' which they felt would be very useful for juniors doing research.\r\n No one had discussed LexisMentor with them. I raised this and explained the product and they would like to test it alongside LexisPSL DR.\r\n They did not consider that a trial of a fmonth was long enough.  They would like a longer trial.  This needs to be discussed with the sales team as I am not aware of the general policy in relation to trials.\r\n',47,4,0,NULL,'PLEASE note I cannot chose the practice area above as there is no Dispute Resoluton choice available.\r\n\r\nThis information needs to be circulated to:\r\nJon Scriven - Practice Area Director\r\nClare Duggan - as a Product Development Manager\r\nTim Wakefield  - Forms\r\n\r\n\r\n15.04.11 Update received from Clare Duggan in regards to specific points:\r\n Cases landing pages - would like to be able to toggle between having the cases in alphabetical order and in date order (currently only available in date order) \r\nClare States \"This isn\'t something we\'ve had feedback on before but we can definitely monitor it to establish whether it\'s a common user need.\"\r\n They find LexisLibrary itself very difficult to use and they much prefer Westlaw which has much easier search facilities.  They liked the fact that PSL product did not have the same search criteria as LexisLibrary ie with connectors etc \r\nClare states \"Interesting given the search is exactly the same on both products and both work with connectors. Are they taking advantage of the word wheels?\r\n Printing - they would like to have tick boxes besides the practice notes, cases (on the landing pages), forms and precedents so that they can tick through the list and then press print and all the documents they have chosen appear.  This would be helpful not only for research purposes but for trial bundles when producing authority bundles.  Clare states \"Interesting point-we are currently speaking to customers about a redesign of results pages on LexisLibrary and the vast majority of our customers don\'t want to deliver a document until they get to the document itself so we are considering removing these from the LL results pages and replacing it with a document folder alternative.\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1531,'2011-03-30 09:31:41',1921,'2011-04-20 09:48:26',4,59,NULL,NULL,NULL,'N'),(2901,'COMPETITOR','Renewal or new business conversation','Athos Yiannis',NULL,NULL,NULL,'','',0,0,NULL,55,'CCH HAVE RATIONALISED THEIR ONLINE PACKAGES OFFERING TO SIMPLIFY TO - CCH TAX BASIC - CCH TAX PLUS - CCH TAX PREMIUM - CCH TAX STANDARD - CCH TAX AND VAT PREMIUM - CCH VAT STANDARD - CCH VAT PREMIUM',NULL,1,53,0,'IN MY VIEW WE SHOULD BE LOOKING TO SIMPLIFY AND RATIONALISE OUR MENUS ESPECIALLY WITH NEW TOLLEY LIBRARY PLATFORM AND BE COMMUNICATING TO ALL OUR SALES FORCE WHAT CCH ARE DOING FOR WHEN WE ARE GOING HEAD TO HEAD WITH THEM FOR NEW BUSINESS OR WHEN THEY ARE COMPETING WITH US AT RENEWALS AND WHEN WE ARE LOOKING TO DISPLACE THEM!\r\n\r\nPM 03.06.11 - Email sent to C Boulter/D Arrowsmith as per Lisa Regans advice (email 24.05). Furhter email sent to DC.\r\n\r\nDC: Hi Nathan having looped around with the Tax team, they totally agree and this issue is well recognised. They have plans in place to rectify this and its on the RoadMap. Keep raising this in your team meetings for updates and thanks for your input.','',NULL,' Aroa International',NULL,NULL,'','',0,1291,'2011-03-30 15:18:25',52,'2011-06-22 08:17:00',7,52,NULL,NULL,NULL,'N'),(2911,'CUSTOMER','Renewal or new business conversation','PSL & Library',NULL,NULL,'MCCA5013','Deborah Price','Secretary to GC',NULL,0,NULL,NULL,'Hi Mark\r\n\r\nI was going to write to you this week anyway to update you on Katherine and Alison\'s feedback on the PSL trial.  I regret to advise that we have decided not to switch to PSL and will be continuing with our subscription to PLC for the time being, as this was favoured by our users.  We would, however, be interested in reviewing the system again in say 12-24 months\' time as we appreciate that you are developing the product on an ongoing basis.\r\n\r\nI asked Katherine and Alison if they could provide me with some constructive feedback to pass on to you, and I set this out below:\r\n\r\n1           Inability to carry out a holistic search across all categories.  You need to search within each topic which is time consuming to carry out.  \r\n\r\n2           List of know how topics is much more limited than PLC.  It lacks some of the subject areas we refer to. \r\n\r\n3           The written style of some of the narrative is quite formal when compared to PLC.\r\n\r\n4           We get the impression, through both use of the system and from comments made by LexisNexis representatives that the content is still under construction.  For example, as discussed the Construction section does not yet appear to be available and existing sections are likely to be still be in the development stage. \r\n\r\n5           The \'Library\' resource is useful - however, it is an additional subscription which would make the package as a whole cost prohibitive.  \r\n\r\nI hope the above explains the reasons why we have decided not to switch to PSL at this point in time, but if you have any further questions please let me know.\r\n',47,4,19,0,'Response from Clare Duggan 15.04.11\r\nHi Mark\r\nThanks for the feedback below. It would be worth forwarding on the content feedback to the lawyers responsible for the practice areas trialled. I can point you in the right direction if you let me know what areas they looked at.\r\nKind regards,\r\nClare.\r\nIn regards to point 1 above, Claire has also stated \" I would be really interested in speaking to this firm a little later in the year when we will be doing some mock-ups of how this might look and work in practice and will be looking for customer feedback and validation. What practice areas were they trialling and were there any in particular that they thought they\'d want to search across simultaneously?\r\n\r\nFollow-up from Clare Duggan 24.05.11\r\nHi Mark\r\n\r\nIn March, you submitted feedback from the firm above and mentioned one of the reasons they didn\'t subscribe to LexisPSL was down to the lack of a holistic search across PSL modules. Do you think this firm would be happy to speak to us about this requirement as we are hoping to embark on some research in the foreseeable future and ideally want to speak to customers or potential customers for whom this is an issue?\r\n\r\nAlternatively if you have any other suitable customers who have also struggled to determine in what practice area content sits, I\'d be grateful if you could pass on their details if you think they\'d speak to us.\r\n\r\nKind regards,\r\n\r\nClare. \r\n\r\n\r\n','',NULL,'McCarthy & Stone','McCarthy & Stone',NULL,'','',0,1241,'2011-03-30 17:17:14',59,'2011-04-20 08:37:10',4,59,NULL,NULL,NULL,'N'),(2921,'PRODUCT','Customer training session','Peter Goodman',6390,NULL,NULL,'',NULL,0,4,4947,NULL,'Peter asked if LexisPSL would have a Property Development topic added at some point soon?  He feels this information is lacking in the product.  He had to buy a book from the Law Society for 90 - Property Development: A Practical Guide (author Gavin Le Chat) and thinks that there is a lack of information on this area generally so if LPSL added some then it would be providing much needed information.\r\n\r\nHe also asked if our PNs/Guidance on Planning could be expanded to include information on the addition of conservatories?  He often has this query and thinks LPSL would be even better if it covered this in more detail - i.e. the size of the conseratory, are building regs required, the building materials used??',NULL,NULL,49,9,'Malcolm Dowden 01.04.11 :We have just agreed the property roadmap for 31 March - 31 July.  We plan to add 2 new topics:  (1) property development, and (2) charity property - both in response to patterns of customer feedback.  Property development will come first.  If Peter could let us have any specific requests for precedents, practice notes then we could build them into the plan.\r\n\r\nIn the meantime, I\'ve asked our planning specialist to prepare a new practice note on conservatories (also extending to garage/loft conversions etc).','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,68,'2011-03-31 07:19:26',201,'2011-10-14 16:44:30',72,201,0,NULL,NULL,'N'),(2931,'PRODUCT','Customer training session','Shelyna Mariscal',NULL,NULL,NULL,NULL,NULL,NULL,4,4949,NULL,'Shelyna has run a search using LPSL quantum.\r\nSearch criteria were:\r\nMajor Injury - back\r\nJSB Severity & Value - minor\r\n\r\nThe results coming back are not just back injuries, they are neck or neck and back injuries.  Shelyna would have expected to see just back injuries & wondered if there was a bug on the system??',NULL,NULL,44,1,'The quantum search looks for \'key words\' and more often than not an injury description will include reference to a back AND a neck injury. Accordingly a lot of the results for neck or back injuries will bring up the same cases. We are updating the quantum database over the next few months and will be introducing a more refined search system which should enable this customer to refine her search further to only include cases which mention a back injury.\r\nKaren O\'Sullivan PI PSL team. 4 April 2011','1301564666.doc','Hansells - back & minor.doc','Hansells',NULL,NULL,NULL,NULL,NULL,68,'2011-03-31 09:46:56',1921,'2011-04-05 12:07:37',7,371,NULL,NULL,NULL,'N'),(2941,'PRODUCT','Customer training session','Shelyna Mariscal',5338,NULL,NULL,NULL,NULL,NULL,4,4955,NULL,'Shelyna said the old edition of JSB Guidelines always had a section on minor injuries(handy for referring to for minor whiplash cases) but the edition on LPSL (10th Ed) has no minor injuries section.  Is this because we have missed it off or is it because the JSB no longer has a separate minor injuries category?',NULL,NULL,44,9,'The 10th edition of the JSB has been exactly replicated in PSL. There isn\'t a minor injuries section and the minor whiplash injury section can now be found in: \r\nChapter 6 (A) (c)  (orthopaedic injuries > Neck Injuries > Minor)\r\nThanks\r\nKaren O\'Sullivan PI PSL team. 4 April 2011','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,68,'2011-03-31 09:50:35',1921,'2011-04-05 12:07:00',7,371,NULL,NULL,NULL,'N'),(2951,'PRODUCT','Renewal or new business conversation','Martin Gaskin',6621,NULL,NULL,'','',0,18,NULL,NULL,'It\'s not clear enough, when logging into the www.lexiswebinars.co.uk site, how to view the Webinars you are subscribed to.  There should be a button saying \'My Webinars\' to get to them.  The easier we can make it, the more likely the clients are to use them and to use them as a pre-sales trial too.',NULL,NULL,44,9,'A button should be added to the site to make it easier to see how to get to their subscribed Webinars. \r\n\r\nPM 24.05.11 Delegated to Peter Nussey','',NULL,'',NULL,NULL,'Webinars','',0,35,'2011-04-05 12:52:47',1921,'2011-05-24 15:23:41',3,1851,NULL,NULL,NULL,'N'),(2961,'PRODUCT','Renewal or new business conversation','Adam Workman',NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,'We offer 2 results for \'share purchase agreement\'. PLC offers around 6 variations. \r\n\r\nThe language used within PSL precedents, particularly EF&P ones, is very dated. E.g. \'Recital\' or \'between\' instead of \'parties\'\r\n',NULL,NULL,10,3,'Anne Marie Claydon 13.04.11 has responded in regards to each point individually:\r\n\r\nShare Purchase agreement\r\nWe do only offer two share purchase agreements within the CoCo module. PLC may well offer 6 versions in Corporate but they do not offer any such content within their Commercial module. So, we actually offer more than PLC in this regard. In the Corporate module, we have two SPAs (a long-form and a short-form) but we also offer various \'Add ons\' providing alternative clauses to go within an SPA. So, adding up all of the Add ons (which would be slotted into the SPA), we have at least a comparable offering to PLC Corporate.  The long-form SPA and the Add ons are not offered within the CoCo module, because they go beyond what we believe (and agreed) is required \r\nthere. So, I\'m afraid if a customer really requires this level of content, they should be buying PLC Corporate as well. \r\n\r\nLanguage\r\nThis is a rather general point. I have copied in Tim Wakefield as he is responsible for EF&P precedents. I cannot comment on these or on the generality of the precedents to be found in the CoCo module. Tim may wish to take this point up but I suspect he would need some more concrete examples to respond on. We do not include EF&P precedents within the Corporate module and so the only ones that apply to me are those within the Transactions topic in CoCo, which the Corporate team maintain.  As far as the specific example of \'recitals\' goes, this is something that Corporate lawyers still favour and so our precedents are drafted on this basis. The CoCo team may take a different view but these precedents are under our remit and hence cater for the preferences of Corporate lawyers. I have spoken to Cara Annett about this point and she indicates that:\r\n\"Different practice areas favour different styles and terminology. We are reviewing the language used generally across our precedents but in the meantime the position we have taken is to maintain the status quo, i.e. on documents that arise predominantly in one practice are (i.e. corporate) we follow that practice area\'s language. We take this approach on the basis it is not that difficult to change one word and all parties understand broadly what is meant (otherwise we will always upset someone!).\"\r\n\r\nI\'m sorry if this is not the response you were looking for. In terms of what to feed back to the customer, it would be to highlight that we do have good SPA coverage within the Corporate module but not so much in the Commercial module. However, there is more coverage (i.e. some!) in the CoCo module than in the PLC equivalent (where there is none). In terms of style, this is a bigger discussion and we would need more concrete examples of outdated language in specific precedents to be able to respond.\r\n\r\nUpdate Tim Wakefield (13.04.11) Nothing to add to Anne-Marie/ Cara\'s points on style outlined below, save to highlight that if this customer has more specific feedback on individual docs we will feed this directly into our practice area review of style/ language used on precedents.','',NULL,'Wannop Fox Staffurth & Bray',NULL,NULL,'LEXISPSL COMMERCIAL',NULL,NULL,35,'2011-04-05 12:55:08',1921,'2011-04-13 16:16:11',7,811,NULL,NULL,NULL,'N'),(2971,'PRODUCT','Renewal or new business conversation','Nicola',6621,NULL,NULL,NULL,NULL,NULL,4,4955,NULL,'It would be useful to be able to narrow results or search by how far forward an additonal or aggravated injury has brought symptons/the need for treatment.\r\n',NULL,NULL,44,1,'This is a sensible suggestion but unfortunately the search mechanism on the quantum database is not sophisticated enough to enable this search to be undertaken. We are currently working hard to significantly expand the number of quantum cases in the database. I will add this suggestion to our roadmap for PSL PI and consider whether it can be implemented once the work on expanding the database has been completed.\r\nKaren O\'Sullivan PSL PI team - 11 April 2011','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,35,'2011-04-05 12:57:04',1921,'2011-04-11 13:10:14',7,371,NULL,NULL,NULL,'N'),(2981,'PRODUCT','Renewal or new business conversation','Nicola',6621,NULL,NULL,NULL,NULL,NULL,4,4949,NULL,'If you enter (in a legislation search) Workplace Health Safety and Welfare in title and then 1992 in year, you get no results. However, if you leave year blank the 1992 act is top result!\r\n',NULL,NULL,44,2,'Having tested this on the live product I haven\'t found this problem. The correct legislation appears whether you search by year or not. It may have been a glitch on the particular day you searched? I haven\'t had any other reports of this problem from other users. I will keep an eye on this issue to see if the problem reoccurs. Obviously let me know if you continue to have any problems. \r\nKaren O\'Sullivan - PI PSL 11 April 2011','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,35,'2011-04-05 12:57:51',1921,'2011-04-11 13:11:14',7,371,NULL,NULL,NULL,'N'),(2991,'PRODUCT','Customer training session','Elizabeth Henry',7174,NULL,NULL,NULL,NULL,NULL,4,4951,NULL,'A customer has just flagged that our PN in TUPE is massively out of date because it hasn\'t been updated to reflect the recent EAT case - OTG - on insolvency?  Apparently, this case was a month ago so by relying on our guidance the solicitors would have been giving incorrect advice?',NULL,NULL,24,6,'Update Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n\r\nUpdate Philip Thornton 27.04.11 \r\nThis issue has already been relayed to the LexisPSL Employment team by email of Lynne Davies on 5 April 2011 at 18:00. The problem was rectified by the morning of Thurs April 7. Full details regarding the matter were emailed to Jon Scriven on Thur 14 April at 17:01','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,68,'2011-04-05 20:05:38',1921,'2011-04-27 14:43:36',7,2321,NULL,NULL,NULL,'N'),(3001,'PRODUCT','Customer training session','Elizabeth Henry',7174,NULL,NULL,NULL,NULL,NULL,4,4945,NULL,'querying the fact that there are only 2 page references under the Butterworths tab? They feel that the 2 page references to Harvey are related to very specific areas in TUPE & would have expected to see a lot more page references within LPSL for this topic?',NULL,NULL,24,4,'Update Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n\r\nUpdate Philip Thornton 27.04.11 \r\nThe Butterworths tab contains only the \'extract links\' within our practice notes. These are deliberately kept to a minimum so as to allow for upsell to Harvey. There are however many further links to Harvey in the practice notes which are \'Further Reading links\'. This second type of link (a) requires a LexisLibrary subs for the link to work and (b) does not appear on the Butterworths tab','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,68,'2011-04-05 20:09:27',1921,'2011-04-27 14:45:04',7,2321,NULL,NULL,NULL,'N'),(3011,'MARKET','Informal conversation','Webinars',NULL,NULL,NULL,'','',1,0,NULL,NULL,'APIL only allow PI Lawyers to submit 25% of their CPD via \'distance learning\' (i.e. Webinars)',NULL,18,44,0,'Negotiation with APIL?\r\n\r\nPM - Delegated 24.05.11','',NULL,'LexisNexis',NULL,NULL,'','',0,35,'2011-04-07 10:52:25',1921,'2011-05-24 15:24:50',3,1851,NULL,NULL,NULL,'N'),(3021,'PRODUCT','Renewal or new business conversation','Claire Boot',8110,NULL,NULL,'','',0,1,NULL,NULL,'1.  When looking at IHT404 (jointly owned assets) the date re-formatted to American format and client couldn\'t get it to save in UK date format.\r\n\r\n2.  Can you \'delete pages\' within a form?\r\n\r\n3.  When demo-ing, we kept getting an error message when scrolling down forms saying \'the simple calculation does not work within the intergrated form\'\r\n\r\n4.  On Form 4.1 (Statutory Demand), where it asks for the Name we have put BLOCK LETTERS.  This makes it unclear where you are supposed to type.  The client was trying to type over the BLOCK LETTERS prompt but you are actually supposed to type above it.  Laserform shows you (in a rather awful lime green) but at least it is clear where to type!\r\n',NULL,NULL,59,3,'Update Tim Wakefield 05.05.11\r\nI have picked up the outstanding insight in my name and passed to Rob Evans in the LexisSmart forms team who will address the issues raised relating to specific forms. We will let Kirsty Le Saint know when this is sorted.\r\n\r\nUpdate Tim Wakefield 06.05.11\r\nRob Evans has addressed the specific forms issues raised and customer has been informed of fix.','',NULL,'',NULL,NULL,'LEXISSMART FORMS','',0,35,'2011-04-07 15:20:12',1921,'2011-05-06 12:55:19',7,151,NULL,NULL,NULL,'N'),(3031,'CUSTOMER','Customer training session','Jayne Leedham',10865,10865,'SHAK5001','Jayne Leedham','PSL',0,0,NULL,NULL,'Jayne is overall very impressed with PSL and Smart Precedents. However, in her opinion Automated Wills Draftsman is a little too detailed. In her experience she rarely comes across anyone that wants any other funeral arrangements than burial or cremation and we have a whole raft of questions on organ donation (which get very specific about corneal donation!) and specific grave arrangements. She feels it would be best to just have the standard questions i.e. cremation or burial? Keep costs to a minimum or no limit? And then the option to go into further detail if you need to by linking through to the other questions. Having pages of questions to click through makes it very time consuming.',0,4,56,0,'Simplify the form so there are not 200 odd pages to click through, taking out subjects that are rarely covered in a standard will. Provide an option (perhaps via a hyperlink) to link through to add in extra information as and when it is needed.\r\n\r\nUpdate Clare Duggan 15.04.11\r\n\"Thanks for the feedback. I\'ve sent this onto the Wills and Probate lawyers to respond as it is content related. I have copied you into that email so they can respond directly.\"\r\n\r\n','',NULL,'',NULL,NULL,'','',0,2461,'2011-04-07 18:46:14',1921,'2011-05-09 10:37:01',7,59,NULL,NULL,NULL,'N'),(3041,'PRODUCT','Customer training session','Ken Law',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'I was doing a sales demo yesterday for PSL PI in a firm in Ellesmere (Gough Thomas & Scott) - where they buy lawtel for PI currently - so we are up against an established competitor.\r\n\r\nWe clicked on the litigation topic and part 36 offers, then practice notes, then clarifying an offer.\r\n\r\nYou then get a \'no documents found\' error.\r\n\r\nWe then tried the \'Why would a claimant make an offer\' practice note link and the same happened. I think there are plenty of other examples of dead links in this area too\r\n\r\nNeedless to say this was embarrassing and not a great advert for our product.\r\n\r\nThe part 36 offers topic in PI appears to be structured differently compared to the DR module - has it been updated in one and not the other?\r\n\r\n\r\nThis is not a unique occurrence of this type of issue - where a link has no docs behind it. How often do we do a complete sweep of the modules to check all is working ok and/or is this something we can automate to stop this problem reoccurring once and for all?\r\n\r\n',NULL,NULL,0,0,'i\'ve already e-mailed this direct through to clare duggan, this insight is to record the error i experienced as it\'s an ongoing problem with psl content.\r\n\r\nUpdate Clare Duggan 15.04.11\r\nHi David \r\nThanks for the feedback below from Gough, Scott and Thomas. I have asked Matt Poulsom who is the paralegal for DR to respond and this is what he had to offer.\r\nI hope this helps - feel free to contact Matt directly if you need to follow up on any of these points\r\nKind regards,\r\nClare.\r\n\r\n1.       We never make a complete sweep/ any sweep of the practice areas to check the links aren\'t working. We should do but there simply isn\'t the headcount available (as this would be a very time consuming, albeit important, process)\r\n\r\n2.       (For Karen as well) The Litigation: Part 36 topic  still draws all its content from DR so when DR is updated, PI is updated automatically. However, DR does now have an additional PN in the topic not present in PI (called \"Making a valid Part 36 offer - claimant or defendant\"). This could be easily included in PI if desired. The ordering of the PNs is slightly different in PI to DR. The PI content could be re-shuffled to exactly replicate that of DR if required. DR also has a series of checklists in the topic which PI does not include but could be included.\r\n\r\n3.       (For Nachum as well) The actual issue raised of the \"no content found\" is a bit of a puzzler. The content of the PNs is in place and viewable by clicking on the main heading link for each practice note. What David has discovered is that the linking from the PNs landing page to sections within the practice notes does not work. However, once each PN has been opened, this internal section linking is then fully operational. I have no idea why this should be the case. I\'ve just run a full extract publish for PI PNs to see if this straightens out the issue. If it doesn\'t, then I\'ll have to defer to Nachum on it.\r\n','',NULL,'Gough Scott & Thomas',NULL,'Lexis PSL',NULL,NULL,NULL,65,'2011-04-08 13:55:07',1921,'2011-04-20 08:33:18',7,59,NULL,NULL,NULL,'N'),(3051,'PRODUCT','Customer training session','Lisa Davies',13230,NULL,NULL,NULL,NULL,NULL,1,3484,NULL,'Lisa had been searchign for the inheritance tax act by entering IHTA 1984 into the quick-find box but we appear not to have this abbreviation marked up behind the scenes in this way - it\'s down as ITA 1984.\r\n\r\nLisa was a little dismayed at this as everyone calls this act IHTA 1984 (apparently)',NULL,NULL,56,2,'mark up the inheritance tax act as IHTA 1984 as well as ITA 1984\r\n\r\nLisa Regan 11.04.11 - I will forward this query to Dids Wrench in the Legislation team and they can possibly get it added so long as there is no other IHTA 1984 in existence already.\r\n\r\nUpdate from Lisa Regan 14.04.11 - With reference to your query, the legislation team has now added the acronym IHTA 1984 to those recognised by the search on LexisLibrary.  The acronym should be live and searchable within the product by tomorrow morning the latest, sooner if the legislation update goes through without any hiccups.','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,65,'2011-04-08 14:03:26',1921,'2011-04-14 09:12:50',7,61,NULL,NULL,NULL,'N'),(3061,'PRODUCT','Customer training session','Lisa Davies',13230,NULL,NULL,'','',1,1,NULL,NULL,'If you try and find a precedent in BWPAS using the techniques we teach is using the word wheels in quick find, it appears not to search BWPAS - or at least it doesn\'t give you the suggestions in the WW list.\r\n\r\nIf you search BWPAS for \'executor and change\', you get a number of precedents including 2A.3.1 Change of executor and trustee.\r\n\r\nIf you enter \'change executor\' into the qf box, you get 1 suggestion only from EF&P - and even though this is a similar doc, users are very particular about using BWPAS as it\'s so highly respected.\r\n\r\nThis search also highlights the wider issue of titles of precedents - I know an \'alternative name mark-up\' is planned but this can\'t come soon enough - or even better more forgiving search principles.\r\n\r\nThe user had been entering \'codicil change executor\' into the title box and getting nothing in the ww as we don\'t have the word \'codicil\' in the title of either the ef&P or BWPAS precedent.\r\nBasically, one way or another, our search needs to be able to start offering closest matches even if ALL the words are not in the title - and also whether the user selects the ww suggestion, or just clicks \'find\' with no connectors.\r\n\r\n',NULL,NULL,56,3,'alex smith also e-mailed direct with this as this has both urgent (BWPAS fix) and also longer term insight.\r\n\r\nPM 24.05.11 Delegated to Malcolm Skinner\r\nMS - 25/05/11\r\nI can\'t disagree with the comments on the search facility as this reflects a common theme. However, in this instance I would have thought that a PC lawyer would have used codicil-replacement - executor or a combination to get what they wanted..','',NULL,'',NULL,'Lexis Library ','','',341,65,'2011-04-08 14:18:31',1921,'2011-05-26 13:26:50',0,2622,0,NULL,NULL,'N'),(3071,'COMPETITOR','Other','Julian Killingly',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,50,'Julian Killingly mainly teaches US law at BCU. He informed me that Westlaw has a service (I think run through their US version) called Cite Advisor. It runs over a document and pulls out the citations and then formats them in accordance with the Blue Book and other texts. Only in relation to US citations. $99 for one username per month.\r\n\r\nThere is also a product called CITRUS (Cite R US) which does the same thing but is a bit more cumbersome.\r\n\r\nHe wanted to know if LN had a similar product.\r\n\r\nApparently Westlaw has a similar product to Lexis Check called Cite Check.',NULL,11,37,NULL,'Do we have anything similar to this on Lexis.com? Are we looking to develop a rival?\r\n\r\nLISA REGAN: There is a US project  - LMO  - LEXIS for Microsft Office which is being developed in the States and was available to US Law Schools.  It was similar to LexisCheck in parts but not completely.  IF you go to the following links there is more information:\r\n\r\nhttp://newsbreaks.infotoday.com/Digest/LexisNexis-Announces-Lexis-em-forem-Microsoft-Office-61000.asp\r\nhttp://www.youtube.com/watch?v=SjR27p2ZYJ8\r\n\r\n',NULL,NULL,'Birmingham City University',NULL,NULL,NULL,NULL,NULL,2461,'2011-04-11 14:21:08',1921,'2011-04-13 13:14:23',7,61,NULL,NULL,NULL,'N'),(3081,'COMPETITOR','Renewal or new business conversation','Jim McGarrity, Senior Partner (PI & Wills/Probate)',4712,NULL,NULL,'','',0,0,NULL,49,'LexisCalculate was well received in the demo, but Jim asked whether we were planning on including a mechanism for other calculations such as a future loss calculator and an Ogden calculator in addition to the inclusion of the Ogden tables. They subscribe to the Sweet and Maxwell PI Toolkit calculator and this provides these services.',NULL,4,44,0,'please let Suzanne Cottle & Gavin Allan know if this is on the road map for development and if so when we can expect this to be added. Thanks\r\n\r\nWe are currently planning the second suite of calculators for PI - both the future loss calculator and the Ogden calculator will be included in the second suite. There is a detailed planning meeting on 26th April 2011 and then contractors in India (who prepared the original calculators) will start working on the second suite. We anticipate launching the second suite before the end of Q3. Timescales cannot be finalised until we speak to India and get their view on how long the work will take ( these calculators will be more complex than the first suite we prepared)\r\nKaren O\'Sullivan - PI PSL - 13 April 2011','',NULL,'',NULL,NULL,'','',0,1441,'2011-04-11 20:16:01',1921,'2011-05-09 09:00:09',7,371,NULL,NULL,NULL,'N'),(3091,'PRODUCT','Renewal or new business conversation','Nick Scott, Partner, Wills/Probate',4712,NULL,NULL,'','',0,4,4959,NULL,'Gavin Allan and I were demonstrating the new content on PSL Private Client. The forms have not yet been added (especially the forms that also sit within PSL Wills & Probate) Also we were searching for what Nick described as a basic \'discretionary Trust\' and this didn\'t seem to be apparent where this was on the service. Also when you look at the topic Elderly Client, Powers of Attorney and go to the precedents tab, there are only 2 options - both of which relate to enduring powers of attorney. Nick pointed out that this was not helpful and that he would have expected to see LPA precedents here and LPA forms under the forms tab (which is still waiting for content to be added to it so it is greyed out)',NULL,NULL,47,3,'Nick is happy to take a call from Malcolm Skinner as we feel that he would be a good customer contact  to give feedback. We will be running a managed trial here at Geoffrey Leaver from 6th May, so if Malcolm could catch up with Nick during the 4 weeks following trial set up that would help the trial along. In the meantime, please could I have some feedback as to when the issues above will be resolved? Many thanks\r\n\r\nPM delegated to Malcolm Skinner on 24.05.11\r\nMS - 25/05/11\r\nI will ring him.\r\nAll available forms should be there now. A discretionary trust has always been available in precedents and a further such trust is available in LexisSmart format.\r\n','',NULL,'',NULL,NULL,'','',0,1441,'2011-04-11 20:37:43',1921,'2011-05-26 13:28:25',7,2622,NULL,NULL,NULL,'N'),(3101,'PRODUCT','Customer training session','Mairead McErlean, Solicitor, DR',4712,NULL,NULL,'','',0,1,3634,NULL,'On the search terms box at the bottom of the start page, Mairead would like to know whey we don\'t have a check box to select \'all subscribed sources\' rather than having the pop up box if you don\'t make a selection from the existing check boxes. She feels that there is an unnecessary click here - could we look to change this?\r\n\r\nAlso other feedback when working with search results in the LexisLibrary - if you have a list of results and you click into one to view it, then hit the red \'results\' tab rather than using the breadcrumb trial to go back a step, this jumps you back to the start of the delivered results list. Could this be changed to make sure that it jumps you back to where your last viewed result has come from? Thanks',NULL,NULL,0,9,'Possibly this should go to Karen Waldron - Karen could you let me know your thoughts? Many thanks\r\n\r\nUpdate from Karen Waldron 14.04.11\r\nOn the first point, yes we are looking into changing this message or possibly removing it altogether. It was in there initially to warn customers that they were not searching over Legislation (as it was giving a \'too many hits\' message). Now the search automatically searches over everything there is less need for the message. We deliberately didn\'t include an \'all subscribed sources\' tickbox after previous usability testing sessions with customers as they expected the search to search all automatically without ticking anything (which it now does). The tick boxes are there for filtering, to narrow the search before searching, rather than to include content before searching. If we remove the message entirely, then that will save the \'unnecessary click\' referred to. We\'ll look into this.\r\n\r\nOn the second point - we are currently making changes to the results page and we can look into including this in the requirements.\r\n\r\nRegards,\r\nKaren.','',NULL,'',NULL,NULL,'','',0,1441,'2011-04-11 20:44:49',1921,'2011-05-09 10:35:38',7,58,NULL,NULL,NULL,'N'),(3111,'COMPETITOR','Renewal or new business conversation','Melissa Page, Partner, Commercial Property',4712,NULL,NULL,'','',0,0,NULL,47,'During a demo of LexisPSL, Melissa wanted to know whether we were able to provide cross referencing yet as part of the auto numbering facility in downloaded precedents to work from PSL. I advised that this is on the roadmap, but until we have this in place, this may be a barrier to this customer purchasing PSL and cancelling PLC in our favour',NULL,4,49,0,'update on cross referencing please\r\n\r\nMalcolm Downden 13.04.11 - Mark Edwards or Vicky Tubb may be able to help with this.  I have no information on the availability of this function\r\nPhil Mone 14.04.11 - Email sent to Mark/Vicky requesting further information\r\nPM 12.05.11 Further email sent to V Tubb\r\n\r\nPM: Response received from V Tubb (18.05.11):\r\nSoon after launching LexisSmart Precedents we had some issues with cross references in the AWD not working, these have been rectified. This insight seems to pertain to the automatic references in precedents generally. Where this occurs, in order for us to replicate the problem and fix it we do need more specific examples.\r\nIf the issue is automatic formatting then the insight should be passed on to John Hanratty to deal. \r\n\r\nPM 02.06.11 - I emailed Suzanne Cottle (18.05), advising of Vicky\'s response and requesting further comment. Nothing else has been received. Insight closed.\r\n','',NULL,'',NULL,NULL,'','',0,1441,'2011-04-11 22:18:21',1921,'2011-06-02 10:51:30',7,331,NULL,NULL,NULL,'N'),(3121,'CUSTOMER','Customer training session','Sue Fachiri',NULL,NULL,'BERR5043','Charlotte Sloan','Solicitor',0,0,NULL,NULL,'Why isn\'t there a hyperlink to the Practice Directions annexed to the new Family Procedure Rules?\r\nThey are not immediately visible by browsing and have to be specifically searched for.\r\nPractitioners like to view the practice directions at the same time and the references to PD\'s within the new rules  do not give a hyperlink through.\r\nFinding the PD\'s today was  rather time consuming and had to be done via a search - in the end I copied the link to the search results into a Word doc saved on the desktop so the solicitors could use this in the interim as a quick way through.\r\nWhen a search was done of the PD\'s the search results themselves did not give any clue asd to where the PD\'s could be found by browsing',0,4,28,0,'Add active links to the Practice Directions\r\nMake them more easily visible/accesible to reach by browsing\r\n20/04/2011\r\nHi Sue\r\nWe have made a few changes to the practice note that contains the FPR and the PD\'s. Hopefully  it looks a bit better now and contains what the customer requires.\r\nIt is in the topic Family Procedure Rules 2010 and subtopic Introduction to FPR 2010 and the pn is called The Rules and Practice directions set out in full.\r\nIt enables the customer to see all of the rules and PD\'s in one place. If you get any feedback from the customer we would be very grateful to hear it - good or bad - as we are continually working on this and are more than happy to make any improvements that we can.\r\n\r\n\r\n\r\n','',NULL,'Berry & Berry','Berry & Berry',NULL,'','',0,72,'2011-04-12 17:27:24',1921,'2011-05-09 10:32:59',7,1551,NULL,NULL,NULL,'N'),(3131,'PRODUCT','Renewal or new business conversation','Andrew Wright (Managing Partner)',2663,NULL,NULL,NULL,NULL,NULL,4,4950,NULL,'Customer had received feedback from the Commercial Partner that there weer \'too many\' EF&P precedents in then service and those used \'old fashioned\' terms such as \'herewith\' that they felt to be outdated. ',NULL,NULL,12,6,'This firm does use EF&P and likes it but they question whether or not LexisPSL is the right place for this type of \'heritage\' content.\r\n\r\n[DC 13.04.11 - We used some EF&P content in LexisPSL CoCo where we felt it was of the right quality - EF&P is such a large resource that not all of it could be - and because it was quicker than writing material from scratch. Early feedback was that customers were about 50/50 as to whether they liked EF&P or didn\'t. As time has gone on, more customers have given us views similar to this i.e. that EF&P looks dated and they wanted something more modern. We will therefore be replacing EF&P content (unless only e.g. insolvency forms which should not be objectionable) but it would help to know what area the customer was looking at - some areas have quite a lot of EF&P precedents and others have little or none]. ','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,24,'2011-04-13 10:54:42',1921,'2011-04-15 16:21:00',7,221,NULL,NULL,NULL,'N'),(3141,'PRODUCT','Renewal or new business conversation','Andrew Wright (Managing Partner)',2663,NULL,NULL,'','',0,4,4945,NULL,'Customer would have liked to see more checklists; they found the layout more complicated than PLC\'s.',NULL,NULL,24,6,'Update Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n\r\nUpdate Philip Thornton 27.04.11 \r\nMore information would be helpful here:\r\n(a) generally, checklists are mots useful where an often repeated procedure is being carried out. We have, for example, included checklists for collective redundancy. It would be useful to know spefically what other checklists the client would like to see - we could then respond more specifically\r\n(b) what aspects of the layout are viewed as \'more complicated\'? It is difficult to respond without specifics','',NULL,'',NULL,NULL,'','',0,24,'2011-04-13 10:56:34',1921,'2011-05-09 10:25:57',7,2321,NULL,NULL,NULL,'N'),(3151,'PRODUCT','Customer training session','',2663,NULL,NULL,'','',0,4,4960,NULL,'Lack of forms on the M&A Share Purchase sub-topic. Customer felt that we should be displaying much more than a Stock Transfer Form. They would expect to see lots of other forms which are relevant in a share purchase agreement, such as 288 forms for retiring and appointing directors.',NULL,NULL,19,3,'Other forms that would be used in a share purchase M&A should be added.\r\n\r\nJane Mayfield\r\n18/04/11\r\nAll of the forms that are commonly used in a share purchase transaction eg. AP01, TM01,  are contained in the subtopics \'Company incorporation, constitution and officers\' and \'Audit and auditors\' in the topic \'Company administration and management\'.\r\n\r\nWe will investigate linking to these pages on the forms page in the subtopic \'Private m&a:shares\' as well as in the other subtopics in \'Transactions.\'\r\n\r\n','',NULL,'',NULL,NULL,'','',0,1881,'2011-04-14 11:50:43',1921,'2011-05-09 10:24:55',7,211,NULL,NULL,NULL,'N'),(3161,'PRODUCT','Customer training session','',2663,NULL,NULL,NULL,NULL,NULL,4,4945,NULL,'Customer did not like the screen being so busy. Suggested that instead of showing topics and sub-topics, we show just topic headings, which you click on reveal the subtopics on a new page.',NULL,NULL,24,0,'Not sure - depends if others share this view.\r\n\r\nUpdate Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n\r\nUpdate Philip Thornton 27.04.11 \r\nThis is the first time I have seen this view expressed. Most customers say the opposite: that they would like all subtopics to be in view by default on the front page (we have, as a result, informed product development that this would be a desirable change.\r\n\r\nVery unlikely that this suggested change would be adopted as no-one else has said the same thing and also the effect would be to make content less accessible (more clicks required) from front page.','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1881,'2011-04-14 11:52:57',1921,'2011-04-27 14:50:53',7,2321,NULL,NULL,NULL,'N'),(3171,'PRODUCT','Customer training session','',2663,NULL,NULL,'','',0,4,4945,NULL,'On the TUPE topic, there was only one checklist to deal with all scenarios. Customer would expect to see different checklists to cover different commercial scenarios, e.g. in industrial settings. PLC does have this.',NULL,NULL,24,6,'Create more checklists.\r\n\r\nUpdate Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n\r\nUpdate Philip Thornton 27.04.11 \r\nThank you - a helpful suggestion. Out TUPE section is being revamped this year, and so we will take this suggestion into account in the course of that project.','',NULL,'',NULL,NULL,'','',0,1881,'2011-04-14 11:55:13',1921,'2011-05-09 09:50:25',7,2321,NULL,NULL,NULL,'N'),(3181,'PRODUCT','Customer training session','',2663,NULL,NULL,'','',0,4,4945,NULL,'PLC has a very useful precedent letter from a law firm to an employer-client that is about to begin a redundancy process, setting out the steps. CWJ use this a lot, and it\'s very simple to convert to their housestyle. We do not have such a precedent.',NULL,NULL,24,3,'Create a suitable precedent and add to topic.\r\n\r\nUpdate Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n\r\nUpdate Philip Thornton 27.04.11\r\nThe redundancy topic is being revamped in the course of this year. On a more general point, we know we need more client-facing letters/packs of documents for our customers to simply print off and use. To this end, we plan to add several client-facing precedent letters (eg, letters of advice on: employment contract, director\'s service agreement, compromise agreement, conducting disciplinary investigation/hearing, overviews of tribunal procedure etc). We hope to start adding these by the end of the year.','',NULL,'',NULL,NULL,'','',0,1881,'2011-04-14 11:57:15',1921,'2011-05-09 09:49:23',7,2321,NULL,NULL,NULL,'N'),(3191,'PRODUCT','Customer training session','',2663,NULL,NULL,'','',0,4,4945,NULL,'Precedents on PSL often contain square brackets for optional/alternative wording. These square brackets are not very obvious, as they are not in bold, and a lawyer in a hurry could miss them and send out a document with square brackets in them. They should be put in bold font.',NULL,NULL,0,3,'Put all square brackets in bold font.\r\n\r\nUpdate Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n \r\nUpdate Philip Thornton 27.04.11 \r\nThis would be feasible as well as sensible if the \'bold\' attribute were added automatically to all square bracket characters in the Word download version of each precedent. I have passed on a suggestion to this effect to Claire Duggan in the product development team.','',NULL,'',NULL,NULL,'','',0,1881,'2011-04-14 11:59:00',1921,'2011-05-09 09:48:28',7,2321,NULL,NULL,NULL,'N'),(3201,'PRODUCT','Customer training session','',2663,NULL,NULL,'','',0,0,4964,NULL,'On SmartPrecedents, if you need to prepare two document for one matter, which are different documents but contain some similar details, there is no way of using your answers for one smart precedent to apply them to a different precedent. I think you can do this on FastDraft on PLC.',NULL,NULL,0,3,'Add this functionality - two different departments in this form both mentioned this point.\r\n\r\nMark Edwards:\r\nThis functionality is on the product roadmap, forming part of the planned Process Automation offering. A phase 2 business case is to be submitted in order to develop the functionality. If funded, it will launch in 2012.','',NULL,'',NULL,NULL,'','',0,1881,'2011-04-14 12:01:28',1921,'2011-05-09 09:47:45',7,341,NULL,NULL,NULL,'N'),(3211,'PRODUCT','Customer training session','',2663,NULL,NULL,'','',0,4,4948,NULL,'There are not enough precedent particulars of claim etc for different types of claim, such as debt actions.',NULL,NULL,4,3,'Add more precedents for different scenarios.\r\n\r\nPM 05.05.11 - Reassigned Insight from Ruth Pratt to Janna Purdie\r\n\r\nUpdate from Janna Purdie 06.05.11:\r\nThis is an development we have on the DR roadmap and we will be seeking to address it over the next year.  The first stage (first six months) will be to ensure that Atkins precedents covering particulars of claim are added into the product.  The second stage (2nd six months) will be to start to add in bespoke case studies with more detailed drafting notes.  We are also looking at providing a standalone precedent which can be used by users for any type of claim but which has the main features of a particualrs of claim in it.  In doing this we need development in the use of arbortext to be able to justify text to enable us to put in court headings.  This is essential for every single one of the DR precedents as they all require court headings.  Our competitors PLC have provided this for many years and we are at a distinct disadvantage given that we are unable to provide it.  The justification of text needs to be developed by the development team (Clare Duggan)','',NULL,'',NULL,NULL,'','',0,1881,'2011-04-14 12:03:03',1921,'2011-05-09 09:46:01',7,1531,NULL,NULL,NULL,'N'),(3221,'PRODUCT','Customer training session','',2663,NULL,NULL,'','',0,4,4947,NULL,'Customer felt there was a lack of content dealing with Residential Landlord and Tenant disputes, especially practice notes and precedents. Similar problem with LexisLIbrary as well. Customer relies on Woodfall as a result.',NULL,NULL,50,6,'Create content for this area.\r\n\r\nI am looking to commission a resi property lit specialist to produce content asap.','',NULL,'',NULL,NULL,'','',0,1881,'2011-04-14 12:09:33',1921,'2011-05-09 09:44:29',7,201,NULL,NULL,NULL,'N'),(3231,'PRODUCT','Renewal or new business conversation','NICK HANNING',10573,NULL,NULL,NULL,NULL,NULL,1,3496,NULL,'THE WORDWHEEL DOESN\'T SEEM TO RECOOGNISE WHEN YOU ARE USING A CONNECTOR.  E.G.IF YOU TYPE IN W/5 IT WILL SAY \'WE THINK YOU MEAN W 5\" ',NULL,NULL,59,9,'Update: Clare Duggan 18.04.11\r\nThanks for the insight below from RWPS. This is an issue we are aware of and making investigations into how we can improve it longer term. Please do continue to pass on feedback like this as we continue to develop this search tool.\r\n\r\nResponse Kirsty Le Saint 18.04.11\r\nThanks Clare - although this doesn\'t give me much to feed back to the customer.  He asked if it was possible to \'switch it off until it works properly\'!!\r\n\r\nResponse Clare Duggan 18.04.11\r\nI should have mentioned this can be switched off in Preferences. This can be unticked to get rid of these \"Did you means?\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,35,'2011-04-18 12:25:41',1921,'2011-04-22 11:12:35',7,59,NULL,NULL,NULL,'N'),(3241,'MARKET','Renewal or new business conversation','Marc Emblem',NULL,NULL,NULL,'','',2,0,NULL,NULL,'Client is frustrated that updates to OECD guidance are nearly impossible to track down. While references are often made to changes the chagne itself is elusive.',NULL,1,53,0,'OECD content should be acquired and fed into premium international tax menus\r\nAlan Blanchard: The OECD content is prohibitively expensive to publish. If we can share the cost among a few products, we could finance the cost of the licence that way. I will speak to Tom Saville about obtaining a price from the OECD, and pull together a list of the titles/menus which need this content.','',NULL,'UBS',NULL,NULL,'','',0,1301,'2011-04-18 16:57:06',1921,'2011-05-09 09:43:30',7,181,NULL,NULL,NULL,'N'),(3251,'PRODUCT','Renewal or new business conversation','kevin gilbert',NULL,NULL,NULL,'','',0,0,NULL,NULL,'client specialises in doctors and dentists, and needs appropriate guidance - expected this to be there as a matter of course as promised\r\n\r\npotential opportuity here AND other clients, revenue being missed',NULL,NULL,53,6,'comms  to sales team with road map / timescales.\r\n\r\nRoy Dewell update 19.04.11 - this has been passed to Chris Boulter\r\n\r\nDC: Hi Neil having looped around with the Tax team, they totally agree and this issue is well recognised. They have plans in place to rectify this and its on the RoadMap. Keep raising this in your team meetings for updates and thanks for your input.','',NULL,'morris crocker',NULL,'tolley guidance','OMB','',0,1301,'2011-04-19 10:12:12',52,'2011-06-22 08:20:17',7,52,NULL,NULL,NULL,'N'),(3261,'PRODUCT','Renewal or new business conversation','maty mc donagh',NULL,NULL,NULL,'','',0,0,NULL,NULL,'index has vansihed fron binder 1 of devoils when using browse function negatively impacting ability to search',NULL,NULL,53,4,'index needs re instating with immediate effect\r\n\r\nUpdate Lisa Regan 10.05.11 - This may have been an editorial decision - worth checking with the editor of DeVoil - try Alan Blanchard.\r\nUpdate Phil Mone 10.05.11 - Reassigned to Alan Blanchard. Email sent to Alan\r\n\r\nUpdate received (11.05.11) from Elain Pugh showing Index is Operational. No further action required.','',NULL,'kilsby williams',NULL,'tolleylibrary','devoils','',0,1301,'2011-04-19 10:18:24',1921,'2011-05-11 16:51:47',7,181,NULL,NULL,NULL,'N'),(3271,'COMPETITOR','Renewal or new business conversation','mick hofffman',NULL,NULL,NULL,'','',0,0,NULL,55,'client uses cch eu vat compliance manual and finds this more useful than our service on international because:\r\ncommentary is too lightweight on TL\r\nspecifically from a uk perspective\r\ngermany, netherlands and italy are main countries in which the client has interest\r\nlegislation and cases specifically are missing from our offering',NULL,1,0,0,'create enhanced international service on Guidance and Library with soecific focus on commentary. happy to discuss revenue implications\r\n\r\nPM - Delegated 24.05.11\r\n\r\nDC: Hi Neil, Ref insight 3271, This relates to a similar insight  raised by Sam (2491). The team agree that we are weak in this area, and have plans/ work in place to rectify this (its on the RoadMap). \r\n','',NULL,'amc',NULL,NULL,'','',0,1301,'2011-04-19 10:32:39',52,'2011-06-22 08:27:34',7,52,NULL,NULL,NULL,'N'),(3281,'PRODUCT','Renewal or new business conversation','Helen Wallce',7291,NULL,NULL,'','',0,0,NULL,NULL,'The client is annoyed that this publication is not available online',NULL,NULL,0,4,'Update Helen Green:\r\nThis is not available online as the publication contains a significant amount of copyright material (owned by the Law Society) who we have not reached agreement with to date regardign an acceptable fee - negotiations are underway.  ','',NULL,'',NULL,'Books','Cordery on Legal Services','',0,7,'2011-04-21 09:06:38',1921,'2011-05-05 16:11:40',7,171,NULL,NULL,NULL,'N'),(3291,'PRODUCT','Renewal or new business conversation','Sarah Parkinson',2213,NULL,NULL,'','',0,4,NULL,NULL,'It would be really useful to have links on the practice notes to the current awareness articles on that topic.  The feedback from the client was that the current awareness was great, so it\'s a shame not to link to it',NULL,NULL,24,5,'On the practical guidance notes, insert links to current awareness stories\r\n\r\nCD (21.04.11): This is not something that we\'ve had feedback on before but certainly something we can monitor going forward to see if this is a universal customer need. What practice area was Sarah from? It would be interesting to know how long she\'d want those links to be there as current awareness items can become updated relatively quickly compared to other content types.\r\n\r\nMA (24.05.11): The PSL Employment team took the decision a while back (around March 2011) to create links to our news analysis stories from our practice notes, to further publicise our reports which otherwise risk getting \'lost\', especially if users don\'t get signed up to our weekly email (an ongoing problem) and whilst the News analysis tab remains inactive. We create these links manually and they will appear under other right hand column links to reports of the relevant case (see the \'Individual redundancy\' practice note, for example). When we write a news analysis story, we always check the impact it has on relevant practice notes. These are then amended (or sometimes substantialy re-written) to take account of the news story/new case/legislation concerned. We add links to the case report etc to the practice note as part of this process and will also remove any links to case reports etc that have become out of date as a result of developments in the law. Links may therefore remain in a practice note for years if they continue to be an accurate statement of the law. Alternatively, we may need to remove them after a matter of months or sometimes even weeks, ie it is not a process that can be automated as legal knowledge is required to make the assessment as to relevance. We do not, unfortunately, have the capacity to revist all our practice notes to add these links, so are dealing only with reports from March 2011 on or on an ad hoc basis when revisiting a practice note generally.','',NULL,'',NULL,NULL,'','',0,7,'2011-04-21 10:10:07',2511,'2011-05-09 09:42:08',7,59,NULL,NULL,NULL,'N'),(3301,'CUSTOMER','Customer training session','Sue Fachiri',NULL,NULL,'RAND5040','Clare Walliker','Accountatnt',0,0,NULL,NULL,'Is it possible to save searches or bookmark items on Tolley Library.?\r\nAt the moment it seems that the only way to save a search is as a scheduled alert.\r\n(When people ask about bookmarking and I have been training on LL I have shown them how to bookmark using the save search function, but this is  not available on Tolley Library).\r\n\r\n\r\n\r\n',0,0,0,0,'I would  like to know if Save Search is to be added to the new Toly Library service and the possible timeframe if so.\r\n\r\nPM  - Delegated 24.05.11\r\n\r\nDC - Hi Sue, I believe you have been emailed about this already by the Tax team, but wanted to close the loop just in case. Basically there is a release scheduled for August which will deliver some of this functionality (bookmarking).','1303971936.pdf',NULL,'Randall Greene','Randall Greene',NULL,'','',0,72,'2011-04-21 11:33:59',52,'2011-07-11 09:41:45',7,52,NULL,NULL,NULL,'N'),(3311,'PRODUCT','Direct Mail',NULL,31594,NULL,NULL,'DACMO TEST USER','System Administrator',5,4,529,23,'DAMCO- Test Record entered for Testing on Production by DAMCO',NULL,NULL,9,2,'DAMCO- Test Record entered for Testing on Production by DAMCO','1303978271.doc','Insight Tracker - Functional Requirements _Version 1.2_ .doc','',NULL,NULL,'','',1,111,'2011-04-28 07:55:29',111,'2011-04-28 08:07:05',21,101,NULL,NULL,NULL,'N'),(3321,'BLANK','Other',NULL,9855,NULL,NULL,'','Owner/Principal',0,4,NULL,NULL,'Detailed feedback from a client who is a long-term user of CD product and who has been trialling LPSL.....\r\n\r\n\r\n- Precedents are in a bad order - alphabetical, rather than the order you see them in the Will\r\n- The \"Books\" on the CD are better due to order (and familiarity!) - e.g. I want BWPAS [A3.18-3.20] -  searched for \'in contemplation of marriage\' - only legislation comes up. It is listed as BWPAS FORMS for wills in expectation of marriage, under letter \'f\' (and the clause in this does not say that the Will will not be revoked whether or not the testator marries). In Lexis Library search for \'contemplation of marriage does get the clause at number 5 in EFP.\r\n- When expanding several levels of menus, the back button on the browser only collapses one level of menu - if that was what I wanted, I would use the \'-\' to collapse the menu\r\n- Automated Will Draftsman:\r\n- 211 pages is a bit daunting, even if it does reduce as options get chosen. For a simple will, it will still be time consuming to select \'no\' for the unwanted options\r\n- Better if there are defaults which are the norm, and if there are unusual needs, bring them in with unusual questions\r\n- Quite slow to load each page.\r\n- Executors; what if you want to appoint more than one individual and a firm of solicitors?\r\n- It only produces the Will, and not any explanatory notes, accompanying letters etc. After getting to about page 50, I \'assembled\' the document as I gave up - and got a 106 page Will! Presumably with all the clause wordings that they use.!!!!!! Not the most useful!\r\n \r\n- Error on Lexis Library - JPG attached\r\n',NULL,NULL,56,9,'MS - 25/05/11\r\nAll valid comments on the basis of \'familiarity\'.  Regrettably the comments do not indicate whether they refer to PSL and/or LL. The comment about the browser is not explained with any particularity.\r\n\r\nThe AWD is currently being revamped as a result of feedback and the new version will deal with length and \'executors\'. It is not for everyday use but primarily as a resource tool for templates. Future enhancements (within the next three months) will include a suite of \'common\' will forms that can be automatically loaded into the AWD, saved and printed. Speed of loading is down to the customer\'s own systems.\r\n\r\nFurther training/explanations may help convince customer.','',NULL,'',NULL,NULL,'LEXISPSL WILLS & PROBATE(APSL04)','',0,581,'2011-04-28 11:45:54',1921,'2011-05-26 08:17:42',7,2622,NULL,NULL,NULL,'N'),(3331,'PRODUCT','Other',NULL,9855,NULL,NULL,'','Owner/Principal',0,0,NULL,NULL,'Comment from a sole practitioner on the Butteworths Wills & Probate\r\n\r\nI have something for your Wills and Probate editor, arising from the new April CD of Butterworths Wills and Probate Library.\r\n \r\nTristram & Coote oaths say \"this is not a case in which an Inland Revenue account is required to be delivered\"\r\nBWPAS says \"and this is not a case where an Inheritance Tax Account is required to be delivered\"\r\n \r\nThe Probate Registry has today confirmed on one of our matters that this latter wording is insufficient and it should read \"This is not a case in which an HM Revenue and Customs Inheritance Tax Account is required to be delivered\".\r\n \r\nI think that \"Inland Revenue\" needs to be replaced with \"HM Revenue & Customs\" throughout and all the Oaths need to be altered.\r\n \r\n',NULL,NULL,56,0,'Update Helen Green 10.05.11\r\n\r\nTristram & Coote is out of date as the \"Inland Revenue\" no longer exists. There should be a new edition of this next year.\r\n\r\n BWPAS - the author has checked the wording and believes:\r\n \"that the wording to \"Inheritance Tax Account\" is correct but some of the registrars at particular district probate registries are known to have their own particular preferences.  I have submitted dozens of oaths to various different registries using my own precedents over the past four years and they have always been accepted. In fact, I have recently had two oaths formally \"settled\" (i.e. approved in advance) by the Winchester District Probate Registry and my wording was approved.\"\r\nHaving said that, he is going to add the words \"HM Revenue & Customs\" to all of the precedents for the July update.\r\n','',NULL,'',NULL,'0','Butterworths Wills & Probate CD','',0,581,'2011-04-28 11:47:52',1921,'2011-05-10 13:57:40',7,171,NULL,NULL,NULL,'N'),(3332,'BLANK','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Head of Litigation',0,4,NULL,47,'We are currently attempting to replace PLC for the legal team at Mercedes - I met with Brian Hall (Head of Litigation, Mercedes) & Sophie Gould to discuss trial feedback & Brian provided the following assessment relating mainly to PSL DR:\r\n\r\nBrian feels PSL is currently aimed at small or one-man teams that farm a lot of work out \r\nMercedes team only go to panel if they can\'t do the work themselves \r\nThere are a number of key topics that Brian felt are not useful or are missing from an in-house perspective in DR \r\nStatutory Demand (whether you\'re an individual or company) \r\nInjunctions \r\nEnforcement - question he wanted answered was \"What can I do if someone hasn\'t paid\" \r\nDraft witness statement \r\nCharging orders - he looked at overview but it didn\'t tell him what he needed to do and there was no precedent charging order he could look at. \r\nMaking an application (making a basic application is more likely than an injunction) \r\nSummary judgement \r\nIn each of these topics Brian would like to see \r\nWhat is it? \r\no        When to use it\r\n\r\nHow do I respond/ what steps do I need to take? \r\no        What evidence do I need to support it?\r\n\r\no        What form do I use?\r\n\r\no        He used PLC draft witness statement as an example of something he found useful.\r\n\r\nThe practical side needs to be improved i.e. more what steps do I need to take, less this is the state of the law \r\nThey had issues downloading hotdocs during the trial & we had a similar issue in the demo yesterday \r\nThey appreciate it\'s a work in progress but if we can show certain areas are being developed and we will use their input to improve the service, as long as the price reflects this, they will be happy to consider moving from PLC \r\n         He queried why we had included Consumer Liability in CoCo and not DR\r\n\r\n         Brian felt PLC looked more modern, nicer font and layout\r\n\r\n         From a validation point of view for In-House Essentials - he thought the idea of having a stripped down general in-house offering was a good one.  In there was a particular area of speciality within the team other relevant modules could be added to sub eg DR, PPty.\r\n',NULL,NULL,59,6,'Janna Purdie:\r\n\r\nI had a productive discussion with Brian Hall at  Mercedes (5 May 2011) and they look set to sign if the price is right for them.  Brian had no idea how to use the product and so having navigated him through it he can now see the possibilities that exist with the product for his team. \r\n\r\nIf Mercedes do sign up then Brian and I will then set up a meeting at their offices to go through what they need.  Mainly it relates to debt recovery work and basic insolvency and to assist in house get off the ground from a DR perspective I will look at adding this into the DR module over the next 6 months.\r\n\r\nMark Francis to advise if Mercedes sign up to LexisPSL and then Janna will arrnage a meeting with Brian Hall to talk through requirements and timetables. Mark is aware of this and so an insight notification does not need to be sent on to him.\r\n\r\nUpdate Janna Purdie 25.05.11\r\nI am waiting to hear whether Mercedes have joined up to Lexis PSL.  If they do then I will arrange the meeting with them to discuss in more detail the two new topics they want added to the product and then look at addressing that by working with the insolvency practice area.  This would probably take place over a 6 month period.\r\n','',NULL,'Daimler Mercedes',NULL,NULL,'LexisPSL DR','',61,1241,'2011-05-04 14:03:56',1921,'2011-05-25 08:25:15',7,1531,NULL,NULL,NULL,'N'),(3342,'BLANK','Direct Mail',NULL,9659,NULL,NULL,'','Head of Information',6,81,NULL,NULL,'Twitter Information in Nexis - Our functionality does not lend itself to this type of information\r\n\r\nOllie,\r\n \r\nWe\'ve become aware that twitter feeds have started appearing in Nexis News content via Newstex  - a fact that we have not welcomed at all and wish to register our displeasure.\r\n \r\nI attached 3 examples to illustrate why they add no value\r\n \r\nTypically they pique our interest but there\'s absolutely no content as the functionality appearing on Twitter itself (ie links) has been stripped out. The German tweet appearing in an All English Language news file is also laughable.\r\n \r\nIs there any way of removing them completely from our news searches filtering them out by content type? \r\n \r\nIt\'s genuinely having a negative impact of the amount of rubbish our BD Research team have to wade through on Nexis (wasting time and causing immense frustration). We\'re also worried that this inclusion could potentially overload the amount of results retrieved (hitting the upper limit of results retrieved) if you continue adding more of the Twitter feeds.\r\n \r\nYour content strategy hasn\'t been thought through on this one as there may be good content out there on Twitter, it\'s just the Newstex hasn\'t provided it by any stretch of the imagination as there\'s no discernible thought on content purpose and audience.\r\n \r\nKathy\r\n \r\n \r\nKathy Jacob\r\nHead of Information Services\r\nPinsent Masons LLP\r\n\r\nDDI +44 (0) 20 7418 7089 \r\nMobile +44 (0) 7917 242 994\r\nInternal Ext - 817089\r\nwww.pinsentmasons.com\r\n',NULL,NULL,59,9,'FYI..I have already passed this to the UK content team who are forwarding this to Jonathan Hoy who owns our relationship with NewsTex \r\n\r\nPM 24.05.11 DC has forwarded to Robyn Mason at the request of S Greenhill.','',NULL,'',NULL,NULL,'','',281,1321,'2011-05-06 08:21:37',1921,'2011-12-05 15:20:24',72,51,0,'TBC','','N'),(3352,'BLANK','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Mr Patrick Martensson, Managing Director',0,4,NULL,47,'The below comments were noted in August 2010 however, I just wanted to make sure they were logged.\r\n\r\n  He likes the magazine he gets from PLC \r\n  He thinks PSL is aimed more at Law firms \r\n  His priority is not legislation or cases but keeping up to date (as he uses our Butterworths Company Law Handbook) and PLC provide him with updates. \r\n  It\'s cheaper than PSL and gives him access to other information. E.g. Financial services, Share options \r\n',NULL,NULL,12,0,'CMelvin - 20.05.11 - There was a comment on this one about extra financial services update and share option updates - White NX is your logger for a firm called IPR industries this is an area we\'ve been looking for more feedback on - could you tell us who that is so we can speak to them?\r\n\r\nDC - 12.05.11 - Email Nina for contact details and advised to contact Claire','',NULL,'IPR Industries',NULL,NULL,'LexisPSL Commercial','',51,1311,'2011-05-06 15:05:59',52,'2011-05-09 09:23:24',3,271,NULL,NULL,NULL,'N'),(3362,'BLANK','Customer training session',NULL,9074,NULL,NULL,'','Partner',0,4,NULL,47,'Andrew Morris, the key contact and partner in Okells solicitors in Ross on Wye had some interesting insights into PSL in comparison to PLC. This is nothing new but backs up with a few specifics some of the things we hear clients say about us v\'s PLC. They are PSL subscribers - Andrew uses the Property and Wills practice areas (I\'ve logged this as wills but it applies to porperty too).\r\n\r\nRecently, Andrew has had a trial of PLC and so (completely unprompted) gave me his thoughts - I wrote down some of his comments.\r\n\r\nFirstly he said they have more know-how (it\'s more detailed), it\'s more intuitive to find what you want (although he does like our word-wheels) and is written more from a practitioners point of view - it\'s what practitioners want to answer questions and obtain documents.\r\n\r\ne.g PLC have a simple guide a solicitor can give to a client called \'what to do when someone dies\'; they have a comparison table of the taxation differences between the different types of common trust\' - it\'s these type of \'how to\', practical guides which give PLC it\'s strength.\r\n\r\nHe felt PLC were in touch with what a busy practitioner wants - PSL is good (he does like it), but it\'s not quite on the mark. He appreciates we have the linking into the deeper content - and that\'s somewhere that we win over plc  especially for legislation, but in his areas, the more detailed practice guides and the type of docs he\'s mentioned above are far more important.\r\n\r\nHe feels PLC\'s short lease of a shop is now a \'standard\' document which is widely used, known by many solicitors which makes drafting and analysing the document when it\'s forwarded by another solicitor much quicker than it used to be.\r\n\r\nHe also mentioned the auto-updating of cross ref\'s in PLC precedents as a major help in speeding up drafting time',NULL,NULL,56,0,'PM 10.05.11 Possibly Malcolm Skinner (Wills and Probate). Awaiting DC\r\nPM 24.05.11 Delegated to Malcolm Skinner\r\nMS 25/05/11\r\nOne issue that has come up is that some people say that PLC is more detailed while others say it is too detailed and the PN length puts them off. They actually have fewer PNs than Private Client and many of theirs are repeated.\r\nHe makes a valid point about guides or checklists. This is something that we are working on. Given the size of the firm it is obvious that they require a lot more client orientated information. The question of matching specific sectors to specific products rather than one size fits all is an issue that is being discussed but no early decision on how to do this is likely.\r\nWe need more specifics on the auto updating point to clarify where we fail.\r\n\r\nDavid Smith 25.05.11 (in response to Malcolm\'s update)\r\nInsight 3362 - auto-updating of precedents is a well known issue and I\'ve reported many times before - it essentially means cross refs in a precedent are linked by word cross refs so if someone deletes a clause, the cross refs can be auto-updated - as per the tables of contents in bug precedents. John Hanratty is putting together a similar proposal for ALL put precedents. This insight was really about psl property in particular!\r\n','',NULL,'',NULL,NULL,'lexispsl','',91,65,'2011-05-09 17:09:34',1921,'2011-05-26 13:25:21',4,2622,NULL,NULL,NULL,'N'),(3372,'BLANK','Customer training session',NULL,9074,NULL,NULL,'','Partner',0,24,NULL,NULL,'This is about SMART-Forms and specifically the IHT400 integrated (and I guess other) forms.\r\n\r\nThey have Smart-forms and Andrew Morris the main contact and partner here went through tryign to complete an IHT 400 to confirm some of the field (name etc) populated down the form on selected schedules. He discovered that they did - which he thought was useful.\r\n\r\nOne of the things he found very frustrating was the fact that for the date boxes and postcode boxes, the various part of the date and postcode are SINGLE fields and so to enter a postcode or date, you need to enter one digit, then to move to the next next, click tab (or mouse click to the next box), enter the next digit, tab etc etc. he found this tiresome that it didn\'t automatically jump to the next box and made it unwieldy to enter info into these fields.\r\n\r\ni have already reported this to Rob Evans and Tim Wakefield - this is just a log.',NULL,NULL,56,3,'Update Tim Wakefield 16.05.11\r\nIn reponse to this feedback, the LexisSmart Forms team have developed \'auto-tab\' functionality such that users will not have to tab between single fields on the IHT 400 Forms. This feature will be rolled out incrementally across affected fields on the  IHT integrated form over the next couple of weeks. David Smith has been informed. ','',NULL,'',NULL,NULL,'','laserform',341,65,'2011-05-09 17:23:24',1921,'2011-05-16 10:11:43',7,151,NULL,NULL,NULL,'N'),(3382,'BLANK','Other',NULL,NULL,NULL,NULL,'','Director',0,111,NULL,NULL,'Linex Legal is increasingly making noises in the market place regarding their newly launched current alert monitoring and news solution, which competes with Ozmosys. The director of their business Matthew Dickinson said their commercial offering allows clients to sign up to the service on a month by month basis. i.e. no minimum 12 month agreement.',NULL,NULL,0,5,'PM 24.05.11 DC has forwarded to Robyn Mason at the request of S Greenhill.','',NULL,'Linex Legal',NULL,NULL,'','Linex Legal',51,1321,'2011-05-10 07:56:28',1921,'2011-05-11 16:09:23',3,51,NULL,NULL,NULL,'N'),(3392,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Partner',1,4,NULL,NULL,'Looking at the Contract for Sale in precedents section, David asked whether these forms are acceptable under the CQS (conveyancing Quality Scheme).\r\nApparently since 2011 it is possible to become an accredited firm for CQS - which requires adherence to certain standard precedents',NULL,NULL,49,3,'As a \'bolt-on\' to the basic LexisPSL subscription customers can now add a specific Smartforms menu that includes all of the Law Soc protocol forms, plus the standard conditions of sale (5th edn).  That is what they need for Law Soc conveyancing scheme purposes.','',NULL,'Hart Brown',NULL,NULL,'Property PSL','',0,72,'2011-05-10 16:13:47',1921,'2011-09-02 15:52:08',72,201,0,NULL,NULL,'N'),(3402,'BLANK','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Brian Hall',0,4,NULL,47,'0Insight 3332 provides comments from initial conversation between Brian and Mark Francis.  This insight arises out of a follow up conversation between brian and Janna Purdie.  \r\n\r\nFollowing a discussion during which Brian was shown how the product worked and the contents we then considered more specific information that as an in house lawyer he would expect to see.  His views were that he required basic insolvency information.  Janna acknowledged this and advised that it was in the DR business plan for 2011 and would be added in at the end of the year or early next year.  He also required the following:\r\nA. Charging Order precedents \r\nB. Additional precedents for statements of case in relation to the following:\r\n\r\n1. sale of goods\r\n2. Fitness for purpose\r\n3. Satisfactory quality\r\n4. Misdescription of goods\r\n5. Misrepresentation\r\n6. Failure to provide goods corresponding to a the sample provided\r\n7. A basis debt action claim\r\n\r\nWay forward:  Janna Purdie is working through the request to see what can be added.\r\nSo far we have added charging order and third party debt precedents.  Attachement of earnings precedents will be added later this week.  These three sets out precedents provide a boost to the number available in relation to enforcement.  Requests have been made for a 2 debt action precedents and precedents addressing fitness for purpose and satisfactory quality as well. \r\n\r\n\r\nJanna is updating Mark Francis on progress as this is his customer\r\n',NULL,NULL,4,6,'Update 25.05.11 Janna Purdie:\r\nIn relation to insight 3402 this has now been completed with 42 new precedents having been added to the DR product in response to comments from the customer.\r\n\r\n','',NULL,'Mercedes',NULL,NULL,'DR','',31,1531,'2011-05-11 14:12:49',1921,'2011-05-25 08:11:11',7,1531,NULL,NULL,NULL,'N'),(3412,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,4,533,NULL,'Customer felt there was a significant lack of depth in Education content on PSL Local Government. Suggested additional areas to cover:\r\n\r\n1. Categories of Schools\r\n2. Admissions\r\n3. Exclusions\r\n4. Setting up a School\r\n5. Failing Schools',NULL,NULL,23,6,'PSL LG covers 2. Admissions, but will investigate.  Also researching expansion of education content, but not likely to be completed until Q3/Q4 2011.  Is there a need for me to contact the customer or just update them when the content is available?','',NULL,'Croydon Council',NULL,NULL,'','',0,1881,'2011-05-12 08:56:12',1921,'2011-09-07 09:45:19',72,351,0,NULL,NULL,'N'),(3422,'BLANK','Customer training session',NULL,7160,NULL,NULL,'','Solicitor',0,4,NULL,NULL,'When out training today a solicitor had been having difficulty finding a Deed of Variation for an existing partnership in Lexis Library. With my assistance we found one but she wanted to know whether it would have been easier for her to locate one in LexisPSL Corporate. After searching it was apparent that such a precedent is not currently contained within that module. She feels that this would be a very useful addition.',NULL,NULL,19,3,'Update 13.05.11 Eleanor Baxter:\r\nI think a deed of variation precedent would be a useful document to have in LexisPSL Corporate.  However, we wouldn\'t propose that it\'s specific only to the partnerships subtopic because it would be suitable for use in a number of areas.  We would instead add this to a new subtopic containing other documents that apply across several areas.\r\nI will add this to the list of documents and we will aim to put this into Corporate within the next couple of months.\r\nThanks for highlighting the query.\r\n\r\nKind regards\r\n\r\nEleanor Baxter\r\nLexisPSL Corporate\r\n\r\n','',NULL,'',NULL,NULL,'','',0,2461,'2011-05-12 17:21:54',211,'2011-05-16 10:48:35',7,211,NULL,NULL,NULL,'N'),(3432,'BLANK','Customer training session',NULL,7160,NULL,NULL,'','Solicitor',0,1,NULL,NULL,'The delegate had been searching for a standard sports person/footballer contract and after extensive searching it would appear that we have nothing of this vein on LL. The only similar thing in EF&P was a \"self-employed player contract (limited company)\" which was not correct. When running a search in the title field of the Forms & Precedents page the word wheel suggested \"Standard Basketball Player Contract\" however when running a search on that no documents were found. Nor where they if searching using the search terms box. This would appear to be a content issue.\r\n\r\nA standard sports person contract that can be adapted to different professions would be a useful addition.',NULL,NULL,59,3,'13/5/2011 (LR) - Forwarding this to Robert Walker in EF&P for consideration\r\n\r\n13/05/11 (Robert Walker)\r\nHi Lisa,\r\nThank you for the suggestion regarding an additional contract. This is something I can discuss further with the contributor.\r\nWe have recently reissued the Sports volume and the Standard Basketball contract is no longer included. This was a third party form rather than one of own precedents. I suspect the information used on the Word Wheel is in need of updating to reflect this and will speak with the department concerned.','',NULL,'',NULL,NULL,'','',0,2461,'2011-05-12 17:27:46',1921,'2011-05-19 09:05:30',7,61,NULL,NULL,NULL,'N'),(3442,'BLANK','Customer training session',NULL,585,NULL,NULL,'','Family Partner',0,1,NULL,39,'(copy of e-mail that went to Katie Green/Geraldine Morris/Jonathan Scriven):\r\n\r\nJust thought I\'d mention something I thought of Thursday when with the family team at Anthony Clark & Co in Lincoln. Massive family team by the way Geraldine - good one for you to meet. Do a lot of work across the board, and have a HUGE caseload!\r\n\r\nWe were having trouble finding something for one of the family partners (Wendy Stevens) and when I asked her how she would have found it prior to having Lexis Library and PSL for family she said she would have gone to the index of Family Law Reports to see relevant recent caselaw.\r\n\r\n2 things dawned on me:\r\n\r\n1. We don\'t have FLR index on the Lexis Library 2. We don\'t (unless I\'m missing a trick) have an online index for Family Court Reports.\r\n\r\nThe online index in the Industrial Relations Law Reports makes them really easy to use so you get the full benefit of how good they are.\r\n\r\nCould this be an option to help highlight even further how fab the FCR are and to use? (Especially in light of possibly losing access to FLR).\r\n\r\nHope this makes sense, will log it as an insight as well.\r\n\r\nHappy Thursday!\r\nG :o) \r\n\r\nPS found a work around for Wendy, but index would have been better...\r\n',NULL,NULL,28,1,'13.05.11 (LR) Forwarding to Hemali Patel in the Cases team for consideration\r\n\r\n16.05.11 Hemali Patel:\r\nThanks for this - we have a meeting about Family coverage this week and I am more than happy to put this forward this as a possible enhancement for the reports going forwards. CC-ing in Katie, the Editor of the FCRs.\r\n\r\n16.05.11 Additional comments from Katie Green\r\nThanks for your email - it\'s useful for Case Reports to get feedback on customers\' use of indexes, so much appreciated.\r\nYou\'re not missing a trick; there is an FCR hard copy index covering the period 1987-1998 (ISBN 0-754-50339-9), but nothing later and currently nothing online.\r\nCreating an FCR index going forward/a cumulative index is obviously a major undertaking resource-wise, but I will discuss this with my manager.\r\nPlease do let me know if you have any further feedback on this or anything else which is cases-related!\r\n\r\nCM 20.05.11 - This one was about a customer who couldn\'t easily find recent family cases.and the discussion in your tracker talks about maybe putting the Family law Reports index online. You can set up a personal alert for all new family cases (including sub areas of family) or you can search by topic (and date - any period you like, from or before a specific date) on the current awareness search screen and see all the latest cases in a given practice area. This is better than waiting for the law report seriesas the law reports are up to a month behind the next day digests our cases team do - if this firm - Anthony Clark & Co wants any help with this we can give it.','',NULL,'',NULL,NULL,'Library Family','',31,66,'2011-05-13 07:41:07',52,'2011-05-16 10:55:36',7,271,NULL,NULL,NULL,'N'),(3452,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Assistant GC',1,4,NULL,47,'In the process of meeting with Marathon Oil and running a demo of LexisPSL, they asked if we had anything on ENVIROCO.  When we looked we had some case material but nothing else.\r\n\r\nWhen they had looked on PLC, they had a draft note, precedent and a practical guidance solution on the topic.\r\n\r\nIf you need any further detail, please let me know.\r\n\r\nRonen',NULL,NULL,12,6,'','',NULL,'Marathon Oil',NULL,NULL,'PSLC14','',31,1361,'2011-05-13 13:33:21',1921,'2011-09-02 09:23:58',72,2612,0,NULL,NULL,'N'),(3462,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'Are there any plans to include  Smartforms RP EXEC1 within PLS Private Client or Wills & Probate Smartforms and Precedents \r\n',NULL,NULL,47,3,'PM - Delegated to Malcolm Skinner 25.05.11','',NULL,'Furley Page',NULL,NULL,'','',0,72,'2011-05-13 15:23:26',1921,'2011-09-14 08:18:27',82,2622,0,NULL,NULL,'N'),(3472,'BLANK','Other',NULL,NULL,NULL,NULL,'','',0,4,NULL,NULL,'From an e-mail I sent to Trainers on Friday 13th May 2011, after renewals of PSL were highlighted as a problem. Nicola Howard asked me to add it to Insight Tracker.\r\n\r\nWe need a prominent link to PSL from the LexisLibrary home page as the main problem with usage  is that many people don\'t know it exists and if they do know about PSL they simply don\'t know where/how to find it. \r\n\r\nIt\'s really not rocket science, we just need to make our content much more accessible, if people can find PSL they are more likely to use it. We have so much content that this in many instances works against us.  We have to take extra care to direct customers to what they really need. Netbos did this very well which is why people still on occasion refer back to it.\r\n\r\nIf customers have not had training on LexisLibrary they won\'t find PSL as the links are currently hidden away in the practice areas pages and even these pages are mostly unknown until training takes place. Individuals won\'t necessarily know the PSL address either;  our contact may not have passed the link along to colleagues, or the e-mail with the access details remains unopened and unread as it is just not a priority for that person.\r\n\r\nWe used to have this problem with Tax. One customer was threatening to not re-new Tax Partner as he did not know how to find it. So I was concerned to have clear links from the first page of the new Tolley Library into other LN tax products. We have this now and it is also helping generate leads for me.\r\n\r\nAt Druces I persuaded the contact to add the PSL links to their intranet so this is one possible approach if they have an intranet.\r\n\r\nHave a good weekend.\r\n\r\nKind Regards\r\nMary\r\n',NULL,NULL,0,6,'16.05.11 - Clare Duggan has advised this should be asssigned to Lisa Regan\r\n\r\n24.05.2011 (Lisa Regan) - When you log onto LexisLibrary there is a huge advertisement tor LexisPSL on the log-in page. Similarly, we do include links to LexisPSL on the practice area pages.  I have been hearing this feedback quite a bit from the trainers so I am going to validate it with customers and run it past the PD team.  There are already a lot of links on the top right of the LexisLibrary page so I don\'t want it unecessarily clutter the page but if it does promote LexisPsl then it is a benefit.  I will get this enhancement sized and potentially added to the development queue.','',NULL,'',NULL,NULL,'','',0,75,'2011-05-13 16:44:35',1921,'2011-05-24 09:39:39',7,61,NULL,NULL,NULL,'N'),(3482,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Solicitor',0,1,NULL,NULL,'A link to PSL should be added to the home page of LL - along the top with the other links so that it stays there all the time.  Otherwise people forget that they need to go to PA or to the general page',NULL,NULL,59,9,'Update (16.05.11):\r\nThank you for your feedback, as LexisPSL is a more topic driven service, the Prod development team agreed that it was more suitable to have links to LexisPSL at the corresponding topic/practice area page and that is currently where you can find the links on LexisLibrary.\r\n\r\nThanks\r\nLisa ','',NULL,'Cornwall Council',NULL,NULL,'','',0,67,'2011-05-15 07:45:09',1921,'2011-05-16 14:10:50',7,61,NULL,NULL,NULL,'N'),(3492,'BLANK','Customer training session',NULL,4370,NULL,NULL,'','Fee earner',0,1,NULL,NULL,'Fee earner loved the legal terms search - requested more terms be added as soon as possible!',NULL,NULL,0,9,'Update 16.05.11:\r\nExcellent news!  Thank you for your feedback, I\'m pleased to inform you that we do have an ongoing project underway to add more legal terms to LexisNavigator. Currently we have approximately 1000 legal terms written by lawyers and we hope to double that during the course of 2011.\r\nRegards\r\nLisa','',NULL,'',NULL,NULL,'','',0,67,'2011-05-15 07:47:04',1921,'2011-05-16 14:11:28',7,61,NULL,NULL,NULL,'N'),(3502,'BLANK','Customer training session',NULL,9008,NULL,NULL,'','Solicitor',0,4,NULL,NULL,'When in the Special Guardianship topic under children the option to view results in Lexis Library in the commentary tab the following message comes up \"Please ensure that you have entered a value between brackets, e.g., unfair dismissal and (teacher or lecturer).\"',NULL,NULL,28,6,'24/5/11: (CD) This looks to be a taxonomy issue which Richard Allison is looking into. We will provide an update as soon as he has analysed this in depth.\r\n\r\n06/06/11: (JM) \r\n\r\nHi Nina, \r\n\r\nFollowing on from the feedback you provided below, this was a taxonomy issue related to how the Butterworths tab is automatically generated from excerpt links in practice notes. \r\n\r\nWe have since decided to remove the Butterworths tab completely from PSL from the end of June/beginning of July as usage of this tab was very low and customer feedback largely favoured access to excerpts within the context of practice notes. \r\n\r\nI hope this helps. If you need any further details, please let me know. \r\n\r\nKind regards,\r\nJen','',NULL,'',NULL,NULL,'','',0,2461,'2011-05-16 15:34:02',1921,'2011-06-08 09:35:36',7,59,NULL,NULL,NULL,'N'),(3512,'BLANK','Customer training session',NULL,1760,NULL,NULL,'','Main contact',0,4,NULL,NULL,'Hi\r\nI was at Brethertons in Banbury and Rugby yesterday and last Thursday talking to PI experts. \r\nCurrently they have PI content in the Lexis Library. They find quantum frustrating and unhelpful. Torquil MaCleod at Rugby liked the look of PI PSL in terms of quantum, but they will be driven by costs.\r\nAlso showed PI PSL to 2 new starters: Richard Dawson and his daughter Sarah Dawson at Banbury. They liked PSL for the format of quantum, but said:\r\n\"Does it have Facts and Figures?\"\r\nThis is a Sweet and Maxwell publication I have heard mention of before at Hodgkinsons Solicitors in Skegness as they love it too.I understand we may be putting equivalent data into PI PSL.\r\nI have fed these commenst through in the past to PI PSL experts at Lexis and would like to add this comment from Sarah and Richard at Brethertons as it could help to persuade Brethertons to buy. They have little extra money in the budget, but if they could cancel anything else such as the Facts and Figures book, Jason Bastock (main contact) said it makes it a much more real option for them. They are not at all prepared to cancel Kemp as they don\'t have the confidence completely in other sources yet, but if they were to buy PI PSL and start using it, then this may change...\r\nRichard Dawson had his own business for many years (and I think worked at Withy King more recently?) and has a reputation as an excellent spinal injuries specialist. He\'s very approachable and I suspect could be a good contact for us to be aware of to help us.  \r\nHope this is of interest\r\nG ',NULL,NULL,44,9,'Update K Osullivan 18.05.11:\r\nThanks for this very useful feedback. In answer to your 2 queries I can confirm:\r\n1. Quantum: We are very aware that our quantum database needs to compete with Kemp. To this end we have launched our online submission process (accessed from the PSL toolbox) and there is a marketing campaign due for release in the next few weeks. Our aim is to substantially increase the number of quantum cases in the database. This will help us to compete with Kemp because our database will have a much greater selection of recent quantum cases than their database. We are also only accepting court settlements (as opposed to negotiated settlements between the parties) unless the quantum case relates to an unusual injury or a clinical negligence claim (both of which we struggle to obtain quantum reports on because they tend to settle before getting to court). Kemp use lots of out of court settlements in their quantum database which we don\'t consider to be of much use if you are arguing quantum before a judge. It is anticipated the number of cases in the database should substantially increase over the next 6 months\r\n2. Facts and figures book - I am pleased to confirm we are enhancing the toolbox at the end of June and including a \'rates and figures\' section. This will link to division XIV -Division XIV Butterworths Personal Injury Damages Statistics August 2010. This contains virtually the same information as the facts and figures book and should ensure customers do not need to subscribe to the Sweet and Maxwell book.\r\nMany thanks Karen O\'Sullivan - PSL lawyer personal injury. 18 May 2011','',NULL,'',NULL,NULL,'PSL PI','Kemp',101,66,'2011-05-17 09:19:32',1921,'2011-05-18 14:54:50',7,371,NULL,NULL,NULL,'N'),(3522,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Legal Counsel',1,4,NULL,47,'The client was keen to find a \'Parent Company\' guarantee as something they regularly used.  In the course of the demo we could not find this and they were a little concerned.  Haveing spoken with one of the PSL\'s, it turns out we do have this, but it is titled as \'Guarantee\'.\r\n\r\nI fed this back to the client, but feel we need to make these things easier for them to find and more intuitive.  If not, we run the risk they feel we lack content, purely down to the fact they cant find it.',NULL,NULL,61,3,'','',NULL,'AMTrust',NULL,NULL,'LexisPSL In-House','',131,1361,'2011-05-17 10:38:35',1921,'2011-09-20 12:43:45',72,591,0,NULL,NULL,'N'),(3532,'PRODUCT','Customer training session',NULL,5483,NULL,NULL,'','Solicitor',1,1,NULL,NULL,'During a recent session the delegates were very keen that the Family Law Journal should have an index added. They said that they wouldn\'t read the journal everymonth and so if they were looking for articles on a particular subject matter they would, instead of running a search, prefer to be able to look through an index. \r\n\r\nAlternatively, or as well, they would like the contents page of each issue of the journal to be able to ve viewed as this would be another way of them being able to quickly identify whether or not the issue had anything of interest without having to run a search on it.',NULL,NULL,28,9,'Lisa Regan 23.05.11\r\nForwarding this query to Alan Blanchard as it concerns the online version of the FLJournal (FYI -this is a Jordans title)\r\nAlan Blanchard 01.06.11\r\nThis should go to Hemali Patel, who looks after the third party journals content and will be able to advise if an index can be added.\r\n\r\nCMelvin - 20.05.11 We run the journals index which is exactly what this person wanted(we think though we wouldn\'t mind checking directly with them if we could get a contact in case they needed something a bit different).you can set up to get alerted on articles in any of our online journals and 500 others based on topic so you just find out what articles you need to read. You can also search online by topic and title on a special search form did no one tell them about this?\r\n\r\nDC - 12.07.11 Contacted Nina for contact details and advised to contact Claire directly','',NULL,'',NULL,NULL,'','',452,2461,'2011-05-19 16:37:14',1921,'2011-11-22 15:55:59',72,271,0,'TBC','','N'),(3542,'BLANK','Customer training session',NULL,5483,NULL,NULL,'','Solicitor',0,1,NULL,NULL,'Delegates have suggested that it would be very useful to have a symbol on the results list next to each case to denote whether or not the case is still good law. They find it frustrating that they have to go into each case individually to find this information.',NULL,NULL,0,1,'Lisa Regan, 24/05/2011: That is very interesting feedback and something I will channel into the development cycle for redesigning results pages this year','',NULL,'',NULL,NULL,'','',0,2461,'2011-05-19 16:38:49',1921,'2011-05-25 15:59:24',7,61,NULL,NULL,NULL,'N'),(3552,'BLANK','Customer training session',NULL,5483,NULL,NULL,'','Solicitor',0,1,NULL,NULL,'Delegates do not like the fact that although you can download a clean precedent from EF&P that the clean version still contains references (they would appear to be paragraph numbers e.g. [950]) They find it time consuming to have to take them out manually and as they are not as obvious as other annotations can sometimes be left in which means re-editing.',NULL,NULL,0,3,'EF&P response: Thank you for your feedback. The paragraph numbers ([950] etc) must be in the tables of contents we sometimes include at the beginning of long precedents as numbers in the main body of the precedent are automatically removed on downloading. We have been phasing the numbers out of the contents so hopefully before long we won\'t have any left. We will continue to work on this.\r\n\r\nPM 25.05.11. Update sent to Nina Packman notifying of the above comment.','',NULL,'',NULL,NULL,'','',0,2461,'2011-05-19 16:41:53',1921,'2011-05-26 13:56:16',7,61,NULL,NULL,NULL,'N'),(3562,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Tax Manager',0,1,NULL,NULL,'The search engine on the new tolley library lists results by relevance by default and then it allows clients to tick a box to order the results be date. The client asked why the main search box hasnt got that option available as tick boxes so that you can choose if you would like to have results ordered by date or perhaps relevance before you click the search button. This is particularly relevant when a client is searching for legislation and wants to see the most up to date results.',NULL,NULL,53,2,'LISA REGAN, 24/05/2011: Forwarding this query to Daniel Arrowsmith/Chris Boulter, who should be your lead for Tolley Library product questions\r\n\r\nDC - DA has already dealt with this','',NULL,'lubbock Fine',NULL,NULL,'Tolley Library','',0,1211,'2011-05-20 10:31:48',52,'2011-07-11 10:11:25',7,2632,NULL,NULL,NULL,'N'),(3572,'BLANK','Customer training session',NULL,5483,NULL,NULL,'','Solicitor',0,1,NULL,47,'Feedback from the delegates was that they find PLC easier to use but that their precedents are a bit too complicated - useful if you\'re selling a multi-national but not if you\'re selling the local cornershop. They believe that our precedents are better in this respect as they cover a much larger type of content and level of complexity. They feel that PLC is mcuh more tailored towards London firms rather than the provinces.',NULL,NULL,10,3,'LISA REGAN 23/05/2011: That\'s good news! I\'ll pass it on to the LExisPSL product manager  - Clare Duggan','',NULL,'',NULL,NULL,'','',0,2461,'2011-05-20 15:27:52',1921,'2011-05-24 09:43:52',7,61,NULL,NULL,NULL,'N'),(3582,'BLANK','Customer training session',NULL,692,NULL,NULL,'','Commercial Lawyer',0,4,NULL,47,'Hi Guys\r\nJust had the below e-mail from Christine Simkin - the lady who will decide if Arnold Thomson take the trial of PSL Property and Private Client to a sale and ditch PLC, she feels PLC is still indispensible:\r\n\r\nFrom: Chris Simkins [mailto:chris@arnoldthomson.com] \r\nSent: 20 May 2011 16:56\r\nTo: Allan, Gavin (LNG-HBE)\r\nSubject: RE: Lexis PSL/Library\r\n\r\nHi Gavin,\r\n\r\nI will contact you next week to discuss but my initial comments are :\r\n\r\n1. No price schedule in the call option still. I need to draft this next Tuesday.\r\n2. No power of attorney for trustee that I could see - have used PLC precedent.\r\n3. No deed of appointment of trustee- will use PLC precedent if need be as need to draft on Wednesday.\r\n\r\nWill phone you Tuesday if that is convenient to you-I have no appointments from lunchtime onwards.\r\n',NULL,NULL,10,0,'PM - Update added by Malcolm Dowden below:\r\nPrice schedules added to precedents landing page for LexisPSL property\r\nNew precedent created (option, fixed price plus indexation)','',NULL,'',NULL,NULL,'PSL Prop and Private Client','',31,66,'2011-05-20 16:14:22',1921,'2011-06-03 12:57:45',7,201,NULL,NULL,NULL,'N'),(3592,'BLANK','Renewal or new business conversation',NULL,11998,NULL,NULL,'','Library Partner',0,4,NULL,47,'PLC have a way of getting CPD througjh their \"Update Programme\".  Will we be having something similar in PSL?  I have marked this as corporate as a corporate lawyer gave the feedback.\r\n\r\nAlso, the same person mentioned that they find PLC\'s content on Partnerships and LLPs pretty weak.  How does our PSL corporate module compare?',NULL,NULL,19,9,'Update 25.05.11 Eleanor Kelly (Corporate Team)\r\n\r\nPartnerships and limited liability partnerships:\r\n\r\nWe draft and present our know-how materials in LexisPSL Corporate using a clear and practical approach.  We always have our customers in mind and know how important it is for them to be able to find a precedent or guidance note quickly.  We display our content using layered topics and subtopics to assist customers in finding the materials they want without having to trawl through irrelevant documents.\r\n\r\nOur Partnerships topic is divided into 3 distinct subtopics:\r\n\r\n General partnerships\r\n Limited partnerships, and\r\n Limited liability partnerships\r\n\r\nPractical guidance is given in each subtopic covering:\r\n\r\n Formation of the partnership, limited partnership or limited liability partnership\r\n The legal framework and continuing obligations (eg trading disclosure, filings and accounts)\r\n Partnership agreements\r\n Ending the partnership, limited partnership or LLP\r\n\r\nThe General partnerships and Limited partnerships subtopics include precedent partnership agreements, deeds of retirement, deeds of adherence with full drafting notes.\r\nEquivalent precedents for LLPs are due to be added to the LLPs subtopic in the next few days. \r\n\r\nWe also have practical guidance on tax in relation to general partnerships, limited partnerships and limited liability partnerships.\r\n\r\nIn the next couple of months we will be adding information on insolvency to the Partnerships topic.\r\n\r\nCPD points:\r\n\r\nLexisNexis offers online webinars from which users can earn CPD points.  Full Corporate and Commercial webinars programmes are offered (as well as programmes across other practice areas).  A link to the LexisWebinars website, which includes information on upcoming and archived webinars and prices, is included on the bottom right of the LexisPSL Corporate homepage.\r\n\r\nWe hope this information is useful to the customer.  Please let the LexisPSL Corporate team know if you need any further information.\r\n\r\nThe LexisPSL Corporate team\r\n','',NULL,'',NULL,NULL,'','',31,7,'2011-05-24 10:08:47',1921,'2011-05-25 10:11:17',7,211,NULL,NULL,NULL,'N'),(3602,'BLANK','Renewal or new business conversation',NULL,11998,NULL,NULL,'','Library Partner',0,18,NULL,NULL,'Have we thought about classifying our webinars to highlight who the appropriate audience should be (i.e. similar to film classifications).  This would stop highly qualified lawyers watching webinars that cover the basics of a topic (this is something i hear fairly regularly).  We could put a sticker on each webinar saying \"suitable for 0-2 years PQE\" etc.',NULL,NULL,0,9,'','',NULL,'',NULL,NULL,'','',71,7,'2011-05-24 10:16:41',1921,'2011-05-24 16:37:28',3,1851,NULL,NULL,NULL,'N'),(3612,'BLANK','Customer training session',NULL,50463,NULL,NULL,'','Barrister',0,1,NULL,50,'From: Allan, Gavin (LNG-HBE) \r\nTo: Hegarty, Nathan (LNG-HBE); Routledge, Anna (LNG-HBE); Michie, Adam (LNG-LON); Smith, Alex G (LNG-LON) \r\nCc: Greenhill, Stuart (LNG-LON); Dickin, Emma (LNG-LON); Howard, Nicola (LNG-LON) \r\nSent: Thu May 26 12:49:04 2011\r\nSubject: Taking Lexis Content onto i-pads/app\'s/i-phones/e-books - Exchange Chambers (Leeds) \r\nDear All\r\n\r\nI would like to forward some findings from a training session last night at the Leeds branch of Exchange Chambers.\r\n\r\nThere were 4 delegates present including 3 Criminal Barristers, and one lady (Nicola Haigh) representing an employment barrister (Paul Kirtley):\r\n\r\n*Nicholas Johnson - johnson@exchangechambers.co.uk - crime\r\n*Stephen Grattage - grattage@exchangechambers.co.uk - crime\r\nAndrew Petterson - petterson@exchangechambers.co.uk - crime\r\nNicola Haigh - haigh@exchangechambers.co.uk - employment\r\n\r\nIn particular, Stephen and Nicholas are already very technically savvy and keen to see how our online offerings could perform on i-pads/i-phones etc.\r\n\r\nCases:\r\n\r\nHaving shown them some tips on the cases page (connectors and using the \'Summary\' field for topic searching) they loved the searching for cases in Lexis and felt it was more intuitive than in West. They don\'t like the fact West puts an imaginary \'and\' between any two words by default which tends to throw the results out too wide. Anna and I heard a similar comment from their colleagues in the Liverpool branch of Exchange Chambers.\r\n\r\nOk, so step one they\'ve found good case law in Lexis, next step which I am sure you would benefit enormously from is scrutinising in great depth what they like to easily be able to do to documents once found. \r\n\r\nThey are very keen to explore how our cases perform as pdf\'s in i-pads etc and how easily they can save them. They have some very good ideas on information flow from providers such as us/West and the use of that information once in a court room. \r\n\r\nPDF\'s:\r\n\r\nI know we know how important they are, but they really are SUPER IMPORTANT to barristers.  For cases, legislation and text books.\r\n\r\nThey love the fact they can use Westlaw at the moment to download Archbold into pdf onto their i-pads and browse through, easily scrolling through seeing page numbers. It sounds like they are already cross referring Archbold in this way in courts with other Barristers/Judges in Leeds. \r\n\r\nThey showed me Archbold on their i-pad, then we tried to simulate the experience with a Lexis book (Harvey) it simply wasn\'t a good enough experience for them as it wasn\'t as easy to navigate and there are no page numbers present.\r\n\r\nWest have already spoken in depth to Stephen Grattage, but he is open to talking to us as well, as is Nicholas Johnson.\r\n\r\nThey are viewing i-pads as the standard way forward, and spoke as if many other chambers in Leeds already have the same willingness to embrace this technology. I am sure they would be willing to either let us know or for them to approach other contacts/Chambers interested in taking this route on our behalf in Leeds. Maybe a trial could be set up when we are at a point of readiness?\r\n\r\nWe need to increase the profile of our books as once they saw the names of books they could be using from the crime menu (eg Blackstones Criminal Practice) they were pleasantly surprised and would love to be able to cross refer with them on something like an i-pad. They have yet to buy the crime menu on Lexis as they see it as being of limited use, but if we could show how it could perform it would make it a much more viable option for Exchange Chambers, and other chambers as well.\r\n\r\nI hope the above information is of interest and that you will be able to gain a lot from contacting Stephen and Nicholas.\r\n\r\nLet me know if I can help further in anyway.\r\n\r\nBest regards,\r\nGavin\r\n\r\n\r\nGavin Allan\r\nTraining Consultant\r\n\r\n',NULL,NULL,21,4,'LR 26/5/2011 - That is very interesting feedback which I will share with the apllications arm of the product development team.  We might like to talk to these barristers in future if you say they are keen as we are currently investigating the development of some mobile apps and presenting our content better on various mobile devices.','',NULL,'',NULL,NULL,'lexis library','',41,66,'2011-05-26 12:20:07',1921,'2011-06-03 10:09:06',7,61,NULL,NULL,NULL,'N'),(3622,'BLANK','Other',NULL,NULL,NULL,NULL,'','Suzanne Smith',0,4,NULL,47,'Having visited BP Collins with Jonathan Campbell in a bid to win them over from PLC to Lexis PSL, I then followed up with a phonecall to one of the practitioners (Suzanne Smith) in the DR team as to why they would not be switching from PLC to LexisPSL. A detailed email on my conversation has been sent to Jonathan and also to Jon Scriven and Janna Purdie in DR. In essence the problems were:\r\n1. lack of content - we do not include substantice law\r\n2. lack of content - in as much as they wanted to cover other practice areas (such as property lit) in tjhe DR module, which we do not do\r\n3. functionality issues - searching was not easy/productive for them\r\n4. the DR weekly email - not in a user friendly format\r\n\r\nFollowing my email, Janna Purdie advised that the weekly email issue was probably partially due to the fact that, whilst trialling the product, users do not get our bespoke email, which is more user friendly.\r\n\r\nItem 3 appeared to be due, at least in part, to the users not using the product in the best way possible. Both Janna and I have queried whether part of this is due to the training (if any) received by a firm such as BP Collins when trialling the product. It would be useful to know what training they receive.\r\n\r\nThe other items re content have been noted by the DR team as ones which we consider are problem for us.',NULL,NULL,9,6,'PM 01.06.11 Ruth Pratt has advised that this Insight can be closed','',NULL,'BP Collins',NULL,NULL,'','',131,2331,'2011-05-30 11:24:20',1921,'2011-06-01 15:45:59',7,2331,NULL,NULL,NULL,'N'),(3632,'BLANK','Customer training session',NULL,5874,NULL,NULL,'','Chris Livingston/Partner',0,4,NULL,NULL,'Chris had comments on LexisCalculate, specifically the Past Periodic Loss calculator.  He would use this calculator to work out the replacement costs of, for example, a hearing aid, which needs to be replaced at intervals of 5 years.  Currently the Past Periodic Loss calculator doesn\'t allow this kind of calculation.\r\nHis suggestions for improving it are:\r\nTo enable it to also calculate the mortality rates, sex & allow for the entry of the age of the person.  This would enable you to imput their sex, xurrent age, quickly work out mortality rate (without having to go and look in Ogden) and then you would know the number of years/days to then work out the loss against.\r\nTo have frequency rates in yearly intervals rather than year, day, week, month.  He would want it to work out either 3 or 5 year intervals, so a unit cost of a hearing aid is 1250, needs replacing every 5 years.',NULL,NULL,44,9,'Update from Karen O\'Sullivan 06.06.11:\r\nThis is an interesting suggestion and one we will certainly consider when planning our future development of the calculators package. I am currently liaising with the IT engineers who will be building our second suite of calculators and will investigate whether this suggestion can be incorporated into the second suite of calculators which we hope to have online by Q3 2011. Thanks Karen O\'Sullivan PSL lawyer - personal injury team','',NULL,'',NULL,NULL,'','',0,68,'2011-05-31 07:42:51',1921,'2011-06-06 12:52:36',7,371,NULL,NULL,NULL,'N'),(3642,'BLANK','Customer training session',NULL,5874,NULL,NULL,'','Chris Livingstone/Partner',0,4,NULL,NULL,'Chris had comments re the quantum database, as yet he feels it is inferior to Kemp & Kemp and retains a hardcopy of this.  He doesn\'t feel we have enough volume in the database for him to feel he has done a thorough search and has a wide enough spread of results on which to base his claim figure.  He also feels there is no \'happy medium\' when it comes to the values we report - it is either 100,00 or 600 with very few cases in the mid range, so it is extremes of values.\r\nHis example was how difficult it is currently to use our qunatum to find cases where a person has broekn their ankle but has put their hand out as they are falling and subsequently broken their wrist, so you break your ankle and land on wrist so then break your wrist.  We picked ankle and got approx 7 results but the highest value was 101,000 and the lowest was 625, there was only one result for the range he had in mind, which was 14,000, he sdaid if he looked in Kemp he could find 50 or so cases which provides him with the security that he isn\'t missing something.\r\nHe also tried a keyword search for ankle and scaphoid but got no results',NULL,NULL,44,9,'Update Karen OSullivan 06.06.11:\r\nThank you for this insight. We are aware that our quantum offering is not, at the moment, on a par with the quantum offered by Kemp. To address this we have launched an online quantum submission site (which can be accessed by the PSL toolbox). The aim of this online site is to drastically increase the number of quantum cases in our database. We are shortly launching a marketing campaign to generate submissions of quantum cases from solicitors and barristers. It is anticipated that after 6 months we will be in a much better position to compete with Kemp on quantum because:\r\n- the vast majority of our quantum cases will be court settlements which we consider have far more value to practitioners negotiating quantum - rather than out of court settlements which make up a large number of Kemp\'s quantum cases. The only out of court settlements we will be accepting will be those relating to medical negligence or where the injuries sustained are unusual (and therefore there is limited quantum reports on it)\r\n- many of the quantum cases in Kemp are a number of years old. By launching our online submission site we anticipate our quantum database will contain a large number of very recent judgments which should give practitioners confidence that the quantum figures they are relying upon reflect current judicial thinking\r\n- once a significant number of new cases have been added to the quantum database we will undertake a review to identify any areas where we are low on quantum reports. We will then run a specifically targeted marketing campaign to try and locate quantum cases to fill these gaps. Obviously any customer feedback will also be acted upon\r\nHope that helps to answer the customer\'s query and that he will feel confident enough to cancel his Kemp subscription at the end of the year!\r\nKaren O\'Sullivan - PSL lawyer - personal injury','',NULL,'',NULL,NULL,'','',0,68,'2011-05-31 07:48:28',1921,'2011-06-06 12:54:24',7,371,NULL,NULL,NULL,'N'),(3652,'BLANK','Customer training session',NULL,5874,NULL,NULL,'','Colin Simpson/Partner',0,4,NULL,NULL,'Colin had comments re LexisCalculate.  He likes the concept & the calculators we currently have but he feels we are running before we can walk by providing the fancy bits but we have missed the basics.  So, there is an interest on special damages calculator but where is the special damages calculator??  Colin feels that why would he use an interest on special damages calculator if he still has to manually work out the damage in the first place?',NULL,NULL,44,9,'Update from Karen O\'Sullivan 06.06.11:\r\nThis is an obvious suggestion - which i\'m not sure anyone in the team has actually thought about before! I have added the suggestion to our roadmap for future development and will consider it as an addition to the product in due course. Thanks Karen O\'Sullivan - PSL lawyer - personal injury team','',NULL,'',NULL,NULL,'','',0,68,'2011-05-31 07:51:59',1921,'2011-06-06 13:42:52',7,371,NULL,NULL,NULL,'N'),(3662,'BLANK','Customer training session',NULL,5874,NULL,NULL,'','Anna Woolf/Paralegal',0,4,NULL,NULL,'Anna picked Pre-Action as a topic, selected the Cases tab, used the \'can\'t find what you\'re looking for view results in LexisLibrary\' and came up with a no dicuments found message, i assume this link is broken or the search string needs tweaking???',NULL,NULL,44,1,'Update from Karen O\'Sullivan 06.06.11\r\nI have just checked the link and it is working fine for me - I wonder whether there was a glitch in the system at the time you looked at this section of the product. If you continue to have problems then please email me and I will try and resolve the issue for you. Thanks Karen O\'Sullivan - PSL lawyer - personal injury team','',NULL,'',NULL,NULL,'','',0,68,'2011-05-31 07:54:03',1921,'2011-06-06 13:41:06',7,371,NULL,NULL,NULL,'N'),(3672,'BLANK','Renewal or new business conversation',NULL,50071,NULL,NULL,'','Tracey Jones/Chambers Manager',0,1,NULL,40,'In a meeting on 24th May 2011 this customer told me that Justis have advised them that their service will no longer contain access to ICLR: The Law Reports as the licence they have with ICLR is not being renewed.  This will put is in a stronger position when compared with Justis as that content is available on LexisLibrary.  We also have an opportunity to divert their spend on Justis over to LexisNexis',NULL,NULL,0,1,'LISA REGAN 02/06/2011: Thanks for this news-  its very interesting.  I\'ll let the product development and marketing teams know so that we can use this insight to our advantage','',NULL,'',NULL,NULL,'','',91,36,'2011-05-31 11:33:23',1921,'2011-06-03 14:58:28',7,61,NULL,NULL,NULL,'N'),(3682,'BLANK','Informal conversation',NULL,30212,NULL,NULL,'','Shaun Mackintosh / Associate',0,4,NULL,NULL,'Shaun Mackintosh at Blackadders explained that the big four in Scotland, Dundas & Wilson, Maclay Murray & Spens, McGrigors and Shepherd & Wedderburn developed a system for sharing forms and precedents in large commercial property dealings as they frequently where working for opposing parties on a regular basis and it would save them all time. The system was set up in 2001 and is essentially free for all firms interested in Commercial property practice. The joint venture is called \'The Property Standardisation Group\'. The website for this is below:\r\n\r\nhttp://www.psglegal.co.uk/\r\n\r\nAt present we are  developing content for Scottish Precedents or Syles for  but the Property Standardisation group may put larger commercial property firms off paying for a service which they can get free of charge.',NULL,NULL,49,3,'PM 01.06.11 - Update received from Jo Bhatia\r\nMalcolm is away this week. We do not deal with Scottish property law on PSL. However, dealing with the principle itself, whilst we clearly cannot compete on price with a free website, our precedents are drafted on the basis that they should cut down negotiation time and be as commercial as possible. They lean on the firm side of reasonable, with any doubts resolved in favour of the seller / landlord in the usual way (whilst not being totally unreasonable for a buyer / tenant). They should aid any firm who uses them in closing deals as quickly and cost-effectively as possible.\r\n\r\nPM 01.06.11 - Response from Colm Parker:\r\nThanks for the update. I added the content on Insight Tracker as I believe some Scottish precedents and drafting notes are going to be added to PSL at some point. I thought this may help steer what content would potentially be the most beneficial to the market given some content is already available. However, I am still unsure how widely the service is used so it may not pose a great threat.','',NULL,'',NULL,NULL,'The Property Standardisation Group','',71,43,'2011-05-31 12:58:41',1921,'2011-06-01 15:44:37',7,201,NULL,NULL,NULL,'N'),(3692,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Brian Napier QC / Advocate',0,1,NULL,NULL,'Brian Napier QC is an Advocate (Scottish Barrister) for Employment Law and is involved in Employment tribunals. He advised English Barristers regularly travel to Scotland to take part in tribunals for their clients. Frequently English Barristers are under the impression Employment Law is identical in Scotland and therefore make a number of mistakes during the tribunal when representing their clients. Although the law is largely the same there are some key differences. Brian Napier is a contributing author to Harvey and believes it would benefit from having a separate supplement for Barristers practicing law in Scotland which points out the major differences in the Law in Scotland.',NULL,NULL,24,4,'Alan Blanchard 01.06.11\r\nThis needs to go to Helen Green, who is Publisher for Harvey\'s, please.','',NULL,'The Faculty of Advocates (FACU5029)',NULL,NULL,'Harvey on Industrial Relations & Employment Law','',101,43,'2011-05-31 13:17:21',181,'2011-06-01 13:59:17',3,181,NULL,NULL,NULL,'N'),(3702,'PRODUCT','Renewal or new business conversation',NULL,31046,NULL,NULL,'','Lewis McDonald / Solicitor',1,4,530,47,'Customer moved to Lexis PSL in 2009 away from PLC. However they have now put in cancellation request and are returning to PLC. The customers comments are as follows:\r\n\r\nWhilst Lexis Nexis PSL is a useful resource, it does, more often than not, provide only basic coverage of topics which is helpful when it is being used as an \'aide memoire\' but not when it is required to develop further understanding.  PLC, on the other hand, has more in-depth practice notes and engages more fully with the relevant issues within a topic.  There is also a wider variety of styles available and handy tools such as a redundancy calculator and summaries of labour laws in different jurisdictions.\r\n\r\nPSL would therefore benefit from more detailed practice notes with a greater breadth of topics covered and from an increased variety of precedents.  Having said this, the daily/weekly/monthly case law updates were very useful.\r\n',NULL,NULL,24,6,'Melanie Adams (responding on behalf of Philip Thornton and PSL team)(7.6.11). We were very pleased that this customer found our news analysis updates very helpful. We would, however, welcome the opportunity to speak to this customer if possible to obtain some more detailed insight about his feedback. Eg: we are very surprised that he felt that \' more often than not\' our practice notes provide only basic coverage of a topic. Our overviews do that (which makes us wonder if perhaps he only looked at those and there are training issues here) but our practice notes are usually very detailed indeed. It would be interesting to know if he had ever looked at our Equality Act practice notes, for example. So far as we can ascertain, these (and many others on other topics)are more detailed than PLCs. We do not know if this customer also has a Library subscription, but, if so, all our PNs have Further reading links to Harvey for more in depth research, plus links to cases/legislation etc, so his comments on that aspect seem somewhat implausible.\r\n\r\nThe PLC redundancy calculator is, in fact, only a link to a public resource on a government website. We provide the same link from our relevant practice note.\r\n\r\nWe plan to add PNs on employment law in Scotland and Northern Ireland within the next 12 months.\r\n\r\nWe currently have over 320 precedents in PSL and so general comments such as the customer\'s are of limited use to us. It would be good to know which specific precedents the customer would like to see added, please.','',NULL,'',NULL,NULL,'','',31,43,'2011-05-31 13:23:24',1921,'2011-09-02 14:50:04',92,2321,0,NULL,NULL,'N'),(3712,'BLANK','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Catherine McKenna',0,1,NULL,NULL,' The Laws of Scotland only covers Scots Law post-devolution so anything governed by UK law will not also be covered.  Why is this as many of our Scottish clients would deal with both UK law and Scots Law, where it differs from UK law. \r\n\r\n\r\n',NULL,NULL,51,1,'Lisa Regan 02/06/2011:  Please send this query to Simon Hetherington who is the publisher for this title\r\n\r\nPM 07.06.11: Update received from Simon Hetherington (06.06):\r\nThat isn\'t an accurate description, I\'m afraid.\r\nThe Laws of Scotland (Stair Memorial Encyclopaedia), volumes and reissues, deals with the law of Scotland. Its remit is therefore (1) UK law applicable in Scotland, and (2) Scots law. This is true of both pre- and post-devolution law. \r\n\r\nThe encyclopaedia was begun (and the main work was completed) well before devolution.\r\n\r\nI think there is some confusion between the Laws of Scotland, and the legislation which is available on LexisLibrary. The legislation offering does not include pre-devolution UK Acts applicable only in Scotland.\r\n\r\nBut, to repeat, this is not the same as Laws of Scotland. Hopefully that clarifies the position for you.','',NULL,'CR Smith',NULL,NULL,'Scottish Civil Cases','',101,1661,'2011-06-01 15:35:13',1921,'2011-06-07 10:02:49',7,61,NULL,NULL,NULL,'N'),(3722,'BLANK','Renewal or new business conversation',NULL,10504,NULL,NULL,'','',0,4,NULL,NULL,'Deborah Brown (Corporate/Commercial Partner) wants to be able to access drafting notes separately from the precedent, without having to click into the precedent. Ideally would be able to see a list of all drafting notes separately but also alongside the precedents a sparate link to the drafting note. \'I normally have the precedent already. I only want to see the drafting note. It would get on my nerves to go into the precedent to just to see the drafting notes.\'\r\n\r\nI will tell customer that you can find the drafting notes separeately if you full text search (drafting notes) in precedents. Is there another way or would we investigate this please?\r\n\r\nThanks',NULL,NULL,0,0,'3/6/2011 - CD\r\n\r\nHi Cara\r\n\r\nThanks for your feedback from Roythornes below.\r\n\r\nDeborah Brown (Corporate/Commercial Partner) wants to be able to access drafting notes separately from the precedent, without having to click into the precedent. Ideally would be able to see a list of all drafting notes separately but also alongside the precedents a sparate link to the drafting note. \'I normally have the precedent already. I only want to see the drafting note. It would get on my nerves to go into the precedent to just to see the drafting notes.\'\r\n\r\nI will tell customer that you can find the drafting notes separeately if you full text search (drafting notes) in precedents. Is there another way or would we investigate this please?\r\n\r\nI am slightly confused by the insight. It is currently possible to access the drafting notes separately when you run a search for a precedent as they are differentiated on the results page in the precedent title. The customer says she wouldn\'t want to go into the precedent to see the drafting note, but then she also says she would like to see a separate link to the drafting note alongside the precedent. Again, a user has the capability when they click into a precedent, to view their drafting notes from a right-hand column link. \r\n\r\nPlease do let me know if I have misunderstood the feedback here or if you want to pop around to discuss the user requirement further.\r\n\r\nKind regards,\r\n\r\nClare.\r\n\r\n6/6/2011 - followup response to Cara\'s comment (It\'s when browsing Clare - when browsing you cannot go straight into the drafting notes without going into the precedent first (ie additional click - that\'s what bothers her). \r\n \r\n\r\nInterestingso the customer would like the landing pages to have two links for each document that has a drafting note - one for the precedent and one for the drafting note. My main concern here would be the usability given you\'d be doubling the amount of real estate used. If she is very familiar with the precedent, I\'m quite surprised she still requires the drafting notes but she obviously does have a need for them from what you say.\r\n\r\nEither way, we\'ll monitor the feedback to see if there is a common customer need here and will address accordingly.\r\n\r\nMany thanks for passing this on,\r\nClare.\r\n\r\n','',NULL,'',NULL,NULL,'','',41,241,'2011-06-02 10:34:42',1921,'2011-06-06 13:13:24',7,59,NULL,NULL,NULL,'N'),(3732,'BLANK','Customer training session',NULL,5287,NULL,NULL,'','',0,4,NULL,47,'Speed of LexisPSL was incredibly slow at client sites, they have noticed it slowing down recently',NULL,NULL,0,0,'3 June 2011 - CD \r\nHi Lynne\r\n\r\nThanks for your feedback. We are currently undertaking significant investigation into the speed of LexisPSL as we have noticed an unacceptable degradation of the service over recent months. There are a number of different things we are implementing in the late June/early July Release which we are hoping will help address this issue.\r\n\r\nDid your client mention any particular areas of the product which they are finding slow or was it just a generic comment?\r\n\r\nKind regards,\r\n\r\nClare.\r\n','',NULL,'',NULL,NULL,'','',0,68,'2011-06-02 13:30:02',1921,'2011-06-06 13:54:27',7,59,NULL,NULL,NULL,'N'),(3742,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Tony Foster / Head of Tax',0,24,NULL,NULL,'The client highlighted the need to bookmark certain pages while using the online library for quick access to commonly used areas.  Just like you would put sticky labels in a hardcopy book - they were wondering if we have plans to include a kind of quick reference or \"sticky labels\" functionality into the library.  As far as I can see, the current method would be to bookmark the page using their browser which isn\'t ideal - particularly if they use different computers. ',NULL,NULL,59,9,'DC - Hi Sam, I believe you have been emailed about this already by the Tax team, but wanted to close the loop just in case. Basically there is a release scheduled for August which will deliver some of this functionality (bookmarking). In addition to this, the team are also already investigating \'Sticky Notes\'..!\r\n\r\n','',NULL,'Amlin plc',NULL,NULL,'Tolley Library','N/A',341,1371,'2011-06-03 10:02:24',52,'2011-07-11 10:18:49',7,2632,NULL,NULL,NULL,'N'),(3752,'BLANK','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Jo McEachern - Head of Legal',0,4,NULL,NULL,' I  needed precedents for articles of association for a joint venture company with different options - majority/ minority holdings tag along/drag along options but could only find basic articles.\r\n We needed to research implied rights of confidentiality but found nothing useful\r\n We needed precedent notice for termination of a commercial lease (not agricultural) and found nothing useful\r\n I needed practice note on ability of shareholders to pass a ratifying resolution for acts which have already occurred and could find no guidance.\r\n\r\nAs in-house lawyers we face a real variety of problems on a daily basis and to avoid using outside lawyers too often we need a web based service which gives us more depth with practical guidance we felt that LexisNexisPSL did not give us this.\r\n',NULL,NULL,10,6,'Update from Donald Cran\r\nRe #2, the PNs on Confidentiality (in Contracts/Creating contracts) and Trade secrets and goodwill (in IP) both deal with implied confidentiality, and the further reading links give more depth. Don\'t know why the PN on Confidentiality did not appear in the searhc. \r\n\r\nThis subject is rare in practice because for a transaction of any value/importance a non-dislcosure agreement would invariably be used, but I think what we have should give the customer a fair overview. If he needs more detail than we have he needs Library. \r\n\r\nPM: Please also refer to attached in regards to other point raised, Answered by Anne-Marie Claydon/Malcolm Dowden/Cara Annett','1308046504.msg','Insight 3752.msg','The Read Group',NULL,NULL,'','',0,931,'2011-06-06 11:02:19',1921,'2011-07-02 14:57:56',7,221,NULL,NULL,NULL,'N'),(3762,'BLANK','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','mr andy bain ',0,24,NULL,55,'customer has asked why the page cannot be made full screen when he opens up a page on Tolley Library',NULL,NULL,53,4,'','',NULL,'Acumen',NULL,NULL,'tolm39','',341,941,'2011-06-06 16:21:25',52,'2011-07-11 10:43:42',7,2632,NULL,NULL,NULL,'N'),(3772,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','fiona donaldson/partner',0,24,NULL,55,'company have commented on the relevance of the search, along with 250 results being too little, they wish to see more results(3000)  to ensure that they get exactly what they are looking for.  They have also commented on the fact that not all (1 search less than 50%) of the results were relative to the search they conducted.  They have also raised the question of why they can also only do 1 search within the search,as on the LN platform you can drill down as often as required.  They also commented that it would be useful to have a sort by source name which is available on the LN platform but not available on tolley library',NULL,NULL,0,4,'DC - Basically I believe you have already received feedback on this insight, but wanted to loop around with you just in case:\r\n\r\nThe tax team have mentioned that when developing the products, a number of people/ firms etc are always engaged to deliver the best/ most desirable functionality. It was as part of those tests, that the volume of results to display was trimmed down to 250 (could be anything, but user group suggested around 200-300 was the optimum).\r\n\r\nIn terms of the search issues and drill downs, these items are under review.\r\n','',NULL,'springfords llp ',NULL,NULL,'general tax practioner','',291,941,'2011-06-06 16:29:53',2632,'2011-10-14 14:16:04',102,2632,0,NULL,NULL,'N'),(3782,'PRODUCT','Renewal or new business conversation',NULL,8651,NULL,NULL,'','Mark Hill/Commercial Property',1,4,NULL,NULL,'Under Business Tenancies in the Forms tab, every single form that is listed is showing as \'Form not currently available\' Please advise when these will be available? This was not great in a demo situation. Thanks',NULL,NULL,49,3,'This seems to have been part of broader technical issues that also disabled links to drafting notes (producing a message saying that they were not part of the subscription) and links from practice notes to legislation (producing a message saying that key property statutes were not part of the LexisPSL property subscription).  There was no change to the xml documents or landing pages, so the issue appears to be in the technical processes.\r\n\r\nUpdate:  the forms under the Business Tenancies tab (all of which are SmartForms) are now available.','',NULL,'',NULL,NULL,'PSL Property','',101,1441,'2011-06-07 19:06:57',1921,'2011-09-15 13:05:42',72,201,0,NULL,NULL,'N'),(3792,'BLANK','Renewal or new business conversation',NULL,8651,NULL,NULL,'','Helen Pacey/Private Client Lawyer',0,4,NULL,NULL,'In all topics in PSL Private Client the Butterworths tab is still greyed out as content has not been added here. please advise when it will be live. Thanks',NULL,NULL,47,4,'MS - 8/6/11\r\nThe \'Butterworths\' tab will only be active where there is content in a Butterworths publications that is relevant to or usefully expands on PSL content. If the tab is not highlighted it can be assumed that there is either no relevant content (this is particularly true of Mental Health and Elderly Client) or the isues in PSL are covered in sufficient detail to render any further reading/reference superfluous. \r\nThe tab is active in The Law of Trusts and Trust Drafting. If the customer cannot see this it is probably a technical issue rather than a content issue.\r\n\r\nSC 10/6/11\r\nI think that this must be a technical issue then - if you look at the Wills & Probate PSL module, all the Butterworths content is on here for all the topics in here so this should also be there for the same topics in Private Client shouldn\'t it? - please can we make sure that this is dealt with asap? Thanks\r\n\r\nPM 10.06.11\r\nEMail sent to Clare Duggan\r\n\r\n10/6/2011 Clare Duggan \r\nHi all\r\nThis was a technical issue which Martin Stevens has now resolved.\r\nHowever, it is worth mentioning that the Butterworths tab is being removed from the product in the June Release after significant customer feedbacck that 1) users don\'t know what this tab is (some thought it was directions to the office) 2) even  users are shown what\'s in there, the vast majority of them say it is of limited value out of context and prefer to view it from within practice notes.\r\nKind regards,\r\nClare','',NULL,'',NULL,NULL,'Private client','',101,1441,'2011-06-07 19:09:53',1921,'2011-06-15 16:02:08',7,2622,NULL,NULL,NULL,'N'),(3802,'BLANK','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Cathy Blacklock',0,1,NULL,55,'The customer has all this for 2400 plus VAT, has anyone similar renewal quotes from CCH that they can share, please\r\nYour CCH Subscriptions\r\n         Capital Gains Tax Guide \r\n\r\n         Consult CCH Tax Workflow \r\n\r\n         Corporation Tax Guide \r\n\r\n         Income Tax Guide \r\n\r\n         Indirect Tax Guide \r\n\r\n         Inheritance Tax Guide \r\n\r\n         Live News \r\n\r\n         NIC Guide \r\n\r\n         Practical Corporate Tax Manual \r\n\r\n         SDLT Reporter \r\n\r\n         Tax Digest \r\n\r\n         Tax Planning \r\n\r\n         Tax Reporter \r\n\r\n         VAT Reporter \r\n\r\n \r\n\r\n',NULL,NULL,53,4,'21/06/2011 LISA REGAN: This should be directed to the sales lead resp for insight\r\n\r\n22.06.11 Email to DC\r\n22.06.11 Update from DC. Record Closed','',NULL,'Moore Scarrott',NULL,NULL,'TL possibly TOLM82','',51,861,'2011-06-10 10:16:00',1921,'2011-06-22 16:04:02',7,52,NULL,NULL,NULL,'N'),(3812,'BLANK','Customer training session',NULL,5068,NULL,NULL,'','Jean Minty',0,4,NULL,47,'While demo\'ing PSL Private Client I noticed that the link at the top right for \'Lexis Library\' takes you down to the Search/Home page rather than the Private Client PAP, unlike any other PSL module. \r\n\r\nCould this be changed to give a consistent experience for PSL/Library users?\r\n\r\nmany thanks,\r\nGavin\r\n',NULL,NULL,47,6,'Update Clare Duggan 10.06.11\r\n\r\nHi Gavin\r\nThanks for your feedback from Greenwoods Solicitors.\r\nI have spoken to the PSL engineers today and we have managed to squeeze this enhancement in to our next Release which is scheduled for late June/early July.\r\nKind regards,\r\nClare.','',NULL,'',NULL,NULL,'PSL Private Client','',261,66,'2011-06-10 10:25:53',1921,'2011-06-15 15:59:25',7,59,NULL,NULL,NULL,'N'),(3822,'BLANK','Informal conversation',NULL,NULL,NULL,NULL,'','Marianne Barrett-Rogers',0,20,NULL,NULL,'A favourable comment about Tolley Guidance  from one of my customers\r\n \r\n\r\n\'I saw presentation by Chris Jones and Mike Truman for the new service at the CIOT conference and immediately made enquiries to add it to our library.  I used it for the first time recently when I had to write a report for a client who was thinking of incorporating his partnership into a limited company. It was great. Everything was easily to hand and I reckon it took half the time to write the letter that it would have done without Tolley Guidance\'.\r\n\r\n \r\n\r\nM.\r\n\r\n \r\n\r\n',NULL,NULL,53,6,'','',NULL,'Barretts',NULL,NULL,'Tolley Guidance OMB','None',0,861,'2011-06-10 12:02:30',52,'2011-07-11 10:13:09',7,2632,NULL,NULL,NULL,'N'),(3832,'BLANK','Customer training session',NULL,13186,NULL,NULL,'','Chris Sexton',0,4,NULL,NULL,'This comment came out of the feedback e-mail following a training session - and something i addressed during the session with the client:\r\n\r\nPost-Training NPS Verbatim Comments:\r\nThe link to the service given the in the introductory e-mail was incorrect and I was unable to access it. Once the training had taken place I was able to acess the service and make full use of it. \r\n\r\nBasically we\'d sent a user ID with links to Library, Tax and tax news and the client has PSL only!!!\r\n\r\nNo wonder they weren\'t using it.\r\n',NULL,NULL,0,0,'Email sent to DC','',NULL,'',NULL,NULL,'','',261,65,'2011-06-14 07:28:04',1921,'2011-06-14 09:41:02',2,0,NULL,NULL,NULL,'N'),(3842,'BLANK','Renewal or new business conversation',NULL,8651,NULL,NULL,'','Mark Hill/ Property Lawyer',0,4,NULL,47,'The Short Form Lease - Retail Premises in Business Tenancies displays incorrectly leaving the user to feel that there is not the content in there that should be. If you scroll down you can see the whole document but only if you know it is there. Am assuming that this is PAM? Please can we fix asap? the download into Word works fine and the layout is not affected in teh download. Thanks',NULL,NULL,49,3,'This is a recurring issue.  Investigation by the technical team has not identified any problem with the xml document, which is the only element of the process we can control.  I\'ve reported the recurrence.','',NULL,'',NULL,NULL,'LEXIS PSL PROPERTY','',321,1441,'2011-06-14 20:10:14',201,'2011-10-14 16:45:21',72,201,0,NULL,NULL,'N'),(3852,'BLANK','Renewal or new business conversation',NULL,8651,NULL,NULL,'','Sheila Tyers & Julie Webb/ Propert dept Support Staff',0,24,NULL,NULL,'Hi - have already emailed Rob Evans regarding this, but this is a sales barrier that needs to be logged here and resolved asap:\r\n\r\nHi Rob\r\n\r\nJust trying to entice Mossop and Bowser away from Oyez and they have stated that thet will not move to any other provider for forms until the following at least are populated with local authority drop down details\r\n\r\nLLC1 and Con29 and all the AP forms and FR forms \r\n\r\nAlso they have raised the issue that they need the forms to be able to be saved as templates with their own details already populated.\r\n\r\nI know both of these are on the radar, but can you tell me when? Without these 2 issues being fixed, I cannot sell this product to this customer\r\n',NULL,NULL,49,3,'An audit was undertaken of all Land Registry forms to identify which needed Local Authority drop downs.  These are being added and will be complete within two weeks.  A solution for the own details template is being worked on and should be avaliable within the month.\r\n\r\nRob Evans','',NULL,'',NULL,NULL,'LEXIS SMART FORMS','Oyez',41,1441,'2011-06-14 20:14:56',1921,'2011-07-02 15:44:34',7,151,NULL,NULL,NULL,'N'),(3862,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Anne Pietsch',1,4,NULL,NULL,'Email already sent to Dolly Lundin regarding below:\r\n\r\nThe attendee, Anne Pietsch felt that the content within the legislation tab of the Education topic within the Local Government module of LexisPSL was incorrect as she felt that it was referring to legislation no longer in force.  The section in question was section 508 of the Education Act 1996.  She felt that this information was therefore very misleading.',NULL,NULL,39,2,'According to LexisCheck and the legislation in LL, the section in question is in force.  Customer will be contact by Michelle and/or me for futher investigation. (Emailed Michelle) \r\n\r\n24 June 2011, customer sent an email to Michelle acknowledging that the legislative reference is correct. (Anne Pietsch, City of London)','',NULL,'City Of London Corporation ',NULL,NULL,'','',0,76,'2011-06-15 00:53:33',1921,'2011-08-12 12:27:31',72,351,0,NULL,NULL,'N'),(3872,'BLANK','Customer training session',NULL,13570,NULL,NULL,'','Callum McNeil',0,1,NULL,NULL,'I previously sent an email to Content Support asking them to look into the below information for the client.\r\n\r\ni recently visited Callum of AO Hall to carry out some training and he queried why he could not find a particular law report he was looking for.  I have since been trying to find what was gong on for him and it would \'appear\' that when using the citation search field within the Cases tab on LexisLibrary that if you type in 1972 AC 1027 it will bring up only Casesearch results.  If you type in 1972 A.C 1027 (with a full stop between the A and the C) that it will bring up the actual ICLR results only.  It would make sense to be able to do one search to bring up both the law reports and also the casesearch results but it does not \'appear\' to be currently doing this.',NULL,NULL,0,1,'LR 21.06.11 I suggest looping in Alisdair Steer of the cases team who might be able to explain why this is happening.\r\n Alisdair - any idea why when using the citation search field within the Cases tab on LexisLibrary that if you type in 1972 AC 1027 it will bring up only Casesearch results?  If you type in 1972 A.C 1027 (with a full stop between the A and the C) that it will bring up the actual ICLR results only.  It would make sense to be able to do one search to bring up both the law reports and also the casesearch results but it does not \'appear\' to be currently doing this.\r\nIs there something that needs to be done to the feed?\r\n\r\nAlisdair Steer 21.06.11\r\nIt seems to me that the cites in the ICLR source should not have the full stops in place ( i think that none of the other sources have full stops in the cites, and it goes against our house style).\r\nHowever, I would say the main thing is that when you\'re searching, the search should ignore the full stops, so it shouldn\'t matter whether the user includes them - you should get both hits either way.\r\nI don\'t think it\'s an issue with the feed, I think it is primarily a search issue, but also related to the full stops in the source cites.','',NULL,'',NULL,NULL,'','',0,76,'2011-06-15 01:01:35',1921,'2011-06-21 15:47:17',7,61,NULL,NULL,NULL,'N'),(3882,'CUSTOMER','Customer training session',NULL,NULL,NULL,NULL,'','Chris Bound',1,1,NULL,NULL,'During a recent training session at Collas Crill in Guernsey, one of the attendees asked if we would be adding the publication Shipping & The Environment (pollution of the sea) by Colin De La Rue to LexisLibrary as this was felt to be quite a main publication with regards to Shipping Law.\r\n\r\n',NULL,NULL,52,9,'21/06/2011:  This is a question for Content Acquisition(Cara Annett), please direct to her\r\nPM 21.06.11: Email sent to Cara Annett\r\n\r\nCA (via email) 21.06.11\r\nWe do not publish this book - Informa do, which means they own rights to it. If we wanted to include it LexisLibrary we would need Informa to agree to license it to us.\r\nThey will charge for this and so the main consideration as to whether this is viable would be the cost of the licence and the value to customers.\r\nI do not think we have received this request before but if the customer could provide further information about how it will be used, how often, how valuable to him it is to have in LexisLibrary and any other thoughts, that would be useful.\r\n(To Victoria Taylor) Vicky - depending how beneficial we think this might be we could ask Tom Saville to take a look at it. \r\n\r\nPM 22.06.11 - Email response sent to Michelle Cannon requesting that she gets further info from the customer as noted by Cara above.\r\nPM 24.06.11 EM from Michelle \"Yes I will contact the customer regarding this.\"','',NULL,'Collas Crill',NULL,NULL,'','',101,76,'2011-06-15 01:14:03',1921,'2011-09-01 14:21:17',72,241,0,NULL,NULL,'N'),(3892,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Martin Walker',0,1,NULL,43,'During a recent training session at London Borough Of Wandsworth (LOND5320) Martin Walker (Borough Solicitor) said that he preferred the layout of the alerts on Lawtel rather than the current awareness alerts on LexisLibrary.\r\n\r\nI explained to him about the different views the Update Alert can be sent to him in and how we usually recommend the \'list\' view.  Martin showed me how the LexisLibrary alert is displayed and then showed me his Lawtel alert.  The Lawtel alert appears to give you catchwords but also a summary of each item listed but not just a few lines but about a page of information.  I explained to him about the full text option but the Lawtel version seems to be something inbetween our list version and our full text version.\r\n\r\nFor instance on a case listed it showed the case citation and name, catchwords, then a summary, next an area headed as \'Held\' followed by Appeal details.  Martin felt that having an option for this style would be very beneficial.',NULL,NULL,0,5,'21/06/2011 LISA REGAN:  Thanks for your feedback regarding this matter.  I think looking at the current alerting system and what improvements could be made is a good idea but a substantial task - the last alert update project we did in Product Development cost $800k!  Please note that it is on my radar but is not something thatt canbe fixed easily or quickly..','',NULL,'London Borough Of Wandsworth',NULL,NULL,'','',0,76,'2011-06-15 01:20:59',1921,'2011-06-21 16:03:57',7,61,NULL,NULL,NULL,'N'),(3902,'COMPETITOR','Informal conversation',NULL,NULL,NULL,NULL,'','cch sales manager',2,0,NULL,55,'1. cch are offering multi year deals with the first year for free if the customer can demonstrate an online subscription either via an invoice or contract [the values are blanked out] in the corporate markets.\r\n2. have won HJHeinz and Atos on the above with a 30% reduction in value in first year of invoice vs 2010.\r\n3. they are afraid of our tax guidance proposition and having difficulty in talking to clients as nothing is changing with their product.',NULL,NULL,53,9,'','',NULL,'cch sales manager',NULL,NULL,'cch','',61,411,'2011-06-16 15:57:06',421,'2011-10-31 16:33:52',72,421,0,'.','','N'),(3912,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Kate Millard - Tax Manager',0,9,NULL,55,'Hi All\r\nIn training the Employment Tax team at PEM how to use Tolley Library they liked it, but felt it was confusing and worrying when it came to seeing the results from searching and working out the latest information for topics where it is key to see recent documents.\r\n\r\nWhen you have any results up you can tick a box to sort by date, but this regularly gives confusing information (sorting by date, but source by source).\r\neg searching from the front page across All content for Gaines Cooper, a known case that has been mentioned a lot recently, sorting by date shows many old documents at the top, and unless you knew, you may think the top results were the most relevant/recent.\r\n\r\nIn reality it is about result number 92/93 where you start to see journal articles that are from June 2011 through this (in theory date sorted) list.\r\n\r\nI understand that within the \'Journal\' tab there are plans to show the most recent article at the top, regardess of journal title which would help enormously, but would like to know if we are going to do something similar in the \'All\' tab of results so you you see the most recent document, wherever it has come from.\r\n\r\nIt\'s a brilliant site, and I strongly believe this would help many other customers see what they are expecting to see.\r\n\r\nThey felt a list of date order, source by source is a waste of time and no help.  \r\n\r\nAppreciate your thoughts.\r\nGavin',NULL,NULL,53,5,'','',NULL,'Peters Elworthy & Moore',NULL,NULL,'Tolley Library','',301,66,'2011-06-16 18:24:38',2632,'2011-10-14 14:19:41',92,2632,0,NULL,NULL,'N'),(3922,'BLANK','Customer cancellation request',NULL,NULL,NULL,NULL,'','Kate Millard - Tax Manager',0,22,NULL,55,'When searching on the front page of Tolley Library for \'incidental duties\' across All content, many good results come up, but Kate from PEM noticed an important article missing that she was expecting to see.\r\n\r\nShe had read an article in the April 2011 issue of Taxation magazine discussing this and was hoping that the online search would pick it up.\r\n\r\nWe looked at a paper copy of the issue of Taxation magazine and clearly saw it existed and that the words \'incidental duties\' appeared several times within it. The issue appears to lye in the fact that the article is in the \'Comment\' section of Taxation Magazine. \r\n\r\nWhere I know Tolley Library will not have all of the Taxation Magazine, and Kate wasn\'t expecting it to either, she (and I) were expecting Tolley Library to have the main articles.\r\n\r\nThis article/comment in the Taxation Magazine was x4 pages long, and very much promoted from the front page as a key article for that issue. As Kate said \'if I was in WH Smiths I would have bought it on the basis of that article\'!\r\n\r\nI said the fuller Taxation Magazine is available as a website in it\'s own right, but she said why should she have to search twice for something, she should be able to have the confidence to look once and know she has all she needs. \r\n\r\nAs the comments section seems to be such a significant and useful part of Taxation Magazine, for the sake of a great customer experience, could they be included in the coverage of Taxation Magazine within Tolley library?\r\n\r\nLooking forward to your thoughts on this.\r\nregards,\r\nGavin',NULL,NULL,53,9,'','',NULL,'Peters Elworthy & Moore',NULL,NULL,'Tolley Library/Taxation Magazine','',91,66,'2011-06-16 18:36:25',2632,'2011-10-14 14:21:33',92,2632,0,NULL,NULL,'N'),(3932,'BLANK','Customer training session',NULL,1470,NULL,NULL,'','Gina Fairfax',0,4,NULL,NULL,'Gina commented that the LPSL Private Client module should really have Inheritance Tax and a Capital Gains Tax topics running through it as this is such an important element for Private Client users, she was surprised it didn\'t contain this content',NULL,NULL,47,9,'Malcolm Skinner 20.06.11\r\nIt does have passing reference to these matters where relevant but a Topic is being prepared for release from later this year solely on tax and IHT and CGT will be dealt with in substantial detail.','',NULL,'',NULL,NULL,'','',0,68,'2011-06-17 09:43:40',1921,'2011-06-21 15:16:59',7,2622,NULL,NULL,NULL,'N'),(3942,'BLANK','Customer training session',NULL,7184,NULL,NULL,'','Anne Elliott/Partner',0,4,NULL,NULL,'Anne felt the LPSL Private Client module would be even better if it contained more tax information, especially topics covering Inheritance tax and to a degree Capital Gains Tax.  I explianed we had Tolley Guidance but Anne said she would prefer & expect to see this content added to the LPSL Private Client module',NULL,NULL,47,9,'Mailcolm Skinner 20.06.11\r\nIt does have passing reference to these matters where relevant but a Topic is being prepared for release from later this year solely on tax and IHT and CGT will be dealt with in substantial detail.','',NULL,'',NULL,NULL,'','',0,68,'2011-06-17 09:46:41',1921,'2011-06-21 15:44:46',7,2622,NULL,NULL,NULL,'N'),(3952,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Geoff Smith - Partner',0,24,NULL,NULL,'The links to EveryForm from Tolley Library do not work - the user receives this error message \"this feature is not currently available - please try again later\"\r\nConsequently when training on this service, when showing how to access forms, users have to revert back to the old Lexis service - the user commented that this was equivalent to have been sold a car with only three wheels with the assurance that the fourth wheel would be added soon ( apparently this is due for fix in early Q3)\r\n\r\nThis was further compunded when searching Everyforms for a P11D and the version available was 2009 only; the new version (2011) are required to be available from 15th April onwards and the up to date version needs to be filed no later than 19th July\r\nSimilarly, form CWF1 (self employment registration) form is out of date too.\r\nThe customer has lost faith in the service for the above reasons, is threatening to cancel on renewal if we cannot provide a service that works properly for them and contains up to date material.\r\n\r\nWould it not be an idea to build SmartForms into the forms element of the Tolley Library subs?',NULL,NULL,53,3,'','',NULL,'Larkings',NULL,NULL,'Tolley Library','',0,72,'2011-06-17 11:37:22',2632,'2011-10-14 14:22:32',82,2632,0,NULL,NULL,'N'),(3962,'BLANK','Customer/product advisory board',NULL,NULL,NULL,NULL,'','Julia Runnacles - GC',0,4,NULL,47,'Hi Ronen\r\n\r\nNice and clear language but I have been disappointed with how few daily updates I get. Also found some legislation not right up to date (unlessIi just didn\'t look properly).\r\n\r\nJulia\r\n',NULL,NULL,61,2,'S Gould (As per Insight 3972) 20.06.11\r\n\"Spoken to client and need further info around what issues were.  Waiting to hear back from Ronen Speyers so can arrange session with one of our trainers as issue may be a training one.  Will delve deeper at that meeting.  Sophie Gould\"','',NULL,'Hasbro',NULL,NULL,'In-House','',81,1361,'2011-06-17 12:44:43',591,'2011-11-15 16:08:24',112,591,0,'TBC','','N'),(3972,'BLANK','Customer/product advisory board',NULL,NULL,NULL,NULL,'','Sandar Kyi',0,4,NULL,47,'Hi,\r\n\r\nPlease see the below feedback from Sandar at Hasbro.  Clearly not good and not only a training issue I feel.  Our search results are always poor and when we are trying to win business where PLC is the incumbent this makes our task impossible as that is what they are used to.  Asking them to browse simply will not work.\r\n\r\nI heard rumours we were looking at sorting the results page so you can sort by relevance, date etc, but are we any closer to this and generally improving what returns there are?\r\n\r\nFinally, the issue with links is a little concerning.\r\n\r\nEmail from Sandar:\r\n\r\nJulia\r\n\r\nI am finding Lexis Nexis quite difficult to use.  For example, when I go and search for something and the search throws up a few results and you press on a link and find out that was not what you are looking for so you press on another link from the search results it seems to take you back to the information on the link you had tried before.  This has happened twice now and so I have not been able to Lexis Nexis at all on things.\r\n\r\nAlso not finding anything on the search results helpful.  For some reason there is very little coming up when you put in a search term. Not sure if we need more training but very difficult to use at the moment.\r\n\r\nThanks\r\nSandar\r\n\r\n\r\n',NULL,NULL,61,9,'SG 20.06.11\r\nSpoken to client and need further info around what issues were.  Waiting to hear back from Ronen Speyers so can arrange session with one of our trainers as issue may be a training one.  Will delve deeper at that meeting.  Sophie Gould','',NULL,'Hasbro',NULL,NULL,'In-House','',41,1361,'2011-06-17 12:50:18',591,'2011-11-15 15:54:01',112,591,0,'TBC','','N'),(3982,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Oliver Broomhall',2,142,NULL,NULL,'Just had a quick phone call with Turrner Peachey who have started using tolley library - generally they like it but a few of the features of library which are not currently available they miss. Basically these are:\r\n\r\n1) ability to e-mail docs (is this in the plan?)\r\n2) Ability to put the document in the \'add to\' area (also is this in the plan??)\r\n3) they find it a bit slower bringing up the actual document sometimes \r\n\r\nOther than that, they think the layout is good and it works well for them.\r\n\r\nOne other key bit of feedback was something we\'ve heard MANY times before and that\'s to do with WHY we don\'t publish the indexes online of the tolley guides - we do for simons obviously and users like this, but not for the tolley guides.\r\n',NULL,NULL,53,0,'','',NULL,'turner peachey',NULL,NULL,'','',341,65,'2011-06-17 12:55:11',2632,'2011-09-05 10:20:31',82,2632,0,NULL,NULL,'N'),(3992,'BLANK','Customer cancellation request',NULL,NULL,NULL,NULL,'','laura Gaudion',0,4,533,47,'Following a meeting at the Isle of Wight thye HOL said that she felt the commentary avalaible on PLC was far superior to that available through our PSL modules and that also the PLC system was much easier to use.\r\nHOL suggested adding much more commetary content to the PSL modules and the costs for both are very similar',NULL,NULL,39,4,'DL: In process of improving current awareness.  Product development is in process of improving user experience.\r\n\r\nPM 02.07.11: Emailed received from Dolly confirming that this Insight has been discussed with Paul (Fairfax) and the issue is in hand.','',NULL,'isle5013',NULL,NULL,'','',31,2682,'2011-06-20 14:11:12',1921,'2011-07-02 14:14:42',7,351,NULL,NULL,NULL,'N'),(4002,'PRODUCT','Customer/product advisory board',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'Feedback from Nestle as part of User Group \r\n\r\n\"I have just accessed the bribery act overview. It\'s short and reader friendly; the layout is very clear. Terrific. I thought I would print this for a couple of colleagues as a handy supplement to some bribery act training I will be giving them next week. However, the \'print\' version of the overview is horrible (sorry!). The format and general appearance are dry and bookish. It\'s not very reader friendly and frankly if I give them this, they will feel that I have printed out an excerpt from a textbook. I\'d like the look of the print version to be similar to the overview. I\'d like it to be something they consider pinning up by their desks.\"\r\n\r\nAction:  Dolly Lundin has passed feedback on to Claire Duggan ',NULL,NULL,61,6,'Action:  Dolly Lundin has passed feedback on to Claire Duggan ','',NULL,'Nestle',NULL,NULL,'','',452,591,'2011-06-20 16:02:40',1921,'2011-09-14 15:53:50',72,591,0,NULL,NULL,'N'),(4012,'BLANK','Customer/product advisory board',NULL,NULL,NULL,NULL,'','James Ellis-Rees Director of Legal Affairs',0,4,NULL,NULL,'1 June - Searched for money laundering rules, Wanted a reminder of what reporting obligations we might have. Only result was one item concerning financial servies, so not useful. PLC had more info.\r\n\r\n13 June - Searched for guidance on execution of deeds. 2005 Regulations found, but only guidance note was brief and out of date since it pre-dated the Regs. Nothing about formalities for Scottish companies, which is what I really wanted. Didn\'t try PLC.\r\n',NULL,NULL,61,0,'','',NULL,'Anixter International Ltd',NULL,NULL,'','',0,591,'2011-06-20 16:05:53',1921,'2011-09-14 15:47:28',72,591,0,NULL,NULL,'N'),(4022,'PRODUCT','Customer/product advisory board',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'I have carried out a number of searches but mainly relating to European Law and so have not always been successful. \r\n\r\nI searched for information on the following:  Termination of a Norwegian employee,  French employee and a Dutch VAT rule,  and as expected could not find any material. \r\n\r\nI also wanted a precedent for a retention of title clause.  Although the search revealed more than one example,  I could not access the more detailed precedents Not sure why? \r\n\r\nI looked up and found distribution agreement precedents but couldn\'t  access the checklist from the search results.  I could access the drafting notes from the precedent, and was not sure if this was the same as the checklist? \r\n\r\nAlso looked up an anti-bribery clause which I found easily. PLC  had a long form and short form version of the clause. It would be really helpful if there was both a long and short form for the bribery clause. In addition, once you have increased your coverage on Europe, it would be helpful to have a more general clause covering business carried out on an international basis. \r\n\r\nAction:  have asked Ronen Speyer to check access codes to check precedent accessing point.  \r\n',NULL,NULL,61,9,'','',NULL,'Anixter International',NULL,NULL,'','',452,591,'2011-06-20 17:51:58',1921,'2011-09-14 15:51:10',72,591,0,NULL,NULL,'N'),(4032,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','emma levitt',1,1,NULL,NULL,'case fowler vs Gruber. missing related cases from the link on the fast links on the right...\r\n\r\n',NULL,NULL,33,1,'22.06 EM sent to Content Support\r\n22.06 EM sent to Russell Green','',NULL,'sfp',NULL,NULL,'insolvency law','',261,411,'2011-06-21 09:17:10',1921,'2011-09-16 13:42:35',72,0,0,NULL,NULL,'N'),(4042,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Helen Ruane',1,1,NULL,NULL,'I have had problems recently renewing insolvencey online due us not including \'The Red Book\' on this service, it has also been an obstacle whilst doing a demo to a prospective new customer. I have spoken to the contents aquistion team previoulsy about this, is there any chance that this can be included in the near future.',NULL,NULL,33,4,'22.06.11 On Alan Blanchard\'s advice I have emailed  Cara Annett.\r\n23.06.11-  Cara Annett \"Susan I think we may need to look at this again. I gather it has recently become more of an issue due to Sealey and Millman having been added to West.\r\n23.06.11 - Susan Bentley \"Hi Allison - please can you confirm the account this relates to? Is this Zolfo Cooper?\"\r\n23.06.11 - PM - I have confirmed the account is Zolfo Cooper\r\n\r\n','',NULL,'Zolfo Cooper',NULL,NULL,'Insolvency online','',101,1661,'2011-06-21 14:32:08',1921,'2011-09-01 16:52:05',72,2612,0,NULL,NULL,'N'),(4052,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Mark Stubberfield',0,4,NULL,NULL,'Links to external websites work fine but here the link to PDF for Practice Direction 9F to HMCS site gives following error:\r\nThe page you are looking for might have been removed, had its name changed, or is temporarily unavailable. \r\n\r\n\r\n--------------------------------------------------------------------------------\r\n\r\nPlease try the following:\r\n\r\nIf you typed the page address in the Address bar, make sure that it is spelled correctly.\r\n\r\nOpen the www.hmcourts-service.gov.uk home page, and then look for links to the information you want. \r\n\r\n\r\nThis only goes to the main page and user cannot access the document in Question.\r\nAlthough we cannot control external websites and their inflexibility and difficulties in using, can we provide our version of the material required, in this case the text of the PDF?',NULL,NULL,47,9,'1/7/11 - MS\r\nAll links restored and working fine.\r\n\r\nFrom: Carkeek, Lisa (LNG-LON) \r\nSent: 27 June 2011 11:34\r\n\r\nTo: Michaud, Jennifer (LNG-HBE)\r\nCc: Fachiri, Sue (LNG-HBE); LNG-UK Insight Tracker; Mone, Philip (LNG-BEL); Duggan, Clare (LNG-LON); Rhoods, Neil (LNG-WOK); Marron, Suzanne (LNG-LON); Scriven, Jonathan (LNG-LON)\r\nSubject: RE: Insight Tracker: Insight Reference 4052\r\n\r\n\r\nThe HM Court Service site has been archived. The HMCS site is available online but external links to it (eg those on PSL) can result in a dead link.\r\nPD\'s are now available on the justice website at www.judiciary.gov.uk/publications-and-reports/practice-directions and we are in the process of adding the new address to PNs in PSL. \r\nLisa\r\n\r\nLisa Carkeek\r\nSolicitor, Practitioner Solutions\r\nLexisNexis, Halsbury House\r\n35 Chancery Lane, London\r\nWC2A 1EL \r\n\r\nFrom: Michaud, Jennifer (LNG-HBE) \r\nSent: 27 June 2011 11:26\r\nTo: Skinner, Malcolm (LNG-LON); Carkeek, Lisa (LNG-LON)\r\nCc: Fachiri, Sue (LNG-HBE); LNG-UK Insight Tracker; Mone, Philip (LNG-BEL); Duggan, Clare (LNG-LON); Rhoods, Neil (LNG-WOK)\r\nSubject: RE: Insight Tracker: Insight Reference 4052\r\n\r\nHi Malcolm and Lisa, \r\n\r\nA problem has been reported with links to PDFs within Private Client - it appears the documents on the HMRC site have been moved so links out to PDFs are now dead links. This has been logged on Insight Tracker as Insight 4052. \r\n\r\nIf you log onto PSL Private Client, to recreate: \r\n- Run a full text search on \'practice direction 9F\' \r\n- On results pages, click the only result on the practice notes tab (creation of trusts by the court)\r\n- Within the document, all the right-hand links entitled \'Practice direction 9B\', 9F and 9G are now dead links. \r\nIt would appear HMRC have moved these; can we update the links in the practice note to the new locations? Are there any other HMRC links that may have changed as well?\r\nNeil - have we got a way yet to automatically monitor when links to external sites change?\r\nCheers,\r\nJen','',NULL,'Kingsfords',NULL,NULL,'LexisPSL Private Client','',0,72,'2011-06-22 17:35:54',1921,'2011-06-30 12:44:56',7,59,NULL,NULL,NULL,'N'),(4062,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Ian Miles',2,142,NULL,NULL,'During a training session on the new service, the folowing questions were asked regarding features that had been relied on in Lexis Library and whether these were planned for Tolley Library:\r\n\r\nAbility to select content from toc for printing (no selection boxes currently appear in toc.\r\nWhen viewing legislation, links to find related content i.e \"find out more\" (as with cases in TL)',NULL,NULL,59,9,'','',NULL,'James Cowper',NULL,NULL,'','',341,72,'2011-06-23 14:10:57',2632,'2011-10-14 14:25:57',102,2632,0,NULL,NULL,'N'),(4072,'PRODUCT','Customer training session',NULL,4998,NULL,NULL,'','',1,132,NULL,NULL,'Couple of things: \r\n\r\n1) Are there any plans to offer a \'browse by agency\' option on the smart-forms portal. I generally find users understand the lexis library \'agency approach\' version of smart-forms browse layout much better than the category offering on smartforms portal.\r\n\r\ne.g yesterday someone was looking for the court of protection (cop) forms - on library these are under \'court service\' i.e the agency but on smart they are under civil procedure (and actually health law too I believe). This might seem obvious to us as a place to look but for the secretary I was dealing with, this connection was not obvious.\r\n\r\n2) I think lexis smart forms is NOT part of the \'all subscribed forms and precedents sources\' group source again - I thought we\'d sorted this quite a while ago.\r\n\r\nI\'ve just tried to search for forms by going directly to the forms and precedents tab in library and entering a form number in the 2nd box and I get no results from smartforms.\r\n\r\nIndeed if you go to this search form and click on \'browse\' on the left it shows a list of all sources available in this group source - and smart forms is not there (law society smart is though). \r\n\r\n3) Can you let me know when we\'ll have auto-population of firm names etc in boxes - I keep coming up against oyez and laserforms who offer this and secretaries like it.\r\n\r\nOn a positive note, Graham withers who I was with yesterday started using smartforms immediately after my session and one of the secretaries said how much easier the form (tr1) was to complete compared to oyez - she said the type was easier to read and it was simpler to move around the document.\r\n',NULL,NULL,59,3,'1) This functionality exists under advanced search. David S has informed training team. \r\n2) Tom Macdonald has fixed the All Subscribed Sources issue.\r\n3) Auto population is currenlty being worked on by the team with a view to rolling out solution in Aug/ Sept','',NULL,'',NULL,NULL,'smartforms','oyez',341,65,'2011-06-23 15:05:31',151,'2011-10-31 10:42:31',72,151,0,'TBC','','N'),(4082,'PRODUCT','Customer training session',NULL,4998,NULL,NULL,'','Hannah Walker',1,4,NULL,NULL,'when browsing through restrictive covenants in psl property, there are 3 precedents there of which 2 are: \'deed of release of covenants\' and \'deed of covenant.\'\r\n\r\nif you enter just the word covenant into the search box on the home page and let the word-wheel form, there appears to be a very odd relevance match to the titles of docs found resulting in the \'deed of release of covenants\' appearing but NOT the \'deed of covenant\'.\r\n\r\nthe client i was with found it a bit odd that the deed of covenant is probably the more relevant document with a simpler title yet PSL located the other precedent only in the word-wheel.',NULL,NULL,49,3,'This is probably another result that would be improved if the default were changed from title to full text for the search.  Also worth remembering that the search looks for the exact phrase unless boolean connectors are used. ','',NULL,'',NULL,NULL,'Lexis PSL Property','',301,65,'2011-06-23 15:28:21',1921,'2011-09-15 15:29:00',72,201,0,NULL,NULL,'N'),(4092,'BLANK','Customer training session',NULL,3993,NULL,NULL,'','Liz Garratt & Scott Walker',0,1,NULL,NULL,'When showing the client Tristram precedents and in particular we browsed to the powers of attorney. None of the 4 documents that appear there - and i think i other sections in the tristram precedents don\'t have the alt-rendition word icon to download the document into Word - which having just trained them on how to do this, they thought was odd that not all documents have this functionality\r\n\r\nAlso, when browsing around the OATHS in tristram precedents (which do have the alt rendition word icon), they noticed that all the oaths say at  the top: \' Heading as in form 1\'. meaning they would hav to find form 1 and copy the heading to complete the document. They found it very strange and frustrating that the oath document online was not dowloadable as a complete document in it\'s own right.\r\n\r\nI have reported this issue previously as non-user-friendly functionality',NULL,NULL,56,3,'LISA REGAN 24/06/2011:  I think this query would best be directed to Sarah Newton\r\nPM 24.06.11 Sent to Sarah Newton\r\n\r\nSARAH NEWTON 24/06/2011: I\'m afraid this isn\'t for me. The Manager in charge of the editorial side of TCPP is Judith Anderson.  \r\n\r\nPM: update received from Judith Anderson 01.07.11\r\nThe first item is a technical issue and I believe it has already been sent to the technical team.\r\nThe second item can be done, but will require consultation with Content Acquisition and their approval concerning costs and the logistics of doing this. \r\n \r\nUpdate sent to David Smith 14.07.11. David has advised that he has logged the same issue again.','',NULL,'',NULL,NULL,'Tristram & Coote','',341,65,'2011-06-23 15:39:14',1921,'2011-07-14 12:14:02',4,2722,NULL,NULL,NULL,'N'),(4102,'BLANK','Customer training session',NULL,8774,NULL,NULL,'','',0,1,NULL,NULL,'When out training today, the group were very impressed by the \"find a legal term\" resource in Quick Find. However, none of them had used it before because they did not really understand what they would be searching for if they used that box. They unanimously agreed that the title \"find a legal term\" is not a clear indication of what using that box will provide you with in terms of content. It was suggested that \"legal glossary\" or \"legal definitions\" would be clear titles.',NULL,NULL,59,9,'LISA REGAN 26/06/2011:  Thanks for your feedback. I do remember there was some indecision about what to call this feature and we did validate it with customers at product advisory boards and \"find a legal term\" came out top in those sessions.  I will keep my ear to the ground for further feedback on the naming and if it really is causing confusion then we cna look into changing it. Thanks, Lisa','',NULL,'',NULL,NULL,'LexisLibrary','',0,2461,'2011-06-23 16:31:42',1921,'2011-06-30 12:53:50',7,61,NULL,NULL,NULL,'N'),(4112,'PRODUCT','Informal conversation',NULL,NULL,NULL,NULL,'','Andrew Ferguson',1,1,NULL,NULL,'Andrew has commented that when he is looking for judgements on the system he can often find the headline content but cannot find the full transcripts and also that he would like to see more specialist information on chlidcare.\r\n\r\nI have told andrew that bthe judgement content may be because we do not have a license for the content but there other ways to view the full transcripts. I will have these questions addressed at an up and coming training session.',NULL,NULL,0,1,'LISA REGAN 19/07/2011:  Re-directing this query to James Wilson as this is about cases.','',NULL,'swindon borough council',NULL,NULL,'legal library','',101,2682,'2011-06-27 08:22:33',1921,'2011-11-02 12:37:07',22,3522,0,'TBC','','N'),(4122,'PRODUCT','Customer/product advisory board',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'Just to let you know I have just looked up redundancy procedure in UK on the website.  I liked the succinct definition of the procedure.  When I serached for more details about selecting a pool and scoring I couldn\'t find any detailed information.  When I serached on PLC web site, it contained the detailed information that I was looking for. \r\n\r\nFeedback from User Group - no action required.  I have sent feedback on to Emp PSL and Cara Annett for information.',NULL,NULL,61,6,'','',NULL,'Anixter',NULL,NULL,'','',101,591,'2011-06-27 12:37:14',1921,'2011-08-12 12:40:45',72,591,0,NULL,NULL,'N'),(4132,'BLANK','Renewal or new business conversation',NULL,1515,NULL,NULL,'','Helen Gwinn',0,1,NULL,39,'The client was very disappointed to hear we are losing the Bankruptcy and Insolvency reports.  What sources do we have that cover this / similar content?  ',NULL,NULL,33,1,'LISA REGAN 30/06/2011: I\'d try the All England Commercial series which covers banking and finance perhaps','',NULL,'',NULL,NULL,'','',101,7,'2011-06-27 15:05:30',1921,'2011-07-02 15:48:26',7,61,NULL,NULL,NULL,'N'),(4142,'BLANK','Renewal or new business conversation',NULL,1515,NULL,NULL,'','Helen Gwinn / Info Manager',0,22,NULL,NULL,'The client has complained that not all Taxation Magazine and NLJ articles are available on the Lexis Library.  The have a subscription to the legal library and also the hardcopy versions of this title.  I have explained the reasons why not the content is put on, but the client is unhappy.\r\n\r\nI have a number of clients who have complained about the same thing.\r\n\r\nMy recommended actions would be to put all of this content online, which would only be available to clients who take the journals part of our content.  I understand that each title needs to justify its existence, but i don\'t believe there is an issue of caniballising our revenue here, as people still like the hardcopy.  This is a frustration our clients have had for a long time and if we were to resolve this it would improve people\'s perceptions of the overall service.',NULL,NULL,53,5,'LISA REGAN 30/06/2011: This query should be directed at Simon Collin (Journals team).  We have heard this complaint from customers before but it was an internal decision from Simon\'s team\r\n\r\n02.07 Redelegated to Simon Collin\r\n\r\n04.07 Email from Simon Collin \r\nI\'m very happy to have a chat with the customer to find out more about their requirements and how they use the content; currently, if they are a print subscriber (you note that they are) then they have access to the full content and archives on the websites - their normal LL login will get them onto both NLJ and TM websites.\r\nWe are currently looking at the journals content and how to improve the customer experience (Toby is running this project); there should be developments over the summer.\r\n\r\n04.07 Email from David Woodward:\r\nThanks for your reply.  Whilst the customer does have access to the NLJ and TM websites, this is on a 1 user license basis, not firm wide access.  Only 1 person is the information team has access to the NLJ TM websites, so they get requests to send across articles on an ad-hoc basis, which adds to their workload.\r\nThe second frustration is that logging out of one website and into another makes the research process disjointed.  One of the reasons users like Lexis is because it\'s a 1 stop shop for research.  When we start leaving content out, it defeats the object.\r\nHopefully the project Toby is running will address these issues.\r\n','',NULL,'',NULL,NULL,'','',101,7,'2011-06-27 15:12:26',1921,'2011-07-04 10:21:34',7,631,NULL,NULL,NULL,'N'),(4152,'PRODUCT','Customer training session',NULL,3101,NULL,NULL,'','Aleksander Bakic/Solicitor',1,1,NULL,NULL,'The insight relates to UK Legislation Status Snapshots. When you are looking at a section of legislation, say s.871 of the Companies Act 2006, and click on Status Snapshots on the right hand side, you are taken to a page showing just the status of that section. Aleksander commented, and I broadly agree, that it would be more useful if the first page you saw was the enactment overview, not just the status of the secion you are looking at. After all, you can check on the status of that individual section by looking at the footnotes to the section. The point of status snapshot is to give you an overview of the status of the entire act, or perhaps the part of the act that you are looking at. The extra click to go to enactment overview seems unnecessary.',NULL,NULL,13,2,'LISA REGAN 1/7/2011:  Thanks for your feedback.  Status snapshot was built in this way to suit both user needs - to be able to see a section status at section level and also at enactment level.  The customer validation founded before we built the functionality that ifa user is looking at a specific section it does make sense that they would be interested in that specific status of that section .  Aleksander\'s feedback refutes this but there is a case for both scenarios.There is the ability to click on the enactment overview also if they so wish so the user does have options.  ','',NULL,'',NULL,NULL,'LexisLibrary','',131,1881,'2011-06-29 10:54:35',1921,'2011-08-22 13:15:57',72,61,0,NULL,NULL,'N'),(4162,'PRODUCT','Customer training session',NULL,3101,NULL,NULL,'','',1,1,NULL,47,'I was training at this US firm which focuses on some niche areas of finance and dispute resolution work. They subscribe to EF&P (amongst other sources), but no other precedents. I was already aware that we are a bit short in areas such as PPP and PFI, but basically we did not have any precedents in their areas of interest. I checked later on my own ID, and overall LexisLibrary is very thin on precedents (as well as Commentary) on work such as PFI, PPP etc. PLC will always be dominant with firms such as these until we beef up our offering in these areas.\r\n\r\nRecommendation: if we wish to be relevant to International Finance/Corporate/DR firms, we need to beef up our precedents and commentary.',NULL,NULL,6,3,'LISA REGAN 1/7/2011:  I would direct this query to robert Walker who heads up EF&P\r\n\r\n06.07.11 PM Email sent to Robert Walker\r\n\r\n12.07.11 PM: Robert Walker has responded stating:\r\n\"From an EF&P perspective, we do not have a title dealing with PFI or PPP although mention is made in, for example, Local Government and other titles. I will discuss further with contributors when discussing appropriate titles to see whether there might be material appropriate to our users.\"\r\n\r\nI have forwarded Roberts response to Ben May\r\n','',NULL,'',NULL,NULL,'','',0,1881,'2011-06-29 11:17:02',1921,'2011-07-14 12:53:57',0,61,0,NULL,NULL,'N'),(4172,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Jim Carrigan - Head of Tax',2,20,NULL,82,'After trialling the Tolley Guidance VAT module, Jim feels that the content is quite basic and at the right level for someone like an accountant doing VAT returns.  He thought TG was a good concept though and said it was very easy to use and search for content etc.',NULL,NULL,57,6,'','',NULL,'Re:Sources UK Ltd',NULL,NULL,'VAT Module','',91,1371,'2011-06-29 13:07:38',1921,'2011-11-15 10:14:40',72,2872,0,'TBC','','N'),(4182,'PRODUCT','Renewal or new business conversation',NULL,1699,NULL,NULL,'','Partner',1,4,NULL,47,'***Please assign this insight to Jon Scriven to whom i have sent the info below by e-mail***\r\n\r\n\r\nDuring a demo in a firm the other day, where the client has had a trial of PLC, they asked us to find a \'mediation agreement\'.\r\n\r\nThey said they had done this on PLC and it had taken them directly to a document quickly.\r\n\r\nWe tried the same search in PSL for \'mediation agreement\' searching title only and the wordwheel disappeared indicating there was no document found.\r\n\r\nWe tried searching for just \'mediation\' in title and it does show some documents (but not the agreement). We tried the word \'mediation\' searching full text and again you get some documents but not the agreement.\r\n\r\nThere\'s clearly an issue here with content mark-up as if you browse through the ADR topic, mediation documents, precedents, there\'s the \'CEDR model mediation agreement\'.\r\n\r\nThe client (nor I) could understand why this hadn\'t been picked up by the searches we tried and it didn\'t look great,.\r\n\r\nI suspect this might have something to do with the fact it\'s a link to an external document and therefore is marked up in a different way which doesn\'t enable the search to find it. \r\n\r\nWhatever the reason this is illogical and we need to find a way to ensure ANY document - whether it\'s ours or a link out to external providers is located by searching.\r\n\r\nThe client is a user of library but is highly critical of our search functionality there and generally they find it tricky to locate things. I don\'t think they were too impressed that they could experience similar issue in Lexis PSL.\r\n',NULL,NULL,9,3,'PM 02.07.11 EM sent received from Jon Scriven. Awaiting update','',NULL,'',NULL,NULL,'Dispute resolution ','',281,65,'2011-06-29 14:02:17',1921,'2011-09-02 09:50:39',72,59,0,NULL,NULL,'N'),(4192,'PRODUCT','Customer training session',NULL,1858,NULL,NULL,'','Debbie Chambers/Conveyancing Clerk',1,4,NULL,47,'Debbie liked the statutory declarations in LPSL Property - she commented on the great coverage flying freehold had.  A suggested improvement would be to include more statutory declarations for rights of way.  Quite often these are required along with sewers and septic tanks!',NULL,NULL,50,3,'Update from Malcolm Dowden: \r\nThanks - we\'ll add some more stat decs asap.\r\n\r\nPM 05.07.11Email sent to Lynne Davies to update','',NULL,'',NULL,NULL,'LexisPSL Property','',0,68,'2011-06-29 14:39:56',1921,'2011-07-05 16:21:32',7,201,NULL,NULL,NULL,'N'),(4202,'PRODUCT','Customer training session',NULL,5836,NULL,NULL,'','Nigel Askew/Partner',1,4,NULL,NULL,'This is a general comment about LPSL smart so applies to ALL LPSL smart modules.  People find it incredibly confusing that within the forms tab in LPSL there are up to 3 options for one form - the word version, the hotdocs version & the pdf smart version, they will consistently pick the hotdocs form and then cannot understand why they can\'t use it (as they don\'t have hotdocs installed).  If we are trying to increase usage of LexisSmart forms surely we should remove the hotdocs and word versions to make it clearer and easier to understand which form they should be using?',NULL,NULL,44,3,'Update 08.07.11 Clare Duggan:\r\nHi Lynne\r\n\r\nThanks for the feedback from Hodgkinsons.\r\nI have had a chat with Tim Wakefield and this was his response:\r\n\r\nI agree with this comment and this forms part of the Forms migration plan that we are in the process of working through with the aim of switching off hotdocs across PSL/ Library at the end of the year. At that point we will also remove hotdocs from PSL. \r\nThe commercial thinking behind the delay here is so that the sales teams (in particular GP) can target a Smart upsell through Q3/4 renewals which gives us revenue and also reduces the number of firms who take PSL but not Smart PSL. Next year the proposal , tbc with sales, is to switch Smart on for all PSL but non Smart customers (hopefully less than 50 by then), remove hotdocs and for sales to use Smart to justify sales uplift in 2012.\r\n\r\nHope that helps,\r\nClare.\r\n','',NULL,'',NULL,NULL,'LexisPSL','',131,68,'2011-07-04 10:06:57',1921,'2011-07-11 09:26:57',7,59,NULL,NULL,NULL,'N'),(4212,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Matthew Stokes/Solicitor',1,4,NULL,NULL,'Matthew asked if there was a sepcific Professional Negligence topic area in DR or would there be one added?',NULL,NULL,9,9,'Janna Purdie 05.07.11:\r\nWe have considered this but it is currently not on the DR roadmap for the next year.  Much of the information we have for litigation generally would apply to Prof Neg cases and so it is not that we do not provide anything for solicitors involved in this type of work but we do not cover very specific issues.  I will highlight that we need to relook at whether we provide this.','',NULL,'Emmetts',NULL,NULL,'LexisPSL Dispute Resolution','',131,68,'2011-07-04 10:56:49',1921,'2011-07-06 09:56:05',7,1531,NULL,NULL,NULL,'N'),(4222,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Matthew Stokes/Solicitor',1,4,NULL,NULL,'PPI is a big area of work for this firm and it will be for the next 2 years (as it will for other firms), Matthew asked if we had considered a PPI calculator as ashort term addition to LPSL??',NULL,NULL,9,9,'Update  from Janna Purdie 05.07.11:\r\nThis is a request for calculators in the product to be able to calculate sums in relation to payment protection insurance.  We do not cover insurance within the DR product and at the moment we do not have any calculators although we are looking at adding a toolbox with calculators in it.  Jon Scriven is dealing with this aspect of DR for the DR team and the request should therefore be forwarded to him.\r\n\r\n','',NULL,'Emmetts',NULL,NULL,'LexisPSL Disoute Resolution','',341,68,'2011-07-04 10:58:13',1921,'2011-07-05 16:34:39',3,1531,NULL,NULL,NULL,'N'),(4232,'PRODUCT','Customer training session',NULL,12122,NULL,NULL,'','Simon Druce/Solicitor',1,4,531,43,'Simon Druce, a senior solicitor at Tollers in Personal Injury, complained that we do not have any cases covering County Court decisions (for liability issues, not quantum, which we do cover). This is applicable to both LexisPSL and LexisLibrary. He said that he knows they are not binding, but practically a lawyer in PI is interested in county court decisions to see how they apply the major decisions from the higher courts. He used to be able to get these on Lawtel, but as they do not subscribe to Lawtel and only has LexisLibrary and PSL, he finds them to be a significant omission from the perspective of PI work.\r\n\r\nI told him I would pass this comment on, but could not promise anything would be done to introduce county court decisions to our coverage for reasons of resources. I queried how much Lawtel cover the County Court, and he claimed they cover all of it! Is this the case? Are there any other voices asking for County Court coverage?',NULL,NULL,44,1,'Thank you for this feedback. I can see from a PI practitioners point of view it would be useful to see how liability issues are being decided at county court level. This would be particularly useful if lawyers could search the recent decisions of their local court - it would give them a great insight into how their local judiciary are approaching liability issues. As the insight contributor noted this is not a practical suggestion. We couldn\'t possibly have enough court reporters to cover all the county courts in the UK. As these decisions are not legally binding upon other courts there would be no business justification for incurring this huge expense.\r\nI used to get Lawtel updates when in private practice. I don\'t recall any county court liability decisions being reported. They may accept case reports from lawyers who attended the county court decision but this would have limited value. Unless the case report has been prepared by a court reporter how would you verify its contents?\r\nI haven\'t had any other requests for county court coverage. I know the DR team have been asked if they can publish county court decision which some of their customer have been involved in but that isn\'t what Tollers are asking for.\r\nObviously let me know if you have any further queries\r\nKind regards\r\nKaren - Personal injury PSL. 11 July 2011','',NULL,'',NULL,NULL,'','',101,1881,'2011-07-05 11:20:02',1921,'2011-07-12 11:29:08',7,371,NULL,NULL,NULL,'N'),(4242,'PRODUCT','Customer training session',NULL,12122,NULL,NULL,'','Simon Druce/Solicitor',1,4,NULL,NULL,'I trained the solicitor in question on LexisPSL, as he did not know that they had access to it. He had tried using LexisLibrary in the past and was not a fan at all, telling me was arguing they should cancel it because it was too slow and hard to find things, therefore not value for money. Once we\'d had a look at PSL, he was a big fan, telling me repeatedly that this had really won him over, he could really make use of it, it seemed easy to use, does the things they need, is quick, straightforward, and importantly leads them to the right place within lexislibrary if deeper research is required.',NULL,NULL,44,9,'CD-05/07/11\r\nHi Ben\r\n\r\nThanks for the feedback you provided below from Simon Druce at Tollers LLP.\r\n\r\nI trained the solicitor in question on LexisPSL, as he did not know that they had access to it. He had tried using LexisLibrary in the past and was not a fan at all, telling me was arguing they should cancel it because it was too slow and hard to find things, therefore not value for money. Once we\'d had a look at PSL, he was a big fan, telling me repeatedly that this had really won him over, he could really make use of it, it seemed easy to use, does the things they need, is quick, straightforward, and importantly leads them to the right place within lexislibrary if deeper research is required.\r\n\r\nIt\'s really great that you\'ve taken the time to send on positive feedback you\'ve heard and for us to understand what really makes customers tick. Please do continue to pass on any further feedback you hear in the marketplace.\r\n\r\nKind regards,\r\n\r\nClare.\r\n','',NULL,'',NULL,NULL,'Lexis PSL','',0,1881,'2011-07-05 11:23:08',1921,'2011-07-06 09:51:38',7,59,NULL,NULL,NULL,'N'),(4252,'BLANK','Customer training session',NULL,4025,NULL,NULL,'','',1,4,NULL,NULL,'The solicitor is part of a team that deals with Social Housing. She states that this is a very niche area and the Property PSL module does not really cover the subject matter that she would be looking for in the product. She deals a lot with Land Registry adjudications, rent recovery, ASBOs etc. \r\n\r\nPreviously, I have worked in a firm that had a large Social Housing department (they are a big client of ours that are looking to consolidate with us). It would seem that this may be a useful area for development in terms of a specialist PSL module.',NULL,NULL,49,9,'Nottingham City Council Housing Team also suggested that a specialist area would be more appropraite as a lot of the Property module is not applicable to them.\r\n\r\n[added by MJD, 11 July 2011] Social housing issues are currently split between LexisPSL property and LexisPSL local government.  We have an expert external author (Sue Simms) available to produce more content.  There could be merit in considering either a new practice area module or a \'microsite\' within property and/or local governnment.\r\n\r\nUpdate M Dowden 18.07.11\r\nAs a far more immediate solution I have spoken to Dolly Lundin about commissioning more specific social housing content for each of property and local government. We will build up content in those areas over the next two months.','',NULL,'',NULL,NULL,'LexisPSL Property','',91,2461,'2011-07-05 13:33:48',1921,'2011-07-18 15:40:01',7,201,NULL,NULL,NULL,'N'),(4262,'PRODUCT','Other',NULL,9855,NULL,NULL,'','Owner Principal',1,1,NULL,NULL,'spotted that a capital \"P\" is needed for \"Property\" in the middle of clause 1 of Deed of Variation precedent 11 [4.13] in Butterworths Wills Probate & Admin Service\r\nPrecedent 11     Variation to effect the severance of a joint tenancy\r\n \r\nNOW THIS DEED WITNESSETH as follows:\r\n1.       THAT it shall be deemed that the Deceased and Mrs B had immediately prior to the death of the Deceased agreed in writing to sever and did thereby sever the joint tenancy in equity in the Property so that at the date of his death the property was vested in the Deceased and Mrs B as beneficial tenants in common in equal shares whereby the Deceased\'s beneficial half-share in the Property formed part of his free estate at the date of his death\r\n \r\n',NULL,NULL,56,3,'08.07.11 Email sent to J Whittle\r\n12.07.11 Forwarded feedback to Tracey McGovern\r\n\r\n12.07.11 Update received form Tracey McGovern\r\n\"Here I can see they\'re talking about Division F, para [4.13]. Can you check to see - is it the \'property\' highlighted below that they think should have a capital P please? If so, I can make this amendment with the next issue.\"\r\nEmail sent to Jonathan Whittle asking him to clarify as above.\r\n\r\n','',NULL,'',NULL,'0','','',131,581,'2011-07-07 10:28:04',1921,'2011-08-23 10:09:25',72,581,0,NULL,NULL,'N'),(4272,'PRODUCT','Other',NULL,9856,NULL,NULL,'','Karen Purdy - Principal',1,1,NULL,NULL,' Customer\'s comment below:\r\n\r\n\"I wondered if there is any point raising this with your Wills editor? Having reviewed a client\'s Will by a different firm, they had a Nil Rate Band Discretionary Trust with 2 additional clauses in the section regarding beneficiaries:\r\n \r\n\"(c) any trust or body corporate or other organisation which is wholly charitable in accordance with the laws of England and Wales from time to time\r\n(d) any person or class of persons other than an Excluded Person nominated during the Trust Period by my Trustees\"\r\n \r\n(c) might be useful as a standard addition to ensure that there is never a situation where you run out of beneficiaries. If that was included then (d) should not be needed. The other issue with (d) is that the standard NRB does not always include a definition of \"Excluded Person\" and Testators may not wish to give their Trustees power to add in new beneficiaries.\"\r\n',NULL,NULL,56,9,'Email sent to Tracey McGovern\r\n\r\nEmail form Tracey 11.07.11 - I\'ll pass this feedback onto my author and will let you have their response as soon as I receive it.\r\n\r\n','',NULL,'',NULL,'0','Butterworths Wills and Probate ','',81,581,'2011-07-07 10:30:48',1921,'2011-08-31 09:32:34',72,0,0,NULL,NULL,'N'),(4282,'PRODUCT','Customer training session',NULL,6816,NULL,NULL,'','',1,4,NULL,NULL,'Please assign to karen o\'sullivan. \r\nKaren - already e-mailed on this -  Emma Dickin has suggested we also log as an insight...\r\n\r\nThe new link to \'rates and figures\' from the PI toolkit takes the user into the BPILS source in a Lexis Library document view window which was a bit confusing for the users i trained.\r\n\r\nI don\'t really see why it can\'t simply open in a PSL window as per other content we draw over from the library source.\r\n\r\nThe new link to \'rates and figures\' from the PI toolkit takes the user into the BPILS source in a Lexis Library document view window. \r\n\r\nAlso, you have to browse a little way down the tree on the left to reach the actual rates - you have to browse PAST section 1 \'special damages stats\' - which really just has little overviews of what each figure or table is about. It would be better if the tree was not open at all.\r\n',NULL,NULL,44,9,'Thanks for this insight. The rates and figures addition to the toolbox went live last week and we are assessing the feedback from customers on whether they like the look it it. I have noted your comments and will add your suggestion to the list for discussion at the next PI meeting. Thanks Karen O\'Sullivan PSL personal injury . 13 July 2011','',NULL,'',NULL,NULL,'PI PSL','',341,65,'2011-07-08 14:55:22',1921,'2011-07-13 13:56:23',7,371,NULL,NULL,NULL,'N'),(4292,'PRODUCT','Customer training session',NULL,6816,NULL,NULL,'','Gareth Owen ',1,4,NULL,47,'Please assign this to the Practice area directors of the PSL product\r\n\r\nthis insight (one could argue) also applies to Library precedents\r\n\r\nGareth is the head of property who uses and loves PLC. Key thing he uses it for is precedents - this firm don\'t buy PSL in his area of property (they have a PI sub which is well liked and a corporate sub - which they took with the intention of helping us with feedback but essentially it\'s been added as a \'built in the package add-on\'). \r\n\r\nGareth\'s attitude when I tried to train him on library content was that he rarley uses it (perhaps once a year). He basically said PLC has become the \'industry standard\' for precedents meaning they know the documents when they arrive from another solicitor and generally like the precedents and can find what they want easily. This is not exactly news - we\'ve heard this MANY times before so i thought it was about time i added it as an insight as i believe we need a specific \'overcoming the indusctry standard objection\' strategy. \r\n\r\nI don\'t know what the answers are here but this is not simply a matter of matching the PLC\'s precedent content - it goes deeper than that.\r\n\r\nWe need to have a specific plan of how we infiltrate our content into the market (perhaps top tier so it filters down??) to overcome this \'industry standard\' viewpoint - currently even if we have the same precedent coverage users see little reason to change from PLC because the rest of their World uses PLC documents. \r\n',NULL,NULL,59,3,'Originally assisgned to Clare Duggan\r\nResponse received from Clare:\"This needs to be sent onto Karen Watton, Jon Scriven, Mark Ashley-Hacker and Orla Medcalfe who are the practice area directors for PSL. It is more of a strategic question than specifically product.\"\r\n\r\nFurther email sent to above contacts 11.07.11','',NULL,'',NULL,NULL,'Lexis PSL','',61,65,'2011-07-08 15:12:50',1921,'2011-10-13 12:26:38',22,231,171,NULL,NULL,'N'),(4302,'PRODUCT','Customer training session',NULL,6816,NULL,NULL,'','',1,4,NULL,NULL,'Please assign insight to Karen O\'sullivan\r\n\r\nThey had been getting very frustrated with the lack of reports they get when word searching quantum in PSL - this is partly because of how they were searching but also they hadn\'t realised that the search in PSL only looks over the top bit of each report.\r\n\r\nWhen I showed them the form in Library - which searches the whole report, they started to get better results but then of course they can\'t do a value sort. They thought the form in PSL should at least have the option to search the whole report including the facts as in it\'s current form it\'s not that useful.',NULL,NULL,44,1,'Thanks for this insight. I discussed these comments at the PI workshop meeting yesterday and it was agreed that we need to change the search facility on the quantum database to enable a subscriber to search either just the top of the text or the whole report. The new online submission site is going to be marketed to the profession shortly. This marketing should significantly increase the number of quantum cases we have in the database which should also address customer complaints about the number of results they get when they undertake a quantum search. Thanks Karen O\'Sullivan 13 July 2011','',NULL,'',NULL,NULL,'PI','',281,65,'2011-07-08 15:16:21',1921,'2011-07-13 14:24:35',7,371,NULL,NULL,NULL,'N'),(4312,'PRODUCT','Customer training session',NULL,1699,NULL,NULL,'','',1,132,NULL,NULL,'Please assign insight to Vicki Tubb\r\n\r\nDuring a sales demo of smart-forms the customer suggested it would be useful to be able to print out a blank questionaire - which they could fill out in a client meeting and then pass to support staff to enter into the smart  precedent questionairre online.\r\n\r\nIs this possible or are we likely to enable this if not?',NULL,NULL,59,3,'Email sent to Victoria Tubb','',NULL,'',NULL,NULL,'Smart precedents','',131,65,'2011-07-08 15:18:26',52,'2011-09-21 11:02:13',112,331,0,NULL,NULL,'N'),(4322,'PRODUCT','Customer training session',NULL,6816,NULL,NULL,'','Cheryl Burfield',1,4,531,NULL,'Please assign to Karen O\'sullivan\r\n\r\nCheryl wanted to see more actual letters of claim withing the precedents on psl PI. one of her colleagues pointed out she could adapt these from the particulars but Cheryl was adamant having a wider variety of letter would be more useful.',NULL,NULL,44,9,'Thank you for this insight. We have added  more letters of claim to our roadmap and plan to have these added to the product by the end of 2011. Jonathan Aspinall has just joined the personal injury team from private practice and we want to use this recent expertise and get him to draft some more letters of claim and letters to clients. Many thanks Karen O\'Sullivan PSL personal injury team 13 July 2011','',NULL,'',NULL,NULL,'','',101,65,'2011-07-08 15:21:22',1921,'2011-07-13 14:25:27',7,371,NULL,NULL,NULL,'N'),(4332,'PRODUCT','Other',NULL,11917,NULL,NULL,'','Ann Hemming / Consultant',1,18,NULL,NULL,'Relates to the VAT Update webinar broadcast on 22nd June.\r\nThe customer found the content too basic for their level.  The issue is that \"The Lexis webinar schedule does not indicate at what level the webinars are pitched, nor was there anything on the webpage.\"\r\n\r\nThe recommended action would be to given an indication of what PQE level each webinar is aimed at, so potential viewers know if it is worth their while tuning in.',NULL,NULL,57,9,'PM 11.07.11 Email sent to Caroline Boyd\r\nPM 13.07.11 Response received from Caroline Boyd:\r\n\"Hi Philip\r\nThe level of each webinar is indicated as \'beginner\' or \'intermediate\' on every email that goes out and is listed on the website. It is also stated on the brochures underneath the \'Who should view these webinars\'. \r\nI am working to ensure that the content of the webinars going forward in 2012 meets the level stated on the brochures.\r\nI hope that this answers your query?\r\nKind regards\r\nCaroline\"\r\n','',NULL,'',NULL,NULL,' Webinars','',81,7,'2011-07-11 11:40:16',1921,'2011-07-14 13:55:05',7,0,NULL,NULL,NULL,'N'),(4342,'PRODUCT','Renewal or new business conversation',NULL,2009,NULL,NULL,'','Steven Ireland',1,4,NULL,NULL,'SOrry - I forgot to mention this at the Practice Area Workshop!  This firm are still going to subscribe and generally loved PSL and Smart - but they fed back that being able to sort the Quantum results by date and value would be useful. ',NULL,NULL,44,1,'Thanks for this insight. We have recently had lots of feedback on changing the quantum search feature. I will add this insight to the list of customer comments for consideration when we change the search feature. Glad PSL is still proving popular with them! Thanks Karen O\'Sullivan 13 July 2011','',NULL,'',NULL,NULL,'PSL ','Kemp',301,35,'2011-07-12 12:35:44',1921,'2011-07-13 14:29:59',7,371,NULL,NULL,NULL,'N'),(4352,'PRODUCT','Customer training session',NULL,12070,NULL,NULL,'','Julie Ball & Sara Hilliard',1,1,NULL,NULL,'Please assign this to Dan Wright & Lisa Regan \r\n\r\nThis issue concerns how tristram precedents are displayed online and has been reported a number of times before.\r\n\r\nIf you look at an Oath online (any of them), they basically duplicate the content which is in the hard copy. The prolem with this is that most documents have \'heading as in form 1\' at the top and often \'continued as in form...\' at the bottom - these extra bits are NOT hyper text linked and so the user then has to trawl around the precedents to find the relevant top and bottom of the document.\r\n\r\nI suspect this is done in hard copy to save paper but online it makes it VERY difficult to get a complete document and i see no reason why we shouldn\'t provide all documents as complete - i.e without these bits says heading as in form 1 at the top etc.\r\n\r\nThis issue came up in atraining session yesterday as the users noticed these links and couldn\'t understand why the docs online were not complete.\r\n\r\nif we did this, it would mean our online and hard copy were different but this would give our ever increasing online clients a much better user experience.',NULL,NULL,56,3,'','',NULL,'',NULL,NULL,'Tristram & Coote','',341,65,'2011-07-12 14:32:00',3711,'2011-12-05 07:27:20',72,61,0,'TBC','','N'),(4362,'MARKET','Informal conversation',NULL,2213,NULL,NULL,'','Karen Scott / Information Manager',1,1,NULL,NULL,'Capsticks LLP are specialists in Healthcare Law.  One of their lawyers is writing a book on NHS Employment Law, as they believe there is a gap in the market.  The client has enquired about whether we would like to licence the title.  Is this of interest?',NULL,NULL,24,4,'LISA REGAN 18/07/2011:  Tihs is a question for the Content Acquisition department (Cara Annett) who can validate this idea and progress if wished.\r\n\r\n18.07.11: Email sent from Cara Annett to Claire McMahon\r\n\"Claire can you investigate and get back to the team? \"','',NULL,'',NULL,NULL,'n/a','',311,7,'2011-07-12 15:06:47',1921,'2011-10-17 11:11:53',72,3412,0,NULL,NULL,'N'),(4372,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Liam Nevin - HoL',4,1,NULL,43,'This customer, and a number of others, still have Lawtel from Sweets. They were not aware that there was something else in the market that did the same job - and that they already subscribed to it through ourselves (they take Primary Sources and Current awareness). The HoL Liam Nevin wanted to keep Lawtel due to the e-mail alerts with same / next day transcripts. I spoke to him and said the All England Reporter does the same job and sent over statistics (see attached) to support my argument. I then talked him through how to set up an e-mail alert on the phone and he was impressed with how you can drill down into specific content. They subsequently cancelled Lawtel and that in turn left budget to consider adding to their current online subscription with us with more relevant content. ',NULL,NULL,39,1,'LISA REGAN 13/07/2011:  That\'s great feedback, thanks for sharing.  I\'m looping in James Wilson (Head of Law Reporters) and Laura Vosper (Marketing) who might like to know this and use it for marketing.','1310484119.doc','CI Monitoring graphs and percentages for April 2011.doc','Stratford Upon Avon District Council',NULL,NULL,'All England reporter','',0,1351,'2011-07-12 15:25:16',1921,'2011-07-18 13:50:56',7,61,NULL,NULL,NULL,'N'),(4382,'PRODUCT','Customer training session',NULL,12070,NULL,NULL,'','julie Ball Sara Hilliard ',1,1,NULL,NULL,'The client was looking for ways to easily download precedents and clauses from BWPAS and manipulate them in word. Unfortunately the new Alt renditions often can\'t cope with the number structure in BWPAS precedents - below is an example:\r\n\r\nlook at the precedent - 2B.1     Codicil changing a legacy from one charity to another; altering a gift of one house (which has been sold) so as to comprise another; inserting an exclusion of Wills Act 1837, s 33; adding a gift of an annuity; and adding long-stop trusts of residue.\r\n\r\nfirstly, if you download this using the new alt rendition, it can\'t handle the para\'s which have letters a,b,c etc - and so also assigns them a number as well as a letter.\r\n\r\nsecondly, various bits of this document (variations of clauses) are hyperlinked - and so if for example you link to the bit which says - \'The first schedule\r\n5A. [Form 1A.13.4, AP[5.99]]\', and try downloading the clause there, again the numbering goes all over the place and so trying to splice these 2 parts together is quite frankly impossible!\r\n\r\n\r\nOther issues with downloading BWPAS precedents happen if you try to look at the so called \'complete\' wills. \r\ne.g Will of widow with adult children, disposing concisely of an estate of only moderate size; appointment of children as executors and trustees; whole estate to children (with substitution of grandchildren at 18); short administrative provisions.\r\n\r\nThe users I was training wanted an easy way to get the whole will into word into which they could then add and remove clauses but (as has been reported many times before) the clauses are all separated into individual pages on library making it virtually impossible to get a complete document extracted with an easy to use numbering structure.\r\n\r\nindeed even if you use the new alt rendition to download e.g: clause 5 of this complete will: Exclusion of apportionment (Form 1A.29.1, AP[5.165]), it just can\'t cope with the number structure again.\r\n\r\nAll this makes it VERY DIFFICULT for a user to easy use and manipulate these highly respected precedents and the whole content set needs serious work to ensure users have a good experience when using it online - currently we are a long way from that. \r\nWhat I went through with this client was not an unusual workflow but i was unable to find a simple way to help them achieve their aim of downloading clauses & documents from the BWPAS work and easily manipulate them in Word.\r\n\r\nall the above user-experience has been reported before.\r\n',NULL,NULL,56,3,'PM: Email sent to Tracey McGovern 13.07.11\r\nPM: Update received from David Smith 13.07.11: \"Hi tracey, I also asked jonh hanratty about this query as it\'s a precedent based issue and I believe john is scheduling a meeting soon to discuss further - I\'ve included him on this so he can include you on the invite.\"\r\n\r\nPM: Udate from Tracey McGovern 13.07.11\r\n\"Hi David, Philip and John,\r\nI am aware that this issue is an ongoing one with Wills Precedents, Division AP. I have asked the authors if they could change the layout of their precedents but it\'s not something they wish to do.\r\nI have also spent time with Mark Wilson, Katy Forrester and Anne Adkins making amendments to the xml files in order that they are more user friendly for the online subscriber.\r\nI\'m at a loss at the moment as to what else I can do as it seems these problems are more technical than content orientated, therefore I am going to pass this email on to Katy Forrester in the hope that she might be able to point me in the right direction as regarding who can deal with this query now that online is now outsourced. \r\nI will let you all know Katy\'s response as soon as I receive it.\"','',NULL,'',NULL,NULL,'BWPAS precedents','',341,65,'2011-07-12 16:16:47',1921,'2011-11-22 17:08:05',72,0,0,'TBC','','N'),(4392,'PRODUCT','Customer training session',NULL,4432,NULL,NULL,'','Paul Kirby',1,4,NULL,NULL,'Paul really likes LexisPSL and was very positive about the contnet.  He had a suggestion for the tool box of PI and wondered if someone would give him a call for a quick chat about it?  Paul Kirby - 01603 723750\r\n\r\nPaul wondered whther we could add in the phrasing for standard directions and create a bit of a list of these directions that the user can \'cherry pick\' and use to create their wording?  Sorry, this is my terrible explanation of it!  If you call Paul just say it is a call following up on some feedback he gave in a training session with Lynne\r\n\r\nThanks',NULL,NULL,44,9,'','',NULL,'',NULL,NULL,'LexisPSL Personal Injury','',341,68,'2011-07-13 14:48:57',371,'2011-08-03 15:46:25',72,371,32,NULL,NULL,'N'),(4402,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Anne Roache - Head of Library & Information Services ',1,1,NULL,NULL,'From the Client:\r\n\r\nThe \"did you mean\" comments centred around the fact that the list of suggestions auto scrolls down through a long list (of often irrelevant terms) meaning that the user has to scroll back up the page to get back to the text entry box.  Also when one types  \"Re\" as part of the name of a case it comes up with a plethora of again irrelevant suggestions and doesn\'t seem to recognise \"Re\" as a legitimate term in itself.  We agree that this feature can be helpful when searching legislation but is more of an annoyance when searching case law.',NULL,NULL,59,9,'LISA REGAN 18/07/2011:  The customer is actually talking about suggested searches on cases search boxes (not the \"did you mean?\" functionality - which appears at top of results). It is a valid point that \"Re...\" could be one of a million cases and therefore perhaps the wordwheel should kick in after a fourth letter/space is typed.  I will monitor feedback if this is a customer frustration and if so rasie a webstar to amend.','',NULL,'Weil, Gotshal & Manges ',NULL,NULL,'Lexis Library','',291,2481,'2011-07-14 08:02:27',571,'2011-07-18 14:58:15',7,61,NULL,NULL,NULL,'N'),(4412,'PRODUCT','Customer training session',NULL,8774,NULL,NULL,'','',1,1,NULL,NULL,'The team do work for the elderly and feel that a precedent specifically for the removal of an incapacitated trustee would be very useful. We do not currently have one. They also fed back that this comes up on a fairly regular basis on forums and it would be useful for them to be able to say that LL now has one. It is a commonly used form in elderly work.',NULL,NULL,47,3,'LISA REGAN 13/07/2011:  Directing this query to Robert Walker in EF&P.  This is something that his team woud produce.\r\n\r\nROBERT WALKER 15/07/2011: We have a selection of clauses and, eg, transfers, dealing with incapacitated trustees in vol 40(2) TRUSTS AND SETTLEMENTS - Forms 68 -72. I will speak with our contributors and see if there is something else that can be added here. - Robert','',NULL,'',NULL,NULL,'Lexis Library','',101,2461,'2011-07-14 14:11:41',1921,'2011-07-20 15:31:25',7,61,NULL,NULL,NULL,'N'),(4422,'PRODUCT','Customer training session',NULL,8774,NULL,NULL,'','',1,1,NULL,NULL,'The delegates wanted to run a search for a \"lift & shift\" clause. This didn\'t come up as it is a synonym for a clause requiring pipes to be lifted and relocated. Apparently this is a commonly used term within the field. We do have the content or a precedent that the clause could be lifted from. However, it may be a good idea to include this is in the list of synonyms we are currently putting together.',NULL,NULL,47,3,'LISA REGAN 13/07/2011:  I\'m directing this query to Katy Forrester who manages the list of synonyms and can get this validated/added\r\n\r\nKaty Forrester 15.07.11 : Please could you direct me to the clause that \'lift and shift clause\' is synonym for? I\'ll then look into the best way to get this equated to the content.\r\n\r\nNina Packman 15.07.11 I\'ll find out exactly what the clause is and get back to you. It may take a little while as I\'ll need to hear back from the delegate with the query but I will get on it and let you know asap\r\n','',NULL,'',NULL,NULL,'LexisLibrary','',131,2461,'2011-07-14 14:16:59',1921,'2011-07-18 13:48:35',4,61,NULL,NULL,NULL,'N'),(4432,'PRODUCT','Customer training session',NULL,8774,NULL,NULL,'','Andrew Holden ',1,4,NULL,NULL,'Andrew Holden has previously raised this issue through the contact the team option on PSL but has received no response. He has informed me that the TP1 available in Smart Forms is different to those available on the Land Registry website. The form is in the wrong format. \r\n\r\nIn relation to the TP1 he states that box 12 is not correct. The LR website version is set out: definitions, rights granted for the benefit of the property, rights reserved for the benefit of other land, restricitive covenants by the transferee, restrictive covenants by the transferor, other. All our contained within one box with separate sections for each heading. Our Smart Form has an initial header of \"rights granted for the benefit of the property\" and then a separate section of definition. None of the other headings appear.',NULL,NULL,47,3,'PM 15.07.11:Originally sent to Malcolm Skinner who has advised this is actually a Property Issue.\r\nSent to Malcolm Dowden\r\n\r\nUpdate from M. Dowden\r\nThe feedback is correct.  I have removed the SmartForms version from LexisPSL property.  The point needs to be referred to Carole Gallagher/Rob Evans so the SmartForms version can be corrected and reinstated.\r\n\r\nPM 18.07.11 Email sent to Carole Gallagher/Rob Evans','',NULL,'',NULL,NULL,'Lexis PSL Private Client','',131,2461,'2011-07-14 14:30:26',1921,'2011-10-14 15:19:10',82,201,0,NULL,NULL,'N'),(4442,'CUSTOMER','Other',NULL,204,NULL,NULL,'','Caroline Cleverly/Information manager?',1,4,NULL,47,'30.06.11 Meeting with Caroline Cleveley, Kate Menin DR PSL and Caroline Bell DR Insurance PSL all of AG, with Christian Fleck, Sarah Healy and Ruth Pratt of LN.\r\n\r\nFirst meeting for the DR PSLs/LN DR team. The meeting generally explored how AG DR PSLs currently use PLC and was then followed by a brief demo of the PSL DR product which prompted further discussion points.\r\nIt was an initially coool reception from Kate Menin though she appeared to warm up as the meeting progressed.  The key issues that came to light were:\r\n\r\nDevelopment issues\r\n use of the back button (it works which is great;  back here we should use it more ourselves to ensure we are familiar with it when doing demos) \r\n\r\n the ease of being able to email a PN/Case/Precedent/Form from the product to another fee-earner in a way which simply takes the document into Kate\'s own email system so that she can send the email from herself to her distribution list - I guess this is a development issue which I suspect might be quite key for all practitioners\r\n\r\n Kate\'s concern that if (and it is a big if) Baili demises, how will she then link to cases in her external quarterly bulletins to clients - they can access Baili for free but few will have a Lexis Library subscription\r\n\r\n The ability to download cases/reports etc in word format so that they can be searched - this needs to be checked in relation to all types of documents within the product however I think use of \'ctrl + f\' works for this purpose \r\n\r\n Weekly round-up email: they would want this included in the automatic weekly alert. Subsequent to the meeting this was discussed with and auctioned by Janna Purdie (JRP) so this good news will be reported back at the next meeting\r\n\r\nAs to critical areas that Kate mentioned specifically by name:\r\n\r\n1. The ability to rely on certain types of PLC precedent - such as CPR 36 offer letters - so that she doesn\'t need to spend time updating them - we cover this already \r\n\r\n2. Litigation funding - this area of DR practice is on the verge of whole scale change and it will radically affect how law firms operate. Both Kate and Caroline mentioned litigation funding a few times - Kate particularly in the context of CFAs where they have worked hard on producing their own bespoke precedents.   It struck me that AG are the type of firm that may  be quite geared up for this in terms of their CFA work they have currently undertaken and/or will consider this whole sphere of practice as an important one to focus on.  From a content perspective we are weak on this. This is partly due to the nature of CFAs being of their nature relatively bespoke creatures.  However, the need to develop this aspect of the product is known to both JRP and myself and we are looking at ways of strengthening our offering here  \r\n\r\n3. Current awareness - it seems to me from what Kate was saying and from looking at the Resolve update she produces that a fair degree of her work involves extracting out from PLCs current awareness and, essentially, rehashing into her own bulletins. Inclusion  of the case name in the headline of our reports to make the searching functions more effective was a preferred choice expressed by Kate and Caroline. Subsequent to the meeting this was discussed with JRP and we are now including case names in our report titles. This will be communicated to AG at the next meeting\r\n\r\n4. Substantive law - this didn\'t appear to be a particular issue for Kate who said that she sometimes delved into those matters, so I got the feeling that either it is not high on her agenda or she recognised that what we currently focus on in our product is the litigation procedure only.  For Caroline, however, substantive law (insurance) is something that she is very involved in as well as market trends/news in the industry. LN has no insurance PSL offering; I got the feeling (?) that either PLC don\'t or, if they do, AG have not purchased this module\r\n\r\nNext meeting\r\nThis has been scheduled for 25 August with Kate Menin, Caroline Bell, JRP and RP.\r\n',NULL,NULL,9,9,'','',NULL,'',NULL,NULL,'PSL DR ','',0,2331,'2011-07-14 22:59:58',1921,'2011-07-18 14:18:23',4,2331,NULL,NULL,NULL,'N'),(4452,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Paul Benski',4,1,NULL,NULL,'The above council recently had a training session and lvoed being able to download a precedent from EF&P into word. The issue was they only had word 2003 which was not compatible with the download. Given the value this can add, i have attached a file that IT can use to filter down to all computers in a council to allow them to download this in word 2003 and benefit from the advantages this bring. Obviously worth pointing this out. ',NULL,NULL,59,3,'LISA REGAN 18/07/2011:  I\'m not sure how you suggest ilet customers know? -Do you want this sent around the sales force, mentioned in eburst, emailed to all customers?Thanks, Lisa\r\n\r\n\r\nEF&P RESPONSE 19/07/2011: This is actually an issue linked to a user\'s Internet Explorer settings or Control Panel settings (which  may be controlled by their company) ie the user doesn\'t get the option to Save the prec - instead it automatically opens in an \'alternative format\' window and can\'t be saved or edited properly.\r\n \r\nAs far as we know there\'s no solution at this end. It is just a case of dealing with the problem as and when we knowm a customer is experiencing it. It\'s not ideal because it can give a false impression as to how useful the downloads are.\r\n \r\nOne way to fix it:\r\n1.         Open the Control Panel and go to Folder Options. \r\n2.         Select the File Types tab. \r\n3.         Scroll down to the extension type that you want to reset. \r\n4.         Select the extension type (doc), then click Advanced. \r\n5.         Check the \"Confirm open after download\" check box, then click OK.\r\n6.         Click Close to the Folder Options dialog box. \r\n \r\nPlease contact Claire Heeley if you need more information. \r\nRegards','',NULL,'Amber Valley Council',NULL,NULL,'EF&P','',131,1351,'2011-07-15 11:08:23',1921,'2011-09-14 10:20:12',72,61,0,NULL,NULL,'N'),(4462,'PRODUCT','Renewal or new business conversation',NULL,13193,NULL,NULL,'','Chris Holden- Partner',2,142,NULL,NULL,'Customer uses \"Email Delivery\" to save search results in the library which is then  saved in Outlook and shared among employees. Customer also uses this function to email information direct to customers. However the function seems to have been removed with the new Tolley Library, however it is within Tolley Guidance and Lexis Library. ',NULL,NULL,53,9,'This function is being added to TolleyLibrary in the next release (last week of August 2011 at the latest). \r\nThanks\r\nDan','',NULL,'',NULL,NULL,'General Tax Practitioner','',341,1411,'2011-07-19 10:59:13',1921,'2011-07-20 15:08:00',7,2632,NULL,NULL,NULL,'N'),(4472,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','In-House User Group member',6,4,NULL,NULL,'Feedback from In-House User Group member\r\n\r\nTechnical/Functionality\r\nBrowse Topics - look like they are alphabetical but they aren\'t - can they be?\r\nLH back to search box - found it annoying.  Could it be just at top or bottom - no document was so long that you needed it scrolling down\r\nWhen you search for PN you get a list of all relevant PNs and their subheadings - but if you go direct to a PN you don\'t get a summary of what the PN is about.\r\nUpdates - can you chose to have some weekly, some monthly eg CoCo weekly but PPty monthly.  \r\nSpecific content needed\r\nCoCo - company info for branches of a company eg she found special rules for dormant companies - are there special rules for branches?  \r\nQuestion she needed answered:  BS have only one domain name and one email address which they use for all their subsidiaries and branches around the globe.  BS have disclaimer at end of all emails and she wanted to know what company info was needed as part of this disclaimer in different jurisdictions. Searched \"Company admin\", \"Company and Email\" \"Email and letterhead requirements\"\r\nIe what are trading disclosure requirements around the globe.  PLC had info but very difficult to find - it was under \"Trading disclosures\"\r\n\r\nSearched \"Standard Terms and Conditions\" - not much came up, lots of EF&P.\r\n\r\n\"Consultancy agreement\" - she wants a short form.\r\n\r\nAlso documents drafted from both sides\r\n\r\nNew legal Services Act \r\n wants checklists, distinction for sole in-house/small teams or GC.  For example - asked by CEO to advise on of their consultants on a contract not connected with the business as a favour - can she do this?  \r\nCan you advise prospective employer re restrictive covenants with previous employer?\r\nWhat opportunities does it open up?\r\n\r\nCompetition - she needs practical information for smaller companies.  \"I am not an expert - what do I need to be aware of?\"\r\n\r\nPLC\r\nToo much info on PLC so hard to find what is relevant\r\nUpdates are good\r\nLikes fact they do a short form and a long form - although short form isn\'t always that short\r\nLikes drafting from both sides - but short forms often doesn\'t do this - only long form\r\n\r\n',NULL,NULL,61,6,'','',NULL,'In-House User Group member',NULL,NULL,'LexisPSL In-House','',0,591,'2011-07-19 13:03:28',1921,'2011-07-20 15:00:55',6,591,NULL,NULL,NULL,'N'),(4482,'PRODUCT','Customer training session',NULL,1781,NULL,NULL,'','Brian Harris/Managing Partner',1,4,NULL,NULL,'Brian wanted a charging clause, he feels this is a basic clause that he would expect to see in LPSL.  The only result from a search was:\r\nPrecedent 10     Variation of an estate on intestacy where attorney appointed to administer estate and incorporating charging clause1\r\n\r\nso a document incorporatng a charging clause but not just the clause itself.  Can the charging clause be added to LPSL as a standalone clause???\r\n\r\nThanks',NULL,NULL,56,3,'MS - 20/07/11\r\nAssuming the reference is to a solicitor (as a professional executor/trustee) charging clause it is not common for such to be used these days as legislation has rendered them effectively obsolete.\r\nHowever, a search (\'charging clause\') will reveal  2 such clauses in PSL W&P - both a concise and full form.','',NULL,'',NULL,NULL,'LexisPSL Wills & Probate','',131,68,'2011-07-19 15:21:32',1921,'2011-09-13 16:49:45',72,2622,0,NULL,NULL,'N'),(4492,'PRODUCT','Customer training session',NULL,1781,NULL,NULL,'','Brian Harris/Managing Partner',1,4,NULL,NULL,'Brian wanted a declaration of trust but a search of LExisPSL W&P only finds one result, he thought this was pretty poor and would have expected to see more??\r\n\r\nthe doc he found was:\r\nForm F2.5: Declaration of trust of property devised or bequeathed by will on a secret trust1\r\n\r\nI appreciate there is the Private Client PSL module but Brian only has W&P LPSL',NULL,NULL,56,3,'MS - 20/07/11\r\nThe term \'declaration of trust\' is very unspecific. It could refer to a will trust or to a standalone trust and additionally there are, within those parameters, hundreds of forms of trusts. If he could be more specific it would help enormously.\r\nPSL is not really designed to cater for this degree of width which is to be found in LL. Within PSL W&P there are at least 16 forms of will trust (including the one found) but no standalone trusts as these are to be found in PSL PC.\r\nUnfortunately, we cannot include everything but if there is something specific that is required we can pass it up the line for approval.','',NULL,'',NULL,NULL,'LexisPSL Wills & Probate','',91,68,'2011-07-19 15:25:34',1921,'2011-10-31 16:42:12',92,2622,0,'TBC','','N'),(4502,'PRODUCT','Customer training session',NULL,1781,NULL,NULL,'','Brian Harris/Managing Partner',1,4,NULL,NULL,'Brian was looking for a basic shareholders agreement and would have expected LPSL CoCo to contain one.  He does have a library sub so did find what he needed in EF&P.',NULL,NULL,12,3,'','',NULL,'',NULL,NULL,'LexisPSL Company Commercial','',101,68,'2011-07-19 15:59:26',241,'2011-10-20 12:28:39',72,241,271,'','','N'),(4512,'PRODUCT','Informal conversation',NULL,1712,NULL,NULL,'','SARAH PALMER/PARTNER',1,132,NULL,NULL,'family forms - divorce petition, male / female unable to remove selection.  Client has to start again which is frustrating.\r\n\r\n',NULL,NULL,28,3,'','',NULL,'',NULL,NULL,'LEXIS SMART','',131,35,'2011-07-20 12:52:58',1921,'2011-10-31 16:43:03',92,341,0,'TBC','','N'),(4522,'PRODUCT','Informal conversation',NULL,1712,NULL,NULL,'','Sarah Palmer/Partner',1,132,NULL,NULL,'no \'undo\' function\' - emailed Lexis who suggested could close form and re-open but doesn\'t work',NULL,NULL,28,3,'','',NULL,'',NULL,NULL,'LexisSmart','',341,35,'2011-07-20 12:54:00',35,'2011-07-26 10:48:05',22,341,0,NULL,NULL,'N'),(4532,'PRODUCT','Informal conversation',NULL,1712,NULL,NULL,'','Sarah Palmer/Partner',1,132,NULL,NULL,'Will assembly (AWD) - long and complex, too may questions, both trainee and solicitor have tried to complete but gave up (after 45 mins).  Example would be parts of body you can leave in Will, way too much detail\r\n\r\n\r\nResponse: We have been working on a new version of the AWD to respond to this and other similar feedback. It will feature upfront questions on which sections users wish to include in their will drafting so that certain questions need not be answered. Once this is available I will send access to Sarah.',NULL,NULL,47,3,'','',NULL,'',NULL,NULL,'LexisSmart','',131,35,'2011-07-20 12:55:13',1921,'2011-11-23 10:18:56',112,331,0,'TBC','','N'),(4542,'PRODUCT','Renewal or new business conversation',NULL,2638,NULL,NULL,'','Paul Cowdery/Partner',1,4,NULL,47,'1. The site is slow to load. \r\n2. There is no comparison between the 1985 Companies Act and 2006 Act which PLC includes and which is helpful (although as we get used to the new act there will be less need for this). \r\n3. If you search in the wrong subject matter, for example if I search for something in corporate, it will not come up even if it is in their company and commercial section, even if you have the relevant subscription (there may well be a way around this that I am not aware of). \r\n4. There were a couple of areas that I was looking for information on and couldn\'t find e.g. personal guarantees, and unfair prejudice and derivative actions. \r\n5. The precedents for the most part are still not as good as those provided by PLC although they have improved and will no doubt continue to do so. \r\n6. Some areas aren\'t covered off and without access to Lexis Nexis library (for which you have ascertained we have to pay more) precedents cannot be found. \r\n7. The e-mail updates do not appear to be as useful or as relevant to me as some of those provided by PLC. \r\nThe good things about Lexis Nexis which PLC does not provide are:- \r\n(a) Access to their company commercial section which we do not currently have a subscription for with PLC (although I think you have said that this may be changing).\r\n(b) Easy access to the relevant statutes which I have not trialled very much but I think will be very useful. \r\n(c) A fast draft service (which I think PLC provides but we would pay extra for). Again I didn\'t have the opportunity to properly try this out but I think will be useful.\r\nI think the main issue is with the precedents and this may well be a stylistic thing, some people may prefer the Lexis Nexis precedents. \r\nCommercial Property \r\nWhilst Lexis Nexis has definitely improved from is previous versions it is still not a patch on PLC in relation to Commercial Property. My impression is that the majority of commercial property solicitors utilize the services of PLC for drafting documents for use in commercial property transactions.\r\n',NULL,NULL,10,3,NULL,'',NULL,'',NULL,NULL,'','',61,35,'2011-07-21 09:12:54',1921,'2011-11-15 14:11:26',72,59,0,'TBC','','N'),(4552,'CUSTOMER','n/a',NULL,NULL,NULL,NULL,'','',12,172,NULL,NULL,'test record',NULL,NULL,62,12,NULL,'',NULL,'other(0)',NULL,NULL,'','',442,801,'2011-07-21 10:23:13',3552,'2011-10-20 10:37:14',21,101,0,'','','N'),(4562,'BLANK','n/a',NULL,NULL,NULL,NULL,'','',12,172,NULL,NULL,'Test messasge',NULL,NULL,62,12,NULL,'',NULL,'',NULL,NULL,'','',442,15,'2011-07-21 10:58:19',691,'2011-07-29 10:46:27',21,101,2,NULL,NULL,'N'),(4572,'PRODUCT','Customer training session',NULL,6816,NULL,NULL,'','Sarah Barnes; Rebecca Nixon; Georgina Peckett',1,4,NULL,NULL,'Please assign this insight to Karen O\'sullivan\r\n\r\nThe training session was clinical negligence based but I have had this sort of thing back from general PI lawyers too that our quantum dbase often returns no results. This is partly because of the way the search only looks over the top bit of a quantum report (to be addressed) but also the extent of the dbase - which I know is due to receive a major marketing push and so will generally improve over time.\r\n\r\nHowever, this insight is feedback from clin neg practitioners about the decision we have taken to, on the whole, only accept court decisions, unless it\'s really unusual.\r\n\r\nThe fe\'s thought this was probably why they could rarely find anything for their practice area as they said it was RARE that one of their cases would go to court and actually for them, it was as useful to get some quantum, even if it was an out of court settlement, rather than nothing at all - which is what happens a lot of the time.\r\n\r\nThey thought that if we are to increase our dbase anywhere close to what they used to get with lawtel (they really miss lawtel), then we should reconsider this and actually actively accept out of court settlements. While they admitted court settlements are potentially more reliable, because they are rare, the chances of building a useful dbase covering all the wide variety of conditions etc they need to deal with would be an impossible and very slow task. They thought that out of court settlements still have to have gone through review by Barristers and have to have been researched before agreement is reached so this was (for them) still very useful.\r\n\r\nSome stats they gave me was that for one of them, in 8 years of practice only 1 case had actually gone to court (and this is a serious PI & Clin neg firm, not a factory). They would love to submit their cases but won\'t take the time to even try and get their cases on the dbase if they think most will be rejected as they are not court decisions.\r\n\r\nOur closest competitor to this is Lawtel which users LOVE and they do accept out of court settlements as a rule, so I see no reason why  we shouldn\'t too. Not sure if kemp is just court settlements but if  not then even more reason why we too should encourage rather than discourage these - this is the market leader.\r\n\r\nI appreciate we don\'t want a deluge of rubbish small settlements for common injuries but perhaps we should review this general policy.\r\n\r\nI think there are ways we could do this and still have an authoritative dbase, here are some ideas:\r\n\r\n1) change the quantum entry form so that \'court and judge\' are NOT required fields as they currently are - or put a little note underneath indicating they should put \'n/a\' or \'out of court settlement\' if that\'s what it is. Alternatively perhaps we have tick box for \'out of court settlements\'.\r\n\r\nWe do say at the bottom of the form we will consider out of court settlements for odd injuries but the form then has a \'*\' required field by the court box which would actively discourage people to submit unusual out of court decisions.\r\n\r\n2) We perhaps build into the search form for quantum a tick box option to \'show all reports\' or \'show just court settlements\'\r\n\r\n3) As long as the quantum report itself somehow shows it\'s an \'out of court\' settlement then the user can decide if they are to use it - better than them just getting no results.\r\n\r\n\r\nI also asked them about whether regional variations were important (I know we are thinking of this) and they thought in their clin neg practice area it wasn\'t really relevant.\r\n\r\nI accept some of their opinions were because they are clin neg and not general PI but I do think we are potentially missing a trick here to build a rival to lawtel quickly (especially if we can incorporate point 3 above into the report).\r\n\r\n',NULL,NULL,44,1,NULL,'',NULL,'',NULL,NULL,'','Lawtel / Kemp',91,65,'2011-07-21 13:51:07',371,'2011-08-01 09:28:13',72,371,42,NULL,NULL,'N'),(4582,'BLANK','Direct Mail',NULL,NULL,NULL,NULL,'','',0,0,NULL,NULL,'Test Copy',NULL,NULL,0,0,NULL,'',NULL,'',NULL,'0','','',0,1631,'2011-07-25 15:27:16',101,'2011-08-23 09:14:39',21,0,0,NULL,NULL,'N'),(4592,'PRODUCT','Other',NULL,7258,NULL,NULL,'','Sam Higgins',1,4,NULL,47,'Comments below from users on their recent trial of PSL (collated via Sam Higgins): \r\n\r\n\"Very useful - much more comprehensive and accessible when compared to PLC\"\r\n\r\n\"In relation to the Company Commercial documents they are significantly inferior to the PLC precedents.\r\nMy view is that we should stay with PLC and then look at it again next year when we need to renew PLC.\"\r\n\r\n\"I vastly prefer Lexis Nexis for litigation, although I suspect PLC is better for corporate matters.\"\r\n\r\n\"The precedents aren\'t as good as PLC but I did like the subject area summaries as they were concise and gave a good overview. I noticed that some of the more valuable content was unavailable as you have to subscribe to Lexis Library as well which was annoying (and I know how expensive Lexis Library is!).\r\nI much prefer PLC.\"\r\n',NULL,NULL,12,6,NULL,'',NULL,'',NULL,NULL,'','',31,2612,'2011-07-26 13:30:11',1921,'2011-09-01 15:28:43',92,811,171,NULL,NULL,'N'),(4602,'COMPETITOR','Renewal or new business conversation',NULL,2822,NULL,NULL,'','Clare Brown - Information Manager',1,4,NULL,47,'I had a meeting this week with Clare Brown, the information manager at Collyer Bristow.  I was walking Clare through Family Law PSL.  During our session she ran through a demo of PLC for me and highlighted the points her and the fee earners love about PLC that we don\'t currently have in PSL (in a constructive manner i might add!).  I thought I would share these as I\'m sure a lot of other lawyers and information managers would have a similar view:\r\n\r\n1.  Each document (whether it be a practice note, journal article or precedent) has either a date stamp or a \"status\" to say whether it is maintained or not.  Clare thought that this is absolutely vital in order for lawyers to trust the information they\'re looking at.  Even if there is no actual date stamp, having something that shows the content is monitored and checked is essential.\r\n2.  Each practice area has a different colour within PLC.  So although the layout is the same, the colours give each area a feeling of being slightly unique.  Not a major point, but thought I\'d mention it.\r\n3.  Having the list of practice areas at the top of the screen was deemed a watse of space.  Clare suggested most lawyers will live in one particular practice area and so having this on all screens wasn\'t necessary\r\n4.  On the prcedents tab, it\'s not clear that a precedent is available in both LexisSmart and normal format (i.e. clicking on the Smart icon brings up the smart version but clicking on the blue link will bring up a standard version).  It\'s not clear from the layout that both options are available.\r\n\r\nHope these points are useful, and it would be great to know if we are planning to address any of these.  Or if we\'re not, it would be useful to know the reasons why, so we can explain to clients.\r\n\r\nThanks\r\nDavid',NULL,NULL,59,6,NULL,'',NULL,'',NULL,NULL,'','',41,7,'2011-07-26 14:55:22',1921,'2011-10-31 16:40:27',72,59,0,'TBC','','N'),(4612,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Jonathan Clarke / Head of Tax',2,142,NULL,82,'The client prefers the way that the old LexisLibrary generated email alerts along with the brief text around the alert.  He feels that the new alerts from Tolley Library don\'t tell him much detail and also do not contain the background text.  He preferred the old alerts structure because he could read the alerts on his blackberry and now he can\'t which frustrates him.  ',NULL,NULL,53,9,NULL,'',NULL,'Sanofi-Aventis',NULL,NULL,'General Tax Practitioner','',341,1371,'2011-07-27 12:08:43',2632,'2011-07-29 11:09:51',112,2632,22,NULL,NULL,'N'),(4622,'PRODUCT','Customer training session',NULL,12122,NULL,NULL,'','',1,1,NULL,NULL,'I was training a trainee at Tollers that works in Wills and Probate. She had been sent a letter by HM Courts Service, referring her to two page numbers from Tristram & Coote\'s. She was trying to use LexisLIbrary to find the pages but as do not have a page search feature, nor do we show page numbers on the page or ToC, she could not do this. She found it very frustrating, as they do not have hard copy of the book in her office. \r\n\r\nI have heard this complaint several times before - is there any scope for adding a page number search to the Commentary search page, or for the ToC show show the page numbering as well? It is a big problem when trying to apply hardcopy principles to our online offering. ',NULL,NULL,56,4,NULL,'',NULL,'',NULL,NULL,'','',71,1881,'2011-07-28 09:47:41',1921,'2011-09-14 09:29:12',72,61,0,NULL,NULL,'N'),(4632,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Christine Walker',1,4,NULL,47,'See below re my suggestion of a field in the \'Tool box\' on PSL to allow a customer to enter a favourite website of their chosing, like you could do using Client Admin in Lexis Library. \r\nIt was a suggestion to try and get round the CPSE form access issue where it\'s content controlled by PLC, but actually free, but has wider implications as Malcolm points out and potentially any PSL module may benefit from this feature.\r\n\r\nFrom: Dowden, Malcolm (LNG-LON) \r\nSent: 19 July 2011 09:19\r\nTo: Allan, Gavin (LNG-HBE)\r\nCc: Davies, Lynne C. (LNG-HBE); Dickin, Emma (LNG-LON); Cottle, Suzanne (LNG-HBE); Smith, David (LNG-HBE)\r\nSubject: RE: Property PSL Session - Making CPSE\'s More Prominent, a suggestion...\r\n\r\nThat strikes me as a great idea.  Quite apart from addressing the immediate issue it connects with ideas raised by Hayley Tam (my colleague on the environment module), the theme of which is that we could produce a much stickier product if customers were able to have a direct hand in its configuration and integration with their work.   At the moment, LexisPSL is essentially a flat website, and customers are relegated to the role of mere consumers of information.  \r\n\r\nMalcolm Dowden\r\nSolicitor, LexisPSL \r\nHalsbury House\r\n35 Chancery Lane\r\nLondon\r\nWC2A 1EL\r\nmalcolm.dowden@lexisnexis.co.uk\r\n+44 (0)20 7400 2739 Tel\r\n+44 (0)7748760131 Mob \r\n\r\nFrom: Allan, Gavin (LNG-HBE) \r\nSent: 18 July 2011 22:45\r\nTo: Dowden, Malcolm (LNG-LON)\r\nCc: Davies, Lynne C. (LNG-HBE); Dickin, Emma (LNG-LON); Cottle, Suzanne (LNG-HBE); Smith, David (LNG-HBE)\r\nSubject: Property PSL Session - Making CPSE\'s More Prominent, a suggestion...\r\n\r\nHi Malcolm\r\nThanks for a really interesting property PSL session earlier today.\r\nA thought occurred to me just now about possibly getting CPSE\'s as a link on people\'s front page without incriminating Lexis (after what you were saying).\r\n\r\nDo you think it would ever be possible in the tool box area to have an option to insert a link of an individual\'s choice, so the customer could chose to put CPSE as theirs if they wanted? \r\nWe have done it using Client Admin on the Practice Area Pages of Lexis Library for adding links of a customer\'s choice such as Companies House/Land Registry etc.\r\nIt could open up a whole raft of possibilities on a general note in all PSL modules as well for other users to put any link of their choice such as ACAS for Employment etc.\r\nJust a thought as the CPSE\'s unfortunately seem quite a potential deal breaker for many firms... (eg Buckles)\r\n\r\nCheers,\r\nG\r\n\r\nGavin Allan\r\nTraining Consultant\r\n\r\nLexisNexis\r\nHalsbury House\r\n35 Chancery Lane\r\nLondon, WC2A 1EL\r\ngavin.allan@lexisnexis.co.uk\r\n+44 (0)7740 631 480 - Mobile',NULL,NULL,49,3,NULL,'',NULL,'Buckles',NULL,NULL,'Property PSL','',31,66,'2011-07-28 11:00:52',1921,'2011-10-31 16:36:57',72,59,0,'TBC','','N'),(4642,'PRODUCT','Customer training session',NULL,2023,NULL,NULL,'','Emma Williams/Assistant Solicitor',1,4,NULL,NULL,'Emma liked LexisPSL, the firm has access to PLC Private Client too.  A specific query came up concerning Cross Border Estates, the guidance in LexisPSL only really covers France.  Emma thought this was great but asked if we would be adding other countries to the list?',NULL,NULL,56,6,NULL,'',NULL,'',NULL,NULL,'LexisPSl Private Client','',91,68,'2011-07-28 13:14:08',1921,'2011-09-13 16:41:15',92,2622,0,NULL,NULL,'N'),(4652,'PRODUCT','Customer training session',NULL,1470,NULL,NULL,'','Andrew Murphy/Partner',1,4,NULL,NULL,'Andrew asked why the Cross Border topic only covered France and what our plans were to add other countries to the list?',NULL,NULL,56,6,NULL,'',NULL,'',NULL,NULL,'LexisPSL Private Client','',91,68,'2011-07-28 13:15:14',1921,'2011-09-13 16:40:08',92,2622,0,NULL,NULL,'N'),(4662,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Helen Ambler',4,4,NULL,NULL,'A delegate asked me to see whether we had a \"green lease\" in LL or PSL. Upon discussion with him I ascertained that by this he meant a lease which has an environmentally friendly aspect. i.e. a lease which allows the tenant to divert water to power a hydroelectrical system. The leases usually have incentives for incorporating the \"green\" aspects. I could not seem to find anything of relevance in LL or PSL. It may be worth while drafting a precedent for PSL as the push from the government is towards greener living/power.',NULL,NULL,39,3,NULL,'',NULL,'Calderdale Met Borough Council',NULL,NULL,'','',101,2461,'2011-07-28 22:14:37',351,'2011-07-29 11:31:10',22,351,0,NULL,NULL,'N'),(4672,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'XML doesn\'t present gridline on web properley - can\'t create tables of precedents.',NULL,NULL,48,12,NULL,'',NULL,'',NULL,NULL,'','',341,2772,'2011-07-29 08:50:19',691,'2011-07-29 09:10:30',92,691,12,NULL,NULL,'N'),(4682,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Victoria Jankunaite / European Head of Tax',2,152,NULL,82,'Client explained that our current method of providing timely updates (such as breaking news stories or podcasts) was inadequate.  The current alerts method within Tolley Library submits an email to the end user but contains no supporting commentary meaning the customer needs to log into Tolley Library at their computer to view the results.  This is time consuming and means that client may not actually log on at all.  Client suggests using Blackberry \"push\" technology to directly notify and download podcasts or breaking news stories to their blackberry device.  This means if the client is walking down the street (or they are travelling somewhere) then they can automatically receive the media and view it straight away.  Examples could include mini presentations, podcasts and video etc.  Deloitte and other large firms are already using this technology to keep their clients efficiently informed.',NULL,NULL,53,5,NULL,'',NULL,'Research In Motion (Blackberry)',NULL,NULL,'Breaking News/Podcasts/Learning','',341,1371,'2011-07-29 10:28:49',2632,'2011-08-03 11:32:24',92,2632,-1,NULL,NULL,'N'),(4692,'PRODUCT','Customer training session',NULL,1671,NULL,NULL,'','',1,1,NULL,43,'The two ladies at the training session were clinical negligence specialists. They looked through our quantum database and said that our content was nowhere near as good as Lawtel\'s and the example they gave was for achilles tendon there were 2 results when on lawtel there would be several pages of results. The said this is a basic search that should bring back lots of results.',NULL,NULL,44,1,NULL,'',NULL,'',NULL,NULL,'','',101,2371,'2011-07-29 15:26:05',371,'2011-08-23 10:29:23',72,371,121,NULL,NULL,'N'),(4702,'PRODUCT','Customer training session',NULL,1671,NULL,NULL,'','',1,1,NULL,NULL,'I trained 6 senior property solicitors who said at the beginning of the session they did not like Lexis Library and always used PLC to find their precedents. However they said it would be useful to be able to find more obscure precedents in library. When I showed them the forms and precedents box in quick find they found the wordwheel really useful because they could put in a few key words and find the precedents they needed. The said that it was \'amazing\' and two of them found straight away precedents they had been looking for for a week. \r\nOne of the partners also said that he used to really struggle finding cases on library but since the cases wordwheel has been added he can find his cases really quickly.',NULL,NULL,49,3,NULL,'',NULL,'',NULL,NULL,'','',131,2371,'2011-07-29 15:32:22',1921,'2011-08-12 13:36:36',72,61,0,NULL,NULL,'N'),(4712,'CUSTOMER','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Silvetta Bunting/ Senior Tax Manager',2,142,NULL,55,'This is a new business opportunity. They currently do not have an online services but are comparing Tolley Library with CCH. As part of the trial period, and due to the way the tax and accountancy teams are structured, The financial tax Director and others would also they would like to also look at Company Secretarial content alongside tax and accountancy. This is currently available via the Lexis legal Library but not Tolley Library. To offer them a complete package I would like to find out if its possible to pull this menu through on Tolley Library for a one off customer?',NULL,NULL,13,9,NULL,'',NULL,'The Bank Of Novia Scotia',NULL,NULL,'Company Secretarial','',462,1131,'2011-07-29 15:45:38',2632,'2011-08-15 10:45:03',72,2632,0,NULL,NULL,'N'),(4722,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Debbie Beard/Partner',2,142,NULL,NULL,'Debbie really likes the new service and the search functionality. However, she wants to be able to open up mulitple documents in new tabs or new windows and not have the service force the current open window to change to the new document.',NULL,NULL,54,4,NULL,'',NULL,'Sheen Stickland',NULL,NULL,'Tolley Library','NA',341,2121,'2011-08-01 10:55:51',2632,'2011-08-03 11:26:29',112,2632,-1,NULL,NULL,'N'),(4732,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Jeremy Mills',1,1,NULL,NULL,'this client has a very niche blend of information requirements , and after a poor experience with us (set up on the wrong menus), he has specified a content set that is a blend of Tax and Legal content.  He loves the new library interface (tolleylibrary) but is unable to access LEGM08 through this and therefore will need 2 different urls to access his online information service, one for LexisLibrary and one for Tolley Library.  whilst this is not a barrier to sale it has dimished the customer experience and is likely to come up more frequently the deeper we get into the Niche and Boutique tax customer segment.',NULL,NULL,12,3,NULL,'',NULL,'alligton eames',NULL,NULL,'legm08','',462,1221,'2011-08-02 11:23:16',1221,'2011-08-15 08:35:44',102,2632,-1,NULL,NULL,'N'),(4742,'MARKET','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Jeremy Mills - Director',2,142,NULL,55,'During the sales process with this customer he has repeatedly expressed frustration with not being able to see a complete list of sources available for him to choose from.  After further discussion around the subject the potential solution of a best fit menu calculator, wherein a customer can select or search for key sources that are of value and an application could then select a \'best fit\' menu for the customer which would deliver all the content required with minimal bundled content in which the customer does not see great value for the optimum pricing. ',NULL,NULL,59,9,NULL,'',NULL,'Allington Eames',NULL,NULL,'All','',131,1221,'2011-08-02 11:30:18',801,'2011-08-25 15:16:08',22,2632,52,NULL,NULL,'N'),(4752,'PRODUCT','Customer training session',NULL,9242,NULL,NULL,'','',1,11,NULL,NULL,'Would it be possible to create an automated \'widget\' that would run LexisCheck in the background as soon as a Word/PDFinternet doc was opened, and display a message saying \"there are citations in this doc, would you like to checkk the status?\" and then users can choose yes or no, as to whether they want to see the details or not.  I think this may help increase useage, and get people in to the habit of using LexisCheck.\r\n\r\nThanks\r\n\r\nSamantha Kay (Account Management Training Team)',NULL,NULL,59,9,NULL,'',NULL,'',NULL,NULL,'LexisCheck','',341,71,'2011-08-02 11:35:09',3472,'2011-08-15 10:29:29',72,3472,0,NULL,NULL,'N'),(4762,'PRODUCT','Direct Mail',NULL,NULL,NULL,NULL,'','David Stevanovic -Head of Indirect Tax',2,142,NULL,NULL,'david has sent these details about our alerting system on Tolley library;\r\n\r\nI\'ve set up a daily alert from the Tolley Library.  Unfortunately whilst it is delivering the format of the update is not at all user friendly compared to the alerts under the old Lexis Library service.\r\n \r\nAfter selecting the \"view full results online\" link the new Tolley service simply repeats the content of the email but gives no summary detail and in order to find out more I have to \"open\" every link.  In contrast the old Lexis service gave a summary which allowed me to then only look at what was of real interest to me - made me more efficient.\r\n \r\nAny plans to replicate the \"summary\" content in Tolley Library Alerts or am I missing something in the way I have set it to run.\r\n\r\nHis login details are - davidstevanovic\r\nonline05\r\n\r\n \r\n\r\n',NULL,NULL,53,5,NULL,'',NULL,'Lloyds Banking Group',NULL,NULL,'TolleyLibrary','',91,1131,'2011-08-02 11:44:03',2632,'2011-08-03 11:39:29',112,2632,22,NULL,NULL,'N'),(4772,'CUSTOMER','Customer training session',NULL,NULL,NULL,NULL,'','Tom McKenna',1,1,NULL,NULL,'I have received feedback on LL from a solicitor who I recently trained at Calderdale MBC. The relevant part of his e-mail is copied below.\r\n\r\n\"It was a pity that so few people attended. In Leeds City Council attendance is compulsory because they reason that staff should be able to use any subscription website to its full extent. When I came back after a lengthy absence because of a leg amputation, a colleague of mine said that the EF & P was no longer available online. I subsequently found out that this was wrong but it shows the lack of knowledge about Lexis Nexis that there is in Calderdale Legal Services.\"',NULL,NULL,0,0,NULL,'',NULL,'CALD5017',NULL,NULL,'','',452,2461,'2011-08-02 12:34:05',801,'2011-12-05 14:29:38',82,52,0,'TBC','','N'),(4782,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,1,NULL,NULL,'The delegates provided me with some feedback on their overall opinion of the layout and look of the service. They fell that it is not set out in a logical fashion and that there are too many buttons, tabs and links on the screen which make it confusing to navigate. They don\'t feel that it is neat an tidy or particularly user friendly. They also feel that it is not attractive - a suggestion was made as to more colour.\r\n\r\nAs a result of all of this they feel that it is too easy to miss something.',NULL,NULL,0,9,NULL,'',NULL,'BIRM5026',NULL,NULL,'','',131,2461,'2011-08-02 13:01:51',1921,'2011-09-12 16:09:02',72,61,0,NULL,NULL,'N'),(4792,'PRODUCT','0',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'This is actually input by Ruth Pratt after discussion with Dominc Lynch.  Dominic had a customer issue - which I am now attempting to replicate here.  The customer is someone at Cross and Cross in the South West (who take PLC), the individual Dominic spoke to may influence future spend - currently 2.5-3k - and reports the issues as:\r\n\r\n1. he could not find one of the ex parte Factortame cases in PSL (did not identify which one) it concerns CPR 36.8 and the individual was concerned to note that the authority of this case (is that if someone asks for clarification of a Part 36 offer in terms of trying to get an understanding of the offeror\'s strategic thinking behind making the offer, this case is authority for refusing to give such thiking) did not feature in our PNs on Part 36 and the case was not in PSL.  Dominic subsequently foundit in Library (he did not specify which one though and there are many)\r\n2. our current awareness if not as full as Lawtel\r\n\r\nRuth\'s response:\r\n\r\n1. on this issue there may well be an oversight in the PN - this will be checked and further information provided to Dominic (this is not currently possible as Ruth is unable to access PSL DR due to some bug in the system)\r\n2. Ruth explained that DR PSL current awareness is very specific, it deals only with cases on civil litigation procedure and associated \'court news\' such as consultations etc.  We do NOT cover any kind of substantive law i.e. the stuff that relates to the type of claim that a litigant may bring.  The PSL team is aware that this is an issue that has been raised previously by customers but do not have the resource to add this, much as we would like to.  ',NULL,NULL,9,6,NULL,'',NULL,'',NULL,NULL,'','',91,2331,'2011-08-02 15:04:05',1921,'2011-11-22 17:07:29',92,3422,62,'TBC','','N'),(4802,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','elizabeth Lavercombe -tax manager',2,142,NULL,55,'They review Simons in hardcopy and have some issues regarding the layout of Simons via Tolley Library (and Lexis LIbrary). They feel that it is confusing. The hardcopy lists volumes in A.B.C,D etc where as Simons online is divided by binders so you have to go into each one, if you are not sure where you exactly need to go. perhaps in brackets, we should have A,B.C.D etc next to each binder to make clear what is inside each one (for users who are very familair with the hardcopy).\r\n',NULL,NULL,53,4,NULL,'',NULL,'Old Mutual',NULL,NULL,'Tolley Library','',0,1131,'2011-08-02 19:20:07',2632,'2011-08-15 08:22:35',92,2632,-1,NULL,NULL,'N'),(4812,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Catherine Evans',2,142,NULL,NULL,'One of their users searches Taxation magazine and has the expanded list of results open, however when she does this only the first 3 or 4 results have the expanded information the ones further down just show the title which means she has to go into them one by one. She is using Internet Explorer. ',NULL,NULL,53,5,NULL,'',NULL,'Randall Greene',NULL,NULL,'TOLM03/TOLM13','NA',341,2121,'2011-08-03 18:22:20',2632,'2011-08-16 15:16:30',112,2632,71,NULL,NULL,'N'),(4822,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Head of Commercial Property ',1,4,NULL,47,'\"We have chosen PLC as it is very user friendly and it is a system that is widely used by the other solicitors. As a result, on a significant amount of matters, you often come across documents used by other solicitors which you are familiar with, as they also use PLC. However, the information resources available on PLC are not as thorough as the LexisNexis library offering. \r\nLexisNexis library has commentary that PLC does not, and it also has a number of more bespoke and unusual precedents, which again, PLC does not. PLC\'s offering is more generic (e.g. very limited residential property law content), but becoming more specialised. \r\nPLC do legal training as well, and LexisNexis offers the same kind of thing, but we don\'t subscribe to that and do it ourselves.\r\nIf LexisNexis are trying to compete with PLC then they need to deal with the following:\r\n- LexisNexis forms and precedents are very difficult to work with. They are a long way behind PLC in that regard. \r\n- Their search facility is cumbersome and is very difficult to transport documents from the web to Word documents. \r\n- They need it to become more widely used by practitioners to provide the benefit in para 2 above.',NULL,NULL,49,3,NULL,'',NULL,'ONeill Patient Solicitors',NULL,NULL,'LexisPSL Property','',41,341,'2011-08-04 14:28:09',201,'2011-10-14 16:46:30',102,201,0,NULL,NULL,'N'),(4832,'COMPETITOR','0',NULL,NULL,NULL,NULL,'','',0,0,NULL,NULL,'test record for Moderator 4/8- to be allocated to DC pls',NULL,NULL,1,0,NULL,'',NULL,'',NULL,'0','','',31,801,'2011-08-04 16:48:35',3542,'2011-10-19 09:55:36',21,52,-1,'','','N'),(4842,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Jane Lawrence',6,4,NULL,NULL,'Firstly I want to mention that all 5 members of the PI team that attended the session thought that the PI module of PSL was excellent.\r\nAt the beginning of the session one of the team asked why our platform was better than Westlaw - after 15 minutes of the session he said....\"Ok, I can see that your platform is considerably better than Westlaw\"\r\n\r\nMy 2 questions are:\r\nWithin the Medical Drawings section is there a diagram of a brain - we could only find a skull?\r\nIs there a way of finding out whether Expert Witnesses have been positively or negatively appraised during other cases?\r\n\r\nThanks',NULL,NULL,44,6,NULL,'',NULL,'RSA Group',NULL,NULL,'','',452,931,'2011-08-04 17:34:42',371,'2011-08-23 08:37:15',112,371,101,NULL,NULL,'N'),(4852,'COMPETITOR','Customer training session',NULL,13506,NULL,NULL,'','Rebecca Ebdon/PSL',1,4,NULL,47,'From: Davies, Lynne C. (LNG-HBE) \r\nSent: 28 July 2011 11:35\r\nTo: Michaud, Jennifer (LNG-HBE); Duggan, Clare (LNG-LON)\r\nCc: Morgan, Louise (LNG-HBE); Cottle, Suzanne (LNG-HBE)\r\nSubject: LexisPSL v PLC - search examples\r\n\r\nHello\r\n\r\nSorry, not sure if I should be sending this to you or logging as an Insight, and I am pretty sure you are well aware of the searching issues and a fix being looked at.\r\n\r\nBelow is a classic example of LexisPSL falling down on the search facility when compared to PLC.  It was a query that come up yesterday when I went to see Rebecca Ebdon a Property PSL at Brookstreet Des Roches.  She would actually be a great person to chat to re content/functionality & is happy to do so, she was a lecturer at the College of Law prior to joining BDR and really knows her stuff.  I asked her what her main resource would be and it is PLC (I appreciate Rebecca is in Property and her views aren\'t necessarily reflected across all practice areas using LexisPSL).  She would use Lexis Nexis less often and it would be to access cases & legislation, and occasionally books.  Her priority are Practice Notes and Precedents.\r\n\r\nRebecca was looking for information around the authority on the execution of documents so her search terms would be either:\r\n\r\nExecution companies house\r\nExecution authority\r\nExecution documents\r\n\r\nRebecca would go to PLC and type any of the above search strings in and retrieve results, try this on LPSL and you get the no documents found message.  Below are the 2 screenshots illustrating exactly the search terms typed in and the results given.  The 4th result on PLC was the answer she required.  Interestingly, a separate comment she made (and this is one I will log as an Insight because it concerns what we are calling documents), if she had been browsing PLC the title of the Practice Note was more \'obvious\', so her query was to do with the execution of documents, the PLC PN had a more logical title - Execution of Deeds and Documents\', the LexisPSL note that kind of had a bit of information in it was called \'What are the signature requirements for documents\', in Rebecca\'s mind this document would not have jumped out as being the one she needed as it did not have a strong title, unlike the PLC document.\r\n\r\nHer other frustration with LPSL is that the search box doesn\'t persist, so to edit a search or change it you have to return to the front page, Rebecca would be more likely to use the general search on the from t page of LPSL rather than the individual search screens.  On PLC the search box persists, so from a list of search results it is easy & quick to edit that search.\r\n\r\nHope this helps, let me know if there is anything else I can do, or indeed if you would like to chat to Rebecca and I can  put you in touch with her.\r\n\r\nThanks\r\nLynne\r\n\r\nFrom: Rebecca Ebdon [mailto:Rebecca.Ebdon@bsdr.com] \r\nSent: 27 July 2011 10:29\r\nTo: Davies, Lynne C. (LNG-HBE)\r\nSubject: \r\n\r\n \r\n\r\n \r\nRebecca Ebdon\r\nProfessional Support Lawyer\r\nfor BrookStreet des Roches LLP\r\nTel: 01235 836637\r\nFax: 01235 836700\r\n\r\nwww.bsdr.com\r\n********* This email is sent for and on behalf of BrookStreet des Roches LLP ********* \r\n',NULL,NULL,49,12,NULL,'',NULL,'',NULL,NULL,'','',281,68,'2011-08-08 10:26:17',1921,'2011-08-08 10:48:19',3,59,0,NULL,NULL,'N'),(4862,'COMPETITOR','Customer training session',NULL,1366,NULL,NULL,'','',1,4,NULL,47,'Librarian at Bevan has told me that PLC are launching a Family and personal injury module - either end of 2011 or into 2012',NULL,NULL,28,12,NULL,'',NULL,'',NULL,NULL,'','',452,67,'2011-08-08 14:14:04',1921,'2011-11-02 12:20:32',72,431,0,'TBC','','N'),(4872,'PRODUCT','Customer training session',NULL,2738,NULL,NULL,'','Michelle PArker',1,1,NULL,NULL,'Can the Quantum results be filtered via DAMAGES value as they are in PSL?',NULL,NULL,44,9,NULL,'',NULL,'',NULL,NULL,'','',131,67,'2011-08-08 14:16:37',1921,'2011-09-12 16:06:18',92,61,0,NULL,NULL,'N'),(4882,'PRODUCT','Customer training session',NULL,12921,NULL,NULL,'','',1,4,NULL,NULL,'Lack of Clin Neg content in PSL PI - emailed Jon Scriven.\r\nWe have no competitiors in this area so should capitalise on this......',NULL,NULL,44,1,NULL,'',NULL,'',NULL,NULL,'','',101,67,'2011-08-08 14:17:55',371,'2011-08-23 09:15:13',112,371,111,NULL,NULL,'N'),(4892,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','GC',1,1,NULL,50,'When looking at cases, specifically Masefield vs Amlin, the GC was surprised there was no commentary around the particular case. ',NULL,NULL,61,4,NULL,'',NULL,'Amlin',NULL,NULL,'In-House Partner','',101,1361,'2011-08-08 14:26:42',1921,'2011-11-25 16:30:17',102,3522,0,'.','','N'),(4902,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','GC',1,1,NULL,NULL,'When using the \'find a legal term\' tool, the GC asked to see \'res ipsa\' which he considers basic and one we should have.  This was not found in the tool.',NULL,NULL,61,9,NULL,'',NULL,'Amlin',NULL,NULL,'In-House Partner','',101,1361,'2011-08-08 14:29:20',3751,'2011-11-25 12:32:10',82,61,0,'TBC','','N'),(4912,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Kelly Hamblin Solicitor',1,4,NULL,NULL,'During a demonstration of the Housing Section of LexisPSL LG this morning we looked up Assignment in the keyword but couldn\'t find much. We did find some information through browsing topcs relating to Succession and the customer thought that Assignment should be linked into Succession and the relevant section of the Housing Act.  I said that I woud pass on this feedback but if you want to contact the customer to discuss further her email is khamblin@selby.gov.uk',NULL,NULL,39,6,NULL,'',NULL,'Selby DC',NULL,NULL,'','',101,1381,'2011-08-09 13:31:02',351,'2011-11-24 13:18:15',82,351,0,'TBC','','N'),(4922,'PRODUCT','Customer training session',NULL,10880,NULL,NULL,'','Christine Myer',1,132,NULL,NULL,'See below query from client about Smart Form IHT400 and linked forms not auto populating. I know Rob Evans has answered to say it\'s on the radar, but it makes so much sense to do if we can and would set us apart from the competition.\r\n\r\n\r\nFrom: Evans, Robert (LNG-LON) \r\nSent: 09 August 2011 10:10\r\nTo: Allan, Gavin (LNG-HBE)\r\nCc: Cottle, Suzanne (LNG-HBE)\r\nSubject: RE: Smart Forms - IHT400 and how it interacts with the linked forms (IHT 405 etc)\r\n\r\nHi Gavin\r\n\r\nAh, the lovely IHT400 integrated form - the real problem I have is that so many customer have different requests for this form, and I would love to change it, but am constrained by the HMRC. I also am not being given the time to make it as clever as it could be - all things you mention are on the to do list.\r\n\r\nRegards\r\n\r\nRob Evans\r\nManaging Editor: Forms and Graphics Management System\r\nrob.evans@lexisnexis.co.uk\r\n\r\nTel: +44(0)207 3473743\r\nwww.lexisnexis.co.uk\r\n________________________________________\r\nFrom: Allan, Gavin (LNG-HBE) \r\nSent: 08 August 2011 22:06\r\nTo: Evans, Robert (LNG-LON)\r\nCc: Cottle, Suzanne (LNG-HBE)\r\nSubject: Smart Forms - IHT400 and how it interacts with the linked forms (IHT 405 etc)\r\n\r\nHi Rob\r\n\r\nHope all is well. I was with a private client solicitor at Sharman Law in Bedford today who was keen to see how our IHT 400 form worked on Smart forms.\r\nShe (Christine Myers) liked the fact it was pdf, and that the IHT401 etc linked forms appear further down the same page as the main IHT400.\r\nHowever, having filled in a money field in the IHT405, she was hoping it would auto-populate the field it links to in the main IHT400, but you have to do this manually as well... At least, I couldn\'t see that you could, love to be proved wrong! \r\n\r\nShe said it would save heaps of time if it did and would really set us apart from the other form providers. She was sort of hoping it would do this anyway as a real lure for them to ditch any other form provider and stay with SmartForms. As I say, maybe it does and I\'m missing a trick, hence asking the guru!\r\n\r\nAppreciate your thoughts\r\nCheers,\r\nG\r\n\r\nGavin Allan\r\nTraining Consultant\r\n',NULL,NULL,47,3,NULL,'',NULL,'',NULL,NULL,'Smart Forms','Lazerform',341,66,'2011-08-09 17:23:34',3701,'2011-10-13 15:41:38',82,3701,0,NULL,NULL,'N'),(4932,'COMPETITOR','Customer training session',NULL,7470,NULL,NULL,'','Sian Winter',1,132,NULL,NULL,'Good news for us:\r\n\r\nIn demo\'ing Smart forms to Sian Winter (family lawyer at Lightfoots) she said she doesn\'t like their current sub of Laserforms for many reasons including:\r\n\r\n-Some fields have gone dark green, with black font so it\'s really difficult to read\r\n-They leave old forms on the system (we do as well, but we make it more obvious in the name of the form when it is/was relevant)\r\n-They often have lots of versions of forms that appear in results that are difficult to make out which is the version to use\r\n\r\nShe liked searching/form use on Smart so will hopefully champion a fuller trial very soon.',NULL,NULL,28,3,NULL,'',NULL,'',NULL,NULL,'Smart Forms','Lazerforms',0,66,'2011-08-09 17:29:51',151,'2011-10-31 10:44:05',72,151,0,'TBC','','N'),(4942,'PRODUCT','Customer training session',NULL,7755,NULL,NULL,'','PSL',1,11,NULL,NULL,'I was training two PSLs from the Private Client department on LexisCheck. One of them typed some case names on to a blank Word doc to try LC for themselves. The case they chose is Gaines-Cooper v HMRC, a major tax decision in the Court of Appeal from January 2010, which is currently being appealed in the Supreme Court. The delegate was surprised that LC did not flag the fact that this case was being appealed, and the judgment is awaited. I showed her how you can click on the Status link to view Casesearch, which may sometimes have an appeal tracker element. But she said she would not always know to click through, so it would be better to have some sort of message on the LexisCheck status comment that the cause is subject to an ongoing appeal.\r\n\r\nCould we somehow flag the Appeal Tracker content on LexisCheck? It is fair to say people would not always know to click through to casesearch.',NULL,NULL,59,1,NULL,'',NULL,'',NULL,NULL,'','',131,1881,'2011-08-11 14:55:44',1921,'2011-11-24 18:13:31',92,3472,0,'TBC','','N'),(4952,'PRODUCT','Customer training session',NULL,7755,NULL,NULL,'','PSL',1,11,NULL,NULL,'LexisCheck does not find cases that have a party name that is hyphenated if the hyphen is not written. For example, a delegate wrote onto a blank Word document that words Gaines Cooper v HMRC, and LexisCheck found no match, asking her to narrow down. When tax was chosen, it offered an unrelated case, with no alternatives. I advised her that the missing hyphen was the problem, but clearly people will often not realise the words should be hyphenated. Additionally, when I tried the search with no space of hyphen, i.e. GainesCooper v HMRC, it offered other implausible suggestions, none of which were correct.\r\n\r\nIs there some way that these two examples of how a user may wrongly type a case name could still lead to an appropriate suggestion of \"We think you mean\"?',NULL,NULL,59,1,NULL,'',NULL,'',NULL,NULL,'','',341,1881,'2011-08-11 15:02:27',3472,'2011-11-14 18:59:30',72,3472,0,'TBC','','N'),(4962,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Stephen Jasiewicz/trading standards',1,1,NULL,NULL,'Hi, Customer would like to know if possible to have British Standards uploaded on to Trading Standards Online, as a point this is the 2nd request for this content this week, the other customer was morrisons.',NULL,NULL,61,9,NULL,'',NULL,'ISE Group',NULL,NULL,'Trading Standards online','no',111,1661,'2011-08-11 15:23:12',1921,'2011-12-05 14:43:49',72,61,0,'TBC','','N'),(4971,'MARKET','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','stephen burwood - partner',2,142,NULL,55,'client requested the following core content online: simons, fosters, tiley and collison tax guide, sargeant simms, clarke offshore tax planning and hmrc clearances and approvals.  on the most cost effective menu structures this would cost around 7k.  Clarke is appox 153 in print and only appears in 2 menus - tax library (20k) and trusts offshore (2.9k).  hmrc clearances and approvals sits only on the tax news service.  on the new menu structure, assume clarke will sit in the trusts and estates menu there will be little difference as this is 2.7k.  in real terms, this means to compete with a similar package from CCH we would be looking at a 75%+ discount request.',NULL,NULL,53,4,NULL,'',NULL,'positive tax solutions llp',NULL,NULL,'tolley library ','',121,1221,'2011-08-15 12:21:30',1221,'2011-08-16 14:23:25',22,2632,-1,NULL,NULL,'N'),(4981,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','miles dean - partner',2,142,NULL,NULL,'this client had historically been a lexis library customer but had repeatedly been unable to purchase the content he specifically needed as no-one could identify which was the best menu.  he is an international tax consultancy specialising in HNWI.  This means he needs regular access to all uk and  the high profile international tax cases, some of which sit in sources such as ITLR, and take their source feed from legal works.  He has little need for our international commentary (he writes some of it for us!!).  the only way the client could access the sources he needed with complete cases coverage (and stay on the tolley library platform - which he views as far superior to LL) was to take tax library, which then clutters his search results with lots of information he doesnt want to see, as well as me having to ask for a monstrous discount!! - which was approved...)',NULL,NULL,53,1,NULL,'',NULL,'milestone international',NULL,NULL,'toll01','none',121,1221,'2011-08-15 12:35:09',2632,'2011-08-16 14:25:49',22,2632,0,NULL,NULL,'N'),(4991,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Martin Smith - Head of Tax',2,142,NULL,NULL,'The customer has printed two copies of the alerts emails he receives from Lexisnexis. The first is from Lexis Library. It arrives with Title, Topic and highlighted search terms. He knows from the Topcis whether he wants to open the articles, and he find the display of this very helpful. The second is from Tolley Library and does not show topics and therefore find this display less useful. He would therefore like to find out if the layout can be altered in Tolley Library to include the topics.',NULL,NULL,54,5,NULL,'',NULL,'West LB',NULL,NULL,'Tolley Library','',91,1131,'2011-08-15 13:54:05',2632,'2011-08-16 14:28:49',112,2632,22,NULL,NULL,'N'),(5001,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Robin John',2,142,NULL,NULL,'When searching HMRC Manuals they liked the old functionality of being able to select a specific title by browsing and drill down to a specific manuals then search just this manual\r\nThey would also like to know when an iPAD app will be available for Tolley Library. ',NULL,NULL,53,9,NULL,'',NULL,'Wellden Turnbull',NULL,NULL,'General Tax Practitioner','NA',462,2121,'2011-08-15 15:19:26',2632,'2011-08-16 14:34:24',92,2632,81,NULL,NULL,'N'),(5011,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Robin John',2,131,NULL,NULL,'They like the idea of eBooks but are put off by the 1 user license as many people within the office will share one hardcopy book in their library but would not be able to do this with eBooks due to limitation of 1 copy of eBook per purchase.\r\n\r\nVT comment:\r\nThere are two options here. First, the customer can install the eBook onto a library owned laptop/iPad for users to access. As the content is locked to one particular device the eBook cannot be checked-in, checked-out; instead users will need to borrow the device. Secondly, we can address the issue of multi-users through flexible pricing. Please feel free to contact me directly to discuss this in more detail.\r\n',NULL,NULL,53,12,NULL,'',NULL,'Wellden Turnbull',NULL,NULL,'various books','NA',441,2121,'2011-08-15 15:22:19',1921,'2011-08-17 15:56:07',72,1561,0,NULL,NULL,'N'),(5021,'PRODUCT','Customer training session',NULL,7974,NULL,NULL,'','Lynsey Cave-Support Staff',1,132,NULL,NULL,'Self populating field for Local Authority/Company Name\r\n\r\nI have sent the below already to the extremely helpful Rob Evans, but logging here as well:\r\n\r\nFrom: Allan, Gavin (LNG-HBE) \r\nSent: 16 August 2011 14:15\r\nTo: Evans, Robert (LNG-LON)\r\nSubject: Smart Forms - Company Name/Local Authority Self Populating Fields?\r\n\r\nHi Rob\r\n\r\nHope all is well. I had a session of Smart Form training with Marrons Solicitors in Leicester today. They are moving over from Laserform, which they have mixed feelings over, but did like some of it\'s functionality.\r\n\r\nOne thing that came up in the session was in forms such as the one numbered \'SIM\', where it asks for a Local Authority, are we planning to put a list for people to pick from? Laserform do which they like...\r\n\r\nSimilarly, on the same form at point 4 (and many others no doubt) there is a field asking for the company details (ie those of Marrons) which they would like if ours behaved like Laserforms and self populated...\r\n\r\nAppreciate your thoughts.\r\n\r\nGavin\r\n\r\nGavin Allan\r\nTraining Consultant\r\n',NULL,NULL,46,3,NULL,'',NULL,'',NULL,NULL,'Smart Forms','Laserform',0,66,'2011-08-16 13:28:28',3701,'2011-10-04 08:41:04',112,151,0,NULL,NULL,'N'),(5031,'PRODUCT','Customer training session',NULL,3096,NULL,NULL,'','Kate Bowen/Associate',1,4,NULL,NULL,'Curry Popeck do not have a LexisSmart PSL sub, only the standard LexisPSL.  Currently in the DR module many of the links to the word versions of forms (which link to HM Courts service website) do not work because the form location has been moved so we have not updated the links.  For example the N5B and N119 links to forms do not work.  Are we planning on fixing the links?',NULL,NULL,9,3,NULL,'',NULL,'',NULL,NULL,'LexisPSL Dispute Resolution','',0,68,'2011-08-16 13:48:17',1921,'2011-08-18 10:14:57',72,201,0,NULL,NULL,'N'),(5041,'PRODUCT','Customer training session',NULL,2023,NULL,NULL,'','Sue Chappell/FILEX',1,4,NULL,NULL,'The LexisPSL tool box has been well received but some feedback surrounding the way it opens, a lot of the content - LexisCalculate, Expert Witness Register, Facts & Figures - all open as extra windows which is rather annoying for end users, slows their system down and they end up with multiple windows open.  Can the content not all sit within LexisPSL?',NULL,NULL,44,12,NULL,'',NULL,'',NULL,NULL,'LexisPSL Personal Injury','',341,68,'2011-08-16 13:52:15',371,'2011-08-30 12:50:31',112,371,101,NULL,NULL,'N'),(5051,'BLANK','Customer training session',NULL,7974,NULL,NULL,'','Lynsey Cave-Support Staff',1,132,NULL,NULL,'While training support staff at Marrons:\r\n\r\nSearching is HEAPS better than before, but one thing, will there ever be scope to bring back the \'!\' for truncation of words, or automatic recognition of singular and plural? \r\n\r\nWe looked for \'requisitions\' and found what we needed, but \'requisition\' misses the useful documents...\r\n\r\nmany thanks,\r\nG\r\n',NULL,NULL,46,3,NULL,'',NULL,'',NULL,NULL,'Smart Forms','Laserforms',0,66,'2011-08-16 16:27:35',151,'2011-10-31 11:02:04',72,151,0,'TBC','','N'),(5061,'PRODUCT','Internal Meeting',NULL,NULL,NULL,NULL,'','Tina Chummun',1,1,NULL,39,'Butterworths Family Law Newsletter, currently in print - what\'s that viability of getting it online and into the Lexis Library (Family) to replace the now missing Jordans Family Law Journal?\r\nIt looks a very relevant and interesting source...\r\n\r\nI sent the below e-mail question around this to Geraldine Morris and Claire Sanders, but would like to log this on here as well.\r\nClaire said it was being investigated as an option with a telesales account aggrieved at losing the Jordans journal, so they were seeing about including the paper version alongside the online sub for Family Library. \r\nI would like to know if we could go one step further and put it online and include in lexis Library Family to deliver a more positive message!\r\n\r\n\r\nFrom: Allan, Gavin (LNG-HBE) \r\nSent: 15 August 2011 12:07\r\nTo: Morris, Geraldine (LNG-HBE)\r\nSubject: Butterworths Family Law Newsletter\r\n\r\nHi Geraldine\r\n\r\nHope all is well ...\r\n\r\nI was thinking of you when I was running the Intro to Law Course in HH (in July) and we had someone there from Sutton who works on journals etc, including the Butterworths Family Law Newsletter.\r\n\r\nIs this one of yours? What\'s the coverage/feasibility of including it in the Lexis Library Family menu to help plug the Family Law Journal gap...?\r\n\r\nAppreciate your thoughts,\r\nG \r\n\r\n\r\nGavin Allan\r\nTraining Consultant\r\n',NULL,NULL,28,9,NULL,'',NULL,'Lexis',NULL,NULL,'Family Library','',31,66,'2011-08-16 16:38:24',1921,'2011-10-14 09:35:26',92,1541,0,NULL,NULL,'N'),(5071,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','',1,4,NULL,47,'I am sure others have fed back on this BUT ALL LexisPSL Modules should have the default for the search box set to \"Full Text\" rather than \"Title\". Many customers will rush ahead and type in a search then click \"search\" and then get frustrated when there are no results, too few results or irrelevent results whereas if search via \"Full Text\" a better experience would have been had\r\n\r\nThis was mentioned by more customers than just EEF Limited who we are trying to sell the Employment module to including existing LexisPSL customers',NULL,NULL,0,9,NULL,'',NULL,'EEF Limited',NULL,NULL,'ALL Modules','',291,2672,'2011-08-16 22:29:20',1921,'2011-09-02 11:58:09',72,59,0,NULL,NULL,'N'),(5081,'','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Mr Ahmad',2,142,NULL,82,'Tax rates for 2011/2012 were not up until about 4 weeks ago.',NULL,NULL,53,2,NULL,'',NULL,'Mehta & Co',NULL,NULL,'TOLM04','',81,2121,'2011-08-18 15:48:56',1921,'2011-08-19 08:37:22',22,2632,0,NULL,NULL,'N'),(5091,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Simon Butler - Tax Manager',2,20,NULL,82,'This customer really likes Tolley Guidance but noted that they stuggled to work out which module to search for some information such as NIC or IR35. as these could be in mulitple modules. ',NULL,NULL,53,4,NULL,'',NULL,'Bbanks & Co',NULL,NULL,'TOLM01-04','',271,2121,'2011-08-18 15:53:12',1921,'2011-09-02 10:16:40',72,2812,91,NULL,NULL,'N'),(5101,'PRODUCT','0',NULL,NULL,NULL,NULL,'','Jon (Corporate Tax exec)',2,142,NULL,55,'In Simons online for example section C2.02 there are new developments referred to at the top of the page which are normally referred to as ND.xxxx (X represents numbers). These ND references should be hyperlinked so the user can click on it and read the new development. As it stands, they have to write down the ND reference and drill through the browsing method on tolley library to go the correct binder in simons that has a section on new developments. This can be quiet tedious and time consuming, also it may end up causing the user to overlook new updates and perhaps use informaiton that isnt entirely correct.',NULL,NULL,53,4,NULL,'',NULL,'arnold hill & co',NULL,NULL,'Simons Online','',131,1211,'2011-08-19 09:33:29',2632,'2011-08-19 12:08:20',22,2632,0,NULL,NULL,'N'),(5111,'COMPETITOR','Other',NULL,NULL,NULL,NULL,'','Philip Hayden - partner',2,24,NULL,NULL,'Client mentioned that HMRC are now providing \'toolkits\' which he is exploring. The implied suggestion was that HMRC site is becoming a more attractive place to conduct research and carry out work as these toolkits enable quick  filing of returns etc. ',NULL,NULL,59,2,NULL,'',NULL,'Richard Place Dobson',NULL,NULL,'HMRC','HMRC',71,1301,'2011-08-22 08:59:32',2632,'2011-08-22 11:45:28',82,2632,0,NULL,NULL,'N'),(5121,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','john mckeith /partner ',2,20,NULL,NULL,'customer likes product, but has requested if seafarers could be added to the specialist area',NULL,NULL,54,4,NULL,'',NULL,'Walton kilgour',NULL,NULL,'Tolgo2','no',442,941,'2011-08-22 09:12:32',2812,'2011-08-26 14:24:38',72,2812,131,NULL,NULL,'N'),(5131,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','jane bedall',1,4,NULL,47,'broken links between data protection and efp ie here even though it is linked and hypertexted....modules financial services missing\r\n\r\nEC model clauses\r\n\r\nFor a precedent setting out the model clauses approved for use where a data controller in the EEA transfers data to a processor located outside the EEA, see Data controllerprocessor transfer outside EEA: model clauses (EU) > EFP Vol 12(2) (2007 Reissue) Data Protection and Freedom of Information > [1043]. The clauses require the data processor to provide guarantees complying with the seventh principle (above), and to undertake to process data solely in accordance with the data controller\'s instructions. To satisfy the eighth principle, they must be agreed by the data processor without amendment. Breaches of DPA 1998 by the data controller may usually be enforced against the processor. ',NULL,NULL,12,8,NULL,'',NULL,'elevan merchant ltd',NULL,NULL,'commercial','',101,411,'2011-08-22 09:41:25',1921,'2011-09-02 11:56:08',92,241,0,NULL,NULL,'N'),(5141,'PRODUCT','Informal conversation',NULL,NULL,NULL,NULL,'','John Ball Tax Manager',2,142,NULL,55,'When the client goes into certain areas and it cross references Simon\'s the reference will give a page number however when you click on the link it takes you to the chapter but the page numbers aren\'t included for you to be able to quickly scroll to the reference.',NULL,NULL,53,4,NULL,'',NULL,'Ward Williams',NULL,NULL,'TOLM04/07/25','',131,2121,'2011-08-22 15:30:16',2632,'2011-08-22 15:30:13',72,2632,0,NULL,NULL,'N'),(5151,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Karen Purdy - Principal',1,4,NULL,NULL,'More feedback from Karen Purdy.....this one related to how search in PSL works - specifically on being able to search on the acronmyn STEP.......Her comments are below verbatim....It would seem logical to include STEP as a search string as it\'s the common name against which most would think to search.....\r\n\r\n\"Sometimes you type in one thing and the search facility can\'t track it down and that\'s because a similar, alternative word is used.  An example below....\r\n \r\nThis one is a bit lazy, but it\'s one I did today:\r\n\r\nSociety of Trust and Estate Practitioners Standard provisions  https://www.lexisnexis.com/uk/lexispsl/willsandprobate/documentFromList.faces?format=GNBFULL&asetId=Z-WA-A-A-A-MsSWYWY-UUB-U-U-U-U-U-U-ABACEECUDA-ABABCDCYDA-AAWWCCZWY-U-U&ps=searchQuick,PRIVATECLIENT,PRECEDENTS,null,4,1,Z-WA-A-A-A-MsSWYWY-UUB-U-U-U-U-U-U-ABACEECUDA-ABABCDCYDA-AAWWCCZWY-U-U,null,null,,&csi=339471&docNo=1\r\n \r\nIt would be handy if you could also locate them by searching for \"STEP\", as that\'s what they\'re always shortened to.\r\n ',NULL,NULL,56,9,NULL,'',NULL,'purdy\'s  PURD5004',NULL,NULL,'','',341,581,'2011-08-23 09:59:08',1921,'2011-10-14 11:14:47',92,59,0,NULL,NULL,'N'),(5161,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Karen Purdy - Principal',1,4,NULL,NULL,'Question from Karen Purdy on PSL.....does what she is looking for exist?\r\n \r\n\"I cannot find a Deed of Gift anywhere. It\'s for a lifetime gift, not to go in a Will. I can\'t think what other practice area would have it, but thought it would be here. Please help!\"\r\n',NULL,NULL,56,3,NULL,'',NULL,'Purdy\'s PURD5004',NULL,NULL,'','',442,581,'2011-08-23 10:00:56',1921,'2011-09-02 10:14:07',72,2341,0,NULL,NULL,'N'),(5171,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Jan Ellis',2,142,NULL,NULL,'Claudia Ward has been doing content research with some Tax News customers in the small tax segment.  She had the following feedback from a lady whose name was given to her by Andrew Cooper in sales:\r\n\r\n 1:  As I explained to Andrew, I am avoiding the new platform (Tolley Library) for as long as I possibly can, because it\'s not easy to set up and carries less information than the old \"TaxNews\" site.\r\n \r\nAnd goodness knows, the \"old\" Tax News is hard enough to set up: I paid for a software engineer to set it up as a tab automatically on my computer, which works really well until LexisNexis unilaterally changes my password, which it does every so often ...\r\n \r\n.. talking of which, it last did this a couple of months ago for my access to Taxation, which I find I can now access only from the Taxation site (or rather, can\'t currently access).  A mere 4 weeks after emailing to ask LexisNexis to sort it out, I got a phone call recently when your colleague promised to restore my access and let me know what the current password is (ideally without disturbing the existing password for Tax News).  This hasn\'t happened yet, but I am really hoping it does, soon, so ideally without me having to wait another 4 weeks...  \r\n2:  I\'m not sure what \"tax case summaery\" you are referring to ... On the \"old\" Tax News service, when you access the recent cases, you get a couple of lines summarising the case - taken, I think, from the case note itself, which is very helpful.  The new Tax Library didn\'t have this feature when I accessed the service in May; it may do now.  \r\n \r\n3;  The reason for my subscription to LexisNexis is mainly (90%+) to access the recent case law and Taxation.  (hence, without Taxation in hard or soft copy any more, I\'m not getting much out of it).  I occasionally use the Tax Update stuff, but it tends to be just as well covered in the HMRC web-site. \r\n \r\n4; really I\'d just like LexisNexis to work, consistently ...\r\n \r\n5; generally happy with what I read elsewhere \r\n',NULL,NULL,53,5,NULL,'',NULL,'',NULL,NULL,'Tax News Online ','',0,2582,'2011-08-23 14:44:08',2632,'2011-10-14 12:02:15',102,2632,0,NULL,NULL,'N'),(5181,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Rob Cardew, head of Trading Standards',1,2,NULL,NULL,'I have a client Gloucestershire T/S who have been using EU Tracker on trial.\r\n\r\nThe feedback has been that in the key areas they are interested in,\r\nAnimal Health,\r\nFood\r\nWeights and Measures,\r\n\r\nThe legislation is not consolidated at all and it is up to the user to put the relevant legislation together themselves. They have found a free alternative to this on the europa.eu website linking through to eurolex which has all the EU legislation consolidated however it does state on this website that the consolidated Legislation is not official but does suit their need!\r\n\r\ncontact, Rob Cardew.\r\nAccount, GLOU5022\r\n\r\n',NULL,NULL,39,2,NULL,'',NULL,'gloucestershire county council',NULL,NULL,'','',291,2682,'2011-08-23 15:13:53',2762,'2011-08-26 12:57:11',92,2762,0,NULL,NULL,'N'),(5191,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'The following questions/observations come from a non-customer who is conducting a trial of Family PSL for market research purposes.  The client is very keen on the product and is now considering purchase so it would be helpful if we could go back to her and address these questions/observations.......many thanks..\r\n\r\n1. Under the Divorce explanatory leaflet section the court fee is stated to be 300 - it is now 340 and it refers to \"a petition must be based on one of five/four facts. It\'s 5 facts, not 4.\r\n\r\n2. The section on inherited wealth under special considerations  which I think is under financial  provision in Browse Topics but I cann\'t access now, is outdated in the light of the recent case law re inherited wealth under latest legal updates.\r\n\r\n3. I cannot access any of the Family Tool Box sections - they each say \"no documents found\".\r\n',NULL,NULL,28,9,NULL,'',NULL,'',NULL,NULL,'','',452,581,'2011-08-23 15:19:10',1921,'2011-09-02 10:10:17',72,1541,0,NULL,NULL,'N'),(5201,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','russell green',1,4,NULL,NULL,'linking to the whole chapter of \"key provisions in standard terms and conditions\" appear to be broken....not building confidence in overall deliverty of product please review.\r\n\r\n',NULL,NULL,12,4,NULL,'',NULL,'arriva',NULL,NULL,'','',261,411,'2011-08-24 11:15:05',1921,'2011-09-12 15:23:54',92,59,0,NULL,NULL,'N'),(5211,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Graham West',2,162,NULL,NULL,'This client receives comprehensive tax training (conferences, courses + general updates) from swat but they also take some courses with MacIntyre Hudson. He said what was great about MacIntyre Hudson is that if a delegate cannot make the session then MacIntyre Hudson wont charge them for that 1 missing delegate. The important point here isnt that the client simply doesnt lose money, its the fact that MacIntyre Hudson are willing to sacrifice a small loss in revenue for long term relationships. This could perhaps be considered for our seminars events. He said he wants to look at our services because on one occasion SWAT didnt do what MacIntyre Hudson did so the client thought many years of business with SWAT counted for nothing.',NULL,NULL,53,9,NULL,'',NULL,'Rhodes & Rhodes',NULL,NULL,'','MacIntyre Hudson',452,1211,'2011-08-24 13:11:49',2832,'2011-09-02 13:04:43',72,2832,0,NULL,NULL,'N'),(5221,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Ralph Maingot/Comp Sec',1,4,NULL,NULL,'The issue came about when the client searched for \"agency worker agreement\". If you type a search in the In House module for full text on \"agency worker\" it comes up with 32 precedents. Click on the precedents tab to open them up. The first 17 work fine when you click on the link. However, you can see if you do this search, no18 in the list is for 95 contracts(Rights of third party) from EF&P. If you click on this link it takes you to the Bolierplate clause. Try 19 and you get the same, and 20, 21 and so on. Basically all the links are meant to be to EF&P as stated on the page, however all of them link through to the bolierplate clause!\r\n\r\nHope this makes sense. Please call me on 079 666 10043 if it needs further explanation.',NULL,NULL,61,3,NULL,'1317894474.msg','Insight 5221.msg','Logicalis UK Ltd',NULL,NULL,'','',81,3601,'2011-08-25 14:57:38',1921,'2011-10-06 09:47:54',72,59,0,NULL,NULL,'N'),(5231,'COMPETITOR','Customer cancellation request',NULL,NULL,NULL,NULL,'','Phillip Freeman',2,142,NULL,55,'Client was informed by CCH that their online library was superior and used a specific example as a comparative search.  The example given was \'disguised remuneration\' and that CCH linked to the HMRC\'s new guidance on this topic (FA2011). When the search was run on TL, there was no link to this, and that the note in the ND section of Simons did not go far enough in explaining the impact of it.   ',NULL,NULL,53,4,NULL,'',NULL,'Phillip Freeman',NULL,NULL,'tolley annuals','',101,1221,'2011-08-25 15:32:46',2632,'2011-08-26 11:31:35',72,2632,0,NULL,NULL,'N'),(5241,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Pankaj Shah - Head of Tax',2,142,NULL,NULL,'Customer would like to see more Financial Services focussed content from us. Topical issue cover Financial Loan relationships, regulatory, bank relationships, capital markets to name a few. He is prepared to have a further discussion with product development team to understand more. In his words would like us to become \'more client focussed than product focussed\'.  ',NULL,NULL,53,9,NULL,'',NULL,'Investec',NULL,NULL,'TolleyLibrary','',452,1131,'2011-08-25 18:04:49',1921,'2011-09-02 09:36:57',92,2632,0,NULL,NULL,'N'),(5251,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','GC',1,4,NULL,NULL,'Client is a Hard Copy customer and has not seen PSL before.\r\nHugely impressed with the ease of use and especially the Precedents - we ran \'Power of Attorney\' as a search and the results were exactly what the lawyers expected to see.\r\n\r\nThe only question we had was that in the CoCo module there is a case for Jet2 sitting in \"What\'s new in CoCo\" dated August 23rd.\r\nThe actual case was published in All ER in July so the client wondered what had triggered the case to appear in the updates section\r\n\r\nAlso when I clicked on the All ER link to go to Library directly it did not link me through but put up a message saying that it was only available in Library.\r\nAs I have the full Library sub it would have been more impressive if the link took me straight through to the case ',NULL,NULL,12,6,NULL,'',NULL,'Camelot',NULL,NULL,'','',261,931,'2011-08-26 08:35:24',1921,'2011-09-02 08:48:30',92,59,0,NULL,NULL,'N'),(5261,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Jane Cousins',2,142,NULL,NULL,'Can we put a specificHMRC manual on our bookshelf?\r\n\r\nCan we move the order of the news eg put employment tax news above corporate tax news?\r\n\r\nRegards\r\nJane Cousins\r\n\r\n0207 545 8000\r\njane.cousins@db.com\r\n\r\nI explained that currently the Manuals are treated as just one source but that we are looking at booking marking/creating a favourites folder that would help get to specific manuals quickly.\r\n\r\nDan Arrowsmith responded on the 2nd issue that there was little interest in moving the news pods around when this was discussed at the last tax Product Advisory Borad meeting.\r\n\r\nMary McGilloway',NULL,NULL,53,4,NULL,'',NULL,'Deutsche Bank',NULL,NULL,'','',452,75,'2011-08-26 11:58:34',2632,'2011-10-14 14:27:22',92,2632,0,NULL,NULL,'N'),(5271,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Jane Cousins',2,142,NULL,NULL,'It is very unfortunate that the system now requests initial passwords to be changed, which then get forgotten so a lot of assistance is needed to get new passwords etc LexisNexis which saves all passwords after one input was much more user friendly!!\r\n\r\nRegards\r\nJane\r\n\r\n0207 545 8000\r\njane.cousins@db.com\r\n\r\nI have now explained that passwords can be saved so they just enter the service again. A recurring problem is that people change passwords and then forget what they changed them to and this then becomes a barrier to them using the services. I did say on Yammer a few weeks ago that perhaps we need to be looking at other means of online access and security than IDs and passwords.\r\n\r\nMary McGilloway\r\n',NULL,NULL,53,4,NULL,'',NULL,'Deutsche Bank',NULL,NULL,'','',452,75,'2011-08-26 12:05:50',2632,'2011-08-30 13:35:17',82,2632,0,NULL,NULL,'N'),(5281,'COMPETITOR','Direct Mail',NULL,NULL,NULL,NULL,'','Mary McGilloway',2,142,NULL,NULL,' Westlaw has announced that McCutcheon on Inheritance Tax is being made available online in their August update. So it is likely that they will put the full established Sweet & Maxwell British Library Tax series of books online. McCutcheon on Inheritance tax is part of this series.\r\n\r\nThis series is very well thought of especially Bramwell on Companies and Company Reconstructions. We need to monitor this, but for now I think large practices may well consider both if they have the money. I can\'t see Westlaw being a real competitor in tax online with just this series of books though it could be a first step before commissioning more content.\r\n',NULL,NULL,53,4,NULL,'',NULL,'',NULL,NULL,'McCutcheon on IHT','Westlaws',31,75,'2011-08-26 12:13:41',2912,'2011-08-31 09:28:18',22,2632,0,NULL,NULL,'N'),(5291,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Julian Sims - Partner',2,20,NULL,NULL,'Really likes the templates but would like more of these to be included ',NULL,NULL,53,3,NULL,'',NULL,'HJS Group',NULL,NULL,'OMB & Corporation ','NA',131,2121,'2011-08-26 12:50:05',2812,'2011-09-12 15:20:13',92,2812,131,NULL,NULL,'N'),(5301,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Julian Sims - Partner',2,142,NULL,55,'when in a document, the client wants to be able to move the table of contents slightly out rather than have it pop out (although this is sometimes useful), but when they are browsing that publication they might just want to move it out slightly to be able to see the other sections titles.\r\n\r\nHe also mentioned the opening of multiple docs as well.',NULL,NULL,53,4,NULL,'',NULL,'HJS Group',NULL,NULL,'TOLM04','',462,2121,'2011-08-26 12:57:41',2632,'2011-08-30 13:40:06',92,2632,141,NULL,NULL,'N'),(5311,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Andrew Parker - Partner',2,142,NULL,NULL,'This client has said that when in the current awareness tab they would like to be able to sort by date.',NULL,NULL,53,5,NULL,'',NULL,'Fulwells',NULL,NULL,'TLLM27','NA',341,2121,'2011-08-26 13:19:52',2632,'2011-08-30 13:28:51',112,2632,0,NULL,NULL,'N'),(5321,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Deborah Lumley / Secretary',1,1,NULL,NULL,'Please assign this insight to John Hanratty & Clare Heeley\r\n\r\nThe client commented that the format of the new word downloads, while much better, had way too much blank space and line-spacing between the paragraphs.\r\nThis is a comment I\'ve had before and affects many of the precedents in EF&P - especially long leases.\r\nThey thought that in this day of \'green-ness\' and saving paper, this was a bit odd and we should look at the format of our template and perhaps reduce the spaces in between the paragraphs to reduce overall page extent.',NULL,NULL,0,3,NULL,'',NULL,'Stallard March & edwards',NULL,NULL,'EF&P','',131,65,'2011-08-26 14:52:45',1921,'2011-09-16 08:53:40',2,151,0,NULL,NULL,'N'),(5331,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','fay laing - director',2,142,NULL,NULL,'The client has fed back that our service does not isloate the HMRC manuals pertaining to VAT, this means that when a search is run the results that come back are cluttered with Direct tax results.  historically these have sat in the Customs and Excise manuals and therefore were separate.  the client can easily navigate to the only VAT related content on the HMRC site.  It would be beneficial to all VAT specialists if there were able to search only the VAT portion of the HMRC manuals.',NULL,NULL,57,4,NULL,'',NULL,'ABERvat',NULL,NULL,'TOLM09','hmrc manuals',131,1221,'2011-08-30 11:09:43',2632,'2011-09-01 10:39:24',22,2632,0,NULL,NULL,'N'),(5341,'PRODUCT','Customer training session',NULL,9669,NULL,NULL,'','David Wadsworth',1,4,NULL,47,'David found many typos in our precedents in LPSL DR, specifically:\r\n\r\nLetter to claimant about Part 36 offer, in the paragraph - time for acceptance - line 4, we have missed out a word - be.\r\n\r\nIn a hurry this coiuld be missed by a client and he has now had his faith in the accuracy of content shaken',NULL,NULL,9,3,NULL,'',NULL,'',NULL,NULL,'LexisPSL Dispute Resolution','',81,68,'2011-08-30 16:33:56',1921,'2011-09-02 10:30:38',92,1531,0,NULL,NULL,'N'),(5351,'PRODUCT','Customer training session',NULL,9669,NULL,NULL,'','Helen Bunker/Managing Partner',1,4,NULL,47,'Helen would expect a Private Client offering to include separate headings for IHT, CGT and Income Tax\r\n\r\nCan you provide an idea as to if/when this content will be added?',NULL,NULL,56,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Wills & Probate','',91,68,'2011-08-30 16:35:55',1921,'2011-09-01 13:29:49',72,2622,0,NULL,NULL,'N'),(5361,'PRODUCT','Customer training session',NULL,9669,NULL,NULL,'','Diana Cornforth',1,6,NULL,47,'Diana is not keen on PLC and dislikes their drafting style, although she did admit to being a \'picky drafter\'!  She was excited that there could be an alternative in LPSL and was keen to see our style of documents and look into the drafting style used.\r\n\r\nDiana chose \'Contract for sale - freehold vacant possession - residential\'.  She noted it covered the 5th Ed of SCS, however she wasn\'t keen on the drafting style used and felt it was still a document full of extra clauses etc, and it was overkill, she expected to see a good solid basic document but felt it was no better than any prevous versions of this document and was disappointed as it wasn\'t going to be a viable document for her to use.\r\n\r\nShe also mentioned that she would have expected to see the prescribed clauses as a cover sheet and could see no reference to them in many of the LPSL precedents as she would ahve expected to, she feels this is an ommission on our part??\r\n\r\nAll help/info much appreciated',NULL,NULL,49,3,NULL,'',NULL,'',NULL,NULL,'LexisPSL Property','',81,68,'2011-08-30 16:42:50',201,'2011-10-14 16:47:45',112,201,0,NULL,NULL,'N'),(5371,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Phillip Freedman',2,142,NULL,55,'The client was researchin QCB\'s and Entreprenuers relief. Simons eluded to a change in legislation on 23rd june 2010. When this was researched further it was apparent that the relevant section of the HMRC manuals was missing. Upon further investgation the whole of CG63950 - CG64171 are missing from the online service. The client seached on his CCH service and found the relevant parts of the manuals in their entirety.  The client has subsequently requested cancellation of his 3.1k order as he has lost confidence in the service vs CCH\'s online offering.  Perhaps a review of the mechanism behind the updating of non-authored content would assist in ensuring we aren\'t in a similar position again. ',NULL,NULL,53,4,NULL,'',NULL,'Phillip Freedman',NULL,NULL,'HMRC Manuals','',101,1221,'2011-08-31 10:04:00',1221,'2011-09-02 08:24:08',82,2632,0,NULL,NULL,'N'),(5381,'PRODUCT','Customer training session',NULL,9669,NULL,NULL,'','Helen Bunker/Managing Partner',1,4,NULL,47,'Helen queried the location of some of the forms within LPSL Private Client.  Helen picked the Estate Administration topic, went to Forms and fully expected to see the IHT400 sitting in the list along with the IHT205 and IHT217.  The IHT400 doesn\'t sit in this topic, it appears in the topic above - application for grant.  Helen aid this wasn\'t necessarily the most logical approach, she would expect to see a \'suite\' of forms together not separated under topics.  Can we move the IHT400 so it appears in the Estate Admin topic, or maybe duplicate the IHT400 so it sits in both Estate Admin & Application for Grant?',NULL,NULL,56,3,NULL,'',NULL,'',NULL,NULL,'LexisPSL Private Client','',442,NULL,'2011-08-31 13:12:38',2622,'2011-09-01 13:21:32',92,2622,0,NULL,NULL,'N'),(5391,'PRODUCT','Customer training session',NULL,9669,NULL,NULL,'','Helen Bunker/Managing PArtner',1,4,NULL,47,'Within the cross border estate heading Helen has asked what our plans are to add to the list of countries?  Currently we only cover France, will we add more & when?',NULL,NULL,56,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Private Client','',111,68,'2011-08-31 13:15:57',2622,'2011-09-01 13:35:08',72,2622,0,NULL,NULL,'N'),(5401,'PRODUCT','Customer training session',NULL,9669,NULL,NULL,'','David Wadsworth',1,4,NULL,47,'David found a number of typos/mistakes within LPSL DR.\r\n\r\nWithin the overview note - Claimant & Statements of Case:\r\nDrafting the particulars of claim and reply\r\nWhen drafting the particulars of claim it is essential to make sure they contain all of the required by the CPR rules. Examples of this include a concise statement of the facts relied on and whether interest is being sought. Specific types of claim will require additional information to be provided. For example whether a relevant pre-action protocol has been complied with or in a contract claim a copy of the contract will need to be provided.\r\nIn claims in which fraud is being alleged it is important to ensure that material is available which enables you to reasonably believe that, on the face of it, a case of fraud is established.\r\nA claimant can file a reply to the defence although not filing one is not an admission of the defence. Where a defence raises new issues a claimant would be advised to file a reply setting out their own version of events.\r\n\r\nThe second line has a word missing, David admitted he was being picky but the number of errors he found has cast doubt on how much he can trust the accuracy of our content.\r\n',NULL,NULL,9,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Dispute Resolution','',81,68,'2011-08-31 13:23:49',1921,'2011-08-31 15:28:56',72,1531,0,NULL,NULL,'N'),(5411,'PRODUCT','Customer training session',NULL,9669,NULL,NULL,'','David Wadsworth',1,4,NULL,47,'David found dead links in the practice note for Contract Consideration, they were the subscription sensitive (you will need LL sub) links to Halsburys Laws in the Economic Value paragraph.\r\n\r\nHe queried how we monitor the links and how often to ensure they are working and actually link to content?',NULL,NULL,12,6,NULL,'1314797389.DOC','Contract_consideration.DOC','',NULL,NULL,'LexisPSL Company Commercial','',111,68,'2011-08-31 13:30:15',1921,'2011-09-02 08:20:26',92,171,151,NULL,NULL,'N'),(5421,'PRODUCT','Customer training session',NULL,9669,NULL,NULL,'','Richard Tyman/Partner & HOD',1,4,NULL,47,'Richard feels that the module should include pre-action protocol draft letters and would expect to see this kind of document in the product.  Do we have any plans to add any more draft letters?',NULL,NULL,9,3,NULL,'',NULL,'',NULL,NULL,'LexisPSL Dispute Resolution','',101,68,'2011-08-31 13:32:48',1921,'2011-09-02 10:25:31',112,1531,0,NULL,NULL,'N'),(5431,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Sarah Palmer',1,1,NULL,NULL,'When using saved searches as a bookmark, is there any way that I can file them in order of importance to me (i.e. most commonly used sercahes at the top)?\r\n\r\nHow can I find out the provenance of Lexis PSL Smart Precedents as this is not shown, or is it safe to assume that they are all drafted by our inhouse PSL lawyers',NULL,NULL,0,9,NULL,'',NULL,'Brain Chase Coles',NULL,NULL,'','',452,72,'2011-09-01 15:34:05',1921,'2011-10-14 15:35:13',72,59,0,NULL,NULL,'N'),(5441,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Kate Martin',1,4,NULL,NULL,'I need to be able to access Form FP2 - Part 18 Application under the new FPR. Whilst  this is mentioned in the FPR ther is no form available and I have to access it via the court website- can this be included in the PSL service please?\r\n\r\nAlso emailed to Geraldine Morris',NULL,NULL,28,0,NULL,'',NULL,'Brain Chase Coles',NULL,NULL,'','',0,72,'2011-09-01 15:38:49',1541,'2011-09-23 14:12:06',72,1541,0,NULL,NULL,'N'),(5451,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Jan Ellis',2,142,NULL,NULL,'Claudia Ward has been doing content research with some Tax News customers in the small tax segment.  She had the following feedback from a lady whose name was given to her by Andrew Cooper in sales:\r\n\r\n2:  I\'m not sure what \"tax case summaery\" you are referring to ... On the \"old\" Tax News service, when you access the recent cases, you get a couple of lines summarising the case - taken, I think, from the case note itself, which is very helpful.  The new Tax Library didn\'t have this feature when I accessed the service in May; it may do now.  \r\n \r\n',NULL,NULL,53,5,NULL,'',NULL,'',NULL,NULL,'Tax News Online','',341,2582,'2011-09-02 08:47:19',2632,'2011-10-14 11:59:44',112,2632,0,NULL,NULL,'N'),(5461,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Jan Ellis',2,142,NULL,NULL,'Claudia Ward has been doing content research with some Tax News customers in the small tax segment.  She had the following feedback from a lady whose name was given to her by Andrew Cooper in sales:\r\n\r\n3;  The reason for my subscription to LexisNexis is mainly (90%+) to access the recent case law and Taxation.  (hence, without Taxation in hard or soft copy any more, I\'m not getting much out of it).  I occasionally use the Tax Update stuff, but it tends to be just as well covered in the HMRC web-site. \r\n',NULL,NULL,53,5,NULL,'',NULL,'',NULL,NULL,'Tax News Online','',131,2582,'2011-09-02 08:48:06',2632,'2011-09-05 10:16:32',112,2632,0,NULL,NULL,'N'),(5471,'PRODUCT','Customer training session',NULL,1524,NULL,NULL,'','Emma Wallbank',1,1,NULL,NULL,'Tristram Oaths:\r\n\r\nHaving trained at Blakemores in Birmingham this week we found the format of the precedents not very helpful in some key texts (Tristram).\r\n\r\n1. When browsing for Oaths in Tristram when you go into one, it often refers you to another one by number eg Form 66. \r\nWhen you look to the left TOC column in lexis Library only Form 91 has it\'s number next to it for cross reference. If the number was there it would be VERY helpful.\r\n\r\n2. In oaths in Tristram they give you only the unique element of the oath and expect you to link to \'As in Header 1\', refer \'Form 66\' to form a complete document but these are rarely live links to help with the flow of creating an Oath. \r\nFelicity in the audience said if you could easily link this COULD REGULARLY SAVE 15-20 MINUTES PER PRECEDENT. They do a lot of wills...\r\n\r\nThis has quite likely been logged before, but it\'s a regular comment so worthy of mentioning again I hope.\r\n\r\nMany thanks,\r\nGavin',NULL,NULL,47,3,NULL,'',NULL,'',NULL,NULL,'Wills','PLC Private Client',131,66,'2011-09-02 11:07:10',1921,'2011-11-01 18:10:31',92,2722,0,'TBC','','N'),(5481,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Emma Wallbank',1,1,NULL,NULL,'Butterworths Wills Probate and Administration Service Precedents Browsing Observations:\r\n\r\nIn BWPAS when you have the paper copy in front of you Helen (head of Private Client) was saying there is an excellent large bank of will clauses at the start of the Division AP - Wills. \r\nHowever, when you browse the online version of Division AP, then select 1. Wills, yes there is a clauses section, but there are only a few of the ones she was expecting to see. \r\nOn closer scrutiny we found the clauses she was looking for in the next section down, section \'2. Free of Tax or subject to tax: a general note\'. Instinct would NOT have led any of us in the room (including 4 private client experts and myself as trainer) to browse that section to find clauses. \r\nWe found it by accident on a search. \r\nCould this section be renamed, or seen as a sub section of section \'1. Wills\' so customers don\'t miss out on what look to be an excellent selection of helpful clauses (quote from my client there!)?\r\n\r\nManythanks\r\nGavin',NULL,NULL,47,3,NULL,'',NULL,'Blakemores',NULL,NULL,'Wills','PLC private client',0,66,'2011-09-02 11:10:07',1921,'2011-09-09 09:50:22',92,181,0,NULL,NULL,'N'),(5491,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','sue white -  VAT partner',2,142,NULL,55,'Client cancelled indirect menu and gone to CCH, they offered a 50% reduction in cost on their 2010 spend with us and a 6 month bridging deal. we charged the 4300 in 2010 and CCH offered them equivalent content  and banding at 2000. no real reccomended actions, just added this for insight into example CCH competitive winback strategy.  Client felt they were not getting good value from us (obviously if CCH are happy to go in at 50%).',NULL,NULL,57,4,NULL,'',NULL,'liaison VAT',NULL,NULL,'tolm09','',51,1221,'2011-09-05 11:14:48',2632,'2011-09-07 08:46:06',82,2632,191,NULL,NULL,'N'),(5501,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Paddy Behan Director',2,142,NULL,82,'Paddy is a great advocate of LN products, but as a specialist he needs infrequent access to a broad range of content.  for instance all of the UK SI\'s (not just the tax ones) and specific cases outwith of the remit of tax, for instance judicial reviews.  He took the time to call me and suggest a more selective pick and mix content set (whereby he can choose specific sources for his content, understanding that he (and most specialists alike) do know what content they need, and do not want their results cluttered by results from \'bundled in\' sources.  He also enquired as to the possibility of PAYG content, paid for by downloaded/ viewed result.  this would give him the flexibility he needs to add greater value to his clients.',NULL,NULL,53,1,NULL,'',NULL,'Behan and co',NULL,NULL,'tolley library','',131,1221,'2011-09-06 15:06:26',421,'2011-09-07 13:56:00',92,2632,201,NULL,NULL,'N'),(5511,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Meg Wilson / Tax Development Manager',2,142,NULL,55,'Hazlewoods feel that our content is not as up to date CCH. They feel that links from legislation to Simons are not up to date, They have to go back to old legislation to find links. See an example below - ICTA 419 has links and ICTA 455 doesn\'t. Apprarently this is very common. They also find the fact that we put new developments into a new develpment section, and not the text, a real negative. They feel when researching CCH\'s service appears more up to date because of this. Another example of our service not being up to date was when they were researching Substantial Shareholdings Exemption rules. Our service apparently says new rules are planned but they came in on the 1st April. CCH\'s service was up to date. I understand we are working on updating links but hope that now we have an excellent plaform we can focus on ensuring the content/links are fully up to date. Also, is adding new develpments to a new development section the best way to do this??\r\n\r\n',NULL,NULL,53,4,NULL,'',NULL,'Hazlewoods',NULL,NULL,'General Tax Practitioner','',81,1391,'2011-09-07 10:09:09',2632,'2011-09-09 08:57:33',92,2632,-1,NULL,NULL,'N'),(5521,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Amanda Renshaw ',4,3,NULL,NULL,'Kingston are looking for a new CMS because their supplier - Softcase, has gone into liquidation so they are using a system which is unsupported.\r\n',NULL,NULL,39,0,NULL,'',NULL,'Royal Borough of Kingston ',NULL,NULL,'Visualfiles','Soft Case',0,1141,'2011-09-07 15:28:32',3761,'2011-09-30 10:55:17',22,62,0,NULL,NULL,'N'),(5531,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Chris Marshall/ Business Manager ',4,18,NULL,NULL,'Customer really interested in subscribing to Webinars - but issue is bandwidth. This is feedback I am receiving a lot. Interest is there, but bandwidth is a big concern (true also at Lambeth).\r\n\r\nDo we know the effect on bandwidth of Webinars, and, if it is large, can it be reduced, or are there plans for it to be reduced?',NULL,NULL,62,0,NULL,'',NULL,'LFCD5000 - London Fire and Emergency',NULL,NULL,'Webinars ','',0,1141,'2011-09-07 15:31:41',1921,'2011-09-07 16:41:07',3,2752,0,NULL,NULL,'N'),(5541,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Simon Smith ',4,91,NULL,NULL,'Harrow pay 3k for NewsUK who have substantially reduced their UK content portfolio in relation to Regional News - which is key selling point of service.\r\n\r\nNexis looks v.strong in comparison - point to market?',NULL,NULL,39,9,NULL,'',NULL,'London Borough of Harrow ',NULL,NULL,'','News UK',452,1141,'2011-09-07 15:36:11',79,'2011-09-16 09:14:59',82,79,0,NULL,NULL,'N'),(5551,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Simon Smith ',6,91,NULL,NULL,'Simon asked how it would be possible to promote usage of Nexis and other online services (they are looking at subscribing to LexisLibrary too) as it is felt across several libraries that online resources don\'t demonstrate enough ROI via demonstrable metrics - such as no\'s of hits, and relative cost per search, and as such - books provided better vfm.',NULL,NULL,39,9,NULL,'',NULL,'London Borough of Harrow ',NULL,NULL,'','',452,1141,'2011-09-07 15:38:14',1921,'2011-10-31 16:44:51',72,3691,0,'TBC','','N'),(5561,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Peter Brown / Digital Rights and Citizenship Manager ',4,1,NULL,NULL,'Peter wanted a LexisLibrary jpg or visual so that users could click on the icon and it would take them through to the service rather than a URL, also a brief explanation of what LL is/does would also be useful.\r\n\r\nReplication of this for Nexis also would be useful to gain visibility of both services in the public library space',NULL,NULL,39,9,NULL,'',NULL,'London Borough of Enfield ',NULL,NULL,'','',452,1141,'2011-09-07 15:40:00',1921,'2011-10-25 11:33:54',72,61,0,'.','','N'),(5571,'COMPETITOR','Informal conversation',NULL,NULL,NULL,NULL,'','Jill Sprinbett',2,142,NULL,55,'the client cancelled their online menus earlier this year for CCH but still has Simons online. She searched for entrepreneurs relief in Simons but was specifically interested in \"material disposal of assets\". It was fair to say that she had only searched \"entrepreneurs relief\" so the results were covering everything on that topic. However, when we used the topic filter and clicked on CGT and then assets there was no mention of the correct result which should have been section C.3.1302.\r\n\r\nShe said that on the CCh library when there are say 30 results. The search engine groups the results together by saying there are 5 results within a specific seciton of the book, so th euser gets a good idea which seciton is more populated with content. On tolley library on the right hand column you can read what section of simons is pullin gup the result but its hard to know if that section only referes to it once or ten times unless you look through the entire results page and see if e.g. section 1.1 is more relevant or section 1.5.......',NULL,NULL,53,4,NULL,'',NULL,'Weston Kay',NULL,NULL,'Simons Online','',0,1211,'2011-09-12 13:53:59',2632,'2011-09-13 17:35:16',72,2632,0,NULL,NULL,'N'),(5581,'PRODUCT','Customer training session',NULL,10994,NULL,NULL,'','Richard Bussell',1,1,NULL,NULL,'***Please assign this insight to Judith Anderson***\r\n\r\nThis insight has been reported before by myself and also other trainers. It\'s about the issue of tristram oaths not being complete precedents but having \'heading as in form 1\' at the top and \'continue as in form ...\' at the end with no hyperlinks.\r\n\r\nRichard thought the bigger part of the issue was not having an end to the precedent as most headings were their own standard heading anyway which they have in an offline template but not knowing what the end of the document was meant to be was (in his view) a big issue meaning he would have to then dig around to try and locate the ending which was referred to.',NULL,NULL,56,3,NULL,'',NULL,'',NULL,NULL,'Tristram & Coote Precedents','',271,65,'2011-09-12 13:55:32',1921,'2011-09-13 16:12:22',92,2722,0,NULL,NULL,'N'),(5591,'CUSTOMER','Customer training session',NULL,10994,NULL,NULL,'','Richard Bussell',1,132,NULL,NULL,'***Please assign this insight to Malcolm Skinner***\r\n\r\nRichard thought it would be useful to have a smart-precedent for an oath for executor set up - is this planned?',NULL,NULL,56,3,NULL,'',NULL,'',NULL,NULL,'Lexis Smart Precedents','',101,65,'2011-09-12 14:03:50',2622,'2011-09-13 22:24:17',82,2622,0,NULL,NULL,'N'),(5601,'PRODUCT','Customer training session',NULL,10994,NULL,NULL,'','Richard Bussell / Ed Sharpe',1,132,NULL,NULL,'Please assign this insight to Rovber Evans - robert.evans@lexisnexis.co.uk\r\n\r\nBoth Ed and Richard liked the look of the IHT400 integrated form in smartforms but they had a suggestion which i was unsure if it was technically possible.\r\n\r\nIdeally what they want in this form is the ability to select the schedules - which you can do in the interated form, BUT then when they save it or print it, for the schedules not selected to NOT be included. They suggested either we should make the schedules only appear if they are selected, or the other way, make the schedules not required (and therefore not selected on the yes/no schedules selection boxes page) disappear.\r\n\r\nI said I\'d send this in as a suggestion as they find with the IHT400 on the government web site, it\'s unwieldy when they might only want 1 or 2 schedules. \r\n\r\nI did suggest they could only choose to print selected pages which they accepted was possible but they thought it should be automatic!',NULL,NULL,56,3,NULL,'',NULL,'',NULL,NULL,'Lexis Smart forms ','',341,65,'2011-09-12 14:10:53',1921,'2011-09-29 10:36:58',112,3701,0,NULL,NULL,'N'),(5611,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Tim Knight',2,142,NULL,55,'we went to see this client last week and he mentioned that he deosnt like the new online library but only came up with one reason - you cant open muliple docs in tabs or windows, he sees this as a step back from the old platform. \r\nHe is very unhappy although I assured him this was already being looked into. \r\nI was wondering if we can include him in future development plans? He would be willing to help. ',NULL,NULL,53,4,NULL,'',NULL,'Sobell Rhodes',NULL,NULL,'Tolley Library','',462,2121,'2011-09-13 11:19:46',2632,'2011-09-13 17:45:45',112,2632,0,NULL,NULL,'N'),(5621,'PRODUCT','Customer training session',NULL,4416,NULL,NULL,'','Kate Gunn',1,1,NULL,NULL,'Please see below, Medical Law Review as a journal would be great on the PI PAP but you can\'t bring it through, even when you subscribe to it. My session at Forum Law in Shirley had many clinical negligence experts present so anything that could show we have a focus in that area too!\r\n\r\n\r\nFrom: Duggan, Clare (LNG-LON) \r\nSent: 13 September 2011 10:49\r\nTo: Allan, Gavin (LNG-HBE)\r\nCc: Gray-Smith, Dawn (LNG-HBE); Smith, David (LNG-HBE); Davies, Lynne C. (LNG-HBE); Regan, Lisa (LNG-LON); Wright, Daniel (LNG-LON)\r\nSubject: RE: Lexis Library - Personal Injury - Journal absent from PI PAP? Medical Law Review\r\n\r\nHi Gavin\r\n\r\nLisa Regan and Dan Wright manage LexisLibrary developments these days so I\'m copying them in so they can look into this for you.\r\n\r\nCheers,\r\nClare.\r\n\r\n________________________________________\r\nFrom: Allan, Gavin (LNG-HBE) \r\nSent: 13 September 2011 10:47\r\nTo: Duggan, Clare (LNG-LON)\r\nCc: Gray-Smith, Dawn (LNG-HBE); Smith, David (LNG-HBE); Davies, Lynne C. (LNG-HBE)\r\nSubject: Lexis Library - Personal Injury - Journal absent from PI PAP? Medical Law Review\r\n\r\nMorning Clare\r\n\r\nHope all is well. I\'ve just been playing around with a client id trying to get Medical Law Review onto their PI PAP in the Library, and it\'s not there...\r\n\r\nI can see it in their \'Sources\' tab. They have Lexis Library PI/Fam/Emp/Wills/Trusts\r\n\r\nUser ID:               jaynewest\r\nPassword:           C5XGZB\r\n\r\n\r\nAm I missing something? Or is this a bookshelf adjustment that needs looking into?\r\n\r\nMany thanks as ever.\r\n\r\nGavin\r\n',NULL,NULL,44,9,NULL,'',NULL,'',NULL,NULL,'Lexis Library PI','',0,66,'2011-09-13 14:45:43',1921,'2011-10-20 11:43:47',72,61,0,'.','','N'),(5631,'PRODUCT','Customer training session',NULL,4416,NULL,NULL,'','Kate Gunn',1,4,NULL,NULL,'During my training at Forum Law (part of Quality Solicitors) who have a large focus of work in the world of personal injury, I was asked about our international quantum coverage. I said currently it was UK based.\r\nShe expanded to say it was things like holiday claims involving international elements to the incident that they are increasingly coming across and would love support on.\r\n\r\nI also recall being asked by a separate client (RSA in Liverpool) about  Norther Irish quantum which again we have none of, but it seems we are being asked more and more often...\r\n\r\nWould it ever be a relevant topic within the PSL International module? Just a thought...\r\n\r\ncheers,\r\nG',NULL,NULL,44,1,NULL,'',NULL,'',NULL,NULL,'PSL PI','',101,66,'2011-09-13 14:51:08',371,'2011-10-05 14:21:48',72,371,231,NULL,NULL,'N'),(5641,'PRODUCT','Customer training session',NULL,11220,NULL,NULL,'','Lynne Haffner - Support Staff',1,132,NULL,NULL,'We have added Smart Forms access to appease Southerns of their many forms issues they have had with us in the past. They had immense problems with HotDocs. \r\n\r\nThey like the concept of Smart Forms, but still have and are currently using Laserforms. \r\nThey have said they will not start using smart forms until it has easy to populate fields such as their company name (they have 4 branches so have fed in 4 templates for this they currently easily use in Laserform).\r\n\r\nWe are seen as an inferior product to competitors. It would take them 15 minutes or so extra using us per form to add company name and other potentially self populating fields such as court address and local authority which we also do not fully have in place on all relevant forms.\r\n\r\nUntil we sort this we are \'not ready for market\' (a quote from their senior partner Gary Taylor). \'Come to me and tell me when it\'s ready\' he said, \'You keep doing this to us\'...!!!\r\n\r\nRob Evans is working extremely hard and has been unbelievably supportive to me and my many smart form clients. I know he desperately wants to get this right as he knows the pain of our customers.\r\n\r\nI cannot stress how much of an obstacle this is to Smart Forms as product that has every reason to succeed and exceed expectations in the market. Why would anyone move to a product that takes longer to use than existing options?\r\n\r\nI have heard similar feedback from other clients including Marrons who I logged an insight for back in August, who e-mailed me again Sep 12th to see where things were on this point.\r\n\r\nPlease help and give this the priority it needs to fully achieve what Smart Forms is setting out to do!\r\n\r\nMany thanks,\r\nGavin\r\n\r\n',NULL,NULL,56,3,NULL,'',NULL,'',NULL,NULL,'Smart Forms','Laserforms',41,66,'2011-09-13 15:22:53',1921,'2011-09-29 10:35:37',112,3701,0,NULL,NULL,'N'),(5651,'PRODUCT','Customer training session',NULL,4416,NULL,NULL,'','Cheryl McSheen-Bailey-Head Private Client',1,1,NULL,NULL,'Below is a repeat of a query the other week from Blakemores:\r\n\r\nButterworths Wills Probate and Administration Service Precedents Browsing Observations:\r\n\r\nIn BWPAS when you have the paper copy in front of you Cheryl (head of Private Client at Forum Law) was saying there is an excellent large bank of will clauses at the start of the Division AP - Wills. \r\nHowever, when you browse the online version of Division AP, then select 1. Wills, yes there is a clauses section, but there are only a few of the ones she was expecting to see. \r\nOn closer scrutiny we found the clauses she was looking for in the next section down, section \'2. Free of Tax or subject to tax: a general note\'. Instinct would NOT have led any of us in the room (including 4 private client experts and myself as trainer) to browse that section to find clauses. \r\nWe found it by accident on a search. \r\nCould this section be renamed, or seen as a sub section of section \'1. Wills\' so customers don\'t miss out on what look to be an excellent selection of helpful clauses (quote from my client there!)?\r\n\r\nManythanks\r\nGavin',NULL,NULL,56,3,NULL,'1317893063.msg','Insight 5651.msg','',NULL,NULL,'Lexis Lib Wills','',131,66,'2011-09-13 20:08:49',1921,'2011-10-06 09:24:23',72,0,0,NULL,NULL,'N'),(5661,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,1,NULL,NULL,'Apparently for many SI\'s (example given was with relation to Environmental Protection Act) it is not clear whether they are England, Wales, Scotland etc. It is possible for us to have a result groups option to filter legislation results by jurisdiction? ',NULL,NULL,39,2,NULL,'',NULL,'Hull City Council',NULL,NULL,'','',131,2371,'2011-09-14 09:54:59',1921,'2011-10-20 09:38:53',112,61,0,'.','','N'),(5671,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,1,NULL,NULL,'When searching for family forms (eg C1, C2, C10, A50) in the forms and precedents box in quick find no suggestions are given. The client pointed out that these are quite common forms and they would expect them to be appear as a drop down suggestions (although they do come up when you click find).',NULL,NULL,28,3,NULL,'',NULL,'Hull City Council',NULL,NULL,'','',101,2371,'2011-09-14 10:01:29',1921,'2011-10-06 09:28:32',72,61,0,NULL,NULL,'N'),(5681,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,1,NULL,NULL,'Appeal tracker: The client is working on a case (Re T (Children Costs) ) which we found as a case report. This case was heard in the Court of Appeal on 18/11/2010 and has gone to appeal to the Supreme Court. The case did not appear on the appeal tracker.',NULL,NULL,28,1,NULL,'',NULL,'Hull City Council',NULL,NULL,'','',101,2371,'2011-09-14 10:04:25',1921,'2011-10-20 09:55:23',72,141,0,'.','','N'),(5691,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'When using the search box to search for family forms (eg C2, C10, A50) the search came back as no results. However when we viewed all forms, all these forms were there. The client wanted to know why the search box was not picking them up.',NULL,NULL,28,3,NULL,'',NULL,'Hull City Council',NULL,NULL,'','',131,2371,'2011-09-14 10:06:35',1921,'2011-09-20 10:23:08',72,59,0,NULL,NULL,'N'),(5701,'BLANK','0',NULL,NULL,NULL,NULL,NULL,'Test',NULL,NULL,NULL,NULL,'Natasha sending test insight - \r\nPhil please let me know if you get an email alert..\r\nsend confirmation email to natasha.miller@lexisnexis.co.uk.\r\nThanks',NULL,NULL,0,0,NULL,NULL,NULL,'Test',NULL,'0',NULL,NULL,0,3552,'2011-09-14 10:41:15',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'N'),(5711,'PRODUCT','Other',NULL,994,NULL,NULL,'','Michael Bance',1,4,NULL,NULL,'Michael has been chair of sole practitioners group. He has now cancelled PSL Commercial mostly due to quality (quantity of duplicated clauses/documentsand not structured logically). This was reported in NPS Q2 2011 and in Sept 11. I spoke to him on the phone and explained the steps we were taking tho remedy the defects in quality and structure and he seemed reasonably impressed and did say he would look again in 6-12 months. However, he further complained about issues with the formatting of documents on download:\r\n(1) \"formatting all over the place - there seemed to be hidden page and section breaks. You couldn\'t format or get rid of gaps. Some different hard font formatting. You couldn\'t change the font. Even if you stuck wtih the existing font, if you introduced some new text the font was not consistent.\"\r\n(2) \"numbering problems if you delete something\"\r\n(3) \"cross-references don\'t link or renumber\"\r\n(4) \"no index/Table of contents which might solve the lack of cross-ref linking automation ie if you delete something at least Toc/Index will show ref not found so you will know to check else where for that\r\n\r\nFor commercial lawyers all of this is really very important.\"',NULL,NULL,10,3,NULL,'',NULL,'',NULL,NULL,'Commercial','',341,241,'2011-09-14 16:01:20',1921,'2011-09-20 10:18:29',92,59,0,NULL,NULL,'N'),(5721,'PRODUCT','Customer training session',NULL,2681,NULL,NULL,'','Lynne Cameron',1,1,NULL,NULL,'Lynne has asked would it be possible to have the full text of documents produced by HMRC in PDF uploaded onto Lexislibrary so they are captured during a search? I explained that currently the press releases announcing the document would generally provide a link to the document concerned, and she said be more useful to have the document within the Library. Please see the attachment for details of the specific document.\r\n\r\nThis would apply to Tolley Library too, though CC take LexisLibrary for Tax.\r\n',NULL,NULL,53,5,NULL,'1316094903.doc','Business Non business V1-6.doc','',NULL,NULL,'','',131,75,'2011-09-15 13:54:42',1921,'2011-11-15 13:05:37',72,61,0,'TBC','','N'),(5731,'PRODUCT','Customer training session',NULL,9811,NULL,NULL,'','',1,4,NULL,NULL,'I was training the litigation team at Prince Evans, in Ealing, on LexisLibrary and PSL. I was asked to search for a Form N244, which is an application notice in civil litigation. I used PSL to do this, using the DR module, and typed N244 in the search box, searching across All, and searching by title. It brought back no results. When I clicked on the Forms option for searching, I could find the form in the list, called N244 - Application Notice. I can also see the form when I click on the topic under Litigation called Applications, and click on the Forms tab. Why can\'t I search for a form by its number, using the Search box? I also tried searching full text, and I got lots of results, but there was no Forms tab in my results screen. I\'ve now tried this for other forms in other modules and it seems you cannot search for a form on PSL. The customer felt this did not make sense, as you can search for basically anything else. Why is the case, and can it be implemented so that you can search for a form number/name using the search box?\r\n\r\nThanks\r\n\r\nBen',NULL,NULL,9,9,NULL,'',NULL,'',NULL,NULL,'','',131,1881,'2011-09-16 08:46:31',1921,'2011-09-19 15:56:47',72,59,0,NULL,NULL,'N'),(5741,'','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Andrew Brooks ',2,142,NULL,NULL,'This client was mis-directed through Small Solo Legal, (he is a tax specialist) and has spend 2 weeks trying to get the correct menu set put together for him. I have discussed his requriements with him and again we come back to the problem of not being able for the client to choose the titles he needs to practice in his particular niche, which in this case is Private Client Tax.  He has sent me a graded list of all of the content on the TAx Library (this was the most cost effective way to construct a menu that covered his needs).  The deal is likely to close around 7-8k, this is still 60+% discounted on the menu price, although reflective of the value he attaches to the content (1=crucial, 5=would never use). the solution will be to offer tax library at a discount representative of the reflected content value, although from a user experience perspective the client will end up with cluttered results from the 50% of sources he has rated 3 or below( interestingly this included most of the core tolley annuals).  Perhaps a solution would be to look at the more niche sources on Tax Library (undehill and layton, williams on wills, butterworth money laundering law and offer them as bolt ons). if you need any more info, please just get in touch. thanks!! Mark',NULL,NULL,53,12,NULL,'1316163077.xls','andrew menu list.xls','Andrew Brooks',NULL,NULL,'tax library','nil',121,1221,'2011-09-16 08:50:54',2632,'2011-09-16 14:29:02',22,2632,0,NULL,NULL,'N'),(5751,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Paddy Behan Director',2,2,NULL,82,'Quote from email:\r\nWhen we spoke we got on to some subjects which, strictly, are outside your area.  For instance, you mentioned that one case was not set up on Tracker Data because the team was not going to track it.  I said that if \"VAT\" or \"customs\" show up as keywords the case should be tracked.\r\n \r\nI now have  a further point to mention.  On Thursday the decision in Accor, Case C-310/09 was handed down by the Court.  I was very surprised to find that on Thursday afternoon the judgment had still not been put up - decisions are almost always available on the Curia website by mid morning.  I have searched again and I cannot find the judgment on the EU Tracker.  In this case, because the case is so important I was very aware of the date and I printed it off the Court website.  But for other, less prominent, but still significant, cases I would rely on the EU Tracker e-mail.  If the judgment is put up late the prompt to look at EU Tracker will be late as well, greatly reducing the value.\r\n',NULL,NULL,57,1,NULL,'',NULL,'Behan and co',NULL,NULL,'eu tracker','',101,1221,'2011-09-16 09:35:34',1921,'2011-10-20 15:07:28',72,2762,0,'.','','N'),(5761,'COMPETITOR','Customer training session',NULL,13001,NULL,NULL,'','Susanne Homer',1,24,NULL,NULL,'Sent the below insight in light of training at Wragge and Co about competitor acitivity there to the accout mananger Jeremy Shayler.\r\n\r\nFrom: Allan, Gavin (LNG-HBE) \r\nSent: 16 September 2011 11:16\r\nTo: Shayler, Jeremy (LNG-LON)\r\nSubject: Wragge & Co - WRAG5001\r\n\r\nHi Jeremy\r\n\r\nHope all is well. Just a quick e-mail to let you know what I heard in Monday\'s training at Wragge & Co (in case it hadn\'t reached you).\r\n\r\nI ran trainee and new starter training in a couple of sessions with Susanne Homer in Birmingham (with a link to their London office). \r\n\r\nShe starts the session setting out generally what\'s available resource wise to all at Wragge. 3 small observations that may mean nothing but will forward to you anyway:\r\n\r\n1. PLC - Wragge are changing their way of accessing it. They are moving to individual log ins rather than automatic login to review who\'s using what. Maybe this is part of the review they are currently having of PSL and how useful it might be.\r\n2. They have LawTel which they promote for updates and cases. (given our current awareness/cases coverage, not sure why this is still necessary... maybe I\'m being optimistic about how good ours is!).\r\n3. West - Susanne said they are trialling West (all UK coverage) at the end of September for a couple of months to see if there are any needs for a subscription.\r\n\r\nShe heavily promotes us as the main/preferred supplier and is really positive about us, but I don\'t think we should underestimate these \'nibblings at our heel\' with the strengthening bond between PLC and West. I don\'t think the West books linking with PLC is sorted yet, but when and if they do, it could be a bit of a worry...\r\n\r\nShe spoke of this West content being a supplemental selection of content, but feel I should relay to you what I heard.\r\n\r\nCheers and have a lovely w/e.\r\nG\r\n\r\n\r\n\r\nGavin Allan\r\nTraining Consultant\r\n\r\nLexisNexis\r\nHalsbury House\r\n35 Chancery Lane\r\nLondon, WC2A 1EL\r\n\r\ngavin.allan@lexisnexis.co.uk\r\n+44 (0)7740 631 480 - Mobile\r\n\r\n',NULL,NULL,59,9,NULL,'',NULL,'',NULL,NULL,'Lexis Lib/PSL','PLC/West/Lawtel',31,66,'2011-09-16 10:20:26',61,'2011-11-04 11:14:20',82,61,0,'TBC','','N'),(5771,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','john snowdon',2,142,NULL,55,'This sole practitioner (bulk of work is OMB compliance), currenly takes CCH online (2000).  he approach LN after being frustrated by persistent price increases.  Nalini in Small solo demo\'d guidance (which he saw value in), but got stuck on library content for him. After I spoke at length to him, it became apparent that his projected usage of library would be no more than 10 times per year, but when he did use it, the content required would be very deep (simons / devoils / company law).  He enquired as to the possibility of a pacakge which included all tolley modules and the library content previously mentioned within his 2k budget.  This does contradict our current fee earner pricing model (package would be approx 8k - TG +Tolm04).  a potential solution would be capped usage or PAYG online pricing.',NULL,NULL,53,9,NULL,'',NULL,'john snowdon',NULL,NULL,'tolley library','',371,1221,'2011-09-16 15:08:30',2632,'2011-09-19 08:02:39',22,2632,0,NULL,NULL,'N'),(5781,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Anna Jane Spirit',1,132,NULL,NULL,'Essential conveyancing forma are not included in the Smartforms content, namely SDLT forms1. 2. 3. and 4. In [articulat SDLT1 is used in every conveyancing transaction and the SDLT forms on the system are not the most commonly needed.\r\n\r\nLPA PA is not on Smartforms either, this can be viewed via Hotdocs in Atkins Court Forms.\r\nIs this content to be added?\r\n\r\nThis query emailed to Rob Evans',NULL,NULL,0,3,NULL,'',NULL,'Burley & Geach',NULL,NULL,'','',131,72,'2011-09-16 15:44:46',1921,'2011-09-29 10:28:26',82,3701,0,NULL,NULL,'N'),(5791,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Helen Gwinn / Legal Information Manager',1,1,NULL,NULL,'The client feels that when viewing legislation and using the \'Find related cases\' that it should bring back more results than it does and therefore feels that they can not really rely on this for finding cases that mention the relevant Act or section and therefore advise their colleagues not to use this function.  For example Helen and her colleagues quoted Equality Act 2010 section 6, they felt there should be quite a few cases that should appear under \'find related cases\'.',NULL,NULL,0,9,NULL,'',NULL,'Blake Lapthorn',NULL,NULL,'Legislation','',91,76,'2011-09-16 16:11:43',1921,'2011-09-16 16:48:21',3,61,0,NULL,NULL,'N'),(5801,'PRODUCT','Customer training session',NULL,1515,NULL,NULL,'','Helen Gwinn/Legal information manager ',1,1,NULL,NULL,'During a meeting at Blake Lapthorn, the three people in attendance all mentioned how they really like the new annotations on legislation.  They felt that this was a very good enchancement and gave lots of important useful information.',NULL,NULL,0,2,NULL,'',NULL,'',NULL,NULL,'','',452,76,'2011-09-16 18:20:45',1921,'2011-10-04 13:06:33',72,61,0,NULL,NULL,'N'),(5811,'PRODUCT','Customer training session',NULL,1515,NULL,NULL,'','Helen Gwinn/Legal information manager ',1,1,NULL,NULL,'Duing a meeting with this client, the three attendees whom train all of the firm\'s users said that they do not encourage the users to search via the Practice Areas tabs.  They felt that these tabs were too general.  They agreed that the practice areas show books generally specific to that area but felt as it included things like All England Law Reports and Halsburys etc these publications also cover other areas and would be much more useful if it was all completely specific to the practice area choosen rather than include content specific to other areas just because the publication included spans various areas.',NULL,NULL,0,9,NULL,'',NULL,'',NULL,NULL,'Practice Area Tabs','',0,76,'2011-09-16 18:25:00',61,'2011-11-04 11:16:57',82,3711,0,'TBC','','N'),(5821,'PRODUCT','Customer training session',NULL,1515,NULL,NULL,'','Helen Gwinn/Legal information manager ',1,1,NULL,NULL,'During a meeting with this client on the 12th September 2011, the three attendees felt that the Quick Find box should default to selecting both the \'act\' and SI\' tickboxes for searching.  They said many times they carry out a search and click \'find\' only to realise that the SI box was not selected and have to rerun the search.  It was felt that it would be better to have both selected as a default.',NULL,NULL,0,2,NULL,'',NULL,'',NULL,NULL,'','',341,76,'2011-09-16 18:27:32',3711,'2011-11-15 10:08:56',82,3711,0,'TBC','','N'),(5831,'PRODUCT','Customer training session',NULL,1515,NULL,NULL,'','Helen Gwinn/Legal information manager ',1,1,NULL,NULL,'During a meeting on 12th September 2011 with 3 peple that carry out all of the firms internal training on LexisLibrary they all mentioned that they love the new update date information on the precedents.  It was felt that this was very beneficial as they then know when it was last updated so know how current the information is.',NULL,NULL,0,3,NULL,'',NULL,'',NULL,NULL,'','',452,76,'2011-09-16 18:29:51',61,'2011-11-04 11:07:04',72,61,0,'TBC','','N'),(5841,'PRODUCT','Customer training session',NULL,1515,NULL,NULL,'','Helen Gwinn / Legal information manager ',1,1,NULL,50,'During a meeting on 12th September 2011 with three people that carry out all of the firms internal training for Lexislibrary it was felt that it would be of benefit for our Casesearch documents to also show where in journals the cases are mentioned.  They understood that you could look up a case and then use the \'find releated journals\' link on the right-hand side of the screen but it was felt it would be of benefit to be included within the Casesearch document as well.  Apparently Westlaw\'s equivalent to Casesearch include a link to the journal articles that mention the case.',NULL,NULL,0,1,NULL,'',NULL,'',NULL,NULL,'','',341,76,'2011-09-16 18:33:53',61,'2011-11-04 11:09:39',112,61,0,'TBC','','N'),(5851,'PRODUCT','Customer training session',NULL,1515,NULL,NULL,'','Helen Gwinn / Legal information manager ',1,1,NULL,NULL,'During a meeting on 12th September 2011 with 3 people that carry out all the firm\'s internal LexisLibrary training, it was mentioned that they felt that the forms should have a PDF option rather than having to use HotDocs as they encounter many problems using HotDocs.  I did explain about LexisSmart but it was felt it should be included as part of the LexisLibrary platform rather than having to have LexisSmart as well.',NULL,NULL,0,3,NULL,'',NULL,'',NULL,NULL,'','',341,76,'2011-09-16 18:37:04',1921,'2011-11-01 11:41:10',72,341,0,'TBC','','N'),(5861,'PRODUCT','Customer training session',NULL,1515,NULL,NULL,'','Helen Gwinn / Legal information manager ',1,1,NULL,NULL,'During a meeting on 12th September 2011 with 3 members of this company whom carry out all internal training on LexisLibrary it was generally felt that the bookshelf functionality was very cumbersome, having to access the link, then use the different radio buttons to select if it is a commentary publication they wish to add or if it is a case pubilcation and also then having to click on the \'find more sources\'.  It was felt that the bookshelf would be better with one list to select from as a lot of people would not know if a source was commentary or materials etc and also would be nice if it could look like an actual bookshelf rather than links of names.  I described the new Tolley Library bookshelf and how that works and they felt that would be much better to have on the LexisLibrary as currently it is too confusing and takes too much time to amend.',NULL,NULL,0,9,NULL,'',NULL,'',NULL,NULL,'','',341,76,'2011-09-16 18:40:39',1921,'2011-10-04 13:46:42',92,61,0,NULL,NULL,'N'),(5871,'PRODUCT','Customer cancellation request',NULL,NULL,NULL,NULL,'','Cristian Ley',1,4,NULL,NULL,'Customer advised essentially, it\'s too simple for his needs.  He know\'s how to use it etc.; the information is just not that meaty (being a PSL service only) and likewise he can\'t afford a full subscription of the sort he enjoyed when in private practice.\r\nIf you wish to speak further with the customer, he can be contacted on 020-8181-9100',NULL,NULL,61,0,NULL,'',NULL,'The Guild Construction Workers Limited',NULL,NULL,'PSL In-House','',91,1311,'2011-09-19 11:25:38',1921,'2011-09-20 12:37:36',72,591,0,NULL,NULL,'N'),(5881,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Jude Hartley',1,4,NULL,NULL,'Following feedback from Jude re training at Hull the childcare team thought that were some key forms missing from that section of LG. This has been passed onto Dolly Lundin who is looking into this',NULL,NULL,39,3,NULL,'',NULL,'Hull City Council',NULL,NULL,'','',101,1381,'2011-09-19 16:42:55',351,'2011-11-24 13:10:32',82,351,0,'TBC','','N'),(5891,'PRODUCT','Customer training session',NULL,13344,NULL,NULL,'','',1,4,NULL,47,'The property department really like PLC and they said they did not like using PSL. I asked the reason for this and they said that when they use the search box on PLC it always finds relevant information, however often on PSL the search box comes up with no results even when they know there is information there. (I have found this to be the case myself when conducting training sessions).  ',NULL,NULL,49,6,NULL,'',NULL,'',NULL,NULL,'Lexis PSL Property','',41,2371,'2011-09-20 14:44:24',1921,'2011-10-26 14:42:52',72,59,0,'.','','N'),(5901,'PRODUCT','Customer training session',NULL,13344,NULL,NULL,'','',1,1,NULL,NULL,'When in the employment practice area page on library the client wanted to add commentary relevant to company law to their bookshelf as they sometimes touch on company law issues. It is not possible to add sources from another practice areas onto the employment practice area bookshelf. We added it to the home page bookshelf so the client can access it from there but this is not as useful as being to access it from the employment practice area bookshelf. This issue would be the same in any practice area -  is it possible to enable people to add any source on their subscription to a particular practice area bookshelf?',NULL,NULL,24,9,NULL,'',NULL,'',NULL,NULL,'','',271,2371,'2011-09-20 14:48:39',1921,'2011-11-09 16:20:01',22,4021,0,'TBC','','N'),(5911,'PRODUCT','Customer training session',NULL,13344,NULL,NULL,'','',1,4,NULL,47,'The clients said that they find the alerts from PLC more useful than PSL because PSL is more news analysis based (the example they gave yesterday 19th sept - was a news piece relating to the EU which they said is not relevant to them). The said that PLC\'s alerts are more case focussed which they find more relevant.',NULL,NULL,4,0,NULL,'',NULL,'',NULL,NULL,'Lexis PSL dispute resolution','',0,2371,'2011-09-20 14:56:31',1921,'2011-09-21 13:17:25',72,1531,0,NULL,NULL,'N'),(5921,'PRODUCT','Customer training session',NULL,13344,NULL,NULL,'','',1,4,NULL,NULL,'Unable to find form N5b when using the search box in PSL disupute resolution. It might be that it is not in the PSL module as we found it easily in Lexis Library but the customers thought it should be in PSL as well.',NULL,NULL,4,3,NULL,'',NULL,'',NULL,NULL,'PSL Dispute Resolution','',0,2371,'2011-09-20 15:02:59',1921,'2011-09-21 13:13:36',72,1531,0,NULL,NULL,'N'),(5931,'PRODUCT','Customer training session',NULL,13344,NULL,NULL,'','',1,1,NULL,NULL,'When browsing through sources we found the Atkins Court forms index which the customer really liked. However I was unable to find a way to add this to the bookshelf. I could add the key document find but not the index. Is there a way of making it more accessible because many dispute resolution groups I train are still very book dependent so easy access to the Atkins Court forms index would enable them to feel more comfortable using online resources.',NULL,NULL,4,3,NULL,'',NULL,'',NULL,NULL,'','',0,2371,'2011-09-20 15:05:45',61,'2011-11-04 11:23:52',102,61,0,'TBC','','N'),(5941,'PRODUCT','Customer training session',NULL,13344,NULL,NULL,'','',1,1,NULL,NULL,'Please could you add an index to Harvey ( and other key employment texts). The customer likes to be able to browse but as they are familiar with the hard copy book an index would make this easier.',NULL,NULL,24,4,NULL,'',NULL,'',NULL,NULL,'','',131,2371,'2011-09-20 15:07:21',61,'2011-11-04 11:21:53',102,61,0,'TBC','','N'),(5951,'PRODUCT','Customer training session',NULL,13344,NULL,NULL,'','',1,4,NULL,NULL,'In the topic area \'Appeals\' the customer thought that there were not many recent cases. They said that they would expect to see Warner and Kingdon v Kingdon listed in the cases section.',NULL,NULL,28,1,NULL,'',NULL,'',NULL,NULL,'Lexis PSL family','',101,2371,'2011-09-20 15:09:44',1541,'2011-09-23 15:26:17',22,1541,0,NULL,NULL,'N'),(5961,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'The clients like the toolbox but in the Essential Financial information section they would find CPI (consumer prices index) useful as they said this is now more widely used than the retail prices index. Also is it possible to add a calculator to the child maintenance section as they thought that would be really useful.',NULL,NULL,28,9,NULL,'',NULL,'taylor walton',NULL,NULL,'Lexis PSL family','',131,2371,'2011-09-20 15:12:51',1541,'2011-11-03 12:14:03',72,1541,0,'TBC','','N'),(5971,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,1,NULL,NULL,'The customer said that they would like to be able to save individual documents. The add/view function is good but 24 hours is not enough time and they would like a way to save documents for longer.',NULL,NULL,0,9,NULL,'',NULL,'Amlin',NULL,NULL,'','',341,2371,'2011-09-20 15:23:02',1921,'2011-10-04 13:47:56',72,61,0,NULL,NULL,'N'),(5981,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Richard Harvey',2,142,NULL,NULL,'Richard said that he thinks that Simons value is declining as too much of it is now written by internal editors and not enough is written from high level QC\'s as the content needs more commentary about real life senarios and less rewrites of the legisaltion. ',NULL,NULL,53,4,NULL,'',NULL,'FBR McGarry Harvey',NULL,NULL,'Simons Taxes','NA',81,2121,'2011-09-20 18:18:29',1921,'2011-10-31 16:46:30',22,271,0,'TBC','','N'),(5991,'BLANK','Customer training session',NULL,8217,NULL,NULL,'','Angela Ingall',6,4,NULL,47,'Angela deals with Plot Sales for developments and has asked when this will be added to LPSL, what precedents there will be and if any will be smart?',NULL,NULL,50,3,NULL,'',NULL,'',NULL,NULL,'LexisPSL Property','',0,68,'2011-09-22 08:05:58',201,'2011-09-26 16:21:54',112,201,0,NULL,NULL,'N'),(6001,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Natasha Test',0,41,NULL,NULL,'Natasha test, please do not respond.\r\nThanks!',NULL,NULL,3,4,NULL,'',NULL,'Natasha Test',NULL,NULL,'Natasha Test','Natasha Test',51,2552,'2011-09-22 16:01:00',1921,'2011-09-23 15:37:00',21,0,0,NULL,NULL,'Y'),(6011,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','David Hollis / Legal Service Manager Commercial',4,4,NULL,NULL,'Sheffield CC are trialling PSL and the commercial team were looking at the procurement section in particular.  They were impressed with the practice notes and links into cases and legislation.  However, the forms under the procurement tab plus the form under the \'129 Model notice of local authority public works contracts: public works concession contracts\' precedent are only availabe via Hotdocs (which opens up a can of worms).  Is there any scope for these to be moved onto LexisSmart?\r\n',NULL,NULL,39,3,NULL,'',NULL,'Sheffield City Council',NULL,NULL,'','',0,1381,'2011-09-22 16:59:17',1921,'2011-10-20 11:46:39',92,151,0,'.','','N'),(6021,'BLANK','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Paul Phelan ',1,1,NULL,50,'Merton are a current subscriber to LL, Richmond currently take Westlaw. Merton/Richmond are first London Boroughs to share legal services, so we are running an extended trial to try and win Richmond lawyers over to LN, and keep Merton lawyers bought into the service.\r\n\r\nFeedback from Litigation/Planning Lawyer was with regards to the Historical Versioning available on Westlaw. Lance described this as definitive, and in every courtroom, West means the law. \r\n\r\nHe reasoned this because his cases tend to track over many years and he needs to be able to accurately analyse the legal position on certain days in time past and have this in court (the judge and opposition party will have this information)and without this, he is in a weaker position and cannot present his cases to the best of his ability, and the client has a lesser service. With West, he can just print the information off and be confident in a courtroom scenario.\r\n\r\nI explained that we have a historical versioning service available via LL, and that you click and request the legislation that you want, and we provide the service in business hours and send the content requested through in about 30 mins.\r\n\r\nLance felt it was a real negative of our service that this was not automated, and could not be reconciled outside of office hours.\r\n\r\nThis lack in our service provision I feel has a real impact as to whether we will win the Richmond business - worth up to 31k over 3 years, and retain the Merton business - worth up to 65k over 3 years, total of 96k over 3 years.\r\n\r\n',NULL,NULL,39,2,NULL,'1317053973.msg','Reassigning.msg','Merton / Richmond ',NULL,NULL,'LexisLibrary ','',0,1141,'2011-09-23 08:04:41',1921,'2011-10-21 12:30:41',112,61,0,'.','','N'),(6031,'COMPETITOR','Customer cancellation request',NULL,NULL,NULL,NULL,'','Kate Naylor',2,142,NULL,55,'CCH admitted that they cannot compete on content - Simons v BTR\r\n\r\nWhen in competitve pitch they are advising customer to keep an online subscription to Simons Online and take all other online services from CCH so are admitting they do not have the depth of content that we have ',NULL,NULL,53,4,NULL,'',NULL,'Sagars',NULL,NULL,'Simons','',51,1151,'2011-09-23 08:21:09',2632,'2011-10-21 12:43:21',82,2632,0,'.','','N'),(6041,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Brian Spence',2,142,NULL,55,'CCH do not own the PCAS content as it is licenced from SWOT\r\n\r\nI have advised Mark Bissett who is SWOTS account mamager but we need to build a realtionship with SWOT so we can get this exclusive content as the lack of theis content is a barrier to winning CCH accounts',NULL,NULL,53,9,NULL,'',NULL,'Montpellier',NULL,NULL,'PCAS','',31,1151,'2011-09-23 08:24:26',1921,'2011-10-21 12:46:05',92,1221,0,'.','','N'),(6051,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Karen O\'Connor',4,1,NULL,NULL,'The environmental health and trading standards teams at Bracknell Forest Council believe that the topic term Food & Drugs  is too broad. They would like to see Food separate from Drugs, and then again sub-divided into Food Standards and Food Hygiene as they are two distinct areas. Food Standrads is trading law ie mis-labelling etc. Food Hygiene is safety, harm etc. The current index term is too broad for them to be able to use it to research their food hygiene information.',NULL,NULL,16,12,NULL,'',NULL,'Bracknell Forest ',NULL,NULL,'LexisLibrary','',291,80,'2011-09-23 10:16:24',1921,'2011-09-26 15:45:51',3,2722,0,NULL,NULL,'N'),(6061,'BLANK','Industry event',NULL,NULL,NULL,NULL,'','david eveleigh',0,3,NULL,NULL,'Passed to darren short\r\nA need for corporates to understand risk across the business for structured and unstuctured data.\r\n\r\nAlso to assist gc in pulling a compelling proposition back to the business.\r\n\r\n\"E disclosure is not the full picture need to be wary of institutional optimism\"\r\n',NULL,NULL,19,9,NULL,'',NULL,'BT',NULL,NULL,'dna qumas','ibm, emc',131,411,'2011-09-23 10:20:16',1921,'2011-09-26 14:35:37',21,0,0,NULL,NULL,'Y'),(6071,'BLANK','Informal conversation',NULL,NULL,NULL,NULL,'','',0,1,NULL,NULL,'Test1',NULL,NULL,0,0,NULL,'',NULL,'',NULL,NULL,'','',0,1361,'2011-09-23 11:43:55',1921,'2011-09-23 15:26:39',21,0,0,NULL,NULL,'Y'),(6081,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','',0,4,NULL,NULL,'Test2',NULL,NULL,0,0,NULL,'',NULL,'',NULL,NULL,'','',0,1361,'2011-09-23 11:44:29',1921,'2011-09-23 15:26:13',21,0,0,NULL,NULL,'Y'),(6091,'BLANK','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Julie Hall / Head of Stock Support Services ',4,1,NULL,NULL,'I am currently working on a campaign across all Public Libraries in London to win new business for LexisLibrary, PSL and NexisDirect. \r\n\r\n30 libraries, max of 22k at each for the first year to go after - so a total of 660k to chase, going for 3 year deals at all so max potential is in region of 1.8mill - even if only close 10% of opportunities, looking at wins of 180k. \r\n\r\nHave renewed business across 2 libraries, grown portfolio within 2, and obtained new business at another, have 2 libraries going through trials at the moment, another to start in a few weeks and meetings going into the diary so that am seeing a new library practically every week.\r\n\r\nAt every meeting, ROI and visibility of online resources is a major obstacle to overcome for the purchaser and for LN. The general public - by and large the library customer, have no brand awareness of LN, and even less so a URL that is on the library homepage without logo or explanation.\r\n\r\nA recent report was written (sadly not for circulation outside the London Library Consortium) including some ideas for best practice in increasing usage / visibility of these resources. The report was written by a LN/Nexis champion, so this is helpful at opening the doors to the meetings.\r\n\r\nThe libraries I have met with so far would really like to see a visual JPG with our branding for LexisLibrary / NexisDirect, even if it is just LexisNexis branding to direct their staff / customers too, and if possible a brief explanation of what the service provides as a hover over.\r\n\r\nThis could really help me win new business across the portfolios in this space.\r\n\r\nThanks,\r\nKate\r\n',NULL,NULL,0,0,NULL,'',NULL,'London Borough of Lewisham ',NULL,NULL,'LexisLibrary ','',0,1141,'2011-09-23 12:33:43',1921,'2011-09-28 10:22:15',3,361,0,NULL,NULL,'N'),(6101,'BLANK','0',NULL,NULL,NULL,NULL,'','hhhh',0,0,NULL,NULL,'Test , pls ignore Hggggg',NULL,NULL,0,4,NULL,'',NULL,'bbb',NULL,'0','hhggggg','gggggg',0,2552,'2011-09-23 12:45:26',101,'2011-09-23 13:02:30',21,0,0,NULL,NULL,'Y'),(6111,'BLANK','Other',NULL,NULL,NULL,NULL,'','Glenn Macpherson - Public Sector Account Manager',6,1,NULL,NULL,'Hi Guys\r\n\r\nRecently when completing my renewals I have noticed that their are a number of customers who have had zero usage on their Library & PSL subscriptions. Unfortunately in some cases by the time this is noticed, the customer has made alterantive arrangements with our competitors. \r\n\r\nI was wondering if it was possible to impement a system whereby if our online customers have zero usage on their account for a certain amount of time, that an automated email is sent to their account manager to investigate and arrange any necessary training, or repackage the customers current content. Ideally you would be able to specify the time frame yourself e.g if the customer hasn\'t used the service for three months. \r\n\r\nI think this would we a great tool to enable us early identify accounts that are potentially at risk, lower cancellation rates and losses to the competition. \r\n\r\nRegards, \r\n\r\nGlenn Macpherson\r\nAccount Manager \r\nPublic Sector\r\n\r\n0208 212 1933',NULL,NULL,59,9,NULL,'',NULL,' LN (internal suggestion)',NULL,NULL,'All online','',0,1031,'2011-09-23 15:17:39',801,'2011-09-29 15:04:53',82,51,0,NULL,NULL,'N'),(6121,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Mike Adams',2,142,NULL,55,'In this account Ive had to ask for very high level discounts on TL(62%) and TG (35%) due to CCH offering to throw in the tax library subscription if the client takes their practice management software. Where CCH are bundling their software and library products they are making a very compelling value proposition but equally they are offering the library at next to nothing if the client takes the software, they are also using the same structure for their accounting products in other companies. ',NULL,NULL,53,7,NULL,'',NULL,'Wellers accountants',NULL,NULL,'','',61,2121,'2011-09-23 15:41:25',1921,'2011-09-29 15:19:00',22,3332,0,NULL,NULL,'N'),(6131,'BLANK','n/a',NULL,NULL,NULL,NULL,'','test',0,172,NULL,NULL,'Test',NULL,NULL,62,12,NULL,'',NULL,'test',NULL,NULL,'test','test',442,3581,'2011-09-26 09:31:02',1921,'2011-09-26 09:40:05',21,0,0,NULL,NULL,'Y'),(6141,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Deborah Felix - Secretary',1,132,NULL,NULL,'Hello\r\n\r\nI was training a customer on SmartForms, and they said a colleague who\'d been trained already could not find a legal aid form called LSC6 - Notice of Issue of Certificate. I also looked for it and could not find it. Is this form missing? If so, are there any plans to add it in the near future?\r\n\r\n(Message also sent by email to Rob Evans)',NULL,NULL,0,3,NULL,'',NULL,'Goddards Solicitors',NULL,NULL,'Lexis SmartForms','',101,1881,'2011-09-26 10:48:33',1921,'2011-11-03 14:37:04',72,3701,0,'TBC','','N'),(6151,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Mr B May',0,1,NULL,47,'TEST',NULL,NULL,6,3,NULL,'',NULL,'May and Co',NULL,NULL,'','',91,1881,'2011-09-26 10:55:03',1921,'2011-09-26 13:05:56',21,0,0,NULL,NULL,'Y'),(6161,'BLANK','n/a',NULL,NULL,NULL,NULL,'','test',0,172,NULL,NULL,'Test',NULL,NULL,62,12,NULL,'',NULL,'test',NULL,NULL,'test','test',442,3581,'2011-09-26 13:58:30',1921,'2011-09-26 14:33:24',21,0,0,NULL,NULL,'Y'),(6171,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Steven Hellard Head of Legal',4,132,NULL,NULL,'While on a training session to trial PSL and Smart forms, customer feedback was that there is a lack of forms on the housing side of smart forms ie houses with multiple occupation!',NULL,NULL,49,3,NULL,'',NULL,'sedgemoor district council',NULL,NULL,'','',91,2682,'2011-09-26 15:26:22',201,'2011-10-14 16:48:43',92,201,0,NULL,NULL,'N'),(6181,'BLANK','Industry event',NULL,NULL,NULL,NULL,'','',0,24,NULL,NULL,'test record- pls disregard',NULL,NULL,59,9,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,452,801,'2011-09-26 15:46:03',801,'2011-09-26 16:02:23',21,NULL,0,NULL,NULL,'N'),(6191,'BLANK','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','mark bissett',0,20,NULL,55,'Test',NULL,NULL,53,4,NULL,'',NULL,'bissett and co',NULL,NULL,'tolley guidance','',121,1221,'2011-09-26 18:41:39',1921,'2011-10-24 10:58:03',21,0,0,'tbc','','Y'),(6201,'PRODUCT','Informal conversation',NULL,NULL,NULL,NULL,'Richard Macey','Keith Plowman (Senior Clerk)',1,8,NULL,NULL,'The customer suggested that when we refer to solicitors and barristers in our online cases we should link out to the relevant person/ firm in Lawyer Locator. If we linked out to the lawyers, more firms may be likely to sign up to Lawyer Locator as they know that this is a good way to raise their profile by linking through from relevant cases.',NULL,NULL,62,12,NULL,'',NULL,'10 Old Square',NULL,NULL,'','',0,3681,'2011-09-26 19:37:23',1921,'2011-10-21 13:25:46',22,341,0,'.','','N'),(6211,'PRODUCT','Customer training session',NULL,9811,NULL,NULL,'','Bryan Neill (Head of Personal Injury)',1,4,NULL,NULL,'I was training at firm called Prince Evans in Ealing this morning on LexisLibrary and PSL, and the Head of PI (Bryan Neill) asked me to find a simple precedent periodical payments order that could be used for PI litigation. They subscribe to (amongst others), the PI and Civil Procedure menus on Library, and the DR and PI modules of PSL.\r\n\r\nOn Library, we could find various precedents, but they were either statements of case, or Family related precedents. On PSL, using the appropriate topic, we could not find a simple order for this purpose. When searching PSL, we found lots of references or explanations, but no straightforward precedent order. We eventually found something from Atkin\'s Court Forms (using my own ID - they do not subscribe to Atkins), which was rather more complicated but could be simplified and used. Bryan pointed out that they do need something like this more and more, and asked why there was no simple precedent for this within the existing PI content, neither on Library nor PSL. I told him I would raise this with colleagues to see if something could be done. The obvious place for this would be within BPILS precedents, but it is not there.\r\n (also sent by email to Karen O\'Sullivan and Timothy Wakefield)',NULL,NULL,44,3,NULL,'',NULL,'',NULL,NULL,'','',301,1881,'2011-09-27 14:41:53',371,'2011-10-05 14:24:36',72,371,181,NULL,NULL,'N'),(6221,'PRODUCT','Customer training session',NULL,9242,NULL,NULL,'','Patricia Robinson',1,4,NULL,NULL,'While training at Pannone yesterday who have the Library, 2 of their key family team liked the look of Family PSL for what they would need. We are looking to find ways of Family PSL being appropriate for this larger size of law firm so it would be a good chance to gather feedback from Patricia Robinson and Alison Barnett who were happy to help us. I sent the below e-mail already to a selection of key people, but am logging here as well:\r\n\r\nFrom: Allan, Gavin (LNG-HBE) \r\nSent: 28 September 2011 07:57\r\nTo: Morris, Geraldine (LNG-HBE); Cullen, Sarah (LNG-HBE)\r\nCc: Scriven, Jonathan (LNG-LON); Howard, Nicola (LNG-LON)\r\nSubject: Pannone Family Team - Family PSL?\r\n\r\nGood Morning All\r\n\r\nI was training at Pannone yesterday in Manchester and Hale. Their Hale office has 2 very experienced and friendly family lawyers (Patricia Robinson and Alison Barnett (practising since 1982)) who were liking the Lexis Library they currently subscribe to having changed their front page so they can now see the key family texts and having given them a few tips. \r\n\r\nWhile chatting to them it became apparent that Alison Barnett sometimes does webinars for us so needs to do research (about to do one on FPR) and Patricia is about to run a presentation on bankruptcy and insolvency in the family context.\r\n\r\nI highlighted the books and current awareness in Library where they could get help, but this is still a little clunky to those not very confident with computers. With their needs and this is in mind I showed them Family PSL, not to \'push\' it on them, but to get their opinion as I also know from the Family Workshops we are looking to find ways of getting PSL Family to appeal/work in the large law sector.\r\n\r\nThey both loved it and, as the account manager Sarah if it\'s ok with you, I\'d like to give them access on a trial for their thoughts on Family PSL. There was a perfect section about bankruptcy and insolvency that Patricia was very excited about and is really keen to see how it can help her for her presentation and beyond!\r\n\r\nWhen I mentioned the key people behind the scenes (Geraldine/Clare) Patricia said she remembers meeting Geraldine at a Resolution event. I quote: \"Geraldine works on this? That\'s really good to hear, she was lovely to talk to\". \r\n\r\nWhether Pannone buy or not we have 2 very willing key family practitioners in the large law sector happy to give us feedback on what Family PSL may benefit from (if anything) to appeal to firms of this size.\r\n\r\nBeing in Hale it\'s round the corner from you Geraldine if a visit is appropriate to collect their thoughts (lovely office).\r\n\r\nHope this is of interest.\r\n\r\nCheers,\r\nGavin\r\n\r\n',NULL,NULL,28,6,NULL,'',NULL,'',NULL,NULL,'Family PSL','',0,66,'2011-09-28 07:01:39',1541,'2011-09-28 10:00:16',72,1541,0,NULL,NULL,'N'),(6231,'PRODUCT','Customer training session',NULL,9242,NULL,NULL,'','Hannah Atkinson',6,1,NULL,50,'Hannah liked Lexis Library, and in particular has to do general research as the trainee. Historically liked West at Uni as she found it easier to use, even know there was potentially less there...\r\n\r\nWith this in mind I showed her the Find a Legal Term in the QuickFind area. We couldn\'t find a term she was hoping to see there as she had a recent need for it when she was doing some planning work.\r\n\r\nShe would have loved to have found \'section 106\' (TCPA) in the list as she could have dne with some help! There seem to be other sections, but not this one - it would be great if it could be added.\r\n\r\nIt\'s a section I often hear mention of as key in planning law from the Town and Country Planning Act (TCPA) so hopefully we can get it included.\r\nMany thanks\r\nGavin',NULL,NULL,46,4,NULL,'',NULL,'',NULL,NULL,'Lexis Library','',0,66,'2011-09-28 07:29:30',1921,'2011-10-04 14:14:40',72,61,0,NULL,NULL,'N'),(6241,'PRODUCT','Customer training session',NULL,7160,NULL,NULL,'','',1,4,NULL,NULL,'Customer asked if court fees can be added to the toolbox. They are PLC users but thought that the Dispute Resolution PSL module was very good and they would be happy to use it instead of PLC.',NULL,NULL,4,9,NULL,'',NULL,'',NULL,NULL,'','',0,2371,'2011-09-30 12:11:38',1531,'2011-10-05 10:32:08',72,1531,0,NULL,NULL,'N'),(6251,'PRODUCT','Customer training session',NULL,7160,NULL,NULL,'','',1,4,NULL,47,'This came up mostly in the Property training session but was also mentioned in other practice area training sessions. They would like to be able to search within topic area not just search throughout the whole module. Apparently PLC has this functionality and this is how they like to use the product.',NULL,NULL,0,9,NULL,'',NULL,'',NULL,NULL,'','',41,2371,'2011-09-30 12:14:32',1921,'2011-10-21 13:29:27',22,59,0,'Search query','','N'),(6261,'PRODUCT','Customer training session',NULL,7160,NULL,NULL,'','',1,4,NULL,47,'This firm have used PLC for many years and are considering switching to PSL. The property department did not like PSL however they did admit that this might be because they are unused to using PSL and are not as familiar with it. One of the main issues that they raised is that they do not think there are enough precedents in PSL compared to PLC. They would like to see more precedents throughout the module. The example they gave me was easements where PSL has a small number and PLC has about 20. They said that property lawyers use precedents a lot and they think many PLC users would look more favourably on PSL if they could see there were more precedents there.',NULL,NULL,49,3,NULL,'',NULL,'',NULL,NULL,'','',31,2371,'2011-09-30 12:18:54',201,'2011-10-04 14:47:33',92,201,0,NULL,NULL,'N'),(6271,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,4,NULL,47,'The Employment department have used PLC for many years and are considering using PSL. On the whole they like the PSL module however they said that they would like to see more advice letters in the precedents. For example in unfair dismissal all the precedents are ET1 and ET3 and they said advice letters would be useful as well and PLC has these.\r\n\r\nThey also said that the information in trackers, tables and misc is really useful but is hidden away. Is is possible to hightlight the fact that the information is there for example using a toolbox?\r\n\r\nThey said that they prefer PLC alerts because they have lots of information about cases in them whereas PSL alerts are more news analysis based which they find less useful. They also said they think there is a delay on analysis of cases because PSL waits for the All England and PLC are getting more up to the minute information from other sources.',NULL,NULL,24,9,NULL,'',NULL,'Lanyon Bowdler',NULL,NULL,'','',31,2371,'2011-09-30 12:29:12',1921,'2011-10-04 14:31:21',3,2321,0,NULL,NULL,'N'),(6281,'PRODUCT','Customer training session',NULL,4532,NULL,NULL,'','Helen Simpson',1,11,NULL,NULL,'Further to e-mail sent to Mark Campbell and Andy Wollatt below, I had a a suggestion from a secretary at the Derby office of Freeth Cartwright of being able to print/export the report that is produced in Lexis Check to aid her work relationship with her very busy boss.\r\n\r\nFrom: Allan, Gavin (LNG-HBE) \r\nSent: 30 September 2011 15:09\r\nTo: Woollatt, Andrew (LNG-LON); Campbell, Mark (LNG-HBE)\r\nSubject: Suggestion - Freeth Cartwright Derby\r\n\r\nHi\r\n\r\nOne of the secretaries on behalf of a very busy fee earner (property area) suggested that she was likely to be doing the Lexis Check checking, and would find it useful to be able to print the report so she could pass it to her v v v busy boss (I\'ll vouch for his busy-ness!)\r\n\r\nApologies if it\'s something currently possible, let me know and I\'ll tell her, or if not, is a print/export option possible?\r\n\r\nMany thanks\r\nG\r\n ',NULL,NULL,49,9,NULL,'',NULL,'',NULL,NULL,'Lexis Check','',341,66,'2011-09-30 14:14:20',1921,'2011-10-04 14:35:03',3,3472,0,NULL,NULL,'N'),(6291,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','John Fisher - Partner',2,142,NULL,NULL,'Amazon is selling our books at a great discount which means this client was either going to buy from amazon or expects us to match their prices',NULL,NULL,53,4,NULL,'',NULL,'Roffe Swayne',NULL,NULL,'Various hardcopy books','amazon',51,2121,'2011-09-30 14:41:25',1921,'2011-10-04 14:46:49',3,121,0,NULL,NULL,'N'),(6301,'PRODUCT','Customer training session',NULL,1515,NULL,NULL,'','Helen Gwinn - Legal information manager ',1,1,NULL,NULL,'I received the below comment within an email dated 22nd September 2011 from my client following a recent training session:\r\n\r\n\r\nThe final point was to do with when a case has not been overuled by a subsequent case but the principles involved have been changed by subsequent legislation - an example would be Barker v Corus UK Ltd (see commentary from the Green Book - see below).  Is there any way of flagging up situations like these in the casesearch document?\r\n \r\n \r\nSubstantive Law\r\nThe substantive law relating to the common problem of multiple employers may be found in s 3 of the Compensation Act 2006 (III PID [1]), which reversed the effect of Barker v Corus UK Ltd [2006] UKHL 20, [2006] AC 572, and a number of cases culminating in Fairchild v Glenhaven Funeral Services Ltd [2002] UKHL 22, [2003] 1 AC 32.\r\n\r\n',NULL,NULL,0,1,NULL,'',NULL,'',NULL,NULL,'CaseSearch','',341,76,'2011-09-30 16:11:56',1921,'2011-10-04 15:15:41',3,61,0,NULL,NULL,'N'),(6311,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Lance Kearney',1,1,NULL,50,'This information has been sent via an email to Morag Rae:\r\n\r\nDuring recent training I was set with a task of finding Codes of Practice within LexisLibrary for a gentleman named Lance Kearney.  Specifically the client is looking for the Code Of Practice issued under Part II of the Criminal Procedure and Investigations Act 1996 (Disclosure).\r\n\r\nI found information about it within Stones Justice Manual and also found the Order for it and various commentaries about it, or SI or information on the Act itself but can not find the actual Code Of Practice. After speaking wtih colleagues it was thought that we maybe did not hold the actual codes and just refer to them.\r\n\r\nThis gentleman loves Westlaw and hates us and is constantly trying to convince others to use Westlaw as apparently it is so easy to use and things like this are so easy to find on there and feels LexisNexis is not user friendly at all.  If we do not currently hold these codes of practices then are we looking at adding them to the new PSL Modules at all.  Or maybe within LexisLibrary when it mentions the codes could there be even a hyperlink that would take you to an external goverment site that holds this information at all like we do within LexisPSL.  \r\n\r\nI am now on holiday until 11th October so as advised to Morag, Kate Pamphilon may be able to liaise with the client on my behalf during my absense if needed.',NULL,NULL,0,7,NULL,'',NULL,'Merton & Richmond Councils',NULL,NULL,'','',41,76,'2011-09-30 18:20:30',1921,'2011-10-27 13:23:10',72,59,0,'.','','N'),(6321,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Paul Phelan - Interim Legal Practice Manager',1,1,NULL,49,'During a meeting on 26th September 2011 the client mentioned that they felt we were quite weak with regards to housing content within LexisLibrary as the Housing Team generally use the Housing Encyclopaedia and also the Housing Law Reports and could not find anything they felt would be on the same par to these pubications.',NULL,NULL,0,8,NULL,'',NULL,'Merton & Richmond Councils',NULL,NULL,'','',81,76,'2011-09-30 18:42:57',1921,'2011-12-05 14:53:35',72,181,0,'TBC','','N'),(6331,'PRODUCT','Renewal or new business conversation',NULL,9669,NULL,NULL,'','Richard Twyman/Partner',1,132,NULL,NULL,'Richard was looking for an LT503 form, i think the LT503 may be the Laserform code for this form and not the \'real\' code!\r\n\r\nI had a look and managed to work out:\r\n\r\nLT503 Claim form (CPR Part 8) for the grant of a new tenancy under section 24 of Part 2 of the Landlord and Tenant Act 1954 (CPR Part 56 and PD56: 3.5) Tenant\'s application - unopposed\r\n\r\nBut if i do a search for Part 8 on LexisSmart Forms none of the form results look like they could be the LT503???',NULL,NULL,9,3,NULL,'',NULL,'',NULL,NULL,'LexisSmart Forms','Laserform',0,68,'2011-10-03 08:31:45',1921,'2011-10-04 15:51:21',112,3701,0,NULL,NULL,'N'),(6341,'PRODUCT','Renewal or new business conversation',NULL,9669,NULL,NULL,'','Helen Bunker/Managing PArtner',1,4,NULL,47,'Helen would like to see more information added to the Cross Border Estate topic and has suggested some countries for consideration:\r\n\r\nMainland Eurpoe in general\r\nSpain\r\nPoland\r\nGermany\r\nBelgium\r\nPortugal\r\nScotland\r\n\r\nUSA - Helen appreciates the USA would be a nightmare but any basic/general information would really help',NULL,NULL,56,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Private Client','',111,68,'2011-10-03 08:34:10',2622,'2011-10-05 09:41:21',82,2622,0,NULL,NULL,'N'),(6351,'PRODUCT','Customer training session',NULL,7326,NULL,NULL,'','Jan Neate',1,4,NULL,47,'The team at Lee Bolton Monier Willaims really like LPSL, but have asked if/when we will be adding some more detailed tax content, specifically IHT, CGT and Income Tax.  They think if these were added as separate topic headings the product would be brillaint',NULL,NULL,56,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Private Client','',101,68,'2011-10-03 09:24:44',2622,'2011-10-05 09:49:17',82,2622,0,NULL,NULL,'N'),(6361,'PRODUCT','Renewal or new business conversation',NULL,9669,NULL,NULL,'','Richard Twyman/Partner',1,4,NULL,47,'Richard & Helen (Managing Partner) mentioned they struggle when it comes to finding country specific information, the key example gven was Polish Commercial Law and Sharia Law.  Even some basic guidance notes, background information on processes etc would help them find their way.  Even though they flagged this in the Commercial area they think Corporate, Property & Private Client could also benefit from some more country specific information',NULL,NULL,10,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Commercial','',131,68,'2011-10-03 09:28:10',3831,'2011-11-02 08:44:49',22,3831,0,'TBC','','N'),(6371,'PRODUCT','Customer training session',NULL,8679,NULL,NULL,'','Rossanna Schurink/Solicitor',1,4,NULL,NULL,'When searching the quantum in LPSL, if you oick the JSB value range - is this the original claim value or the inflated value it is searching the database for?',NULL,NULL,44,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Personal Injury','Kemp',452,68,'2011-10-03 09:57:27',371,'2011-10-05 13:29:59',72,371,211,NULL,NULL,'N'),(6381,'PRODUCT','Renewal or new business conversation',NULL,2213,NULL,NULL,'','Karen Scott / Info Manager',1,4,NULL,NULL,'I have a client who has asked how many quantum cases we currently have in LexisPSL.  Do we have a figure and how does this compare with Kemp?  \r\n\r\nI appreciate that more is not necessarily better as out of date cases are no use to anyone.  Do we have a target for the number of cases we want to have on the service and is there a date of when we will achieve this?  \r\n\r\nAlso, i know we are aiming to increase the number of out of court settlements is an aim of ours.  Have we had much success?',NULL,NULL,44,1,NULL,'',NULL,'',NULL,NULL,'','',91,7,'2011-10-03 11:15:44',371,'2011-10-05 13:30:19',72,371,221,NULL,NULL,'N'),(6391,'PRODUCT','Customer training session',NULL,10030,NULL,NULL,'','Matthew Hill/Solicitor',1,4,NULL,47,'Raworths use both PLC and LexisPSL.  Initial feelings are that despite having had LexisPSL for over 2 years that the content is still light and despite on the face of it LPSL has all key opics they feel the precedent bank is not substantial enough, and have seen little improvement in 2 years.  I said i would ask for the roadmap for the next 6 months and share this with them, it may be worth someone speakin to Matthew as well?',NULL,NULL,9,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Disoute Resolution','',91,68,'2011-10-03 12:14:03',1531,'2011-10-05 10:29:36',92,1531,0,NULL,NULL,'N'),(6401,'PRODUCT','Renewal or new business conversation',NULL,2213,NULL,NULL,'','Tracy Giles / Lawyer',4,4,NULL,NULL,'I demo\'d the local government module to a client last week.  They asked if there was any content on section 75 agreements (NHS Act 2006).  We ran a free text search but couldnt see anything.  Is there any content regarding this on PSL or are there any plans to add it?',NULL,NULL,39,2,NULL,'',NULL,'',NULL,NULL,'','',101,7,'2011-10-03 12:43:29',351,'2011-11-24 13:22:12',82,351,0,'TBC','','N'),(6411,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','sarah.watt@wales.nhs.uk',1,4,NULL,NULL,'Poor clin neg content - quantum cases particularly bad - old and not enough\r\nran search fro gastroscopy - no results\r\nStatutory bereavement damages is wrong - the prac note says 10,000 but it should be 11,800\r\n\r\nCould we add clinical risk - its a book/journal that all clin neg lawyers use',NULL,NULL,44,9,NULL,'',NULL,'Welsh Health Legal Services',NULL,NULL,'Personal Injury','',131,67,'2011-10-03 18:07:30',371,'2011-10-05 13:30:40',72,371,111,NULL,NULL,'N'),(6421,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Julie Wood - solicitor',1,4,NULL,NULL,'Whilst providing a demo of PSL today, the solicitor thought that it would be useful when running a case search if the results could be filiered alphabetically.  She cannot always remember the name but then usually \'knows it when she sees it\'.',NULL,NULL,59,1,NULL,'',NULL,'Lake District National Park Authority',NULL,NULL,'','',341,1381,'2011-10-03 20:21:17',1921,'2011-10-12 16:05:00',72,59,0,NULL,NULL,'N'),(6431,'PRODUCT','Customer training session',NULL,2362,NULL,NULL,'','Andrew Chowdhury',1,1,NULL,NULL,'In training the Crime fee earners at the Walsall branch of Challinors fee earner  Andrew Chowdhury was keen to see they had access to Anthony Berryman/Stones/Blackstones and then asked me if Anthony Berryman was available yet on a Kindle. \r\nHe would like to be able to check and remind himself of key points when in a court room environment.\r\nI said such things were in the pipeline to have our texts as e-books/available on various devices but not sure of timelines.\r\nHe may be worht talking to, I suggested to him we may be in touch which he seemed fine about.\r\nHope this is of interest.\r\nRegards,\r\nGavin ',NULL,NULL,21,4,NULL,'',NULL,'',NULL,NULL,'Lexis Lib Crime Menu','Archbold/West',452,66,'2011-10-04 06:31:32',801,'2011-10-28 09:17:24',82,1561,0,'.','','N'),(6441,'PRODUCT','Customer training session',NULL,2362,NULL,NULL,'','Sarah Pottle/Property fee earner',1,1,NULL,47,'Morning\r\nWhen training the property team at Challinors in West Bromwich we tried using the Quick Find area to find statutory declarations. I remember asking about this kind of document before and finding out they sit in many volumes across EF&P so are not always the easiest thing to find through browsing.\r\nThis is one reason I was trying to see if searching for statutory declarations in the Quick Find/Google-like area may make it easier to bring appropriate ones to light.\r\nWhen I did this however Sarah Pottle said how confusing she thought the results in view were. A couple had a similar short name (ie just \'Statutory Declaration\', not giving any indication as to their focus, and 3 had exactly the same long name leading her to ask why did we have 3 duplicates? (this name was: \"Statutory declaration/certificate/statement of truth as to non-revocation for powers more than 12 months\' old at the date of the disposition for which they are used\").\r\nOne option brings you 130+ options if selected.\r\nIs there any way Stat Dec\'s could be made easier to find? It was starting to put my delegates off the service as they found it frustrating. \r\nDo you have any tips around locating such documents? Is it worth reviewing the names of some? Would the index/key formfinder be more appropriate technique?  \r\nMany thanks for your help!\r\nGavin\r\n ',NULL,NULL,49,3,NULL,'',NULL,'',NULL,NULL,'EF&P','',0,66,'2011-10-04 06:48:15',1921,'2011-10-05 13:20:01',72,61,0,NULL,NULL,'N'),(6451,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','David Brdshaw',2,142,NULL,55,'Morning\r\nWhile training the Corporate Tax team at Dains in Birmingham, the head of the team, David Bradshaw, was disappointed when we looked at the Yellow Tax Handbook to see so few notes underneath the provisons. He had noticed it generally and it happened in the section we went to: s.24 of CTA.\r\nIt gives a derivation link to the 1988 legislation, where there is a huge amount of links to guidance/caselaw/HMRC support etc be he feels quite strongly this extra support should be there at the bottom of s.24 already. His perception is that it is a change in approach from us that he doesn\'t like.\r\nHope this makes sense,  we can always contact him if you would like anything clarifying.\r\nLet me know if I can help further\r\nGavin Allan\r\nTraining Consultant',NULL,NULL,53,2,NULL,'',NULL,'Dains',NULL,NULL,'Yellow Tax H/B-TolleyLib&Hardcopy','',0,66,'2011-10-05 05:31:23',2892,'2011-11-02 10:59:06',72,2632,0,'TBC','','N'),(6461,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','David Bradshaw',2,142,NULL,55,'When we ran a search across all content in the training of Tolley Library at Dains, they were keen to see date as a way of filtering what was there. They were pleased to see a \'sort by date\' tick box, but when I then selected a tab for a content type (here I chose journals) they said the way it sorted results wasn\'t very helpful at all.\r\nTo sort by date, journal by journal didnt make sense to them. It starts with TaxJournal often, which looked like April 2010 showed the most recent article, and it was only because I was there we scrolled down to see there are Taxation Magazine articles from Sep 2011 that they would have missed otherwise.\r\nI know I have mentioned this to Dan Arrowsmith in the past and he has been very helpful, but I just wanted to mention again the feedback/reaction I\'m getting regulalrly from the market who dont like the current view.\r\nHope this is of interest.\r\nCheers,\r\nGavin\r\nGavin Allan\r\nTraining Consultant ',NULL,NULL,53,9,NULL,'',NULL,'Dains',NULL,NULL,'Tolley Library','',341,66,'2011-10-05 05:37:59',2632,'2011-10-05 10:06:54',112,2632,0,NULL,NULL,'N'),(6471,'CUSTOMER','Customer training session',NULL,3985,NULL,NULL,'','Sarah Maxton/Partner',1,4,NULL,47,'Sarah has a suggestion for the LPSL Family tool box, it is for a child maintenance calculator to be added?',NULL,NULL,28,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Family','',442,68,'2011-10-05 09:55:06',1541,'2011-11-03 12:12:32',72,1541,0,'TBC','','N'),(6481,'PRODUCT','Customer training session',NULL,3985,NULL,NULL,'','Linda Letby/Solicitor',1,4,NULL,47,'Linda downloaded the Dec of Trust into word and there seems to be a mismatch in the fformatting, Linda uses arial as her font of choice and was quite critical that the precedent downloaded into word in times new roman.  Linda selected the whole doc and changed the font and the entire doc changed apart from the clauses on page 2 - \r\n\r\n3 The Beneficiary covenants with the Trustee that it will keep the Trustee indemnified from all costs, expenses, claims and demands in respect of the Property and any matters to which it may from time to time be subject\r\n4 The Trustee will not be required to incur any expenditure in respect of the Property unless and until monies have been provided by the Beneficiary for that purpose\r\n5 Nothing in this deed is intended to confer any right on any person under the Contracts (Rights of Third Parties) Act 1999\r\n\r\nthese stay in odd font, a minor point but Linda said it is frustrating',NULL,NULL,49,3,NULL,'1317809055.doc','Dec of Trust (LPSL Property).doc','',NULL,NULL,'LexisPSL Property','',131,68,'2011-10-05 10:06:29',1921,'2011-10-11 14:24:50',72,59,0,NULL,NULL,'N'),(6491,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'Feedback from one of in-House user Group\r\n\r\nI have been searching for info on comfort letters / letters of support from a parent company. I found some info on PLC but only found case law on Lexis.\r\n\r\nAlso sent to Cara to see if we have anything in CoCo that we could send her.',NULL,NULL,61,6,NULL,'',NULL,'Ricardo',NULL,NULL,'','',91,591,'2011-10-05 13:29:56',1921,'2011-11-01 18:52:20',92,591,0,'TBC','','N'),(6501,'PRODUCT','Informal conversation',NULL,NULL,NULL,NULL,'','Various Users',2,142,NULL,NULL,'I asked my contact within this client to ask the users for honest feedback on the new Library and this was the outcome which he sent to me in an email, obviously number 3 is for me to deal with, could you get back to me ASAP as I have a meeting with them on the 12th and he would like me to go through these points at that meeting:\r\n\r\nHi Charlie,\r\n\r\nI have asked my colleagues for feedback on the online services you provide and have received the following queries. Please can you consider them and let me have your thoughts when we meet next week?\r\n\r\n1. In Lexis Nexis Tax News, on new tax cases if I click on More I get to a useful precis of the cases which tells me whether they are worth looking at further.  In Tolleys I have to open each case individually, which I am never going to do- result is Tolleys make me less informed about case law developments.\r\n\r\n2. In Lexis Nexis I can search one or more particular HMRC manuals by Browse/Search on Selected.  No such facility that I can see in Tolleys, result is any HMRC Manual search covers all manuals so is far less refined.\r\n\r\n3. I understand that Stanley\'s Taxation of Farmers and Landowners is now available online on Lexis Nexis.  I use this book a lot and know that other people do too.  Would it cost a lot to include this in the publications we can access online? We cannot access it at the moment.\r\n\r\n4. The updates that come from the new version of Tolleys are not nearly as good as the old ones we got from Lexis Nexis.  Lexis Nexis used to have a very short summary of each case/change/article as part of the update so you could tell at a glance which ones would be of interest and which ones would not.  The new updates only include the title and a link so you need to go into each one individually to find out what they are about.  It takes ages.if you start at all. Can they change/improve this?\r\n\r\n5. It is easy to find the section you want in the new Tolleys and print it..but it is much harder if you want to print that section along with some other related sections adjacent to the original section that you looked at.  In lexis Nexis you simply ticked the sections you wanted to print in the index, but you cannot do this in the new Tolleys.\r\n',NULL,NULL,53,9,NULL,'',NULL,'James Cowper',NULL,NULL,'','NA',341,2121,'2011-10-05 18:20:02',2632,'2011-10-14 14:28:19',92,2632,0,NULL,NULL,'N'),(6511,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Trainee Solicitor',1,1,NULL,NULL,'This regards the Result Groups when searching on Library. I showed the trainee how you can use these to focus on one specific group within results, eg choosing a topic. She suggested it would be better to be able to hide or eliminate options, because you don\'t always know which topic to choose, but might know what\'s not relevant, so if you could gradually take things away, it would be easier to use.',NULL,NULL,0,12,NULL,'',NULL,'Thackray William',NULL,NULL,'','',0,1881,'2011-10-06 13:21:54',1921,'2011-10-27 13:08:48',72,61,0,'.','','Y'),(6521,'COMPETITOR','0',NULL,NULL,NULL,NULL,'','',2,152,NULL,55,'Insight from recent customer visit that CCH are imtimating that they are going to stop CD distribution and ae forcing CD subscribers to take online services instead',NULL,NULL,53,4,NULL,'',NULL,'',NULL,NULL,'CD','',0,1151,'2011-10-07 08:43:43',421,'2011-11-02 09:28:39',92,421,0,'TBC','','N'),(6531,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Emma Askew',2,20,NULL,82,'When emailing a document from the Tolley Guidance Corporation Tax module directly to my Outlook, the mail arrived promptly and correctly however the subject line in the email read:  Email Delivery from LexisPSL.  Should this not be Email Delivery from Tolley Guidance?\r\n\r\nPlease can you investigate this?',NULL,NULL,53,6,NULL,'1317979362.msg',' Email Delivery from LexisPSL.msg','Aegis Group Ltd',NULL,NULL,'Corporation Tax Module','',442,1371,'2011-10-07 09:24:50',2862,'2011-10-11 10:18:27',92,2812,241,NULL,NULL,'N'),(6541,'PRODUCT','Internal Meeting',NULL,NULL,NULL,NULL,'','',1,91,NULL,NULL,'While searching on Nexis Direct, if searching for company information or a person information it is not currently possible to view the negative terms that the system may use to search. I think it would be beneficial if the user could view the terms that nexis Direct uses to assist with their search.',NULL,NULL,59,9,NULL,'',NULL,'',NULL,NULL,'','',441,2682,'2011-10-07 10:53:11',79,'2011-11-01 10:54:12',72,79,0,'TBC','','N'),(6551,'PRODUCT','Customer training session',NULL,10867,NULL,NULL,'','Jayen Leedham',1,1,NULL,NULL,'I was showing Jayne how to use client admin to make sure there was a good bookshelf easily accessible for all of her Private Client team. \r\nShe asked how we told them when new books came online - I said through e-burst, which she said was very unlikely to help them.\r\nShe said sure there could be a link somewhere you could clikc on to see books added to Lexis Library in the last 6-12 mths. After she said that I thought this could maybe within the Sources tab if there is concrn at it being in the way elsewhere so people can review any exciting new additions to the site.\r\nHope this is interesting.\r\nGavin',NULL,NULL,47,4,NULL,'',NULL,'',NULL,NULL,'Lexis Library','',452,66,'2011-10-07 14:36:11',1921,'2011-10-27 14:57:10',72,61,0,'.','','N'),(6561,'PRODUCT','Customer training session',NULL,3985,NULL,NULL,'','Linda Letby/Solicitor',1,4,NULL,47,'Both Linda & Martin Legg (Partner) flagged we have content re HIPS on LPSL and these should have been removed months & months ago.  Suzanne Cottle & I have a meeting with this form on 8th November and both Martin & Linda have said they will be checking to see the content has been removed.  Please could you give me an update as to why this information is still in LPSL (I\'m not sure, there could be a reason fr it to be there)  Thanks',NULL,NULL,49,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Property','',452,68,'2011-10-10 11:42:14',1921,'2011-10-14 13:52:00',72,201,0,NULL,NULL,'N'),(6571,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Head of Tax',2,142,NULL,55,'Neil Wharton explained that he liked the encyclopaedia approach that CCH offered.  He said that CCH\'s contents page and index facilities are very good for finding the information that he wants quickly.  They have used CCH for 5 years, however he did concede that our content is better and felt that the new Tolley Library interface was much better than the previous version.',NULL,NULL,59,9,NULL,'',NULL,'BMW',NULL,NULL,'TOLM04','',41,1371,'2011-10-10 15:22:55',2632,'2011-10-14 14:27:51',92,2632,0,NULL,NULL,'N'),(6581,'CUSTOMER','Customer/product advisory board',NULL,NULL,NULL,NULL,'','Sandar Kyi',1,4,NULL,NULL,'See attachment.  No further action required.',NULL,NULL,61,6,NULL,'1318262762.doc','Sandar Kyi.doc','',NULL,NULL,'PSL','',452,591,'2011-10-10 16:08:00',1921,'2011-10-11 09:35:30',72,591,0,NULL,NULL,'N'),(6591,'PRODUCT','Direct Mail',NULL,NULL,NULL,NULL,'','Phil Moss',2,20,NULL,NULL,'Phil has asked for prev/next buttons at the bottom of the page when reading guidance notes so you can skip to the next set of guidance notes without going back to the guidance note summary page and clicking on the next section.\r\n\r\nPhil has also asked for a \"my documents\" folder like Tolley library. Recently Viewed documents section doesnt necessarily help if you aim to collate a number of documents for a specific case. He wants it to keep docs for 30 days.',NULL,NULL,53,6,NULL,'',NULL,'Lubbock Fine',NULL,NULL,'','',341,1211,'2011-10-10 17:46:55',1921,'2011-10-27 12:57:41',112,2812,241,'.','','N'),(6601,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Penny Franklin/Tax & Treasury Manager',2,142,NULL,NULL,'The customer deals mainly in the international Tax arena. Their comments were that it would be helpful to have short (to the point) summaries of each country\'s Tax position as part of our offering.',NULL,NULL,53,4,NULL,'',NULL,'Talaris',NULL,NULL,'International Tax Menu','CCH &  IBFD',131,NULL,'2011-10-11 03:02:31',1921,'2011-10-13 12:15:54',72,2632,0,NULL,NULL,'N'),(6611,'CUSTOMER','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','',6,142,NULL,55,'General insight from inside Wolters Kluwer (CCH), following my meeting with them last week.  No action required...\r\n\r\n Most departments have been asked to cut budgets by 15%.\r\n Although the last redundancies where at the start of the year, teams have been asked to complete time logs to show their daily tasks and the time they take.  They feel that the next batch of redundancies is around the corner.\r\n Despite this, their helplines are doing well with greater call numbers and faster returns.  This has been aided by a new call routing system and giving the telephone advisers the flexibility to work from home.\r\n General staff turnover is static but the Hinckley site is still only at around 50% capacity.\r\n',NULL,NULL,62,12,NULL,'',NULL,'Wolters Kluwer',NULL,NULL,'','',442,1341,'2011-10-11 08:17:54',1921,'2011-10-11 09:43:17',72,1341,0,NULL,NULL,'N'),(6621,'PRODUCT','Customer training session',NULL,4532,NULL,NULL,'','Mushtaq Khan',1,11,NULL,NULL,'Re: Documents that are LexisCheckable - client would like scanned pdf\'s to be as he feels they are his greatest type by volume from other parties, and would be for many other fee earners too.\r\n\r\nHi\r\nLogging the e-mail I sent below here as a result of feedback from a LexisCheck floorwalk at Freeth Cartwright highlighting a clients feelings in case they are of interest.\r\ncheers,\r\nGavin\r\n\r\n\r\nFrom: Allan, Gavin (LNG-HBE) \r\nSent: 11 October 2011 10:15\r\nTo: Woollatt, Andrew (LNG-LON); Campbell, Mark (LNG-HBE)\r\nSubject: RE: LexisCheck and PDF Scanned Doc\'s\r\n\r\nMany thanks both - here\'s Mushtaq Khans (Partner) contact details in case it\'s something you ever want to explore? mushtaq.khan@freethcartwright.co.uk\r\nG\r\n\r\nFrom: Campbell, Mark (LNG-HBE) \r\nSent: 11 October 2011 10:05\r\nTo: Allan, Gavin (LNG-HBE); Woollatt, Andrew (LNG-LON)\r\nSubject: RE: LexisCheck and PDF Scanned Doc\'s\r\n\r\nScanned PDFs are not electronically created PDF documents.  LexisCheck cannot work on what is in effect just an image of the original document that has been scanned.\r\n\r\nThanks\r\nMark\r\n\r\nFrom: Allan, Gavin (LNG-HBE) \r\nSent: Tuesday, October 11, 2011 9:51 AM\r\nTo: Woollatt, Andrew (LNG-LON); Campbell, Mark (LNG-HBE)\r\nSubject: LexisCheck and PDF Scanned Doc\'s\r\n\r\nHi Guys\r\n\r\nI was asked by a fee earner at Freeth Cartwright about whether LexisCheck would work on scanned doc\'s they receive. I said I knew it was able to work with pdf, but would check re anything actually scanned into pdf.\r\n\r\nWhen I said about checking incoming documents he said nearly all were scanned, and that this is quite common for other fee earners too so he\'s only interested if it can help with such things.\r\n\r\nAppreciate your thoughts.\r\n\r\nG \r\n\r\nGavin Allan\r\nTraining Consultant',NULL,NULL,59,1,NULL,'',NULL,'',NULL,NULL,'LexisCheck','',341,66,'2011-10-11 09:21:12',3472,'2011-11-14 19:07:03',72,3472,0,'TBC','','N'),(6631,'PRODUCT','Customer training session',NULL,50430,NULL,NULL,'','Faye Cuthbert',1,1,NULL,NULL,'The barristers would like to know if they request historical versions of legislation at any time of the day or night if they will receive these immediately or do they have to wait until typical business hours.  The clients are requesting historical versions of legislation to be available 24/7.',NULL,NULL,0,2,NULL,'',NULL,'',NULL,NULL,'','',341,3392,'2011-10-11 09:53:19',1921,'2011-10-27 14:45:14',72,61,0,'.','','N'),(6641,'CUSTOMER','Customer/product advisory board',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'Good morning\r\n\r\nI am attempting to find a precedent document using PSL and have encountered the following problems:\r\n\r\n1. Navigating to the PSL home page - when I open the PSL site, I am shown the following page, which is helpful as it lists the topics that I might need:\r\n \r\n\r\nI then searched for two terms (in this case \"disclaimer\" and \"intranet\") that showed no results. Whilst this was not a problem in of itself, I am unable to return to this screen to start a search from scratch, but appear to be stuck on the \'Search found no results\' page. Is it possible to navigate back to the above page after a search and search for a term from the beginning? \r\n\r\n2. I am searching for an example/precedent of a disclaimer for a company\'s internal notice board that would set out the terms and conditions of the notice board and require consent from the employee prior to entering the site. I have searched in a number of categories but am unable to locate such an example (having searched \'in-house\' and \'commercial\'). I therefore thought it worthwhile asking whether such a precedent exists on the PSL site?\r\n\r\nThanks and kind regards\r\n\r\nAdam \r\n\r\nAdam English\r\nTrainee Solicitor\r\nGovernance, Brand & Marketing\r\nEDF Energy Plc | 40 Grosvenor Place | London | SW1X 7EN\r\n\r\nActions:  Have passed content query to Andrew Sharpe and Functionality query to Pete Maidens and Clare Duggan',NULL,NULL,61,9,NULL,'',NULL,'EDF',NULL,NULL,'','',341,591,'2011-10-11 15:28:14',1921,'2011-11-01 19:08:07',92,591,0,'TBC','','N'),(6651,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Alex Thomson',2,24,NULL,55,'The indexing doesn\'t aligin with the index of each individual binder. It makes reference to letters but the books use number indexing- the main problem is that the number and letter indexing don\'t align.',NULL,NULL,53,4,NULL,'',NULL,'Russell New',NULL,NULL,'Simon\'s Hardcopy','',452,1411,'2011-10-11 19:47:49',181,'2011-11-02 10:02:14',82,181,0,'TBC','','N'),(6661,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Sam Wells',2,142,NULL,NULL,'There are white spaces on the library screen that appear not to be utilised. Customer has given feedback querying why the white space can\'t be used to show more text from the main screen.',NULL,NULL,53,9,NULL,'',NULL,'Lindeyer Francis Ferguson ',NULL,NULL,'TOLM01','',452,1411,'2011-10-11 19:54:23',1921,'2011-11-01 19:18:47',22,2632,0,'TBC','','N'),(6671,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','',2,20,NULL,NULL,'ability to display all elements of each menu tab  i.e. display all videos or templates within a particular module straight from the homescreen. ',NULL,NULL,53,9,NULL,'',NULL,'Barrons',NULL,NULL,'TOLG01','',271,1411,'2011-10-11 20:05:18',1921,'2011-10-13 12:14:12',72,2812,0,NULL,NULL,'N'),(6681,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','barbara shapiro',2,24,NULL,NULL,'Mericia have released their CPD programme for 2012, and priced it at 475+vat for  10 of their venue seminars, see http://www.mercia-group.co.uk/training/prices.htm, we have lost a little ground due to the delay in our programme being available to clients. especially in light of the sale of the CCH business to Mercia. there appears to be no reference to the 2012 cpd programme which they have taken over from CCH. (both on mercia or CCh\'s websites)',NULL,NULL,53,9,NULL,'',NULL,'a-spire',NULL,NULL,'CPD seminars','merica',442,1221,'2011-10-12 08:53:57',1921,'2011-10-12 12:41:13',3,2832,0,NULL,NULL,'N'),(6691,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','neil owen - director',2,162,NULL,57,'Neil lectures freelance for Mercia and CCH (now bought by mercia). He has seen no change for his 2012 commitments, either in quantity of bookings or Fees.',NULL,NULL,53,12,NULL,'',NULL,'Neil Owen',NULL,NULL,'cpd seminars','',442,1221,'2011-10-12 09:17:48',1921,'2011-10-12 12:53:04',3,2832,0,NULL,NULL,'Y'),(6701,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','JAMES PATERSON, LEGAL AND COMPLAINCE COUNSEL ',1,4,NULL,47,'This customer had a trial to PSL and was interested in Commercial, Corporate, Employment and general In-House. He is not going to purchase the product as his feedback was as follows:\r\n1. Couldn\'t find infomation for financial services\r\n2. Didn\'t like the fact that the psl modules aren\'t linked together and so you can\'t run a search across all modules.\r\n3. Didn\'t like the links through to the library because they don\'t work unless you have a library sub.\r\nIf you wish to contact the customer you can do so on 020-7399-9749 or JAMES.PATERSON@ALPHASIGHTS.COM\r\n',NULL,NULL,61,0,NULL,'',NULL,'ALPHA SIGHTS LIMITED',NULL,NULL,'PSL In-House','',281,1311,'2011-10-12 09:25:34',1921,'2011-11-09 13:55:45',112,59,0,'TBC','','N'),(6711,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Neil Owen ',2,162,NULL,57,'Neil was a freelance lecturer for CCH (now taken over by Mercia), Mercia and PTP.  we were discussing the recent sale of CCH\'s CPD business to Mercia, and he gave me some insight into the new programmes. He said that he has seen no change for 2012, he was still booked for as many lectures and had not had any pressure on his fees.  Interestingly he said that Mercia do not soley use in house lecturers for their Tax Courses (he is freelance).',NULL,NULL,53,9,NULL,'',NULL,'vat advisory services',NULL,NULL,'cpd seminars','',442,1221,'2011-10-12 09:27:36',1921,'2011-10-12 12:58:24',3,2832,0,NULL,NULL,'N'),(6721,'PRODUCT','Informal conversation',NULL,NULL,NULL,NULL,'','Mark Herson - Tax Manager',2,142,NULL,NULL,'When client logs into Taxation.co.uk they can see all the articles but the hyperlinks do not seem to be working.',NULL,NULL,53,5,NULL,'',NULL,'James Cowper',NULL,NULL,'Taxation.co.uk','',341,2121,'2011-10-12 09:32:55',1921,'2011-11-11 17:04:02',92,3192,0,'TBC','','N'),(6731,'CUSTOMER','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Cath Hancock',1,4,NULL,47,'In the commercial module there is a topic titled \'Contract Considerations\'.  The client felt that this should in fact be \'Contract Consideration\'.\r\n\r\nThanks,\r\n\r\nRonen',NULL,NULL,10,6,NULL,'',NULL,'Capital One',NULL,NULL,'LexisPSL Commercial','',442,1361,'2011-10-12 09:53:23',3831,'2011-11-02 11:12:27',72,3831,0,'TBC','','N'),(6741,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,4,NULL,47,'While on a training session with this client I was asked about Overage on the property PSL menu, I could not find any information about this however, I did find some information about Stepping Rights on property. my client explained that they are the same to a degree but it would be much better if we could metion that Stepping Rights on the Property menu is also the same content as Overage on the Property menu.',NULL,NULL,49,6,NULL,'',NULL,'isle of wight council',NULL,NULL,'PSL property','',101,2682,'2011-10-12 11:25:17',1921,'2011-10-13 09:21:41',72,201,0,NULL,NULL,'N'),(6751,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'Customer explained that if we could include more information about schools moving to acadamy status that would be good to include practical guidance and legislation.',NULL,NULL,39,6,NULL,'',NULL,'isle of wight council',NULL,NULL,'PSL Education','psl',101,2682,'2011-10-12 11:27:59',351,'2011-11-24 13:24:08',72,351,0,'TBC','','N'),(6761,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,4,NULL,47,'under Highway law, the client explained that on the competitors offering the amalgamate the following sections 38,278 and 228. my client explained that most of the time these sections need to be together but under highway law on local government ours are seperate and could we have them separate and together?',NULL,NULL,39,6,NULL,'',NULL,'isle of wight council',NULL,NULL,'psl','',41,2682,'2011-10-12 11:31:34',351,'2011-11-25 14:22:14',92,351,0,'TBC','','N'),(6771,'PRODUCT','Customer/product advisory board',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'Just to let you know that I used Lexis today to find the Patents Act - I put those words into the search text box and the result was the Copyright, Designs and Patents Act. However typing in \"patent infringement\" gives results where the Patents Act is referred to.  In the document called Patent Overview, it refers to the Patent Act, but not to specific sections - it would be useful if it did. \r\n\r\nI have passed to Commercial Team and IP/IT',NULL,NULL,61,6,NULL,'',NULL,'Ricardo',NULL,NULL,'','',0,591,'2011-10-13 09:48:23',1921,'2011-11-02 10:58:20',92,591,0,'TBC','','N'),(6781,'PRODUCT','Customer/product advisory board',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'In-House User Group feedback Session\r\nDate:  12.x.11\r\nClient: Anixter\r\nSophie Gould and Ronen Speyer from Lexis\r\nPurpose:  Feedback session on PSL\r\nNicola Campbell\r\nGeneral comment - PSL look is turgid, too dense in text.  Usually found something but often just wants a short form.\r\nSearches:\r\nBribery Checklist - couldn\'t find it.  Tried Agency checklist, Bribery Third Party Checklist.  In end Bribery pulled it up.  Checklist too detailed.  Wanted checklist on procedure for checking up on a third party eg these are the checks you should do.\r\nRestrictive Covenants - found long form.  Would like short form.\r\nConfidentiality Agreement - found it.  Really detailed.  Would like a short form.  Also note on how to protect confidential information.  \r\nEmployment - looked up Standard termination Letter and Final Written warning.  Couldn\'t find either.  \r\nCompliance with laws Clause - couldn\'t find it.  Would like it to include eg EU Regs, bribery Act.  Also would like a PN on how to ensure the other party complies with all laws - practical ideas of how to do this eg do you simply put in clause saying you will comply with all relevant laws or do you list some/all of them out.  Include various precedent clauses.\r\nWEE and REACH - nothing came up.  She eventually found it but she can\'t remember how.  Nicky to send me note if she can on whether what she found was useful.\r\nTUPE - she wanted a quick overview.  Both her and James really like the idea of GTDT content.  Would also like Doing Business in Guides highlighting key issues in relevant jurisdictions - especially new emerging markets in Middle East and North Africa.  For example they paid Eversheds lots of money  to do a note on cross jurisdictional issues around warranties and limitation across various jurisdictions.  \r\n\r\nJames Ellis-Rees\r\nBribery and Corruption.  Policy perfectly good, UK focussed.  Drafting note too brief - would have liked a little more detail.  Holy Grail for him is how to get a single universal policy and how to implement it in various jurisdictions worldwide eg definition of public official varies in different jurisdictions.\r\nWould like a PN - how to take a single approach worldwide and some precedents to link from it.\r\nJoint ventures - thought we lacked content here.  \r\nUses Foreign Office website and equivalent in US for Doing Business in Guides.\r\nBusiness skills eg bluffers guide to reading a set of accounts - he would really find that helpful\r\nTraining materials - eg Bribery Act training for the business - he would be interested in.  Other ideas - Contracts basics for the business; Competition Law highlights for the sales team.\r\n\r\nWebinars - likes the idea of 5 mins snippets of how another GC has dealt with an issue. Eg Bakers held seminar in Amsterdam re bribery Act.  Had someone from AON speaking - very helpful to hear what they had done.\r\nPLC Mag - articles are too detailed.  Likes idea of our briefing approach eg highlight a topic and list main risk areas and tell you what to do about them.  \r\nNadia Dar \r\nDoesn\'t like colour, look of it, layout.  RH links - would be useful to have footnotes in test and then linking to RH link so you know exactly which link refers to what bit of text.\r\nOften checking cross jurisdiction issues so didn\'t find PSL very helpful.   Wants to do one search eg for limitation of liability and then filter by jurisdiction, type of document.  \r\nSearched Parent Company Guarantees - no result.  Tried Guarantee and got a property Doc which was misleading as it actually had some helpful stuff in it.\r\nJessica Shaffrey\r\nTest is in central panel with lots of white space either side and RH side full of sources which she isn\'t interested in.\r\nNot enough sub headings eg TUPE - had to scroll through PN to find what she wanted.  Headings didn\'t help.  PLC does this much better than us.\r\nDo a search - get results - then have to go back to search page.  Why can\'t there be a search box on every page - like PLC.\r\n\r\nHow often do they use knowhow providers:\r\nJames - once a week\r\nJessica - PLC couple of times a day\r\nNadia - every other day\r\nAlways have to adapt content for business - very rarely find it in form they could send out.  It is was it would be very helpful\r\n\r\nWill forward information on to relevant PSL Teams so no further action via Insight required.',NULL,NULL,61,6,NULL,'',NULL,'Anixter',NULL,NULL,'','',452,591,'2011-10-13 16:32:23',1921,'2011-10-14 08:24:47',72,591,0,NULL,NULL,'N'),(6791,'COMPETITOR','Other',NULL,NULL,NULL,NULL,'','carl upsall',2,172,NULL,NULL,'I picked up a feed from linkedin on an indirect tax group, the above is looking for authors to write industy specific VAT guides.  the body of the text is as follows\r\n \r\nCarlUnfollow Follow Carl \r\nVAT authors: looking for retailing and small business specialists. \r\nI am publishing a new (UK-based) series of guides for VAT practitioners by sector/industry. In 2012 this will start with rural businesses, NHS, property and financial services. I am keen to include guides for advisers to small businesses and to retailers, and a practical guide to dealing with VAT inspections. If you are interested, please contact me by email carlupsall@spiramus.com. \r\nSuggestions for other sector guides also welcome.\r\n\r\n Spiramus Press spiramus.com \r\nSpiramus Press was established in 2003 to provide practical and professional publications in tax, banking and finance, accounting and laws related to running a business. These are for accountants, finance directors, company...\r\n\r\nwould suggest we look at the value of such content and the offering of spiramus as a whole.  Personally I don\'t come across them that often.',NULL,NULL,57,4,NULL,'',NULL,'spiramus press',NULL,NULL,'vat publications','spiramus',71,1221,'2011-10-14 08:12:12',421,'2011-11-02 16:21:12',72,421,0,'TBC','','N'),(6801,'PRODUCT','Renewal or new business conversation',NULL,2009,NULL,NULL,'','Angela Church',1,4,NULL,NULL,'2.    A couple of users were using the \"Forms\" button on PSL but this gives a long list of forms available in their areas of expertise which is not searchable, and in the case of the family lawyer gave an out of date form.  Is it possible to have a Smartforms button that takes you to the Smartforms homepage?\r\n \r\n',NULL,NULL,59,3,NULL,'',NULL,'',NULL,NULL,'LEXISPSL','',341,35,'2011-10-14 08:19:04',1921,'2011-11-09 13:57:04',112,59,0,'TBC','','N'),(6811,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','n/a',1,132,NULL,NULL,'I had a couple of ideas which i thought may be good for LexisSmart precedents:\r\n1.  when the precedent generates into a word doc, is it possible to highlight where the customer has input answers?  this way, they can see the gaps (if unfinished) without having to go through the questionnaire again.\r\n2.  adding some sort of \'stop press\' or alert if a change in the law means that a precedent saved in \'My Documents\' needs to be revised.',NULL,NULL,62,3,NULL,'',NULL,'n/a',NULL,NULL,'LexisSmart precedents','',452,35,'2011-10-14 08:38:21',801,'2011-10-28 09:14:15',72,341,0,'.','','N'),(6821,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,132,NULL,NULL,'THIS HAS BEEN SENT VIA EMAIL DIRECT TO ROB EVANS\r\n\r\n\r\nI was training on Smartforms yesterday and we were looking at the TR1 and our links  from the execution clause to the LR site and the various options. It did not seem possible to select the clause that you wanted to  insert in the TR1 but I do accept that I could have been missing something so my first question is.. am I?\r\nI have attached below a screen print from the Laserforms version which seems to have a very simple \"double click to select form of execution\" prompt - could we build something like this?\r\n\r\nI have also picked up  some additional comments/gliches on  Form D8:\r\nPt 1 tabbing from boxes in names goes from 1st name p to last name r and then onwards randomly\r\nPart 7 tabbing on dob doesn\'t work in every box and is generally random\r\nPostcode on sols details can\'t type in properly\r\n\r\n\r\n\r\n\r\nFrom: Carolyn Mills [mailto:CarolynM@fitzhugh.co.uk] \r\nSent: 13 October 2011 11:38\r\nTo: Fachiri, Sue (LNG-HBE)\r\nSubject: form\r\n\r\n \r\n\r\n',NULL,NULL,0,3,NULL,'',NULL,'Fitzhugh Gates',NULL,NULL,'Smartforms','Laserforms',41,72,'2011-10-14 10:19:01',3701,'2011-11-03 14:03:51',72,3701,0,'TBC','','N'),(6831,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Patricia Campion Group Tax Manager',2,20,NULL,NULL,'Looking at it the Personal module appears to be aimed at tax advisors filing tax returns on behalf of their individual clients.  As such it doesn\'t have much in the way of templates which would be useful by an employer in relation to termination payments.   This is a complicated area so I can understand it if templates are not included.\r\n\r\n  However the general information given is very useful and well summarised (Simons and other library publications can sometimes focus so much on the detail it is hard to get a feel for the overall picture - and the overall picture is something which the guidance does very well).  So I certainly think that \'Termination payments - overview\' and \'How could a termination payment be taxed?\' - ie results 1 and 2 from a search on termination payments would be very useful if included in the corporate module.  Perhaps the guys could consider including these going forward?\r\n',NULL,NULL,19,6,NULL,'',NULL,'Evolution Securities',NULL,NULL,'Tolley Guidance - Corporate ','',442,1291,'2011-10-14 11:18:42',2862,'2011-10-21 11:04:05',112,2862,131,'tbc','','N'),(6841,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Abigail',2,142,NULL,NULL,'The Taxation news alert email specifically from Tolley Library  which contains a snapshop of the headlines does not contain a hyperlink to that specific news article in Tolley Library. Customer actually commented that the news alert email from Taxation works  better than Library news alert.',NULL,NULL,53,5,NULL,'',NULL,'Creaseys',NULL,NULL,'Tolley Library','',261,1411,'2011-10-14 16:10:00',2632,'2011-10-19 09:57:48',112,2632,0,'','','N'),(6851,'BLANK','Other',NULL,NULL,NULL,NULL,'','',0,172,NULL,NULL,'test copy',NULL,NULL,62,12,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,442,801,'2011-10-18 11:17:31',3561,'2011-10-20 09:13:31',21,NULL,-1,'test copy','','N'),(6861,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Ijeoma Igbokwe/ in-house solicitor',1,4,NULL,NULL,'My customer subscribes to In-house library and is looking to take PSL In-house however whilst trying to trial PSL there is no link through to PSL In-house. Is this something we are looking at including?',NULL,NULL,61,9,NULL,'',NULL,'Arrow Global',NULL,NULL,'PSLC14','',261,1661,'2011-10-18 11:35:30',1921,'2011-10-27 12:39:10',92,591,0,'Having to sign into different platform to trial PSL In-house.','','N'),(6871,'PRODUCT','Customer training session',NULL,13324,NULL,NULL,'','Pauline Roberts',1,4,NULL,NULL,'I saw all 4 of the pi / clin neg team here in 1 session\r\nThey find quantum ok but often they get no results if doing a word search - we think because of the fact only the top of the quantum reports are searched. I directed them to the lexis library search from if they find this a problem which does search the whole \r\n\r\nThey don\'t really mind if there are lots of out of court settlements as they like to know the sort of awards which are being settled in other regions - it gives them an idea of whats going on in the market. They did think the search for should allow users to select either \'court settlements only\' or \'court and out of court settlements\'\r\nThey are very likely to send us some cases.',NULL,NULL,44,9,NULL,'',NULL,'',NULL,NULL,'Lexis PSL ','',341,65,'2011-10-18 12:57:05',371,'2011-10-19 14:48:06',112,371,251,'they often find it difficult to find quantum for unusual situations and think (whilst court settlements are obviously better), we should accept both but make the functionality better so the user can decide if they want to include \'out of court \'in their search. ','','N'),(6881,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','pauline roberts',1,4,NULL,NULL,'they really like the calculators in lexis psl PI and find they save them loads of time having them all in 1 place.\r\n\r\nthese get regular usage from all of the 4 in the pi team.',NULL,NULL,44,9,NULL,'',NULL,'smith llewellyn',NULL,NULL,'lexis psl','',442,65,'2011-10-18 13:04:32',371,'2011-10-19 15:01:18',82,371,261,'speeds up their work.','nothing to do here, just a comment about a feature that a client likes.','N'),(6891,'PRODUCT','Direct Mail',NULL,980,NULL,NULL,'','Matt Fitton',1,4,NULL,NULL,'I am trying to find the precedent \'Shareholders Agreement\' on LexisNexis PSL but when I search for it, it does not come up.\r\n \r\nI have used a precedent shareholders agreement from PSL before - any ideas?\r\n',NULL,NULL,10,3,NULL,'',NULL,'',NULL,NULL,'lexis psl commercial','',101,65,'2011-10-18 13:11:32',3831,'2011-11-01 15:52:13',112,3831,271,'they couldn;t find a precedent they wanted to use so had to take the time to e-mail us.','please assign this insight to Andrew Sharpe.\r\n\r\nthere are other insights relating to this - #4502 and 1491\r\n\r\nthis is to add weight to the argument that we ned to have a shareholder agreement (or a document with this title) in PSL as this is what people search for even if the joint venture agreement does the same thing.','N'),(6901,'PRODUCT','Customer/product advisory board',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'I am trying to find information about approval of company accounts by directors (specifically whether all directors have to have seen the accounts and be present at the board meeting where the decision is taken to approve the accounts or whether it is sufficient to have a quorum at the meeting and for the directors present to approve the accounts.) \r\n\r\nI have searched for \'approval of company accounts\' but haven\'t managed to find anything useful other than some case law and legislation which is not relevant to my query.\r\n\r\n',NULL,NULL,61,6,NULL,'',NULL,'Ricardo',NULL,NULL,'','',0,591,'2011-10-19 13:50:57',1921,'2011-11-02 12:55:57',22,591,0,'Don\'t often look things up but when they do they want to be able to find an answer in order to do thier job.','Have passed on to Commercial and Corporate PSL teams to see if we do have any information.','N'),(6911,'BLANK','Other',NULL,NULL,NULL,NULL,NULL,'',NULL,14,NULL,NULL,'Test',NULL,NULL,25,9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,452,801,'2011-10-21 07:44:53',NULL,NULL,NULL,NULL,NULL,'Test','Record to be deleted','Y'),(6921,'BLANK','Other',NULL,NULL,NULL,NULL,NULL,'',NULL,14,NULL,NULL,'Test',NULL,NULL,25,9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,452,801,'2011-10-21 07:44:57',NULL,NULL,NULL,NULL,NULL,'Test','Record to be deleted','Y'),(6931,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',2,142,NULL,55,'Have you got historical versions of HMRC guidance?',NULL,NULL,53,6,NULL,'',NULL,'Beever and Struthers',NULL,NULL,'Tolley Library','',101,66,'2011-10-21 12:19:13',1921,'2011-10-27 14:44:13',112,2632,0,'Every so often it would be useful to see the guidance at that point as investigations run backwards into time quite a lot. HMRC and us delete/change obsolete notes.\r\nWhere most of the time this is the required guidance, it would be nice to have access to historic points in time to help decide why certain advice was given at certain points in a matter.\r\nA lot of time is wasted in investigations.','Have an equivalent service to Historic Versions in legislation on Lexis Library for HMRC Manuals.','N'),(6941,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',2,142,NULL,NULL,'Why is the only source I find useful on Tolley Library so out of date? It\'s October and the latest issue is from August 2011.\r\n\r\nI have also e-maile the Lexis team direct as below, but wanted to log through here as well:\r\n\r\nHi, Mike.\r\n\r\nHere you go:\r\n\r\nElliott Tompkins\r\nDesign Manager\r\nLexisNexis, Quadrant House,\r\nThe Quadrant, Sutton, Surrey, SM2 5AS.\r\n\r\nelliott.tompkins@lexisnexis.co.uk\r\nDirect line: +44 (0) 20 8212 1931\r\n\r\nThe last communication I have for this title is from June this year.\r\n\r\nThanks,\r\nAlbert\r\n\r\n\r\n\r\n\r\nFrom: Urie, Michael (LNG-LON) [mailto:michael.urie@lexisnexis.co.uk] \r\nSent: Thursday, October 20, 2011 10:57 PM\r\nTo: Morris, Cathy (LNG-BEL); LNG-UK Online Co-ordination\r\nCc: Allan, Gavin (LNG-HBE); Blanchard, Alan (LNG-LON); Santos, Albert\r\nSubject: RE: Pay & Benefits (formerly Payroll and Human Resources)\r\n\r\nHi Alan & Albert,\r\n\r\nDo you know who the editor is for this source? We\'re trying to resolve the update issue below for Pay & Benefits.\r\n\r\nMany thanks,\r\nMike\r\n\r\n..\r\n\r\nMichael Urie\r\nOnline Coordination Assistant \r\nLexisNexis \r\nHalsbury House\r\n35 Chancery Lane\r\nLondon, WC2A 1EL\r\n\r\nmichael.urie@lexisnexis.co.uk\r\n+44 (0) 20 7400 2931 Direct\r\n\r\n\r\n\r\nFrom: Morris, Cathy (LNG-BEL) \r\nSent: 20 October 2011 15:24\r\nTo: LNG-UK Online Co-ordination\r\nCc: Allan, Gavin (LNG-HBE)\r\nSubject: Pay & Benefits (formerly Payroll and Human Resources)\r\n\r\nHi Guys,\r\n\r\nLooking at the above publication online there has been no update since August and according to source information this is a monthly publication. Is there a reason it hasn\'t being updated yet?\r\n\r\n \r\n\r\nMany thanks,\r\n\r\nCathy Morris\r\nContent Legal Advisor\r\nLexisNexis UK\r\nPO Box 1073\r\nBelfast \r\nBT10 9AS\r\n \r\ncontentsupport@lexisnexis.co.uk \r\n0845 370 1234 \r\n\r\n\r\n\r\nLexisNexis is a trading name of REED ELSEVIER (UK) LIMITED - Registered office - 1-3 STRAND, LONDON WC2N 5JR\r\nRegistered in England - Company No. 02746621\r\n\r\n\r\n________________________________________\r\n\"This e-mail and any files transmitted with it are for the sole use of the intended recipient(s) and may contain confidential and privileged information. If you are not the intended recipient, please contact the sender by reply e-mail and destroy all copies of the original message. A  ',NULL,NULL,53,9,NULL,'',NULL,'Critchleys',NULL,NULL,'Tolley Library','',81,66,'2011-10-21 12:29:43',1921,'2011-11-09 18:28:53',72,0,0,'Lack of trust in our site having current information and hence their ability to give current advice to their clients in a fast moving area.','Get the latest issue online into Tolley Library asap always please.','N'),(6951,'COMPETITOR','Renewal or new business conversation',NULL,50617,NULL,NULL,'','Librarian',1,1,NULL,50,'Westlaw Pricing Information - The chambers paid 18,000 for Westlaw UK in 2010 and Westlaw were quoting a 12% price increse for 2011 renewal. This is based on 30 users.',NULL,NULL,62,12,NULL,'',NULL,'',NULL,NULL,'Primary Law','',442,3681,'2011-10-21 13:33:59',1921,'2011-11-01 13:31:18',72,61,0,'The chambers are starting to find the cost of their Westlaw service prohobitive as this is only covers their primary law. they then have to go and source their additional text books on top of this. ','','N'),(6961,'MARKET','Other',NULL,NULL,NULL,NULL,'','David Nayler/ Executive Director',1,4,NULL,NULL,' There is a need in the market for an insurance specific service. \r\n\r\nIn their role as Head of UK FSG & Claims practice they work on behalf of the insurer and insuree via chinese wall company [ACS]\r\n\r\nThe team covers EMEA, BRIC, Asia [global exc. US] however English is the jurisdiction of choice however they advise on a series of issues that require knowledge of local regulations that has a global footprint and requires a global network of contacts. For example a fraud in Nigeria by an employee of a bank is govenered under insurance law for hte overarching insurance cover but for recovering the costs the company needs to use local laws ie what is an employee.\r\n\r\nThey draft and negotiate policy and manage claims actions. Indemnity insurance coverage and broker cap analysis for risk strategies.\r\n\r\nNeed materials around regulations, insurance legislation, case law, arbitration reports and news. Authority and breadth are key.\r\n\r\nThey publish articles/materials internally to advise teams of risk and news of current awareness to raise profile of the team.\r\n\r\nThey have 1 full time head in Denver tracking global rules and regulations around the world on rules around re-insurance, locally admitted insurance, indemnify or non-indemnify policies for corporate directors and director responsibility.\r\n\r\n\r\n\r\n\r\n',NULL,NULL,34,0,NULL,'',NULL,'AON',NULL,NULL,'none','none',101,411,'2011-10-21 13:46:59',1921,'2011-10-25 09:40:03',92,691,0,'If we could provide a service that covers core legal insurance and a wider news on hte insurance market world wide [regulation change] there is a list of companies that we could go to.','would be happy to talk through further requirements around the risk and legal insurance markets.','N'),(6971,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Nigel Kingsley Tax Manager',2,24,NULL,55,'Customer informed me that CCH host user group sessions for all those that use their services. They host meetings regionally 2-3 times a year with about 300 people roughly attending per session. These meetings were currently setup for users of CCH accounting software after their acquistion of MYOB software but are now used as a platform for all users to meet and discuss CCH offerings. These are meetings with 300 people attending who may only take CCH accounting software but are then heavily pitched to for other offerings, especially those that take LN services! These meetings are two way and act as a platform for customers to provide feedback and insights directly to CCH. Customers  also feel CCH are paying more attention to their needs as we aren\'t thought to do anything similiar. ',NULL,NULL,53,9,NULL,'',NULL,'Victor Boorman & co',NULL,NULL,'Accounting Software','',31,1411,'2011-10-24 10:31:40',421,'2011-11-01 16:49:38',92,421,0,'creates a better working relationship between supplier and customer,\r\nallows for CCH to pitch to hundreds of GP\'s in one setting\r\nGP\'s come together and share ideas with CCH','speak to customers and get feedback to see if this would be useful for LN library/Guidance users? will be perfect to gain insights, case studies, service feedback and also to pitch new ideas on new products. ','N'),(6981,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Alex Chester',1,4,NULL,NULL,'Customer Complaint email copied below. Please note - full history of correspondence is attached. I have sent him a Tax Deed from EF&P in the meantime. JL\r\n\r\nHi Jen\r\n\r\nI appreciate this is not your fault, but I would ask you to please now pass this on to the appropriate person as a customer complaint.\r\n\r\nI was very surprised when I first looked at your precedents to find that there was no Tax Deed, which is a fundamental and essential part of most Corporate transactions, so I do not see how you can have a proper set of templates without it.\r\n\r\nI\'m therefore even more surprised that, some 4 months after I first enquired about this, you still do not have a Tax Deed precedent. I believe that many of your precedents have come across from Encyclopaedia of Forms and Precedents, which I\'m sure does have a Tax Deed.\r\n\r\nCan you please put a Tax Deed precedent on your system as soon as possible, and in the meantime please e-mail a precedent to me.\r\n\r\nKind Regards\r\nAlex Chester, Director\r\nBrightLaw  \r\n',NULL,NULL,19,3,NULL,'1319457015.msg','RE LexisPSL General Feedback - Tax Deed - COMPLAINT.msg','Brightlaw',NULL,NULL,'','',101,1061,'2011-10-24 11:51:29',1921,'2011-10-27 12:29:09',72,211,0,'Customer requires a Tax Deed for a transaction he is working on and he is unable to proceed without this. ','','N'),(6991,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Graham Buckell',2,20,NULL,NULL,'This client was concerned that when he typed in a search regarding VAT. in this case he knew there were changes coming and the changes were not advising clients in advance on Tolley Guidance',NULL,NULL,57,4,NULL,'',NULL,'Bates Weston',NULL,NULL,'Guidance VAT','',101,3851,'2011-10-24 12:09:45',3322,'2011-10-24 14:26:07',82,2872,0,'There was a concern that he would be advising his clients the wrong information going forward','this problem was sorted out very quickly by the TG team. and the information was updated. ','N'),(7001,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Clare Hale',2,142,NULL,55,'They said that despite their regular need to refer to this annual book, they are not a fan of it. They believe the content of the chapters can be better organised so that the most recent changes to rules appears first. Especially in the Distributions Chapter where the changes to the rules since July 09 are significant and the reason why they refer to the book a lot but find themselves jumping around different parts of the chapter to find those recent changes. Perhaps a more chrinological structure to the chapter will be easier for readers.\r\n\r\nI did explain to the client that in the past year we have worked to change the annuals (the language, the look and structure etc) but I hope this insight can be applied to the Distributions Chaper of the CT annual book. ',NULL,NULL,19,4,NULL,'',NULL,'Arnold Hill & Co',NULL,NULL,'Tolley\'s Corporation Tax Annual','',0,1211,'2011-10-24 13:07:58',2892,'2011-10-24 14:02:26',92,2632,0,'It is time consuming when they cannot find the recent changes first. They have to move back and forth to get an answer. \r\n\r\nAlso it meant they wanted to seek alternative sources for CT commentary. At the moment they are looking to purchase Tolley guidance CT.','','N'),(7011,'PRODUCT','Customer cancellation request',NULL,NULL,NULL,NULL,'','Graham Buckell',2,142,NULL,55,'The customer said he had cancelled his contract in Feb 2011. However nothing monitored onto the system saying he was cancelling. ',NULL,NULL,53,2,NULL,'',NULL,'Bates Weston',NULL,NULL,'General Tax Library','',442,3851,'2011-10-24 13:15:42',1921,'2011-10-27 09:43:24',3,52,0,'this made it awkward when i am in the meeting saying ok do you have proof you cancelled your agreement with LN. You are then in a situation where it is one word agaisnt another!','I am suggesting all online Library & Guidance cancelations should have to sign a cancelation form which is provided by their LN rep only. The customer keeps a copy and the LN rep keeps a copy. Going forward if accounts are moved about you know excatly why the account cancelled and the form has been filled in so their is no dispute wether the customer cancelled or not (as it is there in balck & white)\r\n\r\nthis also when the client contacts their LN rep, gives the rep a chance to change their mind or stops them from quickly signing with CCH','N'),(7021,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Mark Parr',1,142,NULL,55,'The site brings far to much information up conpaired to the old Lexis Library. Would be happy to continue business with Lexis Nexis if the Lexis Library was still avaiable ',NULL,NULL,53,2,NULL,'',NULL,'The AOB Group',NULL,NULL,'General Tax Library','',452,3851,'2011-10-24 16:06:36',2632,'2011-10-25 11:26:11',82,2632,0,'he says the search giving to much time is having an impact on how much time they lose searching for information from Tolley Library','When is the offical turn off day for Lexis Library Tax? Is the seach in the future going to be narrowed down slightly/','N'),(7031,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Simon Davis/MD',2,142,NULL,55,'The client wasnt happy that CCH was over 50% cheaper and felt LN had been over charging for a number of years',NULL,NULL,53,2,NULL,'',NULL,'Hayles & Partners',NULL,NULL,'General Tax ','',51,3851,'2011-10-24 16:17:17',1921,'2011-11-02 15:46:55',22,421,0,'this client wants a cost effective plan to run his buisness. he agreed our content was very good, but worried it wasnt 50% better than the content from CCH','i have introduced Tolley Guidance as a cost effiective way of helping him run his buisness. i think going forward we may have kept this client if his issues would have been flagged up quicker. maybe new prodcut launches or news letters to clients via email to keep them in the loop on why LN are still the best and only option for the client. ','N'),(7041,'PRODUCT','Renewal or new business conversation',NULL,9675,NULL,NULL,'','Clare Heald / Info Manager',1,1,NULL,NULL,'I received the following email from Clare today.  Please can you provide an answer as to why the new editions of the titles listed are not available on LexisLibrary.\r\nThanks, David\r\n\r\n\"One of my concerns with this is frequency of updating, and how easy it is for people to know just how current the commentary they are using really is.   A random look at three titles shows that for each of them either the Source Information is incorrect or the latest printed edition has not been loaded.\r\n When looking at 2 looseleafs this morning, I checked the Source Information, only to find that it stated that they were less current than they really were: \r\no Butterworths wills, probate and admin. service - SI says Iss 73 (May 2011), actually includes material from Iss 75 (Oct 2011) \r\no Tolley\'s company law - SI says Iss 118 (Aug 2011), actually includes Iss 119 (Oct 2011)\r\nThis is unhelpful, but less serious than \r\n Laddie, Prescott and Vitoria:  The modern law of copyright and designs.   4th ed was published last month, but 3rd ed is still there, and Source Information says 4th ed due Dec 2010, giving the impression that nothing has been done about it in almost a year.   It\'s bad enough not having it a month after publication, but this makes it seem even worse.\r\nI should be grateful if you could look into this, as I suspect these are not the only titles to which this applies.\"\r\n',NULL,NULL,0,4,NULL,'',NULL,'',NULL,NULL,'','',81,7,'2011-10-24 16:18:27',1921,'2011-10-25 10:00:01',3,61,0,'The client is currently trialling LexisLibrary with a view to switching to us from Westlaw.  If they have serious concerns about the accuracy of content, then it will affect our chances of winning the business.','Please can you let me know when the new content will be uploaded and the source information changed.','N'),(7051,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Legal team',1,4,NULL,47,'PLC Coco offering is superior to PSL and therefore customer will not be using our module.\r\n\r\nCan PSL be searched across all modules together?  said I thought it was coming soon......',NULL,NULL,12,0,NULL,'',NULL,'EDF Energy',NULL,NULL,'','',41,67,'2011-10-24 20:19:44',1921,'2011-10-28 08:53:58',112,3831,0,'Customer will not use PSL coco until we improve content','','N'),(7061,'PRODUCT','Renewal or new business conversation',NULL,8406,NULL,NULL,'','',1,4,NULL,NULL,'Quantum cases, although good, are not \"new\" enough and there are not enough cases',NULL,NULL,44,1,NULL,'',NULL,'',NULL,NULL,'','KEMP',91,67,'2011-10-24 20:21:48',1921,'2011-10-27 14:40:32',112,371,0,'Need to look elsewhere (hard copy Kemp)','','N'),(7071,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Vir Ahluwalia',1,1,NULL,NULL,'Why are there no cases in the \'find related cases\' link in legislation for s.1200 of the Companies Act 2006?',NULL,NULL,16,2,NULL,'',NULL,'Birmingham Trading Standards',NULL,NULL,'Lexis Lib Trading Stds','',0,66,'2011-10-25 11:48:04',1921,'2011-10-25 14:21:49',92,141,0,'Trading Standards teams hugely rely on case law to help bring to life legislation and see how it has been applied in real life scenarios. ','Check case law taxonomy is accurate and picking up cases relevant to Trading Standards. Client knows they don\'t have access to all caselaw but expected to see some caselaw linked to this provision in Companies Act 2006 from their angle. ','N'),(7081,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Vir Ahluwalia',1,1,NULL,NULL,'Why do you not have any versions of the full text of Donoghue v Stevenson (1932) (other than Casesearch) in the Trading Standards module of Lexis Library?',NULL,NULL,16,1,NULL,'',NULL,'Birmingham Trading Standards',NULL,NULL,'Lexis Lib Trading Stds','',0,66,'2011-10-25 11:53:48',1921,'2011-10-27 08:48:17',72,141,0,'Reduced their trust/likelihood to come to our site and our credibility in the session I ran as a key case in the area (embarassing for us in front of 14 trading standards officers).','Add a full text version of Donoghue and Stevenson to the topic of \'Trading Standards\' to ensure it is included in Trading Standards Lexis Library. \r\nReview and check accuracy of taxonomy of cases being flagged for Trading Standards.','N'),(7091,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Vir Ahluwalia',1,1,NULL,NULL,'Why is it not clear when legislation has been repealed where it now sits? eg Trade Descriptions Act, section 2',NULL,NULL,16,2,NULL,'',NULL,'Birmingham Trading Standards',NULL,NULL,'Trading Standards','',0,66,'2011-10-25 12:00:04',1921,'2011-10-25 12:50:25',3,3711,0,'It\'s great to see that s.2 has been repealed,  but it takes time to work out where they should be looking for current legislation.','In the footnote at the bottom of s.2 TDA it would be easier to follow if it gave a link to the section it now sits in rather than the SI that repealed it as this does not easily answer where you now need to look. \r\nI believe the Companies Act 1985 has such references at the bottom mapping where sections now sit in the 2006 Act which is extremely helpful. ','N'),(7101,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Vir Ahluwalia',1,1,NULL,NULL,'When I look at regulations on Lexis Library, why is the link to \'Find related cases\' not specific to a provision? \r\n\r\n\r\neg Consumer Protection from Unfair Trading Regulations 2008, provision 5 \r\nwhere there is an embarassing list of 2 cases. 1 happens to be relevant to provision 5, but nothing for the others)  \r\n',NULL,NULL,16,2,NULL,'',NULL,'Birmingham Trading Standards',NULL,NULL,'Lexis Library Trading Standards','',0,66,'2011-10-25 12:13:44',1921,'2011-10-25 12:47:59',3,3711,0,'Trading Standards teams are buried in legislation at all levels so need any help they can get to bring it to life.\r\nRegulations are often large so taking you to a general mix of cases is not very helpful and a waste of their time. \r\nAlternatively as in the example above, why are there only 2 cases for the entire regulation which is very much in the spotlight at the moment - it surprised the 14 officers present.','Have related cases at provision level in our legislation. \r\nTo help ensure results appear, the topic of Trading Standards should have the case taxonomy reviewed to ensure this produces as good a selection of cases as possible.','N'),(7111,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Vir Ahluwalia',1,1,NULL,NULL,'Why are there some legislation links not working in Butts Trading & Consumer Law?\r\n\r\neg Div 1A, Part 2, \r\n-Unfair Commercial Practices,\r\n-Consumer Protection from Unfair Trading Regulations 2008\r\n\r\nBlue links to \'Part 5A\' of Sale of Goods Act, and  \'Part 1B\' of the Supply of Goods and Services Act 1982',NULL,NULL,16,4,NULL,'',NULL,'Birmingham Trading Standards',NULL,NULL,'Trading Standards','',341,66,'2011-10-25 12:23:47',1921,'2011-11-02 16:08:22',22,3711,0,'Lose faith in product, waste time finding legislation in separate search, or a danger of turning to another source away from Lexis not as authoritative and up to date.','Make links work, or don\'t show them as links.','N'),(7121,'PRODUCT','Other',NULL,4541,NULL,NULL,'','Look Chan Ho, Senior Associate',1,1,NULL,43,'\"I thought I should mention with specific examples again that the case alert service is not yet able to compete with other providers. Two examples are (i) the ECJ decision in Interedil v Fallimento Interedil (Case C 396/09) (20 October 2011) and (ii) Joint Administrators of Heritable Bank v The Winding up Board of Landsbanki Islands HF [2011] CSIH 61 (28 September 2011).\r\n \r\nThere is no sign of Interedil on Lexis Library. The Heritable Bank case was mentioned in the All England Reporter only yesterday and the judgment isn\'t available on the website. These are important cases and the judgments are already freely available elsewhere.\" \r\n',NULL,NULL,33,1,NULL,'',NULL,'',NULL,NULL,'','',131,2612,'2011-10-25 12:56:40',1921,'2011-10-25 13:16:13',3,3522,0,'The customer says we are not as quick as our competitors (specifically mentioned Lawtel) in our coverage, meaning he uses them instead of us as a first port of call. ','If this is not already in place, establishing a standard turnaround time from a judgment being handed down to it appearing in our Law Reports and ensuring this is communicated to our customers. ','N'),(7131,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','',2,0,NULL,NULL,'Customer wont move from merica for cpd due to they offer a service every month which hosts the clients website and also sends out monthly newsletters to the clients customers (on behalf of the client) and offers them a complete marketing package with their CPD tranning built in.',NULL,NULL,53,9,NULL,'',NULL,'',NULL,'0','CPD','Merica',41,3851,'2011-10-25 15:24:13',421,'2011-11-01 16:49:01',92,421,0,'it saves the client lots of time and money working on their website. also saves the client having to employ a marketing person to update there website and send newsleters out etc. also they get there cpd traiining within the package which saves them spending elsewhere.','i think mercia have created a good idea here. it keeps their clients loyal to them by offering a complete service from websites/trainning and marketing ','N'),(7141,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','James Singley',2,16,NULL,NULL,'customer would like to use KYC ID on a trial basis. said that this product could be a ket element of his buisness, however we dont have a trial code for this product',NULL,NULL,53,2,NULL,'',NULL,'King Freeman',NULL,NULL,'KYC ID','',441,3851,'2011-10-25 15:55:10',1921,'2011-10-27 12:24:19',72,1501,0,'it means spending 1400 on a product when the client doesnt know if its right for his company','can we have KYC ID on trial as a stand alone???','N'),(7151,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Claire Boot',1,1,NULL,NULL,'Halsbury\'s referred her to a case, but the case wasn\'t available as it was pre 1980\'s??  She wants Viscount Tredegar v Harwood (1929) and Bates v Donaldson (1896).',NULL,NULL,49,1,NULL,'',NULL,'Max Engel',NULL,NULL,'','',91,35,'2011-10-26 08:42:53',3711,'2011-10-26 12:17:42',72,3711,0,'time wasting having to find another case','Can Halsbury\'s not also refer to alternative \'newer\' cases?','N'),(7161,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Richard Engel',1,4,NULL,NULL,'They would like a checklist or precedent test for mental capacity',NULL,NULL,47,3,NULL,'',NULL,'Max Engel',NULL,NULL,'PSL Private Client','',101,35,'2011-10-26 08:45:27',1921,'2011-10-27 09:50:59',72,2622,0,'recently assumed a client did not have any mental capacity issues based on general conversations, but later found out client had a head injury','','N'),(7171,'PRODUCT','Direct Mail',NULL,NULL,NULL,NULL,'','Jenny Poole/Securities Officer',1,4,NULL,NULL,'Email enquiry about how to find note on Consumer Credit regulations concerning treatment of amended consumer credit agreements.',NULL,NULL,10,6,NULL,'',NULL,'Marfin Laiki Bank',NULL,NULL,'','',91,3831,'2011-10-26 08:58:09',1921,'2011-10-26 11:34:26',112,3831,0,'Customer was on LexisPSL trial, and needed guidance on finding relevant guidance - important to the client as in the consumer credit business.','The query was answered by email, showing customer how the relevant guidance could have been found easily. However, the relevant practice note did not answer the customer\'s problem, so this was given in the email as well as explanation that the topic area concerned is due for review shortly.\r\n\r\nFlag as resolved ON ROADMAP.','N'),(7181,'PRODUCT','Renewal or new business conversation',NULL,8110,NULL,NULL,'','Claire Boot',1,1,NULL,NULL,'why are hill & redman divisions not titled?',NULL,NULL,49,3,NULL,'',NULL,'',NULL,NULL,'','',131,35,'2011-10-26 09:07:09',1921,'2011-11-02 16:20:13',3,3711,0,'inconvenience','','N'),(7191,'PRODUCT','0',NULL,NULL,NULL,NULL,'','',1,1,NULL,NULL,'why doesnt EF&P commentary show up in a commentary sources search?',NULL,NULL,59,4,NULL,'',NULL,'',NULL,NULL,'','',341,35,'2011-10-26 09:09:55',1921,'2011-11-02 16:28:14',92,3711,0,'run same search twice','','N'),(7201,'BLANK','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','',6,4,NULL,47,'The customer was used to using PLC. They had seen PSL a few months previously and thought that it wasn\'t as good as PLC but wanted us to come along and show them the product and its benefits.  They were really pleased with all the work and improvments that had been done on PSL corporate and commercial modules since they last saw it and said it had improved a lot. They also really liked the PSL functionality and requested a trial.',NULL,NULL,0,0,NULL,'',NULL,'Capital One',NULL,NULL,'','',0,2371,'2011-10-26 14:53:13',1921,'2011-10-26 14:57:53',3,231,0,'N/A','','N'),(7211,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,1,NULL,NULL,'The firm uses Westlaw and PLC mostly but they said that Lexis is much better than the other providers for cases.',NULL,NULL,0,1,NULL,'',NULL,'IBB Law',NULL,NULL,'','',442,2371,'2011-10-26 14:56:51',1921,'2011-11-02 16:33:35',72,3711,0,'N/A','','N'),(7221,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Fiona Green/Director',2,142,NULL,NULL,'Lexis Nexis used to supply a hardcopy book on Tax Investigations, the client wants to know why this stopped.',NULL,NULL,53,2,NULL,'',NULL,'DJH Accountants',NULL,NULL,'Tax Investigations','',131,3851,'2011-10-26 17:04:59',2632,'2011-10-27 12:49:14',102,2632,0,'This was a high usage product for this customer, and it would be a big help if we provided this book/online mod again','If we could look to re-instate this product again, there is a need for it','N'),(7231,'CUSTOMER','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Finoa Green/Director',2,142,NULL,NULL,'Customer would like to know if their is anything going forward with inforamtion for the medical market',NULL,NULL,53,2,NULL,'',NULL,'DJH Accountants',NULL,NULL,'General Tax','',101,3851,'2011-10-26 17:08:45',1921,'2011-11-02 16:36:28',72,2632,0,'they have a couple of large clients within the medical insdusrty and it would help them if LN provided this type of information','Maybe looking at a mod on Tolley Guidance for clients who wish to dabble within the medical market place and need legislation and guidance','N'),(7241,'CUSTOMER','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Steve Dunn/Partner',2,142,NULL,55,'Customer wants to know if LN are going to bring out anything in audit. ',NULL,NULL,53,2,NULL,'',NULL,'Bache Brown',NULL,NULL,'Genral Tax','',91,3851,'2011-10-26 17:12:40',1921,'2011-10-27 12:39:51',22,2632,0,'They have 45 clients that are Audit only and feel we cant provide anything to help them on the aduit side of there business','maybe a aduit mod on tolley guidance, or a stand alone Aduit product','N'),(7251,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Tim Oakley',1,1,NULL,NULL,'In \'Find a Legal term\' when we type \'Restrictuve Covenant\' does the definition only relate to this legal concept from an emplyment perspective? It is similarly significant to a commercial property expert too. I can see index references further down the page foe employment and property angles, but the definition should be appropriate for both please.',NULL,NULL,11,4,NULL,'',NULL,'Walsall MBC',NULL,NULL,'Lexis Library','',0,66,'2011-10-26 19:30:23',3751,'2011-10-31 15:37:39',92,3751,0,'Finding an appropriate definition quickly could increase confidence in the site as being relevant to a commercial property expert and cut their research time.','Either have 2 Restrictive Covenant entries in Find a Legal Term, or put 2 definitions that would be appropriate for employment AND property - thank you! ','N'),(7261,'PRODUCT','Customer training session',NULL,13370,NULL,NULL,'','Louise Welch',1,4,NULL,NULL,'It would be really good to add a toolbox in this page (like the family page) to include things like probate fees, inheritance calculators and thresholds',NULL,NULL,47,9,NULL,'',NULL,'',NULL,NULL,'','',0,67,'2011-10-27 08:23:05',2622,'2011-10-27 09:36:04',112,2622,0,'Practical info like this saves time and ensures you are using up to date info','','N'),(7271,'PRODUCT','Customer training session',NULL,13370,NULL,NULL,'','Louise Welch',1,4,NULL,NULL,'Would be it possible to add a toolbox (like family PAP) with handy info for property, like stamp duty fees, stamp duty calc for leases, interest and penalties on delayed completion (calcs)',NULL,NULL,49,9,NULL,'',NULL,'',NULL,NULL,'','',101,67,'2011-10-27 08:25:40',201,'2011-11-10 09:20:44',92,201,0,'Makes PSL all in one','','N'),(7281,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Legal Specialist',1,4,NULL,47,'\"Tried to search for guidance on SECCI content and Adequate Explanation - use for new product, it didn\'t seem to be covered in the practice notes. I use the links to legislation. The order/grouping in the SIs were listed was odd, but I found the one I needed and the layout worked well\"',NULL,NULL,12,6,NULL,'',NULL,'capital one',NULL,NULL,'Commercial','',31,1361,'2011-10-27 14:42:55',3831,'2011-10-28 14:33:26',92,3831,0,'Need the guidance, which they get from PLC','','N'),(7291,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Legal Specialist',1,4,NULL,47,'\"Searched for SMS opt out and no results, the practice note contained a useful but v.high level summary of the requirements for email/SMS marketing\"',NULL,NULL,12,6,NULL,'',NULL,'capital one',NULL,NULL,'Commercial','',31,1361,'2011-10-27 14:44:35',3831,'2011-10-28 14:31:46',112,3831,0,'Guidance needed, competing with PLC coverage','','N'),(7301,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Legal Specialist',1,4,NULL,47,'\"Tried the link through to Goode from the Practice notes which was useful, but once there was then no tree to move within Goode, and I had to come out again and go into the Goode book the usual way.\"\r\n\r\nGood to start with, but the \'seamless\' link to Library did not allow for navigation in Goode.',NULL,NULL,12,9,NULL,'',NULL,'capital one',NULL,NULL,'Commercial','',31,1361,'2011-10-27 14:47:00',1921,'2011-11-09 13:57:57',92,59,0,'Had to spend time going through Library to Goode as an extra step when they should be able to navigate instantly.','','N'),(7311,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Legal Specialist',1,4,NULL,47,'\"In the practice notes dealing with Consumer Credit agreements requirements the wording was slightly misleading, it referred to some requirements as being for all agreements since May 2005, but should have read \"from May 2005 to Feb 2011.\" \"',NULL,NULL,12,6,NULL,'',NULL,'capital one',NULL,NULL,'Commercial','',81,1361,'2011-10-27 14:49:50',3831,'2011-10-28 14:29:19',112,3831,0,'Need to have quality of information spot on for peace of mind etc.  Cant second guess the content.','','N'),(7321,'BLANK','Other',NULL,NULL,NULL,NULL,'','Lissa Allcock',2,142,NULL,55,'I spent about 2 hours with Lissa this afternoon and we looked at Tolley Library in detail, she has been using LexisLibrary for some time and is very familiar with its functionality. I am also copying Dan in and much of what she has said is not new feedback for us. I will also add it to Insight Tracker.\r\n\r\nThey use IE7 which they only got this year so there\'s little chance of a further upgrade in the near future. So LexisLibrary, Tolley Library and CCH too are quite slow across their network. On the whole Lissa likes the service for the general users but has real reservations about the absence of the check box functionality in Tolley Library. This is present on LexisLibrary and gives the user the ability to select documents for delivery and also search within a smaller area(s) of text. More detail on this is given further down the e-mail.\r\n\r\nHer Tolley Library feedback is below though I have a few items I need to run by Content Support which I will do tomorrow.\r\n\r\nLEGISLATION\r\nIn a search for an Act or Statutory Instrument \"promote\" the main Act/SI itself to the top of the results page. (If this can be done in future, can it also be applied to case names? MM)\r\n\r\nNeed a check box on the legislation search pages to enable a restriction to Statutory Instruments only, as is present in Lexis Library.\r\n\r\nA search for PAYE regulations did find it but the user is taken deep into the document in the first result not to the top of it which would be more useful. The free Parliamentary website finds this regulation immediately and takes the user to the top, though as Lissa herself pointed out, it is not as current. This is SI 2003/2682.\r\n\r\nCould we have a list of the most commonly searched for SIs that can be accessed in this area and selected quickly? CCH has this function and Lissa has promised a screen shot of this function.\r\n\r\nFUNCTIONALITY\r\nWhen there is only one result it would be more helpful to go straight to it as in LexisLibrary, rather than click on the result\'s title to access the document. It would be useful in view of the slow browser speed at their offices. \r\n\r\nFilter by keyword can only be used once, unless you go back to the initial results page to access it again. Lissa would prefer that the search box remain present in the results pages so further terms can be added to the search more easily (Tolley Guidance does already have this feature MM). In addition the function title is not clear perhaps \"Edit Search\" would be better.\r\n\r\nWould like the option to access Historical Versions of legislation in Tolley Library, this is present in Lexis Library.\r\n\r\nWould like to decide the selections of books on the E&Y default bookshelves for their staff.\r\n\r\nThe Table of Contents view is not always displaying the first character in the titles when the screen is split with the TOC on the left and text on the right. More space would be helpful here, there is a large grey margin that could perhaps be used?\r\n\r\nDelivery icons displayed within a document need to be larger and clearer, especially the download and print options. The view in the tab My Documents is better.\r\n\r\nWould like to switch off or move Breaking News  - Lissa rarely uses it.\r\n\r\nWould like a \"Did you mean?\" for searching.\r\n\r\nWould like to drag the search alerts and updates to RSS feeders, IBFD permits this.\r\n\r\nLissa noted that the information icons found widely in Lexis Library are not present in Tolley Library. These give useful information about individual titles and their currency. Would be useful too to have them by the Search All options in the different Topic tabs to see which titles are included in the search\r\n\r\nThere were some problems editing an update. (I will look at this tomorrow MM).\r\n\r\n\r\nDOCUMENT SELECTION\r\n\r\nMy Documents\r\n\r\nLissa Likes this area but was disappointed that the delivery options here are all or nothing. You can\'t select a few documents for printing and leave the rest for accessing again later on in the week.  \r\nCould the more recently added documents be added to the bottom of the list, rather than the top - more logical.\r\nWould also like to be able to move documents up or down the list in line with the bookshelf functionality. \r\nMore information on a selected document is needed in this area, e.g. if you add 3 sections from the CTA 2010 the only information it will give you is the act\'s title, you really can\'t tell one section from another here making it difficult to know which to select.\r\n\r\nSearching through and downloading selections of text\r\n\r\nShe did notice that check boxes present in LexisLibrary were absent in Tolley Library making it difficult to select a number of related items for delivery or to run a search through a few smaller areas of text. For printing, items would need to be selected one at a time from the table of contents, displayed and then added to My Documents. This is much slower than on Lexis Library and then further slowed down by their browser. Lissa viewed the lack of functionality in this area as quite serious.\r\n\r\nLissa did object to the note that document delivery was subject to \"Terms and Conditions\"!\r\n\r\n',NULL,NULL,53,9,NULL,'',NULL,'Ernst & Young',NULL,NULL,'Tolley Library','',462,75,'2011-10-28 09:49:29',2632,'2011-10-31 11:17:15',92,2632,0,'Some element of LexisLibrary functionality are not on Tolley Library and established users do expect to see these key features carried on to the new service.','','N'),(7331,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Stuart Weekes',2,142,NULL,NULL,'Would like the chapters of Acts to be searchable with a separate box for the chapter placed in the legislation search page. \r\nAlso display chapters in the table of contents for browsing purposes.',NULL,NULL,53,2,NULL,'',NULL,'Crowe Clark Whitehill',NULL,NULL,'','',341,75,'2011-10-28 10:23:18',2632,'2011-10-31 11:20:33',92,2632,0,'Difficult to get to a chapter when needed.','Assess other feedback and how easy it would be to make these changes to the search page and toc view.','N'),(7341,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Lissa Allcock',2,142,NULL,NULL,'With the case Westmoreland Investments Limited v Macniven (HM Inspector of Taxes)(Westmoreland v MacNiven) the name MacNiven is spelt incorrectly:\r\n\r\nMcNiven (Inspector of Taxes) v Westmoreland Investments Ltd. - 23/10/2000 General Case Digest.',NULL,NULL,53,1,NULL,'',NULL,'Ernst & Young',NULL,NULL,'','',81,75,'2011-10-28 11:05:45',1921,'2011-10-28 12:15:23',3,2632,0,'A search would miss this case','A \"Did you mean?\" option could be useful for these errors.','N'),(7351,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','stuart Weekes',2,142,NULL,NULL,'HMRC CGT Manual seems to have a name change  \'CGCONT - CAPITAL GAINS MANUAL\', is this correct?  The manuals are also difficult to browse through.',NULL,NULL,53,4,NULL,'',NULL,'Crowe Clark Whitehill',NULL,NULL,'','',131,75,'2011-10-28 11:16:01',2632,'2011-10-31 11:25:49',112,2632,0,'Takes time tio browse to the content they want witin the manuals and the speculation about the title could cause them to worry about whether they can rely on the source. If it is in line eith the HMRC web pages there is little we can do about it.','Improve the browse option for the Manuals - I know they are being looked at for ia range of possible mprovements next year. ','N'),(7361,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Fiona Donaldson',2,142,NULL,55,'In a demonstration to Springfords the following feedback was gathered:\r\n\r\nOn Lexis Library they liked using segment searching/check boxes to restrict the search and for selecting items for printing.\r\nWould like the Filter by keyword option to stay present so it can be used more than once. They are heavy users of Search within Results in Lexis Library, they tend to search broadly then add additional terms to the search. .Regular users of  LexisLibrary connectors  and would like them in Tolley Library. They also want the option of chosing to have more results displayed and are unhappy with just 250. \r\nWould like a plain Saved Search option as present in Lexis Library - so not a search alert.\r\nWould like to be able to view results for Individual HMRC Manuals which they can get if they search the Manuals separately in LexisLibrary.\r\n',NULL,NULL,53,0,NULL,'',NULL,'Springfords',NULL,NULL,'','',341,75,'2011-10-28 11:41:01',2632,'2011-10-31 11:31:32',92,2632,0,'As experienced Lexis Library users they are finding aspects of Tolley Library frustrating and find they get better results using connectors and would like this function and othe LL functionality incorporated into Tolley Library','At least look at the option to have  a search box stay present throughout the search stage as happens in Tolley Guidance and look at offering the option to have more results.\r\nAn advanced search in Tolley Library would depend on the numbers requesting it overall.\r\nCheck boxes ahve been asked for in a  few sessions.','N'),(7371,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Lissa Allcock',2,142,NULL,NULL,'Lissa pointed out that online Feeney: Irish Income Tax is now out of date and has asked that we put a note within the volume explaining this.',NULL,NULL,53,4,NULL,'',NULL,'',NULL,NULL,'','',81,75,'2011-10-28 12:02:48',1921,'2011-10-28 12:37:50',3,2632,0,'Risk of relying on possibly out of date material.','Put a note within the text at the start.','N'),(7381,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Nigel Wigglesworth',2,142,NULL,NULL,'Make the indices available to at least the Tolley books online, many are familiar with the hard copy index and would find it very useful to be able to do this.',NULL,NULL,54,4,NULL,'',NULL,'Cowans',NULL,NULL,'Tax','',131,75,'2011-10-28 12:05:48',2632,'2011-10-31 11:33:13',112,2632,0,'Ease of use and reassurance that it is \"like the book\".','Investigate adding the functionality, it is something that has been requested many times previously.','N'),(7391,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','speedy gonzalez',0,11,NULL,NULL,'N/A',NULL,NULL,8,2,NULL,'',NULL,'smith and allan',NULL,NULL,NULL,NULL,131,1881,'2011-10-28 14:21:07',801,'2011-10-31 15:25:41',21,NULL,0,'It doesnt','Ignore','Y'),(7401,'COMPETITOR','Customer training session',NULL,9373,NULL,NULL,'','Alex Reid/Librarian',1,1,NULL,43,'Alex Reid told me that Lawtel offer a service called Pending Cases, started about a year ago, which shows a list of cases filed at the Court. We do not offer this service, and Alex felt we should think about offering it. He said clients occasionally call up asking to know what happened with a claim that had been filed at court, and they are able to use this service to check whether the case has been removed, or has been heard, or has a date for a hearing etc.',NULL,NULL,0,1,NULL,'',NULL,'',NULL,NULL,'','',31,1881,'2011-10-28 14:23:09',1921,'2011-11-02 17:11:45',102,141,0,'It is not something that comes up especially often, but when it does, it can take Alex a number of hours to find an answer. ','Perhaps this has been considered before and dismissed as too costly with no real value, but if a competitor offers it, it gives them an edge of sorts. I would be interested to know if this has been considered before.','N'),(7411,'PRODUCT','Customer training session',NULL,9373,NULL,NULL,'','Alex Reid/Librarian',1,1,NULL,NULL,'Alex Reid and I were looking at Appeal Tracker, which he had not seen before. He felt that the positioning of the red Appeal Tracker flag in the grey banner at the top of the the casesearch page was not obvious enough and would be missed by many fee-earners. He felt it must have been designed by a \"techie\", and that it was not intuitive. He felt it would be much more obvious if it occupied some of the white space, near the casename/citations, as users probably start reading from here, not from the grey banner.',NULL,NULL,0,1,NULL,'',NULL,'',NULL,NULL,'','',271,1881,'2011-10-28 14:26:13',61,'2011-11-01 13:21:41',72,61,0,'N/A','Consider re-positioning the Insight Tracker flag at the top of the page to a more prominent position.','N'),(7421,'BLANK','Direct Mail',NULL,NULL,NULL,NULL,'','',0,3,NULL,NULL,'Test',NULL,NULL,0,0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,0,801,'2011-10-28 14:58:57',801,'2011-10-31 15:24:56',21,NULL,0,'Test','','Y'),(7431,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','',0,15,NULL,NULL,'Test',NULL,NULL,8,0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,121,801,'2011-10-28 15:06:46',801,'2011-10-31 15:24:12',21,NULL,0,'Test','','Y'),(7441,'BLANK','Direct Mail',NULL,NULL,NULL,NULL,'','',0,16,NULL,NULL,'Test 2',NULL,NULL,13,0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,281,801,'2011-10-28 15:07:49',801,'2011-10-31 15:22:58',21,NULL,0,'Test 2','','Y'),(7451,'BLANK','Informal conversation',NULL,NULL,NULL,NULL,'','',0,131,NULL,NULL,'Test ',NULL,NULL,4,0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,141,15,'2011-10-28 15:14:22',801,'2011-10-31 15:22:13',21,NULL,0,'Test','','Y'),(7461,'BLANK','Industry event',NULL,NULL,NULL,NULL,'','',0,3,NULL,NULL,'Test 2',NULL,NULL,2,0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,91,15,'2011-10-28 15:15:38',801,'2011-10-31 15:21:31',21,NULL,0,'Test 2','','Y'),(7471,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Adam Rose',2,142,NULL,NULL,'After selecting an option in the \"Find out more...\"  Sometimes the documents displayed can be long and it is time comsuming to find one specific reference among many. Can the reference be highlighted so the context is easily identifiable?',NULL,NULL,53,4,NULL,'',NULL,'Baker Tilly',NULL,NULL,'','',341,75,'2011-10-28 15:26:43',2632,'2011-10-31 11:35:53',92,2632,0,'It would save them time and ensure this useful function is more frequently used','Can they be highlighted as requested\r\n\r\nI\'d also go one step further and suggest that the material displayed from Find out More in Tolley Library would be better displayed in the same way as the results under the Source button. So users can get a list of references within a favourite text or source (MM).','N'),(7481,'BLANK','Informal conversation',NULL,NULL,NULL,NULL,'','',0,14,NULL,NULL,'Testing\r\n',NULL,NULL,5,0,NULL,'',NULL,'',NULL,NULL,'','',101,801,'2011-10-28 15:27:17',1921,'2011-11-10 13:58:01',21,0,0,'Testing','','Y'),(7491,'BLANK','Publication',NULL,NULL,NULL,NULL,'','',0,7,NULL,NULL,'Test',NULL,NULL,5,0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,0,3631,'2011-10-28 15:46:06',801,'2011-10-31 15:19:42',21,NULL,0,'Test','','Y'),(7501,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','David Ostle',2,142,NULL,NULL,'Why can I see less in a set of results to tell me where the result is from compared to the CD version (now it just says \'Simons Taxes\' - the CD and old library said Simons Taxes - Binder 1 etc\'.\r\n',NULL,NULL,53,4,NULL,'',NULL,'Critchleys',NULL,NULL,'Tolley Library','',131,66,'2011-10-28 16:05:39',2632,'2011-10-31 11:38:43',92,2632,0,'Takes longer for him to see if the result is of interest to him. ','Is there a way of showing more in the results list? I\'m guessing this may have been a conscious decision to unclutter text appearing with results. \r\nMaybe another way round would be when you select the blue Source button with results allowing you to filter by source/book, could we allow it to go a level down to filter within a source to the binders like it used to in the Lexis Library? Thanks! ','N'),(7511,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','David Ostle',2,142,NULL,NULL,'Why can I only see 20 results at a time?\r\nThe CD allowed me to scroll quickly through as many results as came up.',NULL,NULL,53,4,NULL,'',NULL,'Critchleys',NULL,NULL,'Tolley Library','',131,66,'2011-10-28 16:07:47',2632,'2011-10-31 11:40:22',102,2632,0,'Takes time to make sense of results and see something they had in mind ','Allow a preference to have 50 or 100 results at a time on searching','N'),(7521,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Philip Row',2,142,NULL,NULL,'Why when I tick HMRC in the serahc area at the top right of the home page so I get books diluting HMRC results? (Simons seems to appear as well)',NULL,NULL,53,4,NULL,'',NULL,'Critchleys',NULL,NULL,'Tolley Library','',341,66,'2011-10-28 16:12:56',2632,'2011-10-31 11:43:12',92,2632,0,'Not so easy to see the wood for the trees for the relevant results','Should iselecting HMRC from the front page include the same sources as appear when you click on \'Materials\'? Forgive my ignorance if there is a technical reason why this should not be the case...\r\nNot a big issue, but it was his first impression of the site which put him off (feels better about it generally now!)I know it\'s been mentioneda lot, but he also said why are we calling it Materials (I said we are changing that as soon as possible!).','N'),(7531,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Philip Row',2,142,NULL,NULL,'How can I set it up/bookmark to allow me to quickly access the 5/10 sections of legislation I need to see?\r\nThe \'My Documents\' gave a perfect view of what they want, just for permanent access to documents.',NULL,NULL,53,2,NULL,'',NULL,'Critchleys',NULL,NULL,'Tolley Library','',341,66,'2011-10-28 16:17:10',2632,'2011-11-22 15:10:28',92,2632,0,'Tiem saver, feels personalised to them to aid Critchleys with their APR and BPR queries they have a lot of. ','Have a way of bookmarking documents - the My Documents area is perfect if it was permanent.\r\nOr are we thinking of doing saved searches?\r\nIt was to replicate the action of post-it noting pages in eg Yellow Tax H/B ','N'),(7541,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'The customer had tried to search for an email disclaimer and although they had found it by browsing it was not coming up by searching. During the session I tried to search for it by searching email disclaimer and e-mail disclaimer and both times it said no search results found although the result is there and it\'s called e-mail disclaimer.',NULL,NULL,10,9,NULL,'',NULL,'Phillips Solicitors',NULL,NULL,'','',301,2371,'2011-10-31 11:28:01',1921,'2011-11-09 13:58:39',22,59,0,'They have reduced confidence in the search functionality.','I think this is probably just a mistake in the search that needs fixing.','N'),(7551,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Paul Davies, Indirect Tax Manager',1,142,NULL,82,'Need for preferential free trade agreements between countries - the rules, duty rates, duty relief and a tracker to see what stage the rules have been implemented. \r\n\r\nCurrently they take IBFD & TolleyLibrary (In-House) but finds it almost impossible to get this information without external advice.    They want an online system similar to Tax Analyst where agreements can be compared side by side.\r\n\r\nThe example given for its use was to identify likely duty to be paid if they built a factory in one country over another.  ',NULL,NULL,54,4,NULL,'',NULL,'Jaguar Cars',NULL,NULL,'New','',101,1341,'2011-10-31 11:29:37',2632,'2011-10-31 15:48:42',112,2632,0,'Questions of this nature are asked 2-3 times per month, each time the external bill is circa 4K but with this information to hand, the work could easily be handled in-house and deliver much greater value - done quicker and have a far greater reach.  They believe that other global manufacturers would have similar issues.\r\n\r\nThe contact is very happy to discuss their needs if required.','Do we have this information already available and if so, is it in this format?  If not, then has this feedback been given before and if so, is it on the roadmap or can it be added.','N'),(7561,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,132,NULL,47,'The compromise agreement in Smart in PSL employment is very long. Is is possible to have a short version on smart as well as the long version. Apparently PLC have this.',NULL,NULL,24,3,NULL,'',NULL,'Phillips Solicitors',NULL,NULL,'','',131,2371,'2011-10-31 11:37:45',1921,'2011-11-02 17:17:38',92,331,0,'They are still using their own version of a compromise agreement and would like to use the Smart version.','Look at adding a Smart short version of a compromise agreement.','N'),(7571,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,4,NULL,47,'PLC has a section on foreign lawyers and as this firm are moving from PLC to PSL they said this is the number 1 thing they will really miss. They do quite a lot of cross border work eg where the head office of a firm is in one country, an employee has a contract in another and are moving to do a contract in another country. A section on recommended lawyers in other jurisdictions would be really useful. Also practice notes on cross border issues would be really useful.',NULL,NULL,24,9,NULL,'',NULL,'Phillips Solicitors',NULL,NULL,'','',452,2371,'2011-10-31 11:55:31',2511,'2011-11-03 11:28:49',112,2511,0,'They will have to use google to find foreign lawyers which is time consuming and a bit hit and miss. So much of their work currently has a cross border element that cross border/international information is very useful.','Can we add this?','N'),(7581,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',6,18,NULL,NULL,'They love the content of the webinars however they said they are not intuitive or user friendly to get into. The examples they gave are that finding things on the dashboard is difficult and for the quiz you are told to click a box called quiz however the box is actually named something else.',NULL,NULL,24,9,NULL,'',NULL,'Phillips Solicitors',NULL,NULL,'','',341,2371,'2011-10-31 11:59:12',1921,'2011-10-31 12:54:20',3,2752,0,'N/A','I\'ve never used the webinars but maybe someone needs to look at their usability from a user\'s point of view.','N'),(7591,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Keith Dixon',2,142,NULL,55,'Customer mentions a fantastic feature CCH have in their library is \"Business Focus\". This is a useful tool that accounts can use to help them with their clients. It provides them with specialist info regarding a particular industry and helps them build a report on that market for their customer. For example if a customer wanted to setup a new chinese retaurant, the tool uses info specifically relevant to that industry to get the latest information, rates, and market insights.',NULL,NULL,53,4,NULL,'',NULL,'Thomas Edward Dixon',NULL,NULL,'','',31,1411,'2011-10-31 12:17:04',2632,'2011-10-31 15:49:11',102,2632,0,'Helps accountants provide specific info to their clients. the tool has approx 60 different industries, e.g. doctor, dentist, golf clubs,.','','N'),(7601,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Rob Bridger',2,24,NULL,55,'customer\'s are frequently asking what our intentions are in regards to developing/purchasing software information. CCH currently provide this after buying our a firm and are combining this with their tax library to offer an overall better suited proposition. ',NULL,NULL,53,9,NULL,'',NULL,'Place Campbell',NULL,NULL,'','',61,1411,'2011-10-31 12:23:25',421,'2011-11-01 16:48:04',92,421,0,'able to fit a general practice\'s overall needs better than LN','','N'),(7611,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Mr Daniels',2,162,NULL,NULL,'customer used to take CCH after using LN for a number of years but is looking to move back. This is purely down to our tax planning content, customer informs us that although general commentary there isn\'t much of a difference, it really is obvious in regards to tax planning guidance/commentary. Customer absolutely loves our specialised tax planning content on an area by area focus. This was the sole reason customer is moving back to us from CCH.',NULL,NULL,53,4,NULL,'',NULL,'daniels and co',NULL,NULL,'','',442,1411,'2011-10-31 12:35:32',2632,'2011-10-31 15:51:19',82,2632,0,'customer sees LN as their only option in regards to tax planning info','','N'),(7621,'BLANK','Other',NULL,NULL,NULL,NULL,'','Sue Green',2,142,NULL,NULL,'The customer would like to know if their are any plans to make the library more customised. (she wanted to set a new user up but had to set it up via me. she would like the facility to set new users up from logging on as her and doing it herself)',NULL,NULL,53,9,NULL,'',NULL,'Page Kirk',NULL,NULL,'General Tax library','',442,3851,'2011-10-31 12:42:48',2632,'2011-10-31 15:54:02',102,2632,0,'it takes a couple of phone calls and time waiting for us to do it. (even though we are quick at getting back) it would be better from them if they could do it their and then. Also normally when there are setting a new user up, the new user normally needs to log on at that exact time','maybe looking at the library offering a service where the client can do various things which they can add onto their account from their homescreen.','N'),(7631,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'The PDF / Smart version of the form Flexible Working - employer\'s reply to appeal FW(E) says that you can\'t save date typed onto the form. Is there any reason for this?',NULL,NULL,24,3,NULL,'',NULL,'Phillips Solicitors',NULL,NULL,'','',131,2371,'2011-10-31 12:57:30',2511,'2011-11-02 11:52:45',72,2511,0,'They need to be able to save the form.','','N'),(7641,'PRODUCT','Customer/product advisory board',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'\"Just to give you some further feedback - I was looking the other day on Lexis for Board Minutes approving financial statements and the search came up with one result which was not relevant. I had also looked on PLC which does have some Board Minute precedents but not this particular one. \"',NULL,NULL,61,6,NULL,'',NULL,'Ricardo',NULL,NULL,'','',101,591,'2011-10-31 17:18:50',1921,'2011-11-02 17:22:38',92,591,0,'Would have saved them having to draft minutes from scratch','I will pass feedback to Corporate team.','N'),(7651,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Dirk Toulmin vanSitttert/GC',1,4,NULL,47,'the client quite liked the useability of the PSL platform. However was dissapointed in the lack of contact and in his own words \"thought it was a bit noddy\"! He did not feel that it was \"meaty\" enough in terms of precedents. To be fair he really does go in depth in terms of his research and likes the Lexis Library platform very much.',NULL,NULL,12,3,NULL,'',NULL,'ICM',NULL,NULL,'','',91,3601,'2011-10-31 17:49:16',3831,'2011-11-01 10:13:10',112,3831,0,'It does not impact them as they have PLC for precedents and practical guideance.','Please do not respond to the client as this is just feedback received. We are in ongoing discussions on other areas of opportunity.','N'),(7661,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Annette Collen/Partner',1,4,NULL,NULL,'Annette is keen to see what the Plot Sales subtopic will cover, especially the precedents',NULL,NULL,49,9,NULL,'',NULL,'Norton Peskett',NULL,NULL,'LexisPSL Property','Alan Riley LPSL',442,68,'2011-10-31 18:25:09',201,'2011-11-10 09:18:11',112,201,0,'Annette is trialling LPSL Property on an informal basis, she used to have access to the Alan Riley LPSL product and this sub has been cancelled by the firm','','N'),(7671,'MARKET','Customer training session',NULL,9000,NULL,NULL,'','Lynne Fulcher/Solicitor',1,4,NULL,NULL,'Lynne is our biggest champion at this firm and is really pleased with LexisPSL PI so far.  She has a sggestion for another calculator which she thinks would be easy to build and a benefit to all PI practitioners.\r\nLynne has suggested we build a working days calculator - so you would select your \'from\' date & then your \'to\' date and it would neatly spit out the number of working days, but it would need to take into account leap years etc, and also there may need to be wither 2 calculators because you would need one calculation for those office workers i.e. people working Mon to Fri 9-5, but a different calculator for retail workers who may also work Saturdays/Sundays?.  And if it could calculate into the future even better, so if you have someone who cannot go back to work for 3 months, you can select the first day they are off & then pick a date 3 months ahead and it would neatly give you the number of working days?',NULL,NULL,44,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Personal Injury','',442,68,'2011-10-31 18:33:37',371,'2011-11-01 09:40:53',112,371,261,'currently Lynne doesn\'t know of a calculator that does this so she has to do it manually or through an excel spreadhseet so there is a gap int eh market for this kind of calculator?','please can we have an answer ASAP for Lynne, or if you want to contact her directly - l-fulcher@nortonpeskett.co.uk','N'),(7681,'COMPETITOR','Customer training session',NULL,NULL,NULL,NULL,'','Joseph Reed/Associate',1,4,NULL,47,'Joseph and the other Partners/Assocaites at Lee Bolton Monier Williams use PLC.  They really like the \'contact the experts\' bit on PLC where you can actually speak to/contact the experts with a question.  When i showed them our meet the experts page they were really deflated as there were nowhere near the volume of profiles on the LPSL page as there are on PLC, it made them question the size of the team behind LPSL',NULL,NULL,59,9,NULL,'',NULL,'Lee Bolton Monier Williams',NULL,NULL,'LexisPSL','',41,68,'2011-10-31 18:38:42',1921,'2011-11-21 13:02:52',22,0,0,'they are trialling LPSL but it has made them question whether they can survive without a PLC sub','can we start addin more expert pprofiles to the LPSL meet the experts site, also make it more obvious who the contributing firms are?','N'),(7691,'CUSTOMER','Customer training session',NULL,2043,NULL,NULL,'','Peter Bishop',1,4,NULL,NULL,'Peter is a really expereiced guy - http://www.burtondyson.com/our-people-peter-bishop.htm - and totally great!\r\n\r\nHe has suggested some letters for LPSL PI, he thought there would have been more draft letters contained in LPSL PI, even though he has a lot of his own draft letters he said it is always good to sense check his against someone else\'s!\r\n\r\nI jotted down what  he said but it was last week and it might be a bit jumbled!\r\n\r\nLetter of claim - letter to defendant with standard letter of claim, def initial letter of claim, part 36 letter to insurers\r\n\r\nI know Peter would be happy to chat, especially as this firm are only trialling LPSL at the moment!\r\n\r\n\r\n\r\n',NULL,NULL,44,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Personal Injury','',111,68,'2011-10-31 18:57:28',371,'2011-11-02 09:48:40',112,371,32,'n/a','Perhaps an email or call to Peter to acknoledge his comments (if you say it was Lynne the Lexis Nexis lady who passed his comments to you he should know!) - \r\n\r\npeter.bishop@burtondyson.com \r\n01427 676225 \r\n','N'),(7701,'PRODUCT','Customer training session',NULL,2043,NULL,NULL,'','Steven Hardy/Partner',1,132,NULL,NULL,'The Annual Return (Companies House) form doesn\'t have a flexi box for the company name, can we make it flexi?',NULL,NULL,10,3,NULL,'',NULL,'',NULL,NULL,'LexisSmart Forms','Laserform',131,68,'2011-10-31 19:00:45',1921,'2011-11-02 17:25:50',72,3831,0,'firm will struggle on and use laserform','can we make the company name box flexi please?','N'),(7711,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Philip Hayden',2,24,NULL,NULL,'Customer\'s have often made comparisons between our support helpline (abbey tax) and CCH. I have often come across that in a direct comparison; Abbey offer better help on VAT however they feel CCH and other helplines are useful because they are put through to a specialist regarding their area of tax. This is different to Abbey in which customers feel is sometimes a lottery in regards to who you get on the phone and they tend to range in responses.',NULL,NULL,53,0,NULL,'',NULL,'Richard place Dobson',NULL,NULL,'Helpline','',111,1411,'2011-10-31 19:23:19',1921,'2011-11-18 17:21:11',92,421,0,'customers tend to perfere our VAT coverage but don\'t feel as confident using our helpline compared to competitors because they are not given confidence knowing it\'s from a specialist of that area.','','N'),(7721,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Sanchia Norris',2,18,NULL,NULL,'Client had a look at a Private Client Webinar. She felt it was extremely boring and did not engage the user. They are going to have a look at one of the General Practice ones and see if that is any different, but she was not terribly impressed.\r\n\r\nThey also have webinars from Matthew Hutton which they say are excellant.',NULL,NULL,53,9,NULL,'',NULL,'Peter Elsworthy & Moore',NULL,NULL,'','Mercia/SWAT',41,891,'2011-10-31 20:08:00',1921,'2011-11-01 09:43:30',3,2752,0,'This client spends alot on in-house training with us and various other suppliers, they decided to book for 25 people to go to a local SWAT course as it was ridiculously cheap.','Possibly let them have a look at the GP one but ask the client how we could improve the viewing experience.','N'),(7731,'COMPETITOR','Other',NULL,NULL,NULL,NULL,'','Roger Downes - Principal',2,20,NULL,55,'After a brief trial of TG, about the product\r\n\r\nIt was quite interesting,but isn\'t worth 2K of investment for a small firm like ours. CCH are offering us interactive manuals online for 540. They may not be quite as good as yours, as they don\'t have direct links to HMRC and the legislation, but it\'s not worth 1400 (more) to me to acquire additional benefits. I\'d need a minimum of 50% discount to think about it.',NULL,NULL,53,6,NULL,'',NULL,'Andorrans',NULL,NULL,'Tolley Guidance','',51,861,'2011-10-31 21:30:35',3322,'2011-11-01 17:25:43',72,3322,0,'They acknowledge the time saving benefits of the product, but perceive they would have to buy all five modules and see cost as prohibitive.\r\n','Need to know more about CCH product and a good set of metrics to prove investment  in our product = value to customer','N'),(7741,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Hugh Mitchell',2,20,NULL,NULL,'The TolleyGuidance modules look very good and I think will be of particular interest to small general practices who do not have the specialists in house.  I was very impressed with the names writing for the VAT Module - I have come across some of them in my professional career.  Not sure I\'ll be using it though as it overlaps to an extent with the services I am offering!\r\n\r\n \r\n\r\n',NULL,NULL,57,6,NULL,'',NULL,'High Path VAT Consultancy',NULL,NULL,'Tolley Guidance','None',442,861,'2011-10-31 21:38:00',3322,'2011-11-01 17:10:57',72,3322,0,'They rely upon heavier research material and specialsist news','Does this product have any relevance to the specialist adviser that is giving advice to other practices','N'),(7751,'PRODUCT','Informal conversation',NULL,NULL,NULL,NULL,'','Rosa Jennings',2,142,NULL,55,'As an AAT Memeber in Practice we have access to a brand new online resource from CCH. The package includes \r\nAccounting Standards\r\nApplying GAAP\r\nPreparing Company Accounts\r\nPractice Management & Prcedures Manual\r\nCompanies Legislation\r\nMoney Laundering Handbook\r\nBritish Master Tax Guide\r\nMaster Tax Examples & Q & A\'s\r\nVAT Planning\r\nPayroll Info Service\r\nLive News\r\n\r\n\r\n\r\n',NULL,NULL,53,4,NULL,'',NULL,'Oak Accountancy Services Ltd',NULL,NULL,'','',31,861,'2011-10-31 22:11:58',421,'2011-11-01 16:47:04',72,421,0,'It\'s a great (free/small cost?) service','Are we talking to the AAT about supplying similar info to their members','N'),(7761,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Craig Martin',2,142,NULL,55,'In-House module needs to take into account at least a basic level of International content',NULL,NULL,61,9,NULL,'',NULL,'Novartis Vaccines & Diagnostics Ltd',NULL,NULL,'','',31,1041,'2011-10-31 22:20:26',1921,'2011-11-01 16:28:58',3,3322,0,'Better equipps them in handing International tax transactions','I have overcome this issue by bundling in our International menu with the In-House content at a negotiated price.','N'),(7771,'PRODUCT','Customer cancellation request',NULL,NULL,NULL,NULL,'','Desmond De Battista',2,142,NULL,55,'Due to varied nature of their International work, these elements would be of benefit:\r\n.- Bullet points/Highlights of new markets\r\n- Written in plain english\r\n- short, sharp and accurate\r\n- modelled on \"doing business in.....\"\r\n- Tax treaties menu does not provide in formation in this manner.',NULL,NULL,59,4,NULL,'',NULL,'Burberry',NULL,NULL,'International Tax','',31,1041,'2011-10-31 22:40:16',1921,'2011-11-02 17:28:50',92,2912,0,'Give s them the ability to process their transactions more quickly and effectively','They have signed up with CCH for the next 3 years (Before I took over the account) but I would hope to  re-engage them on the International side once we have a comparable offering. I am pursuing other opportunities on Tolley Guidance.','N'),(7781,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Steve Ridge',2,142,NULL,NULL,'Simons Menu should offer more on:\r\n- consolidated legislation\r\n- current updates and prospective ammendments\r\n- does not pick up on new market developments quick enough\r\n- needs to incorporate revenue manuals',NULL,NULL,59,2,NULL,'',NULL,'FL Memo',NULL,NULL,'Simons Taxes','',131,1041,'2011-10-31 22:58:25',421,'2011-11-01 16:39:02',3,421,0,'Keeps them more effectively informed when handling their transactions','Revisiting in January 2012 when renewal discussions will take place. Will need specialist support from internal experts to engage the client.','N'),(7791,'PRODUCT','Customer cancellation request',NULL,NULL,NULL,NULL,'','Anne-Marie Chakravarty',2,142,NULL,NULL,'Would want the ablility to bookmark my favourite books.....',NULL,NULL,53,9,NULL,'',NULL,'Novartis',NULL,NULL,'','',341,1041,'2011-10-31 23:04:29',2632,'2011-11-01 15:59:26',92,2632,0,'Saves time when conducting repeated searches','I understand this feature is due to be released?','N'),(7801,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Lisa Murfet',2,1,NULL,NULL,'Yearly increases on price do not justify their fairly minimal use of the resource',NULL,NULL,53,0,NULL,'',NULL,'Mackenzie Dodd Consultants',NULL,NULL,'Taxlink Entry - CD/Print','',431,1041,'2011-10-31 23:17:55',1921,'2011-11-01 10:00:55',72,0,0,'lack of value - could be utilising their budget on more beneficial areas','Resolved - I offered Tolley Library online version of Taxlink Entry - selling benefits of online versus print and more/ updated content','N'),(7811,'PRODUCT','Customer cancellation request',NULL,NULL,NULL,NULL,'','Helen Griffiths',2,142,NULL,NULL,'Customer finds it difficult knowing exactly where they are during navigation - this is with regard to a visible trail of where there are at a particular point during their search',NULL,NULL,53,0,NULL,'',NULL,'Millennium & Copthorne Hotels Plc',NULL,NULL,'','',341,1041,'2011-10-31 23:29:25',1921,'2011-11-01 10:02:22',3,2632,0,'Wastes their time during searches','I was able to offer initial training to help but will also take in a trainer - Discussions taking place to avert cancellation.','N'),(7821,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','David Warrellow',2,142,NULL,NULL,'He is a one man In-house tax team currently but would like a broad enough content base to make him more effective. Has limited budget but would want De voils included as part of In -House Tax essentials package.',NULL,NULL,53,4,NULL,'',NULL,'National Trust',NULL,NULL,'In House Tax Essentials','',351,1041,'2011-10-31 23:47:56',421,'2011-11-01 16:46:28',72,421,0,'Make him more effective as a one man tax department working for a charity','Full In-HouseTax practitioner would be the preferred package but well outside his budget - will new Tax menus incorporate Devoils in the Essentials package? I am also exploring Tolley Guidance with him. This may be be his best option for price vs value.','N'),(7831,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Penny Franklin',2,142,NULL,NULL,'Seraches bring back to many results - 250 is too many. Would like a narrower search function.',NULL,NULL,53,0,NULL,'',NULL,'Talaris',NULL,NULL,'','',341,1041,'2011-10-31 23:58:31',2632,'2011-11-01 16:04:17',92,2632,0,'Wastes their time','Run through a brief training session with them - filtering by topic seems to be the most effective for them. They will use the system more and offer further feedback.','N'),(7841,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Tim Gabbe',2,162,NULL,NULL,'As a general criticism, our Tax conferences seem to cater for the needs of general practice rather than In-House?',NULL,NULL,53,9,NULL,'',NULL,'Veritas',NULL,NULL,'Tolley Conferences','',131,1041,'2011-11-01 00:12:15',1921,'2011-11-14 12:35:49',3,2842,0,'May not cover the relevance required','Candidate for Tax journal conferences - Ongoing.','N'),(7851,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Rod Thomas',2,142,NULL,NULL,'Would like full access to Tax Journal within Sole Tax practitioner sub - ',NULL,NULL,53,0,NULL,'',NULL,'Spring Seafoods',NULL,NULL,'Tax Journal','',91,1041,'2011-11-01 00:25:54',421,'2011-11-01 16:45:18',72,421,0,'Full access would incease the effectiveness of his research','Working out a package to incorporate full Tax journal sub within his budget reach','N'),(7861,'PRODUCT','Informal conversation',NULL,NULL,NULL,NULL,'','Gareth walters',1,1,NULL,NULL,'Client has asked if we can provide direct links through to British Standards from our Trading Standards online system rather than make reference to it? as this may save time for them.',NULL,NULL,29,7,NULL,'',NULL,'monmouthsire council',NULL,NULL,'trading standards','',442,2682,'2011-11-01 10:58:30',3711,'2011-11-03 11:11:27',102,3711,0,'If we had direct links it would save them alot of time.','I would like you guys to just look into whether my request may be possible?','N'),(7871,'PRODUCT','Customer training session',NULL,9008,NULL,NULL,'','Jane Buckley',1,4,NULL,NULL,'[I have separately emailed the question to Clare and Geraldine, just logging the issue on here as well. Clare has already got the ball rolling with reviewing what\'s in the PN - it was barely minutes before she responded to my e-mail which is so helpful and reassuring for me and the client!]\r\n\r\nThe PN\'s in Family PSL for Associated Persons within Domestic Violence as a topic don\'t go into enough detail. \r\nJane feels there are too many clicks to get to the co-habitants definition details in the BFLS page refered to given it\'s a  common area.',NULL,NULL,28,6,NULL,'',NULL,'',NULL,NULL,'Family PSL','Red Book (Jordans)',91,66,'2011-11-01 14:27:47',1921,'2011-11-09 15:33:42',72,1551,0,'Jane showed me how to go straight to the page in the Red Book which she felt was quicker and easier. It all adds time to something that shoudl be quicker she felt.','Extend the detail in the PN in Family PSL. \r\n[already passed details of the BFLS paragraph Jane was excited to see, and wanted to see in PSL!]','N'),(7881,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Stuart Portman (Head of Legal)',1,1,NULL,NULL,'How can I do equivalent to my research where I first went to a Sweet & Maxwell Encyclopaedia, or then tried the index in Halsburys Laws in paper?',NULL,NULL,39,4,NULL,'',NULL,'Walsall MBC',NULL,NULL,'Find a Legal Term','Sweet & Maxwell encyclopaedia\'s',442,66,'2011-11-01 14:42:01',1921,'2011-11-02 09:14:50',3,351,0,'Providing up to date answers and guidance quickly in a fast moving area is absolutely key to this sector right now. ','Step 1 - I showed Stuart the index in Halsburys - which went down very well.\r\nStep 2 - wonderful as Halsburys is, it is not dedicated to Local Authority topics, and not the only book we have covering their concerns. I showed him the \'Find a Legal Term\' field in the \'Quick find\' area of the front page. He loved this as an approach to see key definitions, caselaw and a pointer to the appropriate guidance across our texts. \r\nIn conjunction with other work (such as annotations in legislation), this could be a way to help chip away at Local Authorities dependance on the Sweet & Maxwell Local Authority Encyclopaedia\'s if we ensure we have a comprehensive list of Local Authority oriented Legal terms they can easily search with an index approach.\r\n\r\nWhere there are some great words/phrases on there already for Local Authority - please can this be reviewed (through conversations with key contacts internally and in practice etc) to extend itself with this in mind as it\'s a great way in to relevant support. \r\nThe pressure has never been so high with many having to make the decision of us or Sweets/West so anything we can do to plug the gap would do us great favours at keeping clients now.','N'),(7891,'PRODUCT','Customer training session',NULL,9008,NULL,NULL,'','Natasha Clarke',1,4,NULL,NULL,'Why when I search do you not appear to have a consent order?',NULL,NULL,28,3,NULL,'',NULL,'',NULL,NULL,'PSL Family','',101,66,'2011-11-01 15:59:48',1551,'2011-11-10 09:48:56',92,1551,0,'Apparent absence of such a key document shrivels any faith in the service as being a credible source of information, no matter how good everythign else is.','Claire Sanders kindly showed me we have consent orders on the site, just as Smart versions only. They can be found only by browsing.\r\n\r\nEither we should have a version of the consent orders that are flat as well, or at least allow a search to pick up on their existence. \r\n\r\nI believe there is a move to move every PSL customer to have to have Smart Precedents so it is a standard document type they would expect to see on a search request. ','N'),(7901,'CUSTOMER','Informal conversation',NULL,NULL,NULL,NULL,'','N Armstrong',2,20,NULL,NULL,'The partner of this form used to be part of the AVN network (Tax Club). He finds that automated processes aided by online tools or computer apps deskils his staff. He prefers a work process that involves senior critique. He would rather have staff who make errors but learn from it and \'think\' through the process than ones who follow instructions on screens and dont think too much about the process. \r\n\r\nI must say, this is unusual but I thought it is worth sharing it with the TG team. ',NULL,NULL,53,6,NULL,'',NULL,'Alliotts',NULL,NULL,'Checklists','',161,1211,'2011-11-01 21:51:26',3322,'2011-11-02 17:36:44',72,3322,0,'Slows it down but apparently is better for their learning.','Maybe examples of specific checklists where a simple \'mistake\' could cost them a lot of money.','N'),(7911,'BLANK','0',NULL,NULL,NULL,NULL,'','',0,NULL,NULL,NULL,'Kindly ignore this mail. Test insight to replicate css issue.\r\n',NULL,NULL,0,0,NULL,'',NULL,NULL,NULL,'0',NULL,NULL,0,671,'2011-11-02 13:23:37',801,'2011-11-07 12:01:31',21,NULL,0,'Kindly ignore this mail. Test insight to replicate css issue.','','Y'),(7921,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Sharon Corry',1,4,NULL,NULL,'There is a broken link between PSL and library. During a demo I was in PSL employment, I clicked on equal pay and then the practise notes tab and then on the top practise note equal pay time limits. I scrolled down to the first link where it says \"further reading you will need a lexis library sub Harveys on Industrial relations and employment law Jurisdiction of the employment tribunals paras K 339 -340 -350 . This link is broken as are the 2 extra links below on the same page.',NULL,NULL,24,6,NULL,'',NULL,'First Assist',NULL,NULL,'','',261,3601,'2011-11-02 17:48:21',1861,'2011-11-03 12:53:43',72,1861,0,'n/a','','N'),(7931,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Graham Boddington',2,142,NULL,NULL,'Why when I sort results by date for my search in the general search area for \'bpr\' do the results not appear in date order (a Sep 2011 Tax Journal article is at the top of the list prior to date sort, then disappears when you do date sort).\r\nAlso selecting the tab for Magazines & Journals once date sorted shows a mix of journals and a complete mix of dates. \r\n ',NULL,NULL,53,9,NULL,'',NULL,'Critchleys',NULL,NULL,'Tolley Library','',341,66,'2011-11-02 20:13:46',2632,'2011-11-08 17:54:08',112,2632,0,'Tax law is constantly changing so practitioners need to be confident they are looking at the latest journal articles/documents to give correct advice. ','Have documents sorting by date in the overalal list, and overall by date (not journal by journal in the journal tab).\r\nSorry if this is a repeat of a point, but I wanted to supply an example where it seems to fall down.','N'),(7941,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','PI team ',1,4,NULL,NULL,'When looking at the PI calculator, they thought it would be useful to have a net earnings calculator for self employment people. ',NULL,NULL,44,9,NULL,'',NULL,'P C B Law Shrewsbury',NULL,NULL,'Lexis psl','',131,65,'2011-11-03 10:07:43',371,'2011-11-07 12:52:19',112,371,261,'this would speed up their calculations','we look into developing this calculator','N'),(7951,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Various',1,4,NULL,NULL,'when looking at the gross to net calcultor, they thought it would be useful to have a calculator which did net to gross so if a client comes in and says, my partner takes home approx xK per month, then the gross figure can be calculated (not sure why they need this but thry thought it would be useful)',NULL,NULL,28,9,NULL,'',NULL,'P C B Law Shrewsbury',NULL,NULL,'Lexis PSL Family','',131,65,'2011-11-03 10:10:22',1541,'2011-11-16 14:45:12',72,1541,0,'it would speed up their calculations','we look into derveloping a calculator for this.','N'),(7961,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Various',1,4,NULL,NULL,'When looking at the expert witness dbase for PI (family were in the same session) the family team thought it would be useful to have such a dbase for their work - e.g psychological reports etc.',NULL,NULL,28,9,NULL,'',NULL,'P C B Law shresbury',NULL,NULL,'lexis PSl family','',131,65,'2011-11-03 10:13:15',1541,'2011-11-14 15:54:16',92,1541,0,'it would speed up their workflow','we investigate if anyone produces such a dbase and whether we can subcontract the information as we do in PI with JS publications.','N'),(7971,'PRODUCT','Customer training session',NULL,3414,NULL,NULL,'','Peter Allison',1,132,NULL,NULL,'Could the Form news tab be sorted on practice area rather than date - there is so much info it needs to be sorted for the user to see what is relevant to their own practice',NULL,NULL,59,9,NULL,'',NULL,'',NULL,NULL,'','LaserForm',131,67,'2011-11-03 10:13:38',151,'2011-11-24 10:31:54',92,151,0,'keeping up to date with forms in own PA','using a sort drop down','N'),(7981,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Various - resi property',1,4,NULL,NULL,'When looking at smart precedents for residential property, they thought that it would be useful to have a smart \'contract report\' precedent.',NULL,NULL,49,9,NULL,'',NULL,'P C B Law',NULL,NULL,'Lexis PSL','',131,65,'2011-11-03 10:15:58',201,'2011-11-10 09:15:24',112,201,0,'they thought it would speed up their workflow','we consider whether we shoudl add one of these for resi property','N'),(7991,'PRODUCT','Customer training session',NULL,3414,NULL,NULL,'','',1,1,NULL,47,'Although we now have auto numbering we still do not have cross referencing - so that when a user takes out a clause there is no way of the precedent being updated. PLC does do this already. \"Until you make this available I will only be using PLC precedents\"',NULL,NULL,0,3,NULL,'',NULL,'',NULL,NULL,'','',341,67,'2011-11-03 10:16:48',1921,'2011-11-03 11:59:53',3,151,0,'Manually h ave to check the document - takes time and can make mistakes = risk issue','Cross referencing is an easy function available on Word - can our documents be amended to include this ?','N'),(8001,'BLANK','Customer training session',NULL,3414,NULL,NULL,'','Peter Allison - Partner',0,1,NULL,NULL,'EFP is horrendously out of date - is only good for historic use.  sometimes take months for changes to be amended in it ',NULL,NULL,0,3,NULL,'',NULL,'',NULL,NULL,'','',81,67,'2011-11-03 10:19:00',1921,'2011-11-07 16:54:11',3,4011,0,'dont use it - too \"old style\"','Can EF&P become more reactive and modern','N'),(8011,'PRODUCT','Customer training session',NULL,3414,NULL,NULL,'','',1,1,NULL,50,'Can historical versions be searchable instantly - why do we have to manually ask for the legislation when West can provide it already',NULL,NULL,0,2,NULL,'',NULL,'',NULL,NULL,'','',41,67,'2011-11-03 10:20:34',3711,'2011-11-03 10:58:11',92,3711,0,'We only use West for this service','Include enacted and amended leg as part of the service','N'),(8021,'PRODUCT','Customer training session',NULL,2651,NULL,NULL,'','none specific',1,4,NULL,NULL,'When they click on the \'more tools\' button in lexis psl PI tollkit, they whole box folds up and they can no longer see any of it. they are using IE10 so this could be a browser problem but it needs to be fixed.',NULL,NULL,44,9,NULL,'',NULL,'',NULL,NULL,'Leixs PSL PI','',341,65,'2011-11-03 10:22:03',1921,'2011-11-03 10:52:23',3,59,0,'they can\'t easily access all of the toolkit from the pi homepage','we fix this!','N'),(8031,'PRODUCT','Customer training session',NULL,3414,NULL,NULL,'','',1,132,NULL,NULL,'Can the documents include a check box when you email them with a receipt for the receiver?',NULL,NULL,0,3,NULL,'',NULL,'',NULL,NULL,'','Laserform',131,67,'2011-11-03 10:22:18',3701,'2011-11-03 13:58:25',22,341,0,'Receipts show the form was received and provide a date','possible inclusion of a check box on the PDF when emailing??','N'),(8041,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','',1,24,NULL,NULL,'Throughout the firm this client has huge problems with hotdocs and they are not alone in this as it comes up reasonably often when I\'m training. Hotdocs are not intuitive and very difficult to use and cause customers a lot of wasted time and frustration. Although Lexis Smart is the ideal solution there are still many forms on library (eg in Atkins) that are available in hotdocs only. From a user\'s point of view they can\'t understand why we don\'t have our forms in an easy to use pdf format and I think it detracts hugley from our product. Also Smart is a great product and I can see why we charge extra for smart precedents but I don\'t think we should be charging extra for a pdf form as this is seen as standard technology.',NULL,NULL,0,3,NULL,'',NULL,'Blackhurst Swainson Goodier',NULL,NULL,'Hotdocs','',341,2371,'2011-11-03 11:08:27',3701,'2011-11-03 14:25:56',72,3701,0,'Various people in the firm, secretaries especially have had to have lots of training to be able to use hotdocs and they still find it difficult and time consuming. They are wasting time and getting frustrated trying to use hotdocs and can\'t understand why it has to be so difficult to fill out a form.','Are there any plans to get all forms on library into pdf format and by when? Is it also true that hotdocs is being phased out because I\'ve heard from some people it is and some people say it isn\'t. Will we continue charging extra to use a form in pdf?','N'),(8051,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Karen granger, principle solicitor',1,1,NULL,43,'Client has said that when searching on Lawtel for cases, if a spelling error is made the Lawtel system is much more forgiving as to when searching on our LN LIbrary if a spelling error is made the system will show no results at all, can we make our case search more forgiving should a date error or spelling erro occur?',NULL,NULL,59,1,NULL,'',NULL,'southampton city council',NULL,NULL,'case law','',341,2682,'2011-11-03 11:41:26',3711,'2011-11-15 10:04:26',82,3711,0,'Client says that when this happens she will find the case on google and then input it into our LN library which is a real time waster for her','is there a did you mean or a results drop down list available when searching cases?','N'),(8061,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Karen granger',1,1,NULL,43,'when looking for statutes on LN library the systen alsways asks the user to remove the bracketts, when the bracketts are remove the user never gets any results.',NULL,NULL,59,9,NULL,'',NULL,'southampton city council',NULL,NULL,'Statutes','',341,2682,'2011-11-03 11:44:31',3711,'2011-11-18 15:51:05',82,3711,0,'She will go to our competition to find more information','can we upgrade this element of LN Library?','N'),(8071,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','karen granger',1,1,NULL,43,'when searching the green book online our system never shows the anotations!',NULL,NULL,59,7,NULL,'',NULL,'southampton city council',NULL,NULL,'Civil court practise','',71,2682,'2011-11-03 11:47:28',61,'2011-11-04 11:04:33',92,61,0,'again she will refer to hardcopy for this information which has a time wasting effect','Can we have the anotations of the green book online?','N'),(8081,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Robin Hassan / GC',1,4,NULL,47,'We ran a search for \"Agency Workers Regulation\" in PSL Employment in the general search box\r\nThis only pulled through a couple of results\r\nHowever when we typed in the acronym AWR it pulled through the full list of content that sits within the Starting Employment topic.\r\n\r\nClient would like to know why it pulled for the acronym but not the full text search\r\n',NULL,NULL,24,6,NULL,'',NULL,'BSkYB',NULL,NULL,'Employment','',41,931,'2011-11-03 15:03:21',2321,'2011-11-03 17:19:26',92,2321,0,'Ease of use - client has 106 lawyers all of whom have access to PLC\r\nPSL must demonstrate ease of use and fast, accurate results if we are to be able to pitch against the uncumbent know how provider','','N'),(8091,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Robin Hassan / GC',1,4,NULL,47,'Customer wanted to be able to search across all of PSL and simultaneously Lexis Library.\r\nExample we used was \'contempt of court\'\r\nIf this is typed into the general search box the client would expect to see - \r\nRecent cases relating to this matter\r\nAny changes in legislation or Si\'s \r\nRelevant commentary\r\n\r\n',NULL,NULL,10,6,NULL,'',NULL,'BSKYB',NULL,NULL,'','',41,931,'2011-11-03 15:08:24',1921,'2011-11-03 17:00:27',3,3831,0,'PLC provides updates to the above effect that means the customer has an easy to use overview of a particular matter\r\nIt is usually sufficient information to help them do their jobs','','N'),(8101,'BLANK','Customer training session',NULL,10504,NULL,NULL,'','Edward Johnson',0,4,NULL,47,'Edd asked if we had any stats on how many other firms have PSL as his perception is that around 80% of incoming documents he deals with are of PLC origin. This would help their partner level discussions as they would like to ideally ditch us or PLC, and are feeling a little like they \'backed the wrong horse\'. He felt having the same supplier as the document coming to you from another firm was beneficial because you would be familiar with the layout and could easily check your access to compare it to an original document to see where they adjusted it. It wasn\'t necessarily that he expected all other firms to be using PSL, but if Roythornes thought lots of other firms at least had access to PSL it would help with their confidence in us.',NULL,NULL,49,3,NULL,'',NULL,'',NULL,NULL,'PSL Property','',0,66,'2011-11-04 12:32:24',1921,'2011-11-07 16:56:18',3,201,0,'They want to use documents that are going to be easy to use, efficient and recognised by other firms. A lot of time is wasted potentially.','Give Edd at Roythornes an idea of how many firms have access to PSL to help reduce concerns and protect us from being cancelled. \r\nUse this insight to help realise the actual perception of PSL precedents out there and what we are upagainst with PLC\'s standard document approach.\r\nI believe this ties in with insights logged by David Smith and Lynne Davies among others around the perception that PLC are \'standard\' document providers.\r\nIn forwarding these points to the account manager (Dom WIlson) she was very concerned to hear this, but equally not surprised as many other firms in her experience say the same thing...','N'),(8111,'PRODUCT','Customer training session',NULL,1500,NULL,NULL,'','',1,4,NULL,NULL,'They were unable to find information on wardship proceedings, specifically a precedent for originating summons in wardship. They were also unable to find a witness summons. They said maybe it\'s too specific to be on PSL but were unable to find them in library either.',NULL,NULL,28,0,NULL,'',NULL,'',NULL,NULL,'','',101,2371,'2011-11-04 13:54:48',1921,'2011-11-15 10:47:08',72,1541,0,'They had to go to the court and the court sent them the form.','','N'),(8121,'BLANK','Customer training session',NULL,1500,NULL,NULL,'','',0,1,NULL,NULL,'Is it possible to open the family procedure rules and the practice directions side by side? They need to be read together and if the practice directions could be added in a similar way to Halsbury\'s annotations that would be really useful.',NULL,NULL,28,2,NULL,'',NULL,'',NULL,NULL,'','',261,2371,'2011-11-04 14:06:10',1921,'2011-11-22 15:57:33',92,1551,0,'It would save time as they have to open the family procedure rules and then open the practice directions separately, find the relevant ones and then go between windows to read both.','','N'),(8131,'BLANK','Customer training session',NULL,NULL,NULL,NULL,NULL,'Lisa Marie-Smith',NULL,1,NULL,NULL,'During a session we came across the case of \"The Serious Organised Crime Agency v Agidi & ANR\" from 2011 and the customers asked why there wasn\'t a catchwords summary under the document when it is a judgment. It seemed as though there were other judgments which had catchwords summaries so I mentioned I would flag it as an issue.',NULL,NULL,21,1,NULL,NULL,NULL,'West Midlands Police',NULL,NULL,NULL,'Westlaw and Lawtel',0,3991,'2011-11-07 11:15:25',NULL,NULL,NULL,NULL,NULL,'They search for Case Law on a regular basis and mentioned that it would be really helpful for them to see the catchwords summary as it will cut down the amount of time they need to spend doing research. They additionally mentioned that Westlaw and Lawtel do it and they are used to seeing the catchwords on their websites.','I am unsure of the process when adding catchwords summaries to judgments; whether it is possible to do it before the judgment goes online/whether it gets added at a later date/whether it gets updated regularly etc. So, was unsure whether catchwords were in the process of being added or could be added. Certainly the customer thought they would be very helpful.','N'),(8141,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Lisa-Marie Smith',1,4,NULL,NULL,'The customers were very impressed with LexisPSL and the Employment module as a whole. Whilst taking them through the training we came across the module of \"The right to be accompanied\" which was a subject that often arose in their organisation. The customers were aware of a case that bucked the usual rule that legal representation was not permitted at a grievance meeting but were unable to find it in the Library/PSL. \r\n\r\nWe advised that the PSL module was not trying to be too in depth but it was suggested that a brief sentence might be added to the practice notes under this module simply stating that there in limited scenarios legal representation might be permitted with a link to the relevant case.\r\n\r\n',NULL,NULL,24,6,NULL,'',NULL,'West Midlands Police',NULL,NULL,'','',131,3991,'2011-11-07 11:26:35',2321,'2011-11-08 11:28:47',3,2321,0,'The customers were certain that this particular point of law would arise on a number of ocassions within their organisation and that it would be very helpful to be able to refer to this case quickly through the PSL module.','','N'),(8151,'PRODUCT','Customer training session',NULL,10504,NULL,NULL,'','',1,4,NULL,47,'Whilst on the front page of the PSL Property Module we searched for \"Stamp Duty Land Tax\" and were faced with a significantly lower number of results than anticipated. Between the customers and ourselves (myself and Gavin Allan) we realised that the product does not search for SDLT intuitively when a search was run for \"Stamp Duty Land Tax\" and vice versa. There is a obviously a great wealth of content on this subject area but due to the way it has been put in the system some content is being missed.\r\n\r\nIt would be helpful when running a search for a subject like this for it to look for common synonyms and abbreviations.',NULL,NULL,49,6,NULL,'',NULL,'',NULL,NULL,'','',281,3991,'2011-11-07 11:35:18',1921,'2011-11-09 16:13:31',72,59,0,'It becomes difficult to use PSL as well as they would like. It means that they have to run two searches or remember to search for the abbreviation. The likely response is that they would rely on PLC instead.','The content has been added under both \"Stamp Duty Land Tax\" and \"SDLT\", it might be worth changing the content so it is consistently referred to by one name or add the intuitive functionality when running a search.','N'),(8161,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Ken Ledran',1,1,NULL,50,'We did a search on \'Lap Dancing (!)\' on legislation to see where we ended up after recent changes. It took us straight to Police and Crime Act 2009 when it should have taken us to Local Government Act 1982 (Miscellaneous provisions). I am told that the 2009 act amended it in some way but apparently it should have taken us straight to the 1982 act and mention 2009 amendments. Does this make sense? If so, are we right or is Ken looking at it from his perspective? ',NULL,NULL,39,2,NULL,'',NULL,'Bedford Borough Council',NULL,NULL,'LexisLibrary','',131,1351,'2011-11-07 14:12:34',1921,'2011-11-15 10:41:18',72,3711,0,'They just want to be confident in using the product and how up to date it is for the obvious de-risk reasons ','','N'),(8171,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Brian Elvidge/ Tax Manager',2,162,NULL,57,'Smailes Goldie are members of the UK200 Group and the UK 200 Group use Mercia exclusively to do all their members CPD requirements and training\r\n\r\nThis means we are locked out from selling any training products to UK 200 group members as its all included as part of their membership\r\n\r\n',NULL,NULL,53,12,NULL,'',NULL,'Smailes Goldie',NULL,NULL,'TSO/ Venue Seminars','',31,1151,'2011-11-07 17:59:52',421,'2011-11-09 10:05:03',92,421,0,'Are completely tied to UK 200 Group as training provided as part of their mebership','Who can we get access to UK 200 Group and pitch for their training contract?','N'),(8181,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Lindsay Sherman - Sole',2,162,NULL,NULL,'Qudos are marketing a new online reference library aimed and small GP Tax firms',NULL,NULL,53,4,NULL,'',NULL,'Lindsay Sherman',NULL,NULL,'Online','Qudos',51,1151,'2011-11-07 18:47:20',421,'2011-11-09 10:11:57',3,421,0,'Cost effective  and is a possible  alternative to Tolley Guidance','Investigation and competitive analysis of their offering compared to ours','N'),(8191,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Kate Naylor',2,142,NULL,55,'That CCH online significantly improved in pasat 2 years in terms of content depth and online functionallity\r\n\r\nThey especially liked the online index whick is much larger then ours and give immediate access to all areas of that particular publication and you can open it up on larger screen',NULL,NULL,53,4,NULL,'',NULL,'Sagars',NULL,NULL,'CCH Online','',41,1151,'2011-11-07 18:50:33',421,'2011-11-09 10:13:26',82,421,-1,'Ease of use of online service','identify where we have a CCH subscription and investigate to see if its something we would replicate','N'),(8201,'PRODUCT','Customer training session',NULL,7184,NULL,NULL,'','Anne Elliott/Partner',1,4,NULL,NULL,'Anne likes the concept of LexisPSL and LexisSmart Precedents.  \r\nShe was disappointed that there were no checklists appearing within LPSL Private Client as she feels these are really useful & prove a good sense check when preparing/conducting client interviews/meetings.\r\nAnne commented that she feels that in order to make the most of the LexisSmart Precedents - that every smart precedent should have a corresponding checklist.  Her idea was the checklist could be printed off & used during the client interview to ensure all information was gathered, she would then pass the checklist to her secretary, her secretary would go into the LexisSmart Precedent and enter all information.  Anne is of the opinion this would speed up drafting time further and aid the adoption of the LexisSmart concept as a way of drafting precedents.',NULL,NULL,56,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Private Client','',111,68,'2011-11-07 20:44:22',2622,'2011-11-08 13:15:38',112,2622,0,'Anne & the team use their own checklists but feel it is always vital ot have an updated resource with which to cross check their own checklists or use our checklists instead of theirs','Anne would like to know if there are any example checklists currently within LPSL Private Client, or what the plans are to draft some and add them to the product, timescales would be useful as Anne is in the process of revirewing the departments precedent bank.','N'),(8211,'PRODUCT','Customer training session',NULL,7184,NULL,NULL,'','Anne Elliott/Partner',1,4,NULL,NULL,'Anne and the team had expected there to be more obvious \'tax\' Topics within LPSL, for example - IHT, CGT & Income Tax.',NULL,NULL,56,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Private Client','',101,68,'2011-11-07 20:52:16',2622,'2011-11-08 13:18:21',112,2622,0,'They have resources spread across firm (either books, a LexisLibrary sub) but it would be useful to have much more of their information in one place.','Can we share the roadmap for LPSL Private Client with htem please?  So, they are keen to know what \'tax\' content will be added & when, and also any other developments contnet wise that are coming?  I am happy to pass information on or Anne\'s email is - aee@latimerhinks.co.uk','N'),(8221,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Tax Partner',2,162,NULL,57,'Mercia now aquired CCH\'s venue seminars so gives them great geographical coverage and also put them in direct competition with our Tax CPD venues however they have the advantage of having more venues than we do and a great breadth of seminars\r\n\r\nThey offer accounts the ability to go on a customer panel and allow them to choose the course topics for the forthcoming year\r\n',NULL,NULL,53,5,NULL,'',NULL,'Myersons',NULL,NULL,'CPD Seminars','',61,1151,'2011-11-08 10:18:14',1921,'2011-11-08 11:43:56',3,421,0,'This is very popular and clients like this consultative approach so are very loyal to Mercia so do nt use us foe trainig priducts/servies','need to get a better picture of Mercia\'s full range of courses and venues and build a roadmap of what we are going to do to prevent them taking business from us ','N'),(8231,'COMPETITOR','Other',NULL,NULL,NULL,NULL,'','',2,162,NULL,34,'BPP strongly advertising their CPD on Faceboook\r\n\r\nIt appears everytime I use Facebook \r\nTop Up Your Legal CPD\r\nbpp.com\r\n',NULL,NULL,0,5,NULL,'',NULL,'',NULL,NULL,'Seminars CPD','',41,1151,'2011-11-08 10:29:27',421,'2011-11-08 16:44:51',72,421,0,'Creates strong awareness from a new social networking angle - why can we do this','Possible new marketing campaign','N'),(8241,'PRODUCT','Customer training session',NULL,3985,NULL,NULL,'','Martin Legg/Partner',1,4,NULL,NULL,'Suggestion for tool box in this module - office of public guardian fees',NULL,NULL,56,9,NULL,'',NULL,'',NULL,NULL,'LexisPSL Private Client','',131,68,'2011-11-08 19:48:10',2622,'2011-11-09 12:24:28',112,2622,0,'n/a','is a tool box being added to this module?  Please could you let me know?\r\n\r\nThanks','N'),(8251,'PRODUCT','Customer/product advisory board',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'PSL User Group Feedback session\r\n2nd December 2011\r\nNestle:  Lindsay Hunter(Competition and Commercial)  and Thorsten Gailing (IP)\r\nLN: Sophie Gould and Will Long\r\n\r\nGeneral feedback session on how they found PSL.\r\n\r\nThorsten:\r\nLayout - easy to follow\r\nContent - he liked fact we had cease and desist letters and letters for reply - not many other providers had replies.\r\nDoesn\'t like limit on printing out from Library - its not 500 pages, but 500 chunks which can mean you are quite limited in what you can print out.  SG to pass comment on to developers. \r\nUpdates - eg  Interflora Case - news update was ok but he wanted to know So What - what are implications.  Eg is it bad for brand owners, what is conclusion of case.\r\nDealings with TM in OV or PN - links to cases/legislation are out of date.  SG to pass on to relevant PA.\r\nCases tab - is there a traffic light system saying eg it has been overruled?\r\nLegislation - eg Olympic legislation - do we have anything that says it is in force for a particular section.\r\nWould like limits on what you can cover eg if you say \"everything we give you is confidential\" - is that valid?\r\nLindsay\r\nExecution formalities - often looks this up on PLC.  Needs something useable/ can copy and paste\r\nRecent searches:  Signing Deeds - no hits\r\nDeed of Execution - no hits\r\nExecution - did get a hot\r\nCompetition - missed \"I\" - no hits.  PLC - did you mean.\r\nBribery OV - printed copy was very basis - no formatting, didn\'t look nice.  Thorsten agreed re printed versions.\r\nSG - also make sure it has our name on it when printed out!\r\nLikes text and RH links but why is it all scrunched up in middle of screen with lots of white space either side?\r\nIn-house \"We aren\'t bookish - that\'s why we got away from private practice because we don\'t want to read reams of text.  We want bullet points, short concise, readable.\r\nBribery content - ours is better than PLC - but still needs commentary part eg what are others thinking about it.\r\nHer job:  60% commercial, 40% competition.  PSL commercial covers her needs.\r\nCompetition - happy to talk to Bal re roadmap.\r\n\"PSL really moved on since start of trail - she has noticed improvements\"\r\nAsk the team on PLC - she really likes this.\r\nEG email format - automatically pulls up details of where you are in product without you having to find this info.  Auto response saying got your query.  \r\nEG this article says this but I think it has changed in Ireland - is that right.\r\nEG Trainee tried to look up difference between warranties and guarantee provisions - she used Ask the team for clarification.  Got reply within 24/36 hours.  Reply x-ref a couple of articles and a few paras of own - with caveat it wasn\'t legal advice etc.\r\nEG Can\'t find a service which covers this - directs them to most relevant agreement.\r\nVery responsive - really likes it.\r\nHappy to speak to one of our developers about it.\r\nPLC don\'t have flowcharts/checklists/decision trees - eg going two ways - what\'s it being used for - this would be very useful.\r\nEg DP - what has been leaked out?  Follow flow chart through to answer - yes or no re reporting to Commissioner.\r\nTo do - when get new content on Confidentiality content from Wragges - send to Lindsay and Thorsten for review.\r\n\r\n\r\n',NULL,NULL,61,6,NULL,'',NULL,'Nestle',NULL,NULL,'','',452,591,'2011-11-09 08:02:27',591,'2011-11-09 12:57:28',92,591,0,'eg if they can\'t find relevant content quickly on PSL they will look elsewhere.  ','Will follow up on various action points. eg passed on details to other PSL areas for feedback on roadmaps.','N'),(8261,'PRODUCT','Renewal or new business conversation',NULL,11998,NULL,NULL,'','James Herbert / Library Partner',1,18,NULL,NULL,'The client has had access to the DR, PI, Private Client Tax and Commercial Property webinar series over the past year.  They have a number of issues across the board which means they will not be renewing this year:\r\n1.  They find that a lot of the webinars are aimed at juniors.  There is no grading / rating system to indicate which level the webinars are aimed at, so senior lawyers can often waste their time viewing basic webinars.\r\n2.  The PI webinar broadcast on 3rd Nov was poorly presented and the content was poor.  \r\n3.  Often the lawyers watching think they could do a better job than the people we have recruited, as the speakers are either not engaging or the speakers are not specialists on that subject.\r\n',NULL,NULL,0,9,NULL,'',NULL,'',NULL,NULL,'','',81,7,'2011-11-09 11:04:12',1921,'2011-11-09 11:22:09',3,2752,0,'As a result they find that the hour they are spending on the webinars is not time well spent.  They don\'t see CPD as a tick box exercise.  They want to learn something new.','We need to put a rating system against each webinar to identify clearly who this is aimed at.  Also some information about how we recruit speakers would be useful, so i can discuss with clients.','N'),(8271,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Housing Lawyer',1,4,NULL,NULL,'Customer said that the Housing section of the PSL Local Government is not in enough depth, found some things on the property one but generally, needs more content ',NULL,NULL,39,6,NULL,'',NULL,'Staffordshire Moorlands and High Peak Council\'s',NULL,NULL,'Local Government','',91,1351,'2011-11-10 09:15:56',351,'2011-11-10 09:38:57',72,351,0,'The housing team would value practical guidance to follow in this area and said the content here is available on google and doesnt particularly show expertise in this area','','N'),(8281,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','family team',1,4,NULL,NULL,'When looking at the tool kit, they thought having a legal aid eligability calculator would be useful in the toolkit.\r\n\r\nthey appreciate there\'s one on the lsc website (and there is a link to that site within the toolkit) but think having either a DIRECT link to the eligability calculator or a calculator itself within the toolkit would be useful.\r\n\r\n',NULL,NULL,28,9,NULL,'',NULL,'JCP Solicitors ',NULL,NULL,'lexis psl family','',131,65,'2011-11-10 11:41:45',1541,'2011-11-14 15:50:21',72,1541,0,'having such things in one plaace would save them time and mean they were more likely to use our site.','the direct url for the eligability calc on the lsc is:\r\n\r\nhttp://www.legalservices.gov.uk/civil/guidance/eligibility_calculator.asp\r\n\r\nperhaps we need to provide a link to this direct ly from the home page toolbox?','N'),(8291,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Chris Shaw',1,0,NULL,NULL,'please assign this insight to both Clare Duggan and Dan Wright - applies to both lexis psl and lexis library search functionality.\r\n\r\nthis is a follow up to an insight I logged previously No: 2461 as i saw the same client this week.\r\nI involves this issues that if you title search (in this case for a precedent), that the order of words is crucial as our word wheels only allow a partial word-match for the last word entered.\r\n\r\nthe example on the previous insight (which has now been closed but he raised again this week) was:\r\n\r\nChris had been searching for a deed severing a joint tenancy (particularly the one he knew exists in BWPAS (and it\'s now in psl too). He had entered into lexis library in various boxes \'sever joint tenancy\', had tried connectors and other arrangements but could not find it.\r\nhe went back to the old CD BOS for BWPAS and entered the same search and found it straight away. He was rather dismayed that the older CD search seemed much more user-friendly.\r\n\r\n\r\nOn PSL or library you have to enter \'joint tenancy sever\' to make the word wheel find the precedent. entering \'sever joint tenancy\' doesn\'t work as the exact word \'sever\' is not in the title - it\'s \'severing\'. Our ww\'s only cope with a partial word match if the word is entered last.\r\n\r\nThe previous insight I logged on this had no resolution and the response was that none of the proposed developments on library / psl would deal with this.\r\n\r\nAlso, \r\ntThe client couldn\'t quite understand why if they enter \'joint tenancy sever\' (and so they see results in the ww on both psl and library), if they then choose not to click on the ww entry but instead click on \'find\' (or search on psl), they will get 0 results. I have seen countless clients do this - enter words see the ww list but then still click \'find\'.\r\n\r\n',NULL,NULL,0,0,NULL,'',NULL,'JCP Solicitors',NULL,'0','Lexis Library & PSL ','',281,65,'2011-11-10 13:47:36',1921,'2011-11-10 16:47:59',3,59,0,'it makes it harder to find documents in our services.','Is there any way we can analyse what the old BOS cd algorithm used to do and see if we can use any of the functionality in our newer products?\r\n\r\nalso, I believe what we need to do is make the \'find\' button for title searches do whatever\'s happening to make the ww list appear - so clicking find won\'t reject a phrase like the above - but will work with it and find a best fit in the title of a document and return results. Wil our new free text psl search help with this?','N'),(8301,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Leslee Griffiths / Practice Mngr',1,4,NULL,NULL,'Hi Phil\r\n\r\nSorry for the delay in coming back to you on this, I have been rather busy with the Iken implementation.  \r\n\r\nFirst thoughts on this are that it is a good idea, I particularly like the policy documents and templates which could save a lot of time in terms of updating office manuals etc and presumably the templates can be dropped into any case management system.   My gut feeling is however that given the pressures on local authorities to make efficiencies  many would be unlikely to want to pay for this and I guess a lot would depend on cost (as ever).\r\n\r\nFor Local Authorities as well many aspects of the Handbook are not relevant such as AML, referrals etc and so there would again be a reduced need for that part of the service.  Modular components would be good, so that organisations could pick and choose what they needed and pay accordingly, my feeling is that this might generate more custom from Local Authority clients.\r\n\r\nHope that helps but give me  a call if you wish to discuss anything and again sorry for the delay.\r\n\r\n',NULL,NULL,39,6,NULL,'',NULL,'Staffordshire County Council',NULL,NULL,'Practice Compliance','',452,1351,'2011-11-10 14:27:33',351,'2011-11-24 14:03:26',22,351,0,'They are Lexcel but thought this would be useful feedback for the team. An additional cost in Local Government at the moment is difficult. If it could be explained to me why they should take it that would be great given the cost involved....','','N'),(8311,'PRODUCT','Customer training session',NULL,1869,NULL,NULL,'','Ruth Springer',1,1,NULL,NULL,'A comment from Ruth -she would never have thought that the grey title \"Lexis Library\" on then top right hand corner was also a link back to the home page/start page again. She said it needs to be be more \"obvious\". I said it was in line with  most other internet sites in that the name tended to be a link back to the start. I also pointed out that rthe \"Start Page\" link had thye same function if she would prefer to use that instead.',NULL,NULL,0,9,NULL,'',NULL,'',NULL,NULL,'','',341,75,'2011-11-10 18:29:05',1921,'2011-11-15 10:33:21',72,3711,0,'Not knowing how to go back to the start quickly and easily  wastes their time.','Worth keeping in mind for any future projects that are investigating making navigation through Lexis Library simpler. ','N'),(8321,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Olliver Broomhall',2,142,NULL,NULL,'Please assign to Dan Arrowsmith\r\n\r\nThe firm turner peachey generally love Tolley library but have a couple of gripes about functionality, some of which used to be available on library.\r\n\r\n1) They miss the ability to search just specific parts of a work - e.g HMRC manuals. The default search only allows searching over a complete source. For a source such as HMRC, this makes it difficult to direct the search at the right part of it. this used to be possible on lexis library and they miss it on tolley library.\r\n\r\n2) When they load multiple documents into the my documents area, either because they have chosen to \'add to my docs\' after \'viewing whole of\' or just because they have added individual multiple docs in the storage area, when they then print the docs, it starts each doc on a new page which wastes loads of paper.\r\n\r\nthey would like there to be a tick box option to \'start each doc on a new page (or not). \r\n\r\n3) they really like the index of simons taxes and don\'t understand why we don\'t add in the indexes of all of the other works e.g tolley guides. this is something users often request on both lexis and tolley library.',NULL,NULL,53,0,NULL,'',NULL,'Turner peachey',NULL,NULL,'','',462,65,'2011-11-11 09:30:06',101,'2011-11-22 09:01:34',112,2632,0,'all of the above would increase their adoption of tolley library and speed up their workflows.','','N'),(8331,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Oliver broomhall',2,142,NULL,NULL,'please assign this insight to Dan Arrowsmith\r\n\r\nBasically although they like tolley library, they still buy the red book from CCH because of the way the legislation is structured and how much easier it is to use than the yellow tax handbook\r\n\r\nThis is actually an issue for both the online and hard copy versions of YTH (or so ollie thinks) so might need to be fed through to editorial too.\r\n\r\nBasically the red book breaks the legisaltion down not only into parts but also within the parts into Chapters. Ollie couldn\'t remember (and I don\'t know) if our hard copy YTH does this - the online certainly doesn\'t.\r\n\r\nWhat this means is that if he wants to load in to tolley library doc view a bit of an act which deals with a particular topic, he has to load in the whole PART. The red tax handook breaks the part into chapters by sub topic meaning it\'s far easier to navigate.\r\n\r\neg: ITEPA 2003, part 2 is Employment income, charge to tax.\r\n\r\nour YTH then just lists all the sections under that part heading (of which there are many), the red book breaks the part into smaller \'Chapters\'\r\ne.g Chapter 1 - Introduction s3 - s5\r\nchapter 2 Tax on employment Income - s6-s8\r\nchapter 3 operation of tax charge - s9-s13\r\n\r\nOllie only buys the red book from cch because of this structure and wil continue to do so unless out YTH online changes.',NULL,NULL,53,2,NULL,'',NULL,'turner peachey',NULL,NULL,'Yellow tax handbook ','red tax handbook (CCH)',31,65,'2011-11-11 13:50:01',2892,'2011-11-11 14:34:52',92,2632,0,'they contiune to buy the red book','we look at the structure of yth and compare to the red book.','N'),(8341,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','katy shorten ',2,162,NULL,52,'2020 have been a preferred supplier for venue seminars to Taxassist for the past year, and have informed them that they will be no longer delivering a face to face seminar solution in 2012, and that all of their CPD will be delivered by webinar instead (effectively a forced migration).  I have validated this via the 2020 website, where all CPD is being delivered online for 2012.',NULL,NULL,53,9,NULL,'1321261399.pdf','2020_Webinar_Programme.pdf','taxassist',NULL,NULL,'tolley seminars','',71,1221,'2011-11-14 09:07:15',1221,'2011-11-17 09:17:19',72,421,0,'This has limited impact to the taxasssist network as there were only a few takers in 2011 to the programme (they already provide tax tv to thier members).  it does however present a reasonable opportunity to LN to position themselves in this space with the franchise and entice members to our programme.','i have agreement to run an un-supported campaign to the franchisees (they feel there will be limited uptake). i would reccomend we do this using a geo-centric model to the members, playing to the strength of  our national coverage, with a tele follow-up with members discount.  there is limited cannibalisation risk (only 1 customer already on our books) vs 240 franchise offices.\r\n\r\nI have attached the 2020 2012 webinar programme for reference','N'),(8351,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Andy Lamb',1,4,NULL,47,'Peninsula are an Employment call line and outsourced HR function for businesses.  When they are called, they need to provide fast, accurate information to the caller.  One area they felt the service could be improved on would be on case summaries, specifically in search results.  Ideally to look like a Daniel Barnett summary.\r\n\r\nThis would help them quickly see outcomes of cases and better hone in on relevant content for the caller quickly.  ',NULL,NULL,24,1,NULL,'',NULL,'Peninsula Business Services',NULL,NULL,'LEXISPSL EMPLOYMENT(APSL02)','',442,1361,'2011-11-14 16:03:38',1921,'2011-11-18 13:55:05',72,2321,0,'If we had this, it would man faster response times, more accurate and the ability to better service client needs.','','N'),(8361,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Richard Lupson-Darnell/ Tax Manager',2,142,NULL,55,' I have been sent this breakdown of costs for a CCH library from a 6 Partner practice in Cheltenham.\r\n\r\n \r\n\r\nThought you might like to see it.\r\n\r\n \r\n\r\nCCH Tax Investigations Reporter\r\n\r\nCCH British International Tax Agreements\r\n\r\nCCH British NIC Guide \r\n\r\nCCH Corporate Practice Service\r\n\r\nCCH British Tax Library\r\n\r\nCCH British VAT Library\r\n\r\nCapital Allownces\r\n\r\nP11D Handbook\r\n\r\nEngagement Letter Toolkit\r\n\r\nPractical Audit and Accounts Programmes\r\n\r\nAccounting Standards\r\n\r\nDPB Procedures Manual\r\n\r\nTax Digest\r\n\r\nApplying GAAP\r\n\r\nAuditing Standards\r\n\r\nChariities: IAAG\r\n\r\nSolicitors IAAG\r\n\r\nCCH TaxCall Advice Line 120 minutes\r\n\r\nPension Schemes: IAAG\r\n\r\nCompoanies Legislation\r\n\r\nCompany Secretary\'s Factbook\r\n\r\n \r\n\r\nThe renewal price on the above is 3,406.45 (ex VAT)\r\n\r\n \r\n\r\nThey also subscribe for the CCH International Tax Series for which the renewal price is 931.97 (ex VAT)\r\n\r\n',NULL,NULL,53,9,NULL,'',NULL,'Davies Mayers',NULL,NULL,'TOLM04','',51,861,'2011-11-15 09:00:06',421,'2011-11-17 14:31:10',72,421,0,'They are looking for a competitively priced alternative','','N'),(8371,'COMPETITOR','Informal conversation',NULL,NULL,NULL,NULL,'','Andrew Worthington /Partner',2,24,NULL,NULL,'Practice Growth will no longer be producing their annual Tax fact Cards and Budget Commentary, so there\'s  of a gap in the market for anyone who can - you can? that\'s brilliant send us a quote for 350 copies!',NULL,NULL,53,9,NULL,'',NULL,'Gardner Brown',NULL,NULL,'Tax Fact Cards','Practice Growth',51,861,'2011-11-15 09:07:09',421,'2011-11-17 14:33:00',72,421,0,'They need a new supplier','I\'ll send them a quote and ask the question at future visits.. who supplys you with....','N'),(8381,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','David Stevanovic, head of indirect tax',2,142,NULL,NULL,'quote from client in e-mail to previous AM:\r\n\'\'Something I asked Juliette to look into and I wonder if anything is being done to enhance this part of service. \r\nI attach a copy of the alert I received on Friday.  It contains a long list of decisions but neither it nor the \"view results online\" link show an abstract of the case (or article).  Could an additional \"abstract\" column be added to the alert as this would make life much easier to sift for the stuff most relevant to me.  Note - The abstract used to feature under the old alert format.\r\n<<Tolley(R) Library Alert: Expanded Lexis>> \r\nKind regards \r\nDavid Stevanovic \r\nHead of Indirect Tax \r\nRBS Gogarburn, Edinburgh \r\nEH12 1HQ \r\nTel Int 2626 3142 \r\nTel Ext  0131 626 3142 \'\'\r\n',NULL,NULL,53,4,NULL,'',NULL,'RBS',NULL,NULL,'Tolley Library','',301,1301,'2011-11-16 07:18:20',1921,'2011-11-18 10:34:12',92,2632,0,'this clrearly impacts on time spent by the client in reading through his alerts - he is currenttly having to spend too much time trying to understand which articles are relevant.','could this option be replicated as per the LexisLibrary service?','N'),(8391,'PRODUCT','Renewal or new business conversation',NULL,2213,NULL,NULL,'','Tracy Giles / Solicitor',1,4,NULL,NULL,'The customer liked the layout and functionality of the service and generally speaking found the content useful.  However, they felt it lacked depth of content in certain areas, specifically in relation to alternative structures for the delivery of Council Services, Local Authority Trading Companies etc  and also some information in relation to Social Enterprises.',NULL,NULL,39,6,NULL,'',NULL,'',NULL,NULL,'','',91,7,'2011-11-16 11:27:44',351,'2011-11-24 12:50:31',82,351,301,'It means it\'s not a 1-stop shop for their requirements and they would still have to look elsewhere for information on these topcis, which devalues the product slightly','Are we planning on adding this content into the service.  If so, is there a timescale in place?  If not, could you let me know why so i can go back to the client.','N'),(8401,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Elaine Varty/Librarian',1,1,NULL,NULL,'One of the lawyers at DWP has to look up devolved legislation quite often, including Northern Ireland legislation. LexisLibrary does not have this content. His only alternative is to use legislation.gov.uk, but its updating is pretty poor in comparison to LexisLibrary.',NULL,NULL,0,2,NULL,'',NULL,'Department for Work and Pensions',NULL,NULL,'','',101,1881,'2011-11-16 13:35:33',3711,'2011-11-18 14:10:55',92,3711,0,'They have difficulty getting hold of the current devolved legislation online','Ideally, for LexisLibrary to add consolidated Northern Irish devolved legislation to LexisLibrary. I have had this request before, around a year go, from a large law firm, so I imagine there are quite a few customers out there who would find it of use.','N'),(8411,'PRODUCT','Informal conversation',NULL,1977,NULL,NULL,'','Christine Walker',1,1,NULL,NULL,'Sent e-mail direct as below about absence of BPIR now to LNG UK Cases Database but logging here as well.\r\n\r\n\r\n\r\nFrom: Allan, Gavin (LNG-HBE) \r\nSent: 16 November 2011 13:49\r\nTo: LNG-UK Cases Database HH\r\nCc: Cottle, Suzanne (LNG-HBE)\r\nSubject: FW: Help - BPIR coverage\r\n\r\nHi There\r\n\r\nI\'ve had a query below re the BPIR that we recently lost as they were part of the Jordans content we could put on our site till recently.\r\n\r\nDo we have equivalents in any of our case series - ie All England?\r\n\r\nAppreciate your help.\r\n\r\nCheers,\r\nGavin\r\n\r\nFrom: Christine Walker [mailto:Christine.Walker@buckles-law.co.uk] \r\nSent: 16 November 2011 13:32\r\nTo: Allan, Gavin (LNG-HBE)\r\nSubject: Help\r\n\r\nHi Gavin\r\n\r\nHope you are well.\r\n\r\nWe seem not to be able to access BPIR (bankruptcy reports) which I have done previously - who do I need to talk to about this?\r\n\r\nThanks\r\nC\r\n\r\n\r\nChristine Walker\r\nHR Director\r\nBuckles Solicitors LLP\r\nPhone: +44 (0)1733 888728\r\nFax: +44(0) 1733 888930\r\nwww.buckles-law.co.uk\r\n\r\nAwarded Law Firm of the Year 2011 by LawNet, an exclusive association of 68 law firms across the UK and Ireland\r\n\r\nFor your convenience our Peterborough Office is now open until 8:30pm on Wednesdays & Thursdays and from 9:30am to 3:30pm on Saturdays\r\n\r\nPlease consider the environment - do you really need to print this email?\r\n \r\n\r\n\r\n================================================================\r\nBuckles Solicitors LLP\r\nGrant House, 101 Bourges Boulevard, Peterborough PE1 1NG. tel: 01733 888888\r\n3 St Mary\'s Hill, Stamford PE9 2DW, tel: 01780 484570\r\n\r\nBuckles Solicitors LLP is a Limited Liability Partnership registered in England OC311739\r\n\r\nBuckles Solicitors LLP is regulated by the Solicitors Regulation Authority | Details of the\r\nSolicitors code of conduct can be found at www.sra.org.uk/solicitors/code-of-conduct.page\r\n\r\nA list of the members\' names is available for inspection at the above offices\r\n\r\nVisit us online at www.buckles-law.co.uk\r\n\r\nThe content of this e-mail, including any attachment(s) is confidential, and may be\r\ncovered by legal professional or other privilege. If you are not the named recipient or\r\na person responsible for delivering it to a named recipient or you have received the\r\nmessage in error, you must not disclose it to any person or make use of the information\r\ncontained in it, but should immediately inform us on one of the above telephone numbers\r\nand delete the message from your system.\r\nWhilst every effort has been made to ensure that this e-mail and any attachment to it\r\nis free from viruses and other defects, Buckles Solicitors gives no warranty to that\r\neffect and can accept no responsibility for any losses resulting from infected e-mail\r\ntransmissions. You are therefore advised to scan any attachments to this e-mail prior\r\nto opening them.\r\nPlease note that whilst the advice with which we provide you is given on behalf of\r\nBuckles Solicitors LLP any personal views expressed in this email may not be those of\r\nthe originator and do not necessarily reflect those of this organisation.\r\n\r\nThe Buckles : Perrins Alliance - an association of independent law firms. Each member\r\nis a separate firm between which there is no common ownership. These firms are not\r\nmembers of one partnership or otherwise legal partners with each other, nor is any one\r\nfirm responsible for the services or activities of the other. Each firm governs itself\r\nand handles its administrative matters on a local basis.\r\n\r\n',NULL,NULL,33,1,NULL,'',NULL,'',NULL,NULL,'Lexis Library','',101,66,'2011-11-16 13:56:31',1921,'2011-11-16 17:14:46',72,141,0,'Restrict their ability to have confidence in giving complete advice in insolvency matters.\r\nThey may decide to pay more and get the series of cases from the publisher (Jordans) ','Do we have equivalent coverage in our existing case series that we can say with confidence the client isn\'t missing out!','N'),(8421,'PRODUCT','Customer training session',NULL,4277,NULL,NULL,'','Gill Robinson',1,4,NULL,NULL,'WHy can\'t I manipulate a \'flat\' version of the consent form. Smart is no good for me as I had and am likely to again have circumstances that required manipulation of the flat version so I had to go to a Resolution version.',NULL,NULL,28,3,NULL,'',NULL,'',NULL,NULL,'Family PSL','',131,66,'2011-11-16 14:01:17',1921,'2011-11-17 10:41:43',92,1541,0,'Forced them to use an alternative and reduced their faith in PSL Family.','Include a flat version of the Consent order in Family PSL. \r\nIt would also help another insight logged where searching does not pick up consent orders as it is only available in smart format.','N'),(8431,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','David Bowen-Ashwin',1,1,NULL,NULL,'This training was conducted by my colleague Walker Syachalinga. The customer subscribes to a number of practice area menus on LexisLibrary, e.g. Property etc, some of which include EF&P. The customer could not understand why they are unable to access the Index to EF&P, but they can access the Table of Contents and the content itself. My understanding is that you only have access to the Index if you subscribe to the EF&P menu, or one of the large menus such as Legal Library. For the customer, though, this comes across as very odd. Why would they not have access to the index, when, from their perspective, they pay for EF&P access through the menus they buy?',NULL,NULL,0,3,NULL,'',NULL,'Jacksons',NULL,NULL,'','',131,1881,'2011-11-16 15:57:17',3711,'2011-11-18 13:59:22',82,3711,0,'It reduces the usability of EF&P.','The index to EF&P should be included on the practice area menus. Customers do not understand (and nor do I) why it is not.','N'),(8441,'PRODUCT','Customer training session',NULL,4277,NULL,NULL,'','Gill Robinson',1,4,NULL,NULL,'Toolbox looks good, what about a \'Legal Aid Calculator\' link?',NULL,NULL,28,9,NULL,'',NULL,'',NULL,NULL,'PSL Family','',452,66,'2011-11-16 16:09:43',1541,'2011-11-16 17:24:58',72,1541,0,'Ease of access would save them time and encourage them to use PSL as the one stop shop for all useful links/support.','Include a link in the toolbox for a Legal Aid Calculator. There may be a link in the useful links that indirectly goes to the site where this sits, but they felt a direct link would be very helpful','N'),(8451,'PRODUCT','Customer training session',NULL,4277,NULL,NULL,'','Gill Robinson',1,4,NULL,NULL,'Forms look good, but where are the EX ones eg EX160?',NULL,NULL,28,3,NULL,'',NULL,'',NULL,NULL,'Famly PSL','',452,66,'2011-11-16 16:11:41',3701,'2011-11-24 11:06:40',82,1541,0,'Need access to this form to handle family queries','Include the EX 160 etc forms linked to family in Family PSL. They may also be relevant elsewhere but the family team felt strongly that they are key to a family practitioner.','N'),(8461,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Mr Robson',2,142,NULL,NULL,'He has cancelled his online subscriptions to CCH products as uses Business Link for free\r\n\r\nhttp://www.businesslink.gov.uk/bdotg/action/layer?topicId=1073858808\r\n\r\nhe stated that this free to access websiter has been significantly improved recently and he now finds that he can use this as a reference for all queries and no longer needs to use paid for subscriptions ',NULL,NULL,53,4,NULL,'',NULL,'Jackson Robson Licence',NULL,NULL,'Business Link','Business Link',71,1151,'2011-11-18 10:27:22',421,'2011-11-18 16:09:47',72,421,0,'Saves costs','Investigate the actual technical content of Business Link\r\n\r\n','N'),(8471,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Daren Peacock',2,162,NULL,NULL,'SWOT offer software that produces a basic excel spreadsheet checklist that is relevant to your actual client and the work you are going ',NULL,NULL,53,6,NULL,'',NULL,'Afford Bond',NULL,NULL,'Checklists','SWOT',31,1151,'2011-11-18 10:30:22',1921,'2011-11-18 10:41:32',3,3322,0,'Undermines Tolley Guidance content as checklists are a very popular part of the service ','Can we see how this software works?','N'),(8481,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Tim Adcock',2,142,NULL,55,'This firm have used us for a number of years for Tax Reference information however changed to CCH for just 1 year at the end of 2008\r\n\r\nThey returned to us in 2010 as stated thet CCH have no tac planning commentary - its just the BTR repeated',NULL,NULL,53,4,NULL,'',NULL,'Mitchell Charlesworth',NULL,NULL,'BTR','',91,1151,'2011-11-18 10:44:50',421,'2011-11-18 16:33:58',92,421,0,'They fell they cannot use CCH due to lack of content','keep an eye on any online Tax Planning developments from CCH nas they will have recieved this feedback too','N'),(8491,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Kate Naylor',2,142,NULL,55,'CCH pressurising for a decision by stating they would give 15 months for the price of 12 but offer only open for 24 hours',NULL,NULL,53,4,NULL,'',NULL,'Sagars',NULL,NULL,'','',241,1151,'2011-11-18 10:47:26',421,'2011-11-18 16:39:06',72,421,0,'Really annoyed the customer who does not like to be put under pressure from sales ','be aware as some customer may fall for this and agree to go with CCH','N'),(8501,'PRODUCT','Customer/product advisory board',NULL,NULL,NULL,NULL,'','carole tucker Lawyer',1,4,NULL,82,'Client has said that she is experiencing problems when trying to find information on precedents for gating on highways, also she has said that she cannot find any precedents for this in the legal library EF&P either.\r\nShe has also said that she has concearns that the content is weak overall in the highways section and Licenses for highways.',NULL,NULL,39,3,NULL,'',NULL,'somerset council',NULL,NULL,'n/a','',91,2682,'2011-11-18 15:51:26',351,'2011-11-24 14:01:06',22,351,0,'Loss of time looking for content.','Client has said that does not use the PSL modules very often, I asked if she had recieved training? she said that she had but because she does not use the system very often she may be forgetting how to use it!\r\n\r\nCarole has said she would be willing to take a phone call to help her with her issues but she does not feel this is such a big problem for her.\r\n\r\nI suggest a gentle call to explore how we can help her finding what she is looking for and that should resolve the problem','N'),(8511,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Catriona Herbert/Practice Manager',1,132,NULL,NULL,'The lawyers are unable to save PDFs within their IT infrastructure and  this renders Smartforms largely redundant. They have been told by their IT team that it is necessary to subscribe to an expensive version of Adobe in order to save PDFs. I have spoken to the technical support team and Head of Sales Andy Smith and neither have heard of this. I wonder if the lawyers have been told something by their IT dept or misinterpreted something? Therefore they would like all the forms to be available in Word.',NULL,NULL,39,3,NULL,'',NULL,'Elmbridge BC',NULL,NULL,'Smartforms','',0,80,'2011-11-18 16:36:39',151,'2011-11-24 10:28:01',92,151,0,'Unable to save PDFs, cannot use functionality on Smartforms to save each version of the form','Can we state definitively that this is incorrect and that so long as the client is using Adobe reader 8.2 (or higher), then the ability to save PDFs should be free? If not, would we consider adding Word versions too for those organisations unable to afford Adobe?','N'),(8521,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Catriona herbert/Practice manager',1,132,NULL,NULL,'Felt that the Smartforms browsing by category unctionality was erratic, for example the Contract Law/ Terms section included forms that weren\'t relevant to this topic  EG Form Response to an employment tribunal claim ET3,Acknowledgment of service - Directors disqualifi... N502  Acknowledgment of service - Directors disqualifi... N503 ,Pre-trial checklist - Directors disqualification \r\n',NULL,NULL,39,3,NULL,'',NULL,'Elmbridge Borough Council',NULL,NULL,'Smartforms','',341,80,'2011-11-18 16:46:32',3701,'2011-11-18 17:39:07',92,3701,0,'Less likely to use browse as unreliable','','N'),(8531,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Catriona Herbert/Practice Manager',1,132,NULL,NULL,'They would like a drag column option when looking at the form lists in Smart forms, to help them read form titles which are lengthy and only the suffixes are different ',NULL,NULL,39,3,NULL,'',NULL,'Elmbridge BC',NULL,NULL,'Smartforms','',452,80,'2011-11-18 16:48:47',151,'2011-11-24 10:27:02',72,3701,0,'Harder to view form names','','N'),(8541,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Catriona Herbert/Practice Manager',1,4,NULL,NULL,'Protective costs orders should be covered in Local Govt PSL under the Judicial review section (as they are in the Environment module) as this is a key area for local authorities ',NULL,NULL,39,6,NULL,'',NULL,'Elmbridge BC',NULL,NULL,'Local Government','',101,80,'2011-11-18 16:50:56',351,'2011-11-25 14:27:07',92,351,0,'LG PSL does nt meet their needs, need to look at Environment too','','N'),(8551,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Catriona Herbert',1,4,NULL,NULL,'The practice notes on Housing benefit are confusing in LG PSL, there are 2, one called Housing Benefit and one called Housing Benefit and Council Tax. How do they know what content is covered in which note?',NULL,NULL,39,6,NULL,'',NULL,'Elmbridge BC',NULL,NULL,'Local Government','',131,80,'2011-11-18 16:52:51',351,'2011-11-24 13:27:20',92,351,0,'Takes longer to navigate','','N'),(8561,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Catriona Herbert/Practice Manager',1,4,NULL,NULL,'is insufficient content on Housing Benefit fraud in LG PSL ',NULL,NULL,39,6,NULL,'',NULL,'Elmbridge BC',NULL,NULL,'Local Govt','',91,80,'2011-11-18 16:54:26',351,'2011-11-24 13:08:08',82,351,0,'key area of research needed','','N'),(8571,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Catriona Herbert/Practice manager',1,4,NULL,NULL,'One lawyer felt that the topic index in LG PSL was insufficiently detailed and she would prefer a more detailed book-like index',NULL,NULL,39,6,NULL,'',NULL,'Elmbridge BC',NULL,NULL,'Local Govt','',131,80,'2011-11-18 16:55:55',1921,'2011-11-25 13:14:57',3,59,0,'more likely to use a book via LL rather than PSL','','N'),(8581,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Catriona Herbert/Practice Manager',1,1,NULL,NULL,'The Dishonesty entry in Find A Legal Term links to the Dishonesty entry of Words and Phrases Legally Defined as you would expect. However, this only covers the position in Australia and not England. The link would be better going to the Dishonest entry instead which discusses the common law position in the UK much better ',NULL,NULL,59,9,NULL,'',NULL,'Elmbridge BC',NULL,NULL,'Legal Navigator','',131,80,'2011-11-18 16:58:42',1921,'2011-12-05 17:09:29',92,3751,0,'less likely to use Legal Navigator as not een as reliable','','N'),(8591,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Ewen Scott ',1,142,NULL,NULL,'Customer has requested if we can still set up client administrator for their online service, this is something they have previously used (LN site) and found it a great service to enhance our offering',NULL,NULL,53,9,NULL,'',NULL,'Alexander sloan',NULL,NULL,'library','',442,941,'2011-11-21 10:58:11',2632,'2011-11-22 15:06:59',102,2632,0,'save them time by doing the administrtion side themself, gives them control that they do not get with CCH','','N'),(8601,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Anneli Sarkanen ',1,1,NULL,50,'I saw this looking through the BIALL web pages today comparing West\'sand our treatment of a Case in Casesearch.\r\n\r\nJones v Barnett (1984). Demonstrates the differences between Westlaw and Lexis. On Westlaw, it says the case is overruled by Di Palma v Victoria Square Property (1986) yet on Lexis, it is only given a blue \"citation information only\" and doesn\'t list Di Palma as a case citing Jones v Barnett. Lexis only lists Thatcher v CH Pearce & Sons (considered). Westlaw doesn\'t list the Thatcher case. \r\n\r\nSee http://biallpr.pbworks.com/w/page/5259141/Cases%20for%20training\r\n\r\n \r\n\r\n',NULL,NULL,0,1,NULL,'',NULL,'BIALL',NULL,NULL,'','',91,75,'2011-11-21 11:04:59',1921,'2011-11-22 09:37:49',72,0,0,'Customers will believe they need to look at the case on both West and LL to pick up everything.','Update the information we have in our version of the case.','N'),(8611,'BLANK','Renewal or new business conversation',NULL,11998,NULL,NULL,'','Gillian Mayrick / Info Manager',1,4,NULL,NULL,'The customer would like to submit their quantum cases into our database.  However, they have been told previously that we want exclusivity, meaning they wouldn\'t be allowed to put a case study of a case on their own website.  This has stopped them contributing.  Can we alter our stance on this, to allow them to submit cases?',NULL,NULL,44,1,NULL,'',NULL,'',NULL,NULL,'','',131,7,'2011-11-21 11:36:04',371,'2011-11-21 14:02:01',102,371,291,'It impacts us more than them','Allow them to publish their own cases as a case study on their website','N'),(8621,'PRODUCT','Customer training session',NULL,2009,NULL,NULL,'','Angela Church',1,132,NULL,NULL,'The customer had a problem with the Lexis Smart Forms search field box. They cannot use connectors or other search techniques to find the correct form, especially when they do not know the form name or where the form would fall under in a certain area. This often happened when the form could fall in multiple areas. ',NULL,NULL,62,3,NULL,'',NULL,'',NULL,NULL,'Forms','Oyez',341,2411,'2011-11-21 11:48:48',151,'2011-11-24 10:23:50',112,151,0,'Because of the lack of using connectors or a suggestion box for inputing search terms, it takes more time to find the form they need. ','Perhaps, following a search technique like the one that Tolley LIbrary uses, or at the very least, allow the use of connectors across the heading of the form and the body of the form too.','N'),(8631,'PRODUCT','Customer training session',NULL,2009,NULL,NULL,'','Angela Church/ Office Manager',1,132,NULL,NULL,'Form CLSApp8 and 6 (legal Services Agency) do not allow to change font size or to expand boxes for further input.',NULL,NULL,9,3,NULL,'',NULL,'',NULL,NULL,'Forms','',131,2411,'2011-11-21 13:53:53',151,'2011-11-24 09:33:38',112,151,0,'They need to be able add more text if the case arises.','Allow to change font size and have expandable boxes. ','N'),(8641,'PRODUCT','Customer training session',NULL,2009,NULL,NULL,'','Angela Church',1,132,NULL,NULL,'Form SCS from The Law Society auto fills the Seller\'s Conveyancer from the top of the form to the box on page 6 entitled Seller\'s Conveyancer\'s Name. They don\'t want it to autofill as sometimes the name may differ and there isn\'t a way to do this otherwise.',NULL,NULL,18,3,NULL,'',NULL,'',NULL,NULL,'Forms','',341,2411,'2011-11-21 14:01:43',3701,'2011-11-24 10:31:16',72,151,0,'This does not allow them to use the form for situations in which the seller is different.','','N'),(8651,'PRODUCT','Customer training session',NULL,2009,NULL,NULL,'','Angela Church/ Office Manager',1,132,NULL,NULL,'D81 (April 2011) Family Law Form. Customer would like the ability to add text under each of the numbers fields starting on page 2 under 7. Capital. ',NULL,NULL,0,3,NULL,'',NULL,'',NULL,NULL,'Form','',341,2411,'2011-11-21 14:14:50',3701,'2011-11-24 10:29:32',72,151,0,'They need to be able to add text to some of the figures entered in.','','N'),(8661,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Debbie Salman',2,142,NULL,NULL,'For non-tax customers the UK Parliament Acts needs to be automatically set as a separate source on the home bookshelf for ease of access and searching.',NULL,NULL,1,9,NULL,'',NULL,'Lewis Golden',NULL,NULL,'','',111,75,'2011-11-21 15:30:31',2632,'2011-11-22 15:42:39',92,2632,0,'They struggled to find acts of Parliament using the legislation only search option on the right of the home page in Tolley Library.','By placing UK Parliament acts on the bookshelf they can identify the source they need. For accountancy customers who want to use TL we need to place a range of carefully accountancy sources on their home bookshelf as default.','N'),(8671,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Debbie Salman',2,142,NULL,NULL,'More document detail is needed for the individual results  presented after a search, at present it impossible to make an informed descision as to which ones to look at. For accounbtancy they would like any relevant document references/numbers to appear in the results list e.g. FRS numbers.',NULL,NULL,1,9,NULL,'',NULL,'Lewis Golden',NULL,NULL,'','',81,75,'2011-11-21 15:35:34',2632,'2011-11-22 15:43:40',92,2632,0,'Wastes time looking at unhelpful results.','Find a way of imcluding the full document title at least in the results list.','N'),(8681,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Debbie Salaman',2,142,NULL,NULL,'They appreciate it is not an accountancy service as such but it would be helpful if they could have the option of an accountancy tab or have the ability to re-name another existing tab they do  not need to use. I did say they should make their Home page their accountancy page in the meantime.',NULL,NULL,1,0,NULL,'',NULL,'Lewis Golden',NULL,NULL,'','',131,75,'2011-11-21 15:43:02',2632,'2011-11-22 15:47:02',92,2632,0,'I would not say it really impacts their business as such but having an Accountancy page would make it more welcoming and a huge plus for them would be the ability to restrict a search to all accountancy sources only. This is not available at the moment.','Perhaps we can look at customising a page for individual topics as I think most legal sourcess can be imported to Tolley Library. The issue is how far do we want to take this?','N'),(8691,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Debbie Salaman',2,142,NULL,NULL,'They need alerts within the accountancy sources to work as they do need to monitor new developments in this area which changes rapidly.',NULL,NULL,1,5,NULL,'',NULL,'Lewis Golden',NULL,NULL,'','',341,75,'2011-11-21 15:56:06',2632,'2011-11-22 15:48:02',112,2632,0,'Risk of not being made aware of business changes.','See if accountancy sources  can be made compatable with alerts on TL.','N'),(8701,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Debbie Salaman',2,142,NULL,NULL,'Would prefer the most recent results for news to display automatically rather than have to check a further box. ',NULL,NULL,1,5,NULL,'',NULL,'Lewis Golden',NULL,NULL,'','',131,75,'2011-11-21 16:01:43',2632,'2011-11-22 15:51:59',102,2632,0,'By not presenting these items in date order it takes more time to find the one needed. Also people may not spot the \"Sort by date\" option.','For those sources in Tolley Library where date is vital e.g. Cases, Journals and News the most recent items should perhaps be the default option.','N'),(8711,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Debbie Salaman',1,142,NULL,NULL,'Would like the archive of items stored in History and My Documents to go back further than just 7 days. Would be happy to simply scroll through a longer list.',NULL,NULL,1,9,NULL,'',NULL,'Lewis Golden',NULL,NULL,'','',241,75,'2011-11-21 16:06:00',2632,'2011-11-22 15:54:03',92,2632,0,'Make older items they need to see semi-regularly much more accessible.','Investigate and see if this is an option.','N'),(8721,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Debbie Salaman',2,142,NULL,NULL,'They used the check boxes in LexisLibrary and want this functionality again so they are able to restrict searching to much smaller areas of text and also choose precise pieces of text for printing/e-mailing/dowmloading.',NULL,NULL,1,9,NULL,'',NULL,'Lewis Golden',NULL,NULL,'','',341,75,'2011-11-21 16:10:43',2632,'2011-11-22 15:55:40',112,2632,0,'Saves time and effort and it is also frustrating for them as they used this functionality in LL.','Investigate for future releases.','N'),(8731,'BLANK','Customer training session',NULL,NULL,NULL,NULL,'','Debbie Salaman',1,142,NULL,NULL,'Would like the ability to search document titles only to find specific items more easily. The headings search in commentary sources in Lexis Library did this very well. Would  like to expand it to all sources.',NULL,NULL,1,0,NULL,'',NULL,'Lewis Golden',NULL,NULL,'','',462,75,'2011-11-21 16:16:09',2632,'2011-11-22 15:58:26',102,2632,0,'It would provide fewer and more relevant search results - providing of course they DO know the actual title of the document.','Again, it is worth investigating for Tolley Library.','N'),(8741,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Debbie Salaman',2,142,NULL,NULL,'They cannot access LN Accountancy at all.\r\n\r\nThere is an ongoing problem with this site. I have drawn it to the attention of the Technical team. It is not just customers, I can\'t access it using my own ID and pwd or using the weekly codes. This is the link I was told to use: http://uk1.lexisnexis.com/AccountancyDirect/Members/FrontPage.aspx ',NULL,NULL,1,5,NULL,'',NULL,'Lewis Golden',NULL,NULL,'LN Accountancy','',331,75,'2011-11-21 16:25:09',1921,'2011-11-21 17:00:12',3,2632,0,'They can\'t access specific accounatncy news easily, I was unable to show it in training sessions with Lewis Golden and Hays MacIntyre recently so renewal revenue is at risk. I have brought ithe issue to the attention of the account managers concerned as well.','Investigate this to secure revenue next year. Are we looking properly at a new accountancy offering?','N'),(8751,'PRODUCT','Customer training session',NULL,1470,NULL,NULL,'','Simon Studd / Partner',1,1,NULL,NULL,'The formatting of EF&P precedents when downloaded into MS Word is awful; he spent 4 hours re-formatting a shareholders agreement after he had inserted new clauses from another document. The numbering and indentation went all awry. The helpdesk were of no help either. He loves the content of the EF&P precedents, being far superior to PLC in brevity and options for different scenarios, but the PLC precedents are far more user friendly when downloaded to Word',NULL,NULL,0,3,NULL,'',NULL,'',NULL,NULL,'','',341,1881,'2011-11-21 16:52:34',4011,'2011-11-22 15:22:47',72,3711,0,'He had to spend a lot of time trying to get the document in to a condition fit for sending to the client., and he finds the service unfuriating, as the content is excellent, but hard to make useful','One specific issue is the lack of built in internal referencing within the precedents. For example, if you clause 5 refers to clause 3, and you then delete clause 2, clause 5 should now make reference to (the new) clause 2. This does not happen, making amending the precedents a lot of work. This is not difficult to do to the documents, and would make them more popular and usable.','N'),(8761,'PRODUCT','Customer training session',NULL,1470,NULL,NULL,'','Simon Studd / Partner',1,4,NULL,NULL,'While he likes the look of the PSL precedents, some of them do not say which book they have come from. I explained that the precedents that do not state e.g. EF&P before the title have been drafted bespoke for the service, but usually based on one from a well known book. He wanted to know which book it is based on. I showed him how to get in touch with the writers for the module, but he wanted to be able to check on the screen, quickly, what book the document is based on.',NULL,NULL,12,3,NULL,'',NULL,'',NULL,NULL,'','',131,1881,'2011-11-21 16:56:08',3831,'2011-11-21 17:30:07',92,3831,0,'Makes him think twice before using an unnamed precedent on PSL, and possible enourages him to go to PLC.','Perhaps we could add this kind of information, with the name of the lawyer that did the work, in a pop up screen that users could click on if interested','N'),(8771,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Steve Cox / Senior Business Analyst Manager',2,162,NULL,NULL,'Steve explained they are using a company called SESCA Enterprises Ltd for their training.  SESCA are a professional accountancy and business training organisation.  Steve and the team subscribe to a flexible training ticket which gives them 25 courses for 1000.  The team then share the course tickets amongst themselves.  IRIS actually use these courses for useful updates to make sure they are covered on information that their software products provide.  It is important to note that IRIS are a software vendor and they do not act as a typical in house tax team would.  This is the first time however that I have come across SESCA.  Other GP and In House firms may be using this organisation for their tax training. ',NULL,NULL,62,12,NULL,'',NULL,'IRIS Software',NULL,NULL,'n/a','Sesca',51,1371,'2011-11-21 18:08:45',421,'2011-11-25 11:28:52',72,421,0,'They get the training they require at a cheaper rate.','','N'),(8791,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Matthew Bradley',1,4,NULL,47,'The reason for selecting PLC over LexisPSL is PLC offer us letters of advice for our client, and all the content can all be accessed from one screen. For example when drafting a compromise agreement they have a letter that explains the different options available to the company as well as the actual compromise agreement for the employee.',NULL,NULL,24,3,NULL,'',NULL,'Bradley & Jefferies',NULL,NULL,'','',41,28,'2011-11-22 12:27:56',1921,'2011-11-22 16:47:05',3,2321,0,'Although the customer identifys that our practice notes/drafting notes could be reworded and put into a letter format to advise their clients of the process taking place and the options they have, this would take them additional time. This is not something they provide their clients with at present but they will be able to offer a better level of service to their client by sending these letters, something they see as imperitive in the competitive market for commercial/employment work','Are we considering these types of letters and where we position them within our service?','N'),(8801,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Matthew Bradley',1,4,NULL,47,'Customer searched for Mediation Agreement within LexisPSL and pulled up no results. When we browsed the content we found that there was a mediation agreement but I believe as it was an external document (we provided a link to the site) that it was not bought up on the search.',NULL,NULL,9,3,NULL,'',NULL,'Bradley & Jefferies',NULL,NULL,'LexisPSL DR','',41,28,'2011-11-22 12:31:06',28,'2011-11-23 10:20:30',92,1531,0,'Customers impression during trial was that we were weak on content and that using our product would be more time consuming and therefore less productive for the firm.','','N'),(8811,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Sue Murphy/Practice Manager ',1,4,NULL,NULL,'A selection of Associates and Partners at the firm asked whether a \'Charities\' practice area tab would be created, as opposed to just having \'charities\' as a topic within the Private Client practice area on PSL? They asked for this because they had tried to find charity related content on PSL but had not seen the \'charities\' topic because it has been placed within private client. They said that Charities law SHOULD have its own tab, as it makes it look \'unimportant\' on PSL. \r\n\r\nAlso, they were slightly annoyed that when you click on the topic \'charities\' within the private client practice tab, that it states that there is no legislation as the legislation tab remains grey. They were annoyed because when you click on the legislation tab in the search box on the general page of private client it actually lists the charities act 2006 and 1993 as KEY LEGISLATION on the right hand side, but then it is not listed when you actually click on the charities topic under legislation. There comment was that PSL \'lacks continuity in parts\' because of things such as the above! Could the charities acts be listed under the legislation tab in the chartities topic in private client please so that we avoid this continuity comment? ',NULL,NULL,7,9,NULL,'',NULL,'Stone king LLP',NULL,NULL,'','',131,4061,'2011-11-23 15:35:23',2622,'2011-11-25 16:11:36',92,2622,0,'They said that they predominately use both acts and that they would use PSL a lot more if the acts were placed within the legislation tab of the charities topic in the private client practice area. They also stated that they would use PSL more if a charities practice area was created!','','N'),(8821,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Kate Waller / Head of Tax',2,162,NULL,34,'The client is currently using BPP for training as in her own words \"BPP are more attractively priced, easy to get to and very friendly\".  She did however concede that the courses can be quite generalise.  There training budget per employee is 1K per year.',NULL,NULL,53,12,NULL,'',NULL,'Clear Channel Outdoor Ltd',NULL,NULL,'n/a','',51,1371,'2011-11-23 16:42:48',1921,'2011-11-23 17:30:57',3,421,0,'They are currently getting good value for money in there eyes.','We are having a Tolley Learning meeting in February to discuss how a Tolley training package will provide better value than BPP.','N'),(8831,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Senior Lawyer Employmnet',1,1,NULL,NULL,'Feedback arose from a training session for the In House emplyment team. The trainer logged in using their password which of course meant access to the majority of Lexis Library. The trainer showed them how to search using \"Find a legal term\". The response from the client was very positive and they thought it was a great addition to the service and one that they would use frequently. However, they have a subscription to the employment menu only and find a legal term is not included in this menu. Are there plans to add Lexis Navigator(I believe this is the tool that we are talking about) to all menu\'s? If not could someone feedback to me why not? I explained to the customer that it was only available in certain menu\'s that cover a broad spectrum of legal topics but promised I would give her some feedback.',NULL,NULL,24,9,NULL,'',NULL,'B&Q',NULL,NULL,'','',462,3601,'2011-11-23 17:43:40',1921,'2011-11-24 09:41:01',3,3711,0,'It only came to light because of the trainer showing them so we might have to be careful in what we say in the future as the client was bemused why they could not have this solution.','Please supply me with feedback on why we do not offer this across all menu\'s and if there are plans afoot to address this?\r\n\r\nMany thanks','N'),(8841,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','John Rowland Solicitor',1,4,NULL,NULL,'Trialled Lexis PSL Company Commercial and In House. Currently subscribe to PLC, due for renewal Jan 31st 2012. Feedback from trial was generally positive: Liked the overview, thought the content was generally good and liked the fact that he could research casel law and practical guidance which put us ahead of PLC. It was very close but in his words\" Lexis PSL is not quite there yet but certainly very close\" They chose to renew with PLC. He said he was being \"picky\" but his main bugbare was the number of precedents and the fact that when he printed off documents the links in blue on the left hand side(mainly cases and legislation) all merged in to the text in the document and there was no clear definition. He would have liked the links to remain on the right hand side of the printed page exactly as they appear on the screen. He demonstrated via Webex and I could see his point.',NULL,NULL,12,9,NULL,'',NULL,'DRS',NULL,NULL,'','',61,3601,'2011-11-23 17:52:00',3831,'2011-11-24 10:01:37',102,3831,0,'N/A','They have asked us to show them the \"NewPSL\" when it is released and to keep in touch as they want to trial again at the end of 2012.','N'),(8851,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','',2,142,NULL,55,'Client has 1 complaint about Tolley Library - they cannot open muliple windows and they find this very frustrating ',NULL,NULL,53,0,NULL,'',NULL,'',NULL,NULL,'','',462,1151,'2011-11-23 21:51:05',2632,'2011-11-25 13:21:22',112,2632,0,'Frustrated with service and reduces usage and give CCH the opportunity to demo their service ','Can this functionallity be added?','N'),(8861,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Mr Hanby',2,152,NULL,55,'Since stopped producing Simons NIC as a atand alone print product our clinet have has to seek this service from CCH as we do not produce a suitable alternative (this has now merged with Simons Taxes)',NULL,NULL,53,4,NULL,'',NULL,'Hanby & Co',NULL,NULL,'','',101,1151,'2011-11-23 21:55:24',1921,'2011-11-25 12:47:54',3,181,0,'They do not want to subscribe to Simons Taxes they just want Simons NIC so have now had to go to CCH as thye still produce a separate NIC publication\r\nAlso we have lost the 865 in revenue they paid for this in 2010','Online stand alone?','N'),(8871,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Fiona Bootle, Co Solicitor',1,4,NULL,NULL,'The customer was unable to access Lexis PSL trial without altering web settings/ firewall details, even though they had an existing Library subscription that they were able to access. ',NULL,NULL,62,12,NULL,'',NULL,'Nexus',NULL,NULL,'All PSL Modules','',442,3621,'2011-11-24 09:48:48',1921,'2011-11-24 11:40:48',92,59,0,'they had to alter their firewall and cookie settings and lost a couple of days from the trial','PSL should have the same level of access security as Library. It\'s silly when a customer can access their Library subscription but not PSL','N'),(8881,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Alex Segal',2,142,NULL,NULL,'During a training session when running a search through the legislation tab for the companies act  2006 for loans to participators, the result was \"no documents found\"\r\nThe same search for the Companies act without any keywords yielded the same result.\r\nThe Companies Act 2006 is contained within the Company law handbook but the legislation search did not pick this up.\r\nA search for fraudulent training which is clearly dealt with in the 2006 act similarly did not yield any results\r\n\r\nAnother observation related to the ability to filter by keyword only once, unlike the Lexis Library service.\r\nAlso noted was the lack of documents viewed in Tolley Library (cf Lexis Library)\r\n\r\nAnother observation related to a typo in Tax Treaties where Philippines is spelt Phillipines on 6 occasions (this was picked up  as an example of the search yielding few results when actually the spelling used  was incorrect).\r\n\r\nTHIS HAS BEEN FORWARDED TO DAN AROWSMITH IN SEPARATE EMAIL',NULL,NULL,0,9,NULL,'',NULL,'Morris Lane & Co',NULL,NULL,'','',462,72,'2011-11-24 13:35:24',2632,'2011-11-25 13:40:58',92,2632,0,'Not keen to migrate to the new service as it lanks functionality.','','N'),(8891,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Steve Cox / Senior Business Analyst',2,142,NULL,55,'It appears that a tactic of CCH reps is to price match their existing print customers (and ours) in order to get them to buy there online services.  The customer in this case explained to me that there level of content was no where near the level of content that we have.  I don\'t think the CCH rep even asked if the customer had our hardcopy books too.  \r\n<email with details submitted to SME separately due to sensitive information>',NULL,NULL,53,2,NULL,'',NULL,'IRIS SOFTWARE',NULL,NULL,'TolleyLibrary','',442,1371,'2011-11-25 12:42:30',1921,'2011-11-25 12:54:45',3,421,0,'am in the process of moving IRIS Software to our online services.','','N'),(8901,'PRODUCT','Customer training session',NULL,11840,NULL,NULL,'','',1,4,NULL,NULL,'This is a new customer and he phoned up because he has just gone onto the service for the first time, gone to the forms section and wanted to use the form SCS standard conditions of sale agreement. When he clicked on the form it says a Lexis Library subscription is needed which he doesn\'t have. I have emailed the form to him as a goodwill gesture.',NULL,NULL,49,3,NULL,'',NULL,'',NULL,NULL,'PSL property','',131,2371,'2011-11-28 14:07:55',1921,'2011-12-01 09:25:13',3,59,0,'N/A','There is nothing on the forms page to say that this form is only available with a Lexis Library subscription. I think the form should be taken off if it cannot be put onto the PSL platform or it should be made clear from the forms page a LL subsription is needed as this is misleading.','N'),(8911,'PRODUCT','Renewal or new business conversation',NULL,12700,NULL,NULL,'','',1,4,NULL,NULL,'The customer is now trialing the product and during the pre-trial training on the quantum database he asked to look at the results for the injury type chronic pain. We looked at the first few results and he said they are not results for chronic pain which is specifically defined. The search word highlighted in red in each result was often just picking up the word pain. The customer said pain would be associated with most injuries so these were not good search results. \r\nThe customer was pleased with the search results for other injuries eg neck injuries.',NULL,NULL,44,9,NULL,'',NULL,'',NULL,NULL,'','',81,2371,'2011-11-28 14:18:18',1921,'2011-12-01 09:28:43',3,371,0,'N/A','','N'),(8921,'PRODUCT','Direct Mail',NULL,NULL,NULL,NULL,'','Jennifer Kaye',1,4,NULL,47,'Jennifer received our marketing information regarding PSL Essentials. I spoke to her and arranged a weeks trial as they are currently with PLC and this was coming up for renewal. The main areas Jennifer was interested in were Commercial/Corporate. Having spoken to her after the trial, she advised she is going to stick with PLC. This is due to not being able to search across all modules and also not being able to find the info she wanted. She was searching for \"most favoured nations clause\" however, she found this within her PLC sub.\r\nJennifer would be willing to give more feedback and have one of our PSL contact her however, she wouldn\'t be able to spare an hour for this. She can be contacted on  020-8396-0100',NULL,NULL,10,0,NULL,'',NULL,'Vue Enterainment Ltd',NULL,NULL,'','',41,1311,'2011-11-28 14:39:56',NULL,'2011-12-01 17:11:28',22,3831,0,'Customer didn\'t have time to discuss this','','N'),(8931,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','',2,20,NULL,55,'Tax Investigations - can we publist the Business notes either on a stand alone online service or as part of TG as we currently do not have a product and CCH do',NULL,NULL,53,4,NULL,'',NULL,'',NULL,NULL,'Tolley Guidance','',31,1151,'2011-11-28 21:24:09',1921,'2011-12-01 10:04:31',3,421,0,'unable to covert the CCH spend to LN new business','Investigate possibility of adding content but need to business notes as these are what CCH subscribers pay for ','N'),(8941,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','mr Winters',2,162,NULL,NULL,'Mr Winters advised me that CCH set him up with eCPD as a replacement to the venue seminars that they have previously attended in Edinburgh.  This was done automatically and was not what he asked for. ',NULL,NULL,53,0,NULL,'',NULL,'henderson  Black',NULL,NULL,'','',71,941,'2011-11-29 09:40:20',1921,'2011-12-02 12:14:12',3,2832,0,'they had to contact CCH to cancel the subscription as they did not ask for it','we need to contact all CCH customers for CPD','N'),(8951,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Andrew Johnson',1,1,NULL,NULL,'These are the clients exact words: This could be the first case whereby we have lost a client to the new PLC/Westlaw collaboration.\r\n\r\nI can\'t say too much as their contract contains a specific confidentiality clause, but the price was about the same as you offered for the Lexis Library in-house module (without FSA Regs module) but with some additional content we wanted for Employment law and Civil Procedure (equivalent to Atkins Court forms). Unfortunately, we have concluded that we weren\'t getting sufficient use of Lexis Library to warrant the costs, especially when we compared it to the heavy usage made of PLC during the year. We did look at Lexis PSL last year, but the team are big fans of PLC and at the current time a move away from PLC is not a priority\r\n\r\nTo be completely upfront I think the deal you offered was a very good one. The deciding issue was simply what the team preferred to use. I had tried throughout the year to galvanise more interest from the team in the LexisLibrary tool, arranging the training sessions and seeking feedback on the tool. I think it was just that because the team is overstretched with work that only a couple of the team ever invested the time needed to properly get to grips with LexisLibrary. They found the wealth of results too overwhelming as they always needed quick concise results.',NULL,NULL,61,0,NULL,'',NULL,'Liverpool Victoria',NULL,NULL,'','PLC/Westlaw',41,3601,'2011-11-29 11:30:49',3601,'2011-12-01 15:55:38',3,61,0,'It is not important to the client but more as internal feedback stating we lost out to PLC/Westlaw','We ran 3 training sessions throughout the year to try and engage the lawyers and we had entered into conversation around LexisPSL. ','N'),(8961,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','David Howitt',1,4,NULL,47,'I carried out a new business demonstration to 3 lawyers from Xoserve this week. The feedback on PSL against PLC was very favourable. They particular liked the facthat all the content around a searched topic was available in one location without having to link out for case law etc. They thought the Bribery Act Checklist was great and would be interested in looking at the product agin in the New Year. They were quite keen to understand the roadmap and content that would be available in the IP&IT module and competition module and wanted to know when these were due for release.',NULL,NULL,35,6,NULL,'',NULL,'Xoserve',NULL,NULL,'','',442,3601,'2011-11-29 11:45:20',1921,'2011-12-01 10:23:18',3,59,0,'They stated that they would find PSL easier to use than PLC ','Could someone let me know the release dates for Competition & IP/IT and perhaps some more detail on the content','N'),(8971,'PRODUCT','Customer training session',NULL,10785,NULL,NULL,'','Vicki Seabrook',1,4,NULL,NULL,'When in Quantum, the categories of injury don\'t break down enough - where\'s dental?\r\nSecondarily, if you happen to search using dental as a key word only 6 cases appear that are not particularly relevant (she wants gum disease etc through negligent treatment). She felt for such a large area, this was poorly supported.',NULL,NULL,44,1,NULL,'',NULL,'',NULL,NULL,'PSL PI','Kemp & Kemp',101,66,'2011-11-29 12:14:43',1921,'2011-12-01 10:25:52',3,371,0,'Have to turn to other suppliers of quantum to get anything helpful for many of their queries.','Include dental queries as a  category of injury\r\nEncourage quantum in clin neg to be submitted - including dental which is much of their work at SS. They are PI specialists so good to listen to! :o) ','N'),(8981,'PRODUCT','Renewal or new business conversation',NULL,491,NULL,NULL,'','Catrino Wheeler/Partner',1,4,NULL,47,'The customer commented that on using our flat precedents she noticed that there was no automatic updating of cross referencing. ',NULL,NULL,0,3,NULL,'',NULL,'',NULL,NULL,'','',41,3821,'2011-11-29 13:39:35',1921,'2011-12-01 11:50:52',112,59,0,'Takes her longer to mark up a precedent (compounded by the fact that the relecvant precedents are not yet in Smart form)','This is a general point that applies accross all PSL modules. It is not a question for the subject matter experts but for the editotial/technical teams.','N'),(8991,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','Sean Hazell / Head of Litigation',1,4,NULL,NULL,'See e-mail below. \r\n\r\n\r\nPhil\r\n\r\nI have spotted a section that seems to incorrectly state the current law in the PSL PI section. It concerns liability for dog bites.\r\n\r\nI have pasted the relevant section below:\r\n\r\n\"case against a police dog that bit a police offer instead of an escaping criminal failed under the Animals Act because the tendency to bite was a result of training rather than character.Gloster v Chief Constable of Greater Manchester [2000] All ER (D) 389\"\r\n\r\nThis case was overruled by the House of Lords in the later case of Mirvahedy v Henley & Another [2003] 2 A.C. 49. Counsel drew this to my attention when advising recently in a case involving a police dog bite. The reference to a tendency to bite being the result of training was expressly rejected by Lord Foscote in the Mirvahedy case who then stated that the claim in Gloster should have succeeded.\r\n\r\nRegards\r\n\r\nSean Hazell\r\nHead of Civil Litigation\r\nLegal Services, The Farmhouse, Thames Valley Police Headquarters, Kidlington, Oxon, OX5 2NX.\r\nDX 133673 Solicitors, Kidlington\r\nDirect Line: (01865) 846175    Internal No:  7006175\r\n',NULL,NULL,44,1,NULL,'',NULL,'Thames Valley Police',NULL,NULL,'PSL personal Injury','',81,1351,'2011-11-29 15:49:53',1921,'2011-12-01 10:31:23',3,371,0,'out of date content increases risk and affects our standing as a reliable provider of up to date online information','Can you get back to me ASAP as this is a big account in terms of getting the PSL PI rolled out to police and councils advising police ','N'),(9001,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Dean Johnstone',2,142,NULL,55,'Online users have set up alerts on TollyLibrary however when they receive the alert it is just a text only summary - no link to the full article so they feel thay are usless and of no value\r\n\r\nCustomer also commented that Accounting web alerts have links and perfer to use these',NULL,NULL,53,5,NULL,'',NULL,'Dodd & Co',NULL,NULL,'','',261,1151,'2011-11-29 22:27:25',1921,'2011-12-01 10:36:08',3,2632,0,'It de values the online servcie and the way our clients want to utilise alerts and updates\r\n\r\nIt makes them use alternative services and could open the door to CCH','Can we include links on the alerts please','N'),(9011,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','David Brookes',2,152,NULL,NULL,'Can purchase Tolley Boks from Amazon cheaper then RAMS offer!\r\n\r\nThis account no longer have the Tolley books on standing order as they now wait until September and see what Amazon pffer and its alwys cheaper then what they get quoted form their RAM so then we have to price match',NULL,NULL,53,4,NULL,'',NULL,'Robinson Udale ',NULL,NULL,'','Amazon',51,1151,'2011-11-29 22:31:16',1151,'2011-12-01 10:40:06',3,121,0,'We are losing revenue by offering Amazon such good rates!','better communication about Trade activity so RAMS are aware of what is happening ','N'),(9021,'PRODUCT','Customer training session',NULL,10785,NULL,NULL,'','Marc Folgate',1,4,NULL,NULL,'With your forms in PSL, we like the look of Smart pdf versions, where are EX160/EX150? Also what about the Court Fund Forms (CFF 320 etc)?',NULL,NULL,44,3,NULL,'',NULL,'',NULL,NULL,'PSL PI','',0,66,'2011-11-30 11:14:27',1921,'2011-12-01 10:44:08',3,371,0,'Currently takes ages to download from Court Service Website an use one by one, this would save them loads of time','Add the mentioned forms to PSL Personal Injury. They may seem to be general forms, but are of great significance to a PI lawyer. ','N'),(9031,'PRODUCT','Customer training session',NULL,9008,NULL,NULL,'','Pauline McIntyre',1,4,NULL,NULL,'Children content great, but not clear where public children support is compared to private. Although Pauline does both private and public, would be nice to clearly see which bit to go to for either query.',NULL,NULL,28,6,NULL,'',NULL,'',NULL,NULL,'PSL Family','',131,66,'2011-11-30 11:23:06',1541,'2011-12-02 09:47:36',82,1541,0,'Make life easier to see where to go to, save time with research','Separate out the public/private children topics content to fully bring it to life','N'),(9041,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Andrew Marr HOL',1,4,NULL,47,'This customer has both LexisPSL and PLC and would eventually like to cancel PLC once they fee that both the content and functionality are at a comparable level.  In terms of content the new constrction module will help. With regards functionality the main criticsm that they have is not being able to search across all modules as they are often unsure of where the guidance will sit.',NULL,NULL,62,0,NULL,'',NULL,'Sellafield',NULL,NULL,'','',341,1381,'2011-11-30 13:44:02',1921,'2011-12-01 11:49:39',3,59,0,'I believe that both these points will be addressed early next year.','','N'),(9051,'PRODUCT','Customer/product advisory board',NULL,NULL,NULL,NULL,'','',1,4,NULL,NULL,'1. Used today to find case Clark v Ardington 2002 3 WLR 762A - found immediately and found emailing the summary to myself extremely easy and straight forward.  Used LNB as could not find the case on Westlaw.\r\n\r\n2. Rec\'d a query on Small Holdings and Allotments - used both terms and could not find what I was looking for.  Had to revert back to doing an archive search on Westlaw to retrieve the information which was correctly called Small Holdings and Allotments Act 1908.  Used the termsSmall Holdings and then Allotments and didn\'t receive the hit I wanted.  Used the same terms in Westlaw archive and got the Act straight away.\r\n',NULL,NULL,61,6,NULL,'',NULL,'Network Rail',NULL,NULL,'','',0,591,'2011-12-01 11:10:12',1921,'2011-12-01 14:25:11',22,591,0,'Couldn\'t answer query from member of her team','Passed to Ppty PSL','N'),(9061,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Kate Heap',1,1,NULL,NULL,'I looked at the Historical Versions page with Kate she said that it would be very helpful to have a free text box to submit further information relating to a request. Sometimes these requests are far from straightforward and more information may need to be provided.e the feedback (quoting verbatim where possible) -  this will help to ensure a speedy and effective response!',NULL,NULL,53,2,NULL,'',NULL,'HMRC',NULL,NULL,'','',452,75,'2011-12-01 14:12:07',3711,'2011-12-01 15:11:25',3,3711,0,'The information they get back may not be precisely what they need if they have not the scope to explain what is needed fully in the first instance.','Assess if there has been similar feedback previously and see if there is a case for adding a further category to the form.','N'),(9071,'PRODUCT','Other',NULL,NULL,NULL,NULL,'','',1,1,NULL,NULL,'This is something I noticed. On clicking into search by the UK Parliament SIs the option Act not SI is selected by default so unless a user is very observant and changes this wrong default selection they are going to get no search results. This was my experience so i am sure it is affecting customers in the same way.',NULL,NULL,62,2,NULL,'',NULL,'',NULL,NULL,'','',341,75,'2011-12-01 14:19:33',3711,'2011-12-01 15:07:51',92,3711,0,'Wastes times as their search will not work unless they know or happen to observe that they have to change the selection to SI. Irritating too.','Amend asap. Bad user experience.','N'),(9081,'PRODUCT','Customer training session',NULL,NULL,NULL,NULL,'','Kate Heap',1,1,NULL,NULL,'Would really like to set a simple alert that e-mails weekly a list of all items in a journal - e.g.Taxation. The list of should not only give the article titles but useful summaries along with links into the documents to open relevant articles easily.',NULL,NULL,53,4,NULL,'',NULL,'HMRC',NULL,NULL,'Taxation Magazine','',452,75,'2011-12-01 14:26:29',1921,'2011-12-01 14:38:24',3,3711,0,'Would create seamless access to the journals and encourage weekly use of the content. Ideal for use on iphone/ipad when travelling with wifi access.','Worth investigating.','N'),(9091,'BLANK','Customer cancellation request',NULL,NULL,NULL,NULL,'','Lindsey Sherman',0,152,NULL,NULL,'Customer attended one of our conferences in London and received a 30% discount voucher for Taxation and Tax Journal\r\n\r\nThey are now going to cancel their exiting subscriptions to Taxation and Tax Journal and re order them as new subscriptions so to get the 30% discount \r\n\r\n',NULL,NULL,53,0,NULL,'',NULL,'Lindsey Sherman',NULL,NULL,'Taxation','',0,1151,'2011-12-02 13:37:10',1921,'2011-12-02 16:18:53',2,0,0,'We are giving revenue away\r\n\r\nRAMs are not made aware of these discount vouchers that are being given out','Better comminication\r\n\r\nDo not give discount vouchers to customers who already subscribe to these products','N'),(9101,'COMPETITOR','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','',2,142,NULL,55,'The following is a quote from CCH given to one of my accounts via email\r\n\r\nYou still have to manually check \'New Developments\' in Simons\'s.  You could gather an opinion from the main body of text but unless you manually check through the updates you may be looking at out of date information.  It is exactly the same information behind a new front page.  We phased out new developments around 5 years ago!',NULL,NULL,53,4,NULL,'',NULL,'',NULL,NULL,'','',71,1151,'2011-12-05 11:36:12',1921,'2011-12-05 15:11:09',3,181,0,'Make our subscribers doubt the quality of our service','Please can I have an official responce that I can use to respond to this ','N'),(9111,'PRODUCT','Renewal or new business conversation',NULL,NULL,NULL,NULL,'','Placida Ojinnaka - Trainee Education / Employment ',6,18,NULL,NULL,'Verbatim from customer:\r\n\r\nTechnical- I found it easy to navigate and as I mentioned the colour schemes (blue- tracker, purple/lilac-welcome page) are very calming and makes it easy to distinguish from the research site. I would suggest that there is a link \r\n\r\nContent- most of the practice areas which we cover are there but I noticed that there was not one for Risk Assessments- Practice Management & Compliance and this might include Professional Conduct. \r\n\r\nThe Assessment was easy to use but study notes might be an additional resource that some of my colleagues would value. However there were no explanations give to why an answer might be incorrect or correct. I do like that it tells you how many times you have been assessed. It tells you also how many CPD points you have accrued.   \r\n\r\nThe webinar which I viewed was \"Discrimination Case Law Update\", clarity was great, however, I was not able to view the speakers, though this may be a technical error at my end, never the less this did not prevent me listening. This might be because I was listening to the podcast and not the live one. When we view the live webinar on 7.12.11, I\'ll feedback further. \r\n',NULL,NULL,24,0,NULL,'',NULL,'LOND5027 London Borough of LAmbeth ',NULL,NULL,'','',452,1141,'2011-12-05 15:47:17',1921,'2011-12-05 15:54:22',3,2752,0,'They are looking to purchase webinar sub to roll out to the team','','N'),(9112,'BLANK','Other',NULL,NULL,NULL,NULL,NULL,'',NULL,24,NULL,NULL,'tet record- pls delete',NULL,NULL,59,9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,452,4064,'2011-12-15 14:56:09',NULL,NULL,NULL,NULL,NULL,'test record','','N'),(9113,'BLANK','Customer training session',NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,'NM test',NULL,NULL,0,0,NULL,NULL,NULL,'nm',NULL,'0',NULL,NULL,0,2552,'2012-01-25 12:51:46',NULL,NULL,NULL,NULL,NULL,'NM test','','N');
