INSERT INTO `issues` VALUES (2,172,62,442,'Test Issue','New Issue','2011-07-25 14:59:28',1),(12,4,48,341,'Gridlines for Precedents on LexisPSL','Needed before Sep 2011 but not currently available - essential for launch','2011-07-29 09:08:14',1),(22,142,53,341,'E-mail alert view problem','Expanded list view is not working. The e-mail alerts do not include the mini-summary segment that the customers were used to in LexisLibrary.\r\nThis is being fixed in the late August release.','2011-07-29 11:07:11',1),(32,4,44,111,'Precedents for workflow stages','We have added case management  flowcharts to the roadmap for 2012 and are also planning on including draft letters for various stages of a claim.','2011-08-01 09:22:57',1),(42,4,44,91,'Clinical negligence in quantum database','Clinical negligence in quantum database\r\n','2011-08-01 09:28:24',1),(52,142,59,131,'Menu info needed','Customer needs more on the available online menus.','2011-08-03 10:10:34',1),(62,4,9,91,'Content query CPR 36','apparently we don\'t mention the factortame case in our PN on clarifying CPR 36 offers - relevant CPR provision being CPR 36.8','2011-08-03 15:12:26',1),(71,142,53,341,'Expanded list problem in results page','Clicking expanded list not always showing the epxanded list to the user. This is being caused by a separate bug when searching accross journals. A fix is being analysed.','2011-08-15 08:26:54',1),(81,142,53,462,'Need to search individual HMRC manuals','Users want to be able to select idividual HMRC manuals and search those only.','2011-08-16 14:30:52',1),(91,20,53,271,'Searching across more than one module of TG','Live','2011-08-19 13:15:58',1),(101,4,44,452,'Tool Enhancements','In progress','2011-08-23 08:37:41',1),(111,4,44,101,'Additional Clinical Negligence topics','Additional Clinical Negligence topics','2011-08-23 09:15:53',1),(121,1,44,101,'Quantum Database','Quantum Database','2011-08-23 09:28:04',1),(131,20,54,442,'Request for new content in TG','Live','2011-08-25 08:23:53',1),(141,142,53,462,'Browsing UI difficulty','User is having problems navigating through our TOC in doc view and/or from the bookshelf','2011-08-30 13:39:02',1),(151,4,12,111,'Broken Links to Major Works in Library','Current thinking is that this is a PAM/Content issue and we are discussing this with Helen Green.','2011-09-01 10:52:36',1),(161,4,12,101,'EFP link to Data stamps - what they mean?','Robert Walker to discuss with Tim Wakefield and coleagues. All EFP documents in PSL (and LIbrary) include the \'EFP\' link. The link is to information on Date stamps - what they mean?, which is a prelim page covering editorial policy located in Library. This seems cumbersome for PSL users since itn results in a confusing error message (\'The LexisPSL service does not contain this document [even though you are in the document]. It is, however, available in LexisLibrary. If you would like to subscribe to another Practice Area, refer to the LexisPSL Web site. Return to your last page in the Commercial Practice Area.\')\r\nThe proposal is to include the information on a freely accesible LexisWeb page and then direct the link to that.','2011-09-01 14:49:15',1),(171,4,12,31,'PLC comparison','PSL Commercial = complete peer review of product underway','2011-09-01 15:17:36',1),(181,4,44,301,'Missing content/cannot find content','We agree this content should be added to the product and have included it on the PI roadmap. We anticipate adding this content to the product within 3 months.','2011-09-02 18:11:30',1),(191,142,57,51,'CCH Pricing','Agressive pricing from CCH','2011-09-07 08:45:46',1),(201,142,53,131,'Industry specific Current Awareness not accessible','Claire Melvin investigating how we can industry specific targeted tax news without oversupply of irrelevant legal content.','2011-09-07 13:56:02',1),(211,4,44,452,'JSB / quantum database figure query','The general damages figure is automatically increased to reflect inflation since the date of judgment. Accordingly the JSB catagory search will find quantum cases which have an inflated value which matches the JSB catagory chosen','2011-10-05 13:04:38',1),(221,4,44,91,'Lack of quantum cases in the datebase','We have launched a new online submission site for quantum cases and are targeting a marketing campaign at the profession to encourage them to submit their quantum cases in high numbers. This will compete with Kemp because firstly our cases will nearly all be court decisions (Kemp has a high level of out of court settlements which carry less weight when negotiating quantum) and secondly we will have a much higher proportion of recent quantum cases than Kemp.\r\nWe anticpate a significant increase in our quantum cases within 6 months. We are also specifically targeting firms to submit quantum cases on areas where we currently lack quantum cases such as clinical negligence.\r\nWe don\'t have precise figures for the number of quantum cases in Kemp. we prefer to concentrate on talking to customers about the quality of the quantum cases we offer.','2011-10-05 13:15:49',1),(231,4,44,101,'Out of scope','We don\'t think there is enough interest from customers at the moment to support international quantum coverage. We will continue to monitor the matter and revisit it if there is more feedback from customers requesting this.','2011-10-05 14:23:58',1),(241,20,53,341,'Functionality enhancement','Ongoing','2011-10-11 10:18:23',1),(251,4,44,341,'Search function on quantum database','We are reviewing the quantum database search function in response to customer feedback and anticipate making changes to the search functionality Q1 2012','2011-10-19 14:44:28',1),(261,4,44,442,'Second suite of calculators','Currently being developed and expected to launch on the PSL product end of Dec 2011','2011-10-19 14:57:44',1),(271,4,12,101,'Customer wants shareholders agreement in Commercia','We are considering a basic shareholders agreement for PSL Commercial.\r\n\r\nThere is a JV agreement in PSL Commercial that could be used for this for the time being (it can be found in PSL Commercial > Partnerships and joint ventures > Corporate joint ventures > Joint venture agreement  majority / minority). \r\n\r\nWe have requested a Product Development change to search results so that search for \'shareholders agreement\' suggests Joint venture agreement\r\n\r\nThere are some more complex shareholders agreements in PSL Corporate too and we are considering creating LexisSmart versions next year.\r\n\r\nBy the way, if the customer has a full Library sub there is also the book Reece Thomas and Ryan: The Law & Practice of Shareholders\' Agreements in Library which has some further documents.','2011-10-20 12:22:41',1),(281,142,53,91,'Lack of audit and accounting content','Research ongoing','2011-10-27 14:32:04',1),(291,4,44,131,'Quantum cases - submission to other publications?','Firms are not prevented from submitting cases to Lexis and then submitting them to other quantum publishers and / or publishing them on their own website. We do not insist on exclusive use of their quantum submissions.','2011-11-21 13:59:46',1),(301,4,39,91,'Content','Customer requests additional topic/sub-topic content coverage.','2011-11-24 12:40:08',1);
