IENT',1,0),(7069,'VAT01 ','VALUE ADDED TAX 2001-02 1ED',1,0),(7070,'WB0311','WEBINAR LIABILITY & EXCLUSION CLAUSES IT',1,0),(7071,'PSLD20','LEXISSMART FORMS & PRECEDENTS - EMPLOYMENT',1,0),(7081,'PSLD22','LEXISSMART FORMS & PRECEDENTS - FAMILY',1,0),(7091,'PSLD21','LEXISSMART FORMS & PRECEDENTS - PROPERTY',1,0),(7101,'PSLD23','LEXISSMART FORMS & PRECEDENTS - DR',1,0),(7111,'PSLD24','LEXISSMART FORMS & PRECEDENTS - PI',1,0),(7121,'PSLD25','LEXISSMART FORMS & PRECEDENTS - WILLS & PROBATE',1,0),(7131,'PSLD19','LEXISSMART FORMS & PRECEDENTS - COMMERCIAL',1,0),(7141,'PSLD26','LEXISSMART FORMS & PRECEDENTS - IN HOUSE',1,0),(7151,'PSLD27','LEXISSMART FORMS & PRECEDENTS - LOCAL GOVERNMENT',1,0),(7152,'LEGM55','Lexis Smartforms',1,1);
