INSERT INTO `replyresponses` VALUES (2,4552,101,'TEST RESPONSE1',NULL,NULL,'2011-07-21 10:41:55',1),(12,4552,801,'Anna\'s response to TEST RESPONSE1',NULL,NULL,'2011-07-21 10:45:05',1),(22,4552,101,'TEST RESPONSE 2',NULL,NULL,'2011-07-21 10:50:46',1),(32,4552,801,'Anna responding again',NULL,NULL,'2011-07-21 10:51:58',1),(42,4562,101,'TESTCOMMENT1',NULL,NULL,'2011-07-21 11:05:23',1),(52,4562,15,'Thanks x',NULL,NULL,'2011-07-21 11:09:12',1),(62,4562,101,'testcomment 2',NULL,NULL,'2011-07-21 11:13:50',1),(72,4552,101,'Answer to query',NULL,NULL,'2011-07-22 14:17:02',1),(82,4552,101,'answer',NULL,NULL,'2011-07-22 14:19:24',1),(92,4562,101,'TEST RESP',NULL,NULL,'2011-07-25 15:00:19',1),(102,4522,341,'Could I have a little more detail on what the customer was doing and where they\'d like an undo feature?',NULL,NULL,'2011-07-26 10:48:08',1),(112,4562,101,'Done it',NULL,NULL,'2011-07-26 12:09:43',1),(122,4562,101,'No way',NULL,NULL,'2011-07-26 12:11:06',1),(132,4582,101,'http://tracker.prod.lnukapps.co.uk/products/records/4572\r\n',NULL,NULL,'2011-07-26 12:15:08',1),(142,4542,241,'Please see attached email thread. In summary:\r\nA meeting has been scheduled with PSL representatives to gather detailed feedback on areas for improvement which we can then implement\r\n1.	The site is slow to load. \r\nTo be delegated to Product Development ie Clare Duggan\r\n2.	There is no comparison between the 1985 Companies Act and 2006 Act which PLC includes and which is helpful (although as we get used to the new act there will be less need for this). \r\nFrom Jane Mayfield, Corporate PSL:: The Companies Act toolkit is expected to be added to LexisPSL Corporate in August 2011 providing easy access to the Companies Act 1985 as it stood pre 2006 and how it changed at the relevant implementation dates during the period from 2006 until 2009 along with the Table of Origin and Table of Destination allowing customers to identify the comparable sections of the Companies Act 2006.\r\nIn relation to our practice notes and precedents, as the PSL Corporate product was launched after the Companies Act 2006 was fully in force, we took the decision not to draft substantial content that focuses on historical legislation that is no longer in force.  However, we have aimed to include summaries of any provisions of the Companies Act 1985 remaining relevant to companies that were incorporated under the previous Act within our practice notes and drafting notes to precedents.  If the customer has any specific comments or requests for additional commentary on the previous legislation, please let us know.\r\n3.	If you search in the wrong subject matter, for example if I search for something in corporate, it will not come up even if it is in their company and commercial section, even if you have the relevant subscription (there may well be a way around this that I am not aware of). \r\nTo be delegated to Product Development eg Clare Duggan\r\n4.	There were a couple of areas that I was looking for information on and couldnt find e.g. personal guarantees, and unfair prejudice and derivative actions. \r\nFrom Jane Mayfield, Corporate PSL: Derivative claims and unfair prejudice are dealt with in LexisPSL Corporate under a practice note called Protection of minority shareholders.  This practice note is found in the topic Share capital and minority shareholders/sub-topic Share capital and minority shareholder and gives further access on this matter in Tolleys Company Law Handbook (without the need to have a LexisLibrary subscription).  \r\nThis practice note is found when a full text search in LexisPSL Corporate for either derivative claim or unfair prejudice is carried out.\r\nRe: personal guarantees  There is a practice note on guarantees and indemnities in the Quasi-security subtopic of the Financing topic  but this does not deal with personal guarantees in detail.  We will look into including this in the roadmap of content to include in LexisPSL Corporate and Lexis PSL Company Commercial in the future.\r\n5.	The precedents for the most part are still not as good as those provided by PLC although they have improved and will no doubt continue to do so. \r\n6.	Some areas arent covered off and without access to Lexis Nexis library (for which you have ascertained we have to pay more) precedents cannot be found. \r\nWe are constantly striving to improve the precedents and to ensure that the coverage offered is appropriate. We would like to further explore with the customer what would be most helpful for and the follow-up meeting on 25 August will hopefully address this.\r\n7.	The e-mail updates do not appear to be as useful or as relevant to me as some of those provided by PLC.\r\nWe are trialling different methods to improve the email alerts. I have delegated this part of the Insight to Susan Bentley.','1311693934.htm','RE QualitySolicitors Clarke  Son LLP - LexisNexis Trial.htm','2011-07-26 15:25:49',1),(152,4522,35,'Let me check and see if they\'d be happy for them to call you.',NULL,NULL,'2011-07-27 08:23:38',1),(162,4612,2582,'This is Claire: We have had feedback on this from other clients too. The basic issue is that we have a segment called the \"Abstract\" or Mini summary in the stories which go into the alert in lexis library. The Tolley library alerts isn\'t showing this segment. I know Dan has been discussing with us on this and what the relevant segment was - and we ran some tests for him to see if it was because of the group source they are using on Tolley library for the alerts. The aim is to get this back - Dan will have to update you on what the developers have said.',NULL,NULL,'2011-07-27 14:48:39',1),(172,4602,59,'Testing.',NULL,NULL,'2011-07-27 15:37:06',1),(182,4602,59,'Clare D (27/7/2011)\r\n\r\nThanks for the feedback David. Please see my repsonses below.\r\n\r\n1.  This is one that some of the practice areas (certainly CoCo) has started doing on practice notes. Cara Annett will be able to provide full details if you contact her. \r\n2.  We are looking at a visual refresh of the site over the next 6-9 months so feedback like this is really useful to hear and we can certainly look at ways to differentiate these more.\r\n3.  Similar to above, as we now have such an expansive and growing number of practice areas, this will also be addressed in the visual refresh. Obviously at the moment, they will only see the practice areas they subscribe to so it may look excpetionally busy if you were demoing with your own codes.\r\n 4.  Good point. We are going to speak to our visual designers to see what visual enhancements we can make to ensure this is more obvious. I\'ll keep you in the loop.\r\n\r\nAny questions, please let me know.\r\n\r\nThanks again for feeding this back to us.\r\n\r\nClare.',NULL,NULL,'2011-07-27 17:15:30',1),(192,4582,59,'TEST',NULL,NULL,'2011-07-28 10:11:03',1),(202,4562,59,'TEST2',NULL,NULL,'2011-07-28 10:44:34',1),(212,4562,59,'TEST3',NULL,NULL,'2011-07-28 11:16:57',1),(222,4562,371,'TEST4',NULL,NULL,'2011-07-28 13:25:26',1),(232,4562,371,'TEST5',NULL,NULL,'2011-07-28 14:02:27',1),(242,4642,2622,'Further jurisdictions will be added during the remainder of this year and into Q1 2012',NULL,NULL,'2011-07-28 15:38:24',1),(252,4652,2622,'Further jurisdictions to follow this year and early next.',NULL,NULL,'2011-07-28 15:53:23',1),(262,4632,59,'Thanks for the feedback Gavin. This is not something we have had demand for thus far but certainly a development we can monitor going forward to asses demand and value. If there are websites which we know that customers value and use in a given practice area, some practice areas have created a useful website links document which is then included in their Toolbox so this could be an alternative (cost-effective) way to providing this access Do let me know if you hear any similar feedback in the market. We will certainly keep an eye on it.\r\n\r\nKind regards,\r\n\r\nClare.',NULL,NULL,'2011-07-28 17:24:30',1),(272,4672,691,'We need to get this cracked!',NULL,NULL,'2011-07-29 09:09:13',1),(282,4672,691,'Agreed.',NULL,NULL,'2011-07-29 09:10:35',1),(292,4562,691,'TEST6',NULL,NULL,'2011-07-29 10:42:25',1),(302,4612,2632,'I think this issue is about the mini-summaries not appearing in the e-mail alerts. The release in late Aug will fix this but, please come back to me if the customer is not satisfied.',NULL,NULL,'2011-07-29 11:09:45',1),(312,4562,2632,'test7',NULL,NULL,'2011-07-29 11:28:17',1),(322,4592,221,'We need to know which topics/PNs or precedents the users were looking at before commenting further on this. Do we have this information?',NULL,NULL,'2011-07-29 16:01:48',1),(332,4512,2572,'Can you give a bit more detail as to why user wants to change the selection? Either their client is male or female?',NULL,NULL,'2011-08-01 08:23:33',1),(342,4392,371,'Thank you for your feedback. As you know we are always interested to hear from customers with their suggestions for improving the product. Jonathan Aspinall has recently joined the PSL PI team from private practice and is already working on a project to develop some standard precedents for each stage of the case. I am sure he would be very interested in speaking with Paul and discussing matters further. I suspect we wont include these precedents in the toolbox but rather in the precedent tab of the relevant practice note. We anticipate these precedents will take a number of months to develop and we hope to also have some workflow charts with links to the relevant forms and practice notes for each stage. We will let you know when this project to ready to go live in the product. Many thanks Karen OSullivan  PSL PI  31 July 2011',NULL,NULL,'2011-08-01 09:21:29',1),(352,4572,371,'Thank you for your feedback. We have already identified that we need to accept out of court settlements for clinical negligence cases for the very reasons you have set out. It would be great if this firm could come on board and submit their clinical negligence quantum to us as it is an area we really lack cases in. I think you are correct when you state the guidance notes should be changed to make it clear that we will accept out of court settlements for clinical negligence cases. I am looking into how quickly we can get this amended. At the present time we would not consider extending the submission site to include all out of court settlements. By only accepting court decisions we think we will have a superior quantum database than our competitors. It is a point of difference we can use when marketing our quantum database. If we dont get the number of quantum cases in that we anticipate over the next 12 months (I am confident that we will) then we will reconsider this decision. I understand Jonathan Aspinall is sending the quantum submission link to this firm and I look forward to receiving their quantum submissions. Many thanks for your help on this issue  it sounds like this firm will be a good source for quantum cases for us.  Kind regards Karen OSullivan PSL personal injury 30 July 2011.\r\n\r\n',NULL,NULL,'2011-08-01 09:27:34',1),(362,4592,2612,'The customer has been asked for specifics. Details will be circulated once they are available.',NULL,NULL,'2011-08-01 14:21:33',1),(372,4712,2632,'Forwarded to Chris Boulter as this is a commercial call. ',NULL,NULL,'2011-08-02 09:33:51',1),(382,4722,2632,'From Dan - We are looking into this it\'s on the roadmap. We have some chance of it going into the next release, but if not it will be early next year.',NULL,NULL,'2011-08-02 12:53:26',1),(392,4372,61,'Thanks for the feedback, we\'ll relay this back to the Sales team.',NULL,NULL,'2011-08-03 10:04:47',1),(402,4692,61,'Please forward this to John Scriven for feedback on the Quantum Database.',NULL,NULL,'2011-08-03 10:07:54',1),(412,4732,61,'Thanks for your feedback.  All the Tax material is still avaiable from LexisLibrary so perhaps in this instance it would be best for the customer to use LexisLibrary for both their tax and legal needs if it saves them a hassle of logging into and searching both services.',NULL,NULL,'2011-08-03 10:16:36',1),(422,4782,61,'Thanks for your feedback. One of the concepts for 2012 is to declutter interfaces and use plainer english to make usability easier so hopefully they should see improvement over the next year.  We have been adding more \"life\" to LexisLibrary via the LexisNavigator , wordwheel and DYM functionality this year and will continue to streamline the service with the deliver of the Redesigned Results project in Q1 2012 - which should make reading results much clearer/logical and user friendly.',NULL,NULL,'2011-08-03 10:22:26',1),(432,4702,61,'Thanks, that is fantastic feedback and I\'m great that the wordwheels are having such a positive effect on the user experience of LexisLibrary.  I will let the development team know.',NULL,NULL,'2011-08-03 10:27:08',1),(442,4622,61,'Thanks for your feedback.  To enable this feature it would not only require a page search feature on the commentary search form but substantial reworking of the commentary to include page markers also.  In such a scenario again  I would suggest that the user uses the browse functionality to locate the relevant pages/text.  Also using the \"View Whole of\" when at the document level can make it easier to browse for the  specific part of commnetary needed',NULL,NULL,'2011-08-03 10:33:59',1),(452,4682,2632,'Thanks for the useful feedback. Real-time alerting is something that we have been asked for very rarely so far. However, as this cusomter mentions there is a growing expectation that this type of funtionality will be available in our products. We will monitor further feedback in this area.\r\n\r\nAny product enhancment in this area will  require significant investment, so much more analysis is required.',NULL,NULL,'2011-08-03 11:32:13',1),(462,4742,2632,'Sent to Chris Boulter to look at this from a commercial perspective.',NULL,NULL,'2011-08-03 11:37:27',1),(472,4762,2632,'Mini-summaries are being fixed in the later August release if TL.',NULL,NULL,'2011-08-03 11:39:24',1),(482,4792,2331,'I have checked White Book and Green Book - neither mention any of the factortame cases in conenction with CPR 36.8.  There are many Factortame cases and so given this and the absence of reference in either of the two commentary sources, I am a bit stuck on this. Have asked Dominic to provide me with the customer\'s number so that I can call to discuss direct.',NULL,NULL,'2011-08-03 15:14:32',1),(492,4392,371,'Update received from Jonathan Aspinall 02.08.11.\r\n\"I have this morning spoken to Paul Kirby and confirmed that having a template document for standard directions is something which we have got in mind. I said that it is certainly something I would hope to see in the product. I have not decided whether such a document would be best in the toolbox or the precedent tab. We may have a generic one in the tool box and in due course a more topic specific template in the precedent tab for each topic with a link to that template from the relevant flow chart.\r\nPaul was pleased to hear that we might be able to introduce something along the lines he has suggested.\"',NULL,NULL,'2011-08-03 15:45:35',1),(502,4742,421,'Mark\r\n2 things here:\r\n\r\n1. We will be launching our new menus shortly, which should give clients more choice / flexibiity, and also be more transparent in terms of which content is where.\r\n2. The best fit menu calculator is a good idea in certain circumstances - e.g when a customer knows what all our sources are and understands the benefit to his business; if he doesn\'t know every source however, then this might restrict conversations to pricing of specific titles, as opposed to the value of the service as a whole.\r\nHowever, we are looking at a tool like this for migration purposes, so can potentially build something off the back of this.',NULL,NULL,'2011-08-03 15:54:52',1),(512,4792,2331,'have spoken to Nigel Parker at Cross and cross - he will send me factortame case and I will send him stuff on Green and White Book commentaries and together we will see if the existing PN content needs updating and, if so, how',NULL,NULL,'2011-08-04 15:49:36',1),(522,1661,801,'response test - disregard',NULL,NULL,'2011-08-04 16:43:35',1),(532,4832,801,'test comment from contributor',NULL,NULL,'2011-08-04 16:57:49',1),(542,4832,351,'comment from unrelated SME',NULL,NULL,'2011-08-04 17:01:23',1),(552,4732,1221,'In this instance, the customer is very impressed with the Tolley Library functionality and finds the LexisLibrary functionality restrictive, using on LN library will not resolve this.',NULL,NULL,'2011-08-08 11:11:56',1),(562,4732,61,'Propsed 2012 projects should ease the LL usuability issues. Proposed All subject to approval/budget)=\r\na) decluttering of LL search screens\r\nb) enhanced bookshelves\r\nc) (optional) Nat lang search\r\n',NULL,NULL,'2011-08-08 13:23:42',1),(572,4902,61,'Thanks for your feedback.  Do you know what pratice area this term pertains to?  There is a project in the next 12 months to add more practice area specific terms.  I will let K. Forrester know to add',NULL,NULL,'2011-08-08 15:31:18',1),(582,4902,1361,'This is not practice area specific and is a generic legal term meaning as it is, the full version being res ipsa loquitur  the thing speaks for itself\r\n\r\nThanks,\r\n\r\nRonen\r\n',NULL,NULL,'2011-08-08 15:58:29',1),(592,4732,1221,'thanks for the response..\r\nI think this should really sit within Tax to respond, as the client is currently mis classified in Legal at the moment, can we move it?',NULL,NULL,'2011-08-09 11:35:58',1),(602,4732,61,'It depends if you think improving LexisLibrary would help the user (me) or if you want the menu question discussed - I would contact Daniel Arrowsmith if the latter. Thanks',NULL,NULL,'2011-08-09 12:27:41',1),(612,4892,61,'I woould redirect this query to James Wilson in the Cases team for feedback. Thanks',NULL,NULL,'2011-08-09 12:31:42',1),(622,4872,61,'I need a bit more information around this. Can you email me the steps of how to replicate in LexisLibrary- lisa.regan@lexisnexis.co.uk? It could be a possible release enhancement.',NULL,NULL,'2011-08-09 12:53:10',1),(632,41,NULL,'In Q1 we will be launching TolleyLibrary which will be simpler and easier to use for tax practitioners.',NULL,NULL,'1970-12-31 23:00:00',1),(642,81,NULL,'provide a feature giving option to print or not to print.',NULL,NULL,'1970-12-31 23:00:00',1),(652,101,NULL,'Perhaps give them the option to chose',NULL,NULL,'1970-12-31 23:00:00',1),(662,111,NULL,'Need to assess reasons why some content goes online and some does not, and communicate this to customers. There could be contractual reasons with some content, or perhaps it may have an adverse  impact on certain hardcopy sales.',NULL,NULL,'1970-12-31 23:00:00',1),(672,131,NULL,'Assess the usability of the alerts and see what improvements can be made for future developments.',NULL,NULL,'1970-12-31 23:00:00',1),(682,151,NULL,'Explore if this is possible but we do conform to international guidelines here.',NULL,NULL,'1970-12-31 23:00:00',1),(692,201,NULL,'AS - would like to pick up on this. More standardisation would be good.',NULL,NULL,'1970-12-31 23:00:00',1),(702,211,NULL,'Perhaps KWIC might be looked at. Though the  view option has always been more a matter of personal preference.',NULL,NULL,'1970-12-31 23:00:00',1),(712,231,NULL,'Notes say this is coming.',NULL,NULL,'1970-12-31 23:00:00',1),(722,241,NULL,'Notes say CD is investigating.',NULL,NULL,'1970-12-31 23:00:00',1),(732,301,NULL,'Needs discussion, some customers may like this. ',NULL,NULL,'1970-12-31 23:00:00',1),(742,311,NULL,'Not possible at present, but can see the advantages.',NULL,NULL,'1970-12-31 23:00:00',1),(752,341,NULL,'Some of what they need may already be available via other sources such as Current Awareness which can sometimes contain government information. Perhaps a source for this could be created.',NULL,NULL,'1970-12-31 23:00:00',1),(762,351,NULL,'Would add clarity.',NULL,NULL,'1970-12-31 23:00:00',1),(772,361,NULL,'No examples were given by the customer, but it would be helpful in a search across a PAP page to have a breakdown of the individual volume results for larger works such as EF&P and Halsburys Laws.',NULL,NULL,'1970-12-31 23:00:00',1),(782,381,NULL,'At the moment highlighting text and printing does not work on LL and the toc segments can be larger than the text needed. So the cstomer needs to copy and paste to an e-mail or to Word.',NULL,NULL,'1970-12-31 23:00:00',1),(792,391,NULL,'Customer can create it themselves via client admin.',NULL,NULL,'1970-12-31 23:00:00',1),(802,401,NULL,'LN needs to assess strategy for In-house legal departments / GCs and particularly Enterprise Solutions.',NULL,NULL,'1970-12-31 23:00:00',1),(812,431,NULL,'This has been in developement for improvements including the option to \"View whole of...\"',NULL,NULL,'1970-12-31 23:00:00',1),(822,551,NULL,'The Irish Revenue would like the ability to filter out UK content too, which is only done via a specific search string.',NULL,NULL,'1970-12-31 23:00:00',1),(832,591,NULL,'Can go back to My Research to run the initial search again.',NULL,NULL,'1970-12-31 23:00:00',1),(842,681,NULL,'Possibly she means Simon\'s Taxes rather than STI which does display the dates as the issues are browsed to.',NULL,NULL,'1970-12-31 23:00:00',1),(852,701,NULL,'Don\'t know what she is referring to!',NULL,NULL,'1970-12-31 23:00:00',1),(862,731,NULL,'Can use toc view and the check boxes to select items for printing.',NULL,NULL,'1970-12-31 23:00:00',1),(872,761,NULL,'probably wants to avoid going to the full browse view and only needs the most recent.',NULL,NULL,'1970-12-31 23:00:00',1),(882,881,NULL,'probably wants to avoid going to the full browse view and only needs the most recent.',NULL,NULL,'1970-12-31 23:00:00',1),(892,951,NULL,'This has improved and now a brief summary isprovided for news items.',NULL,NULL,'1970-12-31 23:00:00',1),(902,961,NULL,'Probably more a matter of personal choice, if changes are wanted it is useful to be able to see the current settings at a glance.',NULL,NULL,'1970-12-31 23:00:00',1),(912,1001,NULL,'I think she means being permitted to view alert results belonging to colleagues.',NULL,NULL,'1970-12-31 23:00:00',1),(922,1091,NULL,'This is currently hidden away under the Help link on the legislation search page.',NULL,NULL,'1970-12-31 23:00:00',1),(932,1111,NULL,'Opportunity to re-engage to understand legal needs.',NULL,NULL,'1970-12-31 23:00:00',1),(942,1121,NULL,'He is referring to the History section of My Research where searches are stored for a week, and pages visited for the last 2 days.',NULL,NULL,'1970-12-31 23:00:00',1),(952,1151,NULL,'Further activity in the GRC space. LN needs to decide whether to play in this space.',NULL,NULL,'1970-12-31 23:00:00',1),(962,1161,NULL,'To be discussed at meeting on 30/11/2010, following conversation with Dave Coleman on 25/11/2010. YM 26/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(972,1181,NULL,'No actioned required. YM 15/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(982,1191,NULL,'No actioned required. YM 15/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(992,1211,NULL,'nothing - well known and search enhancements should help',NULL,NULL,'1970-12-31 23:00:00',1),(1002,1221,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nTHIS IS NOT TRUE! Fortunately, I was able to refer to an excellent note in LexisPSL DR on the subject that refers to a practice direction written by Lord Woolf: it is not sufficient to cite an unofficial report if an official or approved report is available\r\n\r\nSo, if you come against an objection to buying our case reports because litigation lawyers think they can rely on free BAILLI unapproved judgments you can confidently tell them that that is not the case. There is a hierarchy of law reports and our Library gives access to all of these apart from the Weekly Law Reports.\r\n\r\nSee attached email for full details',NULL,NULL,'1970-12-31 23:00:00',1),(1012,1231,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nYour Interpretation / Suggested Response Lawyers from different practice areas value different aspects (component modules) from LPSL.\r\nPI lawyers as we note value the extensive quantum database, more than up to date legislation, forms or precedents.\r\nAnother practice area values forms more than up to date legislation and another values up to date legislation more than forms.\r\n \r\nSee attachment for more info\r\n \r\n1) To help future development, focus on developing what is important and highly valued specific to each practice area rather than making us the highest performer in low valued functionality.\r\n2) Develop value propositions for sales to use specific to each practice area.',NULL,NULL,'1970-12-31 23:00:00',1),(1022,1241,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nYour Interpretation / Suggested Response Obviously we know that the cases and legislation in PLC link out to OPSI and BAILLI but may be worth brushing up on why our case and legislation offering is much better, and perhaps have some bullet points prepared we can use to overcome this objection.\r\n \r\nAmanda proposed to put together some bullets on this.\r\n\r\nNo action required. YM 15/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1032,1251,NULL,'Acknowledge pricing strategy to keep out PSL',NULL,NULL,'1970-12-31 23:00:00',1),(1042,1261,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nYour Interpretation / Suggested Response: Does anyone know why we dont? or does anyone know who I can ask?\r\n \r\nAlex Smith:\r\nI believe we were look at a legal practice menu (Cordery, Bar Handbook) onto LexisLibrary. Not sure where this got to. Personally think it should be on LL in the legal library menu at the very least. If commercially the right decision then it would be easy to do.\r\nThe commercial decision is in Orla\'s team.\r\nWe are getting quite a few requests from large law customers who want all LLFs online as they are cancelling print for a variety of practical reasons\r\n \r\nAmanda: In my short life as a head of sales out on customer visits, I have been asked about this 3 times and Im sure the guys would echo that this is a frequent request.\r\n\r\nNo action required. YM 15/10/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1052,1271,NULL,'accelerate case law content within quantum database\r\n\r\nResponse from Clare Duggan, 29/10/2010\r\nLexisNexis is looking to extend their quantum coverage and is offering lawyers a one off fee of 40 for each quantum case submitted which is published in the quantum database and/or other LexisNexis products (eg LexisLibrary, Quantum Cases Database, Butterworths Personal Injury Litigation Service, Halsbury\'s Laws). Quantums can be submitted from now onwards, and early next year, there will be a link available from both LexisLibrary and LexisPSL enabling subscribers to submit these via an online form. We hope this will help to grow our archive in line with Kemps offering.\r\nYM 29/10/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1062,1311,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nYour Interpretation / Suggested Response: \r\nPersonal Injury is a contentious area of law, and therefore the practice involves working with civil procedure rules. The lawyer naturally wanted to make full use of the PI PAP by adding the Green Book, which contains the Civil Procedure Rules and other commentary. The Librarian was unable to do this, as the PAP bookshelf does not allow you to add sources from \"other\" practice areas, although the Green Book is very relevant to personal injury practice.\r\n\r\nI was not aware that the Green Book could not be added to the PAP bookshelf for  Personal Injury. I went through the steps with Kate, and had to concede that it does not allow you to add the Green Book. I promised to take this matter further.\r\n\r\nNo action required. YM 15/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1072,1321,NULL,'No action required. YM 15/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1082,1331,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response workaround; timescales?\r\n\r\nResponse from Clare Duggan, 17/11/2010\r\n\"Thanks for your feedback below. I believe Lexis SmartStyle is due to be rolled out in Q1, 2010. This should help to displace PLC. Further information and training materials will be available closer to the time. I think John Hanratty should be able to give you further information on this if required sooner.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1092,1351,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nYour Interpretation / Suggested Response: \r\nThe table of contents is presented straight away on entering CCH so users can drill down to key information very quickly e.g. tax rates, cases,  This aproach works for them as they have a smaller set of sources.\r\n \r\nPromised to look at this and report findings to others to consider for the new product.',NULL,NULL,'1970-12-31 23:00:00',1),(1102,1361,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\n\r\nYour Interpretation / Suggested Response: \r\nThere isn\'t enough content. This is a lawyer with good technology understanding.\r\n \r\nResponse: Lexis PSl is an organic service relying on suggestions from users and often adding such content . At the end of the session we looked for such a precedent within wider library and found it in EF&P and forwarded by email. Also undertook to forward suggestion to PSL team and let customer know the outcome.\r\n\r\nEffect of response: Pleased to hear that  suggestions acted upon but still dubious about level of coverage and  wishes to discuss needs further with AM.\r\n\r\nNo actioned required. YM 15/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1112,1371,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nI tried to concentrate and emphasise the fact that PSl was topic led.  I took away from this session the fact that many practitioners see an online service as something that HAS to be searched and we need to get across the message that searching is not mandatory and subsequently have used this approach in training sessions to good effect\r\n\r\nEffect of this was grudging acceptance, on subsequent floorwalk the general opinion was more positive\r\n\r\n\r\nResponse from Clare Duggan, 17/11/2010\r\n\"It would really help to know exactly what these users were trying to find so we know where the problem lies. Is it design, functionality, content or something else entirely? Nonetheless, we are introducing word wheels/suggested searches onto LexisPSL next year so this should help them no end.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1122,1381,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nThe client was surprised our search engine wasn\'t smarter and still required connectors.\r\nWe are looking to address this later this year as people are so used to  a google style search online - we have a \'searching\' project underway to enhance users\' experience and offer such tools as \'did you mean\', smart indexing behind the scenes and more \'fuzzy\' searching.\r\nThe user was pleased to hear this but was still surprised it was not the way the site currently worked.\r\n\r\nNo action required. YM 15/11/2010 ',NULL,NULL,'1970-12-31 23:00:00',1),(1132,1391,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\n\r\nThey can\'t see how to access the material. Tax partner is available via another url outside Lexis Library and the link to it is hidden beneath another link Other Lexis Nexis Sources on the Tax & Accountancy page - so it\'s far from obvious to a user. The charity sources needed adding to the bookshelf.\r\n\r\nResponse: I will set up links to Tax Partner on your  PC desktop and add the Charity titles to the bookshelf.\r\n\r\nEffectiveness: Much happier and I have had confirmation that they renewed their contact.',NULL,NULL,'1970-12-31 23:00:00',1),(1142,1401,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nThe yellow tax handbook lists legislation in within the \'parts\' but doesn\'t show (as the main UK stats dbase does) the section range within each part.\r\nI agree it would be useful if you could see the section range within each title of the parts. user agreed this would be a useful development which would add to their experience of using this key tax source.',NULL,NULL,'1970-12-31 23:00:00',1),(1152,1421,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response:\r\n1) searching blogs and websites is a whole different way of searching and has its own variety of challenges. Blog specialists and AM have been in contact withclient and workd to add de -dup as required\r\n2) would like ability to customise on own. blog specialists and AM have been in contact withclient and workd to add sources as required\r\n3) personal interpetation required .. The difference between Great! and GREAT! little can be done, but blog team are aware and something they do try and gauge ',NULL,NULL,'1970-12-31 23:00:00',1),(1162,1431,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nCan a user open a link from the document view tree in a new window or tab \r\nIt\'s not possible to do this but I will feed this back as a suggested product development - the alternative is to press ctrl n to open a new tab showing the same content as the first and then navigate from there.\r\nUsers were a little surprised why this didn\'t work!\r\n\r\nNo action required. YM 15/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1172,1441,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nWhen you search in the Lexis Library cases page against party names for \'H v S\' nothing comes up in relation to the correct case. Searching in the search terms box for \'H v S\' brings up coverage of the case from Bingham and Berrymans, and the result shows as having \'H v S\' as the title/party names. It\'s not the full case but it\'s a good summary that would help to convince our users we have comprehensive coverage.\r\n\r\nFollow-up: Clare Duggan - 24 May 2011\r\nHi Gavin\r\n\r\nFurther to your feedback earlier this year from Howells, the online coordination and fabrication team have explored the issue and it turns out that the cause is down to the (Bingham) source being a combination of commentary and cases content. Unfortunately it\'d be extremely difficult to split the source, and the cases in the content are very short and don\'t have much metadata to work with. \r\n\r\nI am trying to find a case with a WLR ref .The case name is just H v S which doesn\' t help! The ref is  l2002] 3 WLR 1179\r\nAm I likely to be able to find it or does the site not relate to WLR refs at all\"\r\n\r\nIf you find this to be an increasingly difficult issue for customers as time goes on, please come back to me and I\'ll ask the teams to investigate if there are any alternative developments which would resolve this.\r\n\r\nKind regards,\r\n\r\nClare.\r\n\r\n\r\nAllow the case summaries in Bingham and Berrymans to be searched by party name field in the cases page on Lexis Library. We should not have to think laterally about a possible way round it. The content is excellent, so let\'s make it even more accessible!\r\n \r\nOur currently perceived weak PI/Clin Neg content would be extended through these excellent summaries. People give up if they don\'t see it on a first search for party name and go elsewhere eg Kemp & Kemp/LawTel.\r\n\r\n\r\nResponse from Clare Duggan, 17/11/2010\r\n\"Thanks for your feedback below. It looks like this content hasn\'t been marked up correctly so Tom Macdonald is looking into it and hopefully it is something we can rectify going forward.\r\nI\'ll keep you in the loop.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1182,1451,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response:\r\nThe user could see there was an updater one can set but this is a general one and thought it would provide too much info - they wanted a tailored updater.\r\nThe current updater would cover updates from all practice areas but I agree it\'s not targetted and that would be a useful enhancement. it would mean the resource was more useful and relevant to other business units and drive up usage.\r\n\r\n\r\nTo be discussed at meeting on 30/11/2010, following conversation with Dave Coleman on 25/11/2010. YM 26/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1192,1461,NULL,'From Alex Smith\r\n\r\nPlease see below the Westlaw.co.uk announcement around their enhancement on Legal Terms and using legal terms as the entry point to research. \r\n\r\nThis makes our Legal Terms Navigator launch in the December Release (around 4 December) absolutely crucial to meet with as much functionality and content as possible. \r\n\r\nWe need: \r\n\r\n(a) to meet our product development dates and targets without fail. \r\n(b) have as many legal terms in the Navigator as possible for launch\r\n(c) aggressively market this as the way of the future and as something modern and new. \r\n\r\nLuckily West have \"just\" (with nice functionality including wordwheel) put on print dictionaries so we can market their attempt as old skool and a bit lazy compare with Navigator.\r\n\r\nThey don\'t have the backing of the indexes reinvented and they don\'t have the authority of Halsbury\'s to back their definitions.\r\n\r\nThe product side is in hand and we need to gain absolute confidence in the December date. \r\n\r\nContent is twofold: \r\n\r\n(a) Lawrence and content solutions are working hard in getting our Indexes into shape for online\r\n\r\n(b) Katy, two paralegals in my team and a team of freelancers are working on delivering 500 legal terms for launch reaching 750 by year end. However if anyone has further resource to offer in their editorial teams I\'m sure Katy can fully utilise, especially making sure the defining cases and legislation is pulled out. \r\n\r\nThe impact? \r\n\r\nThe West move backs the view I\'ve had all year based on customer research and interviews that Legal Terms is the way into our products and core titles like Halsbury\'s Laws, all england and our practitioner titles. I\'m pleased West have played their card as we have the measure of their offering and whilst it\'s annoying they are there first with a wordwheel of legal terms and terms at the top of their results their approach reflects their slightly dated approach of putting \'books online\" (something we did in the 1990s). Our offering in December remains new, fresh and different and we need to drive forward with the content and product delivery with renewed vigour and focus and to market this firmly as the future of legal research and the doorway to our crown jewels. \r\n\r\nI\'m working with Laura already oin the marketing and I look forward to working with you and your teams to deliver something \'gamechanging\' in December. \r\n\r\nAny ideas and suggestions around accelerating content delivery and marketing tack please let me know. \r\n\r\nAlex\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(1202,1471,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\n\"That\'s a good idea - I will suggest it as an enhancement to our site\"\r\nThis has been reported to terry Eagling-joyce who will raise it further as a proposed development with the editorial team\r\n\r\nNo action required. YM 15/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1212,1481,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nThey are referring to ALL ER reporter cases which are not included within this menu - just ALL ER (employment) and ALL ER European cases.\r\nThe all england reporter is not a source included within the Employment menu - with access to the IRLS, all er itself, knights industrial and now the industrial tribunal reports, it\'s a huge case database.\r\nCustomer still couldn\'t work out why they didn\'t get access to cases picked up by All er reporter - when they were hyper linked in LL.\r\n\r\nNo call to action. YM 15/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1222,1491,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\n1) as to the range of company documents, this will be greatly increased by the launch of Corporate in October, as a lot of the private company content in Corporate will flow in to Company Commercial. As to the specific example given of shareholders agreements, the joint ventures sub-topic in Corporate will include a lot more precedents and practice notes in this area, dealing with a broad range of circumstances.\r\n2) We are aware of the auto-formatting/cross-referencing issue and there is a project running at the moment to develop a way to offer this functionality, so this should soon be resolved.  The footnotes and bullet points referred to in the context of company precedents are in the EF&P content included in Company Commercial.  There will be no EF&P precedents in the Corporate module and no EF&P precedents in the company content of the Company Commercial module come October, so this will no longer be an issue for company precedents.  \r\n3) The Corporate module will include comprehensive coverage of the Companies Act 2006, broken down as the product demands into overviews, practice notes, precedents etc., which will for the most part flow through to the Company Commercial module come October.  We are not planning checklists summarising the Companies Act 2006 changes because with the whole Act now being in force this does not seem appropriate/useful  we would be commenting on the historical position.\r\n4) The company content in the Company Commercial module is deliberately aimed at small to medium firms doing small and medium transactions, the Corporate module will be for those doing more complex transactions and for the full range of transactions.  Again, we cant comment on the complexity of the commercial content.\r\n5) This should be improved come October, we are currently working to develop the taxonomy for the Corporate module, so this should help with searching for company content.\r\n6) There will be more financing content in the Corporate module come October, which will then feed into the Company Commercial module.  However, there will not be a huge amount of financing content, as neither Company Commercial nor Corporate are intended to compete with PLCs Financing module.  In the Corporate module and in the company part of Company Commercial module, the intention is only to provide enough high-level financing content to inform a corporate lawyer doing a corporate deal.  Whether there should be a separate LexisPSL Financing module is currently under discussion.  We will also offer high-level tax content in Corporate and Company Commercial come October.\r\n\r\nNo call to action. YM 15/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1232,1501,NULL,'Moved from ActWise. YM 27/10/2010\r\n\r\nYour Interpretation / Suggested Response: \r\nWe need a Find Related Journal Articles link in LexisLibrary.\r\nFeed back again to prodcut developers, it is on the radar.\r\n\r\n\r\nResponse from Clare Duggan, 12/11/2010\r\n\"Youll be pleased to know that this is something which our Online Coordination Team are working on at the moment and hope to introduce via a Find Related Journals link on LexisLibrary in 2011.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1242,1531,NULL,'We have added PDFs to several of our case series and are happy to receive feedback on other series which our customers would like us to provide in PDF format so we can look to prioritise these going forward. Ones such as Butterworths Intellectual Property and Technology Cases are an example of such a series which we have added PDFs to, as a direct result of customer feedback. This functionality is something we include within a users subscription, and which also extends to other content types such as UK Parliament Acts.\r\nClare Duggan, 08/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1252,1551,NULL,'Response from Clare Duggan to Nathan Hegarty, 12/11/2010\r\n\"Crime is not an area of law we have historically been very strong in. Major criminal cases are covered in the All England Law Reports and criminal commentary is available in Blackstones Criminal Practice and Halsburys Laws of England. The most authoritative law reports are actually the ICLRs which are available on LexisLibrary. We are also planning to launch a LexisPSL Crime Module in 2011 which may be of interest to your customer.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1262,1561,NULL,'1) Although this is an area which Sweet and Maxwell are very strong in, we do offer an array of criminal cases, and very popular commentary titles such as Blackstones Criminal Practice which may be of interest. We are also hoping to launch a new LexisPSL Crime module next year which will mean a wide selection of tools for a criminal lawyer.\r\n2) Again, we do offer a wide selection of housing cases within series such as the All England Law Reports and Estates Gazette. However we would be interested to know if there are any particular cases which would be useful or which our competitor is or isnt covering presently.\r\n3) Customers can get access to historical versions post-1998 through our Legislation team who will email users directly within 2 hours, but more often a few minutes. To submit a request, users simply need to click on the link entitled Historical Versions on the Legislation Search Form and fill in the required information. \r\n4) This is interesting feedback which weve not had before but we will certainly monitor going forward to see if its a common customer requirement across our various sectors.\r\n5) We are looking to extend our journals offering in 2011 so would be interested in the type or name of journals which customers would like us to cover. We are always looking to recruit users onto our quarterly Product Advisory Boards so they can help to drive product development. Do let us know if this customer would be interested in attending.\r\nClare Duggan, 08/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1272,1571,NULL,'1) Customers can get access to historical versions post-1998 through our Legislation team who will email users directly within 2 hours, but more often a few minutes. To submit a request, users simply need to click on the link entitled Historical Versions on the Legislation Search Form and fill in the required information. We have looked into automating this process over the years but there are always enhancements which users prioritise over this one, due to it generally being something they dont need to do very often. It is however something which we continue to monitor and would be interested in knowing if there are any particular areas of law which customers particularly require this historical information for. It may be we can then look to prioritise Acts within certain practice areas going forward.\r\n2) Chitty is one of Sweet and Maxwells titles which unfortunately (but not surprisingly) we have been unable to licence. We do however have a title called Butterworths Common Law Series: The Law of Contract which may be of use to this barrister.\r\nClare Duggan, 08/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1282,1611,NULL,'The client needs to be contacted and the technical problems that are stopping them using the content resolved.\r\n\r\nResponse from Clare Duggan, 29/10/2010\r\nId be interested in seeing exactly what steps they are taking and screenshots of the issues as this doesnt give me enough information to work with. Im assuming it is one for the technical team but Id be happy to take a look if more details are provided.\r\nYM 29/10/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1292,1621,NULL,'PLease can someone from the Employment PSL team contact Lynn initially at the client on 01379 652141 and get the name of one of the Employment team and speak with them directly to find out exactly what content they feel is missing in comparison to PLC. At the moment they feel that the service is a waste of money and their renewal is due Feb 11 and I suspect the sub will be lost at that point.\r\n\r\nResponse from Clare Duggan, 29/10/2010\r\nAgain, wed need to know exactly what content they believe is missing. Id suggest you invite Philip Thornton or one of the team along to your meeting to discuss content issues in more depth.\r\nYM 29/10/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1302,1631,NULL,'Again please can someone from the Commercial PSL team contact the client and obtain the name of one of the Commercial team and then go through with them specifically what they would expect and want to see within the site and talk through our upcoming additions with the client\r\n\r\nResponse from Clare Duggan, 29/10/2010\r\nThe inclusion of LexisLibrary precedents in the CoCo module came about as a result of sales feedback as there was a feeling that customers who took both products didnt know the full extent of what was available on both. It would be worth discussing this in more depth with Veronica Bailey.\r\nYM 29/10/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1312,1641,NULL,'This relates to both the practise areas they subscribe to, Employment and Commercial. I am going to visit the client to understand in more detail what their content issues are and it would be helpful to have a product specialist with me as I will not be able to answer any very specific comparison between either pLC or EF & P\r\n\r\nResponse from Clare Duggan, 29/10/2010\r\nAgain, an item to discuss when you take one of the lawyers along to your customer meeting. With regards to the 3,500 message, this is no longer appearing on LexisLibrary, as we now display the most relevant 1000 documents when the results list is this large. The linking issue sounds the same issue as 1611 above. \r\nYM 29/10/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1322,1651,NULL,'No call to action. YM 29/10/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1332,1671,NULL,'Ensure our pricing and offering for solo\'s is competitive.  \r\nBasic offering at low price with options to pay for extra as and when needed may by attractive.',NULL,NULL,'1970-12-31 23:00:00',1),(1342,1691,NULL,'\"The reason for not reproducing page numbers on Journals (in a similar fashion as we do for cases) is because we don\'t reproduce the journals as we do in hard copy ie page 1 followed by page 2 etc because we arrange the articles and editorial comments differently. To follow the hardcopy scheme would not have the structure that aids navigation online - therefore to put in the muddled page numbers would be messy. It is however something which we will continue to monitor.\"\r\nClare Duggan, 08/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1352,1701,NULL,'\"Bibliographic software compatibility is something which we have been working towards and we are hoping that LexisLibrary will be compatible with Refworks by the end of 2010. We will keep customers informed in our monthly e-burst update.\"\r\nClare Duggan, 08/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1362,1711,NULL,'No call the action; Derek confirms that the appropriate people have been informed. YM 06/12/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1372,1721,NULL,'No call to action; Derek confirms that the appropriate people have been infomed. YM 06/12/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1382,1731,NULL,'We need to assess how much of a threat this is to Masterplan/Legal Intelligence',NULL,NULL,'1970-12-31 23:00:00',1),(1392,1741,NULL,'More feedback than a problem. This can be done but it is important that the feedback is picked up by the right people.',NULL,NULL,'1970-12-31 23:00:00',1),(1402,1751,NULL,'Improve the resources so we issue passwords quicker. It seems as though we have lost a member of staff or two and the peole left are struggling to keep up with the requests.',NULL,NULL,'1970-12-31 23:00:00',1),(1412,1761,NULL,'get a list of PLC CoCo precedents and ensure LPSL includes this as a minimum\r\nfind out whats missing in CoCo and ensure we have this in either LPSL or LexisLibrary and then inform the sales group so we know where to find it\r\nhave a core list of precedents (or whatever the content challange is) which we know we have and PLC does not, and which we know customers want, and actively expose the absence as a weakness in PLC\r\nuse the \'build your own package\' approach - we will be able to offer more practice areas next year\r\n\r\n\r\nResponse from Clare Duggan, 12/11/2010\r\n\r\n\"Ive included Cara, Susan and Laura from Content Acquisition in the email as I believe that they will be interested in the feedback and how we approach this.\r\n\r\nI am not sure that simply replicating PLC precedents or other content in our CoCo module is the right approach. My preference would be for sales to set up some customer meetings for Content Acquisition to attend and get a real understanding what it is that customers are after on the content front so we can prioritise accordingly and get to the heart of our customers needs. I am sure the quality and the range of areas covered are as, if not more, important than pure numbers. We also have to remember that PLC have been writing this content for over 10 years so simply replicating what theyve done is not going to be quick or necessarily the best way to compete. I have heard some customers complain that PLC have a bloated offering with too many precedents on the same matter, so it may be that we need to validate this and come up with a  more compelling offer.\"\r\n\r\nResponse from Cara Annett, 21/01/2011 \r\nThe Content Acquisition response to this was communicated to WFT in a recent Sales meeting (3/01/2011), and is set out in the attached slides [Wai-Fung please note that in the table I have amalgamated standard docs and standard clauses into precedents as previously discussed]. Essentially, we have identified (as a rough first cut) approx. 300 missing docs and we are prioritising them based on usefulness to the customer (anything esoteric, out of date or irrelevant to a company commercial lawyer is categorised as 4 or 5 priority; therefore not urgent. We will revisit to this group of documents to provide Sales with an explanation as to why they are not useful to have in PLC once priorities 1 and 2 have been addressed. Priorities 1 and 2 are being added to the CoCo teams roadmap and in due course we will communicate the publication of these documents or the timeframe for addition.\r\n\r\nMany thanks to Wai-Fung who has provided a law grad on secondment to Content Acq. for the next two weeks. Jess will validate the current variance analysis, update it, output a list of docs we have that PLC don\'t (to provide to Sales) and refine the responsibilities and reasoning behind priorities.\"\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(1422,1771,NULL,'More movement in the in-house legal solutions space. Greater pressure for LN clarity of approach for in-house market.',NULL,NULL,'1970-12-31 23:00:00',1),(1432,1781,NULL,'i indicated there is a project underway to enable this kind of functionality which is increasingly expected as a BASIC function of our downloaded precedents - this project needs to have more resource and urgency if PLC are to be stopped in their tracks.\r\n\r\nResponse from Clare Duggan, 12/11/2010\r\n\"Content Solutions are working tirelessly on the LexisSmart Style Project and hope to deliver this functionality in Q1, 2011. There will be communications and demonstrations available in the new year prior to launch.\"\r\n\r\nFurther response from Clare Duggan, 17/11/2010\r\n\"Ive just had a further update on this. Cross referencing is actually outside the scope of this project but there is some work being looked at about cross referencing of numbers longer term. We dont yet have a timeframe on this.\r\n\r\nApologies for any confusion. Im sure John Hanrattty could provide further information if required.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1442,1791,NULL,'investigate sourcing this content\r\n\r\nResponse from Clare Duggan, 12/11/2010\r\n\"I have passed this feedback onto the Cases team to investigate. I will let you know of any developments.\"\r\n\r\nResponse from Clare Duggan, 15/11/2010\r\n\"The cases team have done some exploration of your feedback below and haven\'t been able to find anything on Land Valuation Tribunals.  There is a website called \"Valuation Tribunals\" and also a website called Residential Property Tribunal Service which talks about Leasehold Valuation Tribunals (also referred to as LVT). If the customer could provide further information or examples of this content it might be possible to evaluate whether this is something that would be included in our cases offering.\r\n \r\nThis has been flagged with Hemali Patel, Managing Editor of Case Materials, in case there is any further feedback relating to this.  There are currently no plans to add any content like this at the moment.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1452,1801,NULL,'Look at a different, flexible and affordable packages for sole practitioner (or small groupsbarristers as I have many customers who travel to the Inns to use the library rather than subscribe to us.\r\n\r\nPassed to Dave Coleman. YM 15/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1462,1811,NULL,'I forwarded this query to the Corporate/CoCo LPSL team, they did reply very quickly and answered the query.  However, I don\'t think the answer given actually addresses the issue.  I was told that the results LexisPSL gave for the seacrh we ran for website communications did actually contain the information Jessica required, but the information was actually contained within a drafting note of one of the precedents given in the results.  So I appreciate the information is there but I am sure when Jessica can run this search on PLC and instantly be given the information she is not going to want to waste her time trying to dig arund on LexisPSL for the information when it is not clearly & obviously presented in the results.\r\nSo the issue would appear to be the ease of use of PLC, and on the basis of this example I can fully understand why Jessica would now feel PLC is quicker, easier to use & quickly directs her to the answer for this query.\r\n\r\nResponse from Clare Duggan, 16/11/2010\r\n\"I think its an interesting one in that looking at PLC results, they dont necessarily even contain the whole phrase (results 2 and 3). Did Jessica think all the results (or just number 1) were relevant? Was the drafting note useful or did she need to be able to access the precedent too? Is the problem that we just dont have the type of material (precedent/practice note or other) that PSL were able to provide. From our authors perspective, it sounds like they believe the right content is on there? I dont suppose we have the full PLC document to show our authors do we? \r\n\r\nOne enhancement we will be introducing on LexisPSL next year is synonym searching which may help if this term as an example has multiple names or referred to in more than one way.\r\n\r\nIm not sure Ive necessarily given you any answers here. In fact Ive probably asked a lot more questions but itd be interesting to dig a bit deeper to see whether its a content, product or functionality issue which needs addressing here.\r\n\r\nHappy to have a chat next time youre in Halsbury House or if you want to continue the discussion on email.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1472,1831,NULL,'Account manager to pitch a deal that includes an alternative offering of case law from Lexis to the LawTel which they don\'t like.\r\n\r\nPassed to Dave Coleman. YM 15/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1482,1841,NULL,'Account manager to be aware and package into any deal our equivalent content which would be Lexis PSL Employment/Lexis Library Employment (Amanda Wadey already aware of this information)',NULL,NULL,'1970-12-31 23:00:00',1),(1492,1851,NULL,'A general comment to be aware to back up decisions as to the approach of creating our precedents (which I believe is already happening with PSL ones), but just to back up that the market do feel the need for this approach.\r\n\r\nPassed to Dave Coleman. YM 15/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1502,1861,NULL,'The nature of this content would be useful if not already, then to be included in Tolley Guidance.\r\nSecodnly, if it is possible, as they seem to be books we own, could we put them into the Library and or Tolley Guidance direct?\r\n\r\n24.05.11 - reassigned to Tolley Guidance Team. Email sent.\r\n24.05.11 - spoke with Anita Harwood and sent email\r\n\r\nAH I have been unable to find any books with the title Tolley Workbooks.  The most appropriate sounding titles with two volumes that include practical examples is Taxwise  I & II.  These are annual titles and are part of the library',NULL,NULL,'1970-12-31 23:00:00',1),(1512,1871,NULL,'No call to action. YM 17/11/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1522,1881,NULL,'The above feedback is quite common and I believe it\'s this type of functionality which reduces a users experience of navigatign lexis library easily. i think we need to look at these functions again and look at ways to improve the user\'s experience as Simon suggested above.\r\n\r\n\r\nResponse from Clare Duggan, 17/11/2010\r\n\"Thanks for your feedback below. We are about to embark on a usability study to look at results pages so hopefully we will be making these pages more intuitive as a result of research findings. Do you think Simon (and any of his colleagues) would be interested in partaking?\r\nInterviews take no longer than an hour and they will be offered a 100 cash incentive or 100 towards the charity of their choice. Interview slots are available the w/c 29th November or 6th December if he does want the opportunity to shape these developments.\r\nI look forward to hearing from you.\"\r\n\r\nReply from David Smith, 18/11/2010\r\n\"I could ask but before I do, he is based in Selby North Yorkshire (quite a way) - or can these interviews be done remotely. Also, his comments relate to the doc view and browse trees - he actually doesn\'t really search as such, so if it\'s specifically the actual results page you\'ll be looking at, I\'m not sure he\'s your best person.\r\nHe was pretty straight talking though and expressed his frustrations as a user. \r\nLet me know if the above would work for you and I\'ll drop him a line.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1532,1891,NULL,'Consider adding links from PSL to take users into lexis library so they can browse further from the Butterworths links in PSL (i know we have some of these links into lexis library but think they should be alongside ALL of the \'butterworths\' links.\r\n\r\n\r\nResponse from Clare Duggan, 17/11/2010\r\n\"This is something which we have looked into before and remains in a backlog to be revisited. At the moment, we have had to prioritise other items such as word wheels and navigation to sub-topic when searching as we believe they will add a lot more value to the product as whole but we will certainly continue to monitor this and will let you know if we do decide to add this at a future point.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1542,1901,NULL,'Do our PSL team know which case this would be and if there are any plans to update our service to take it into account?',NULL,NULL,'1970-12-31 23:00:00',1),(1552,1911,NULL,'Investigate their revised offering and report back to sales on features, pricing etc if possible\r\n\r\nResponse from Lisa Regan, 10/12/2010\r\n\"The LexisCheck product development team is aware of this Link Studio product in the market. \r\nIt is a mark-up tool that creates hyperlinks to cases/legislation in your documents.\r\nLexisCheck is a superior offering because not only does it create hyperlinks in your documents, it also provides status signals (traffic lights) indicating the validity of that piece of law with further links to related commentary and cases also.\r\nThere is no competitive analysis document as such but if you are interested in seeing the comparison for yourself, information can be found here http://www.justcite.com/about/justcite-link-studio.aspx or here http://www.justispublishing.com/services/linkstudio.html\"',NULL,NULL,'1970-12-31 23:00:00',1),(1562,1921,NULL,'Lexis PSL (and EF&P) does have a link to the site where the CPSE can be found (where they are free), but it is quite embedded within the site.\r\n\r\nMichael and Colleen said is there a way it could be more prominent?\r\n\r\nI know there is investigation at the moment for other PSL modules to include a toolbox of useful links such as the one in Personal Injury. Would it be possible to have a link on the front page of Property PSL for the CPSE in an area like a toolbox?\r\n\r\nThey also felt a link could be useful in a toolbox like area on the front page for Stamp Duty Calculators (for leases?), and a Mortgage Calculator. Do these exist on other free sites that we could link to rather than having to create from scratch?\r\n\r\n\r\nResponse from Clare Duggan, 30/11/2010\r\n\"Malcolm Dowden and I have had a conversation around this and hes of the mind that theyre all very good ideas. He pointed out that we have links to SDLT calculators on the landing pages, but if we could present them in a toolbox, similar to PIs, then the user experience could be significantly improved.\r\nApparently the CPSEs issue is a long running saga.  They were originally placed on PLC because it was the only available site.  The British Property Federation stipulated that they must be made freely available.  However, over time PLC have asserted a creeping copyright to the enquiries  hence the need for a link to their site...\r\nI will continue discussions with Malcolm on this and we can investigate the best way to move forward.\r\nIll obviously keep you in the loop.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1572,1931,NULL,'Jessica suggested that we should amend the search facility in LexisPSL to reflect the way that end users would assume it should work (i.e. natural language, or at least putting an impled and or w/p behind the scenes)\r\n\r\n\r\nResponse from Clare Duggan, 30/11/2010\r\n\"Youll be pleased to know that we are looking to introduce suggested searches across PSL in Q1 of 2011, so there should be a lot less reliance on connectors. This will not only aid end-users in locating their required materials but will also provide users with a consistent approach in LexisLibrary and PSL if they take both products.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1582,1941,NULL,'PM 24.05.11 Email sent to Vicki Tubb & Malcolm Dowden\r\nPM 24.05.11 Malcolm Dowden has confirmed that the issues raised were previously addressed\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(1592,1951,NULL,'Response from Nachum Sokolic, 17/12/2010\r\n\r\nCan you attach an example precedent, or point me in the direction of an example precedent, in PAM, which is failing?',NULL,NULL,'1970-12-31 23:00:00',1),(1602,1961,NULL,'Amend the LPSL search facility to incluide forms in the search results.\r\n\r\n\r\nResponse from Clare Duggan, 29/11/2010\r\n\"This is currently a limitation which we are hoping that we can rectify longer term once the Forms team have made some content enhancements enabling forms to be searched. In the interim, well add a Top Tip to one of the next e-bursts to remind customers to look for this content on the Forms landing pages.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1612,1971,NULL,'To be sent to Donald Cran - not yet demo\'ed. YM 23/02/2011\r\nPM. Delgated to Donald Cran 13.05.11\r\n\r\nPM Update received form Cara Annett 15.06.11. Closed pending further follow-up\r\nCara advises that this matter was addressed directly with the AM back in December 2010 but no follow-up was given to the questions asked. Cara states in an email from December 2010:\r\nAmanda, Mark,\r\nPlease can you let me know whether this customer is comparing our PSL CoCo updates with PLC Commercial updates or with PLC Intellectual Property updates?  I can\'t currently get into to PLC to see but I\'d like to check this because from what I\'ve seen PLC\'s Commercial module doesn\'t really cover IP at all. \r\nThe piece in question is a summary of a Telegraph piece which is on a feed from LexisLibrary Current Awareness. I think most LexisPSL modules feature this feed as a value add. The source is called the UK Newspaper Index and it is popular with customers who use it to make sure they are prepared if a client comes asking about something reported in the newspapers. \r\n\r\nWe\'re grateful to Ralli for flagging the issue though because it highlights that what this source is could be made clearer in LexisPSL (in LexisLibrary, the source does have details that explain what it is. In LexisPSL Updates Archive, there is a brief description of the sources of updates but I don\'t think customers setting up an alert would see this). Therefore, we\'ll investigate this and would hope to provide clarification in the product shortly. We are also looking into providing enhanced linking between the Newspaper summaries and the legal updates. These two steps will I think overcome the issues with newspapers unsophisticated reporting whilst ensuring that law firms still have access to material to help them keep abreast of news coverage. Could you let the customer know and find out what he thinks about that?\r\n\r\nCan I check - was Mr Arrowsmith\'s problem with the error message (not being the person who set it up (from the start of the thread)) resolved? ',NULL,NULL,'1970-12-31 23:00:00',1),(1622,1991,NULL,'Response from Laura Brown, 02/12/2010\r\n\"Hi Lynne, \r\nI saw your comment re the draft pre-action protocol letter for a construction case. Ill ask a couple of the PSLs if this is something they are planning to do and will forward any response to you. \r\nLaura\"\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(1632,2001,NULL,'PM 24.05.11:Email sent to P. Thornton',NULL,NULL,'1970-12-31 23:00:00',1),(1642,2011,NULL,'We are intending to add a second tranche of calculators to the personal injury product later in 2011. I have noted the request for an interest on costs calculator and will certainly consider including it in the toolbox when the new calculators are being developed.\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(1652,2021,NULL,'No call to action.  Derek confirms that he is informing the appropriate people. YM 06/12/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1662,2031,NULL,'Agreed with Dave Coleman that this should be categorized as a Product Insight; delegated to Clare Duggan. YM 06/12/2010\r\n\r\nResponse from Clare Duggan, 06/12/2010\r\n\"Since we have introduced suggested searches across Quick Find, we are hoping that the number of search fields and forms our subscribers use starts dropping. This, in time, may give us the ability to move towards this type of search that Google offers (although we all know legal research is quite different than general surfing on the internet). As you know, we are currently doing usability on the results pages which should help us to identify what users want to do after they run a search and what they need from a product perspective to make this an intuitive workflow.\r\nWell keep you in the loop about what comes out of the study and what developments we decide on as a result of this study.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1672,2041,NULL,'Ensure cross referencing works as this is one of the few possible weak points in PLC.\r\n\r\nConsider having multiple versions of core documents such as a compromise agreement (junior level and senior level) so we can also deliver what PLC does. \r\nOur version is very different at present in that it requires lots of input compared to PLC so is not as time efficient. We need our version, but we would benefit hugely from a version similar to PLC\'s that senior people feel they could turn to the site for (put together quickly). \r\n\r\nMark Edwards:\r\nThis is useful feedback and this approach has been taken for the will, and is under consideration for the compromise agreement. Currently we are awaiting further customer feedback on the compromise agreement before any decisions are taken.',NULL,NULL,'1970-12-31 23:00:00',1),(1682,2051,NULL,'I have suggested this number be changed and the answer phone message amended.\r\n\r\nThis has already been picked up by clare duggan / Luella Porter - this entry is simply to record the insight.\r\n\r\n\r\nResponse from Clare Duggan, 29/11/2010\r\n\"This number has now been changed to the Belfast Helpdesk number so it is picked up quickly and then directed to the correct team of lawyers where required.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1692,2061,NULL,'I appreciate it\'s a trade off between users being able to see the main headings on a reasonable sized web page but would it be possible that if a user opens the \'view all topic\'s\' once, that it\'s then locked on so they don\'t have to keep opening them every time they return to the home page.\r\n\r\nI would probably argue that potentially it would be better to have all topics open on the left by default - I believe from looking at how clients use this site that this would give particularly untrained, new users a far better experience - more people seem ok with scrolling down a web page than notice the \'open all\' links.\r\n\r\n\r\nResponses from Clare Duggan, 30/11/2010\r\n\"From a design perspective, it isnt considered good practice to expose items below the fold as users tend to miss them, hence the product being designed in thus way. In the PSL usability study conducted earlier this year, we tested this function and users overall had little trouble locating this icon. We can of course retest this next time we run further PSL usability work. \r\nIt is also worth mentioning that we are working to add suggested searches to LexisPSL in Q1, 2011 so this will also negate the need for connectors and will aid our users in pinpointing the exact materials theyre after.\"\r\n\r\nReply from David Smith, 30/11/2010\r\n\"but would it be a good idea to \'lock it on\' - so if a user has clicked on it once, it then stays open when they return to the home page or log on again?\"\r\n\r\nFurther response from Clare Duggan, 30/11/2010\r\n\"Itd need validation David but well certainly retest in the next set of usability on PSL. Thanks again for passing on the feedback.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1702,2091,NULL,'Further developments in the outsourcing / LPO space as firms gear up for the impact of the Legal Services Act\r\n\r\nNo call to action.  Derek confirms that he is informing the appropriate people. YM 06/12/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1712,2101,NULL,'Additional developments in the legal services market in advance of the Legal Services Act. Expect more alternative models for service delivery emerge.\r\n\r\nNo call to action.  Derek confirms that he is informing the appropriate people. YM 06/12/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1722,2111,NULL,'FYI sent to the appropriate people on 09/12/2010. YM 15/12/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1732,2121,NULL,'FYI sent to the appropriate people on 09/12/2010. YM 15/12/2010',NULL,NULL,'1970-12-31 23:00:00',1),(1742,2131,NULL,'Change one or both logos to better reflect the content on PSL - at least differentiate them.\r\n\r\nResponse from Clare Duggan, 09/12/2010\r\n\"There was a commercial decision made to market and sell these as a package, hence the standard icon for them both. I think you need to encourage and explain to the support teams to check whether they are looking at forms or precedents before they direct their queries. Hopefully it is a teething issue which should be resolved once theyre educated.\"\r\n\r\nReply from Claire Melvin, 09/12/2010\r\n\"We agree with the concept to sell them as a package and the co branding  but this is not just the support team that are being affected  we had another one of these today from DH Stalland  asking why a particular document which was a smart form was broken (which it wasnt)  but it didnt have specific features on it which are actually smart precedent features not smart form features. We get the same sort of thing coming in the other direction with people complaining that a smart precedent doesnt have feature x  which you only get in a smart form.\r\nWeve tried to explain  that where they are in the precedent tab the features are different than those in the forms tab  with the same logo but no one gets itI think we need some more visual clues  say different coloured logos with the same branding   or something we can tell them to remind them (or more clarity in the support and promotional material)  that these ones do this  and the other ones do that.\r\nSame brand  both good  but different features.\"\r\n\r\nFurther response from Clare Duggan, 09/12/2010\r\n\"Thanks for the further clarification Claire. We can certainly look into this further and get a sizing for this work. Ideally Id want some further customer validation too which may be possible in some PSL usability sessions next year.\r\nIll keep you in the loop.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1752,2141,NULL,'We are going to package in new PSL and LexisCheck content to try and retain as much of this revenue as possible, but usefull for all to know that Westlaw are continuing with very aggressive pricing, and unless usage is high, it is difficult to persuade the client to stay with us at the same level of revenue...',NULL,NULL,'1970-12-31 23:00:00',1),(1762,2151,NULL,'With the revamp of Quantum we should look to take this customer feedback on board and do something about the search forms and sorting of results functionality.\r\n\r\nThis will be critical when our quantum data improves next year if users are to extract the maximum value from the data (and hence our investment in improving it) and find what they need. Just a bout every PI session I do users criticise our data and in particular the fact that there\'s no ability to sort results by VALUE.\r\n\r\nNicola thought that neither search from was quite right for the variety of different scenarios they find themselves in and I have to agree. I think we need to work towards ONE FORM which is the same on both sites and gives the user the ability to search with as much flexibility as they need.\r\n\r\nNicola (who is a trainee, soon to qualify and BIG advocate of our services internally) is also more than happy to speak to us about what needs to improve. She uses our site all the time and is the highest user in the firm...01792529622 nicola.cornelius@jcpsolicitors.co.uk\r\n\r\n\r\nResponse from Lisa Regan, 16/12/2010\r\n\"This is really useful and perhaps there is work to be done to the Quantum search forms in the New Year to make them more user friendly. I will raise this with some other customers and to the Product Development team to get their thoughts and opinions on how to proceed.  As a note, altering the search forms is application work and tied to scheduled Rosetta releases. Its doubtful we will have anything until at least Spring if we decide to make changes as the 2 first releases of 2011 are full up  February and April.\r\nIt is on my radar though!\"',NULL,NULL,'1970-12-31 23:00:00',1),(1772,2161,NULL,'Gemma Page has provided detailed information and offered a visit to explain further the offering.\r\n\r\nYM 12/01/2011\r\n\"Post my conversation with Dave Coleman regarding this Insight, it appears, judging from the Customer\'s feedback, that the purpose and benefits of e-books were not abundantly clear to the customer, particularly whether this product is a complement to or a substitute for one of our other products.  Therefore, we pose the following questions:\r\n 1) Have the benefits and positioning of e-books been communicated to the Sales force so they can handle such queries as raised in this Insight?\r\n 2) Equally, are the marketing collateral / customer communications clear on these points?\"\r\n\r\nSee email attachement for Cara\'s response. YM 17/01/2011',NULL,NULL,'1970-12-31 23:00:00',1),(1782,2171,NULL,'Nothing needs to be done as the fix is already in hand but Malcolm wanted the positive feedback to be recorded somewhere hence this insight.',NULL,NULL,'1970-12-31 23:00:00',1),(1792,2181,NULL,'Test',NULL,NULL,'1970-12-31 23:00:00',1),(1802,2191,NULL,'Test',NULL,NULL,'1970-12-31 23:00:00',1),(1812,2201,NULL,'Test',NULL,NULL,'1970-12-31 23:00:00',1),(1822,2211,NULL,'test',NULL,NULL,'1970-12-31 23:00:00',1),(1832,2221,NULL,'N/A',NULL,NULL,'1970-12-31 23:00:00',1),(1842,2231,NULL,'test',NULL,NULL,'1970-12-31 23:00:00',1),(1852,2241,NULL,'Test',NULL,NULL,'1970-12-31 23:00:00',1),(1862,2251,NULL,'Response from Clare Duggan, 09/03/2011\r\n\"Longer term we are working towards a single forms repository which will hopefully enable us to offer a search across Forms. It\'d be interesting to hear what ordering Maxine would find more intuitive on this page.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1872,2261,NULL,'Carry on as we are, ensuring we having appropriate coverage, but not too much as can link to Lexis Library.\r\n\r\nAwaiting response from Malcolm Dowden. YM 19/01/2011\r\n\r\nResponse from MJD:  I recently had an opportunity to compare PLC directly with LexisPSL Property.   There is no doubt that PLC\'s coverage of property issues is extensive.  However, I think that we are in a position to be far more positive about the ability of LexisPSL to match up point for point.   The key advantage of LexisPSL is that we can keep our practice notes brief and practical - links to LexisLibrary material and other resources (eg Law Soc guidance notes) allow us to be concise where PLC must describe cases, legislation etc in the body of their notes.   However, be aware that PLC are beginning to respond directly to LexisPSL.  They have adopted the \'tab\' structure for topics and sub-topics, and they are trying to break their long practice notes (eg more than 50 pages on easements) into more manageable and focused notes.  While that is an indication that they are raising their game in response to LexisPSL, it does give us an immediate opportunity to highlight the many instances where they have \'blank\' tabs (ie no content behind them).  In a number of areas LexisPSL content now surpasses PLC\'s.  The tab that is always populated in PLC is \'legal updates\' (ie material drawn from their excellent daily update emails).  However, that material is undifferentiated and includes a lot of outdated content.  It would be worthwhile considering as a marketing tactic the application of LexisCheck to content downloaded from PLC.  ',NULL,NULL,'1970-12-31 23:00:00',1),(1882,2271,NULL,'Response from Clare Duggan, 20/01/2011\r\n\"Both of the points Tom raises are items we will be validating in our usability study next month so we can assess their relative importance in the backlog of LexisPSL developments. The first item has historically been down to the fact that we haven\'t had a single repository of Forms but I believe we are getting closer to this solution, which may open up new opportunities.\r\nWe will be looking for attendees in the usability study so if Tom is interested, it\'d be great to include him.\"\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(1892,2281,NULL,'Martin would like to see more intuitive search functionality - some of which is there with the word-wheels but for more general research too.\r\n\r\n\r\nResponse from Clare Duggan, 25/01/2011\r\n\"I think the double word-wheel on the Explore box which is due out in Q1 2011 should help Martin with his more general research. We\'ll be sending around internal and external communications on this closer to the time.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1902,2291,NULL,'investigate why the bar does not always behave and perhaps make it easier to pick up.\r\n\r\n\r\nResponse from Clare Duggan, 25/01/2011\r\n\"This is something we can certainly monitor and am sure as we move away from a frames based product going forward, will disappear in the longer term.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1912,2301,NULL,'continue to develp the search functionality with to make it as easy as possible for users to find content. People expect everything to work like google with it\'s complex algorithms to find a best fit and generally find what users want quickly.\r\n\r\n\r\nResponse from Clare Duggan, 25/01/2011\r\n\"There\'s not a lot to add here - as you know, there are further enhancements being made to the search over the coming months which should help significantly\"',NULL,NULL,'1970-12-31 23:00:00',1),(1922,2311,NULL,'this insight was added in error as i had already done it - insight number 1881 - apologies.\r\n\r\nthis has been dealt with.',NULL,NULL,'1970-12-31 23:00:00',1),(1932,2321,NULL,'Review what we allow as documents that KYC ID accepts for id verification as many people don\'t have a passport or driving licence.\r\nIt sounds liek it is possible, just a Lexis choice to not include it as yet.\r\n\r\nUpdate Mark Dunn 03.05.11\r\nThese are currently the only documents enabled by GB Group for their URU service used by KYC ID. We can discuss with GB to see if the ID document options can be expanded.\r\nUpdate Mark Dunn 05.05.11\r\nI have a monthly catch-up with GB Group and will discuss this with them later this month.\r\n\r\n\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(1942,2331,NULL,'Review how Sanctions appear on the report - can it be tracked/proved that individuals have been checked as not being your client so safe? IE change colour on the report, or have some kind of \'stamp\'?\r\n\r\nUpdate Mark Dunn 03.05.11\r\nThis is not a feature inbuilt within URU currently and we will need to check back with GB Group to see if their product interface allows this type of functionality. \r\nUpdate Mark Dunn 05.05.11\r\n\"I have a monthly catch-up with GB Group and will discuss this with them later this month.\"\r\n\r\n\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(1952,2341,NULL,'nothing - just a bit of info!\r\n\r\nResponse from Joanna Bhatia, 22/02/2011\r\n\"We have been working hard on our current awareness in Property PSL and recent feedback suggests we are ahead of PLC in terms of reporting on cases.\r\nYour customer may also find it helpful to receive the PSL daily email alert (set up by going to Manage Legal Updates as I\'m sure you know) if he subscribes to LexisPSL which may prove to be even more focused for him.\"',NULL,NULL,'1970-12-31 23:00:00',1),(1962,2351,NULL,'Analysis for training needs of PI firms\r\nKaren O\'Sullivan emailed 14 March 2011:\r\n Ogden tables to be within toolkit - we plan to add these to the toolbox when its contents are expanded later this year. The engineers are currently ascertaining how much info we can fit into the toolbox before the front page becomes cluttered and confusing\r\n Industry \'Norms\' - for example when a hair dye goes wrong there would be a industry norm amount that we can refer to without going to Quantum - I have added this to our roadmap for consideration. I suspect we may just link to relevant websites from the toolbox but that would still save the fee earner time. It may be too risky to have the information in the product as it would be hard to keep it up to date\r\n Out of court Settlements - for example those cases which do not get to court but are settled out of court - I have never thought these are of much use but if I got more feedback asking for this we could consider expanding the quantum database to include them\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(1972,2361,NULL,'Can we allow access to this content within both menus?\r\n\r\nDO we have an update on this trakcer, customer has requested feedback, thanks\r\n\r\nPM 25.05.11 Insight reassigned from Jon Scriven to Lisa Regan.',NULL,NULL,'1970-12-31 23:00:00',1),(1982,2371,NULL,'I fed this back to Jonathan Scriven (CC\'d Amanda Wadey). with details on comments made - email sent 24th Jan\r\n\r\nKaren O\'Sullivan responded by email 14 March 2011 - \r\n we are aware our clinical negligence content is limited and needs to be expanded. An external author is working on new practice notes and these should appear in the product soon\r\n we are launching a big marketing campaign in the next 2 months to significantly expand the number of cases in our quantum database. This should increase the number of clinical negligence quantum cases in the database and hopefully resolve the customer\'s concern\r\n we are aware multiplier calculators need to be included in the second tranche of calculators which will be released later in 2011\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(1992,2381,NULL,' More Clin neg overall - an external author is in the process of preparing additional clinical neg practice notes and we hope to add these to the product shortly\r\n Multiplier calcs - a second tranche of calculators are to be added to the product later in 2011. We intend to include multiplier calculators in this second release.\r\n A Disclosure letter (not pre action) - this is currently being prepared and should be added to the product shortly\r\n Letter for a client setting out the stages of a court case - this is a good idea and something we will certainly consider adding in the future\r\n Letter to client regarding seriousness of not telling the truth and the importance of the statement of truth - this is a good idea and something we will certainly consider adding in the future\r\n PI trust advice letter explaining what it is and why they need it - this is a good idea and something we will certainly consider adding in the future\r\n Letter to client explaining expert meetings and what they will do - this is a good idea and something we will certainly consider adding in the future\r\n Letter to client explaining general and special and provisional damages - this is a good idea and something we will certainly consider adding in the future\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2002,2391,NULL,'email to Dolly - LExis PSL\r\nWorking in collaboration with family team and external author to improve children\'s content.  Hopefully Q3 2011.',NULL,NULL,'1970-12-31 23:00:00',1),(2012,2401,NULL,'Contact PSL team, give email address of trainee.\r\nSee PSl response:\r\n\r\nDear Ms Searle\r\n\r\n \r\n\r\nFurther to my email last week and your subsequent conversation with my colleague, Samantha Burnett, I am pleased to advise that a new precedent, Letter  employer\'s invitation to employee to work a KIT day (maternity leave), has now been added to LexisPSL Employment.\r\n\r\n \r\n\r\nYou can access it by browsing via the topics on the left hand side of the home screen under Protected rights in employment > Maternity, parents and carers > Precedents tab, under the heading maternity leave.  Alternatively, you can access it by clicking here (you will be prompted to log on to the service before being taken directly to the precedent).\r\n\r\n \r\n\r\nI hope that you find the new precedent helpful.  If you have any comments on it, please feel free to pass them on directly to me.\r\n\r\n \r\n\r\nThank you very much for your input.\r\n\r\n \r\n\r\nYours sincerely\r\n\r\n \r\n\r\nMelanie Adams\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n\r\n\r\n \r\n\r\nMelanie Adams\r\n\r\nSolicitor\r\n\r\nLexisNexis\r\n\r\nHalsbury House\r\n\r\n35 Chancery Lane\r\n\r\nLondon, WC2A 1EL\r\n\r\n \r\n\r\nmelanie.adams@lexisnexis.co.uk \r\n\r\n+44 (0)20 7400 2752 Direct\r\n\r\n+44 (0)7771 947135 Mobile\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2022,2411,NULL,'Karen O\'Sullivan emailed her response on 14 March 2011:\r\n\'I have just reviewed your \'Day in the life\' document for Benyons on the insight tracker. I note the main feedback from this fee earner was:\r\n\r\n\'More client letter precedents.  I have to explain everything to my client, process, stages etc and it would be great to have these as templates.\'\r\nThis seems to be a request a few customers have asked for so I have added it to our roadmap and will seriously consider adding some client letter precedents as soon as possible\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2032,2421,NULL,'Please note there is no option for LN News & Business in the porduct family drop down - can you please amend\r\n\r\nLN needs to compile a statement that can be used by Sales so as to qwell any concerns regarding the potential loss of data from its services which may be due to publishers re asseessing their pricing models',NULL,NULL,'1970-12-31 23:00:00',1),(2042,2431,NULL,'Train the Helpdesk and introduce an ongoing programme to support them so taht they may provide better support to clients on the Nexis.com, Lexis.com platforms',NULL,NULL,'1970-12-31 23:00:00',1),(2052,2441,NULL,'Is there a plan to surface Elegy information into QuickView?  If not, can there be?\r\n\r\nDC: Hey Manni, this is a well documented issue, shared by a number of the SalesForce. The issue is under review in terms of getting the detail surfaced in QuickView, but may be held off until SOMIT is delivered. I will chase business systems for you.',NULL,NULL,'1970-12-31 23:00:00',1),(2062,2451,NULL,'More of our front list book titles should be made available as e-books.\r\n\r\nResponse from Victoria Taylor, 04/02/2011\r\n\"Thank you for providing this feedback. By the end of Feb we\'ll have the following tax titles available as eBooks: Tolley\'s VAT Cases 2010, Tolley\'s Tax Cases 2010, Whillan\'s Worldwide Taxes 2010-11, Tolley\'s Tax Guide 2010-11, Tolley\'s Capital Gains Tax 2010-11 (Budget Edition & Main Annual), Tolley\'s Corporation Tax 2010-11 (Main Annual), Tolley\'s Income Tax 2010-11 (Budget Edition & Main Annual), Tolley\'s Inheritance Tax 2010-11, Tolley\'s Value Added Tax 2010 Second Edition, Clarke: Offshore Tax Planning 17th Edition, Tolley\'s Yellow Tax Handbook 2010-11, Tolley\'s Orange Tax Handbook 2010-11, Tax Office Directory 2011 First edition, Tolley\'s Tax Planning Set 2010 and Tax Office Directory 2011 first edition. \r\nThe rest of the tax list (with only a few minor exceptions) will be available when the printed edition publishes.\r\nI would very much like to hear which titles the customer wanted in eBook format that were not yet available. Please could you let me know?  \r\nHowever, in 2011 we will be publishing the majority of tax titles as eBooks.\r\nI\'d be very happy to discuss this with you further. Which titles were they particularly interested in? Does the customer take Tolley Guidance?\"\r\n\r\nManni Sasani, 04/02/2011\r\n\"The client used to take the library which they cancelled. Tolley Guidance is of interest to them but we haven\'t reached the trial stage yet as they are still reluctant about the concept of taking another \'online\' service.\r\nI believe it was the tolley tax \'planning\' titles that they wanted which was missing.\"\r\n\r\nIn this instance the customer\'s reluctance was mainly to do with price of multiple-licences. This query has been passed directly to the tax developer in case there is anything we can do for this particular customer. ',NULL,NULL,'1970-12-31 23:00:00',1),(2072,2461,NULL,'I have already reported this one to Alex Smith too - i don\'t think any of the current search enhancements would help as if one enteres a partial word at the start of a search in quick find - such as \'sever joint tenancy\' , the word wheel doesn\'t then find \'severing\' - which is the word used in the actual precedent.\r\n\r\nResponse from Alex Smith, 23/02/2011\r\n\"This is great feedback on one of the core wider feedback we have on LexisLibary and LexisPSL. We are currently in the middle of massive two year investment around the search but getting the engine right for legal research involves a lot of research. \r\nWe\'d love to have this customer involved in some of our upcoming Search and Results usability studies. Could you please contact the customer to see whether they would be willing to be part of this (likely to an hour in the next few months) and get their details? We will be testing several engine capabilities and how they test with what the user is looking for. \"\r\n\r\nResponse from David Smith, 25/02/2011\r\n\"Hi Alex,\r\n\r\nYes indeed - this firm have already agreed to take part in the usability study and Clare Duggan is to contact them.\r\n\r\nHi Clare,\r\n\r\nI mentioned the other day that JCP have a young solicitor - Nicola Cornelius who you should try to get them to engage in the usability study when you visit, another person is Chris Shaw who gave me the following feedback which I entered into the iknow tracker (very similar thing to the bloke from Phillips & Co in Ludlow - insight 2471):\r\n\r\nChris had been searching for a deed severing a joint tenancy (particularly the one he knew exists in BWPAS. He had entered into lexis library in various boxes \'sever joint tenancy\', had tried connectors and other arrangements but could not find it.\r\n\r\nhe went back to the old CD BOS for BWPAS and entered the same search and found it straight away. He was rather dismayed that the older CD search seemed much more user-friendly.\r\n\r\nThey are 2 offices apart\"',NULL,NULL,'1970-12-31 23:00:00',1),(2082,2471,NULL,'I know some of the search enhancements will help but this was the 2nd time in a week someone had referred to the flexibility of the BOS CD search and how it was better than Lexis Library\r\n\r\nResponse from Clare Duggan, 23/02/2011\r\n\"Did you show the customer synonym searches as this is a good example of where your search terms don\'t have to be in the document? As I\'m sure you\'re aware, we\'re continuing to make a huge investment in search enhancements so really want to highlight the realm of great features and functionality to our customers. There will be more usability studies going on this year for searching and search results this year, so it\'d be good to include a user like Steven if he was willing to participate.\"',NULL,NULL,'1970-12-31 23:00:00',1),(2092,2481,NULL,'Offer both the longer shop leases but also a very much shorter, basic lease for a shop to cater for our different markets and client bases. They considered this to be possibly the most common document they use.\r\n\r\nResponse from Malcolm Dowden, 04/02/2011\r\n\"Ive been in touch with David on this insight and agreed to add a new precedent to meet the customer feedback.\"',NULL,NULL,'1970-12-31 23:00:00',1),(2102,2491,NULL,'DC: Hi Sam having looped around with the Tax team, they totally agree and this issue is well recognised. They have plans in place to rectify this and its on the RoadMap. Keep raising this in your team meetings for updates and thanks for your input.',NULL,NULL,'1970-12-31 23:00:00',1),(2112,2501,NULL,'Response from Clare Duggan, 23/02/2011\r\n\"Lisa and I will take a look at what this would involve and come back to you. It\'d be good to get some customer contact details as and when it arises too.\"',NULL,NULL,'1970-12-31 23:00:00',1),(2122,2511,NULL,'Investing in our precedents proposition so that they are easy to use and do not involve significant secretarial work to be utilised. We are very far behind our competitors in this regard. SmartPrecedents is a step in the right direction, but it is not yet comprehensive, and we have excellent precedents in sources such as Atkins which we do not make accessible enough.\r\n\r\nResponse from Clare Duggan, 23/02/2011\r\n\"There is a project underway which will enable the use of a house style tool on both PSL and LexisLibrary Jon Hanratty\'s team has been heading this up so I\'ll get some timeframes and give you an update shortly.\"',NULL,NULL,'1970-12-31 23:00:00',1),(2132,2521,NULL,'Response from Victoria Taylor, 14/02/2011\r\n\"Thanks for sharing these comments. These issues have cropped up a number of times before and have all been logged. Linklaters are due to commence an eBooks trial at the end of this month so we should receive further comments when they actually begin to use the product. Thanks again.\"',NULL,NULL,'1970-12-31 23:00:00',1),(2142,2531,NULL,'Response from Clare Duggan, 22/02/2011\r\n\"Interesting insight.\"',NULL,NULL,'1970-12-31 23:00:00',1),(2152,2541,NULL,'update from Tim Wakefield:\r\n\r\nSuzanne \r\n\r\nI agree that this looks like a clause bank rather than a repository for favourite forms. At present there is no plan to develop this functionality on the portal and I am not sure that this is something that we would necessarily prioritise for the moment. I will log the feedback and monitor over next few months to see if we get further similar requests. For the moment this customer will have to use a work around which could be to save a completed TR1 as TR1_Indemnity_Covenant_1 and then cut and paste from that form into new forms as required. \r\n \r\nThanks,\r\n\r\nTim \r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2162,2551,NULL,'Check if there really have been any changes to PLC in terms of the way you search and what content appears.\r\nListen out for other clients feeding similar information and maybe bring this observation into PLC ousting conversations if it is appropriate\r\nEnsure we keep our content in PSL nicely set out and structured, and focused with any results from searching. She liked our tabs that appear o searching in PSL (eg Cases/Practice Notes etc)\r\n\r\nNo call to action, according to Jane Mayfield. YM 09/03/2011',NULL,NULL,'1970-12-31 23:00:00',1),(2172,2561,NULL,'The heading currently there should be changed so that it gives a proper indication of the contents within it, such as Gifts in Wills. The General Note could then be the first paragraph within that section.\r\n\r\nPM  - Re-delegated from Jon Scriven to Lisa Regan 24.05.11\r\nLR 26/05/2011 - I\'ve forwarded the query to Tracey McGovern who is best palced to deal with this query \r\n\r\nPM: Update received from Tracey McGovern 02.06.11 which included response from author:\r\nAuthor Leslie Lintott states \"On this point, Tracey, it looks as if somewhere along the line a heading which is mean to apply to one paragraph only (AP 5.33) has been formatted to look as if it\'s a main heading to the next series of sub-headings.  In the index to the hard copy it is easy to see that the next paragraphs are all about gifts, etc and I don\'t think the fact that AP5.33 has its own heading matters at all.  It is the way it opens in the browser which causes the problem.   \r\n\r\nTracey then said \"The author seems to think that it\'s more to do with the styling of the heading than the name of the heading. I will therefore take this on board when I\'m amending the whole division as regards headings and layout in the next week or so and hopefully this problem will be rectified for the July release\"\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2182,2571,NULL,'we should aim to meet with the corporate partner to discuss how we can work with them. call me to discuss. Gavin\r\n\r\nAnne-Marie Claydon spoke directly to Gavin Shaw about strategy for this client in the w/c 28/02/11. \r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2192,2581,NULL,'Response from Janna Purdie, 22/02/2011\r\n\"Discuss the position with Smart Forms with Mark Edwards.  Given that the Smart Form precedent is drafted so that the offer is not time limited my view is that the case would have no impact on the form unless the user sought to amend the precedent produced. However, I do not know to what extent Rebecca amended it.  I am happy to have a look at it over the week in an external author capacity if that helps (I don\'t have time during the working week).  My view is that the warning should be removed from the form and replaced by a note setting out that if a user seeks to edit the precedent produced they should bear in mind the impact of the C v D case.  URGENT\"\r\n\r\nFurther response from Victoria Tubb, 04/03/2011\r\n\"I have reviewed this feedback from Janna on behalf of Mark Edwards.\r\nShe has instructed that the current warning on the LexisSmart Precedent for Part 36 Offers is not relevant and should be removed.\r\nI have instructed Matt Poulsom to remove the warning.\r\nIn terms of feedback to the customer I suggest that Lynne explains that the LexisSmart precedent has been reviewed in light of the case of C v D and we can confirm that it does not need to change.\"',NULL,NULL,'1970-12-31 23:00:00',1),(2202,2591,NULL,'we should be going after CCH tax cusotmers and offering them a more flexible way of getting their infomation\r\n\r\nDC: Hi Christine, having looped around with the Tax team, they totally agree and this issue is well recognised. They have plans in place to rectify this and its on the RoadMap. Keep raising this in your team meetings for updates and thanks for your input..!',NULL,NULL,'1970-12-31 23:00:00',1),(2212,2601,NULL,'Response from Elinor Clark (in Malcolm\'s absence), 22/02/2011\r\n\"Malcolm has dealt with this query\"',NULL,NULL,'1970-12-31 23:00:00',1),(2222,2611,NULL,'Response from Janna Purdie, 21/02/2011\r\n\"I need to discuss the updating of Smart Forms with Jon Scriven (the DR practice area director) as this is not within my remit but I would like to provide you with a complete response in relation to the issues raised for both Smart forms and PSL.  I will respond in detail tomorrow morning.\"\r\n\r\nResponse from Janna Purdie, 22/02/2011\r\n\"Discuss the position with Smart Forms with Mark Edwards.  Given that the Smart Form precedent is drafted so that the offer is not time limited my view is that the case would have no impact on the form unless the user sought to amend the precedent produced. However, I do not know to what extent Rebecca amended it.  I am happy to have a look at it over the week in an external author capacity if that helps (I don\'t have time during the working week).  My view is that the warning should be removed from the form and replaced by a note setting out that if a user seeks to edit the precedent produced they should bear in mind the impact of the C v D case.  URGENT\"\r\n\r\nFurther response from Victoria Tubb, 04/03/2011\r\n\"I have reviewed this feedback from Janna on behalf of Mark Edwards.\r\nShe has instructed that the current warning on the LexisSmart Precedent for Part 36 Offers is not relevant and should be removed.\r\nI have instructed Matt Poulsom to remove the warning.\r\nIn terms of feedback to the customer I suggest that Lynne explains that the LexisSmart precedent has been reviewed in light of the case of C v D and we can confirm that it does not need to change.\"',NULL,NULL,'1970-12-31 23:00:00',1),(2232,2621,NULL,'Response from Clare Duggan, 09/03/2011\r\n\"Is their current service PLC or some other product? Are they subscribers or trialists of PSL?\r\na) If they do provide any specific examples of content they deem missing, it\'d be interesting for the lawyers/authors hear what they are. It may be that those areas are already available (but labelled differently), in the pipeline already or possibly something we could look to add.\r\nb) We are discussing this with users in our usability study at the moment so it may be something which we develop later if there is an overwhelming customer need. Did Nick mention what practice areas he might want to search across or had he struck problems before when he didn\'t know which module to search? Please let me know if you do have any further information on this or if this chap might be a suitable candidate for the study.\"',NULL,NULL,'1970-12-31 23:00:00',1),(2242,2631,NULL,'Response from Lisa Regan, 03/03/2011\r\n\"Thank you for your feedback.\r\nWe were unaware of this issue previously.\r\nThere is a 2011 project underway to redesign the results lists so this may correct the issue.\r\nWe will possibly be getting rid of the left hand results groupings e.g. by topic and presenting the info in a different way e.g. tabs.\r\nThe majority of our customers do use Internet Explorer without issue, this is useful feedback nonetheless though.\r\nI will ensure the Prod Dev team knows about this issue so when testing we can also include testing using Google Chrome/Firefox as more browsers appear on the market.\"',NULL,NULL,'1970-12-31 23:00:00',1),(2252,2641,NULL,'For in-house team.\r\n\r\nWe need to ensure that our development is done by shadowing in-house lawyers (possibly by industry sector) and really understanding what their daily queries are in order to focus our coverage on these areas.  This will offer real practical guidance.\r\nFurthermore, some form of \'Ask the team\' service via telephone needs to be explored with a view to having PSLs dedicate time on the phone for our clients rather than the current hap hazhard approach',NULL,NULL,'1970-12-31 23:00:00',1),(2262,2651,NULL,'Response from Matt Grant, 09/03/2011\r\n\"Marketing are aware, and we\'re chasing a quotable from the partner involved.\"',NULL,NULL,'1970-12-31 23:00:00',1),(2272,2671,NULL,'All PAP bookshelves need to be de-cluttered\r\n\r\nLISA REGAN, 24/5/2011: Michael Urie in the Content Support team is looking into the issue of updating PAP bookshelves. I will forward this issue to him.',NULL,NULL,'1970-12-31 23:00:00',1),(2282,2681,NULL,'Karen O\'Sullivan emailed 14 March 2011 stating:\r\nThe figure provided in the \'value\' section of the cases summary is the general damages value at todays date. If customers want to know the figure for general damages that were actually awarded to the claimant they should click into the case and that information is at the top of the case summary. I think the \'value\' section of the case summary could make it clearer that the figure stated is at today\'s value. I will ask for this amendment to the database results to be made to the product asap',NULL,NULL,'1970-12-31 23:00:00',1),(2292,2691,NULL,'Karen O\'Sullivan emailed on 14 march 2011 stating:\r\n we are aware our clinical negligence content is limited and needs to be expanded. An external author is working on new practice notes and these should appear in the product soon\r\n we are launching a big marketing campaign in the next 2 months to significantly expand the number of cases in our quantum database. This should increase the number of clinical negligence quantum cases in the database and hopefully resolve the customer\'s concern. I have noted their request for hospital infection cases (eg MRSA and C Diff)\r\n see 2701 for my comments on out of court quantum settlements\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2302,2701,NULL,'Karen O\'Sullivan emailed a response on 14 March 2011 stating:\r\n\'We have had a number of requests from customers for out of court settlements to be included in the quantum database. We will consider expanding the database to include them if it seems appropriate to do so (I have concerns about how useful out of court settlements are to fee earners generally although I can see in an area where nearly all the cases settle without trial [such as deafness] then there may be a need for their inclusion in the database)\'',NULL,NULL,'1970-12-31 23:00:00',1),(2312,2711,NULL,'Karen O\'Sullivan responded by email 14 March 2011 stating - \'We are currently testing our new quantum database submission form - and hope we can go live in the next 6 weeks. Once the submission system is live then there will be a marketing campaign to generate a high volume of case submission - which should subtantailly increase the size of our database. The feedback on the information needed for deafness cases is really useful. PSL lawyers will check all the quantum cases before they are put into the database. If the case is a deafness one then we will go back to the submitter for the average binaural hearing loss figure if they have not included it in their submission. This should address the customer\'s concerns\'',NULL,NULL,'1970-12-31 23:00:00',1),(2322,2721,NULL,'The renewal is due in October and a decision on what service to continue with will be made in June. We have opened dialogue and re-introduced LexisPSL.\r\nGavin Parsons is the AM\r\n\r\nRelevant people informed via Dave Coleman. YM 10/03/2011',NULL,NULL,'1970-12-31 23:00:00',1),(2332,2731,NULL,'The Stop Press should be printed automatically with the legislation document.\r\n\r\nLisa Regan 22.03.11 (input by Phil Mone):\r\nI can see in some circumstances that a user would want to print the legislation without the stop press information so full customer validation would be needed if we were to automatically print the Stop Press on the legislation document. \r\nWe have product Advisory Boards coming up in April where customers come along to a forum and discuss developments/issues/feedback so we can as them then what they think.',NULL,NULL,'1970-12-31 23:00:00',1),(2342,2741,NULL,'In the process of arranging a meeting/telecon with one of our PSLs to discuss the issues raised\r\n\r\nUpdate Clare Duggan 15.04.11\r\nClare has stated \"Thanks for the feedback from Helphire. I am hoping that the majority of the items were addressed by the PSL lawyers on your customer visit but I have made a couple of comments below with regards to the functionality and linkin\"\r\n1) In relation to the Voluntary Insolvency isse  \"I\'ve asked the paralegal in the CoCo team to take a look at this link to see if the issue still remains and will let you know if not.\"\r\n2) In regards to searching issues \"Hopefully the wordwheels we released on LexisPSL this week will help on the search front and lessen the chance of getting zero results or irrelevant results. We will be extending the scope of these content-wise over the coming months.\r\n3) In regards to the PSL Updates, Clare states \"Did they go into any detail about the frequency they are after and what do they mean by variety? Any further information you can glean on these would be gratefully received. It would be good to understand whether it\'s the format or the content (or both) that needs addressing.\"\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2352,2751,NULL,'Clare Duggan has updated (15.04.11) to specific points below:\r\nTHEY NEED AN FS MODULE OF PSL : \r\nClare States \"I believe this is in the pipeline for the next 12 months. Rachael West will be able to confirm.\"\r\n\r\nTime is always an issue and at the moment it is much slower using Library than it was using PLC \r\nClare states \"I have the US performance team running some tests on the product over the coming weeks as we have also noticed a degradation in the speed in recent weeks. I will let you know the outcome of that and hopefully we can make some improvements.\"\r\n\r\nCaron ran through some example searches and outlined the use of connectors etc - The results we generally got to were good and relevant but the process of filtering and the search methodology of Library is very \'clunky\' and \'confusing\' compared to what they are used to in PLC\r\nClare states\" Were they using the wordwheels or were their issues more around the results retrieved? We are currently doing a big project around improving our results pages and would be very interested to speak to them and discuss our prototypes if they would like to be involved and help shape the new-look results pages.\"\r\n\r\nWith little relevant material in PSL at present the FS team will only use Library and this lacks any practical guidance which is a big issue compared to PLC \r\nSome simple step-by-step \'how to\' guides and a search tips manual would be very helpful (Caron is emailing search tips) \r\nClare states \"The LN Academy training modules have been added to LexisLibrary and will be added to PSL soon too which should help. Hopefully word-wheels will reduce their need to use connectors as well.\"',NULL,NULL,'1970-12-31 23:00:00',1),(2362,2761,NULL,'1. The service has five updates per annum which is more than any direct competitor in this area. They publish in the same months each year - March, June, August, October, December but will be adjusted as necessary to ensure that significant changes in the law are covered as soon as possible.\r\n\r\n2. The service offers in-depth and comprehensive analysis and guidance on all immigration matters - something which is not freely available online. ',NULL,NULL,'1970-12-31 23:00:00',1),(2372,2771,NULL,'Were some of the technical problems they experienced, teething issues as they trialled at launch.\r\nI am trying to re-visit the team with the new trusts content that has been added and wonder if some of the issues they had could be overcome by training - but do we need to re-visit the simple standard wills that we are making available on the site.\r\n\r\nThis firm uses our precedents mainly from BWPA as their standard and they have a project to review and automate what they can to speed process and were very keen.\r\nThey are also about to buy a new house styler tool so we have a further opportunity to go back in.\r\n\r\nAttached is the screen shot that she refers to in her email.',NULL,NULL,'1970-12-31 23:00:00',1),(2382,2781,NULL,'Dan is investigating whether or not we can add this as a feature of \"My Research\".\r\n\r\nLISA (25.03.11): We can validate this with customers and see if the majority of users will find it useful.  We have product advisory boards (forums) in April so we can validate the idea then.  We cannot guarantee that we will definitely develop it, but we will investigate the possibilty. Regards',NULL,NULL,'1970-12-31 23:00:00',1),(2392,2791,NULL,'Update Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n\r\nUpdate Philip Thornton 27.04.11 \r\nAs regards the point about splitting content across tabs, we regard this as a useful product feauture which is superior to PLC. It would seem that the customer disagrees. There is no realistic prospect of this element of LexisPSL design changing in the foreseeable future. We have never heard any other customer express this particular view.\r\n\r\nTurning to the comments about precedents: We now have over 320 precedents in LexisPSL Employment. A list is attached.\r\n\r\nThe team have just added a new, totally revamped version of our most frequently-used precedent, the compromise agreement, which was overhauled in response to customer feedback and to reflect the latest legislative changes and current practice. It also now includes detailed drafting notes and links to our practice notes, the relevant legislation and HMRC material. They have also added a suite of 17 precedents (also with drafting notes), containing optional additional clauses to be used with the new agreement. This is in addition to the LexisSmart version of the compromise agreement. \r\n\r\nThey are also totally overhauling the:\r\n             Service agreement (to add extensive drafting notes and provide optional clauses for listed companies and those operating in a regulated environment) (target date is end of May)\r\n             Basic contract of employment (target date is end of June)\r\n             Share sale and business sale warranties and indemnities (target date end of July)\r\n             Restrictive covenant materials (target date end of August)\r\n\r\nIn addition, the team also plan to add several client-facing precedent letters (eg, letters of advice on: employment contract, director\'s service agreement, compromise agreement, conducting disciplinary investigation/hearing, overviews of tribunal procedure etc). They hope to start adding these by the end of the year.\r\n\r\nExtensions to the LexisSmart precedent offering in employment are also planned (over the course of the next nine months or so) to include:\r\n             Service agreement (three versions)\r\n             Basic contract of employment (numerous versions)\r\n             Written statement of particulars of employment\r\n             Consultancy agreements\r\n             Non-executive director letter\r\n             Secondment agreement\r\n             Trainee solicitor contract\r\n\r\nThe LexisPSL Employment  team have also recently added numerous contentious precedents (ET1s, ET3s and related tribunal documents) relating to claims under the Equality Act 2010 and, with those, now have a total of over 110 contentious precedents.  We understand that PLC currently have only 20 or so such precedents.\r\n\r\nThe team obtained over 70 precedents from Shepherd and Wedderburn earlier this year and are now collaborating with them over the production and maintenance of some of the precedents in the product. They are using some of these new precedents as the basis for creating updated and more contemporary versions of existing precedents (eg the service agreement, consultancy agreements, secondments agreements, policies and procedures) and to plug some gaps (eg in relation to medical report requests and TUPE).\r\n\r\nIf you have a need for a particular precedent we do not currently have in PSL, if you could the Employment PSL team (contact: melanie.adams@lexisnexis.co.uk) know, they will always do what they can to expedite adding it to the product.',NULL,NULL,'1970-12-31 23:00:00',1),(2402,2801,NULL,'Update Clare Duggan 15.04.11\r\nIf you select Part 36 offers, select PRactice Notes, select defendent receiving a Part 36 offer - deciding whterh to accept offer.  Within this PN, the majority of the cross references to other PNs result in a no documents found message, which looks awful for a customer?\r\nI\'ve asked Matt Poulsom who is the paralegal for the DR team to investigate this and will come back to you asap.\r\n\r\nFollow-up: 24/5/2011\r\nHi Lynne\r\n\r\nFurther to your feedback below from Jordans Solicitors, I just wanted to let you know that these cross references have all been corrected.\r\n\r\nIf you select Part 36 offers, select Practice Notes, select defendant receiving a Part 36 offer - deciding whether to accept offer.  Within this PN, the majority of the cross references to other PNs result in a no documents found message, which looks awful for a customer?\r\n\r\nKind regards,\r\n\r\nClare.\r\n\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2412,2811,NULL,'Karen O\'Sullivan Pi PSL 12 April 2011\r\nThe practice notes for Part 36 offers in PSL are being amended at the present time to be more PI specific as the current versions are of more general application having been copied from the DR product. We will also be including some precedents in this section which should cover the CRU issue Gemma has referred to.\r\nThe document assembly for Part 36 offers in Lexissmart is currently on hold due to the recent Court of Appeal decisions in this area. I am making enquiries about when this work will be re started.\r\nI anticipate the new practice notes and precedents will be on the product by the end of May 2011.\r\n\r\n11.04.11, Phil Mone, Email sent to Karen O Sullivan\r\n\r\n\r\n25.03.11 Janna Purdie : \r\nThe reference to CRU is to The Compensation Recovery Unit (CRU) works with insurance companies, solicitors and DWP customers, which is used to recover:\r\n\r\namounts of social security benefits paid as a result of an accident, injury or disease, where a compensation payment has been made. This is known as the Compensation Recovery Scheme. In addition as I understand it there is a separate recovery system for costs incurred by NHS hospitals and Ambulance Trusts for treatment from injuries from road traffic accidents and personal injury claims which is known as Recovery of NHS Charges. \r\n\r\nThe CRU is not referenced in the Part 36 practice notes or precedents in DR module as we do not deal with personal injury.  However, the Personal injury team use our information on this.  The issue is that the precedents in DR need to be amended to make them more reflective of the position for a PI lawyer and that amended version of the precedents should be made available in the PI module which is the one which I assume Gemma Bean should be using if she is looking at PI cases.\r\n\r\nThis would need to be actioned by Jon Scriven/Karen O\'Sullivan who work on the PI team.  I have changed the practice area above to Personal injury.',NULL,NULL,'1970-12-31 23:00:00',1),(2422,2821,NULL,'Karen O\'Sullivan -PI PSL - 13 April 2011\r\nI have added these requests to our roadmap for further consideration in the future. Initial research indicates there might be a licensing issue in relation to the pre-action protocols but if they can be added to the product they will be. It shouldn\'t be difficult to add something to the practice note to cover Katherine\'s request for guidance on when to appeal the CICA.\r\n\r\n11.04.11, Phil Mone,  Email sent to Karen O Sullivan\r\n\r\n25.03.11 JANNA: MIB is the Motor Insurers Bureau and CICA is Criminal Injuries Compensation Authority and so I  think the issues raised in this insight arise out of the Personal injury module as we do not deal with these in DR module which is what I deal with.  \r\nThis needs to be sent to Jon Scriven and Karen O\'Sullivan who deal with the Personal Injury module',NULL,NULL,'1970-12-31 23:00:00',1),(2432,2831,NULL,'Clare Duggan 15.04.11\r\nThis is something we are working towards and hopefully the alternative rendition project (i.e. word downloads on Looselaf sources) that John Hanratty\'s team is working on will be a step in the right direction.\r\nIf not then consistent delivery of word downloads across precedents content will be rolled into the Investment case that Tim Wakefield is currently awaiting sign off on from Alex Sage/ Nicky. If it is signed off then phase 1 delivers June 2012.\r\n\r\nClare Duggan Follow-up 24.5.2011\r\nHi Lynne\r\n\r\nFurther to your insight from Jordans Solicitiors submitted earlier this year, I wanted to let you know that word downloads have now been rolled out across the Looseleaf sources. If users come across any specific instances/ precedents that appear to be missing the word icon then please let John Hanratty know and he will investigate.\r\n\r\nKind regards,\r\n\r\nClare.\r\n\r\n\r\n\r\n\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2442,2841,NULL,'Please assign this insight To Vicci Tubb: victoria.tubb@lexisnexis.co.uk\r\n\r\nV Tubb 25.03.11 (input by Phil Mone) \"I\'ll upload where we are, still some way to go.\"\r\n\r\n24.5.2011 V Tubb - responded to JCP in full against their issues with actions. Debbie Ware is working on the revised Automated Will Draftsman and templates in response to the feedback from JCP. Completion date early June, testing and marketing to be completed by August for roll out of preview functionality.\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2452,2851,NULL,'Denise there are parental responsibility agreement forms on PSL- they are forms (which are not searchable) See Parental responsibility - Forms C (PRA2) - Step-Parent Parental Responsibility Agreement Section 4A(1)(a) Children Act 1989 , Claire\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2462,2861,NULL,'We are working with product development and the engineers to expand the contents of the toolbox - anticipated release date is the end of July. We are going to include a \'Figures and rates\' section in the toolbox which will include the information Pamela currently obtains from her Facts and Figures book.\r\nKaren O\'Sullivan - 30 March 2011',NULL,NULL,'1970-12-31 23:00:00',1),(2472,2871,NULL,'We are working with product development and the engineers to expand the contents of the toolbox - anticipated release date is the end of July. We are going to include a \'Figures and rates\' section in the toolbox which will include the information Liz  currently obtains from her Facts and Figures book.\r\nKaren O\'Sullivan - 30 March 2011',NULL,NULL,'1970-12-31 23:00:00',1),(2482,2881,NULL,'We need to use marketing to draw up flyers for us containing competing offers\r\n\r\nPM - Initially delegated to Phil Rogers - Update from Phil Rogers 15.04.11  - this is for competitive strategy & not for me\r\nPM - Delegated to Derek Livingstone 24.05.11\r\n\r\nUpdate from Gavin Cummy 25.05.11\r\nWe are now starting to work with individual Chambers in the same way and offer the same service - hopefully better!',NULL,NULL,'1970-12-31 23:00:00',1),(2492,2891,NULL,'PLEASE note I cannot chose the practice area above as there is no Dispute Resoluton choice available.\r\n\r\nThis information needs to be circulated to:\r\nJon Scriven - Practice Area Director\r\nClare Duggan - as a Product Development Manager\r\nTim Wakefield  - Forms\r\n\r\n\r\n15.04.11 Update received from Clare Duggan in regards to specific points:\r\n Cases landing pages - would like to be able to toggle between having the cases in alphabetical order and in date order (currently only available in date order) \r\nClare States \"This isn\'t something we\'ve had feedback on before but we can definitely monitor it to establish whether it\'s a common user need.\"\r\n They find LexisLibrary itself very difficult to use and they much prefer Westlaw which has much easier search facilities.  They liked the fact that PSL product did not have the same search criteria as LexisLibrary ie with connectors etc \r\nClare states \"Interesting given the search is exactly the same on both products and both work with connectors. Are they taking advantage of the word wheels?\r\n Printing - they would like to have tick boxes besides the practice notes, cases (on the landing pages), forms and precedents so that they can tick through the list and then press print and all the documents they have chosen appear.  This would be helpful not only for research purposes but for trial bundles when producing authority bundles.  Clare states \"Interesting point-we are currently speaking to customers about a redesign of results pages on LexisLibrary and the vast majority of our customers don\'t want to deliver a document until they get to the document itself so we are considering removing these from the LL results pages and replacing it with a document folder alternative.\"',NULL,NULL,'1970-12-31 23:00:00',1),(2502,2901,NULL,'IN MY VIEW WE SHOULD BE LOOKING TO SIMPLIFY AND RATIONALISE OUR MENUS ESPECIALLY WITH NEW TOLLEY LIBRARY PLATFORM AND BE COMMUNICATING TO ALL OUR SALES FORCE WHAT CCH ARE DOING FOR WHEN WE ARE GOING HEAD TO HEAD WITH THEM FOR NEW BUSINESS OR WHEN THEY ARE COMPETING WITH US AT RENEWALS AND WHEN WE ARE LOOKING TO DISPLACE THEM!\r\n\r\nPM 03.06.11 - Email sent to C Boulter/D Arrowsmith as per Lisa Regans advice (email 24.05). Furhter email sent to DC.\r\n\r\nDC: Hi Nathan having looped around with the Tax team, they totally agree and this issue is well recognised. They have plans in place to rectify this and its on the RoadMap. Keep raising this in your team meetings for updates and thanks for your input.',NULL,NULL,'1970-12-31 23:00:00',1),(2512,2911,NULL,'Response from Clare Duggan 15.04.11\r\nHi Mark\r\nThanks for the feedback below. It would be worth forwarding on the content feedback to the lawyers responsible for the practice areas trialled. I can point you in the right direction if you let me know what areas they looked at.\r\nKind regards,\r\nClare.\r\nIn regards to point 1 above, Claire has also stated \" I would be really interested in speaking to this firm a little later in the year when we will be doing some mock-ups of how this might look and work in practice and will be looking for customer feedback and validation. What practice areas were they trialling and were there any in particular that they thought they\'d want to search across simultaneously?\r\n\r\nFollow-up from Clare Duggan 24.05.11\r\nHi Mark\r\n\r\nIn March, you submitted feedback from the firm above and mentioned one of the reasons they didn\'t subscribe to LexisPSL was down to the lack of a holistic search across PSL modules. Do you think this firm would be happy to speak to us about this requirement as we are hoping to embark on some research in the foreseeable future and ideally want to speak to customers or potential customers for whom this is an issue?\r\n\r\nAlternatively if you have any other suitable customers who have also struggled to determine in what practice area content sits, I\'d be grateful if you could pass on their details if you think they\'d speak to us.\r\n\r\nKind regards,\r\n\r\nClare. \r\n\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2522,2921,NULL,'Malcolm Dowden 01.04.11 :We have just agreed the property roadmap for 31 March - 31 July.  We plan to add 2 new topics:  (1) property development, and (2) charity property - both in response to patterns of customer feedback.  Property development will come first.  If Peter could let us have any specific requests for precedents, practice notes then we could build them into the plan.\r\n\r\nIn the meantime, I\'ve asked our planning specialist to prepare a new practice note on conservatories (also extending to garage/loft conversions etc).',NULL,NULL,'1970-12-31 23:00:00',1),(2532,2931,NULL,'The quantum search looks for \'key words\' and more often than not an injury description will include reference to a back AND a neck injury. Accordingly a lot of the results for neck or back injuries will bring up the same cases. We are updating the quantum database over the next few months and will be introducing a more refined search system which should enable this customer to refine her search further to only include cases which mention a back injury.\r\nKaren O\'Sullivan PI PSL team. 4 April 2011',NULL,NULL,'1970-12-31 23:00:00',1),(2542,2941,NULL,'The 10th edition of the JSB has been exactly replicated in PSL. There isn\'t a minor injuries section and the minor whiplash injury section can now be found in: \r\nChapter 6 (A) (c)  (orthopaedic injuries > Neck Injuries > Minor)\r\nThanks\r\nKaren O\'Sullivan PI PSL team. 4 April 2011',NULL,NULL,'1970-12-31 23:00:00',1),(2552,2951,NULL,'A button should be added to the site to make it easier to see how to get to their subscribed Webinars. \r\n\r\nPM 24.05.11 Delegated to Peter Nussey',NULL,NULL,'1970-12-31 23:00:00',1),(2562,2961,NULL,'Anne Marie Claydon 13.04.11 has responded in regards to each point individually:\r\n\r\nShare Purchase agreement\r\nWe do only offer two share purchase agreements within the CoCo module. PLC may well offer 6 versions in Corporate but they do not offer any such content within their Commercial module. So, we actually offer more than PLC in this regard. In the Corporate module, we have two SPAs (a long-form and a short-form) but we also offer various \'Add ons\' providing alternative clauses to go within an SPA. So, adding up all of the Add ons (which would be slotted into the SPA), we have at least a comparable offering to PLC Corporate.  The long-form SPA and the Add ons are not offered within the CoCo module, because they go beyond what we believe (and agreed) is required \r\nthere. So, I\'m afraid if a customer really requires this level of content, they should be buying PLC Corporate as well. \r\n\r\nLanguage\r\nThis is a rather general point. I have copied in Tim Wakefield as he is responsible for EF&P precedents. I cannot comment on these or on the generality of the precedents to be found in the CoCo module. Tim may wish to take this point up but I suspect he would need some more concrete examples to respond on. We do not include EF&P precedents within the Corporate module and so the only ones that apply to me are those within the Transactions topic in CoCo, which the Corporate team maintain.  As far as the specific example of \'recitals\' goes, this is something that Corporate lawyers still favour and so our precedents are drafted on this basis. The CoCo team may take a different view but these precedents are under our remit and hence cater for the preferences of Corporate lawyers. I have spoken to Cara Annett about this point and she indicates that:\r\n\"Different practice areas favour different styles and terminology. We are reviewing the language used generally across our precedents but in the meantime the position we have taken is to maintain the status quo, i.e. on documents that arise predominantly in one practice are (i.e. corporate) we follow that practice area\'s language. We take this approach on the basis it is not that difficult to change one word and all parties understand broadly what is meant (otherwise we will always upset someone!).\"\r\n\r\nI\'m sorry if this is not the response you were looking for. In terms of what to feed back to the customer, it would be to highlight that we do have good SPA coverage within the Corporate module but not so much in the Commercial module. However, there is more coverage (i.e. some!) in the CoCo module than in the PLC equivalent (where there is none). In terms of style, this is a bigger discussion and we would need more concrete examples of outdated language in specific precedents to be able to respond.\r\n\r\nUpdate Tim Wakefield (13.04.11) Nothing to add to Anne-Marie/ Cara\'s points on style outlined below, save to highlight that if this customer has more specific feedback on individual docs we will feed this directly into our practice area review of style/ language used on precedents.',NULL,NULL,'1970-12-31 23:00:00',1),(2572,2971,NULL,'This is a sensible suggestion but unfortunately the search mechanism on the quantum database is not sophisticated enough to enable this search to be undertaken. We are currently working hard to significantly expand the number of quantum cases in the database. I will add this suggestion to our roadmap for PSL PI and consider whether it can be implemented once the work on expanding the database has been completed.\r\nKaren O\'Sullivan PSL PI team - 11 April 2011',NULL,NULL,'1970-12-31 23:00:00',1),(2582,2981,NULL,'Having tested this on the live product I haven\'t found this problem. The correct legislation appears whether you search by year or not. It may have been a glitch on the particular day you searched? I haven\'t had any other reports of this problem from other users. I will keep an eye on this issue to see if the problem reoccurs. Obviously let me know if you continue to have any problems. \r\nKaren O\'Sullivan - PI PSL 11 April 2011',NULL,NULL,'1970-12-31 23:00:00',1),(2592,2991,NULL,'Update Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n\r\nUpdate Philip Thornton 27.04.11 \r\nThis issue has already been relayed to the LexisPSL Employment team by email of Lynne Davies on 5 April 2011 at 18:00. The problem was rectified by the morning of Thurs April 7. Full details regarding the matter were emailed to Jon Scriven on Thur 14 April at 17:01',NULL,NULL,'1970-12-31 23:00:00',1),(2602,3001,NULL,'Update Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n\r\nUpdate Philip Thornton 27.04.11 \r\nThe Butterworths tab contains only the \'extract links\' within our practice notes. These are deliberately kept to a minimum so as to allow for upsell to Harvey. There are however many further links to Harvey in the practice notes which are \'Further Reading links\'. This second type of link (a) requires a LexisLibrary subs for the link to work and (b) does not appear on the Butterworths tab',NULL,NULL,'1970-12-31 23:00:00',1),(2612,3011,NULL,'Negotiation with APIL?\r\n\r\nPM - Delegated 24.05.11',NULL,NULL,'1970-12-31 23:00:00',1),(2622,3021,NULL,'Update Tim Wakefield 05.05.11\r\nI have picked up the outstanding insight in my name and passed to Rob Evans in the LexisSmart forms team who will address the issues raised relating to specific forms. We will let Kirsty Le Saint know when this is sorted.\r\n\r\nUpdate Tim Wakefield 06.05.11\r\nRob Evans has addressed the specific forms issues raised and customer has been informed of fix.',NULL,NULL,'1970-12-31 23:00:00',1),(2632,3031,NULL,'Simplify the form so there are not 200 odd pages to click through, taking out subjects that are rarely covered in a standard will. Provide an option (perhaps via a hyperlink) to link through to add in extra information as and when it is needed.\r\n\r\nUpdate Clare Duggan 15.04.11\r\n\"Thanks for the feedback. I\'ve sent this onto the Wills and Probate lawyers to respond as it is content related. I have copied you into that email so they can respond directly.\"\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2642,3041,NULL,'i\'ve already e-mailed this direct through to clare duggan, this insight is to record the error i experienced as it\'s an ongoing problem with psl content.\r\n\r\nUpdate Clare Duggan 15.04.11\r\nHi David \r\nThanks for the feedback below from Gough, Scott and Thomas. I have asked Matt Poulsom who is the paralegal for DR to respond and this is what he had to offer.\r\nI hope this helps - feel free to contact Matt directly if you need to follow up on any of these points\r\nKind regards,\r\nClare.\r\n\r\n1.       We never make a complete sweep/ any sweep of the practice areas to check the links aren\'t working. We should do but there simply isn\'t the headcount available (as this would be a very time consuming, albeit important, process)\r\n\r\n2.       (For Karen as well) The Litigation: Part 36 topic  still draws all its content from DR so when DR is updated, PI is updated automatically. However, DR does now have an additional PN in the topic not present in PI (called \"Making a valid Part 36 offer - claimant or defendant\"). This could be easily included in PI if desired. The ordering of the PNs is slightly different in PI to DR. The PI content could be re-shuffled to exactly replicate that of DR if required. DR also has a series of checklists in the topic which PI does not include but could be included.\r\n\r\n3.       (For Nachum as well) The actual issue raised of the \"no content found\" is a bit of a puzzler. The content of the PNs is in place and viewable by clicking on the main heading link for each practice note. What David has discovered is that the linking from the PNs landing page to sections within the practice notes does not work. However, once each PN has been opened, this internal section linking is then fully operational. I have no idea why this should be the case. I\'ve just run a full extract publish for PI PNs to see if this straightens out the issue. If it doesn\'t, then I\'ll have to defer to Nachum on it.\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2652,3051,NULL,'mark up the inheritance tax act as IHTA 1984 as well as ITA 1984\r\n\r\nLisa Regan 11.04.11 - I will forward this query to Dids Wrench in the Legislation team and they can possibly get it added so long as there is no other IHTA 1984 in existence already.\r\n\r\nUpdate from Lisa Regan 14.04.11 - With reference to your query, the legislation team has now added the acronym IHTA 1984 to those recognised by the search on LexisLibrary.  The acronym should be live and searchable within the product by tomorrow morning the latest, sooner if the legislation update goes through without any hiccups.',NULL,NULL,'1970-12-31 23:00:00',1),(2662,3061,NULL,'alex smith also e-mailed direct with this as this has both urgent (BWPAS fix) and also longer term insight.\r\n\r\nPM 24.05.11 Delegated to Malcolm Skinner\r\nMS - 25/05/11\r\nI can\'t disagree with the comments on the search facility as this reflects a common theme. However, in this instance I would have thought that a PC lawyer would have used codicil-replacement - executor or a combination to get what they wanted..',NULL,NULL,'1970-12-31 23:00:00',1),(2672,3071,NULL,'Do we have anything similar to this on Lexis.com? Are we looking to develop a rival?\r\n\r\nLISA REGAN: There is a US project  - LMO  - LEXIS for Microsft Office which is being developed in the States and was available to US Law Schools.  It was similar to LexisCheck in parts but not completely.  IF you go to the following links there is more information:\r\n\r\nhttp://newsbreaks.infotoday.com/Digest/LexisNexis-Announces-Lexis-em-forem-Microsoft-Office-61000.asp\r\nhttp://www.youtube.com/watch?v=SjR27p2ZYJ8\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2682,3081,NULL,'please let Suzanne Cottle & Gavin Allan know if this is on the road map for development and if so when we can expect this to be added. Thanks\r\n\r\nWe are currently planning the second suite of calculators for PI - both the future loss calculator and the Ogden calculator will be included in the second suite. There is a detailed planning meeting on 26th April 2011 and then contractors in India (who prepared the original calculators) will start working on the second suite. We anticipate launching the second suite before the end of Q3. Timescales cannot be finalised until we speak to India and get their view on how long the work will take ( these calculators will be more complex than the first suite we prepared)\r\nKaren O\'Sullivan - PI PSL - 13 April 2011',NULL,NULL,'1970-12-31 23:00:00',1),(2692,3091,NULL,'Nick is happy to take a call from Malcolm Skinner as we feel that he would be a good customer contact  to give feedback. We will be running a managed trial here at Geoffrey Leaver from 6th May, so if Malcolm could catch up with Nick during the 4 weeks following trial set up that would help the trial along. In the meantime, please could I have some feedback as to when the issues above will be resolved? Many thanks\r\n\r\nPM delegated to Malcolm Skinner on 24.05.11\r\nMS - 25/05/11\r\nI will ring him.\r\nAll available forms should be there now. A discretionary trust has always been available in precedents and a further such trust is available in LexisSmart format.\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2702,3101,NULL,'Possibly this should go to Karen Waldron - Karen could you let me know your thoughts? Many thanks\r\n\r\nUpdate from Karen Waldron 14.04.11\r\nOn the first point, yes we are looking into changing this message or possibly removing it altogether. It was in there initially to warn customers that they were not searching over Legislation (as it was giving a \'too many hits\' message). Now the search automatically searches over everything there is less need for the message. We deliberately didn\'t include an \'all subscribed sources\' tickbox after previous usability testing sessions with customers as they expected the search to search all automatically without ticking anything (which it now does). The tick boxes are there for filtering, to narrow the search before searching, rather than to include content before searching. If we remove the message entirely, then that will save the \'unnecessary click\' referred to. We\'ll look into this.\r\n\r\nOn the second point - we are currently making changes to the results page and we can look into including this in the requirements.\r\n\r\nRegards,\r\nKaren.',NULL,NULL,'1970-12-31 23:00:00',1),(2712,3111,NULL,'update on cross referencing please\r\n\r\nMalcolm Downden 13.04.11 - Mark Edwards or Vicky Tubb may be able to help with this.  I have no information on the availability of this function\r\nPhil Mone 14.04.11 - Email sent to Mark/Vicky requesting further information\r\nPM 12.05.11 Further email sent to V Tubb\r\n\r\nPM: Response received from V Tubb (18.05.11):\r\nSoon after launching LexisSmart Precedents we had some issues with cross references in the AWD not working, these have been rectified. This insight seems to pertain to the automatic references in precedents generally. Where this occurs, in order for us to replicate the problem and fix it we do need more specific examples.\r\nIf the issue is automatic formatting then the insight should be passed on to John Hanratty to deal. \r\n\r\nPM 02.06.11 - I emailed Suzanne Cottle (18.05), advising of Vicky\'s response and requesting further comment. Nothing else has been received. Insight closed.\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2722,3121,NULL,'Add active links to the Practice Directions\r\nMake them more easily visible/accesible to reach by browsing\r\n20/04/2011\r\nHi Sue\r\nWe have made a few changes to the practice note that contains the FPR and the PD\'s. Hopefully  it looks a bit better now and contains what the customer requires.\r\nIt is in the topic Family Procedure Rules 2010 and subtopic Introduction to FPR 2010 and the pn is called The Rules and Practice directions set out in full.\r\nIt enables the customer to see all of the rules and PD\'s in one place. If you get any feedback from the customer we would be very grateful to hear it - good or bad - as we are continually working on this and are more than happy to make any improvements that we can.\r\n\r\n\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2732,3131,NULL,'This firm does use EF&P and likes it but they question whether or not LexisPSL is the right place for this type of \'heritage\' content.\r\n\r\n[DC 13.04.11 - We used some EF&P content in LexisPSL CoCo where we felt it was of the right quality - EF&P is such a large resource that not all of it could be - and because it was quicker than writing material from scratch. Early feedback was that customers were about 50/50 as to whether they liked EF&P or didn\'t. As time has gone on, more customers have given us views similar to this i.e. that EF&P looks dated and they wanted something more modern. We will therefore be replacing EF&P content (unless only e.g. insolvency forms which should not be objectionable) but it would help to know what area the customer was looking at - some areas have quite a lot of EF&P precedents and others have little or none]. ',NULL,NULL,'1970-12-31 23:00:00',1),(2742,3141,NULL,'Update Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n\r\nUpdate Philip Thornton 27.04.11 \r\nMore information would be helpful here:\r\n(a) generally, checklists are mots useful where an often repeated procedure is being carried out. We have, for example, included checklists for collective redundancy. It would be useful to know spefically what other checklists the client would like to see - we could then respond more specifically\r\n(b) what aspects of the layout are viewed as \'more complicated\'? It is difficult to respond without specifics',NULL,NULL,'1970-12-31 23:00:00',1),(2752,3151,NULL,'Other forms that would be used in a share purchase M&A should be added.\r\n\r\nJane Mayfield\r\n18/04/11\r\nAll of the forms that are commonly used in a share purchase transaction eg. AP01, TM01,  are contained in the subtopics \'Company incorporation, constitution and officers\' and \'Audit and auditors\' in the topic \'Company administration and management\'.\r\n\r\nWe will investigate linking to these pages on the forms page in the subtopic \'Private m&a:shares\' as well as in the other subtopics in \'Transactions.\'\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2762,3161,NULL,'Not sure - depends if others share this view.\r\n\r\nUpdate Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n\r\nUpdate Philip Thornton 27.04.11 \r\nThis is the first time I have seen this view expressed. Most customers say the opposite: that they would like all subtopics to be in view by default on the front page (we have, as a result, informed product development that this would be a desirable change.\r\n\r\nVery unlikely that this suggested change would be adopted as no-one else has said the same thing and also the effect would be to make content less accessible (more clicks required) from front page.',NULL,NULL,'1970-12-31 23:00:00',1),(2772,3171,NULL,'Create more checklists.\r\n\r\nUpdate Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n\r\nUpdate Philip Thornton 27.04.11 \r\nThank you - a helpful suggestion. Out TUPE section is being revamped this year, and so we will take this suggestion into account in the course of that project.',NULL,NULL,'1970-12-31 23:00:00',1),(2782,3181,NULL,'Create a suitable precedent and add to topic.\r\n\r\nUpdate Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n\r\nUpdate Philip Thornton 27.04.11\r\nThe redundancy topic is being revamped in the course of this year. On a more general point, we know we need more client-facing letters/packs of documents for our customers to simply print off and use. To this end, we plan to add several client-facing precedent letters (eg, letters of advice on: employment contract, director\'s service agreement, compromise agreement, conducting disciplinary investigation/hearing, overviews of tribunal procedure etc). We hope to start adding these by the end of the year.',NULL,NULL,'1970-12-31 23:00:00',1),(2792,3191,NULL,'Put all square brackets in bold font.\r\n\r\nUpdate Phil M 27.04.11 John Scriven has advised all LPSL Employment Insights to be reassigned to Philip Thornton\r\n \r\nUpdate Philip Thornton 27.04.11 \r\nThis would be feasible as well as sensible if the \'bold\' attribute were added automatically to all square bracket characters in the Word download version of each precedent. I have passed on a suggestion to this effect to Claire Duggan in the product development team.',NULL,NULL,'1970-12-31 23:00:00',1),(2802,3201,NULL,'Add this functionality - two different departments in this form both mentioned this point.\r\n\r\nMark Edwards:\r\nThis functionality is on the product roadmap, forming part of the planned Process Automation offering. A phase 2 business case is to be submitted in order to develop the functionality. If funded, it will launch in 2012.',NULL,NULL,'1970-12-31 23:00:00',1),(2812,3211,NULL,'Add more precedents for different scenarios.\r\n\r\nPM 05.05.11 - Reassigned Insight from Ruth Pratt to Janna Purdie\r\n\r\nUpdate from Janna Purdie 06.05.11:\r\nThis is an development we have on the DR roadmap and we will be seeking to address it over the next year.  The first stage (first six months) will be to ensure that Atkins precedents covering particulars of claim are added into the product.  The second stage (2nd six months) will be to start to add in bespoke case studies with more detailed drafting notes.  We are also looking at providing a standalone precedent which can be used by users for any type of claim but which has the main features of a particualrs of claim in it.  In doing this we need development in the use of arbortext to be able to justify text to enable us to put in court headings.  This is essential for every single one of the DR precedents as they all require court headings.  Our competitors PLC have provided this for many years and we are at a distinct disadvantage given that we are unable to provide it.  The justification of text needs to be developed by the development team (Clare Duggan)',NULL,NULL,'1970-12-31 23:00:00',1),(2822,3221,NULL,'Create content for this area.\r\n\r\nI am looking to commission a resi property lit specialist to produce content asap.',NULL,NULL,'1970-12-31 23:00:00',1),(2832,3231,NULL,'Update: Clare Duggan 18.04.11\r\nThanks for the insight below from RWPS. This is an issue we are aware of and making investigations into how we can improve it longer term. Please do continue to pass on feedback like this as we continue to develop this search tool.\r\n\r\nResponse Kirsty Le Saint 18.04.11\r\nThanks Clare - although this doesn\'t give me much to feed back to the customer.  He asked if it was possible to \'switch it off until it works properly\'!!\r\n\r\nResponse Clare Duggan 18.04.11\r\nI should have mentioned this can be switched off in Preferences. This can be unticked to get rid of these \"Did you means?\"',NULL,NULL,'1970-12-31 23:00:00',1),(2842,3241,NULL,'OECD content should be acquired and fed into premium international tax menus\r\nAlan Blanchard: The OECD content is prohibitively expensive to publish. If we can share the cost among a few products, we could finance the cost of the licence that way. I will speak to Tom Saville about obtaining a price from the OECD, and pull together a list of the titles/menus which need this content.',NULL,NULL,'1970-12-31 23:00:00',1),(2852,3251,NULL,'comms  to sales team with road map / timescales.\r\n\r\nRoy Dewell update 19.04.11 - this has been passed to Chris Boulter\r\n\r\nDC: Hi Neil having looped around with the Tax team, they totally agree and this issue is well recognised. They have plans in place to rectify this and its on the RoadMap. Keep raising this in your team meetings for updates and thanks for your input.',NULL,NULL,'1970-12-31 23:00:00',1),(2862,3261,NULL,'index needs re instating with immediate effect\r\n\r\nUpdate Lisa Regan 10.05.11 - This may have been an editorial decision - worth checking with the editor of DeVoil - try Alan Blanchard.\r\nUpdate Phil Mone 10.05.11 - Reassigned to Alan Blanchard. Email sent to Alan\r\n\r\nUpdate received (11.05.11) from Elain Pugh showing Index is Operational. No further action required.',NULL,NULL,'1970-12-31 23:00:00',1),(2872,3271,NULL,'create enhanced international service on Guidance and Library with soecific focus on commentary. happy to discuss revenue implications\r\n\r\nPM - Delegated 24.05.11\r\n\r\nDC: Hi Neil, Ref insight 3271, This relates to a similar insight  raised by Sam (2491). The team agree that we are weak in this area, and have plans/ work in place to rectify this (its on the RoadMap). \r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2882,3281,NULL,'Update Helen Green:\r\nThis is not available online as the publication contains a significant amount of copyright material (owned by the Law Society) who we have not reached agreement with to date regardign an acceptable fee - negotiations are underway.  ',NULL,NULL,'1970-12-31 23:00:00',1),(2892,3291,NULL,'On the practical guidance notes, insert links to current awareness stories\r\n\r\nCD (21.04.11): This is not something that we\'ve had feedback on before but certainly something we can monitor going forward to see if this is a universal customer need. What practice area was Sarah from? It would be interesting to know how long she\'d want those links to be there as current awareness items can become updated relatively quickly compared to other content types.\r\n\r\nMA (24.05.11): The PSL Employment team took the decision a while back (around March 2011) to create links to our news analysis stories from our practice notes, to further publicise our reports which otherwise risk getting \'lost\', especially if users don\'t get signed up to our weekly email (an ongoing problem) and whilst the News analysis tab remains inactive. We create these links manually and they will appear under other right hand column links to reports of the relevant case (see the \'Individual redundancy\' practice note, for example). When we write a news analysis story, we always check the impact it has on relevant practice notes. These are then amended (or sometimes substantialy re-written) to take account of the news story/new case/legislation concerned. We add links to the case report etc to the practice note as part of this process and will also remove any links to case reports etc that have become out of date as a result of developments in the law. Links may therefore remain in a practice note for years if they continue to be an accurate statement of the law. Alternatively, we may need to remove them after a matter of months or sometimes even weeks, ie it is not a process that can be automated as legal knowledge is required to make the assessment as to relevance. We do not, unfortunately, have the capacity to revist all our practice notes to add these links, so are dealing only with reports from March 2011 on or on an ad hoc basis when revisiting a practice note generally.',NULL,NULL,'1970-12-31 23:00:00',1),(2902,3301,NULL,'I would  like to know if Save Search is to be added to the new Toly Library service and the possible timeframe if so.\r\n\r\nPM  - Delegated 24.05.11\r\n\r\nDC - Hi Sue, I believe you have been emailed about this already by the Tax team, but wanted to close the loop just in case. Basically there is a release scheduled for August which will deliver some of this functionality (bookmarking).',NULL,NULL,'1970-12-31 23:00:00',1),(2912,3311,NULL,'DAMCO- Test Record entered for Testing on Production by DAMCO',NULL,NULL,'1970-12-31 23:00:00',1),(2922,3321,NULL,'MS - 25/05/11\r\nAll valid comments on the basis of \'familiarity\'.  Regrettably the comments do not indicate whether they refer to PSL and/or LL. The comment about the browser is not explained with any particularity.\r\n\r\nThe AWD is currently being revamped as a result of feedback and the new version will deal with length and \'executors\'. It is not for everyday use but primarily as a resource tool for templates. Future enhancements (within the next three months) will include a suite of \'common\' will forms that can be automatically loaded into the AWD, saved and printed. Speed of loading is down to the customer\'s own systems.\r\n\r\nFurther training/explanations may help convince customer.',NULL,NULL,'1970-12-31 23:00:00',1),(2932,3331,NULL,'Update Helen Green 10.05.11\r\n\r\nTristram & Coote is out of date as the \"Inland Revenue\" no longer exists. There should be a new edition of this next year.\r\n\r\n BWPAS - the author has checked the wording and believes:\r\n \"that the wording to \"Inheritance Tax Account\" is correct but some of the registrars at particular district probate registries are known to have their own particular preferences.  I have submitted dozens of oaths to various different registries using my own precedents over the past four years and they have always been accepted. In fact, I have recently had two oaths formally \"settled\" (i.e. approved in advance) by the Winchester District Probate Registry and my wording was approved.\"\r\nHaving said that, he is going to add the words \"HM Revenue & Customs\" to all of the precedents for the July update.\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2942,3332,NULL,'Janna Purdie:\r\n\r\nI had a productive discussion with Brian Hall at  Mercedes (5 May 2011) and they look set to sign if the price is right for them.  Brian had no idea how to use the product and so having navigated him through it he can now see the possibilities that exist with the product for his team. \r\n\r\nIf Mercedes do sign up then Brian and I will then set up a meeting at their offices to go through what they need.  Mainly it relates to debt recovery work and basic insolvency and to assist in house get off the ground from a DR perspective I will look at adding this into the DR module over the next 6 months.\r\n\r\nMark Francis to advise if Mercedes sign up to LexisPSL and then Janna will arrnage a meeting with Brian Hall to talk through requirements and timetables. Mark is aware of this and so an insight notification does not need to be sent on to him.\r\n\r\nUpdate Janna Purdie 25.05.11\r\nI am waiting to hear whether Mercedes have joined up to Lexis PSL.  If they do then I will arrange the meeting with them to discuss in more detail the two new topics they want added to the product and then look at addressing that by working with the insolvency practice area.  This would probably take place over a 6 month period.\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2952,3342,NULL,'FYI..I have already passed this to the UK content team who are forwarding this to Jonathan Hoy who owns our relationship with NewsTex \r\n\r\nPM 24.05.11 DC has forwarded to Robyn Mason at the request of S Greenhill.',NULL,NULL,'1970-12-31 23:00:00',1),(2962,3352,NULL,'CMelvin - 20.05.11 - There was a comment on this one about extra financial services update and share option updates - White NX is your logger for a firm called IPR industries this is an area we\'ve been looking for more feedback on - could you tell us who that is so we can speak to them?\r\n\r\nDC - 12.05.11 - Email Nina for contact details and advised to contact Claire',NULL,NULL,'1970-12-31 23:00:00',1),(2972,3362,NULL,'PM 10.05.11 Possibly Malcolm Skinner (Wills and Probate). Awaiting DC\r\nPM 24.05.11 Delegated to Malcolm Skinner\r\nMS 25/05/11\r\nOne issue that has come up is that some people say that PLC is more detailed while others say it is too detailed and the PN length puts them off. They actually have fewer PNs than Private Client and many of theirs are repeated.\r\nHe makes a valid point about guides or checklists. This is something that we are working on. Given the size of the firm it is obvious that they require a lot more client orientated information. The question of matching specific sectors to specific products rather than one size fits all is an issue that is being discussed but no early decision on how to do this is likely.\r\nWe need more specifics on the auto updating point to clarify where we fail.\r\n\r\nDavid Smith 25.05.11 (in response to Malcolm\'s update)\r\nInsight 3362 - auto-updating of precedents is a well known issue and I\'ve reported many times before - it essentially means cross refs in a precedent are linked by word cross refs so if someone deletes a clause, the cross refs can be auto-updated - as per the tables of contents in bug precedents. John Hanratty is putting together a similar proposal for ALL put precedents. This insight was really about psl property in particular!\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(2982,3372,NULL,'Update Tim Wakefield 16.05.11\r\nIn reponse to this feedback, the LexisSmart Forms team have developed \'auto-tab\' functionality such that users will not have to tab between single fields on the IHT 400 Forms. This feature will be rolled out incrementally across affected fields on the  IHT integrated form over the next couple of weeks. David Smith has been informed. ',NULL,NULL,'1970-12-31 23:00:00',1),(2992,3382,NULL,'PM 24.05.11 DC has forwarded to Robyn Mason at the request of S Greenhill.',NULL,NULL,'1970-12-31 23:00:00',1),(3002,3392,NULL,'As a \'bolt-on\' to the basic LexisPSL subscription customers can now add a specific Smartforms menu that includes all of the Law Soc protocol forms, plus the standard conditions of sale (5th edn).  That is what they need for Law Soc conveyancing scheme purposes.',NULL,NULL,'1970-12-31 23:00:00',1),(3012,3402,NULL,'Update 25.05.11 Janna Purdie:\r\nIn relation to insight 3402 this has now been completed with 42 new precedents having been added to the DR product in response to comments from the customer.\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3022,3412,NULL,'PSL LG covers 2. Admissions, but will investigate.  Also researching expansion of education content, but not likely to be completed until Q3/Q4 2011.  Is there a need for me to contact the customer or just update them when the content is available?',NULL,NULL,'1970-12-31 23:00:00',1),(3032,3422,NULL,'Update 13.05.11 Eleanor Baxter:\r\nI think a deed of variation precedent would be a useful document to have in LexisPSL Corporate.  However, we wouldn\'t propose that it\'s specific only to the partnerships subtopic because it would be suitable for use in a number of areas.  We would instead add this to a new subtopic containing other documents that apply across several areas.\r\nI will add this to the list of documents and we will aim to put this into Corporate within the next couple of months.\r\nThanks for highlighting the query.\r\n\r\nKind regards\r\n\r\nEleanor Baxter\r\nLexisPSL Corporate\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3042,3432,NULL,'13/5/2011 (LR) - Forwarding this to Robert Walker in EF&P for consideration\r\n\r\n13/05/11 (Robert Walker)\r\nHi Lisa,\r\nThank you for the suggestion regarding an additional contract. This is something I can discuss further with the contributor.\r\nWe have recently reissued the Sports volume and the Standard Basketball contract is no longer included. This was a third party form rather than one of own precedents. I suspect the information used on the Word Wheel is in need of updating to reflect this and will speak with the department concerned.',NULL,NULL,'1970-12-31 23:00:00',1),(3052,3442,NULL,'13.05.11 (LR) Forwarding to Hemali Patel in the Cases team for consideration\r\n\r\n16.05.11 Hemali Patel:\r\nThanks for this - we have a meeting about Family coverage this week and I am more than happy to put this forward this as a possible enhancement for the reports going forwards. CC-ing in Katie, the Editor of the FCRs.\r\n\r\n16.05.11 Additional comments from Katie Green\r\nThanks for your email - it\'s useful for Case Reports to get feedback on customers\' use of indexes, so much appreciated.\r\nYou\'re not missing a trick; there is an FCR hard copy index covering the period 1987-1998 (ISBN 0-754-50339-9), but nothing later and currently nothing online.\r\nCreating an FCR index going forward/a cumulative index is obviously a major undertaking resource-wise, but I will discuss this with my manager.\r\nPlease do let me know if you have any further feedback on this or anything else which is cases-related!\r\n\r\nCM 20.05.11 - This one was about a customer who couldn\'t easily find recent family cases.and the discussion in your tracker talks about maybe putting the Family law Reports index online. You can set up a personal alert for all new family cases (including sub areas of family) or you can search by topic (and date - any period you like, from or before a specific date) on the current awareness search screen and see all the latest cases in a given practice area. This is better than waiting for the law report seriesas the law reports are up to a month behind the next day digests our cases team do - if this firm - Anthony Clark & Co wants any help with this we can give it.',NULL,NULL,'1970-12-31 23:00:00',1),(3062,3462,NULL,'PM - Delegated to Malcolm Skinner 25.05.11',NULL,NULL,'1970-12-31 23:00:00',1),(3072,3472,NULL,'16.05.11 - Clare Duggan has advised this should be asssigned to Lisa Regan\r\n\r\n24.05.2011 (Lisa Regan) - When you log onto LexisLibrary there is a huge advertisement tor LexisPSL on the log-in page. Similarly, we do include links to LexisPSL on the practice area pages.  I have been hearing this feedback quite a bit from the trainers so I am going to validate it with customers and run it past the PD team.  There are already a lot of links on the top right of the LexisLibrary page so I don\'t want it unecessarily clutter the page but if it does promote LexisPsl then it is a benefit.  I will get this enhancement sized and potentially added to the development queue.',NULL,NULL,'1970-12-31 23:00:00',1),(3082,3482,NULL,'Update (16.05.11):\r\nThank you for your feedback, as LexisPSL is a more topic driven service, the Prod development team agreed that it was more suitable to have links to LexisPSL at the corresponding topic/practice area page and that is currently where you can find the links on LexisLibrary.\r\n\r\nThanks\r\nLisa ',NULL,NULL,'1970-12-31 23:00:00',1),(3092,3492,NULL,'Update 16.05.11:\r\nExcellent news!  Thank you for your feedback, I\'m pleased to inform you that we do have an ongoing project underway to add more legal terms to LexisNavigator. Currently we have approximately 1000 legal terms written by lawyers and we hope to double that during the course of 2011.\r\nRegards\r\nLisa',NULL,NULL,'1970-12-31 23:00:00',1),(3102,3502,NULL,'24/5/11: (CD) This looks to be a taxonomy issue which Richard Allison is looking into. We will provide an update as soon as he has analysed this in depth.\r\n\r\n06/06/11: (JM) \r\n\r\nHi Nina, \r\n\r\nFollowing on from the feedback you provided below, this was a taxonomy issue related to how the Butterworths tab is automatically generated from excerpt links in practice notes. \r\n\r\nWe have since decided to remove the Butterworths tab completely from PSL from the end of June/beginning of July as usage of this tab was very low and customer feedback largely favoured access to excerpts within the context of practice notes. \r\n\r\nI hope this helps. If you need any further details, please let me know. \r\n\r\nKind regards,\r\nJen',NULL,NULL,'1970-12-31 23:00:00',1),(3112,3512,NULL,'Update K Osullivan 18.05.11:\r\nThanks for this very useful feedback. In answer to your 2 queries I can confirm:\r\n1. Quantum: We are very aware that our quantum database needs to compete with Kemp. To this end we have launched our online submission process (accessed from the PSL toolbox) and there is a marketing campaign due for release in the next few weeks. Our aim is to substantially increase the number of quantum cases in the database. This will help us to compete with Kemp because our database will have a much greater selection of recent quantum cases than their database. We are also only accepting court settlements (as opposed to negotiated settlements between the parties) unless the quantum case relates to an unusual injury or a clinical negligence claim (both of which we struggle to obtain quantum reports on because they tend to settle before getting to court). Kemp use lots of out of court settlements in their quantum database which we don\'t consider to be of much use if you are arguing quantum before a judge. It is anticipated the number of cases in the database should substantially increase over the next 6 months\r\n2. Facts and figures book - I am pleased to confirm we are enhancing the toolbox at the end of June and including a \'rates and figures\' section. This will link to division XIV -Division XIV Butterworths Personal Injury Damages Statistics August 2010. This contains virtually the same information as the facts and figures book and should ensure customers do not need to subscribe to the Sweet and Maxwell book.\r\nMany thanks Karen O\'Sullivan - PSL lawyer personal injury. 18 May 2011',NULL,NULL,'1970-12-31 23:00:00',1),(3122,3532,NULL,'Lisa Regan 23.05.11\r\nForwarding this query to Alan Blanchard as it concerns the online version of the FLJournal (FYI -this is a Jordans title)\r\nAlan Blanchard 01.06.11\r\nThis should go to Hemali Patel, who looks after the third party journals content and will be able to advise if an index can be added.\r\n\r\nCMelvin - 20.05.11 We run the journals index which is exactly what this person wanted(we think though we wouldn\'t mind checking directly with them if we could get a contact in case they needed something a bit different).you can set up to get alerted on articles in any of our online journals and 500 others based on topic so you just find out what articles you need to read. You can also search online by topic and title on a special search form did no one tell them about this?\r\n\r\nDC - 12.07.11 Contacted Nina for contact details and advised to contact Claire directly',NULL,NULL,'1970-12-31 23:00:00',1),(3132,3542,NULL,'Lisa Regan, 24/05/2011: That is very interesting feedback and something I will channel into the development cycle for redesigning results pages this year',NULL,NULL,'1970-12-31 23:00:00',1),(3142,3552,NULL,'EF&P response: Thank you for your feedback. The paragraph numbers ([950] etc) must be in the tables of contents we sometimes include at the beginning of long precedents as numbers in the main body of the precedent are automatically removed on downloading. We have been phasing the numbers out of the contents so hopefully before long we won\'t have any left. We will continue to work on this.\r\n\r\nPM 25.05.11. Update sent to Nina Packman notifying of the above comment.',NULL,NULL,'1970-12-31 23:00:00',1),(3152,3562,NULL,'LISA REGAN, 24/05/2011: Forwarding this query to Daniel Arrowsmith/Chris Boulter, who should be your lead for Tolley Library product questions\r\n\r\nDC - DA has already dealt with this',NULL,NULL,'1970-12-31 23:00:00',1),(3162,3572,NULL,'LISA REGAN 23/05/2011: That\'s good news! I\'ll pass it on to the LExisPSL product manager  - Clare Duggan',NULL,NULL,'1970-12-31 23:00:00',1),(3172,3582,NULL,'PM - Update added by Malcolm Dowden below:\r\nPrice schedules added to precedents landing page for LexisPSL property\r\nNew precedent created (option, fixed price plus indexation)',NULL,NULL,'1970-12-31 23:00:00',1),(3182,3592,NULL,'Update 25.05.11 Eleanor Kelly (Corporate Team)\r\n\r\nPartnerships and limited liability partnerships:\r\n\r\nWe draft and present our know-how materials in LexisPSL Corporate using a clear and practical approach.  We always have our customers in mind and know how important it is for them to be able to find a precedent or guidance note quickly.  We display our content using layered topics and subtopics to assist customers in finding the materials they want without having to trawl through irrelevant documents.\r\n\r\nOur Partnerships topic is divided into 3 distinct subtopics:\r\n\r\n General partnerships\r\n Limited partnerships, and\r\n Limited liability partnerships\r\n\r\nPractical guidance is given in each subtopic covering:\r\n\r\n Formation of the partnership, limited partnership or limited liability partnership\r\n The legal framework and continuing obligations (eg trading disclosure, filings and accounts)\r\n Partnership agreements\r\n Ending the partnership, limited partnership or LLP\r\n\r\nThe General partnerships and Limited partnerships subtopics include precedent partnership agreements, deeds of retirement, deeds of adherence with full drafting notes.\r\nEquivalent precedents for LLPs are due to be added to the LLPs subtopic in the next few days. \r\n\r\nWe also have practical guidance on tax in relation to general partnerships, limited partnerships and limited liability partnerships.\r\n\r\nIn the next couple of months we will be adding information on insolvency to the Partnerships topic.\r\n\r\nCPD points:\r\n\r\nLexisNexis offers online webinars from which users can earn CPD points.  Full Corporate and Commercial webinars programmes are offered (as well as programmes across other practice areas).  A link to the LexisWebinars website, which includes information on upcoming and archived webinars and prices, is included on the bottom right of the LexisPSL Corporate homepage.\r\n\r\nWe hope this information is useful to the customer.  Please let the LexisPSL Corporate team know if you need any further information.\r\n\r\nThe LexisPSL Corporate team\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3192,3612,NULL,'LR 26/5/2011 - That is very interesting feedback which I will share with the apllications arm of the product development team.  We might like to talk to these barristers in future if you say they are keen as we are currently investigating the development of some mobile apps and presenting our content better on various mobile devices.',NULL,NULL,'1970-12-31 23:00:00',1),(3202,3622,NULL,'PM 01.06.11 Ruth Pratt has advised that this Insight can be closed',NULL,NULL,'1970-12-31 23:00:00',1),(3212,3632,NULL,'Update from Karen O\'Sullivan 06.06.11:\r\nThis is an interesting suggestion and one we will certainly consider when planning our future development of the calculators package. I am currently liaising with the IT engineers who will be building our second suite of calculators and will investigate whether this suggestion can be incorporated into the second suite of calculators which we hope to have online by Q3 2011. Thanks Karen O\'Sullivan PSL lawyer - personal injury team',NULL,NULL,'1970-12-31 23:00:00',1),(3222,3642,NULL,'Update Karen OSullivan 06.06.11:\r\nThank you for this insight. We are aware that our quantum offering is not, at the moment, on a par with the quantum offered by Kemp. To address this we have launched an online quantum submission site (which can be accessed by the PSL toolbox). The aim of this online site is to drastically increase the number of quantum cases in our database. We are shortly launching a marketing campaign to generate submissions of quantum cases from solicitors and barristers. It is anticipated that after 6 months we will be in a much better position to compete with Kemp on quantum because:\r\n- the vast majority of our quantum cases will be court settlements which we consider have far more value to practitioners negotiating quantum - rather than out of court settlements which make up a large number of Kemp\'s quantum cases. The only out of court settlements we will be accepting will be those relating to medical negligence or where the injuries sustained are unusual (and therefore there is limited quantum reports on it)\r\n- many of the quantum cases in Kemp are a number of years old. By launching our online submission site we anticipate our quantum database will contain a large number of very recent judgments which should give practitioners confidence that the quantum figures they are relying upon reflect current judicial thinking\r\n- once a significant number of new cases have been added to the quantum database we will undertake a review to identify any areas where we are low on quantum reports. We will then run a specifically targeted marketing campaign to try and locate quantum cases to fill these gaps. Obviously any customer feedback will also be acted upon\r\nHope that helps to answer the customer\'s query and that he will feel confident enough to cancel his Kemp subscription at the end of the year!\r\nKaren O\'Sullivan - PSL lawyer - personal injury',NULL,NULL,'1970-12-31 23:00:00',1),(3232,3652,NULL,'Update from Karen O\'Sullivan 06.06.11:\r\nThis is an obvious suggestion - which i\'m not sure anyone in the team has actually thought about before! I have added the suggestion to our roadmap for future development and will consider it as an addition to the product in due course. Thanks Karen O\'Sullivan - PSL lawyer - personal injury team',NULL,NULL,'1970-12-31 23:00:00',1),(3242,3662,NULL,'Update from Karen O\'Sullivan 06.06.11\r\nI have just checked the link and it is working fine for me - I wonder whether there was a glitch in the system at the time you looked at this section of the product. If you continue to have problems then please email me and I will try and resolve the issue for you. Thanks Karen O\'Sullivan - PSL lawyer - personal injury team',NULL,NULL,'1970-12-31 23:00:00',1),(3252,3672,NULL,'LISA REGAN 02/06/2011: Thanks for this news-  its very interesting.  I\'ll let the product development and marketing teams know so that we can use this insight to our advantage',NULL,NULL,'1970-12-31 23:00:00',1),(3262,3682,NULL,'PM 01.06.11 - Update received from Jo Bhatia\r\nMalcolm is away this week. We do not deal with Scottish property law on PSL. However, dealing with the principle itself, whilst we clearly cannot compete on price with a free website, our precedents are drafted on the basis that they should cut down negotiation time and be as commercial as possible. They lean on the firm side of reasonable, with any doubts resolved in favour of the seller / landlord in the usual way (whilst not being totally unreasonable for a buyer / tenant). They should aid any firm who uses them in closing deals as quickly and cost-effectively as possible.\r\n\r\nPM 01.06.11 - Response from Colm Parker:\r\nThanks for the update. I added the content on Insight Tracker as I believe some Scottish precedents and drafting notes are going to be added to PSL at some point. I thought this may help steer what content would potentially be the most beneficial to the market given some content is already available. However, I am still unsure how widely the service is used so it may not pose a great threat.',NULL,NULL,'1970-12-31 23:00:00',1),(3272,3692,NULL,'Alan Blanchard 01.06.11\r\nThis needs to go to Helen Green, who is Publisher for Harvey\'s, please.',NULL,NULL,'1970-12-31 23:00:00',1),(3282,3702,NULL,'Melanie Adams (responding on behalf of Philip Thornton and PSL team)(7.6.11). We were very pleased that this customer found our news analysis updates very helpful. We would, however, welcome the opportunity to speak to this customer if possible to obtain some more detailed insight about his feedback. Eg: we are very surprised that he felt that \' more often than not\' our practice notes provide only basic coverage of a topic. Our overviews do that (which makes us wonder if perhaps he only looked at those and there are training issues here) but our practice notes are usually very detailed indeed. It would be interesting to know if he had ever looked at our Equality Act practice notes, for example. So far as we can ascertain, these (and many others on other topics)are more detailed than PLCs. We do not know if this customer also has a Library subscription, but, if so, all our PNs have Further reading links to Harvey for more in depth research, plus links to cases/legislation etc, so his comments on that aspect seem somewhat implausible.\r\n\r\nThe PLC redundancy calculator is, in fact, only a link to a public resource on a government website. We provide the same link from our relevant practice note.\r\n\r\nWe plan to add PNs on employment law in Scotland and Northern Ireland within the next 12 months.\r\n\r\nWe currently have over 320 precedents in PSL and so general comments such as the customer\'s are of limited use to us. It would be good to know which specific precedents the customer would like to see added, please.',NULL,NULL,'1970-12-31 23:00:00',1),(3292,3712,NULL,'Lisa Regan 02/06/2011:  Please send this query to Simon Hetherington who is the publisher for this title\r\n\r\nPM 07.06.11: Update received from Simon Hetherington (06.06):\r\nThat isn\'t an accurate description, I\'m afraid.\r\nThe Laws of Scotland (Stair Memorial Encyclopaedia), volumes and reissues, deals with the law of Scotland. Its remit is therefore (1) UK law applicable in Scotland, and (2) Scots law. This is true of both pre- and post-devolution law. \r\n\r\nThe encyclopaedia was begun (and the main work was completed) well before devolution.\r\n\r\nI think there is some confusion between the Laws of Scotland, and the legislation which is available on LexisLibrary. The legislation offering does not include pre-devolution UK Acts applicable only in Scotland.\r\n\r\nBut, to repeat, this is not the same as Laws of Scotland. Hopefully that clarifies the position for you.',NULL,NULL,'1970-12-31 23:00:00',1),(3302,3722,NULL,'3/6/2011 - CD\r\n\r\nHi Cara\r\n\r\nThanks for your feedback from Roythornes below.\r\n\r\nDeborah Brown (Corporate/Commercial Partner) wants to be able to access drafting notes separately from the precedent, without having to click into the precedent. Ideally would be able to see a list of all drafting notes separately but also alongside the precedents a sparate link to the drafting note. \'I normally have the precedent already. I only want to see the drafting note. It would get on my nerves to go into the precedent to just to see the drafting notes.\'\r\n\r\nI will tell customer that you can find the drafting notes separeately if you full text search (drafting notes) in precedents. Is there another way or would we investigate this please?\r\n\r\nI am slightly confused by the insight. It is currently possible to access the drafting notes separately when you run a search for a precedent as they are differentiated on the results page in the precedent title. The customer says she wouldn\'t want to go into the precedent to see the drafting note, but then she also says she would like to see a separate link to the drafting note alongside the precedent. Again, a user has the capability when they click into a precedent, to view their drafting notes from a right-hand column link. \r\n\r\nPlease do let me know if I have misunderstood the feedback here or if you want to pop around to discuss the user requirement further.\r\n\r\nKind regards,\r\n\r\nClare.\r\n\r\n6/6/2011 - followup response to Cara\'s comment (It\'s when browsing Clare - when browsing you cannot go straight into the drafting notes without going into the precedent first (ie additional click - that\'s what bothers her). \r\n \r\n\r\nInterestingso the customer would like the landing pages to have two links for each document that has a drafting note - one for the precedent and one for the drafting note. My main concern here would be the usability given you\'d be doubling the amount of real estate used. If she is very familiar with the precedent, I\'m quite surprised she still requires the drafting notes but she obviously does have a need for them from what you say.\r\n\r\nEither way, we\'ll monitor the feedback to see if there is a common customer need here and will address accordingly.\r\n\r\nMany thanks for passing this on,\r\nClare.\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3312,3732,NULL,'3 June 2011 - CD \r\nHi Lynne\r\n\r\nThanks for your feedback. We are currently undertaking significant investigation into the speed of LexisPSL as we have noticed an unacceptable degradation of the service over recent months. There are a number of different things we are implementing in the late June/early July Release which we are hoping will help address this issue.\r\n\r\nDid your client mention any particular areas of the product which they are finding slow or was it just a generic comment?\r\n\r\nKind regards,\r\n\r\nClare.\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3322,3742,NULL,'DC - Hi Sam, I believe you have been emailed about this already by the Tax team, but wanted to close the loop just in case. Basically there is a release scheduled for August which will deliver some of this functionality (bookmarking). In addition to this, the team are also already investigating \'Sticky Notes\'..!\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3332,3752,NULL,'Update from Donald Cran\r\nRe #2, the PNs on Confidentiality (in Contracts/Creating contracts) and Trade secrets and goodwill (in IP) both deal with implied confidentiality, and the further reading links give more depth. Don\'t know why the PN on Confidentiality did not appear in the searhc. \r\n\r\nThis subject is rare in practice because for a transaction of any value/importance a non-dislcosure agreement would invariably be used, but I think what we have should give the customer a fair overview. If he needs more detail than we have he needs Library. \r\n\r\nPM: Please also refer to attached in regards to other point raised, Answered by Anne-Marie Claydon/Malcolm Dowden/Cara Annett',NULL,NULL,'1970-12-31 23:00:00',1),(3342,3772,NULL,'DC - Basically I believe you have already received feedback on this insight, but wanted to loop around with you just in case:\r\n\r\nThe tax team have mentioned that when developing the products, a number of people/ firms etc are always engaged to deliver the best/ most desirable functionality. It was as part of those tests, that the volume of results to display was trimmed down to 250 (could be anything, but user group suggested around 200-300 was the optimum).\r\n\r\nIn terms of the search issues and drill downs, these items are under review.\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3352,3782,NULL,'This seems to have been part of broader technical issues that also disabled links to drafting notes (producing a message saying that they were not part of the subscription) and links from practice notes to legislation (producing a message saying that key property statutes were not part of the LexisPSL property subscription).  There was no change to the xml documents or landing pages, so the issue appears to be in the technical processes.\r\n\r\nUpdate:  the forms under the Business Tenancies tab (all of which are SmartForms) are now available.',NULL,NULL,'1970-12-31 23:00:00',1),(3362,3792,NULL,'MS - 8/6/11\r\nThe \'Butterworths\' tab will only be active where there is content in a Butterworths publications that is relevant to or usefully expands on PSL content. If the tab is not highlighted it can be assumed that there is either no relevant content (this is particularly true of Mental Health and Elderly Client) or the isues in PSL are covered in sufficient detail to render any further reading/reference superfluous. \r\nThe tab is active in The Law of Trusts and Trust Drafting. If the customer cannot see this it is probably a technical issue rather than a content issue.\r\n\r\nSC 10/6/11\r\nI think that this must be a technical issue then - if you look at the Wills & Probate PSL module, all the Butterworths content is on here for all the topics in here so this should also be there for the same topics in Private Client shouldn\'t it? - please can we make sure that this is dealt with asap? Thanks\r\n\r\nPM 10.06.11\r\nEMail sent to Clare Duggan\r\n\r\n10/6/2011 Clare Duggan \r\nHi all\r\nThis was a technical issue which Martin Stevens has now resolved.\r\nHowever, it is worth mentioning that the Butterworths tab is being removed from the product in the June Release after significant customer feedbacck that 1) users don\'t know what this tab is (some thought it was directions to the office) 2) even  users are shown what\'s in there, the vast majority of them say it is of limited value out of context and prefer to view it from within practice notes.\r\nKind regards,\r\nClare',NULL,NULL,'1970-12-31 23:00:00',1),(3372,3802,NULL,'21/06/2011 LISA REGAN: This should be directed to the sales lead resp for insight\r\n\r\n22.06.11 Email to DC\r\n22.06.11 Update from DC. Record Closed',NULL,NULL,'1970-12-31 23:00:00',1),(3382,3812,NULL,'Update Clare Duggan 10.06.11\r\n\r\nHi Gavin\r\nThanks for your feedback from Greenwoods Solicitors.\r\nI have spoken to the PSL engineers today and we have managed to squeeze this enhancement in to our next Release which is scheduled for late June/early July.\r\nKind regards,\r\nClare.',NULL,NULL,'1970-12-31 23:00:00',1),(3392,3832,NULL,'Email sent to DC',NULL,NULL,'1970-12-31 23:00:00',1),(3402,3842,NULL,'This is a recurring issue.  Investigation by the technical team has not identified any problem with the xml document, which is the only element of the process we can control.  I\'ve reported the recurrence.',NULL,NULL,'1970-12-31 23:00:00',1),(3412,3852,NULL,'An audit was undertaken of all Land Registry forms to identify which needed Local Authority drop downs.  These are being added and will be complete within two weeks.  A solution for the own details template is being worked on and should be avaliable within the month.\r\n\r\nRob Evans',NULL,NULL,'1970-12-31 23:00:00',1),(3422,3862,NULL,'According to LexisCheck and the legislation in LL, the section in question is in force.  Customer will be contact by Michelle and/or me for futher investigation. (Emailed Michelle) \r\n\r\n24 June 2011, customer sent an email to Michelle acknowledging that the legislative reference is correct. (Anne Pietsch, City of London)',NULL,NULL,'1970-12-31 23:00:00',1),(3432,3872,NULL,'LR 21.06.11 I suggest looping in Alisdair Steer of the cases team who might be able to explain why this is happening.\r\n Alisdair - any idea why when using the citation search field within the Cases tab on LexisLibrary that if you type in 1972 AC 1027 it will bring up only Casesearch results?  If you type in 1972 A.C 1027 (with a full stop between the A and the C) that it will bring up the actual ICLR results only.  It would make sense to be able to do one search to bring up both the law reports and also the casesearch results but it does not \'appear\' to be currently doing this.\r\nIs there something that needs to be done to the feed?\r\n\r\nAlisdair Steer 21.06.11\r\nIt seems to me that the cites in the ICLR source should not have the full stops in place ( i think that none of the other sources have full stops in the cites, and it goes against our house style).\r\nHowever, I would say the main thing is that when you\'re searching, the search should ignore the full stops, so it shouldn\'t matter whether the user includes them - you should get both hits either way.\r\nI don\'t think it\'s an issue with the feed, I think it is primarily a search issue, but also related to the full stops in the source cites.',NULL,NULL,'1970-12-31 23:00:00',1),(3442,3882,NULL,'21/06/2011:  This is a question for Content Acquisition(Cara Annett), please direct to her\r\nPM 21.06.11: Email sent to Cara Annett\r\n\r\nCA (via email) 21.06.11\r\nWe do not publish this book - Informa do, which means they own rights to it. If we wanted to include it LexisLibrary we would need Informa to agree to license it to us.\r\nThey will charge for this and so the main consideration as to whether this is viable would be the cost of the licence and the value to customers.\r\nI do not think we have received this request before but if the customer could provide further information about how it will be used, how often, how valuable to him it is to have in LexisLibrary and any other thoughts, that would be useful.\r\n(To Victoria Taylor) Vicky - depending how beneficial we think this might be we could ask Tom Saville to take a look at it. \r\n\r\nPM 22.06.11 - Email response sent to Michelle Cannon requesting that she gets further info from the customer as noted by Cara above.\r\nPM 24.06.11 EM from Michelle \"Yes I will contact the customer regarding this.\"',NULL,NULL,'1970-12-31 23:00:00',1),(3452,3892,NULL,'21/06/2011 LISA REGAN:  Thanks for your feedback regarding this matter.  I think looking at the current alerting system and what improvements could be made is a good idea but a substantial task - the last alert update project we did in Product Development cost $800k!  Please note that it is on my radar but is not something thatt canbe fixed easily or quickly..',NULL,NULL,'1970-12-31 23:00:00',1),(3462,3932,NULL,'Malcolm Skinner 20.06.11\r\nIt does have passing reference to these matters where relevant but a Topic is being prepared for release from later this year solely on tax and IHT and CGT will be dealt with in substantial detail.',NULL,NULL,'1970-12-31 23:00:00',1),(3472,3942,NULL,'Mailcolm Skinner 20.06.11\r\nIt does have passing reference to these matters where relevant but a Topic is being prepared for release from later this year solely on tax and IHT and CGT will be dealt with in substantial detail.',NULL,NULL,'1970-12-31 23:00:00',1),(3482,3962,NULL,'S Gould (As per Insight 3972) 20.06.11\r\n\"Spoken to client and need further info around what issues were.  Waiting to hear back from Ronen Speyers so can arrange session with one of our trainers as issue may be a training one.  Will delve deeper at that meeting.  Sophie Gould\"',NULL,NULL,'1970-12-31 23:00:00',1),(3492,3972,NULL,'SG 20.06.11\r\nSpoken to client and need further info around what issues were.  Waiting to hear back from Ronen Speyers so can arrange session with one of our trainers as issue may be a training one.  Will delve deeper at that meeting.  Sophie Gould',NULL,NULL,'1970-12-31 23:00:00',1),(3502,3992,NULL,'DL: In process of improving current awareness.  Product development is in process of improving user experience.\r\n\r\nPM 02.07.11: Emailed received from Dolly confirming that this Insight has been discussed with Paul (Fairfax) and the issue is in hand.',NULL,NULL,'1970-12-31 23:00:00',1),(3512,4002,NULL,'Action:  Dolly Lundin has passed feedback on to Claire Duggan ',NULL,NULL,'1970-12-31 23:00:00',1),(3522,4032,NULL,'22.06 EM sent to Content Support\r\n22.06 EM sent to Russell Green',NULL,NULL,'1970-12-31 23:00:00',1),(3532,4042,NULL,'22.06.11 On Alan Blanchard\'s advice I have emailed  Cara Annett.\r\n23.06.11-  Cara Annett \"Susan I think we may need to look at this again. I gather it has recently become more of an issue due to Sealey and Millman having been added to West.\r\n23.06.11 - Susan Bentley \"Hi Allison - please can you confirm the account this relates to? Is this Zolfo Cooper?\"\r\n23.06.11 - PM - I have confirmed the account is Zolfo Cooper\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3542,4052,NULL,'1/7/11 - MS\r\nAll links restored and working fine.\r\n\r\nFrom: Carkeek, Lisa (LNG-LON) \r\nSent: 27 June 2011 11:34\r\n\r\nTo: Michaud, Jennifer (LNG-HBE)\r\nCc: Fachiri, Sue (LNG-HBE); LNG-UK Insight Tracker; Mone, Philip (LNG-BEL); Duggan, Clare (LNG-LON); Rhoods, Neil (LNG-WOK); Marron, Suzanne (LNG-LON); Scriven, Jonathan (LNG-LON)\r\nSubject: RE: Insight Tracker: Insight Reference 4052\r\n\r\n\r\nThe HM Court Service site has been archived. The HMCS site is available online but external links to it (eg those on PSL) can result in a dead link.\r\nPD\'s are now available on the justice website at www.judiciary.gov.uk/publications-and-reports/practice-directions and we are in the process of adding the new address to PNs in PSL. \r\nLisa\r\n\r\nLisa Carkeek\r\nSolicitor, Practitioner Solutions\r\nLexisNexis, Halsbury House\r\n35 Chancery Lane, London\r\nWC2A 1EL \r\n\r\nFrom: Michaud, Jennifer (LNG-HBE) \r\nSent: 27 June 2011 11:26\r\nTo: Skinner, Malcolm (LNG-LON); Carkeek, Lisa (LNG-LON)\r\nCc: Fachiri, Sue (LNG-HBE); LNG-UK Insight Tracker; Mone, Philip (LNG-BEL); Duggan, Clare (LNG-LON); Rhoods, Neil (LNG-WOK)\r\nSubject: RE: Insight Tracker: Insight Reference 4052\r\n\r\nHi Malcolm and Lisa, \r\n\r\nA problem has been reported with links to PDFs within Private Client - it appears the documents on the HMRC site have been moved so links out to PDFs are now dead links. This has been logged on Insight Tracker as Insight 4052. \r\n\r\nIf you log onto PSL Private Client, to recreate: \r\n- Run a full text search on \'practice direction 9F\' \r\n- On results pages, click the only result on the practice notes tab (creation of trusts by the court)\r\n- Within the document, all the right-hand links entitled \'Practice direction 9B\', 9F and 9G are now dead links. \r\nIt would appear HMRC have moved these; can we update the links in the practice note to the new locations? Are there any other HMRC links that may have changed as well?\r\nNeil - have we got a way yet to automatically monitor when links to external sites change?\r\nCheers,\r\nJen',NULL,NULL,'1970-12-31 23:00:00',1),(3552,4072,NULL,'1) This functionality exists under advanced search. David S has informed training team. \r\n2) Tom Macdonald has fixed the All Subscribed Sources issue.\r\n3) Auto population is currenlty being worked on by the team with a view to rolling out solution in Aug/ Sept',NULL,NULL,'1970-12-31 23:00:00',1),(3562,4082,NULL,'This is probably another result that would be improved if the default were changed from title to full text for the search.  Also worth remembering that the search looks for the exact phrase unless boolean connectors are used. ',NULL,NULL,'1970-12-31 23:00:00',1),(3572,4092,NULL,'LISA REGAN 24/06/2011:  I think this query would best be directed to Sarah Newton\r\nPM 24.06.11 Sent to Sarah Newton\r\n\r\nSARAH NEWTON 24/06/2011: I\'m afraid this isn\'t for me. The Manager in charge of the editorial side of TCPP is Judith Anderson.  \r\n\r\nPM: update received from Judith Anderson 01.07.11\r\nThe first item is a technical issue and I believe it has already been sent to the technical team.\r\nThe second item can be done, but will require consultation with Content Acquisition and their approval concerning costs and the logistics of doing this. \r\n \r\nUpdate sent to David Smith 14.07.11. David has advised that he has logged the same issue again.',NULL,NULL,'1970-12-31 23:00:00',1),(3582,4102,NULL,'LISA REGAN 26/06/2011:  Thanks for your feedback. I do remember there was some indecision about what to call this feature and we did validate it with customers at product advisory boards and \"find a legal term\" came out top in those sessions.  I will keep my ear to the ground for further feedback on the naming and if it really is causing confusion then we cna look into changing it. Thanks, Lisa',NULL,NULL,'1970-12-31 23:00:00',1),(3592,4112,NULL,'LISA REGAN 19/07/2011:  Re-directing this query to James Wilson as this is about cases.',NULL,NULL,'1970-12-31 23:00:00',1),(3602,4132,NULL,'LISA REGAN 30/06/2011: I\'d try the All England Commercial series which covers banking and finance perhaps',NULL,NULL,'1970-12-31 23:00:00',1),(3612,4142,NULL,'LISA REGAN 30/06/2011: This query should be directed at Simon Collin (Journals team).  We have heard this complaint from customers before but it was an internal decision from Simon\'s team\r\n\r\n02.07 Redelegated to Simon Collin\r\n\r\n04.07 Email from Simon Collin \r\nI\'m very happy to have a chat with the customer to find out more about their requirements and how they use the content; currently, if they are a print subscriber (you note that they are) then they have access to the full content and archives on the websites - their normal LL login will get them onto both NLJ and TM websites.\r\nWe are currently looking at the journals content and how to improve the customer experience (Toby is running this project); there should be developments over the summer.\r\n\r\n04.07 Email from David Woodward:\r\nThanks for your reply.  Whilst the customer does have access to the NLJ and TM websites, this is on a 1 user license basis, not firm wide access.  Only 1 person is the information team has access to the NLJ TM websites, so they get requests to send across articles on an ad-hoc basis, which adds to their workload.\r\nThe second frustration is that logging out of one website and into another makes the research process disjointed.  One of the reasons users like Lexis is because it\'s a 1 stop shop for research.  When we start leaving content out, it defeats the object.\r\nHopefully the project Toby is running will address these issues.\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3622,4152,NULL,'LISA REGAN 1/7/2011:  Thanks for your feedback.  Status snapshot was built in this way to suit both user needs - to be able to see a section status at section level and also at enactment level.  The customer validation founded before we built the functionality that ifa user is looking at a specific section it does make sense that they would be interested in that specific status of that section .  Aleksander\'s feedback refutes this but there is a case for both scenarios.There is the ability to click on the enactment overview also if they so wish so the user does have options.  ',NULL,NULL,'1970-12-31 23:00:00',1),(3632,4162,NULL,'LISA REGAN 1/7/2011:  I would direct this query to robert Walker who heads up EF&P\r\n\r\n06.07.11 PM Email sent to Robert Walker\r\n\r\n12.07.11 PM: Robert Walker has responded stating:\r\n\"From an EF&P perspective, we do not have a title dealing with PFI or PPP although mention is made in, for example, Local Government and other titles. I will discuss further with contributors when discussing appropriate titles to see whether there might be material appropriate to our users.\"\r\n\r\nI have forwarded Roberts response to Ben May\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3642,4182,NULL,'PM 02.07.11 EM sent received from Jon Scriven. Awaiting update',NULL,NULL,'1970-12-31 23:00:00',1),(3652,4192,NULL,'Update from Malcolm Dowden: \r\nThanks - we\'ll add some more stat decs asap.\r\n\r\nPM 05.07.11Email sent to Lynne Davies to update',NULL,NULL,'1970-12-31 23:00:00',1),(3662,4202,NULL,'Update 08.07.11 Clare Duggan:\r\nHi Lynne\r\n\r\nThanks for the feedback from Hodgkinsons.\r\nI have had a chat with Tim Wakefield and this was his response:\r\n\r\nI agree with this comment and this forms part of the Forms migration plan that we are in the process of working through with the aim of switching off hotdocs across PSL/ Library at the end of the year. At that point we will also remove hotdocs from PSL. \r\nThe commercial thinking behind the delay here is so that the sales teams (in particular GP) can target a Smart upsell through Q3/4 renewals which gives us revenue and also reduces the number of firms who take PSL but not Smart PSL. Next year the proposal , tbc with sales, is to switch Smart on for all PSL but non Smart customers (hopefully less than 50 by then), remove hotdocs and for sales to use Smart to justify sales uplift in 2012.\r\n\r\nHope that helps,\r\nClare.\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3672,4212,NULL,'Janna Purdie 05.07.11:\r\nWe have considered this but it is currently not on the DR roadmap for the next year.  Much of the information we have for litigation generally would apply to Prof Neg cases and so it is not that we do not provide anything for solicitors involved in this type of work but we do not cover very specific issues.  I will highlight that we need to relook at whether we provide this.',NULL,NULL,'1970-12-31 23:00:00',1),(3682,4222,NULL,'Update  from Janna Purdie 05.07.11:\r\nThis is a request for calculators in the product to be able to calculate sums in relation to payment protection insurance.  We do not cover insurance within the DR product and at the moment we do not have any calculators although we are looking at adding a toolbox with calculators in it.  Jon Scriven is dealing with this aspect of DR for the DR team and the request should therefore be forwarded to him.\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3692,4232,NULL,'Thank you for this feedback. I can see from a PI practitioners point of view it would be useful to see how liability issues are being decided at county court level. This would be particularly useful if lawyers could search the recent decisions of their local court - it would give them a great insight into how their local judiciary are approaching liability issues. As the insight contributor noted this is not a practical suggestion. We couldn\'t possibly have enough court reporters to cover all the county courts in the UK. As these decisions are not legally binding upon other courts there would be no business justification for incurring this huge expense.\r\nI used to get Lawtel updates when in private practice. I don\'t recall any county court liability decisions being reported. They may accept case reports from lawyers who attended the county court decision but this would have limited value. Unless the case report has been prepared by a court reporter how would you verify its contents?\r\nI haven\'t had any other requests for county court coverage. I know the DR team have been asked if they can publish county court decision which some of their customer have been involved in but that isn\'t what Tollers are asking for.\r\nObviously let me know if you have any further queries\r\nKind regards\r\nKaren - Personal injury PSL. 11 July 2011',NULL,NULL,'1970-12-31 23:00:00',1),(3702,4242,NULL,'CD-05/07/11\r\nHi Ben\r\n\r\nThanks for the feedback you provided below from Simon Druce at Tollers LLP.\r\n\r\nI trained the solicitor in question on LexisPSL, as he did not know that they had access to it. He had tried using LexisLibrary in the past and was not a fan at all, telling me was arguing they should cancel it because it was too slow and hard to find things, therefore not value for money. Once we\'d had a look at PSL, he was a big fan, telling me repeatedly that this had really won him over, he could really make use of it, it seemed easy to use, does the things they need, is quick, straightforward, and importantly leads them to the right place within lexislibrary if deeper research is required.\r\n\r\nIt\'s really great that you\'ve taken the time to send on positive feedback you\'ve heard and for us to understand what really makes customers tick. Please do continue to pass on any further feedback you hear in the marketplace.\r\n\r\nKind regards,\r\n\r\nClare.\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3712,4252,NULL,'Nottingham City Council Housing Team also suggested that a specialist area would be more appropraite as a lot of the Property module is not applicable to them.\r\n\r\n[added by MJD, 11 July 2011] Social housing issues are currently split between LexisPSL property and LexisPSL local government.  We have an expert external author (Sue Simms) available to produce more content.  There could be merit in considering either a new practice area module or a \'microsite\' within property and/or local governnment.\r\n\r\nUpdate M Dowden 18.07.11\r\nAs a far more immediate solution I have spoken to Dolly Lundin about commissioning more specific social housing content for each of property and local government. We will build up content in those areas over the next two months.',NULL,NULL,'1970-12-31 23:00:00',1),(3722,4262,NULL,'08.07.11 Email sent to J Whittle\r\n12.07.11 Forwarded feedback to Tracey McGovern\r\n\r\n12.07.11 Update received form Tracey McGovern\r\n\"Here I can see they\'re talking about Division F, para [4.13]. Can you check to see - is it the \'property\' highlighted below that they think should have a capital P please? If so, I can make this amendment with the next issue.\"\r\nEmail sent to Jonathan Whittle asking him to clarify as above.\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3732,4272,NULL,'Email sent to Tracey McGovern\r\n\r\nEmail form Tracey 11.07.11 - I\'ll pass this feedback onto my author and will let you have their response as soon as I receive it.\r\n\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3742,4282,NULL,'Thanks for this insight. The rates and figures addition to the toolbox went live last week and we are assessing the feedback from customers on whether they like the look it it. I have noted your comments and will add your suggestion to the list for discussion at the next PI meeting. Thanks Karen O\'Sullivan PSL personal injury . 13 July 2011',NULL,NULL,'1970-12-31 23:00:00',1),(3752,4292,NULL,'Originally assisgned to Clare Duggan\r\nResponse received from Clare:\"This needs to be sent onto Karen Watton, Jon Scriven, Mark Ashley-Hacker and Orla Medcalfe who are the practice area directors for PSL. It is more of a strategic question than specifically product.\"\r\n\r\nFurther email sent to above contacts 11.07.11',NULL,NULL,'1970-12-31 23:00:00',1),(3762,4302,NULL,'Thanks for this insight. I discussed these comments at the PI workshop meeting yesterday and it was agreed that we need to change the search facility on the quantum database to enable a subscriber to search either just the top of the text or the whole report. The new online submission site is going to be marketed to the profession shortly. This marketing should significantly increase the number of quantum cases we have in the database which should also address customer complaints about the number of results they get when they undertake a quantum search. Thanks Karen O\'Sullivan 13 July 2011',NULL,NULL,'1970-12-31 23:00:00',1),(3772,4312,NULL,'Email sent to Victoria Tubb',NULL,NULL,'1970-12-31 23:00:00',1),(3782,4322,NULL,'Thank you for this insight. We have added  more letters of claim to our roadmap and plan to have these added to the product by the end of 2011. Jonathan Aspinall has just joined the personal injury team from private practice and we want to use this recent expertise and get him to draft some more letters of claim and letters to clients. Many thanks Karen O\'Sullivan PSL personal injury team 13 July 2011',NULL,NULL,'1970-12-31 23:00:00',1),(3792,4332,NULL,'PM 11.07.11 Email sent to Caroline Boyd\r\nPM 13.07.11 Response received from Caroline Boyd:\r\n\"Hi Philip\r\nThe level of each webinar is indicated as \'beginner\' or \'intermediate\' on every email that goes out and is listed on the website. It is also stated on the brochures underneath the \'Who should view these webinars\'. \r\nI am working to ensure that the content of the webinars going forward in 2012 meets the level stated on the brochures.\r\nI hope that this answers your query?\r\nKind regards\r\nCaroline\"\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3802,4342,NULL,'Thanks for this insight. We have recently had lots of feedback on changing the quantum search feature. I will add this insight to the list of customer comments for consideration when we change the search feature. Glad PSL is still proving popular with them! Thanks Karen O\'Sullivan 13 July 2011',NULL,NULL,'1970-12-31 23:00:00',1),(3812,4362,NULL,'LISA REGAN 18/07/2011:  Tihs is a question for the Content Acquisition department (Cara Annett) who can validate this idea and progress if wished.\r\n\r\n18.07.11: Email sent from Cara Annett to Claire McMahon\r\n\"Claire can you investigate and get back to the team? \"',NULL,NULL,'1970-12-31 23:00:00',1),(3822,4372,NULL,'LISA REGAN 13/07/2011:  That\'s great feedback, thanks for sharing.  I\'m looping in James Wilson (Head of Law Reporters) and Laura Vosper (Marketing) who might like to know this and use it for marketing.',NULL,NULL,'1970-12-31 23:00:00',1),(3832,4382,NULL,'PM: Email sent to Tracey McGovern 13.07.11\r\nPM: Update received from David Smith 13.07.11: \"Hi tracey, I also asked jonh hanratty about this query as it\'s a precedent based issue and I believe john is scheduling a meeting soon to discuss further - I\'ve included him on this so he can include you on the invite.\"\r\n\r\nPM: Udate from Tracey McGovern 13.07.11\r\n\"Hi David, Philip and John,\r\nI am aware that this issue is an ongoing one with Wills Precedents, Division AP. I have asked the authors if they could change the layout of their precedents but it\'s not something they wish to do.\r\nI have also spent time with Mark Wilson, Katy Forrester and Anne Adkins making amendments to the xml files in order that they are more user friendly for the online subscriber.\r\nI\'m at a loss at the moment as to what else I can do as it seems these problems are more technical than content orientated, therefore I am going to pass this email on to Katy Forrester in the hope that she might be able to point me in the right direction as regarding who can deal with this query now that online is now outsourced. \r\nI will let you all know Katy\'s response as soon as I receive it.\"',NULL,NULL,'1970-12-31 23:00:00',1),(3842,4402,NULL,'LISA REGAN 18/07/2011:  The customer is actually talking about suggested searches on cases search boxes (not the \"did you mean?\" functionality - which appears at top of results). It is a valid point that \"Re...\" could be one of a million cases and therefore perhaps the wordwheel should kick in after a fourth letter/space is typed.  I will monitor feedback if this is a customer frustration and if so rasie a webstar to amend.',NULL,NULL,'1970-12-31 23:00:00',1),(3852,4412,NULL,'LISA REGAN 13/07/2011:  Directing this query to Robert Walker in EF&P.  This is something that his team woud produce.\r\n\r\nROBERT WALKER 15/07/2011: We have a selection of clauses and, eg, transfers, dealing with incapacitated trustees in vol 40(2) TRUSTS AND SETTLEMENTS - Forms 68 -72. I will speak with our contributors and see if there is something else that can be added here. - Robert',NULL,NULL,'1970-12-31 23:00:00',1),(3862,4422,NULL,'LISA REGAN 13/07/2011:  I\'m directing this query to Katy Forrester who manages the list of synonyms and can get this validated/added\r\n\r\nKaty Forrester 15.07.11 : Please could you direct me to the clause that \'lift and shift clause\' is synonym for? I\'ll then look into the best way to get this equated to the content.\r\n\r\nNina Packman 15.07.11 I\'ll find out exactly what the clause is and get back to you. It may take a little while as I\'ll need to hear back from the delegate with the query but I will get on it and let you know asap\r\n',NULL,NULL,'1970-12-31 23:00:00',1),(3872,4432,NULL,'PM 15.07.11:Originally sent to Malcolm Skinner who has advised this is actually a Property Issue.\r\nSent to Malcolm Dowden\r\n\r\nUpdate from M. Dowden\r\nThe feedback is correct.  I have removed the SmartForms version from LexisPSL property.  The point needs to be referred to Carole Gallagher/Rob Evans so the SmartForms version can be corrected and reinstated.\r\n\r\nPM 18.07.11 Email sent to Carole Gallagher/Rob Evans',NULL,NULL,'1970-12-31 23:00:00',1),(3882,4452,NULL,'LISA REGAN 18/07/2011:  I\'m not sure how you suggest ilet customers know? -Do you want this sent around the sales force, mentioned in eburst, emailed to all customers?Thanks, Lisa\r\n\r\n\r\nEF&P RESPONSE 19/07/2011: This is actually an issue linked to a user\'s Internet Explorer settings or Control Panel settings (which  may be controlled by their company) ie the user doesn\'t get the option to Save the prec - instead it automatically opens in an \'alternative format\' window and can\'t be saved or edited properly.\r\n \r\nAs far as we know there\'s no solution at this end. It is just a case of dealing with the problem as and when we knowm a customer is experiencing it. It\'s not ideal because it can give a false impression as to how useful the downloads are.\r\n \r\nOne way to fix it:\r\n1.         Open the Control Panel and go to Folder Options. \r\n2.         Select the File Types tab. \r\n3.         Scroll down to the extension type that you want to reset. \r\n4.         Select the extension type (doc), then click Advanced. \r\n5.         Check the \"Confirm open after download\" check box, then click OK.\r\n6.         Click Close to the Folder Options dialog box. \r\n \r\nPlease contact Claire Heeley if you need more information. \r\nRegards',NULL,NULL,'1970-12-31 23:00:00',1),(3892,4462,NULL,'This function is being added to TolleyLibrary in the next release (last week of August 2011 at the latest). \r\nThanks\r\nDan',NULL,NULL,'1970-12-31 23:00:00',1),(3902,4482,NULL,'MS - 20/07/11\r\nAssuming the reference is to a solicitor (as a professional executor/trustee) charging clause it is not common for such to be used these days as legislation has rendered them effectively obsolete.\r\nHowever, a search (\'charging clause\') will reveal  2 such clauses in PSL W&P - both a concise and full form.',NULL,NULL,'1970-12-31 23:00:00',1),(3912,4492,NULL,'MS - 20/07/11\r\nThe term \'declaration of trust\' is very unspecific. It could refer to a will trust or to a standalone trust and additionally there are, within those parameters, hundreds of forms of trusts. If he could be more specific it would help enormously.\r\nPSL is not really designed to cater for this degree of width which is to be found in LL. Within PSL W&P there are at least 16 forms of will trust (including the one found) but no standalone trusts as these are to be found in PSL PC.\r\nUnfortunately, we cannot include everything but if there is something specific that is required we can pass it up the line for approval.',NULL,NULL,'1970-12-31 23:00:00',1),(3922,4732,421,'We\'ve taken a decision here to only include Tax menus on TolleyLibrary; it is optimised for that content only. This impacts the user experience - they\'d lose many benefits of the new platform.',NULL,NULL,'2011-08-10 08:03:51',1),(3932,4792,2331,'Have reviewed the case referred to by the customer.  More PI based (which is customer\'s practice area anyway) so have discussed and passed the matter on to Jonathan Aspinall',NULL,NULL,'2011-08-11 15:46:25',1),(3942,4962,61,'This sounds like it relates to a bespoke website not LexisLibrary.  Please could you include more detail of what you require? Is it a LN website that needs updating? If so, query is for Journals.Thank',NULL,NULL,'2011-08-12 09:55:18',1),(3951,4802,2632,'Could be fairly easy to implentent. We need to analyse the impact of the change before we commit. I would like to get some feedback from other users to get the most appropriate labelling',NULL,NULL,'2011-08-15 08:22:30',1),(3961,4752,3472,'This option as looked into originally but it was rulled out due ot the fact that LexisCheck running automatically everytime wodul corrupt usage. Also oevrall feedback was that it would annoy users',NULL,NULL,'2011-08-15 10:29:08',1),(3971,4712,2632,'We now have a menu for this content - CPTM14',NULL,NULL,'2011-08-15 10:44:58',1),(3981,4732,1221,'understand, is there anything stopping us running a couple of the legal menus through the platform and seeing how they work? my understanding was they all used rosetta as source content?',NULL,NULL,'2011-08-15 12:26:10',1),(3991,4692,1921,'Jon has asked that this be forwarded to Karen O\'Sullivan/Jonathan Aspinall for a response',NULL,NULL,'2011-08-16 08:32:41',1),(4001,4742,1221,'understand that not all clients know what they need, although within the specialist segment they tend to, and within small solo, we could associate titles (out of room.....)',NULL,NULL,'2011-08-16 11:22:23',1),(4011,4971,2632,'Forwarding to Chris Boulter as it\'s a commercial call.',NULL,NULL,'2011-08-16 14:23:19',1),(4021,4981,2632,'Forwarding to Chirs Boulter as its a commercial call.',NULL,NULL,'2011-08-16 14:25:47',1),(4031,4991,2632,'We are making changes to the alerts settings in the late August release. This should allow the user to see the mini-summary view so that he can check if the alert is useful.',NULL,NULL,'2011-08-16 14:28:42',1),(4041,5001,2632,'The HMRC function has been requested by a few other clients - we are investigating it. \r\nTL can be used on i-pads already - is there something specific that they can\'t do at the moment on an i-pad?',NULL,NULL,'2011-08-16 14:33:39',1),(4051,4812,2632,'This is more of a bug, so should go have gone via the normal route to Belfast. Don\'t do that now though because we are already aware of the bug and are fixing it.',NULL,NULL,'2011-08-16 15:16:07',1),(4061,4971,421,'Thanks Mark - will look into this. I make it 5.7K to get what they would need; the clearances and approvals we can add. What is CCH\'s price point?',NULL,NULL,'2011-08-16 15:52:47',1),(4071,5031,1531,'Hi this is a property issue and should be dealt with by Malcolm Downden.  Although the customer is a DR module customer they were looking for the forms in property module.',NULL,NULL,'2011-08-17 09:18:05',1),(4081,4971,1221,'CCH\'s price point was 1900, agree with your pricing (mine came to 6700 - 800 for tax news).',NULL,NULL,'2011-08-17 09:27:43',1),(4091,5061,61,'As noted in the initial feedback this is being investigated by Geraldine Morris and she is the best person to provide feedbacl',NULL,NULL,'2011-08-17 10:05:23',1),(4101,5061,61,'As noted in the feedback, this is being investigated by Geraldine Morris and she is the best person to provide feedback.',NULL,NULL,'2011-08-17 10:06:20',1),(4111,5011,1561,'Comment added to the Feedback Summary box',NULL,NULL,'2011-08-17 12:27:26',1),(4121,5031,2421,'Some of the links to court forms were broken following the recent reorganisation of courts and tribunals. The links have now been fixed and are working. ',NULL,NULL,'2011-08-18 10:11:47',1),(4131,4732,2582,'There\'s a bit of history to this...there was a legal menu which had most of the same content as the tax menus but for some reason was cheaper than the equivalent tax one. Some tax people went for it.',NULL,NULL,'2011-08-18 10:57:21',1),(4141,4732,2582,'What would be useful would be to find out what sources rather than menus the person wants/needs - they may actually be tax sources.',NULL,NULL,'2011-08-18 10:58:18',1),(4151,5081,2632,'Forwarding to Alan Blanchard for his thoughts',NULL,NULL,'2011-08-19 08:37:22',1),(4161,5081,181,'Do we know specifically which source(s) this relates to?\r\n10:56 AM 19/8',NULL,NULL,'2011-08-19 09:56:36',1),(4171,5101,181,'Raising with GLP Fabrication to resolve.',NULL,NULL,'2011-08-19 09:57:46',1),(4181,5091,2862,'I think this feedback supports the searching across multiple modules improvement which should already be on our list as it was raised last year.  I know it is on the list for PSL too.',NULL,NULL,'2011-08-19 12:24:35',1),(4191,5091,2882,'Information should be included in every module to which it is relevant and so many subjects will be included in more than one module. For example, the two examples given of NIC and IR35 are included in both the personal tax and OMB modules. \r\nThe focus may be different between modules, but interlinks should redirect the customer where something is discussed in more detail or from a different angle in another module.',NULL,NULL,'2011-08-19 13:24:52',1),(4201,5111,2632,'The toolkit content is available in TL. It\'s in the source called \'Specialist Tax Regulatory Material\' so if user adds this to their bookshelf they can run a search for the toolkit - for example \'HMRC Toolkit Trusts and Estates\' would bring up the result for the user. These can also be accessed via links in TolleyGuidance. I will mention this is the training team so that they have a response if this comes up from any other customers.',NULL,NULL,'2011-08-22 11:45:49',1),(4211,5131,241,'see attachment','1314017152.htm','RE Feedback Tracker notification Feedback Ref 5131.htm','2011-08-22 12:46:46',1),(4221,5131,241,'see atatched','1314022248.htm','FW incorrect link in PSL.htm','2011-08-22 14:11:42',1),(4231,4732,1221,'the key sources that were not tax were EF&P and Halsburys Company and commercial.  the others are all spread across various menus (but together in Legm27 - which is available on Tolley Library). just to confuse matters further the client has tolley guidance (a 3rd URL to login into).  Federated search seems a potential solution..... thanks  Mark',NULL,NULL,'2011-08-22 17:03:16',1),(4241,4842,371,'Thank you for your feedback. RSA are correct when they say there is no diagram of the brain. I am happy to add this drawing to the product and have added it to our roadmap for the future development of the product. I would hope to have this diagram added before the end of Q3 2011. The expert witness directory is a new addition to the product. We are current collating customer feedback to the directory to ascertain whether customers find the directory useful and whether it contains sufficient information for their needs. I have recorded RSAs request for details on whether the expert has been positively or negatively appraised. At the present time this information is not available but if there is sufficient customer interest in this information being provided we will consider adding it to the product in the future (although I would add a caveat that this may be difficult information to obtain and add to the product). I hope this helps. Thanks Karen OSullivan  personal injury PSL. 15 August 2011.\r\n\r\n',NULL,NULL,'2011-08-23 08:36:38',1),(4251,4882,371,'Thank you for this feedback. We are keen to expand our clinical negligence offering if customer feedback justifies this investment. I would be very interested to speak to this firm and discuss in greater detail the additional clinical negligence topics they would like to see us cover. Perhaps you could provide me with their contact details and I will give them a ring?  Many thanks Karen OSullivan PSL personal injury. 15 August 2011.\r\n\r\n',NULL,NULL,'2011-08-23 09:14:43',1),(4261,4692,371,'Thank you for this feedback. In response to customer feedback we have developed a new online submission site for quantum cases which we anticipate significantly increasing the number of quantum cases we will have in our quantum database over the next 12 months. The online site makes submission of quantum cases easy and simple for practitioners and they will be paid 40 for each case accepted for publication. The online site is up and running and receiving submissions. We anticipate launching a marketing campaign to encourage the profession to submit their quantum cases within the next month. We are aware we lack quantum cases in particular injury areas and also for clinical negligence cases. To resolve this we are specifically going to target firms and chambers who carry out this work and encourage them to submit their quantum cases to us. We hope this project will resolve the concerns some customers currently have about the depth of coverage of our quantum database. We will then be in a position to truly compete with Lawtel on quantum (we excel in all other areas when compared with Lawtel). Obviously let me know if you need any further information. ',NULL,NULL,'2011-08-23 09:25:48',1),(4271,4692,371,'If appropriate please encourage this firm to submit their quantum case. The online submission site can be accessed via the PI toolbox in PSL. Thanks Karen OSullivan PSL personal injury  16 August 2011.\r\n',NULL,NULL,'2011-08-23 09:26:15',1),(4281,5161,2341,'Private Client PSL contains a precedent Deed of Gift and many more are available in Private Client Library.',NULL,NULL,'2011-08-23 10:40:30',1),(4291,5151,2341,'This is a functionality issue and we will ask the technical team to respond.',NULL,NULL,'2011-08-23 10:49:01',1),(4301,5141,2632,'Not sure I follow this one completely - do you have an example we can look at Charlie?',NULL,NULL,'2011-08-23 11:47:43',1),(4311,5071,59,'Hi Andy\r\nThanks for your feedback. This is one of those items of feedback we have tested in the last two usability reviews and both times, the overwhelming preference from customers has been for the Title search default as they get a more refined set of results. It is also worth noting that the wordwheels are only available on the title search so this is another good reason to keep this as the default. We will continue to monitor this and can test it again in the 2012 usability review. Do let me know if you have any more feedback to this effect, particularly with examples of the search terms users are inputting.\r\nKind regards,\r\nClare.',NULL,NULL,'2011-08-23 17:13:11',1),(4321,5191,1541,'Re the divorce petition fee - I am afraid I can\'t see where this is incorrect. It may be re Toolbox content (see below). The practice notes correctly refer to 340. A reference to 4/5 facts is in fact correct, it is 5 facts re a divorce and 4 re dissolution of a civil partnership (adultery doesn\'t apply to civil partnership dissolution). \r\n\r\nRe the inherited wealth content - the case in the legal updates section was in the High Court and didn\'t establish any new points of law. We will cover all levels of court in the update but practice notes are updated where the law is changed or a new principle established. \r\n\r\nRe the toolbox - it was put into the product in error for a short period. There were problems in loading the content fully. i will follow up with content management as to when it will be ready to go in properly. \r\n\r\ndo let me know if i can assist further',NULL,NULL,'2011-08-24 11:08:33',1),(4331,5201,59,'Hi Russ\r\n\r\nThanks for the feedback below; this is more a question for the PSL editorial team to pick up on. Can you please provide detail of where the broken link appears in the CoCo module and well send it to the PSL editors? With broken links, if you can please provide steps taken (e.g. browse to topic, subtopic, content type, doc name)they will be able to find the link and repair it quickly.\r\n \r\n\r\n\r\nThanks, Jen.\r\n\r\n',NULL,NULL,'2011-08-24 11:56:49',1),(4341,5121,2812,'Many thanks for this feedback. The Tax authors have added this to their task list as a future development.',NULL,NULL,'2011-08-25 08:21:57',1),(4351,5191,801,'please note the response / comment has been added by the Subject Matter Expert',NULL,NULL,'2011-08-25 10:02:05',1),(4361,4182,1921,'Emailed Jon Scriven requesting update. Jon has advised to pass to Clare Duggan',NULL,NULL,'2011-08-25 11:50:10',1),(4371,4962,801,'Hi Allison, please note the comment SME Lisa Regan has logged for you in the Tracker- would you please review and advise? thank you',NULL,NULL,'2011-08-25 15:01:08',1),(4381,4962,1661,'Hi,  I have spoken to Lisa and she has refered me to Tom McDonald who is looking in to this for me, to see if we are able to add British Standards Summeries on to the Trading Standards menu. Thanks for your help. Allison',NULL,NULL,'2011-08-25 15:14:55',1),(4391,4742,801,'Hi Mark, just a logistic note on the comment submission mechanism- the word limit has been increased to 200 words so you will not run out of space that soon',NULL,NULL,'2011-08-25 15:16:36',1),(4401,5131,241,'Links all fixed except EFP links to dating documents policy. Discussed with Robert Walker 25/8 see attached.','1314288483.htm','RE EFP links in PSL.htm','2011-08-25 16:08:48',1),(4411,5241,2582,'This could be quite an easy win for you. Remember we do have lots of Financial Services content - in the legal side - over 100 FSA source books, we monitor and write laods of news on the legal side. Going round on subscriber visits you see loads of accountancy firms with FSA authorisation because of the advice overlaps',NULL,NULL,'2011-08-26 09:47:58',1),(4421,5231,2632,'Alan and Chris J have seen this in a separate e-mail chain. - Action being taken forward to provide a whats new update for the looseleafs in TL. ',NULL,NULL,'2011-08-26 11:31:28',1),(4431,5251,2612,'Jet2 was first reported in the module on 15 June which is why it appeared in the All ER in July. Once case reports move from the top 100 stories in the Updates Archive, they default to the tab Cases so this is where youll find it if you search (this has been raised as a Webstar because when the judgments and digests move to the Cases tab they no longer appear in the Updates Archive). \r\n\r\nThe alert on 23 August is the digest which follows on from the judgment.\r\n\r\nClare Duggan to comment on the linking from PSL to Library. \r\n',NULL,NULL,'2011-08-26 12:52:28',1),(4441,5181,2762,'Attached is Katrina Crossley\'s reply to Paul. She called the customer to discuss the issues listed above and he suggested we go back to him in 6 weeks.','1314363413.docx','EU Legislation feedback.docx','2011-08-26 12:57:35',1),(4451,5251,59,'Susan-can you please provide me with the id and password, as well as the actual link in the discussed item so I can invetiate this further?\r\nThanks,\r\nClare.',NULL,NULL,'2011-08-26 12:58:57',1),(4461,5291,2882,'Hi, thanks for the feedback. Please could you provide more specific details of exactly what templates the customer would like us to add.',NULL,NULL,'2011-08-26 13:13:46',1),(4471,5211,2822,'Forwarded to Clare Marwood in seminars',NULL,NULL,'2011-08-26 14:18:31',1),(4481,5211,2832,'When a customer books a CPD seminar or series of CPD seminars and they find that they are unable to attend some of them, it is possible for them to transfer to an alternative seminar providing that the places are used within the subsciption year. They would not receive a refund for unused places but we allow them this flexibilty to swap to another seminar. ',NULL,NULL,'2011-08-26 14:52:28',1),(4491,5311,2582,'We need to get a bit more clarification on what they want to do/why? - Generally in our current awareness we pre-sort in reverse published date - so latest comes first, and we rank back in strict date order. Is that what they mean - or do they want to break down by years or something else so they can quick get to particular time frames. Or Is what they need to do search for stuff over specific/particular date ranges. Are they not getting this behaviour and need it in a specific area of the service/search form.',NULL,NULL,'2011-08-26 15:26:28',1),(4501,5291,2121,'They like what we currently have but would just like more of the standard letters. He didnt give me any more specifics.',NULL,NULL,'2011-08-26 15:28:09',1),(4511,4182,59,'Hi David\r\n\r\nThanks for your feedback. This is an interesting one in that wod wheels are only set up to pick up content which sits on our servers. It doesn\'t crawl multiple websites that are referred to in our practice notes etc. To do this automatically would be a massive financial undertaking which given the  infrequency of the feedback would not be justified currently. One slighter less expensive way which it could be done would be for the lawyers to create stub documents for any documents they refer to externally so that these documents sit on our servers and can be crawled and included in word wheels. That too however would be a very time-consuming exercise - I\'ll leave Jon and the PADs to determine whether this is something they\'d want to put in their backlog of developments.\r\n\r\nHope this helps.\r\n\r\nKind regards,\r\n\r\nClare.',NULL,NULL,'2011-08-26 16:04:03',1),(4521,5311,2632,'I understand this one - it relates to the fact that when clicking on the current awareness tab after a search is run, the tick box for order by date is removed. Obviously we wanted users to be able to sort by date from all the tabs but our infrastructure does not support this. The New Lexis infrastructure should allow for multiple layers of filters so that this can be achieved (although clearly I cannot give a date for this yet). The work around is to click on sort by date on the all tab and then click on the current awareness tab. the results will then be ordered by date.  Please let me know if anything doesnt make sense.',NULL,NULL,'2011-08-30 13:29:15',1),(4531,5271,2632,'As you say Mary - the users can use remember me so that they don\'t need to remember their username and password. I believe the change on our side that is making new users enter a new password runs accross all platforms not just TL.',NULL,NULL,'2011-08-30 13:35:36',1),(4541,5301,2632,'Thanks - useful feedback. We are looking at a potential project for next year to improving browsing for TL users. I would like to include this customer in the testing if you have no objection Charlie? ',NULL,NULL,'2011-08-30 13:40:25',1),(4551,5281,2632,'Thanks - forwarding to Irene Kaplan and Anita Barker for their consideration',NULL,NULL,'2011-08-30 13:43:14',1),(4561,5241,2632,'Forwarded to Chris Boulter for commercial consideration. In terms of the feedbacl on being client focussed - that is very much where we are going too. One of the central themes of CDI is to be less focussed on product when interviewing - I\'m happy to go and see him if you can pass on the relevant contact details.',NULL,NULL,'2011-08-30 13:48:20',1),(4571,5301,2121,'I\'m sure Julian would be ok with being included in this project. I\'ll email him and copy you in Dan so you\'ll have his details.',NULL,NULL,'2011-08-30 14:17:52',1),(4581,5341,1531,'We are in the process of conducting a full review of the bespoke precedents in our product and will pick up this comment as we review them.',NULL,NULL,'2011-08-30 16:42:29',1),(4591,5351,2622,'There is limited reference to IHT in Will Drafting but a full discourse on all these tax issues will be contained in the Tax and Wealth Management topics which are being drafted now with expectation that they will be in the product late this year and/or Q1 2012',NULL,NULL,'2011-08-30 16:58:03',1),(4601,5361,201,'Many residential conveyancers use the printed form containing the Standard Conditions of Sale, with any specific additional provisions being typed onto the back of the form or onto a separate sheet.  Due to Tim W\'s recent deal with the Law Soc we are able to provide that form as a SmartForm.  Consequently, the precedent was developed in discussion with larger firms for higher value and/or mixed use schemes.  Feedback on an earlier, stripped down, version was that it was too thin,  \r\n\r\nThe prescribed lease clauses are available as a separate precedent (see business tenancies).  I\'ve added the precedent to the landing page for resi tenancies.',NULL,NULL,'2011-08-31 09:01:51',1),(4611,5281,2912,'S & M are in the process of placing all their content online (better late than never!) The title referred to was written for the lawyer market and as such has never been considered as a key competitor for any of the titles in our current tax portfolio; the key ones being Foster\'s Inheritance Tax, IHT Tax annual; IHT Tax Planning, Mellows on Trusts and Estates and Simons. Probably the move by Sweets will be of more significance to those running the PSL for Private Clients and the supporting Private Client menu. On the tax front the main focus of our attention is what Thomson\'s tax is doing, which we are monitoring.',NULL,NULL,'2011-08-31 09:28:25',1),(4621,4272,1921,'Followed up with Tracy McGovern who had been in contact with editorial team. Editors have thanked us for the suggestions and will consider the proposals put forward',NULL,NULL,'2011-08-31 09:31:36',1),(4631,5401,1531,'I have amended this \r\n\r\nJanna',NULL,NULL,'2011-08-31 14:29:09',1),(4641,5421,1531,'This is on the DR roadmap and we will be looking at adding these.  It would be helpful to know from customers whether there are specific ones which they would like to have prioritised',NULL,NULL,'2011-08-31 14:40:27',1),(4651,5241,2882,'Thanks for this feedback. Becoming more client focussed and developing commercially relevant content is very much our aim. \r\nIn TolleyGuidance we already have practical content which is relevant to financial services which we see as a key area for development and addition of new content. There is as you say a wealth of high quality relevant content in Library and it is really a question of bringing this together into a coherent and attractive offering.\r\nWe are already in the process of developing a new topic in the Corporate tax module of TolleyGuidance with content on the key industry specialisms for corporate tax professionals, and content on banking and capital markets and financial services is a priority. \r\nI would welcome the opportunity to discuss the customer\'s requirements in more detail.\r\n',NULL,NULL,'2011-09-01 10:21:13',1),(4661,5331,2632,'Interesting point - I am meeting with various people to see if there way we can use the VAT tab to limit the HMRC search. This may require development but I can seen some value in it.',NULL,NULL,'2011-09-01 10:39:40',1),(4671,5411,241,'Please tell customer that we are investigating this currently and the document should be fixed today.  We will respond more fully regarding our process shortly.  Please thank the customer for raising this issue.',NULL,NULL,'2011-09-01 10:55:29',1),(4681,3452,241,'We have a case digest added 6 April\r\nThe case report was also included in PSL 6 April\r\nThere was a fuirther article added 18 April\r\n\r\nSusan Bentley can add to this as I believe we covered this before PLC',NULL,NULL,'2011-09-01 13:20:29',1),(4691,5381,2622,'It appears under \'Application etc\' as it is discussed fully under that PN. The logic is that admin is post grant but grant cannot be obtained without the IHT forms! It all depends on perceptions and, probably, the 205 should be in \'Application etc\' not admin!  If a search is made for a form does it matter where it is found as long as it is available with its descriptive background? The point in issue as not been raised before but soundings will be taken from other users for a consensus.',NULL,NULL,'2011-09-01 13:21:21',1),(4701,5391,2622,'A number of countries will be added such as Spain,  Switzerland, Hong Kong and so on. The final list is to be decided upon and external authors instructed. Timings are not yet available. Annouincements will be made as and when they are added. Feedback on countries that should be included are still welcome.',NULL,NULL,'2011-09-01 13:35:16',1),(4711,4502,241,'Awaiting input from Anne-Marie Claydon in PSL: Corporate',NULL,NULL,'2011-09-01 14:18:41',1),(4721,3882,1921,'Update from Cara Annett:\r\n\"We have not heard anything more on this. The query should be marked resolved. Informa don\'t actually licence anything to us currently so unlikely to be possible even if customer demand was sufficient\"',NULL,NULL,'2011-09-01 14:20:00',1),(4731,5131,241,'See below re EFP date links.\r\n\r\nFrom: Walker, Robert (LNG-LON) \r\nSent: 25 August 2011 17:56\r\nTo: Annett, Cara (LNG-LON)\r\nCc: Duggan, Clare (LNG-LON); Jones, Phillip (LNG-LON); Green, Helen (LNG-LON); Maidens, Peter (LNG-LON); Wakefield, Timothy (LNG-LON); Tiu, Jennifer (LNG-LON); Heeley, Claire (LNG-LON)\r\nSubject: RE: EFP links in PSL\r\n\r\nCara,\r\n \r\nThanks for this.\r\n \r\nI have looked at PSL and see the problem when the EFP link is clicked. This link was set up to take our users to our note Date Stamps  - What they mean. It works well for our product but obviously is not helpful to PSL users when all they can see is a reference to lexis library and do not know what information they are missing.\r\n \r\nI will talk with those involved at our end and also with Tim on his return. The suggestion that the information be moved to a place that everyone can access is good. \r\n \r\nThanks for drawing this to our attention. It is important to find a solution that works for everyone as users of  EF&P precedents on all products need to see what Date Stamping is all about.\r\n\r\n',NULL,NULL,'2011-09-01 14:41:26',1),(4741,5131,241,'Russell\r\n\r\nI am logging this as a EFP About dates on docs link as that is ongoing and needs to be addressed by the EF&P. It should porbably be delegated to them. In the meantime, please can you thank the customer for the feedback. Apart from another broken link we spotted we noticed that the link to the model clauses was linking to an old version in EF&P, even though the new version is available. This has now been fixed and will appear in the live product tomorrow after an overnight refresh. Could you check to see that the customer is happy with this?\r\n\r\nMany thanks\r\n\r\nCara',NULL,NULL,'2011-09-01 14:44:06',1),(4751,5411,241,'Lynne \r\n\r\nThanks for passing this along. Please thank the customer and let him know that we believe we have found and fixed all the problematic links in the document mentioned, and we are very sorry for any inconvenienced this has caused him. \r\n\r\nThe revised document will go live tomorrow morning after an overnight refresh. \r\n\r\nI have now logged broken links as an issue. We have had some occasional troubles in the past and this will now be looked into by the Editorial team. \r\n\r\nTo reassure the customer about our processes for ensuring links remain valid, please could you let him know this is an issue we are continually reviewing but also that for PSL Commercial in particular: \r\n(1) our editors notify PSL teams of any changes in related volumes so that links are updated as required;\r\n(2) currently, in addition to this, we manually check all links in the entire product on a rolling basis as part of our peer review process;\r\n(3) we also run a broken links report which is still in beta but is beginning to help us speed up the link checking process. \r\n\r\nHope this helps. Many thanks\r\n\r\nCara',NULL,NULL,'2011-09-01 15:02:43',1),(4761,4592,241,'Susan \r\n\r\nPlease could you thank the customer for this feedback. In terms of the PSL Commercial documents and specifically the comments regarding precedents, please could you let the customer know that we have taken on board this feedback and that for the last couple of months we have been conducting an intensive quality control review, seeking to imporve the standard of all agreements and clauses, looking in depth at the drafting and the drafting notes. We are also reviewing all practice notes, ensuring the law is fully up to date and the most relevant and useful citations and cross-references are included. In the last three months, we have completely overhauled about 20% of the product; in particular the topics on Bribery, Distribution, Goods and services and much of Contract have been refreshed. This is ongoing project and we really hope the customer will start to see significant improvements in the quality and especially in how it compares to competitors.\r\n\r\nI will delegate this to AMC for Corporate and then it should go to DR. Have also logged as issue = PLC comparison\r\n\r\nThanks\r\n\r\nCara',NULL,NULL,'2011-09-01 15:17:01',1),(4771,5131,241,'Sorry Russell email from Claire Heeley re the data processor model clauses link might take a few days: \r\nWe have an update going through at the moment so it\'ll be a few days (at least) before we\'ll be able to get the file live but I can give you a provisional date when I get a better idea. Unfortunately it\'s difficult to predict when it\'ll be because some updates are quicker than others to go through. We need to get the current one through and then the one with this file too!\r\n \r\nI haven\'t changed the title of the precedent as to me it still accurately describes the new clauses... which are headed:\r\n \r\nSTANDARD CONTRACTUAL CLAUSES (PROCESSORS) \r\nFor the purposes of Article 26(2) of Directive 95/46/EC for the transfer of personal data to processors established in third countries which do not ensure an adequate level of data protection \r\n \r\nI don\'t know if that matters for your purposes?\r\n \r\nI\'ll keep you posted as to progress with the update.\r\n \r\n',NULL,NULL,'2011-09-01 15:19:52',1),(4781,4542,1921,'Cara Annett has advised that this insight should be delegated to Clare Duggan, Susan Bentley and Jane Mayfield. Starting off, Clare, can you please update on the part of the Insight which is relevant to you',NULL,NULL,'2011-09-01 15:35:55',1),(4791,5251,2612,'Hi Clare - link has been provided to you by email. \r\n\r\nThe ID and password will need to be provided by the account manager. \r\n\r\nThanks.',NULL,NULL,'2011-09-01 16:35:17',1),(4801,3452,2612,'PLC did not cover this case until the w/c 11th April (so the week following our coverage). ',NULL,NULL,'2011-09-01 16:42:00',1),(4811,4042,1921,'Update from Susan Bentley:\r\n\"This title is being costed for addition to our online services. The cost of putting it online and then keeping it updated (every 2 weeks) will then be evaluated against the business value/risk of it not being online. \"',NULL,NULL,'2011-09-01 16:51:30',1),(4821,5371,2632,'Dealt with via a separate e-mail chain - Chris Jones, Chris Boulter, Ed Scott involved. Outcome -They have been aware of a number of missing documents from our version of the manuals. This is now being fixed, and we should, from tomorrow, be able to say we have 100% of the manual content available on LexisLibrary / TolleyLibrary.\r\nOur turnaround time for changes to the manuals has varied, and has been up to two weeks for some elements. However, this has been reduced to one day as of today. \r\n',NULL,NULL,'2011-09-02 08:24:19',1),(4831,5481,61,'I would direct this query to Alan Blanchard who oversees online editorial. Thanks',NULL,NULL,'2011-09-02 14:10:35',1),(4841,2251,1921,'Lynne, please see Clare\'s response below. If you require any further asssitance with this Insight, please advise. ',NULL,NULL,'2011-09-02 14:32:18',1),(4851,4502,241,'Hi Lynn\r\n\r\nPlease can you thank the customer for raising this. We are considering a basic shareholders agreement for PSL Commercial.\r\n\r\nThere is a JV agreement in PSL Commercial that could be used for this for the time being (it can be found here: http://www.lexisnexis.com/uk/lexispsl/commercial/docBookmark.faces?remotekey1=LNI&remotekey2=520M-RGT1-F11V-F2NY&csi=333086&end=1).  I am going to ask Product Development to look into suggesting this as a result on a search for shareholders agreement.\r\n\r\nThere are some more complex shareholders agreements in PSL Corporate too and we are considering creating LexisSmart versions next year.\r\n\r\nBy the way, if Mr Harris has a full Library sub there is also the book Reece Thomas and Ryan: The Law & Practice of Shareholders\' Agreements in Library which has some further documents.\r\n\r\nHope that helps\r\n\r\nKind regards\r\n\r\nCara',NULL,NULL,'2011-09-02 18:10:21',1),(4861,5091,2121,'Will there be a search across the modules box added at some point?',NULL,NULL,'2011-09-05 09:00:32',1),(4871,5461,2632,'Feedback noted - there are ongoing discussions about the taxation content in TolleyLibrary that form part of Chris Boulters menu project.',NULL,NULL,'2011-09-05 10:16:37',1),(4881,3982,2632,'The latest release covered points 1 and 2 - e-mailing is now possible along with adding docs to an area (My Documents). I\'m not sure about point three, it may be cause their browser version - we will keep an eye on this.',NULL,NULL,'2011-09-05 10:20:35',1),(4891,5371,1221,'Hi, Just note to follow up, unfortunatley despite everyones efforts to resolve this, the client has cancelled his order with us and gone back to CCH online. the order was for 3k pa on a 2 year deal. see attached from the client.','1315303000.txt','Order 201112.txt','2011-09-06 09:56:48',1),(4901,5481,181,'Forwarding to Tracey McGovern, Content Editor',NULL,NULL,'2011-09-06 12:37:33',1),(4911,5491,2632,'Ok thanks - issue noted',NULL,NULL,'2011-09-07 08:46:05',1),(4921,5501,2632,'Forwarding to Chris Boulter - related to menu set-up',NULL,NULL,'2011-09-07 08:48:07',1),(4931,5221,1921,'Issues currently being investgiated by on-line coordination team. Awaiting further update from Peter Maidens',NULL,NULL,'2011-09-07 09:53:07',1),(4941,5501,421,'From Claire Melvin: there seems to have been a number of other customers saying similar things  about wider coverage  to include some of the stuff we have in financial services, accounting, company law, insolvency  and possibly industry coverage. (where weve done some research about the most popular areas).\r\n\r\nWe have this content  but I want to find out more about the ways were writing it maybe a bit too legal for the tax market, the other areas and the industries\r\n\r\nWould it be possible for you to send the contact details on me so I can get someone in the tax news team to speak to this person.\r\n',NULL,NULL,'2011-09-07 13:54:17',1),(4951,5511,2582,'IClaire Melvin: \'m also wondering whether we might be able to use the news content in some way to assist. We put the related legislation citations in the content - in other products like Middle East Online. I\'ve used this field to pull in related material.',NULL,NULL,'2011-09-07 14:20:52',1),(4961,5511,2632,'Forwarding to Alan Blanchard for his thoughts.',NULL,NULL,'2011-09-09 08:57:07',1),(4971,5511,181,'I\'ve discussed this with the content team. We will work to get the number of new devs down, but don\'t forget that the new devs section provides a quick and easy way to keep track of latest devs. We are also resourcing at least 8 hrs per week on linking. We have identified key areas of the commentary to aggressively tackle and are doing so from now. What we need, ultimately, is more in-house writing resources.....',NULL,NULL,'2011-09-09 09:49:32',1),(4981,5131,241,'The links to the data processor stadnard clauses are now fixed so the main point of this insight is resolved.\r\n\r\nThe EFP links to date stamps issue is still open.',NULL,NULL,'2011-09-12 12:48:34',1),(4991,5431,61,'Currently there is no way to priortise saved searches to preference, they are recorded in order that they were created.  This is something we can validate with customers and if popular- look to develop. For the LexisPSL portion of the query - please contact Clare  Duggan for comment.',NULL,NULL,'2011-09-13 08:49:41',1),(5001,5431,1921,'Re-delegated to Clare Duggan as suggested',NULL,NULL,'2011-09-13 10:22:24',1),(5011,5611,2121,'I forgot put that he also wanted the filer by keyword to be applied more than once so that you could continue to narrow the search down.',NULL,NULL,'2011-09-13 12:12:34',1),(5021,5581,2722,'To resolve this problem, it will be necessary to add paragraph numbers which will hyperlink to the referenced clauses. I am arranging for a macro to be written which will insert the para numbers.',NULL,NULL,'2011-09-13 12:17:37',1),(5031,5571,2632,'The topic filter exposes our topic taxonomy, if the user wants to pick sources they should use the source filter. I ran the search for \'material disposal of assets\' in TL and then clicked on Simons Taxes in the source filter and the result was at number 2 in list. I have a full content set so it\'s likely for most people it would be even easier to get to the relevant Simons doc.\r\nIt\'s worth highlighting that we have source, topic, date, keyword, and source type filtering on our results pages and CCH only have source.\r\n',NULL,NULL,'2011-09-13 17:34:42',1),(5041,5611,2632,'Both these items are very high on our priority list for our next release already.\r\nThere is a workaround for the window issue that I can show you Charlie that should hopefully keep him happy until the next release.\r\nI\'ll also see if he would like to be involved in some testing in the future.',NULL,NULL,'2011-09-13 17:45:22',1),(5051,3462,2622,'The Oath is now available within PSL as a Smart Form',NULL,NULL,'2011-09-13 22:14:24',1),(5061,5591,2622,'It is avilable as a SmartForm, but only as a flat precedent.. As it already exists in a smart environment there are no plans to add it as a smart precedent within PSL',NULL,NULL,'2011-09-13 22:23:34',1),(5071,5471,1921,'Redelegated from Lisa Regan to Judith Anderson',NULL,NULL,'2011-09-14 09:26:12',1),(5081,5471,2722,'Yes, this problem has been raised previously and a fix is in process.\r\n\r\nOnce the fix has been implemented it would be very helpful if the commenters could test the result.\r\n\r\nJudy',NULL,NULL,'2011-09-14 09:39:32',1),(5091,5651,1921,'Email sent to Tracey McGovern to advise.',NULL,NULL,'2011-09-14 11:57:51',1),(5101,4012,1921,'Insight for Info only. No follow up required',NULL,NULL,'2011-09-14 15:46:38',1),(5111,4022,1921,'Info only. No action required',NULL,NULL,'2011-09-14 15:48:40',1),(5121,4002,1921,'Insight for Information only. No action required',NULL,NULL,'2011-09-14 15:52:38',1),(5131,4592,811,'It is not clear whether the customer has actually looked at Corporate. Please collate more specific examples of where we are \'not as good\' and then I will respond to them.\r\n\r\nMany thanks \r\n\r\nA-M',NULL,NULL,'2011-09-14 17:35:14',1),(5141,5691,1061,'Hi Jude,\r\n\r\nAt the moment there is a technical limitation which prevents us from making forms searchable. Forms can currently be accessed on the forms tab where all forms in a practice area module can be found in one place. We are currently working on making forms searchable in an upcoming product release although we haven\'t yet got confirmation of when this will be live. In the meantime, best practice training will help point PSL users in the right direction. ',NULL,NULL,'2011-09-15 08:38:08',1),(5151,3692,1921,'Passed to Helen Green who then advised to forward to Judith Anderson. Forwarded to Judith on 13th July who advised she would look into matters.\r\nEmailed Judith today for further information',NULL,NULL,'2011-09-15 12:43:49',1),(5161,5711,1061,'Hi Cara,\r\n\r\nGood news - we are currently in the process of addressing these. \r\n(1) UX are reviewing formatting of documents in PSL and stripping this back to a clean slate so that the formatting is done cleanly moving forward. Due to business priorities in the Nov release, this is lekly to be completed for a release early 2012. \r\n\r\n(2 & 3)  - Work to add dynamic cross-referencing to PSL precedents is currently underway in conjunction with th Content Solutions team. Again, this is likely to be ready for delivery at the end of 2011/start of 2012. \r\n\r\n(4) Can I check whether the requirement for TOC was as a posible way to counter points 2 & 3 or is there a separate requirement? If it\'s the latter, we\'d be keen to understand the need around this. \r\n\r\nThanks\r\nJen',NULL,NULL,'2011-09-15 12:50:05',1),(5171,5321,1921,'Assigned to Tim Wakefield as advised by Anna Lewandowska',NULL,NULL,'2011-09-16 08:52:17',1),(5181,5541,79,'feedback has been passed onto both content and marketing.',NULL,NULL,'2011-09-16 09:12:58',1),(5191,4032,1921,'Corresponded with Russell Green. Russell has advised to close Insight, No further action required',NULL,NULL,'2011-09-16 13:39:56',1),(5201,5741,2632,'Forwarding to Chris Boulter.',NULL,NULL,'2011-09-16 14:28:29',1),(5211,5731,1061,'Hi Ben, \r\n\r\nAt the moment there is a technical limitation which prevents us from making forms searchable. Forms can currently be accessed on the forms tab where all forms in a practice area module can be found in one place. We are currently working on making forms searchable in an upcoming product release although we haven\'t yet got confirmation of when this will be live. In the meantime, best practice training will help point PSL users in the right direction.\r\n',NULL,NULL,'2011-09-16 15:01:52',1),(5221,5771,2632,'Forwarding to Chris Boulter',NULL,NULL,'2011-09-19 08:01:57',1),(5231,4082,65,'I disagree with this response and do not think this issue should have been closed - \r\n\r\nThe search i have highlighted would not be better if the default were changed to \'full text\'.\r\nThe wordwheel should have a better relevance match and the document \'deed of covenant\' should apppear before \'deed of release of covenant\'.\r\n\r\nThe wordwheels are supposed to help users locate documents but this is not intuitive... why would a user expect \'deed of release of covenants\' to appear when they enter the word \'covenant\' but NOT the docuement with the simpler title \'deed of covenant\'??',NULL,NULL,'2011-09-19 14:28:41',1),(5241,5871,591,'Thank you.  no further action required.',NULL,NULL,'2011-09-19 16:57:30',1),(5251,5601,1921,'Email sent to Rob Evans',NULL,NULL,'2011-09-20 10:44:52',1),(5261,2641,1921,'Sophie has advised no further action is required on this Insight',NULL,NULL,'2011-09-20 12:39:03',1),(5271,3522,1921,'Sophie Gould has advised no further action is required on this Insight',NULL,NULL,'2011-09-20 12:42:46',1),(5281,5671,1921,'Email sent to Katy Forrester (as advised by Lisa Regan)',NULL,NULL,'2011-09-20 13:17:21',1),(5291,5681,141,'Thanks to the customer for drawing this to our attention. It should have been on the AppealTracker. Our apologies. We\'re adding it now, and we\'ll track it from now on.',NULL,NULL,'2011-09-20 14:43:27',1),(5301,5891,59,'Hi Jude\r\nThanks for the feedback. Could you please provide more detail abotu the actual terms and content types that the property team were searching for. Also, were they using the title or full text search, did they select suggested searches.etc. All of this information is critrical for us to decipher where the issue lies.\r\nI look forward to hearing from you soon so we can pursue this further.\r\nThanks,\r\nClare.',NULL,NULL,'2011-09-20 16:28:25',1),(5311,5921,1531,'Form N5B is a property form which is a claim form for possession of property.  This form should be available in the property module.  We do not address the specifics of property litigation',NULL,NULL,'2011-09-20 17:44:50',1),(5321,5911,1531,'The information relevant to the EU is found in the cross border module and a customer can chose on their alerts not to receive information on cross border issues if they are not relevant to them.  I will feed this information back to Sraha Healey as she is running a project looking at the alerts we provide to customers',NULL,NULL,'2011-09-20 17:48:49',1),(5331,4312,2572,'On the development road map we have included functionality to print out the question and answer file from MyDocuments. \r\n\r\nThey could do this for a blank questionnaire and then fill in after receiving instructions.\r\n\r\nCurrently planning developments for 2012, no date currently fixed',NULL,NULL,'2011-09-21 08:26:32',1),(5341,4312,52,'I\'ve moved the status to Response4 - On the Roadmap',NULL,NULL,'2011-09-21 11:01:17',1),(5351,5981,2582,'This is Claire Melvin: Do you mean Simons Tax Intelligence or the main Simons work. Simons Tax Intelligence is primarily the text of what has happened not the why or so what. And we are generally getting more feedback that that is what people particularly corporate clients want. I\'ve just put in a request to get budget for more of this sort of content for the current awareness side I\'ve got a pool of journalists who do interview with practitioners - as part of this I did a review about what we have across everything including CA,  journals - and in tax we\'re averaging about 70-72 practitioner features a month..way more than other practice areas but if the problem is print retention of this particular title that won\'t help you. You will need to get unique content for this particular title.',NULL,NULL,'2011-09-21 14:21:35',1),(5361,5801,61,'I\'m pleased to hear this! I\'lll pass on the positive feedback to the developers involved. Thanks',NULL,NULL,'2011-09-22 13:24:11',1),(5371,5861,61,'I agree the bookshelves are clunky and outdated.  It is on the radar for development, we\'re gathering feedback and formulating the customer needs. It did not make the cut for the 2011/2012 development pipeline but we are aware there is an issue/fix needed.',NULL,NULL,'2011-09-22 13:28:37',1),(5381,5851,61,'I don\'t know too much about the LexisSmart form development-  I would contact Timothy Wakefield/Mark Edwards.',NULL,NULL,'2011-09-22 13:31:48',1),(5391,5971,61,'There are no plans to extend the time that documents remain in the document delivery folder.  In the example you cite, I would advise customers to download and save the documents to their PC directly.',NULL,NULL,'2011-09-22 13:36:41',1),(5401,5851,2572,'Tim Wakefield is LexisSmart forms owner',NULL,NULL,'2011-09-23 08:32:27',1),(5411,5961,1541,'Many thanks for the feedback, very useful. I have flagged up the consumer price index with content aquisition with a view to adding that to the LexisLibrary publication, Family Finance in Practice, so that we can then pull it across to the Family PSL toolbox. Re adding a child support calculator, useful feedback again. Calculators are quite costly to build but if there is enough demand we could justify it. I am sounding out a Practice Area Director re this and will look into costs, get some more customer feedback and see if this is feasible. ',NULL,NULL,'2011-09-23 13:51:33',1),(5421,5441,1541,'Form added to LexisPSL Family',NULL,NULL,'2011-09-23 14:11:06',1),(5431,5521,62,'No idea why this has been assigned to me! Sounds like something for the Public Sector Enterprise Solotutions sales team - Stephan Israel can adivse who in his team is best placed to support.',NULL,NULL,'2011-09-23 14:19:11',1),(5441,5951,1541,'We only include cases which establish a new point of law or are of some other significance. At the time of the judgment we including a current awareness piece on Kingdon v Kingdon but it didn\'t establish any new principles of law so wasn\'t added to the practice notes. Re Warner, I can\'t locate a reference to this in any of our major commentaries eg rayden etc, could the customer provide a citation and I will look into it further. ',NULL,NULL,'2011-09-23 14:49:10',1),(5451,5991,201,'We have a team meeting on Wednesday this week to conform contents for the plot sales subtopic.  Will be within this quarter.',NULL,NULL,'2011-09-26 16:20:42',1),(5461,6141,3701,'Hi - the LSC set is being investigated at the moment - we have already contacted the only person at the LSC who knows about this content, but they are unfortunately on holiday. Other LSC folk have taken a look at our current content but they cannot help us beyond a basic assessment. In short, we will have to wait for individuals at the LSC to return from holiday.\r\n',NULL,NULL,'2011-09-26 16:37:29',1),(5471,5781,3701,'SDLT forms are for online submission only  as such we do not offer them and are prohibited from offering off-line versions.\r\n\r\nLPA PA is LPA PFA 2009 (the instrument)  which is most certainly live and available through Smartforms.\r\n',NULL,NULL,'2011-09-26 16:39:40',1),(5481,5641,3701,'Like our competitors, we offer  Court dropdowns, Local Authority dropdowns and Probate Court dropdowns on selected forms. This feature is being expanded to more forms all the time.\r\n\r\nOn the roadmap is the autocompletion of forms and many other fatures - resources remain thin.',NULL,NULL,'2011-09-26 16:46:45',1),(5491,5601,3701,'This feature has been on the roadmap for a few months - several updates and HMRC haggling have created stumbling points. The request is technically feasible and has been implemented in other forms, such as the Lasting Power of Attorney instruments and the Companies House form IN01 - soon to be on AR01 as well.',NULL,NULL,'2011-09-26 16:51:26',1),(5501,4292,231,'Please see attached document.    A further response (from Property) should be forthcoming.  \r\n\r\nOrla Metcalfe','1317139996.doc','Please assign this to the Practice area directors of the PSL product.doc','2011-09-27 16:12:17',1),(5511,6221,1541,'Family PSL trial to be extended to the Hale office family lawyers via Sarah Cullen (Manchester office have recently completed a trial). Feedback is being sought from the Pannone famiy team as a whole. ',NULL,NULL,'2011-09-28 09:58:56',1),(5521,6201,1921,'Email forwarded to Richard Macey.','1317204149.msg','Feedback id  6201 - Insight tracker.msg','2011-09-28 10:01:28',1),(5531,6111,1921,'Email forwarded to compass.','1317205520.msg','Feedback id  6111 - Insight tracker.msg','2011-09-28 10:24:19',1),(5541,6231,61,'Katy Forrester added Section 106 TCPA to our list of terms to be created for LexisNavigator. Usual ETA online approx 3 months.\r\n',NULL,NULL,'2011-09-28 15:38:18',1),(5551,6041,1221,'Further to my meeting with the chairman of SWAT.....PCAS is wholly owned by CCH, and SWAT are contracted to exclusively update the Audit content held therein.   They are also bound by that contract not to author and license any other audit content that would directly compete with PCAS.  Having said that SWAT is able to consult on content, but are unlikely to do anything that would jeopardise their lucrative relationship with CCH.  There is a meeting on the the 24th OCT with SWAT updates will follow accordingly.',NULL,NULL,'2011-09-29 08:14:33',1),(5561,6111,1921,'Reply from compass attached.','1317303177.msg','RE Feedback id  6111 - Insight tracker.msg','2011-09-29 13:31:53',1),(5571,6121,51,'Thanks Charlie have forwarded to Chris Jones and the pricing team to assess and respond\r\nStuart',NULL,NULL,'2011-09-29 14:21:27',1),(5581,6111,51,'Hi Glenn, we\'ve hopefully resolved this as we launched generic usage reporting last month (you hopefully got the email) which tracks usage pro-actively across all accounts on a month by month basis. i\'ll send the report to you and let me know what you think. Cheers\r\nStuart',NULL,NULL,'2011-09-29 14:30:32',1),(5591,6021,61,'Thanks for your feedback.  Historical Versioning was submitted to the EXEC as a 2012 concept.  Currently the EXEC are deciding on which projects get the green light - tbc, but please be aware this is very much on our radar.',NULL,NULL,'2011-09-29 16:02:25',1),(