The issue in that specific subtopic is that each easement reflects its own facts, so we provide only the most generic drafting.    Adding some further examples from EF&P would bulk out the landing pages.  More generally, we have to retain navigability on the landing pages.  We do that by presenting only the most mainstream/daily toolkit items.  Using the search facility (altering from title to full text search) picks up a collection of precedents that in numerical terms outstrips PLC',NULL,NULL,'2011-10-04 14:49:44',1),(5691,6341,1921,'Email sent to Malcolm Skinner as automated notification email was not received upon delegation',NULL,NULL,'2011-10-04 16:09:13',1),(5701,6421,59,'Hi Sarah\r\n\r\nThanks for the feedback. It\'s quite an interesting suggestion given that if you had an alphabetical list of cases or one filtered by date, they\'d both take a while to peruse if you didn\'t know what the case name was. We will continue to monitor this feedback going forward to see if this is a common user need.\r\n\r\nMany thanks,\r\nClare.',NULL,NULL,'2011-10-04 17:20:14',1),(5711,6391,1531,'Hi,  we have added 28 new precedents in 2011.  These have been in response to requests from customers.  I am happy to look at what Raworths would like to see in the product.  We certainly have some budget to look at getting some precedents added in. If Matthew is happy for some from the DR team to speak to him then we are happy to make the call.  Perhaps you could agree this with him and provide Janna Purdie and Ruth Pratt with his details and one of us will call him over the next week.',NULL,NULL,'2011-10-04 17:28:31',1),(5721,6251,59,'Hi Jude\r\nThanks for the feedback. Could you please provide me with some examples of what the users here were struggling to locate when using the normal PSL search or browse facilities? We\'ve certainly had users exoress interest in searching across more than one of their practice areas but we\'ve not had feedback on users needing to search across such a small subset of content. Did they retrieve too many results from the Quick Search? I\'d be really interested to hear a little more around their frustrations in this instance.\r\n\r\nI look forward to hearing from you.\r\n\r\nKind regards,\r\n\r\nClare.',NULL,NULL,'2011-10-04 17:32:07',1),(5731,6341,2622,'We will be providing this and have identified some 20 offshore jurisdictions to include. Practice Notes will be externally sourced from jurisdictional experts and they are curently being instructed.',NULL,NULL,'2011-10-05 09:42:53',1),(5741,6351,2622,'We are currently writing a whole new tax topc for PC PSL that will include the requested elements. Content will be available towards the end of this qurter and into Q1 2012. Watch this space! Or rather keep an eye on PSL!',NULL,NULL,'2011-10-05 09:51:08',1),(5751,6451,2892,'I will speak to the author about this and ask for his feedback. Update will be posted as soon as this is received. ',NULL,NULL,'2011-10-05 09:56:12',1),(5761,6251,59,'comment added',NULL,NULL,'2011-10-05 10:03:01',1),(5771,6461,2632,'Thanks for the feedback - we are working on this as a priority.',NULL,NULL,'2011-10-05 10:09:02',1),(5781,6441,471,'Robert Walker, EF&P: Thanks for the feedback. To make it easier to find statutory declarations by browsing, we are adding a Statutory Declarations heading to the Property section of key document finder which should prove a useful tool to locating statutory declarations spread across the property titles. We will also look to see whether amendments are possible to Form Finder and the Consolidated Index to make it easier to locate statutory declarations there.\r\n \r\nThe statutory declaration referred to has been included in three separate titles as it is appropriate to the content of each of them. It is correctly labelled \'Statutory declaration/certificate/statement of truth as to non-revocation for powers more than 12 months\' old ....\' as it is a prescribed form under the Land Registration Rules and this is its name. The form contains prescribed options for use as a declaration, certificate or statement of truth. There are of course more straightforward statutory declarations in EF&P  beginning with the words statutory declaration and then continuing with the subject matter.\r\n \r\nAny further queries on this then do drop me an email.\r\n',NULL,NULL,'2011-10-05 12:44:47',1),(5791,6381,371,'Sorry forgot to say that we are only targeting out of court settlements for clincial negligence and unusual injury quantum cases. We have already had some clincial neg cases in and are trying to develop links with the larger clincial neg firms to get them to submit their quantum cases to us. Thanks Karen',NULL,NULL,'2011-10-05 13:17:59',1),(5801,6481,1921,'Email sent to Martin Stevens as Clare Duggan has advised this is a Fabrication team issue.',NULL,NULL,'2011-10-05 16:25:47',1),(5811,5431,59,'Hi Sue\r\n\r\nYou can assume that Smart precedents are drafted by our internal or commissioned lawyers.\r\n\r\nThanks,\r\nClare.',NULL,NULL,'2011-10-05 16:38:29',1),(5821,5151,59,'Hi \r\n\r\nThe Online Coordination team are looking at whether it is possible to add this to the synonyms list. It will all depend on  the use of step in other contexts as it would have to be used across the whole of PSL.\r\n\r\nThanks,\r\nClare.',NULL,NULL,'2011-10-05 16:41:27',1),(5831,6471,1541,'Very useful feedback thank you, we are looking into the potential cost of a child support calculator and will let you know if that is feasible in due course. ',NULL,NULL,'2011-10-05 19:50:54',1),(5841,6501,2632,'1. We are working on this but it has been a relatively low priority so far because no other customers have raised this as an issue yet to my knowledge. \r\n2. We have received this feedback from a number of other customers. It\'s a high priority development for early next year.\r\n4. This has already  been fixed - I will call you Charlie to expain what the customer needs to do.\r\n\r\n5. Again, I am looking for a solution to this problem. The reason that the boxes were removed was that they were making the TOC too complex for most users. We need to include this option without making the TOC too difficult to use.',NULL,NULL,'2011-10-06 08:34:05',1),(5851,5651,1921,'Update received from Tracey McGovern (email 26.09.11) advising that this matter should now be resolved',NULL,NULL,'2011-10-06 09:25:04',1),(5861,5671,1921,'Email response received from Katy Forrester stating:\r\n\"The dropdown suggestions are are generated using the form titles and so they are available only on the precedent titles field of the search form. The examples below are marked up as form numbers rather than titles, so that is the reason they are not currently included as suggestions for the title field. \r\n \r\nCurrently the most effective way to locate these forms would be to search using the \'form number\' field on the precedents search form. However, I will pass on this feedback to the product development team.\"',NULL,NULL,'2011-10-06 09:30:16',1),(5871,5221,1921,'Update received from Peter Maidens (29.09.11). Probelm has now been fixed',NULL,NULL,'2011-10-06 09:48:42',1),(5881,6531,2812,'Thank you for this feedback.\r\n\r\nThe email alerts were updated in the last release to change the labelling to Tolley Guidance. This change will need to be rolled out for all email options I will add this to our worklist to be included in the next Tolley Guidance release. Thanks.',NULL,NULL,'2011-10-07 11:17:06',1),(5891,6241,1531,'The DR team added the court fees to the tool box on Friday 7 October\r\n\r\n',NULL,NULL,'2011-10-07 20:44:10',1),(5901,6561,201,'HIPS were suspended in May 2010, pending legislation to abolish the requirement for them.\r\n\r\nThat legislation is in clause 170 of the Localism Bill.  the Localism Bill has yet to receive royal assent.  Consequently, the requirement for HIPs is currently suspended rather than finally removed.\r\n\r\nThe content relating to HIPS includes a warning note to that effect.\r\n\r\nThe content will be removed when the legislation to abolish the requirement has recieved royal assent and is in force.',NULL,NULL,'2011-10-10 12:18:34',1),(5911,6481,1921,'Update given by John Hanratty - please see attached',NULL,NULL,'2011-10-10 16:03:07',1),(5921,6571,2632,'Useful feedback, thanks. I think the customer is describing CCH\'s browse by index system. A lot of less IT literate users like this as a way of getting to content qucikly - we are considering it as an enhacncement for next year.',NULL,NULL,'2011-10-11 08:23:23',1),(5931,6601,2892,'Ths type of content is available in Whillans\'s Worldwide Taxes (available in print and online). Details about tax rates and allowances is provided for 100 countries. If you need more detail on the specific content included please contact Laura Priest in the Content Development team. Thanks. Lindsay Gale',NULL,NULL,'2011-10-11 09:47:30',1),(5941,6591,2812,'This is really useful feedback. I have been in touch with the customer to thank him for taking the time to send us feedback. These development ideas have been added to our roadmap and will be reviewed when considering future development work. We would also like to arrange a follow up meeting with the customer after 31st Jan 2012 to discuss these ideas in more depth,',NULL,NULL,'2011-10-11 10:51:57',1),(5951,6201,1921,'Further email sent to Richard Macey',NULL,NULL,'2011-10-11 12:51:32',1),(5961,6481,1921,'Apologies - Email correspondence is now attached','1318343038.msg','Insight Tracker Insight reference 6481.msg','2011-10-11 14:25:53',1),(5971,6561,201,'To emphasise that retention of the content pending abolition is intentional, I\'ve amended the warning note at the head of each document to confirm that it will be removed once the Localism Bill has received royal assent.',NULL,NULL,'2011-10-12 08:20:37',1),(5981,6671,2862,'This is currently possible.  If you go to the templates tab of the search bar and enter the type of content you are looking for eg flowchart in the keyword section the results should be all the flowcharts in the module.  The same for letters, checklists and proformas.',NULL,NULL,'2011-10-12 10:31:37',1),(5991,6671,2812,'Just to add to this - all elements are displayed via the content tabs. it would not be practical to display all items for each element (ie) all videos, templates as this would run into hundreds. As soon as the customer has entered a search term all content related to the search term will be displayed in the results list.',NULL,NULL,'2011-10-12 10:41:40',1),(6001,6661,2632,'I\'m sorry but I need a lot more detail here before I can comment properly:\r\n- Where is the white space?\r\n- What would the customer want to see it filled with?',NULL,NULL,'2011-10-12 10:55:19',1),(6011,6741,201,'Overage information, including drafting, is in LexisPSL Property > Transferring property > contracts, and also in > options and pre-emption rights, and in > transfers and assignments.  It is also in > Property Development > site acquisition.\r\n\r\nTo find it, use the search term \'overage\' either in a title search or a full text search.',NULL,NULL,'2011-10-12 13:11:58',1),(6021,6721,2632,'Forwarding this to Mike Truman - it sounds like it might be a subcription issue though.',NULL,NULL,'2011-10-12 16:08:40',1),(6031,6201,1921,'Richard Macey has advised that feedback has been passed to Lawyer Locator Functionality team',NULL,NULL,'2011-10-13 09:22:17',1),(6041,4222,1921,'Email sent to Jon Scriven (15.09 and 13.10). Jon is currnetly out of office. Will await response',NULL,NULL,'2011-10-13 12:23:34',1),(6051,4792,1921,'Jonathan Aspinall has advised \"\r\nI hope to give a preliminary response in the next few days. More long term, as previously advised,  we are getting the costs practice notes updated so will be able to be able to give a more definitive response (backed up by Counsel i.e. 12 Kings Bench Walk) before the end of the year.\"',NULL,NULL,'2011-10-13 13:32:09',1),(6061,4922