 number of customers.',NULL,NULL,'2011-10-14 14:23:14',1),(6181,3952,2632,'This was fixed as of the last TL release.',NULL,NULL,'2011-10-14 14:24:14',1),(6191,4062,2632,'There are no plans in the near future to add a function for selection from the TOC. We need to keep the design of the TOC as straightforward as possible so that it\'s primary function (browsing) is intuitive.\r\nTL contains the same links as LL. It might be that the user was comparing different sources - Yellow and Orange in TL Vs UK Parliments Acts in LL?',NULL,NULL,'2011-10-14 14:27:32',1),(6201,5261,2632,'Neither of these can be achieved yet but we will see how many other customers raise these points.',NULL,NULL,'2011-10-14 14:28:56',1),(6211,4432,1921,'Rob Evans has advised that this issue has now been resolved',NULL,NULL,'2011-10-14 15:20:41',1),(6221,2921,201,'Development topic added and planning content significantly expanded.',NULL,NULL,'2011-10-14 16:46:07',1),(6231,6551,61,'Thanks for your feedback Gavin.  This idea has been mooted previously but unfortunately did not make the cut for 2012 development,  It would be a useful feature for new lexis and we\'ll bear it in mind. Meanwhile, please direct users to the eburst archive for all news of content updates - not just books.  It can be found at http://www.lexislegalintelligence.co.uk/intelligence/e-burst.  Thanks',NULL,NULL,'2011-10-17 10:03:42',1),(6241,4362,1921,'Redelegated to Clare McMahon. Also emailed her directly in relation to this.',NULL,NULL,'2011-10-17 11:08:45',1),(6251,4362,1921,'Clare has advised this issue has been dealt with.',NULL,NULL,'2011-10-17 11:15:38',1),(6261,5081,2121,'sorry I dont have that information.',NULL,NULL,'2011-10-17 11:29:47',1),(6271,4362,3412,'looked into the possibility of a healthcare employment title but it was not financially viable ',NULL,NULL,'2011-10-17 12:21:11',1),(6281,6631,61,'Thanks for your feedback. Current historical versioning requests are only available only in business hours.',NULL,NULL,'2011-10-17 14:14:16',1),(6291,6811,2572,'1. Document preview (due in 2012) will highlight in document what changes when questions are answered. there is also an audit trail showing which questions haven\'t been answered. These highlights will not be in the final draft as lawyers do not like too much reformatting.\r\n2. Changes to document templates are shown in MyDocuments, there is an \'updated\' showing in the last field. I have a screen shot but the system won\'t let me upload it.',NULL,NULL,'2011-10-17 15:19:14',1),(6301,5561,61,'I think ihis is a query for web development/Tom Pearsall.  Thanks',NULL,NULL,'2011-10-17 15:56:44',1),(6311,5621,61,'Please direct this query to Tom MacDonald',NULL,NULL,'2011-10-17 15:58:30',1),(6321,5661,61,'We are launching the redesigned results project in the December 2011 release and this should make it easier to identify which jurisdictions SIs belong to.  Thanks for your feedback.',NULL,NULL,'2011-10-17 16:01:29',1),(6331,6511,61,'We\'re launching the redesigned results project in December 2011 and this will impact the use of the left hand facets in the new Ui.  They should be more helpful to users as more facets will be avail to users and they can drill down more easily using the facets to eliminate whats not needed',NULL,NULL,'2011-10-17 16:05:13',1),(6341,6311,61,'With regards to the look/ease of use of LexisLibrary - we are making some big changes to the User interface in the coming year starting with the launch of the redesigned results project in Dec\' 2011 so hopefully this will improve his user experience.\r\nClare Duggan should be able to answer if these codes of practice will be included in the new LExisPSL modules. \r\nPlease contact Alan Blanchard who can investigate why the codes are not included in Stones (with theassociated editor) or could perhaps investigate linking to them.  Thanks',NULL,NULL,'2011-10-17 16:14:47',1),(6351,6831,2862,'Thanks very much for this feedback.  I\'m glad to know that the customer found these notes useful, even though the PT module was not for them.  In terms of including the notes within CT, I will raise this at the team content meeting.  \r\nI think that, in future, there will be more detail on termination payments from the employer\'s perspective in the Employment Taxes module (currently scheduled for release in 2012).',NULL,NULL,'2011-10-18 07:33:45',1),(6361,6831,801,'response form the SME has now been added- follow the link to access the record, thank you',NULL,NULL,'2011-10-18 08:40:26',1),(6371,6841,2632,'The links are being added with the next release.',NULL,NULL,'2011-10-18 08:48:09',1),(6381,6831,2862,'In terms of templates in relation to this topic, I don\'t think the existing modules are the right place for them.  We will consider them in connection with the Employment Taxes module.',NULL,NULL,'2011-10-18 09:34:04',1),(6391,6851,801,'test response',NULL,NULL,'2011-10-18 11:18:31',1),(6401,6891,1921,'Re-delegated to Cara Annett as Andrew Sharpe is currently out of office',NULL,NULL,'2011-10-19 08:44:13',1),(6411,4552,801,'test comment ',NULL,NULL,'2011-10-19 09:29:01',1),(6421,4832,801,'test comment from SME',NULL,NULL,'2011-10-19 09:32:38',1),(6431,4832,61,'test with other SME\'s credentials',NULL,NULL,'2011-10-19 09:35:28',1),(6441,4832,2862,'test with  another SME credentials in Mozilla (AL)',NULL,NULL,'2011-10-19 09:36:59',1),(6451,4552,3542,'test reply - by Natasha signed in as a SME - using FF',NULL,NULL,'2011-10-19 09:46:35',1),(6461,4832,3542,'test reply - by Natasha as an SME - using FF will also change the feedback type field to product before submitting.',NULL,NULL,'2011-10-19 09:48:02',1),(6471,4552,3532,'test reply - by Natasha as a moderator - using IE, will change the market segment dropdown',NULL,NULL,'2011-10-19 09:49:30',1),(6481,6431,1921,'Lisa Regan has advised this should be \r\nre-delegated to Cara Annett. ',NULL,NULL,'2011-10-19 09:56:40',1),(6491,4832,3542,'test reply - by Natasha - signed in as a SME using Chrome - I changed the feedback type to competitor',NULL,NULL,'2011-10-19 09:57:04',1),(6501,4832,15,'test from MJ',NULL,NULL,'2011-10-19 09:57:33',1),(6511,6251,1921,'Email sent to Jude Hartley requesting further information be provided, as requested',NULL,NULL,'2011-10-19 10:07:16',1),(6521,4832,3532,'natasha test',NULL,NULL,'2011-10-19 10:10:00',1),(6531,6251,2371,'Hi Clare,\r\nI don\'t think it was that they couldn\'t find what they were looking for searching in other places - they said that using PLC they would click into SDLT and then search within that topic area and that is how they like to use PLC. It is probably just a searching preference and they will need to learn to do searching differently on PSL.\r\nKind regards,\r\nJude',NULL,NULL,'2011-10-19 10:15:30',1),(6541,4832,801,'test',NULL,NULL,'2011-10-19 13:52:25',1),(6551,6861,591,'Will contact marketing to see if link can be added.',NULL,NULL,'2011-10-19 13:53:38',1),(6561,6871,371,'There are some enhancements coming to the search function in Nov \'11 and more significant changes in response to customer feedback Q1 2012. \r\nInteresting point on the out of court settlements. We do accept these for clinical neg and unusual injury claims. If we don\'t recieve significant numbers of new quantum cases via our online submission site and marketing campaign then we will consider opening up quantum submissions on all PI out of court settlements. We are going to review this issue in 6 months.\r\nWe are currently working hard to improve the quantum database and I hope customers will see general improvement in this area over the coming months.\r\n\r\nMany thanks for your feedback\r\nKaren O\'Sullivan - PSL personal injury',NULL,NULL,'2011-10-19 14:49:25',1),(6571,6881,371,'Thats good to hear David.\r\nI am working with the development team to bring a second suite of calculators to the product by the end of the year. They will focus on future pension and earnings loss and fatal accident claim calculations. They should  save our customers lots of time by working out their Ogden table calculations for them.\r\nIf you need any further information on the second suite of calculators just email me. It is currently undecided whether there will be any additional charge to PSL customers to access the additional calculators.\r\nThanks\r\nKaren',NULL,NULL,'2011-10-19 15:02:40',1),(6581,5621,1921,'Email sent to Tom MacDonald',NULL,NULL,'2011-10-20 08:23:09',1),(6591,5551,1921,'Email sent to Caryn mCEwen/ Claudia Welsh',NULL,NULL,'2011-10-20 08:49:49',1),(6601,5561,1921,'Email sent to Tom Pearsall requesting feedback',NULL,NULL,'2011-10-20 09:10:45',1),(6611,5551,3691,'Down to marketing and account management to figure out best way to prove this - not a content or product issue. ',NULL,NULL,'2011-10-20 09:11:15',1),(6621,5621,1921,'Update received from Tom MacDonald (see attachment). \r\nMedical Law Review will be available for the PI bookshelf  this will be effective on Monday (24.10.11)\r\n','1319110888.msg','Insight 5621.msg','2011-10-20 11:42:55',1),(6631,6891,241,'Please thank customer for feedback and advise as per issue description. Thanks',NULL,NULL,'2011-10-20 12:28:08',1),(6641,5751,2762,'We have responded to the customer about this and some other glitches he came across.\r\nThe reason for the delay mentioned above was that the editor was working alone on that specific date and there were several cases that came in.\r\nAs it can happen often that the court delivers numerous cases on a single day, we have taken steps to ensure that there is extra support during these busy periods in the future so all cases appear on the product as soon as possible.\r\n\r\n',NULL,NULL,'2011-10-20 14:26:45',1),(6651,6831,2862,'There is currently no obvious place to insert this content within the Corporate Tax (CT) module.  It has been decided to wait until the Employment Taxes module has launched and then have a dedicated topic in CT which will have overviews of employment taxes issues (including termination payments) with links to the Employment Taxes module for more in-depth commentary.  Thanks for the feedback as it will eventually lead to this content being included in the CT module but unfortunately it can\'t be done immediately.',NULL,NULL,'2011-10-21 10:39:44',1),(6661,6831,801,'test comment',NULL,NULL,'2011-10-21 11:05:19',1),(6671,6031,2632,'Thanks - very interesting. I\'ve forwarded this to Chris Boulter for commercial consideration.',NULL,NULL,'2011-10-21 12:44:33',1),(6681,5561,1921,'Response received from Tom:\r\nHi Kate,\r\nCould you provide a bit more information about this please?\r\nIt sounds like Marketing would need to provide an approved logo or brand ident for LexisLibrary and Nexis, as well as appropriate marketing information about the products. Does that sound right to you?',NULL,NULL,'2011-10-21 13:08:18',1),(6691,6091,1921,'Issue ties in with Insight 5561. Tom Pearsall is assisting and has asked for further information',NULL,NULL,'2011-10-21 13:11:56',1),(6701,3902,1921,'Re-delegated as advised by Dan Arrowsmith (14.10.11)',NULL,NULL,'2011-10-21 13:50:00',1),(6711,6251,59,'Thanks for the clarification Jude. That is really interesting. It sounds like they start by browsing, get to the general area they are interested in and then want to search to drill down. We are looking at a redesign next year which will also consider search workflows so thatnks for sharing this added detail with me.\r\nKind regards,\r\nClare.',NULL,NULL,'2011-10-21 14:03:49',1),(6721,6311,1921,'Forwarding to Clare Duggan regarding PSL query',NULL,NULL,'2011-10-21 14:04:01',1),(6731,6311,1921,'Email sent to Morag Rea in regards to PSL query',NULL,NULL,'2011-10-21 15:25:25',1),(6741,6991,2872,'All new cases and updated VAT information should be automatically fed into the \'News and Analysis\' section on TG.  Recommend that the client always checks the news tab to see whether any updated cases are included in this section',NULL,NULL,'2011-10-24 13:54:23',1),(6751,7001,2892,'Thank-you for this feedback which I will pass onto the author. However, chapters of the Tax Annuals are structured by topic rather than chronologically which enables most customers to find what they are looking for quickly. Also in 2010 as part of relaunch we introduced a contents list at the beginning of each chapter to assist with navigation of individuals chapters. If the customer is willing to be contacted directly about this feedback can you please pass their contact details onto me? Kind regards, Lindsay Gale',NULL,NULL,'2011-10-24 14:03:27',1),(6761,6981,821,'Anne-Marie Claydon is responding to the customer directly.\r\n\r\nThe tax deed was originally on the PSL Corporate road map for the summer.  This has been delayed due to unavoidable conflicting priorities.  We will respond to the customer urgently and get this document into PSL Corporate by the end of this week.\r\n\r\nWe will update the customer and Jen when this has been done.\r\n\r\nEleanor',NULL,NULL,'2011-10-24 15:04:03',1),(6771,6961,1921,'Update from Karen Watton\r\n\"For internal consumption only at this point - \r\nThe question of whether we cover insurance law and wider insurance practice has come up a couple of times from inhouse. On the pure insurance law side, it is something that could, in due course, be covered in the Financial Services module but its a big area of law in its own right and it is not on the current roadmap for development. (Would the potential market size justify extra specific resource being focused on this?  dont have enough info at the moment. )\r\n\r\nTheres a broader question of whether we organize information along sector-specific lines in the way that larger law firms promote themselves. It would be great to have the flexibility to slice and dice content easily so it could be organized along both legal disciplinary lines for private practitioners and to match the needs of inhouse lawyers, though I assume this would be a challenge technically\"',NULL,NULL,'2011-10-25 09:36:56',1),(6781,5951,2371,'Sorry I don\'t have anymore specific info on the Warner case from them. \r\nJude',NULL,NULL,'2011-10-25 11:09:41',1),(6791,5891,2371,'Hi Clare,\r\nSorry I\'m unable to get further information about this. I think it might have been an issue from before the recent work was put in about search functionality because I\'ve noticed the searching works much better now. If I come accross specific examples i\'ll let you know.\r\nKind regards,\r\nJude',NULL,NULL,'2011-10-25 11:24:17',1),(6801,7021,2632,'Very simple resolution to this one. You can let the customer know that if the put speech marks around a phrase - so \"capital gains tax\" for example it will search for an exact phrase and usually produce less results. This is what users should do if they are looking for something specific and know how we phrase it in our content. Please let me know if you need any more info - I\'m happy to speak to the customer if they still have issues.',NULL,NULL,'2011-10-25 11:27:13',1),(6811,5561,1921,'Logos have now been supplied which the customer can use. Please refer to the attached correspondence.','1319542397.msg','Insight 5561 1.msg','2011-10-25 11:34:28',1),(6821,7051,811,'This is a response for the Commercial team rather than Corporate. Please delegate to Andrew Sharpe. ',NULL,NULL,'2011-10-25 11:52:19',1),(6831,7071,141,'I\'ve discussed this with Gavin and we\'ll deal with this query together from now on.',NULL,NULL,'2011-10-25 13:11:06',1),(6841,7121,141,'This query should be referred to James Wilson (All England Reporter). If it also relates to Current Awareness alerts, the query should also be referred to Claire Melvin.',NULL,NULL,'2011-10-25 13:16:13',1),(6851,7081,141,'This seems to be a taxonomy question and therefore should be referred to Richard Allison.',NULL,NULL,'2011-10-25 13:17:14',1),(6861,6961,1921,'Comment from Mark Smith:\r\n\"Just to add to karens comments - as part of the in-house business plan we will be exploring sector specific flavours of LexisPSL next year. At the moment we havent begun our research into the best sectors to focus on. \"',NULL,NULL,'2011-10-25 13:44:26',1),(6871,7051,3831,'We are aware that we need to improve Commercial - a lot of work has been done and it ongoing. Suggest flag this as ON ROADMAP.',NULL,NULL,'2011-10-25 14:03:49',1),(6881,7081,1921,'Email sent to Richard Allison giving details of Insight. Awaiting response',NULL,NULL,'2011-10-25 14:31:07',1),(6891,6981,1061,'Corporate Team has contacted customer regarding the complaint and advised on timing for when the precedent will appear on LexisPSL. This matter can be closed. Thanks!',NULL,NULL,'2011-10-25 16:55:17',1),(6901,4892,3522,'Not sure what the customer means by comment. The case was digested by the Reporter team. If they mean expert commentary eg PSL/Current Awareness story then that is outwith my department.\r\nJames. ',NULL,NULL,'2011-10-26 11:45:39',1),(6911,7151,3711,'Hi Philip,\r\n\r\nThankfully, I can answer it as I used to work for Halsburys Laws.\r\n\r\nDo you know if the customer accessed the relevant HLs paragraph via LexisLibrary?\r\n\r\nIts a bit strange because we do have those cases, and they are hyperlinked. Here are the links to the CaseSearch documents which can be passed on to the customer. So long as they have the relevant case sources within their subscription  they should be able to see them.\r\n\r\nTredegar (Viscount) v Harwood [1929] AC 72, 97 LJ Ch 392 \r\nBates v Donaldson [1896] 2 QB 241, 60 JP 596 \r\n\r\nThe reason why we cite old cases is because they are still valid law, and ultimately the authority of the statement made within the text of Halsburys Laws. These are the cases which the court would expect them to cite, not merely a subsequent case which mentions them as previous authority (which may well never be reported).\r\n\r\nThanks and best regards,\r\n\r\nDan\r\n',NULL,NULL,'2011-10-26 12:18:08',1),(6921,7251,1921,'Re-directed to Katy Forrester as advised by Lisa Regan',NULL,NULL,'2011-10-27 08:40:28',1),(6931,7081,1921,'Update received from Richard Allison stating:\r\n\"Thank you   I have arranged for Donoghue v Stevenson to be tagged with the topic Training Standards and this should be live in product within the next day or so.\r\nThere is more detailed feedback if anyone is interested  let me know!\r\nThanks,\r\nRichard\"',NULL,NULL,'2011-10-27 08:48:58',1),(6941,7141,1501,'Thanks James\r\n\r\nThere is a trial ID available for KYC ID on the Weekly Legal Library Trial Codes email that is sent out daily by Business Support.',NULL,NULL,'2011-10-27 09:09:13',1),(6951,7261,2622,'Couldn\'t agree more. This will be taken on board and activated asap.',NULL,NULL,'2011-10-27 09:36:09',1),(6961,7161,2622,'There cannot be a one size fits all approach as much will depend on what is being done. The general situation is addressed at length (including a description of some tests that are used) in Private client/Elderly client/Capacity/Assessments and tests\r\n\r\n',NULL,NULL,'2011-10-27 09:50:49',1),(6971,7211,3711,'Thanks for the feedback.\r\n\r\nDo you know why the customer felt we were better for cases? Would the customer be happy for us to contact them regarding this?\r\n\r\nThe real value is in understanding what the customer needs, and if we\'re delivering it already, we need to know what that added value is so we ensure we continue delivering it.\r\n\r\nThanks,\r\n\r\nDaniel Wright',NULL,NULL,'2011-10-27 10:00:21',1),(6981,7241,2902,'Could you find out what other material the client would like. We do cover auditing material fairly in depth on TL and LL. It would be interesting to know what other material they are interested in. ',NULL,NULL,'2011-10-27 10:20:14',1),(6991,3902,421,'Hi Russ - Many thanks for this - we have heard that this is their tactic and this backs it up. Smacks of desparation to me.',NULL,NULL,'2011-10-27 11:46:22',1),(7001,7221,2632,'Forwarding to Irene to see if she has any thoughts on this.',NULL,NULL,'2011-10-27 12:42:05',1),(7011,6931,2632,'We are seriously considering this as a development for next year. This need is consistent with what a number of customers have told us in the past.',NULL,NULL,'2011-10-27 12:45:45',1),(7021,7221,2892,'We did publish a Tax Investigations books which was written by Will Heard. However, it did not sell well and therefore we did not publish a new edition. However, each of the TolleyGuidance  modules contains several notes dealing with tax investigations. The topic is also covered in depth in Simons. Thanks, Lindsay',NULL,NULL,'2011-10-27 12:46:02',1),(7031,7221,2632,'Nothing else to add, please see response from Lindsay above.',NULL,NULL,'2011-10-27 12:49:57',1),(7041,7231,2862,'In terms of existing content, there is a sub-topic on doctors and dentists within the special businesses topic of the OMB module of TolleyGuidance.  There are six guidance notes, two examples and a template proforma.  There is also a sub-topic on healthcare within the specific industries topic of the VAT module.  There are four guidance notes (one on doctors and dentists, two on opticians and one on pharmacists) and two examples. ',NULL,NULL,'2011-10-27 13:10:31',1),(7051,6311,1921,'Response received from Morag Rea advising where the codes could be found both internally and externally. See doc attached','1319721711.msg','Codes Of Practice.msg','2011-10-27 13:22:55',1),(7061,6971,421,'Simon - thanks for this. Software user groups are quite common - e.g. Sage run them also - and have more potential discussion topics than say for an online platform. I like the idea, but I\'m not sure that we could get these type of numbers - our current product advisory boards are of much smaller scale - without incurring considerable costs. Having said that, it is something to consider and I\'ll raise it at the next Tax Strategy Group.',NULL,NULL,'2011-10-27 13:31:12',1),(7071,7031,421,'Thanks John. We do produce an \'eburst\' email to clients - but this has in the past focused on technical platform updates. This is in the process of being revamped and should be expanded to cover content. Was this client using TolleyLibrary, by the way?',NULL,NULL,'2011-10-27 13:45:16',1),(7081,7061,371,'Hi Sophie\r\nOur marketing campaign for the online submission is launching on Monday - so watch this space! We are hoping to have lots of nice recent quantum cases for our customer shortly.\r\n\r\nmany thanks for the feedback\r\n\r\nKaren',NULL,NULL,'2011-10-27 14:17:43',1),(7091,7131,421,'Hi John - we\'re looking at all this Practice Management / Marketing stuff at the moment. It\'s worth noting that we\'ve already got some of it via our Personalised Client Publications and CPD - it\'s the case of building up our offering around this and packaging accordingly.',NULL,NULL,'2011-10-27 14:24:14',1),(7101,7241,421,'Hi John; Assuming that the client means audit manuals, etc:\r\n1. It\'s worth noting that these are often integrated systems - checklists, filing systems etc - that go beyond simple content.\r\n2. As such, these systems are typically a lot stickier with clients than traditional content.\r\nHowever, we are looking at audit content and TolleyGuidance as we speak - we have an ongoing research project in this area.',NULL,NULL,'2011-10-27 14:31:35',1),(7111,6431,241,'http://www.lexisnexis.org.uk/ebooks/ebooks/ lists all our eBooks - Anthony and Berryman\'s was published in ebook format this May. Blackstone\'s is not published by LexisNexis so we can\'t help with that one.\r\nRedelegating to Vicky Taylor who can answer more comprehensively re Stone\'s.\r\n\r\nKind regards\r\n\r\nCara',NULL,NULL,'2011-10-27 15:12:37',1),(7121,7191,471,'EFP: We are very sorry for the inconvenience the subscriber has experienced with trying to access EF&P commentary. Our technical team is aware that the commentary is not searchable at this time using either the Commentary search tab or the \'Explore\' search box. They\'ve said that it may take quite a bit of time to resolve this, so we cannot give the subscriber an exact date by which to expect these functions to work. In the meantime however, the Commentary can be searched using the Forms and Precedents tab. Please let us know whether there is anything more that we can do to assist.\r\n\r\n',NULL,NULL,'2011-10-27 15:13:37',1),(7131,5931,61,'nnn',NULL,NULL,'2011-10-27 16:06:39',1),(7141,6431,1561,'We\'ve not yet converted Stones into eBook format as the data in this title is fairly complex meaning that there are challenges in ensuring the text renders well in electronic format. I\'d be delighted to discuss Stones (pros and cons of an eBook) in more detail with the customer if this is of interest so please feel free to pass across my email address: victoria.taylor@lexisnexis.co.uk\r\nRegards\r\nVicky ',NULL,NULL,'2011-10-28 09:03:17',1),(7151,7311,3831,'This is not the first comment on Consumer Credit area of LexisPSL Commercial - we know it needs review and it\'s in the programme.',NULL,NULL,'2011-10-28 14:30:15',1),(7161,7291,3831,'Part of the review of all LexisPSL Commercial content. Will seek assistance from LexisPSL IT&IP to speed up response.',NULL,NULL,'2011-10-28 14:32:29',1),(7171,7281,3831,'Need to examine whether this is a LexisPSL Commercial or Finance issue. Either way, it will be added to relevant Roadmap and resolved.',NULL,NULL,'2011-10-28 14:34:22',1),(7181,5051,151,'We\'re going to continue to deal with these types of query through the metadata. We have jsut updated to handle this exeception.',NULL,NULL,'2011-10-31 11:02:48',1),(7191,7321,2632,'Thanks Mary - there\'s a lot of different points here. I\'m going to respond to your separate e-mail with detailed answers. ',NULL,NULL,'2011-10-31 11:18:03',1),(7201,7331,2632,'I\'m a bit confused on this one - we don\'t have a legislation search page in TL? Does the customer mean the Legi search form? The TOC point will be considered when looking at the possible TOC enhancements for next year.',NULL,NULL,'2011-10-31 11:21:21',1),(7211,7351,2632,'The editors are working on the problem with the TOC naming as a priority. Other TOC improvements are being considered for next year.',NULL,NULL,'2011-10-31 11:26:37',1),(7221,7361,2632,'There are lots of separate issues here. On the point around selection for printing and searching. We are looking at this - we need to do it in a way that does not negatively impact browsing for the majority of users. On the point around multiple keyword filters - this is being added with the next TL release. Regarding a Boolean search and 250+ results, there are no plans for this, we will re-consider if enough customers ask for it. This feedback has been rare so far.',NULL,NULL,'2011-10-31 11:32:17',1),(7231,7381,2632,'We are looking at enhancements in this area for next year.',NULL,NULL,'2011-10-31 11:33:59',1),(7241,7381,2892,'Thanks Dan. We have received feedback from several customers that this would be useful so it would be great if we could put them up next year. ',NULL,NULL,'2011-10-31 11:36:29',1),(7251,7471,2632,'Interesting idea - we will continue to monitor feedback on this.',NULL,NULL,'2011-10-31 11:36:42',1),(7261,7501,2632,'There are limitations to our current content structure that make fixing this difficult. We need to gather more insight in this area.',NULL,NULL,'2011-10-31 11:39:31',1),(7271,7511,2632,'Performance - if we included more results the site would be too slow.',NULL,NULL,'2011-10-31 11:41:09',1),(7281,7201,231,'Thanks for the positive feedback.  I will make sure the teams are aware.\r\n\r\nOrla Metcalfe',NULL,NULL,'2011-10-31 11:41:24',1),(7291,7521,2632,'It shouldn\'t be possible to get Simon\'s results from running a search accross HMRC form the main search box. Can you please provide an example search term that led to this?',NULL,NULL,'2011-10-31 11:43:57',1),(7301,7531,2632,'We have looked at this concept a number of times and continue to monitor it. We don\'t allow indefinite storage in \'My Documents\' because of capacity/content limitations.',NULL,NULL,'2011-10-31 11:45:47',1),(7311,7611,2892,'Exxcellent feedback - thank-you for passing this on. The customer will no doubt also be interested in our new Employment Tax Planning title which recently published in print and will be available online in the new year. ',NULL,NULL,'2011-10-31 13:37:23',1),(7321,7591,2912,'This was looked at when we were putting together the content for tax investigations, which is what it is primarily used for. Extensive research was carried out and the conclusion from our findings was that such information was no longer considered as important as it was. The HMRC agreed.',NULL,NULL,'2011-10-31 13:39:06',1),(7331,7561,2572,'A condensed version is being prepared so it is in the pipeline.\r\nExpected delivery to be confirmed',NULL,NULL,'2011-10-31 13:52:12',1),(7341,7551,2912,'We already sell Tax Analysts which is what the customer seems to want. In addition we are desperately looking to bring in content that examines the issues of doing business on a global level. Ideally we will start with the EU countries and expand the coverage from there. We have a few irons in the fire at the moment and hopefully one will come to fruition soon.',NULL,NULL,'2011-10-31 15:29:29',1),(7351,7251,3751,'Thanks for the suggestion. An extended set of property terms commissioned for LexisNavigator in 2011 is currently in development and I will request that a property focussed definition for Restrictive Covenant is included in the set due to be delivered back to us next month.',NULL,NULL,'2011-10-31 15:37:19',1),(7361,7621,2632,'At this stage there are no plans to add a client admin feature to TolleyLibrary. This development would be extremely time consuming and costly - usage of this feature by tax customers has historically been very low. We will continue to monitor however.',NULL,NULL,'2011-10-31 15:54:48',1),(7371,7601,421,'Simon. We are well aware of this and the situation is under ongoing review in terms of how we potentially partner with software vendors, or make our content more available to those vendors. I cannot give you any more details because of confidentiality concerns, or none that we can give to clients.  Interestingly CCH have not yet made their software talk to their Library - the only real benefit that they can currently offer is on price alone.',NULL,NULL,'2011-10-31 16:14:15',1),(7381,2361,1921,'Passed to Tracey McGovern who contacted authors.\r\nTracey has advised that while the authors can see that the topic of second marriages, stepchildren, step-parents etc requires a careful approach they note that there are a variety of approaches in their \"normal\" precedents which can be used for divorced clients. They would not normally have precedents specifically for divorced persons',NULL,NULL,'2011-10-31 16:25:48',1),(7391,4512,35,'I dont know for sure but I would assume they either made a mistake, and cannot simply change the selection, or they would like to complete the form for one spouse, and then cannot edit for the other??  It may be better that you ask the client. ',NULL,NULL,'2011-10-31 16:49:08',1),(7401,5811,1921,'Redirecting to Daniel Wright',NULL,NULL,'2011-10-31 16:49:43',1),(7411,5821,1921,'Redirecting to Daniel Wright\r\n',NULL,NULL,'2011-10-31 16:50:55',1),(7421,4112,3522,'Would need more detail about what he is searching for and which product he is looking at.  If there is a digest on the system it will be accompanied by a transcript unless it was an oral judgment, in which case the digest would have \"judgment delivered extempore\" near the top.  As I have now left the All England Reporter team suggest you contact Neneh Munu (my successor) for more detail. ',NULL,NULL,'2011-10-31 16:56:13',1),(7431,7671,371,'Hi Lynne\r\nThis is really useful feedback. As you are aware the second suite of calculators is in development at the moment. We are including a date to date calculator but at the moment it is a pretty basic one. I have forwarded this customer\'s suggestion onto the calculator development team to see if they can incorporate these ideas (they are brilliant at what they do so I am hopeful that they can). Once I have a response from them I will email the customer directly and cc you in.\r\nMany thanks for taking the time to provide me with this feedback.\r\nkind regards\r\nKaren - PSL personal injury',NULL,NULL,'2011-11-01 09:41:30',1),(7441,5981,2121,'He was talking about Simon\'s Main Works',NULL,NULL,'2011-11-01 10:01:18',1),(7451,7651,3831,'I understand from our Practical Guidance Specialists that this is a common comment. We are aware that our content is not as advanced in terms of quantity. Our roadmap is all about developing the content.\r\n\r\nHowever, we should be cautious about these users comments - when challenged it appears \"lack of depth\" or similar is sometimes a self-justification for resisting a change from PLC to us without any real foundation.',NULL,NULL,'2011-11-01 10:13:34',1),(7461,7701,3831,'Contacting colleagues to see where this sits within the LexisPSL editor, content management, developer or lawyer teams.',NULL,NULL,'2011-11-01 10:15:39',1),(7471,6541,79,'We have raised a webstar to add the search logic to the help file text within ND. At this stage i cant give an exact time when it will appear, but it is on the backlog to be done.',NULL,NULL,'2011-11-01 10:53:32',1),(7481,5851,1921,'Michelle Cannon has advised:\r\n\"I did try to push LexisSmart as mentioned in my comment but they were not interested in looking at subscribing to anything else and were already aware of the benefits that LexisSmart could give.  They were trying to say that they felt it should be as standard within the LexisLibrary without having to pay for something extra\". \r\n\r\nI will pass this feedback to AM Jonathan Campbell. No further action required',NULL,NULL,'2011-11-01 11:41:20',1),(7491,7701,3701,'Hi - Companies House responded to our query recently:\r\nThe short answer is No, but to expand on the answer, the majority of the forms on the Companies House website are set out in registrar\'s rules. This effectively means that to be \'legislatively correct\' they have to be recreated in the same format. \r\n \r\nIf (for example) by expanding section A2 of a form,  A3 was to move from page 1 to page 2, that would make the form not \'properly delivered\'  and examiners would be within their rights to reject it. \r\n \r\n(CH) did say that in reality some examiners might pass a form because they didn\'t twig the page layout had altered from the official version, but naturally you couldn\'t rely that then you submitted a form, you were going to get an examiner who didn\'t know the official layout.\r\n',NULL,NULL,'2011-11-01 11:55:20',1),(7501,5851,1921,'Email sent to David Woodward who is now looking after JC\'s accounts',NULL,NULL,'2011-11-01 11:55:21',1),(7511,7841,2822,'Needs to go to Louise Coleman in conferences',NULL,NULL,'2011-11-01 12:45:13',1),(7521,7411,61,'Thanks for your feedback.  The presentation of document pages is a 2012 concept so when we are considering the casesearch document page and writing requirements, I will feed this into the feedback. Many thanks',NULL,NULL,'2011-11-01 13:22:09',1),(7531,7401,1921,'Re-directed to Craig Rose as advised by Lisa Regan.',NULL,NULL,'2011-11-01 13:28:45',1),(7541,6951,61,'I\'m not sure why this has been assignd to me?  Its not an insight about content or product - this is of relevance to the sales force alone perhaps as a potential way to win business?',NULL,NULL,'2011-11-01 13:29:05',1),(7551,7401,141,'I dealt with this in response to a posting on Yammer a few weeks ago. As far as I am aware, Claim Forms can only be searched in hard copy at the court for payment of a fee. So the only way we could provide a pending claims service would be by having a person permanently based in the court, reading laboriously through the register of claim forms and then entering the data accordingly. There would have to be a really clear commercial demand before we could even think of creating a business case to justify such an outlay. I know that that Dan Marshall was looking at this a year or so ago from the News and Business perspective, and so I would suggest this query is directed to him. As for West, I\'m not sure they are providing this service any more, but if I\'m wrong on that please let me know. ',NULL,NULL,'2011-11-01 13:57:54',1),(7561,6891,3831,'We have noticed that this is an issue - we will be drafting a simple private company shareholders\' agreement for Commercial. There are longer-form agreements in the Corporate module of LexisPSL.',NULL,NULL,'2011-11-01 15:52:34',1),(7571,7791,2632,'This feature is being considered but is not on a roadmap for release as yet. ',NULL,NULL,'2011-11-01 16:00:06',1),(7581,7811,2632,'I need more detail here beforeI can answer. Do you have an example of the research they were conducting? For example are they talking about browsing or searching for content?',NULL,NULL,'2011-11-01 16:02:25',1),(7591,7831,2632,'Interesting feedback. The only other feedback we have had in this area was from a couple of customers who have said that 250 is too low rather than too high. Using the topic filter is an excellent suggestion. The other one would be using speech marks around a phrase to search for only that exact phrase - ie. bypassing the natural language search.',NULL,NULL,'2011-11-01 16:04:48',1),(7601,7751,421,'Andrew - We are talking to the AAT about precisely this - in fact they are trialling TolleyGuidance amongst a member group! Mark Bissett has been leading this. We\'re aware of where we may have content gaps and are looking to fill these where relevant. ',NULL,NULL,'2011-11-01 16:29:35',1),(7611,7711,421,'I\'ve passed this on to Anita, who is going up to see Abbey Tax shortly.',NULL,NULL,'2011-11-01 16:32:02',1),(7621,7731,421,'Thanks Andrew - this has been taken up with the pricing team.',NULL,NULL,'2011-11-01 16:34:26',1),(7631,7731,1921,'Redelegated as advised by Chris Boulter',NULL,NULL,'2011-11-01 16:39:43',1),(7641,7781,421,'FL Memo are a competitor of ours - how seriously do you think we should take this?',NULL,NULL,'2011-11-01 16:39:46',1),(7651,7741,1921,'Redelegated as advised by Chris Boulter',NULL,NULL,'2011-11-01 16:41:47',1),(7661,7821,421,'The new menus will be as flexible as we can make them, however, we cannot drastically reduce the price of DeVoil. There may well be a better alternative in the new world, but I suspect not at the price point he is looking to achieve. New menus to come shortly.',NULL,NULL,'2011-11-01 16:42:07',1),(7671,7851,421,'Tax Journal will be available as a bolt-on within the new menu structure which should solve this issue.',NULL,NULL,'2011-11-01 16:43:08',1),(7681,7741,3322,'It depends on the specialist services being offered.  As an example, the VAT module has outstanding international content.  Aside from the practical guidance, its a fantastic link into the library and HMRC manuals so could be a great starting point for the their research.  ',NULL,NULL,'2011-11-01 17:11:27',1),(7691,7731,3322,'Thanks - as Chris B said this has been referred to the pricing team.  Thanks Anita',NULL,NULL,'2011-11-01 17:26:19',1),(7701,6361,1921,'Redirected from Rukhsana Alam',NULL,NULL,'2011-11-01 18:35:15',1),(7711,6521,1921,'Redelegated from Alan Blanchard',NULL,NULL,'2011-11-01 18:56:48',1),(7721,6651,1921,'Email sent to Alan Blanchard',NULL,NULL,'2011-11-01 19:17:20',1),(7731,6661,1921,'Hi Simon, please give further details as requested by Dan. Thanks',NULL,NULL,'2011-11-01 19:19:15',1),(7741,6361,3831,'We have commissioned a set of practice notes on Sharia law and basic compliance for corporate and commercial transactions.\r\n\r\nI have called Richard or Helen a number of times, but have yet to reach them. I will ask for more information on what they were looking for in terms of Polish or other foreign jurisdictional information.',NULL,NULL,'2011-11-02 08:45:18',1),(7751,6521,421,'Kate - this is really very interesting, as you\'d expect. We have a project looking at what we are going to do re: continuity of an offline solution, but to my knowledge we are not looking at cancelling CDs in the short/medium term. It\'s therefore a potential opportunity for us if we message this correctly. I will speak to the person running the project and see what we can tell customers. Thanks, Chris',NULL,NULL,'2011-11-02 09:28:59',1),(7761,6651,181,'The index references at the paragraph level. Each para ref is made up of the Division plus the actual para number. So, para 1 of Div A1.1 is referenced as A1.101. Para 2 would be A1.102 etc. Divisions are referenced according to the Part they are in. So, Div A1.1 is the first Division in Part A1. Once this numbering and referencing system is understood, the index refs should make sense. We have a video to help explain this which can be downloaded shown to customers: http://community.reedelsevier.com/media/p/3468.aspx',NULL,NULL,'2011-11-02 09:39:56',1),(7771,7691,371,'Hi Lynne\r\n\r\nThanks for this feedback. We already had this idea for draft letters on our roadmap for development in 2012. We will give this fee earner a ring to discuss through his ideas.\r\n\r\nMany thanks\r\n\r\nKaren - PSL personal injury team',NULL,NULL,'2011-11-02 09:49:18',1),(7781,6451,2892,'Author\'s feedback to this comment \r\n\"There is no change of policy. It is tricky to decide what we want to include under the new rewrite legislation. Much of the material referred to below the TA 1988 provision would not normally also appear under the equivalent rewritten provision. \r\n\r\nHowever, I do take the point that it would be helpful to move some of these references across. I shall consider doing this. We are starting a major clean-up of TA 1988  removing much of the repealed material, which we have previously retained at customer request. As part of this work we can also look at the referencing.\r\n\r\nI would also mention that we have already undertaken a huge amount of work on inserting new HMRC Manual refs and also refs to Simons Taxes, which hopefully will prove useful. \r\n\r\nWe can reassure Mr Bradshaw that we shall take his comments very seriously and will act on them.\"\r\n\r\n',NULL,NULL,'2011-11-02 10:59:41',1),(7791,6731,3831,'The relevant sub-topic in Commercial has been extensively re-written, with a result that there is now only one PN this could refer to: Contract-consideration (ie a PN about the consideration as a contract law term of art). Hence this ticket has now been labelled as RESOLVED.\r\nThis has highlighted that there are 2 checklists with \"considerations\" in their title. This will shortly be amended so that there is only one.',NULL,NULL,'2011-11-02 11:12:50',1),(7801,7631,2511,'Many thanks for this feedback, which has highlighted a technical issue with the way the form had been set up in the product, which unfortunately  had not been picked up previously. This has now been resolved by our technical team and we understand that the corrected version, which will enable data entered onto the form to be saved, will be available in the product today (2 November 2011). Melanie Adams (PSL Employment)',NULL,NULL,'2011-11-02 11:31:59',1),(7811,6321,1921,'Re-delegated to Alan as advised by Lisa Regan',NULL,NULL,'2011-11-02 12:06:26',1),(7821,4862,1921,'Insight has been highlighted to Jon Scriven and the relevant practice area SMEs, Geraldine Morris and Karen O\'Sullivan.\r\n\r\nThank you',NULL,NULL,'2011-11-02 12:20:53',1),(7831,4112,1921,'Please see update below from James Wilson',NULL,NULL,'2011-11-02 12:37:45',1),(7841,6941,1921,'As advised by Dan,  I have emailed Elliot Tompkins requesting an update on this matter',NULL,NULL,'2011-11-02 13:44:02',1),(7851,6641,591,'Functionality issue passed to Clare Duggan and addressed with client.\r\n\r\nPassed content issue to Andrew Sharpe who created a new document for PSL which we sent to client. ',NULL,NULL,'2011-11-02 14:06:11',1),(7861,6771,591,'Passed to IP/IT and Commercial team.  Awaiting feedback.',NULL,NULL,'2011-11-02 14:11:55',1),(7871,6491,591,'Directed client to relevant content on PSL',NULL,NULL,'2011-11-02 14:16:32',1),(7881,6791,421,'Thanks Mark. Good competitive intel. Have joined the group myself now. Will forward to Anita and Helen to make them aware.',NULL,NULL,'2011-11-02 16:21:32',1),(7891,7121,3522,'I am no longer with the All England Reporter team - my replacement is Neneh Munu.  I would observe two things however: \r\n\r\n1.  the [2011] CSIH 61 case would not be covered by the Reporter service normally anyway\r\n\r\n2.  More to the point, CI stats show the Reporter to be far more comprehensive and quicker than Lawtel - email Hemali Patel, who will be able to provide detailed stats. ',NULL,NULL,'2011-11-02 16:29:36',1),(7901,7771,2932,'Please let the customer know we are looking to provide Doing Business guides as soon as possible and are actively commissioning in this area.',NULL,NULL,'2011-11-02 17:02:20',1),(7911,7401,1921,'Email sent to Dan Marshall to see if he has anything further to add, as per Craig\'s comments',NULL,NULL,'2011-11-02 17:08:15',1),(7921,7401,1921,'Dan Marshall has added:\r\n\r\n\"Our interest from N&B didn\'t go far I\'m afraid, it was only a speculative query.\"\r\n',NULL,NULL,'2011-11-02 17:11:58',1),(7931,7901,3322,'Thank you for this - the guidance notes do not cover every scenario so they are still required to apply the guidance to their specific fact pattern.  This is really interesting insight and I\'m going to forward it to the wider team.  Thanks',NULL,NULL,'2011-11-02 17:37:21',1),(7941,7541,59,'Hi Jude\r\nThanks for your email. Can you let me know where you found this document when browsing so I can look into this further? Where odes it sit in the topic tree?\r\nMany thanks,\r\nClare.',NULL,NULL,'2011-11-02 20:35:54',1),(7951,7921,1921,'Redelegated to Peter Maidens as advised by Clare Duggan',NULL,NULL,'2011-11-03 09:45:17',1),(7961,7681,1921,'Email sent to Orla Metcalfe, Jon Scriven, Mark Smith and Karen Watton highlighting the above feedback',NULL,NULL,'2011-11-03 10:18:33',1),(7971,8011,3711,'Hi,\r\n\r\nUnfortunately this isn\'t something we can do at the moment within the product. We do keep this functionality under review, and appreciate any feedback related to customer\'s need for this service. It would be helpful to know how often the customer uses this facility on Westlaw.\r\n\r\nThanks and best regards,\r\n\r\nDan Wright',NULL,NULL,'2011-11-03 10:58:29',1),(7981,7861,3711,'Hi,\r\n\r\nOne of the reasons why we wouldn\'t link to the British Standards is that these links could change over time. As this is third party content we would have no control over when this happened, and would not know when to update the links. Dead links would increase user frustration.\r\n\r\nThanks for the feedback!\r\n\r\nDan Wright',NULL,NULL,'2011-11-03 11:11:55',1),(7991,7571,2511,'Many thanks for this feedback. We are conscious that some of our subscribers have a cross-border practice and are already taking steps to plug the current gaps in our content on this. Overviews of employment law in Northern Ireland and Scotland are on our roadmap and should be available shortly. Also, Clare Robertson (clare.robertson@lexisnexis.co.uk, +44(0)20 7400 2755) is coordinating the potential addition of a substantial amount of comprehensive practice area specific cross-border material  across all PSL modules, as part of the PSL International module, soft-launching in December. We would expect that this will cover much of what this firm is currently obtaining via PLC. We would be reluctant to recommend any lawyer, due to the possible legal implications. However, the new material will include details of all the contributing foreign lawyers and their contact details, in effect providing a directory of foreign lawyers for the firm to use. The firm might also consider using the Martindale-Hubble directory (www.martindale.com)? Clare is looking for firms to trial PSL International, and would be pleased to hear from you if think Philipps Solicitors might be interested in participating.',NULL,NULL,'2011-11-03 11:28:46',1),(8001,7991,1921,'Re-directed, as advised by Daniel Wright',NULL,NULL,'2011-11-03 12:00:28',1),(8011,6471,1541,'We have now added a link in the toolbox to a child maintenance calculator which should cover most cases. Do let me know if you get any further feedback. ',NULL,NULL,'2011-11-03 12:12:58',1),(8021,5961,1541,'We have now added a link in the toolbox to a child maintenance calculator which should cover most cases. Do let me know if you get any further feedback. ',NULL,NULL,'2011-11-03 12:14:41',1),(8031,8031,3701,'We need to understand this need a little more so as to propose a solution - at the moment, the PDF is simply attached to an email, and there are plenty of tools withi the email client to handle this request. ',NULL,NULL,'2011-11-03 13:58:56',1),(8041,6821,3701,'A version of the TR1 with all possible clauses (35 in all) as choices - the user selects the clause which is then inserted in place on the form. It is also easy to swap this out for a different clause if needed. The clause as placed is also editable, for further modification.\r\n\r\nSent an example so that the customer can confirm if it is what is required - awaiting feedback.',NULL,NULL,'2011-11-03 14:04:08',1),(8051,6141,3701,'The 3 LSC forms that customers have been asking about are now available through SmartForms.',NULL,NULL,'2011-11-03 14:12:00',1),(8061,7971,3701,'This is a LexisSmart Forms query - delegation should be to myself or in this particular instance, Tim Wakefield.',NULL,NULL,'2011-11-03 14:14:41',1),(8071,8041,3701,'The plan is to have removed HotDocs altogether by March (Q1) 2012, although the aim is to reach that sooner. The real issue is that users need to be migrated off HotDocs and signed up for LexisSmart Forms - this is something that account managers should be actively doing (and are, as I understand it). ',NULL,NULL,'2011-11-03 14:26:14',1),(8081,8081,2321,'I am making two assumptions in replying to this query; (1) that the search was done from the search box on the front page of the product, and (2) that the search was done with the option \'Full text\' set rather than \'Title\'. A search on \"Agency Worker Regulation\" done in this way produces, for me, the following results: 2 overviews, 12 practice notes, 55 legislation results, 14 precedents and 17 update archive results. By contrast, a search on \"AWR\", using the same settings,  produces, for me, the following results: 3 practice notes, 7 precedents and 3 update archive results. Hence I am currently unable to reproduce the customer\'s experience.',NULL,NULL,'2011-11-03 17:19:10',1),(8091,4542,59,'Hi\r\n\r\nWith regards to 1, is this still an issue as we made a number of developements in palce which should have addressed any speed issues. Any details around what they are doing when it\'s slow to load and timings would be great if this is still an issue.\r\n\r\nWith regards to question 3, we are introducing a cross practice area search at the next release in Q4 2011 which will address this.\r\n\r\nMany thanks,\r\nClare.',NULL,NULL,'2011-11-03 18:30:21',1),(8101,6701,59,'Hi\r\n\r\nThanks for your feedback. Wither regards to item 1-this is a module which is being added next year which should help him. It maybe worth organising a trial in Q2 2012. At our next product release which is later this year, we will be introducing a cross practice area search subject to testing which will address item 2. With regards to 3, this is a commercial decision. We can\'t jeopardise LexisLibrary sales by including all content on LexisPSL.\r\n\r\nHope this helps,\r\nClare.',NULL,NULL,'2011-11-03 18:37:56',1),(8111,6801,59,'Hi\r\n\r\nThanks for your feedback. We are currently undertaking a research project with a view to redesigning LexisPSL in 2012 so we can certainly monitor this feedback and see whether there is a overall user need for this facility.\r\n\r\nKind regards,\r\n\r\nClare.',NULL,NULL,'2011-11-03 18:40:22',1),(8121,7301,59,'Hi\r\n\r\nThanks for your feedback. We are currently undertaking a research project with a view to redesigning LexisPSL next year and this item is being looked at by the Content Solutions team to see what the possibilities are and reviewing the customer needs.\r\n\r\nPlease continue to feed back any similar requests for such functionality.\r\n\r\nThanks,\r\nClare.',NULL,NULL,'2011-11-03 18:42:42',1),(8131,8071,61,'The Green Book does not have annotations, only Halsburys Laws has annotations online. Perhaps its best we contact the customer directly to find out what the real need is?',NULL,NULL,'2011-11-04 11:04:54',1),(8141,5831,61,'This is great feedback that we\'re meeting customer needs. I\'ll be sure to let the precedents team know.',NULL,NULL,'2011-11-04 11:07:34',1),(8151,5841,61,'This is interesting as this has been discussed as a way to improve the casesearch offering. Its on our development radar and i think would be a great way to link up cases and journals providing seamless linknig between the two. Thanks',NULL,NULL,'2011-11-04 11:09:43',1),(8161,5761,61,'This is useful competitor info - most of which we are aware of.  It is also insight for sales to ensure they offer a competitive deal to Wragge .We are making strides to integrate LexisPSL and LExisLibrary more closely in 2012 to surmount the WEst/PLC hook-up. Also, PLC\'s move to PW/ID (which we use already) is probably so they can analyse usage more closely (which we do). Thanks',NULL,NULL,'2011-11-04 11:14:43',1),(8171,5811,61,'The practice area tabs are fully customisable and this should be encouraged.  We also offer the Client Admin tool., where users can create their own bespoke practice area pages for their firm.  This might be the best option for thme to pursue.',NULL,NULL,'2011-11-04 11:17:24',1),(8181,5941,61,'To be honest, we know from analytics that indexes are rarely used so I doubt that we will be adding the Harvey Index.  The search/browse functionality for Harvey (avail online now) should be enough for the   user to navigate/find the informaiton they need. ',NULL,NULL,'2011-11-04 11:22:26',1),(8191,5931,61,'We know from analytics that indexes are rarely used so its doubtful we will add the Atkins index.  The user should be able to locate the information they need using the Atkins browse page or searching the source.  Thanks',NULL,NULL,'2011-11-04 11:24:27',1),(8201,7531,66,'Thanks Dan - will we ever consider a saved search tab or element to the site, so it\'s not the document being saved but the search to bring the right document up at least? cheers, Gavin',NULL,NULL,'2011-11-04 12:38:44',1),(8211,7941,371,'Hi David\r\nThanks for this feedback. As you know the second suite of calculators is in development at the moment. The original 9 calculators are also being updated so there is scope to improve on them.\r\nThe family team use some of our calculators and they have had a request from customers that the calculators could be improved if they included a net to gross calculator as well as the net to gross one we currently have.\r\nI assume your feedback is along these lines as well?\r\nAssuming it is I have spoken to the calculator development team to see if this enhancement can be made.\r\nI will keep you posted!\r\nMany thanks\r\nKaren - PI PSL team',NULL,NULL,'2011-11-07 12:52:41',1),(8221,7871,1551,'The 2 relevant Practice notes have been updated as per customers request. Gavin please pass on thanks for the suggestion this was very useful feedback. These are popular pn\'s accordinbg to usage stats and we are always keen to improve them. ',NULL,NULL,'2011-11-07 16:51:31',1),(8231,7891,1551,'I have raised this with Clare Duggan as the ability to search for the Smart precedents is a functional issue. ',NULL,NULL,'2011-11-07 16:57:15',1),(8241,8021,59,'Hi David\r\n\r\nThanks for your feedback. IE10 is only currently available to test drive so it is not included in our test plans or compatibility agreements.\r\n\r\nWe look at browser usage each month so will continue to review this and ensure that if we have a significant number of users on any given browser, we look to test it and ensure it is compatible with LexisPSL.\r\n\r\nKind regards,\r\n\r\nClare.',NULL,NULL,'2011-11-07 19:01:47',1),(8251,8001,4011,'EF&P is a contributed work, but we endeavour to react to change and will continue to do so. We publish 17 fully revised reissue volumes a year and together with interim servicing uploaded some 36 updates onto LexisLibrary last year. In April this year, for example, we updated volume 36 containing 350 precedents to reflect the new Law Society Standard Conditions of Sale and the revised material went online the day the changes came into force. The April and October changes to various elements of employment law again went online the day they came into force. Last year the whole of EF&P was updated to reflect the changes brought in by the Perpetuities Act - nearly 500 revised precedents going live the day the changes came into force.\r\n \r\nWe are currently looking with our contributors at our current practice of drafting precedents and compiling short guides on best practice for drafting precedents for EF&P to ensure that they are presented in a clear and modern way.\r\n',NULL,NULL,'2011-11-08 11:01:32',1),(8261,8141,2321,'The practice note \'The right to be accompanied\' refers in some detail to the cases of R (G) v Governors of X School [2011] UKSC 30 and Kulkarni v Milton Keynes Hospital NHS Foundation Trust and SoS for Health [2009] IRLR 829, which are the leading authorties on this point. I would have thought that these are the cases to which the customer is referring, so I am not quite sure what else might be thought to be missing.',NULL,NULL,'2011-11-08 11:28:48',1),(8271,8201,2622,'There are a number of checklists within the product that will be moved to the appropriate tab in due course (a PSL search for \'Checklist\' will show what there is). More are planned and will be added as the additional topics are released.\r\nWhile the principle of a precedent checklist is interesting the LexisSmart product was designed to promote client/solicitor interaction at the point of instructions i.e. the Q&A format to be used face to face (or online) and a document created there and then (or saved for future work). Where this is not possible most firms have their own instruction sheet which they have adapted to reflect the AWD and RWW questions and the fee earner has then drafted the will without secretarial involvement.',NULL,NULL,'2011-11-08 13:14:31',1),(8281,8211,2622,'These are currently being written and will be released through Q1 2012.',NULL,NULL,'2011-11-08 13:18:33',1),(8291,5901,1921,'Email sent to Tom Macdonald',NULL,NULL,'2011-11-08 14:40:22',1),(8301,5721,1921,'Email sent to Deirdre Wrench',NULL,NULL,'2011-11-08 15:33:27',1),(8311,8151,59,'Hi all\r\n\r\nI\'ll pick this one up. There looks to be no major conflicting meanings for SDLT, so Katy Forrester has added this into our list for acronyms etc which will get around this issue going forward. It may take a little bit of time to see this in the product as the US team are experiencing major problems updating this list.\r\n\r\nHope this helps.\r\n\r\nThanks for feeding back this suggestion.\r\n\r\nKind regards,\r\n\r\nClare.\r\n',NULL,NULL,'2011-11-08 16:21:01',1),(8321,8231,421,'Thanks Kate - this is really helpful - am forwarding to Nic, Eleanor, and Clare Marwood.',NULL,NULL,'2011-11-08 16:45:11',1),(8331,7931,2632,'Thanks Gavin - useful stuff. We do need to look at this. We have heard this from other customers. Occasionally our content does not support date ordering particularly well. We are looking at enhancements in this area, so feedback is useful.',NULL,NULL,'2011-11-08 17:53:44',1),(8341,8171,421,'I\'ve forwarded this to Stuart Allison - who will have a view on this as:\r\na) This is the small / solo market and\r\nb) Mark Bissett looks after affiliates.',NULL,NULL,'2011-11-09 10:05:12',1),(8351,8181,421,'Do you mean Qudos Consulting: http://www.qdosconsulting.com/?\r\nThey don\'t seem to have a tax online product - have you got any further information here?\r\nThanks\r\nChris',NULL,NULL,'2011-11-09 10:12:08',1),(8361,8191,421,'Thanks Kate - we\'re aware of this and looking at the index issue as part of Dan Arrowsmith\'s TolleyLibrary roadmap.',NULL,NULL,'2011-11-09 10:13:36',1),(8371,8241,2622,'Noted and will be added to roadmap.',NULL,NULL,'2011-11-09 12:24:28',1),(8381,7541,2371,'Hi Clare,\r\nIt\'s in commercial psl, IT and e-commerce, web, precedents, notices and disclaimers.\r\nKind regards,\r\nJude',NULL,NULL,'2011-11-09 14:03:01',1),(8391,4852,1921,'Issue previously responded to in August. Clare was unable to update record due to technical problems with the Tracker. I have requested update from Lynne',NULL,NULL,'2011-11-09 14:16:19',1),(8401,4852,1921,'Update received from Tom MacDonald 09:\r\n\"Ive been asking for this as well. Now we have customer feedback I think we should be able to get this through. It should be up to the customers what they put onto each of their PAPs, not us. We often get asked to make a change to enable source on PAPs which takes 48 hours each time.\r\nIll speak to the product development team tomorrow and see what we can do.\"',NULL,NULL,'2011-11-09 14:18:53',1),(8411,4852,1921,'pls disregard the previous note- refers to a different record, to be removed',NULL,NULL,'2011-11-09 14:37:37',1),(8421,5901,1921,'Response received from Tom Macdonald:\r\n\"Ive been asking for this as well. Now we have customer feedback I think we should be able to get this through. It should be up to the customers what they put onto each of their PAPs, not us. We often get asked to make a change to enable source on PAPs which takes 48 hours each time.\r\nIll speak to the product development team tomorrow and see what we can do.\"',NULL,NULL,'2011-11-09 16:18:50',1),(8431,6941,1921,'Update received from Elliot Tompkins (see att).\r\nElliot has advised that:\r\n\"We had a slight problem with the September and October issues being uploaded into the incorrect folder but Ive attached an email detailing that the original files were now up on the ftp server for the Innodata team to extract and supply\"','1320863307.msg','Insight 6941.msg','2011-11-09 18:28:50',1),(8441,7981,201,'We are working on the next batch of SmartPrecedents for property and have set up a team call to discuss and agree on the format and content.',NULL,NULL,'2011-11-10 09:15:39',1),(8451,7661,201,'Team meeting scheduled to finalise content.  Are there any specific precedents the customer would want/expect to see?',NULL,NULL,'2011-11-10 09:18:28',1),(8461,7271,201,'Yes - we have links to SDLT calculators etc under the practice note and precedents tabs, but are pitching for a new toolbox element in the next available release.',NULL,NULL,'2011-11-10 09:20:59',1),(8471,8271,351,'There is planned expansion for social housing.  I sent Phil a list of PNs and PREC for Q4 2011/Q1 2012.',NULL,NULL,'2011-11-10 09:38:40',1),(8481,7891,1551,'Clare Duggans  reply was :  \'Smart precedents do not appear in the search unless they have a corresponding flat precedent.\r\n\r\nIt was discussed that we have a flat precedent for every smart precedent  however, it was apparent relatively quickly that this was not possible  the format of the smart precedents did not lend themselves to having a corresponding flat version.\r\n\r\nI\'ll have a chat to the engineers to see if there\'s something we can do at the search end but currently this is a limitation of such content.\'\r\n',NULL,NULL,'2011-11-10 09:48:54',1),(8491,8331,2892,'I have just contacted the author and here is his response to this feedback.\r\n\"Personally I find the CCH platform more difficult to use, precisely because of the way they set things out. Perhaps I dont understand it well enough, but it always seems difficult on CCH to view more than one section at a time. On LexisLibrary there is the option to view the whole of the Part, rather than having to keep opening and closing each section individually.\r\n\r\nWorth looking at, but I would not want to change our online service to look/behave like CCHs which is clearly inferior!\"\r\n\r\nIt seems like this could be a case of personal preference. \r\n',NULL,NULL,'2011-11-11 14:38:17',1),(8501,8331,65,'I think if we added a structure like the red book, which breaks each (potentially long) part down further into individual chapters by TOPIC, this would still enable someone to load in the whole part as the tree structure would still enable this. However, it would also allow a user to look at a few sections within the part which cover a particular TOPIC area if we added a similar \'chapter structure\' within each part. The client actually showed me this in the hard copy of the red book so i could see what they meant.\r\n\r\nCould be wort asking other red book users if this is why they like the layout or whether thsi is just a one-off',NULL,NULL,'2011-11-11 15:39:21',1),(8511,8281,1541,'Many thanks for the feedback, very useful. We will add the eligibility calculator link to the useful weblinks section of the toolbox. It should be live within the next 24 hours. ',NULL,NULL,'2011-11-14 15:54:04',1),(8521,7961,1541,'Many thanks for the feedback. I have contacted PI and also taken a look at the database which does include family experts. We are investigating how to add it with the product development team and checking access rights. Will update ASAP re progress. ',NULL,NULL,'2011-11-14 15:57:50',1),(8531,2431,1921,'Discussed with Operations Manager Jackie Wilde.\r\nWe are aware of areas for improvement and will continue to develop product knowledge. Weekly calls will be occurring with Oliver Reid to review progress',NULL,NULL,'2011-11-14 16:06:54',1),(8541,4952,3472,'I\'ve taken this and put it towards the CFE guys and editorial to see if we can come up with a solution.',NULL,NULL,'2011-11-14 19:03:14',1),(8551,4942,3472,'I have put this towards the CFE guys and editorial to see if we can do anything about thsi issue',NULL,NULL,'2011-11-14 19:05:50',1),(8561,6621,3472,'only electronically created PDFs or PDFs converted using OCR (optical character recognition) can use LexisCheck.  Documents scanned in as an image cannot.',NULL,NULL,'2011-11-14 19:10:51',1),(8571,8311,3711,'Thanks for the feedback.\r\n\r\nAs you say, the clicking on the logo to return the user to the product homepage is standard behaviour for most internet based products.There is also the Start page link and the Home tab. We\'ll keep it in mind that some users need these indicators when looking at new products.\r\n\r\nThanks,\r\n\r\nDaniel Wright',NULL,NULL,'2011-11-15 09:04:00',1),(8581,8161,3711,'Hi,\r\n\r\nThanks for the feedback.\r\n\r\nThe reason why lap dancing didn\'t return the Local Government Act 1982 (Miscellaneous provisions) section is that while the Police and Crime Act 2009 amends the LGA 1982 Act, it doesn\'t amend it by adding the words \'lap dancing\'.\r\n\r\nThe search looks for the searched terms in the legislation. In this instance, the legislation only contains the terms \'lap dancing\' in the PCA 2009, not in the text of the LGA 1982. \r\n\r\nFor the user, he will need to navigate from the amending piece of legislation containing the term searched for, to the legislation that it amends.\r\n\r\nSadly, if the Parliamentary Draftsmen don\'t add the term then we cannot add it to the legislation.\r\n\r\nThanks,\r\n\r\nDaniel Wright',NULL,NULL,'2011-11-15 09:11:12',1),(8591,4172,2872,'The content on TG VAT module has continued to improve and although the content is aimed at non-VAT professionals it is no longer too basic.  It has not been designed to meet the demands of an experienced VAT professional.',NULL,NULL,'2011-11-15 09:56:55',1),(8601,8051,3711,'Hi,\r\n\r\nThanks for the feedback.\r\n\r\nThere are wordwheels on the Home page and Cases search form for cases, which should have resolved the customer\'s pain points. There is no drop down list of cases as there are around 500,000 case reports on the system. \r\n\r\nIf you talk to the customer again it would be useful to know a specific example where she\'s had this issue, or if she has noticed the suggestions that should appear after the third character she\'s entered in the case name search field.\r\n\r\nThanks,\r\n\r\nDaniel Wright',NULL,NULL,'2011-11-15 10:07:59',1),(8611,8111,1541,'We don\'t cover wardship in Family PSL as it\'s not very common and therefore not part of the \"core\" family areas however there is very good coverage in LexisLibrary. By typing \"originating summons w/10 wardship\" then clicking on the results for Forms and precedents the 5th result down is a precedent in Atkins Court Forms. By clicking on the Commentary results using the same search terms detailed analysis of Wardship can be found in all the major family loose-leafs including Clarke Hall and Morrison. Hope that helps. ',NULL,NULL,'2011-11-15 10:09:55',1),(8621,5821,3711,'Hi,\r\n\r\nThe reason why both aren\'t selected as a default is because SIs are generally named after the Acts they are made under. If both options were selected, the customer would generally get lots of results which weren\'t what they were looking for. The majority of our users are looking for Acts rather than secondary legislation, so the default was set to Acts. We will keep this under review, but usage still indicates that preference.\r\n\r\nThanks and best regards,\r\n\r\nDaniel Wright',NULL,NULL,'2011-11-15 10:12:38',1),(8631,7951,1541,'Many thanks for the feedback. We will do some customer research to assess the need for this (and speak to PI with whom we share the calculators) and if there is sufficient demand will look at costs. ',NULL,NULL,'2011-11-15 10:16:14',1),(8641,8321,2632,'- We are looking to introduce the tick boxes that allow for searching of individual parts of sources (including specific HMRC manuals) as an enhancement for next year. The challenge for us is to do this in a way does not make the table of contents difficult to use for those customers who are browse dominant. \r\n- We will check if other customers also need the option to print all in one rather than on separate pages and then add this option if it proves popular.\r\n- Again, enhanced and increased use of indexes is something that we are seriously considering for next year as we have heard this form a number of our customers.\r\n',NULL,NULL,'2011-11-15 11:14:47',1),(8651,7841,2842,'Will contatct Tim Gabbe and make him aware of all corporate focued tax conferences ',NULL,NULL,'2011-11-15 11:27:54',1),(8661,8351,2321,'(1) If the user wants fast, accurate information to provide to their caller, we would suggest that the best place to look would be in the relevant practice note rather than searching our legal updates archive for news analysis reports on specific cases, because the practice note not only provides concise advice on how the law works, but also links through to all relevant caselaw, including links to our relevant news analysis case reports, all accessible from one helpful location.\r\n(2) I agree that the results list produced on a search of our legal updates news analysis reports is not user-friendly. We adopt an invariable editorial style in all our news analysis reports whereby a mini-summary of the gist of the report is included as the first paragraph of the report. Sadly, that mini-summary is not displayed by the search results list. If the search results list instead produced (i) the headline of the report followed by (ii) that mini-summary paragraph, a user could quickly see which results were of interest. Hence this is a product development issue, not a problem with the underlying news analysis documents, which are already written in the way the user desires.',NULL,NULL,'2011-11-15 12:31:33',1),(8671,5721,1921,'Update received from Deirdre Wrench stating:\r\n\r\n\"whilst we now have a faster turn around and better data integrity on the HMRC manuals source, we are faithfully reproducing their content which includes the PDFs. We hope to be able to do this work at some point but Im afraid I dont have a timescale for you  we are currently in the process of asking the business to fund additional work related to the HMRC WebCrawler. You mention adding PDF to the HMRC Manuals but what I am referring to, and what I believe the customer is referring to is for this content to be in html format and therefore searchable. The PDFs are currently on Library.\"',NULL,NULL,'2011-11-15 13:08:27',1),(8681,8351,59,'We are currently looking at a redesign for LexisPSL in 2012 and this includes looking at results lists etc so it is useful to see this feedback and we\'ll continue to monitor our subscribers workflows from results pages.\r\nThanks,\r\nClare.',NULL,NULL,'2011-11-16 12:43:56',1),(8691,8421,1541,'Thank you for the feedback. We have had a flat version in mind for a  while, its a resourcing issue, will look into it further and see if this can be prioritised. ',NULL,NULL,'2011-11-16 14:44:10',1),(8701,7951,1541,'PI have confirmed that this calculator is in development and should be available to be added to Famiy in February 2012. ',NULL,NULL,'2011-11-16 14:48:46',1),(8711,8411,141,'I\'ve already replied to this query which initially came through to me via e-mail.',NULL,NULL,'2011-11-16 17:08:40',1),(8721,8441,1541,'Thanks for the feedback, by coincidence we have just today added a legal aid eligibility link to the useful websites section of the toolbox, should be live by tomorrow. ',NULL,NULL,'2011-11-16 17:28:37',1),(8731,8341,421,'Thanks Mark - do you need me to do anything, or can you run with this yourself?',NULL,NULL,'2011-11-17 09:21:00',1),(8741,8381,2632,'Neil - can you please send me the attachment mentioned? It might be that we have already fixed this issue and the user needs to just set-up their alerts again to get the summary. If I can see the attachement I should be able to confirm for sure.',NULL,NULL,'2011-11-17 11:54:37',1),(8751,8381,2582,'Dan - this is claire m. can you copy me into the alert you get sent as I\'ll be able to quickly tell what variant it is and where they got it from. They could be people who have not reset on Tolley library since you made the change - or they could be scheduled search alerts which don\'t have abstracts but we can get them the equivalent.',NULL,NULL,'2011-11-17 12:05:41',1),(8761,8361,421,'Thanks Andrew - this is good intel. Do you need anything particularly from me on this?',NULL,NULL,'2011-11-17 14:34:50',1),(8771,8371,421,'Andrew - great stuff! Are you planning to give this news to the rest of the sales teams?',NULL,NULL,'2011-11-17 14:36:38',1),(8781,5581,2722,'The links have now been added. ',NULL,NULL,'2011-11-17 17:53:46',1),(8791,8341,1221,'other than share with the wider tax team so they can target the customers they know take 2020 venue seminars, nope!!  i\'ll take care of the TaxAssist angle.  thanks , mark',NULL,NULL,'2011-11-18 10:36:57',1),(8801,8431,3711,'Hi,\r\n\r\nThanks for the feedback. \r\n\r\nThe index lies outside the user\'s subscrption which only covers the practice areas they subscribe to.\r\n\r\nThe index is only necessary if someone is looking over the entirety of the work, which is not something they should be doing under their subscription. Whilst the user is benefitting from being able to access certain material that is outside their subscription, it is essentially content they haven\'t paid for.\r\n\r\nIf they wish to do so, they can change their subscription to benefit from the added functionality.\r\n\r\nThanks and best regards,\r\n\r\nDaniel Wright',NULL,NULL,'2011-11-18 14:02:10',1),(8811,8401,3711,'Hi,\r\n\r\nThanks for the feedback.\r\n\r\nWe currently don\'t have any plans to add consolidated devolved legislation for Northern Ireland, but will keep the situation under review.\r\n\r\nPlease let us know if you get more requests for this.\r\n\r\nThanks and best regards,\r\n\r\nDaniel Wright',NULL,NULL,'2011-11-18 14:14:31',1),(8821,8061,3711,'Hi,\r\n\r\nThanks for the feedback.\r\n\r\nThe brackets on LexisLibrary are used to reorder the priority of connectors in searches. These are used by information professionals looking for very specific information, performing advanced searches.\r\n\r\nIf a user removes the brackets, the system will recognise the searched for term in the content.\r\n\r\nThanks and best regards,\r\n\r\nDaniel Wright\r\n\r\n',NULL,NULL,'2011-11-18 15:54:41',1),(8831,8461,421,'Hi Kate - we\'re aware of Business Link, interesting to here that it has been improved. The information on it is sourced from a third party provider - BHP - and they\'re on the list of people we\'d like to speak to in terms of how we could work together - they\'ve got some industry specific content that we might repurpose. So it is on our agenda.',NULL,NULL,'2011-11-18 16:12:55',1),(8841,8481,421,'Thanks Kate - oddly enough it was my understanding that until a couple of years ago we were behind CCH in this area. Interesting that their offering is just BTR reworked. I will get this verified, if so, we will let the broader sales team have this as part of their ammunition! Thanks\r\nChris',NULL,NULL,'2011-11-18 16:37:27',1),(8851,8491,421,'Thanks Kate - one to be aware of. We should also think about how we make mileage out of this - state that we don\'t give limited time offers etc (presuming we don\'t!)',NULL,NULL,'2011-11-18 16:42:39',1),(8861,8531,3701,'Tim Wakefield can take this further, but I would suggest that insted of allowing dragging (which I know if not simple on a website) the titles should simply wrap to the next line or two. The web team can get this done.',NULL,NULL,'2011-11-18 17:38:46',1),(8871,8521,3701,'This is a platform issue - driven by Lexis taxonomy. It is likely that the taxonomy has not been consistently applied, so we will need to discuss and find resources to revisit the several thousand records.',NULL,NULL,'2011-11-18 17:42:37',1),(8881,8121,1551,'This is a good idea and one that we had considered. It is a resourcing issue as the Practice Directions fall between editorial teams. It has been flagged up at Director level and is being looked into',NULL,NULL,'2011-11-21 11:19:31',1),(8891,8601,141,'CaseSearch isn\'t one of my products. This query should be referred to Alasdair Steer.',NULL,NULL,'2011-11-21 12:05:29',1),(8901,8601,1921,'Email sent to Alasdair Steer',NULL,NULL,'2011-11-21 12:24:50',1),(8911,8511,3701,'This is definately not correct information. All SmartForms can be saved from Reader 8.2 and higher. It would be good to understand their specific issue further.',NULL,NULL,'2011-11-21 12:36:13',1),(8921,7681,1921,'Further email sent to Orla,Jon,Mark and Karen',NULL,NULL,'2011-11-21 13:04:12',1),(8931,8611,371,'Thanks for this feedback. I think there has been a misunderstanding. We do not insist on having exclusive use any quantum cases which are submitted to us. We are happy for the firms to publish details of their quantum cases on their website and / or submit them for publication to other quantum databases. It is very common for both Kemp and us to contain the same quantum case.\r\nI hope when you have clarified the position with this firm that they will then be happy to submit their quantum cases to us. If the firm has any further queries I am happy to contact them and reassure them.\r\nHope that helps\r\nThanks\r\nKaren O\'Sullivan - PSL personal injury',NULL,NULL,'2011-11-21 14:03:40',1),(8941,8511,3701,'Hi Rachel\r\n\r\nAny chance I can speak to their IT guys. I need to know a little more about their systems. It sounds like they are using something like Worksite, and have not installed the correct versions of that system. Not able to save PDFs in their IT insfrastructure does not necessarily mean that the forms are not saveable.',NULL,NULL,'2011-11-21 14:16:53',1),(8951,8631,3701,'The Legal Services Commission forms are in general not expandable, but they should allow for text resizing - we will look into these. We have just submitted a proposal to LSC to change the way their forms work, and have completed the first of these forms - CLAIM1. This will be live in the product later today, and we will then rework the requested forms - 1 week development time needed.',NULL,NULL,'2011-11-21 16:08:18',1),(8961,8641,3701,'Although We cannot envisage why the seller\'s conveyancer name would differ in this circumstance, we can alter the form to prevent this autofill. Completion - 1 day.',NULL,NULL,'2011-11-21 16:21:03',1),(8971,8651,3701,'This is possible, but requires a great deal of scripting to differentiate letters from numbers for the calculations. Completion within 1 week.',NULL,NULL,'2011-11-21 16:24:54',1),(8981,8761,3831,'We will have to think about this. Externally-written precedents will be attributed to the author, but internal precedents are not attributed to any individual. We could state that these are written internally, but not sure what value that has, or to state what the origins of any precedent were (EF&P or otherwise). PLC do not attribute agreements to individuals, when a document is written by their internal PSL team.',NULL,NULL,'2011-11-21 17:31:47',1),(8991,8761,241,'Ben, please could you let the customer know that not all of our precedents are based on books - they may be based on our internal expert\'s knowledge of market practice, previous documents they have worked with etc. In fact the majority of precedents on the PSL platform fall into this category of internally authored precedents based on our lawyers\' expertise.\r\n\r\nCould you ask the customer why it matters what book a precedent is based on? To my knowledge much of the content we create for PSL is not available elsewhere (in fact it is oftent in response to a specific request) and so I am surprised by this assumption. Just really interested to know why it is important.',NULL,NULL,'2011-11-21 21:42:14',1),(9001,8671,2582,'This is Claire Melvin: Can we find out if they want this in the full text or the Current Awareness versions of these documents (both). Some technical background on this - at present the full text of stuff like the FRSs gets built as \"Commentary\" - which means from a segment perspective the only info you can get into the results is heading info - which comes from the tree levels. I have in the past restructured the trees of sources of this type to get more useful information visible in the results. However, what would be better would be if we had a specific style sheet for \"material\" content like the FRSs, HMRC and FSA which could support better searching/results like Agency name, FRS number. This isn\'t the first time we\'ve had this sort of feedback about this type of content',NULL,NULL,'2011-11-22 08:41:54',1),(9011,8321,101,'Please ignore this particular test alert.\r\n\r\nBest regards.\r\nHark',NULL,NULL,'2011-11-22 09:03:16',1),(9021,8601,1921,'Update received from Alasdair Steer:\r\n\"We will rectify this error asap, many thanks for letting us know.\"',NULL,NULL,'2011-11-22 09:38:33',1),(9031,8591,2632,'Hi Christine - I\'ll give you a call about this, we have a solution but it\'s easier to explain over the phone. Dan',NULL,NULL,'2011-11-22 15:08:48',1),(9041,7531,2632,'Yes we will consider it. There is copy url on the results page of course that can be used in the mean-time.',NULL,NULL,'2011-11-22 15:12:17',1),(9051,8751,4011,'We have done a lot of work improving the layout/ formatting on EF&P precedents over the last 18 months or so. This includes providing a specific word download option that includes auto-renumbering of clauses.  It is worth checking that  customers are using this download feature as occasionally they are not. That said we are aware that from time to time issues have arisen with specific precedents across the 25,000 available on EF&P and can look further at individual precedents when brought to our attention.\r\n\r\nA  guide has been prepared on Downloading and Reformatting Precedents for Word 2003 and 2007 which some customers have found helpful. I will email a copy  to the trainer.  \r\n\r\nSo far as internal automatic  referencing is concerned,  this is something that cannot be done at present with our material.  It is a feature that we will certainly  be including once our material moves into XML as opposed to Word.\r\n\r\n',NULL,NULL,'2011-11-22 15:24:06',1),(9061,8661,2632,'Thanks for the feedback - we need to see how much we get on this before we decide what to do. At the moment we don\'t have the flexibility to have a specific default book shelf dependant on what the firm specialise in. ',NULL,NULL,'2011-11-22 15:44:23',1),(9071,8681,2632,'Useful feedback - thanks. Chris Boutler and I have been disicussing this possibility. We need to do some work on further customer validation before commiting further.',NULL,NULL,'2011-11-22 15:48:23',1),(9081,3532,1921,'Update recieved from Claire Melvin:\r\nBen from my team did contact her at the time. There was more to this one that initially met the eye.\r\nAround about the same time ben called back this particular title which we had been licensing from Jordans in full text had to be removed from lexis library  because of a wider licensing dispute with that company which also impacted the Family Law Reports.\r\nWe do however, still have the title in the journals index allowing people to quickly see what has been newly published in it without having to search.',NULL,NULL,'2011-11-22 15:49:37',1),(9091,8691,2632,'We are working on a fix for this which we hope to release early in 2012.',NULL,NULL,'2011-11-22 15:49:50',1),(9101,8701,2632,'They may not prefer the results to be date ordered by default. If the user gets 250 results and we then re-order by date, the relevance of the top results might be low. Our UX research since launching the product suggests that most users would be confused by different sorting on running searches from different search forms. We will continue to monitor though.',NULL,NULL,'2011-11-22 15:53:47',1),(9111,8711,2632,'Agree that we need to investigate this. clearly, the challenge is with capacity and performance.',NULL,NULL,'2011-11-22 15:55:50',1),(9121,8721,2632,'This is consistent with some other customer feedback. We hope to introduce this option in a release next year,',NULL,NULL,'2011-11-22 15:57:30',1),(9131,8731,2632,'This would require a major change to the user interface for the product. If we are going to add a field we will first need to conduct a UX project to make sure we are not making the application more difficult to use.',NULL,NULL,'2011-11-22 16:00:16',1),(9141,4792,1921,'<updating  ownership of the record>',NULL,NULL,'2011-11-22 17:08:50',1),(9151,4382,1921,'Updating tracker records. Discussed with Tracey McGovern who advised that issues should now be resolved. Content solutions restyled a lot of the material  no further complaints have been received. See attached','1321981630.msg','4382.msg','2011-11-22 17:09:04',1),(9161,4792,1921,'updating record ownership',NULL,NULL,'2011-11-22 17:09:14',1),(9171,8801,1531,'This is a technical issue rather than a content one and I have raised it with the technical team to see how we can get around this issue.  In the meantime I am looking at whether we can provide mediation agreements from other parts of the business with the product.  These would come up on a search for Mediation Agreement.\r\n\r\nIn relation to the customers impression that we are weak on content it would be helpful to have some detail on what content they considered we should be providing as we can then factor this into the development of the product.',NULL,NULL,'2011-11-22 17:40:14',1),(9181,4852,1921,'Updating ownership',NULL,NULL,'2011-11-22 17:42:01',1),(9191,4532,1921,'Update recieved form Victoria Smith:\r\n\"We are still in the process of reworking the AWD. However we are planning to relaunch in a short period and Caroline Dhanjee in marketing knows Sarah very well, so I suggest she contacts her direct.\"',NULL,NULL,'2011-11-23 10:19:39',1),(9201,4442,2331,'this insight is now closed since this is an ongoing engagement and the broader report back in line with that engagement will follow the next meeting',NULL,NULL,'2011-11-23 16:06:52',1),(9211,8841,3831,'Noted about the presentation/print out of precedents. Clearly the look and feel/presentation of LexisPSL is being addressed. \r\n\r\nI\'ve not put this as a Roadmap issue, as it\'s not within the LexisPSL lawyers\' control, but this is being addressed.',NULL,NULL,'2011-11-24 10:03:24',1),(9221,8841,59,'To reiterate Andrew\'s point, we are implementing a redesign next year and items such as delivery will be addressed in this project. This is useful information to feed into that design work.\r\n\r\nThanks for passing it on,\r\nClare.',NULL,NULL,'2011-11-24 10:14:45',1),(9231,8621,151,'we are making a couple of changes to the basic fields that the search runs across and wil include a search tips box to explain the search function',NULL,NULL,'2011-11-24 10:25:36',1),(9241,8531,151,'This functionality already exists on the product if you hover over teh form title the full title appears in a pop up box. ',NULL,NULL,'2011-11-24 10:28:51',1),(9251,8651,3701,'This is complete, and the reworked form is available in the products',NULL,NULL,'2011-11-24 10:31:19',1),(9261,8871,59,'Hi Jon\r\n\r\nThanks for your feedback. Did you get in touch with Technical Support when this happened as I can\'t say I have ever heard of this issue before. We\'d need a lot more detail from with you or the customer as to what actually happened when they tried to log in, what their current IT system set-up is and anything else which might help us estbalish the cause so we can implement a solution if need be.\r\nI look forward to hearing from you.\r\nKind regards,\r\nClare.',NULL,NULL,'2011-11-24 10:32:37',1),(9271,8641,3701,'This form has been reworked and is available in the products',NULL,NULL,'2011-11-24 10:33:04',1),(9281,7971,151,'This is a good suggestion and we will take a look at how to implement with the product/ smartforms team.',NULL,NULL,'2011-11-24 10:33:45',1),(9291,7991,151,'This is a known issue and on the roadmap as part of the content enhancement work we will be starting in 2012 on precedents. ',NULL,NULL,'2011-11-24 10:36:25',1),(9301,8451,3701,'Within the LexisSamrt PDF forms range, the form EX160 can be found by searching for EX160. The particular PSL module need to add this in.',NULL,NULL,'2011-11-24 11:00:47',1),(9311,8391,351,'Yes, this content will be updated and expanded Q1, possibly earl Q2 2012. (budget is uncertain right now) With the changes due to the Localism Act and the potential impact on LA services, this is a key area for expansion and will take priority.',NULL,NULL,'2011-11-24 12:38:50',1),(9321,8571,351,'Whilst I can make some changes to topic/sub-topic heading - there isn\'t much room to add this in-depth information.  This issue is more related to product than content.  Perhaps Clare Duggan might have a view and response?',NULL,NULL,'2011-11-24 12:47:35',1),(9331,8391,351,'Hi David, Please do let me know if Tracy offers anything specific, as in precedents, etc, in addition to a general request for expansion. As I indicate, this is a very important area to expand - especially related to the Localism Act going into effect 1 April 2012. Cheers, Dolly',NULL,NULL,'2011-11-24 12:52:13',1),(9341,8561,351,'Expansion and updating of Social Housing content is underway, benefits issues included.  Rolling delivery - current to Q2 2012.',NULL,NULL,'2011-11-24 13:09:50',1),(9351,5881,351,'The Children\'s social care topic has been updated and new content added.  Updated customer feedback, after reviewing the changes, would be useful in case there\'s more they would want covered.',NULL,NULL,'2011-11-24 13:12:15',1),(9361,4912,351,'Social housing is in process of being updated and expanded.  Rolling schedule - current through Q2 2012 (to include some Smart precedents).  Selby is on my list to update as improvements are made.',NULL,NULL,'2011-11-24 13:20:03',1),(9371,6401,351,'re Arrangements between NHS bodies and local authorities - I don\'t have a current plan to include this this specific agreement, but can add it to my list for Adult social care and or the local gov\'t law section.  Earliest I could see this added is Q1/Q2 2012.',NULL,NULL,'2011-11-24 13:23:49',1),(9381,6751,351,'The new \'academies and freeschools\' sub-topic is now live with 8 PN linked with relevant legislation.  If possible, updated customer feedback would be most appreciated.',NULL,NULL,'2011-11-24 13:25:59',1),(9391,8551,351,'All of social housing is under review and being updated/expanded.  i see there is overlap on these two practice notes and will address accordingly.',NULL,NULL,'2011-11-24 13:29:00',1),(9401,8571,59,'Hi\r\nDid she give you any more detail around the sort of detail she\'d want? Is this her primary method of navigation? If you have any more detail you could provide, it might help me to understand better what she is trying to do here.\r\nMany thanks,\r\nClare.',NULL,NULL,'2011-11-24 13:33:58',1),(9411,8501,351,'Paul, I\'m investigating with my highways specialist author.  At first blush, gating/stopping up has some overlap.  Will contact customer when I have a better feel for this area.  I\'m already in discussion about expanding highways anyway.  Maybe room for a few more precedents!',NULL,NULL,'2011-11-24 14:02:53',1),(9421,6761,351,'I\'m in process of adding more precedents to the list to be Smartified.  These sections are on my radar.  I will update as soon as I know more.  Also, I\'m working to expand the highways topic in general.',NULL,NULL,'2011-11-24 14:07:32',1),(9431,8871,3621,'Hi Clare\r\n\r\nYes, and also Russell Green, my line manager. The same thing also happened at another Library customer called Aecom Design. What happens is you try and log on to PSl and you just get the PSL placeholder icon with a hyperlink which directs you into the LN marketing website. When I mentioned it to Russell he thought it was something to do with the customer\'s level of security but it was strange that Library would work but PSL wouldn\'t. i am re-visiting Nexus next Thursday so I will ask them what IT changes they made as i understand their PSL trial sub now works. \r\nRegards\r\nJonathan',NULL,NULL,'2011-11-24 17:28:43',1),(9441,8811,1921,'Redelegated as advised by Clare Duggan. Email sent to Malcom Skinner, Jon Scriven and Lisa Karkeek',NULL,NULL,'2011-11-24 17:59:15',1),(9451,8801,28,'They considered we are weak on mediation agreements as they could not find any results. This comment was more around how they feel when they cant find the content by searhing. If they get now results their perception is that we are weak on content. That is why it is important to fix the search links when we do have content there.',NULL,NULL,'2011-11-25 09:46:50',1),(9461,8771,421,'Thanks Sam - I\'ll let the various teams know.',NULL,NULL,'2011-11-25 11:30:42',1),(9471,8861,421,'Please re-delegate to Alan Blanchard.',NULL,NULL,'2011-11-25 11:41:21',1),(9481,4902,61,'Ipsa loquitor is a legal term if you will but a legal term for the purpose of LexisNavigator is a legal term (topic really) which has supporting cases, legislation and commentary which discuss it.  \"Ipsa loquitor\" is legal parlance commonly used but which is not a topic.  Does that make sense? There wont be supporting case law, legislation for it. Best regards ',NULL,NULL,'2011-11-25 12:18:36',1),(9491,4902,3751,'Hi, Just to let you know that Res Ipsa Loquitor is now available as a legal term in the LexisNavigator source and includes links to supporting content. Many thank s for the suggestion. Katy',NULL,NULL,'2011-11-25 12:33:31',1),(9501,8571,1921,'Please see update below from Clare Duggan',NULL,NULL,'2011-11-25 13:16:46',1),(9511,8851,2632,'Ability to right click and open multiple windows is being added early in 2012.',NULL,NULL,'2011-11-25 13:23:15',1),(9521,8881,2632,'This an interesting point  thanks for providing the examples.\r\n\r\nWhen users search across the main search box, we are doing quite a lot of filtering to give them good tax results. This is why we had to add the search legal and tax tick box on the main form. There could be an argument for having a similar box on the legi search form, but we might be making the UI too complex. Of course, the users can use the bookshelf to run the search that you mention below (they could add the company law handbook and Yellow for example). We will continue to look at this.\r\n\r\nWe are adding the ability to put in multiple keyword filters in the next release  (early next year)\r\n\r\nIll forward the typos on to the editorial team.\r\n\r\nIm surprised they are saying they do not want to move over if these are the only issues?\r\n',NULL,NULL,'2011-11-25 13:42:51',1),(9531,8541,351,'Noted.  Will see how quickly I can get this covered.',NULL,NULL,'2011-11-25 14:28:51',1),(9541,8811,2622,'There sems to be confusion on terminology. Charities is a topic within the PC PSL practice area. The charity documents that have been found will have been practice notes with the Law of Trusts topic, Charities sub-topic. As from 25/11/11 there is a full Charities topic live with a number of practice notes. Stone King were asked to assist with the production of practice notes as their pre-eminence in the field was recognised but, unfortunately, they declined. It is hoped that they will change their mind so that we can work together on what is an important area.',NULL,NULL,'2011-11-25 16:12:44',1),(9551,4892,1921,'Emailed Ronen.  Response received stating:\r\n\"No further action is needed.  The client wanted to see commentary about the specific case as it involved them.\"\r\n\r\n',NULL,NULL,'2011-11-25 16:31:39',1),(9561,8911,2371,'As an addition to this I\'ve just re-read my notes and the customer also said that chronic pain is different to chronic pain syndrome and there seemed to be confusion with this in the search engine.',NULL,NULL,'2011-11-28 14:21:12',1),(9571,8581,80,'I\'d like to be able to go back to the client with some sort of response about this, can we say we will look at ammending the link to go to Dishonest rather than Dishonesty?',NULL,NULL,'2011-12-01 10:45:19',1),(9581,8571,80,'Hi, I\'m sure there\'s any more detail I can add unfortunately. I suppose I just wanted to log the fact that not everyone likes browsing via general topic headings and that this lawyer wanted a very detailed book type index as her preference.',NULL,NULL,'2011-12-01 10:46:45',1),(9591,8981,1061,'Hi,\r\n\r\nOur Content Solutions team is currently in the process of developing the capability for dynamic cross-references which will provide this functionailty in LexisPSL precedents. This is expected to be implemented in early next year. \r\n\r\nRegards\r\nJen Lucas',NULL,NULL,'2011-12-01 10:57:56',1),(9601,8901,59,'Hi Jude\r\n\r\nFirms need the additional menu LEGM56 in order to access these forms. This is down to licensing reasons which I\'m sure Malcolm Dowden or Tim Wakefield could explain in more detail if required.\r\n\r\nHope this helps,\r\nClare.',NULL,NULL,'2011-12-01 14:17:24',1),(9611,9071,3711,'Hi,\r\n\r\nThanks for the feedback!\r\n\r\nThe issue in relation to the pre-selection of legislation type lies in user expectation. The majority of user are looking for Acts over SIs - and hence the reason why Acts are preselected - but we can certainly look into pre-selecting both. The potentially troublesome result of doing so is the number of results that users will then return, even if they\'re just looking for an Act.\r\n\r\nThanks,\r\n\r\nDaniel Wright',NULL,NULL,'2011-12-01 15:09:43',1),(9621,9061,3711,'Hi,\r\n\r\nThanks for the feedback!\r\n\r\nThe Historical Versions form already contains 12 fields, and we haven\'t had this particular request before. If you get the chance to ask any other users about the issue of needing to give further information in relation to the request, could you please let us know and we can review whether it is a field we need to add?\r\n\r\nThanks and best regards,\r\n\r\nDaniel Wright',NULL,NULL,'2011-12-01 15:13:18',1),(9631,8951,3711,'Hi,\r\n\r\nThanks for the feedback. \r\n\r\nDid the customer specifically mention the West/PLC hookup as being the draw? From the comments you\'ve shared it seems the real hook was PLC entrenchment within the firm - did they specifically mention the collaboration?\r\n\r\nThanks again, it\'s a good example of customer\'s perception of the service.\r\n\r\nThanks and best regards,\r\n\r\nDaniel Wright',NULL,NULL,'2011-12-01 15:57:35',1),(9641,8921,3831,'I will contact Jennifer. On the LN Way of Selling course at the moment, so will look to do this Monday.',NULL,NULL,'2011-12-01 17:13:27',1),(9651,9011,1151,' Tolley\'s Tax Guide 2011-12 by Claire Hayes, Ruth Newman, Arnold Homer and Rita Burrows (Hardcover - 16 Aug 2011) \r\nBuy new: 77.95 65.14 \r\n\r\n17 new from 47.99 3 used from 44.70 \r\n\r\nGet it by Saturday, Dec 3 if you order in the next 8 hours and choose express delivery.\r\n (1)Eligible for FREE Super Saver Delivery. \r\n',NULL,NULL,'2011-12-02 09:06:55',1),(9661,9031,1541,'Really pleased to see this feedback as we are actually just in the middle of doing exactly what this customer wants! The Children main topic will be split into Private Children and Public Children to make the allocation of subtopics clearer. This follows a large recent expansion of the Public Children content. We would have done the split earlier but had to await the PAM changes, now that is in place the split should be complete by very early next week. Do let me know if the customer has any comments on it. ',NULL,NULL,'2011-12-02 09:49:16',1),(9671,8941,1921,'Redelegated as advised by Chris Boulter',NULL,NULL,'2011-12-02 12:15:57',1),(9681,8951,3601,'Hi Daniel,The fact that the team preferred PLC was a major factor in the client cancelling their subs with LexisNexis. However, the customer did state that the fact that PLC had offered them a deal whereby they could access directly more indepth content in particular Civil procedures through the PLC/Westlaw link made it a like for like deal and mitigated our big USP.',NULL,NULL,'2011-12-02 13:52:28',1),(9691,8581,3751,'Hi, we will certainly look at amending this link to lead to the WPLD entry for Dishonest in preference. It is the case that  WPLD covers Australia, Canada and New Zealand entries in addition to the UK. In the \'Dishonesty\' entry I see the caselaw cited in the Australian case is in fact to the relevant English cases. However, the Dishonest entry is also relevant so this is an editorial judgment call. Thanks for the feedback. Katy',NULL,NULL,'2011-12-02 16:39:48',1),(9701,4352,3711,'Hi,\r\n\r\nFollowing some work from Editorial - these links should now be all hyperlinked and users can link to the relevant precedent document cited.\r\n\r\nThanks and best regards,\r\n\r\nDaniel Wright\r\n',NULL,NULL,'2011-12-05 07:29:21',1),(9711,6321,181,'Commentary on housing is contained in Butterworths Property Law Service and Hill & Redmans Law of Landlord and Tenant. There is a full Halsbury volume and Stair title on Housing; also related commentary in Social Services and Landlord and Tenant in Halsbury;  Social Security/Social Care in Stair. Housing cases:\r\n\r\n	Estates Gazette Law Reports\r\n	All England Reporter\r\n	All England Official Transcripts (1997-2008)\r\n	Judgments (2008 onwards)\r\n\r\nThe most important housing cases can also be found in the All England Law Reports and ICLR Law Reports sources.\r\n\r\nOn the legislation side, case notes for the Rent Act 1977 and all the Housing Acts can now be found on the Halsburys Annotations source. These notes, which display alongside the legislative text, provide short summaries of judicial decisions on the meaning and effect of the statutory provisions. By integrating the text of the provisions with the cases construing them, these notes largely dispense with the need to search for cases on the judicial interpretation of the provisions.\r\n\r\nPlus housing forms and precedents can be found in EF&P. \r\n',NULL,NULL,'2011-12-05 10:55:25',1),(9721,3342,3691,'Hi, \r\n\r\nI have been in touch with Ollie directly on this when it was raised in May - this has been dealt with.\r\n\r\nThanks,\r\nCaryn',NULL,NULL,'2011-12-05 11:38:13',1),(9731,4772,801,'The issue of customer awareness of existing /new product subscriptions is being considered as part of the Online Customer Experience project, currently implemented by Emma Dickin / Anna Routledge and myself;                                                    as one of the workstreams, we are looking at the communications sent by LN to new or existing customers (both key contacts and end users), with view to improve the process of keeping them informed about the products and services they have access to; the enhanced process is due to be implemented Q1 / Q2 2012.',NULL,NULL,'2011-12-05 14:29:15',1),(9741,4962,1921,'Update received from Tom MacDonald stating:\r\n\r\n\"The British Standard Summaries are not live so we cant put them into the Trading Standards menu\"',NULL,NULL,'2011-12-05 14:45:37',1),(9751,9101,1921,'Forwarded to Alan Blanchard, as advised by Chris Boulter',NULL,NULL,'2011-12-05 15:12:58',1),(9752,7481,4064,'test comment',NULL,NULL,'2011-12-15 14:58:52',1);
